	(1,'Shanjida Sultana',2,0,NULL,'Dhaka, Dhaka',NULL,19,'As a scout we had to do a lot of community work specially when we are in camping. I did station service, cleaning up, aware people to use foot over bridge, helped police to remove traffic jam, participated in refugee camp, helped people to find out the the arsenic free tube-well. I also participated in immunisation program in the rural area. Furthermore I helped fire brigadier to rescue people from fire and arranged blood donation program. I worked to aware people about deforestation and help to arrange tree plantation program. For doing those kinds of community work I achieve an award from the honourable prime minister which is known as Shapla Cub Award and one more award from honorable president which is known as President Scouts Award .',NULL,'Building-47, Flat-11, Motijheel Colony Motijheel Dhaka',NULL,4,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/4/certification/du6eDkvhAb9GWPsDjuIhQDbrsUgu8Nd4AV2XpPc4.jpeg','Bangladeshi','11',10,9,'+8801728798477','90','2003-12-16','abonti.rusha@icloud.com',NULL,'1','1','1','+8801673537939','mustafa.bhuyan921@gmail.com','Md. Golam Mostafa Bhuyan',NULL,NULL,'Government employee',NULL,'2','2019-09-23',NULL,'Shitu',NULL,'+8801626558381',NULL,'Mst. Shahnaj Akter Beauty',NULL,NULL,'Business women',100,100,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/4/student_photo/MTtNbh2ovqZTESIXXTzNythMVOqtDUrN90561wZ8.jpeg',NULL,'1000','2','New York','Motijheel, Dhaka','Ideal School and College','2019-11-27 06:43:17','+88029330177','female',NULL,'Motijheel','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/4/marksheet_previous/WI4vzpOMTn8X8Ox2PyAsJe0LlqALPo7CLPukAxhE.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/4/marksheet_previous_two/9Rz1hiFZebw9DMEQQJ6fJuPECJHWMBuXExdu6pTW.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/4/marksheet_current/IeIoRExGLHm1KbVvUjDXQcwawv81bMmjBeymGqgg.jpeg',NULL,1,'29','Attending to 24th World Scout Jamboree',NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,'BK0400392','2021-03-07','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/4/student_passport/UHnMr97GkemfKOZRr1rN5fEs9WbuW02fwxtsbBih.jpeg','Dhaka Bangladesh',2,'7333070022',500000,2,'3733063022',500000,'Dhaka, Dhaka',1000,'Motijheel','Dr. Shahan Ara Begum','+88029330177','I have traveled to West Virginia, Philadelphia and New York in this year',2,'India for vacation and South Korea for attending to 5th International Patrol Jamboree',1,NULL,'Participating in YES program will make me youth cultural ambassador. Being an ambassador I will be able to show people my country. When they see me they will know my country through me. I want to gain this experience of being my countrys ambassador because it will help me being more experienced that I can help people in my community also I will be  more mature person and help me to take better decisions and opinions in future for myself and for other people. I want to meet new people and I want to more diverse because I want to be more open minded accept everyone the way they are. I want to go by the motto of Not better and not worse only different.','Cultural representation depends mainly on who are my audiences. If my audiences are elderly person, I have to give them a presentation on our old age tradition, if my audiences are younger people, peers or school going person I have to give them a presentation on food, currency, what we wear and about our language. I have to tell them what basically we do in our festivals. I will show them our currency. I will tell about our traditional clothing. It will be my pleasure if I tell them our languages and how different regions people talk with different languages. Our nation has various historical events I want to make them know about our nation and its history. I will cook some food items. I want to take a souvenir of our country such as- Clay doll, Mini Rickshaw. I will show them some photos on our historical Saheed Minar, National Mausoleum etc. Our country has diverse culture.I will show my hospitality to them. Though these presentation I will show them a abstract view of our culture.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-13','2019-11-13',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/4/school_seal/eKvlJRQcE0OFyjmDzEdionQb5g8dFTIDMuDL0hUj.jpeg'),
	(2,'Mohammad',2,0,NULL,'Chattogram, Chattogram',NULL,19,'It is the duty of a citizen to do social work.  A country moves forward when the people of that country do various kinds of service to themselves as well as the community.  Therefore, we should participate in various types of social work.  And I was fortunate to be able to be involved with societies and service organizations like Bangladesh Scouts from an early age.  Through this organization I have participated in various social activities such as distribution of relief to helpless people during disasters, planting programs, clearing roads, building bamboo mounds or bridges.  So I want to join USA and join such a social organization.',NULL,'Chandgaon, Bahaddarhat, Chattogram',NULL,6,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/6/certification/PySTjGFn3dewLxf3KfLchv37C1dBN7YsYGHr3N1Q.jpeg','Bangladesh','10',8,9,'+8801872302464','80','2004-01-10','mohammadfarhad64@gmail.com','https://facebook/mohammadfarhad2464','1','1','1',NULL,NULL,'Mohammad Jakaria',NULL,NULL,NULL,NULL,'1',NULL,NULL,'Farhad',NULL,'01875232882','mohammadfarhad464@yahoo.com','Nazma Akter',NULL,NULL,'Service Holder',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/6/student_photo/pnIDawMw1AUPVSOxUvnlFnLIKml3LnuoapyoGt48.jpeg',NULL,'4212','1',NULL,'Chandgaon, Bahaddarhat, Chattogram','Chandgaon NMC Model High School','2019-11-27 06:43:17','031-651104','male',NULL,'Chandgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/6/marksheet_previous/dy3a0qyaRrZTwnk1vikeMYOPy94XZaMhOVzTLcxu.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/6/marksheet_previous_two/HZzFgIVNbxb1ciNaozpVdSIoO942lSKCzdqMbq5C.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/6/marksheet_current/pCjmWHDvBELPPsI9q0NrHEQxd4R7D23hT8JUla6m.jpeg',NULL,2,'20','Scouting Program',NULL,NULL,'2019-11-27 07:44:30',NULL,1,1,NULL,NULL,'BX0974615','2023-11-19','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/6/student_passport/s7xXJyutvxcBffijIk6AkZntRfk4CUxJlSd0VBxk.jpeg','Chattogram',1,NULL,-1,2,'1591904277436',10000,'Chattogram, Chattogram',4212,'Chandgaon','Nurul Haq Siddique','031-651104','West Virginia, 3 months ago',1,NULL,1,NULL,'I have a strong passion for the English language, literature and culture.  From an early age I have been trying to get to know the US countries and their culture.  Their history, heritage, thoughts have amazed me.  So I want to know more about them from that country.  Besides, I also want to know about their country\'s rules and constitution.  However, the destiny is from the Creator.  But the effort is mine.','Bangladesh is a country rich in history and heritage since ancient times.  People of this country have been exploited by various castes since then.  So there are many different types, languages, traditions, cultures mixed with our culture. We will introduce them to the costumes, the variety of languages and the people who have been living in this country ever since.  Besides, I will also tell them the variety of Bengali language. I will do my best to highlight these cultures, histories among them.  Moreover, I will try to highlight the diverse nation that is Bengali.  Moreover, I want them to know how communal the Bengali nation is.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-11','2019-11-11',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/6/school_seal/x47iWNrLnHElUG2kHYAzogAzyuM2XT1BBvCrfaeN.jpeg'),
	(3,'Kayeef Bin',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have participated as a organiser as well as a volunteer in some of the social service related events. I hold the position of head of management in the organization humanity which deals with helping the poor people. I have volunteered in a number of social service related events like scars and illuminate. If I say about the future then I have a plan with some of my friends to arrange a seminar where we will hire a freelancer and teach the poor people freelancing where they will sign a contract that they will work for us for a limited time. The money which we will get will be used in social service related work. By this we can help more people and the poor people will also be benefited as they will get a income source. The present world can be more developed if everyone comes forward in case of social service related work.',NULL,'Dhaka',NULL,7,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/7/certification/7BP5REGe2iY4VwafV6fGkTHOsjkljRCxA2YUGOhq.jpeg','Bangladeshi','11',10,9,'01873602989','70','2004-04-30','ifazkayeef@gmail.com','https://www.facebook.com/kayeef.ifaz','1','1','1','01711393695','shahnowazmdiqbal@gmail.com','Shahnowaz Md Iqbal',NULL,NULL,'Businessman',NULL,'1',NULL,'https://instagram.com/kayeefbinifaz?igshid=tz9b0cgl88oj','Shahnowaz',NULL,'01715602989','fidabinshahnowaz@gmail.com','Shahida Alam',NULL,NULL,'Unemployed',78,75,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/7/student_photo/kRRdoIqjiMmEzXKHzztRPNl3Ehz3j1GvZmb90XyE.jpeg',NULL,'1229','1',NULL,'Sector-6,Uttara, Dhaka','Rajuk Uttara Model College','2019-11-27 06:43:17','0258952780','male',NULL,'Nikunja','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/7/marksheet_previous/hwze16JRLRWqDpZqUUkTa03SFnalhkCXbKr7PXQc.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/7/marksheet_previous_two/fbh5K0sV9wNuwnPCREfnuLXiL6V2iyN5p3ux9kz0.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/7/marksheet_current/2EAh2Ci0tfchqMjIEvxPLatbVwHjIoA3DJpJP3me.jpeg','N/A',1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,'No, I don\'t hold any.','No, I don\'t have any disability.','BRO742482','2023-02-12','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/7/student_passport/meUeKDG6TKujsqPFCCJ4wsa7A5JDkvqrQj1RHJZi.jpeg','Chattogram',2,'2222404330897',1200000,2,'2222404330894',-1,'Dhaka, Dhaka',1230,'Uttara','Brig.Kazi Shawkat Alam','0258952780',NULL,2,'India for summer vacation',1,NULL,'I love to participate in events and gather new experiences. I want to explore the world and be independent. As being a patriotic person I want to do something for my country. I want to represent my country in the international level. And I think Yes program is giving a amazing opportunity. It is the perfect platform to showcase my talent. Being able to represent my country in the International level will be a remarkable achievement for me and I don\'t want to miss this opportunity. I want to work with full effort and became a perfect Alumni if given the opportunity.','Bangladesh is an developing country. It is developing in a great manner.Bangladesh is a Muslim majority country. People of different religion stay here unitedly. Most of the people speak in Bangla. The Bangladeshi people mostly like to eat fish. Most of people around the world know Bangladesh for the sports Cricket. It is a cricket loving nation and the Bangladesh Cricket team is improving in a great way. The most eye-catching thing of the history of Bangladesh is that the students sacrificed their life for the mother language Bangla. That\'s why 21st February is considered as the International Mother Language Day. The power of Bangladesh is it\'s unity. The different protests of student\'s are really remarkable. Sadly there have been a lot of problems and controversies in our country but the students unitedly protested against them courageously. Bangladeshi culture is so amazing that it cannot simply be explained in words.',1,'A YES Alumni Member',NULL,2,'2019-10-15','2019-10-14',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/7/school_seal/5Vc48EILuTarq9Bkr7Sdz6twfCBYRQWkJJmr4uPx.jpeg'),
	(4,'Farhan',2,0,NULL,'Dhaka, Dhaka',NULL,19,'In January till March, 2019 I did a training program organised by Bangladesh Youth Leadership Center and the program was Building Bridges Through Leadership Training Junior. Here, at first, I learnt what is leadership, how to work in a team with people of diverse backgrounds, public speaking and on the last week, improvise all we learnt during the whole month.\r\n\r\nAll of us gathered in teams went on to serve the underprivileged for three days on the last week. I, along with my team worked in a school with 50 underprivileged children and taught them classroom etiquette by describing and acting it to them and how to be respectful to others. Consequently, my team and I gifted the children stickers, pencils, sharpeners, erasers and chart papers which made them extremely happy. \r\n\r\nOn the last day of the program, we presented our project consisting of the summary of the three days and thankfully, we received appreciation from the whole class including all the facilitators and instructors.',NULL,'Flat D2, House 29, Nabonir Govt. Residence, Khiljee Road',NULL,12,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/12/certification/wsgzGEask6zgV6i0XHcaP3rURCuSfIRb1a1WE6PP.jpeg','Bangladesh','10',9,8,'+8801726628451','1','2004-08-19','farhanishraq69@gmail.com','https://www.facebook.com/furanishraq','1','1','1','N/A','hasanrokibul@yahoo.com','Late. Mohammad Rokibul Hasan',NULL,NULL,'N/A',NULL,'1',NULL,'@furanishraq','Ishraq',NULL,'+8801726628451','gulejannatjenny@gmail.com','Gul-E-Jannat',NULL,NULL,'Service Holder',73,81,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/12/student_photo/OrbmZe7ACvxtJGc5bGxaJ4EtJ6yp4mNc2LuNawBt.jpeg',NULL,'1207','2','New York','House #60/A, Road #27 (16 New), Dhanmondi, Dhaka','Cardiff International School Dhaka','2019-11-27 06:43:17','+8801990778456','male',NULL,'Shyamoli','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/12/marksheet_previous/QDaveNInTSlQTdzgQU3xrBS5kOf2CBCbJSG97GWi.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/12/marksheet_previous_two/PV72aRZeegDufjCLjGXSUQcyj3pCzrKBxpSyY5B7.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/12/marksheet_current/iblrJSPbNHKbbpGude8nO2b8j6Df47X634HhSAH2.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',1,'N/A',-1,2,'6881777079',360000,'Dhaka, Dhaka',1209,'Dhanmondi','Ayesha S. Chowndhury','+8801675744780',NULL,1,NULL,1,NULL,'Apart from just gaining information about the other countries from internet, it is also one of my dream to experience countries itself by travelling to those countries and experience its traditions; meet the people, visit the remarkable places and lastly, try the famous foods; one of my most desired to visit country is the USA, where I always wanted to visit from my childhood. In addition, I am also very much interested in the American education system, as they provide one of the most quality education in the whole world and amazing subjects to their school students and especially, the subject that attracts me the most is psychology. As my father died because of a heart attack last year, but the main reason being schizophrenia and hyper tension, I have decided to become a psychologist and treat people because I don\'t want any people to suffer like my dad. Nevertheless, as I haven\'t visited any country in my life due to many reasons, but I am very much eager to have the live experience.','Firstly, it would be my duty to treat the American family as my family and show them the same respect I have for my family. This is one of our main gesture, that is, to respect each other. On the other hand, I would share all the experience I got regarding the culture of my country to my American parents, the first part of culture being the traditional festivals. Before the day of the festival, for example, Pohela Baishakh, 14th April, I would go out with my family for shopping and buy clothes, for them and for me, which would be Punjabi and Saree and all of them would be yellow. On the day of festival, I would request them to wear the clothes and go out to have fun on that day, and if possible, I would try to search and take them to Bengali restaurants if there is one nearby. Moreover, I would also try my best to teach them specific Bangla sentences and words, so that they feel more free to me. Regardless, it would be great for me to have an interchange of culture with them as well.',2,'A YES Alumni Member',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/12/school_seal/pyMepKDmLUjiikIEjNzY60VX5F9t49TijkCfdDuv.jpeg'),
	(5,'Md. Rubiatul Islam',2,0,NULL,'Magura, Khulna',NULL,19,'I\'m still involved in social activities. It\'s better than the previous ones. It\'s main motto is to spread it\'s work all over the country. But for now it\'s mission exists only in our locality and named as \"Hope of Mohammadpur\". Our activities are easy, effective, fascinating and also delightful. we plant trees in the premises of educational institutions. As the students are the main future focus. We deliver speeches about the importance of planting trees, how to save them, not to cut them, the crisis nature is facing, aware them to stop using plastic products etc. In each and every class, we distribute a flower vase and a dustbin. We inspire students to draw pictures of nature on them. In exchange of these works, we claim some plastic cans from them and incinerate the cans before them.\r\nThrough this we make our students nature lover, teaches to be careful to nature, knowledge them about the benefit of nature, make them aware of duties. We help them to become a  better responsible human.',NULL,'Rajbari, Mohammadpur',NULL,15,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/15/certification/ojKg695okISzH0r4DwV4fgXdSEEXsqejLcAe9Vng.jpeg','Bangladesh','10',9,8,'+8801647279327','92','2004-12-29','mris16331@gmail.com','https://www.facebook.com/mris16331','1','1','1','+8801915515848','sharifulkarim1970@gmail.com','Md. Shariful Karim',NULL,NULL,'Senior Assistant Professor',NULL,'1',NULL,NULL,'Shuaib',NULL,'+8801735901605','rahiminakhatun1973@gmail.com','Rahimina Khatun',NULL,NULL,'Family Welfare Assistant',89,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/15/student_photo/d93s1NnPgtjAYwSum29nUOtuAG9myK60gVuh4HDq.jpeg',NULL,'7630','1',NULL,'Mohammadpur','Govt. R.S.K.H. Model High School Mohammadpur, Magura','2019-11-27 06:43:17','+8801821416894','male',NULL,'Mohammadur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/15/marksheet_previous/9wg6JqUa5yv2W2yIdTjFbCRDfVHchTvSlRv3pzMH.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/15/marksheet_previous_two/5tBzbhoKzenUA3G3TuX3Ek8y1xAhW127VHFa237L.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/15/marksheet_current/DaNwaPfK5UFWWyDTOw3A643YX3mYgt69QPTkPvkl.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Mohammadpur',2,'5516652636551',490000,2,'5516652636552',376000,'Magura, Khulna',7630,'Mohammadpur','A.K.M. Nasirul Islam','+8801821416894',NULL,1,NULL,1,NULL,'Firstly, I\'m fond of traveling, getting new experiences and like to share them. I\'ve visited many places of my country.Now, I want to taste something different.\r\nThere are different types of people irrespective of caste and creed. There are also many so good hearted persons.If I could come in contact with them! I would have learned so many great values to become a better human.\r\nI love to take leadership with responsibility. I like to take extra responsibility to become one\'s close. These feelings are great.\r\nAnd when the dignity and the status of my country will depend on my attitude, honestly and how good working I am. Then the feeling will be enough for me to give my best shot.Yes, I can feel it.\r\nI like to mix with new people, knowing a person with curiosity, learning and teaching new things.It\'s like knowing and respecting ones culture. I really feel awesome and joyful to win ones heart by my positivity.\r\nYes, I hope to remove the misunderstandings and make a bond of faith and respect.','Bengali language is a great glory for which language movement took place, thousands of people died. I\'ll share with them the brave story of the language martyrs and of the freedom fighters.I want to share  those heroic stories of 3 million people in the liberation war.\r\nThe Bengali festival goes from the first day of the year to the last day. We have two Eids, Durga Puja, Buddhist Purnima, Christmas, Baishabi and many other national festivals. I\'ll share all of my experiences practicing with these festivals.\r\nBengali clothing is attractive. We\'ve  traditional Panjabi, Pajama, Dhoti kurta, lungi Pagri etc for men and traditional sarees like Jamdani, Dhakai for women. I can give a great experience about these dresses.\r\nI can cook some Bengali dishes and hopefully will bring them closer to bengali cuisine by my cooking.\r\nI\'ll share the experiences different religions  living in same country. They would love to hear the stories of different ethnicities culture in Bangladesh like Chakma, Marma.',1,'A YES Alumni Member',NULL,2,'2019-10-24','2019-10-24',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/15/school_seal/QOQACRNCNiIlMya6zrGfklPvtIGgED1sxVO9NS1n.jpeg'),
	(6,'Dipto Rema',1,0,NULL,'Dhaka, Dhaka',NULL,19,'Participating in a social service was a big task for me.In the past,I participated in a social service which make common people conscious about climate change.In a society,If common peoples are not taking any actions to stop climate change then nothing can stop this world to turn to a disaster. So I want to make people more conscious about climate change and if we take proper actions to stop climate changing, we can turn this world in to heaven and our country will have a reputation to the other countries',NULL,'274/1 a,Jafrabad,Shangkar,Dhaka',NULL,32,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/32/certification/5SfPL2MnOXVCwplLHSJVDQedXDPz3c53yzP1UTvJ.jpeg','Bangladeshi','8',7,6,'+8801833845334','70','2004-11-20','diptomankhin112@gmail.com','https://facebook.com/iamdiptto','1','1','1','+8801933467182','dabanonda2019@gmail.com','Dabananda Mankhin',NULL,NULL,'Service Holder',NULL,'1',NULL,'@iamdiptto','Rema',NULL,'+8801992648325',NULL,'Beauty Rema',NULL,NULL,'Beautician',60,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/32/student_photo/tKqoRAhfPk9lJWK8lZo3dsMCsz9o3RJPKG5xeoXJ.jpeg',NULL,'1207','1',NULL,'West Dhanmondi, Dhaka','West Dhanmondi Yousuf High School','2019-11-27 06:43:17','+88029118512','male',NULL,'Mohammadpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/32/marksheet_previous/94WK3zqf406z7tDdXUo6JuR0LJgVpNWzdFp3sxes.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/32/marksheet_previous_two/ZNJvaYc328NJkRFkQ8E1jZVAP4QrlCiXlFb43DIu.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/32/marksheet_current/5qIEjRC82gpsVFGrDKFzhu6KI5tSSz8Jvb2QLVCE.jpeg','https://twitter.com/iamdiptto',1,NULL,NULL,NULL,NULL,'2019-11-30 07:24:57',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Mymensingh',2,'7345620939',240000,2,'9572793249',180000,'Dhaka, Dhaka',1207,'Mohammadpur','Shikdar Mohammad Jamshed Ali','+88029118512',NULL,1,NULL,1,NULL,'USA is one of my favourite country expect my own country.Going to America is a dream for me.Except learning or improving my English I want to visit and travel that beautiful country.Going to America is my dream but my parents can\'t bear the expenses to go to America, traveling or other stuff\'s. So that why I choose the K-L YES program','As Bangladeshi I will share my cuisine to my American family. In Bangladesh food culture is really important.In every Bangladeshi festival Bangladeshi food has its own flavour. Sharing my cuisine culture to my American family is one kind of making them conscious about my culture.Bangladeshi food culture has its own flavour and own identity than others.So I just want to let them know how we eat ,how we talk and how we celebrate our festivals',1,'YES Program Website',NULL,2,'2019-11-03','2019-10-31',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/32/school_seal/YqDmBgIxEjoxFPGrbDROKLKO98zCoGmAK4VMdYTe.jpeg'),
	(7,'Samrina',2,0,NULL,'Chattogram, Chattogram',NULL,19,'Actually,I don\'t have any experience of doing community service.But if I have the opportunity to do social service,I will definitely do it.I want to work for women and children welfare.There are a lot of problems prevalent in our society which are needed to be stopped and erased,such as- early marriage,dowry system,violence against women, inequality between men and women,women and child abuse,child labour,corruption etc.Public awareness is very important to solve social problems. Through community servive,I will try to raise public awareness.Raising public awareness is not telling public what to do but it explains issues and disseminates knowledge to people so that they can know about the laws of our country against crimes and also know to use them at the right time and get the criminals punished.Then,anybody will think twice before doing such a crime and the crimes may not happen anymore.I think that by doing so I can bring a specific positive change in the society.',NULL,'\"MAA\"House:352/J/7/1;Road:1,Lane:8;Ramna R/A,North Agrabad,Halishahar,Chattogram',NULL,38,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/38/certification/aAf87rXyx76b4R3Ja60tKx21MuFWQpNdtwGTWsMf.jpeg','Bangladeshi','9',8,7,'01815659494','50','2004-08-23','samrinamotaher054@gmail.com',NULL,'1','1','1','00971561347571','motaherchowdhury65@gmail.com','Motaher Hossain Chowdhury',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Motaher',NULL,'01815659494','rowshanreko71@gmail.com','Rowshan Ara',NULL,NULL,'Unemployed',70,69,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/38/student_photo/Ya5GTe9FZGFSAX085uyym48nOAQSIwFcN5skZZoR.jpeg',NULL,'4224','2','New York','L-Block Lane No.7, Halishahar H/E.  Chittagong Bangladesh','Silver Bells Kindergarten And Girls\' High School','2019-11-27 06:43:17','031 2520643','female',NULL,'Doublemooring','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/38/marksheet_previous/W2IRX7VzJdIfyZ4KqkN0Ktthgm7C0vOAXmUBegS9.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/38/marksheet_previous_two/449uj2oTWubNs7qIWFIxXF1kg10pKTvSFIW8Kylb.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/38/marksheet_current/8iB68WSn2gGlQZGYBTlHZYhfkz8PNkCxmuz0G6rN.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,'EE0138340','2024-10-04','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/38/student_passport/eLxvG1gMbUCK2rHqiFKP8L4zyZfw5D92pQXqedyo.jpeg','Chattogram',2,'5105184922',3600000,2,'3262963261',-1,'Chattogram, Chattogram',4216,'Halishahar','Mrs.Shajeda Akhter','01819556234',NULL,2,'Dubai for winter vacation',1,NULL,'I want to apply for the YES program because I want to represent my country in home and abroad.I want people all above the world to know about my homeland.I want them to be eager to visit my country and explore it so that my country can also be renowned and developed like the other countries of the world.','I want my American family to know about the traditional clothing of Bangladesh.The dress preferences in Bangladesh are unique. Bangladeshi mens casual wear in rural areas is the lungi with formal clothing being suits or shirts and trousers. On cultural and religious occasions, men have traditional wear called Panjabi. In women, the traditional and main dress is the Shari, with young females also wearing salwar kameez.I want them to know the importance of our traditional clothing.I can help them to dress up like us and celebrate our traditional days with them.I hope that by this I can help them to know  about our traditional clothing.',1,'My High School/Teacher',NULL,2,'2019-11-18','2019-11-14',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/38/school_seal/da1eY600FoyEZM7DhJ72R9CuffPbXcJopULsTcJn.jpeg'),
	(8,'Farjana Shamim',2,0,NULL,'Kushtia, Khulna',NULL,19,'My mother was a housewife before. Suddenly my father got sick and our family was no more stable. We started facing financial difficulties. Somehow  my mother found a job within 2 months and started supporting us. It was not until then that we realized the importance of women employment.\r\nI want to encourage every educated women in my area to step out and work. Unemployment rate among female graduates is about 2.5 times more than their male counterparts: 16.8 percent, according to Quarterly Labour Force Survey (QLFS) 2015-16 by Bangladesh Bureau of Statistics. I want to do a workshop in my city for the women who dont realize the importance of employment.  I also want to make the employers realize the importance of women employment. The employers must assure proper safety for women workers. Male chauvinism must be stopped and men should encourage women to step out of their home and work. I want to make sure every woman makes their own money in my community.',NULL,'Faisal Tower 7, Thanapara, Kushtia',NULL,55,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/55/certification/czfOPjTLpJSENxHkWtu7NgBScf6lKJGhHl8v5GLi.jpeg','Bangladeshi','10',9,8,'01718161304','90','2004-09-03','farjana.showme.3@gmail.com','https://www.facebook.com/farjana.03.showme','1','1','1','01798540225',NULL,'Md. Khorshed Alam',NULL,NULL,'Unemployed',NULL,'1',NULL,NULL,'Showme',NULL,'01746379240',NULL,'Mst. Shalina Khatun',NULL,NULL,'Service Holder',88,93,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/55/student_photo/mGdupRJmWblZQUBgIyc6IeJy26YrOwUqoaXwTLym.jpeg',NULL,'7000','1',NULL,'NS Road, Kushtia','Kushtia Govt. Girls\' High School, Kushtia','2019-11-27 06:43:17','+8807161929','female',NULL,'Kushtia','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/55/marksheet_previous/c3TjqgfmhFjy2kEoMS3B7P1X4Sp8KQ398vOisN3j.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/55/marksheet_previous_two/8rrrHXMBrEDi58Fxqmb4NPpmoYepbjxfUoZwQoVI.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/55/marksheet_current/DQ4S78QbB5Ez539m0hrZNxaW43eerHnCWtv2Ogd3.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Kushtia',2,'5027902109962',120000,2,'235 215 5499',180000,'Kushtia, Khulna',7000,'Kushtia','Md. Mozammel Huq','+8807161929',NULL,1,NULL,1,NULL,'The life you have led doesnt need to be the only life you have  Anna Quindlen. This line changed my vision towards life. Now I strongly believe we can always reinvent ourselves. Thats why I always want to explore different places. I always want to travel and learn about others. Different cultures and religions attract me a lot. So when I first came to know about YES, I immediately found my new life goal. I want to apply to YES program because American culture attracts me a lot.  I want to grab the opportunity of spending a whole year in the United States and acquire practical knowledge. YES program will make me a better human being who can contribute to the society. Living with an American family for an entire year will be life changing for me. I will surely be able to learn from their culture and represent mine. This is why I cannot wait to attend the YES program.','A nation\'s culture resides in the hearts and in the soul of its people- Mahatma Gandhi. Like him, I also believe culture can be shared and enriched only by its people. Cuisine is the strongest part of our culture. Mughal cuisine, Indian cuisine and British cuisine have influenced our Bangladeshi cuisine greatly. Various spices are the biggest attraction of our cuisine. It is heard that the quest for spices encouraged the Portuguese to come to Asia. I think an American family will be amazed by our cuisine and spices. I can definitely cook them snacks and sweets that will encourage them to learn more about us.\r\nAnother important part of our culture is our Bengali language. Approximately 228 million people all over the world speak Bengali as their first language. Another 37 million people speak Bengali as a second language. I cannot wait to tell my American friends about 1952. I want to encourage Americans to learn Bengali as a second language. I really want to promote Bengali worldwide.',1,'Other','I searched in a facebook group about scholarship opportunities and came to know about YES.',2,'2019-11-12','2019-11-05',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/55/school_seal/i0d7TlFjrr9atl83iSZTZvqfNkMjFwqQRF4ceIi7.jpeg'),
	(9,'Mofizul Islam Evan',2,0,NULL,'Narayanganj, Dhaka',NULL,19,'Social service is a great thing to all of us. If anyone get to know something, he/she should make others know about that thing. It is our social duty. I didn\'t get chance of something like this. But in which programs I have attended, I always told my friends about the incidents or something which were new to me. I want to know something to serve it to others properly. If I get a chance to participate in the YES program, I will be always ready to share what I learned in that. I would arrange discussion meeting in many schools and obviously in my school. I have also a plan to join the YES program activists when I come from USA. I want to learn something which would be used for the welfare of my country, my nation and my society. I can give the surety that I would do my best to serve my country with what I got and would get. I would inspire our youth to serve the country. At last, I want to say that I can bring a change.',NULL,'3,H.K.Banarjee Road ,Amlapara,Narayanganj',NULL,69,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/69/certification/yl7XonHEsr2DB1aqHQWDxJhED61em7z9QTsoyGx1.jpeg','Bangladesh','9',8,7,'01913567165','78','2005-07-15','thephenomenalory21@gmail.com',NULL,'1','1','1','01912353343','mmkamal1111@gmail.com','Mohammad Mostofa Kamal',NULL,NULL,'Banker',NULL,'1',NULL,NULL,'Evan',NULL,'01913567165',NULL,'Khadiza Akter',NULL,NULL,'Teacher',84,83,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/69/student_photo/jECLJaF2d9L6l2TQon9YFQmrVObeiBnoCoSLyxPK.jpeg',NULL,'1400','1',NULL,'47 K.B.Saha Road ,Amlapara,Narayanganj','Narayanganj Ideal School','2019-11-27 06:43:17','7648681','male',NULL,'Narayanganj Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/69/marksheet_previous/1PGj5jozlbiNpW1y4mXjedyAEHEWFYl5zpueB9qg.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/69/marksheet_previous_two/T3MTA4Gl0pctC4ZzFEOnTho5EnJxPoOuIRhKpVhM.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/69/marksheet_current/gYvuWd6MBvCS5m35yFkgOE5A8mnKmP7kUAiCbRrz.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Sonargoan,Narayanganj',2,'1949847519',60000,2,'9152751054',19500,'Narayanganj, Dhaka',1400,'Narayanganj Sadar','Anowar Hossain','7644306',NULL,1,NULL,1,NULL,'I want to apply for the YES program because I want to know and learn something and to do something good for my country by using that knowledge.Besides, I have an inborn attraction for robots since I saw the movie named \"TRANSFORMERS\" . From then, I desired to make a robot of my own. It\'s one of my most wanted passion. When I got into Class 8, I started to learn  coding. But that year, I had to sit for JSC exam. For that I could not be able to complete it. When the exam had finished, I started learning again. Promoting to class 9, Isaw the world full of knowledge.But I was determined to learn about robotics.One day,I saw in our school\'s notice board that our school is becoming a host of a program called \'YES Activation Programme\'. I registered in that program instantly.Those who came to train us had got the opportunity to go to USA.They shared their experience with us. I was fully determined to go there.After all,I want to learn something which can be used for the welfare of my country.','The culture of a society means the way of living, eating habit, cultural functions, clothes, language, religion, values, policies, tradition etc. I think I can present it to the American family with whom I would live very sowbelly. I can present it to the family with my own sleight. I hope they would like it if it is set forth to them properly. \r\nWe have our own cultural elements like the way of living, eating habit, clothes etc. I can share our sacrifices during Liberation War in 1971. Similarly, we have our own food habits like rice and fish. I can give them an account of tasting our own recipe. Besides, we have our own dresses like punjabi, saree and blouse. I can inform about our handmade dresses which are really comfortable and made with only yearn. In our country, the main religion is muslim. I can make them know about our Prophet Hazrat Muhammad (Sm). Over and above, there is a lot of things to share with them. Concededly, I will share my culture with them.',1,'My High School/Teacher',NULL,2,'2019-11-02','2019-10-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/69/school_seal/q272NyqIYSKc0YabDpSxDdAKmoOhqP2FXUdRBYnk.jpeg'),
	(10,'Sarika',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Future community service: Despite apocalyptic warnings of upcoming climate change, the heartfelt efforts of climate and environmental activists around the world have done very little on an average to the looming threat. This is why I would join my school\'s community service club to raise funding for local energy innovators which will allow new, innovative commercial technologies to get off the ground.',NULL,'81/6, Indira Road, P.S.: Sher-E-Bangla Nagar, Dhaka - 1215.',NULL,88,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/88/certification/LDf0d9STRPbIxvnpJhaj8YmrFjZWJzbGMdr4cE9r.jpeg','Bangladeshi','8',7,6,'+8801712655565','90','2005-06-19','sarikasaiyara19@gmail.com','https://www.facebook.com/sarika.saiyara','1','1','1','+8801717058833','siddique.islam@gmail.com','Siddique Islam',NULL,NULL,'Journalist',NULL,'1',NULL,'https://www.instagram.com/sarikasaiyara/','Saiyara',NULL,'+8801712655565','arfinnegar11@gmail.com','Arfin Negar',NULL,NULL,'Journalist',96,98,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/88/student_photo/zBbIlupjCe33vF0RTt0FjQ3BNR6HVlk66FEuZWKo.jpeg',NULL,'1215','1',NULL,'House # 6/10, Block # F, Lalmatia, Dhaka-1207, Bangladesh.','Academia School Dhaka','2019-11-27 06:43:17','+8801717363444','female',NULL,'Sher-E-Bangla Nagar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/88/marksheet_previous/Si5dDPLwtohX3eKoSf50OZil0TTeBydeP7wz81QS.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/88/marksheet_previous_two/w21IcjAhYwj0hJ9CjM77EAbvERgQvW9Lp878NAgD.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/88/marksheet_current/porFgGkmYXrtHkaDiRx3w6wjfr1Vqju62ty7cyUy.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'552 938 5790',1800000,2,'372 939 4951',240000,'Dhaka, Dhaka',1207,'Mohammadpur','Raunaque Alamgir','+8801717363444',NULL,1,NULL,1,NULL,'With a voracious openness to learn and a hardworking, but smart, approach towards challenges, I live by the \"American dream\". I resonate with America\'s culture of individualism and freedom, and through this YES program, wish to live in the land where Model United Nations, my interest, commenced.','Also being a regular student of the country\'s best cultural and music school, Chhayanaut Sangeet Vidyatan, I intend to share my culture, particularly those of language and music, through small talks and family dinners. My honed skills as a classical dancer specializing in Folk, Kathak and Bharatnatyam dance forms from Nrityanchal Dance Company under the guidance of the unparalleled Bengali dancers: Shibli Mohammad and Shamim Ara Nipa will also aid me to impart knowledge of the present and ancient Bangladeshi culture. As an avid reader of history, I also tend to naturally converse upon the collective history of the Indian sub-continent and how it shaped us to be the \"Bangalees\" we are today.',2,'A YES Alumni Member',NULL,2,'2019-10-07','2019-10-06',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/88/school_seal/fYdpYSk8bZLR5wuwjejxNDKrVoTqdZW8VbVY7CeE.jpeg'),
	(11,'Tasnim Tahmida',2,0,4,'Dhaka, Dhaka',NULL,19,NULL,NULL,'19/1-J Sheikh Saheb Bazar, Dhaka',NULL,89,NULL,'Bangladesh','10',9,8,'+8801781354929','70','2004-05-24','vabnatasnim75@gmail.com',NULL,'1','1','1','+8801533515262','mdnaynulhaque508@gmail.com','Md. Naymul Haque',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Vabna',NULL,'NA',NULL,'NA',NULL,NULL,'NA',78,80,NULL,NULL,'1205','1',NULL,'101 Pilkhana Road, Dhaka','Viqarunnisa Noon School and College','2019-11-27 06:43:17','+88029333356','female',NULL,'Lalbagh',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'5957467623',-1,1,'NA',-1,'Dhaka, Dhaka',1205,'Lalbagh','Nazneen Ferdous','+8801731531550',NULL,1,NULL,1,NULL,NULL,NULL,NULL,'A Friend',NULL,NULL,'2019-11-25','2019-10-01',0,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/239/file/RzJrriWEb1nVgW9HiQJXK6p13q3J3cxHPncJk2vw.pdf',NULL),
	(12,'Badhan das utsha',2,0,NULL,'Pirojpur, Barishal',NULL,19,'This one is my most favorite sector. I am very social addicted. Whenever I get such chanches, I never loose it. I am a scout, a member of amnesty international, I did volunttering in the local hospital, I am also member of volunteering team of Bangladesh Fire Service And Civil Defense and Bangladesh Police. Here is a story-\r\nPrevious year when students come up with traffic movement the government called traffic week to bring back rule in roads all over Bangladesh. As I was a scout and a volunteering member of Bangladesh Police, I was also been called. We checked cars licence, insurance and also fitness. I would never know we have so much problem with our traffic system if I didn\'t attend it.After 3 or 4 days of this program via newspaper, I come to know that Traffic system is the most corrupted sector in Bangladesh.It changed my life\'s purpose. From then I decided to take higher education from abroad and will know about their systems.Then surely I will come back and develop every system',NULL,'Bhandaria, pirojpur',NULL,92,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/92/certification/ZEuxWXTFALLEZxLpCEUtetMXGdIYV52I2nWZQFpF.jpeg','Bangladesh','9',8,7,'01747327132','77','2005-02-17','utshadasbadhan3938@gmail.com','https://www.facebook.com/utshadas.badhan','1','1','1','01720296161',NULL,'Barun Kumar Das',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Badhan das utsha',NULL,'01747327132',NULL,'Dipti Rani Das',NULL,NULL,'Teacher',87,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/92/student_photo/QKXI0sCGpqwDLokz0lfoNYFnpI4IUgwBF3mv8xgQ.jpeg',NULL,'8550','1',NULL,'Bhandaria, pirojpur','Bhandaria vehari pilot secondary school','2019-11-27 06:43:17','01728152919','male',NULL,'Bhandaria','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/92/marksheet_previous/D7jEofGz4vyyYYjOJtgERYtb3H9cme5IB8cSOicG.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/92/marksheet_previous_two/7cFdwP5I36rmRDO3MLMykwG3nBdgVDTUSS25U2vk.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/92/marksheet_current/fxbn9HDymHNmrPLvzmGGugo68V0XU2QYTXrx0vqN.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,2,NULL,'I have a little bit eye problem',NULL,NULL,NULL,'Khulna',2,'6857472648',300000,2,'7795315840',190000,'Pirojpur, Barishal',8550,'Bhandaria','Md moniruzzaman','01728152919',NULL,1,NULL,1,NULL,'I love science and I want to learn it practically. Here we just learn to memorise all topics. So my basic becoming loose day by day. In America, I will find better teachers, better guidance and better friends. There I can learn with fun. Also I want share my culture there. That\'s why I want to apply for the YES program.','I would like to share the tradition of Bengali Clothes with my American family. By attending class wearing Panjabi, gifting my American friends Bengali traditional clothes I will do that. Also I will share my tradition by stage performance because I am a singer.',1,'A YES Alumni Member',NULL,2,'2019-11-12','2019-11-07',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/92/school_seal/MYCFpHhXCNw1iwpoekLKXCSz4VBXbWCA44y3VWMe.jpeg'),
	(13,'Sharifin',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I haven\'t been in a community service club and also never participated in one, therefore I have no experience in community service, but if I get the opportunity, I will surely participate in a community service which restricts pollution and cleans the environment. Pollution is the biggest problem in the world, all the climate change and global warming is being caused by pollution. Bangladesh is also a highly polluted country and it is getting worse eventually. By starting from our own area to eventually cleaning the whole country is my main target. If not cleaning everything, but the plastic bags for sure because these are non biodegradable and produces lots of harmful gases when burned. To accomplish the target, I would like to build a squad consisting of people who are willing to participate in the mission to reduce pollution and clean the environment for their own betterment and for the betterment of our country and ultimately the whole world.',NULL,'Azimpur New Paltan #33',NULL,93,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/93/certification/gsfRjOw4X44gCTkdlBTRM57aldGGQbtbBg47LI4H.jpeg','Bangladesh','11',10,9,'01758131715','72','2003-01-26','sharifinh72@gmail.com',NULL,'1','1','2','01715058258','tasminfarina1993@gmail.com','SM Rezaul Haque',NULL,NULL,'Business man',NULL,'1',NULL,NULL,'Hasib',NULL,'01919058258','sharifinhasib1723@gmail.com','Rubina Haque',NULL,NULL,'Unemployed',79,92,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/93/student_photo/oWMJMtGaUvL71u5iuPoeTtsDudaFxzr7eANn80Rp.jpeg',NULL,'1205','1',NULL,'Lalmatia Block D','Mangrove School','2019-11-27 06:43:17','028100819','male',NULL,'New Market','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/93/marksheet_previous/STTVYnNoeQTfUCEM6tsBl630oZJSQnTZrf4hwDuF.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/93/marksheet_previous_two/AZ0vsKep1jp28HPm0sOTFEXUAV5h26yPM2Hdjdwi.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/93/marksheet_current/0VtZAMQ0qvhDiEWioUCIwQAi4op1XhiyCw73gYT3.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'4606684860',36000000,2,'9553341521',-1,'Dhaka, Dhaka',1207,'Lalmatia','Tariq Khan','01796259584',NULL,1,NULL,2,'My older brother for the academic year 2013-2014','YES program has changed the lives of many people and I might have a different life if I apply. By applying, I will be able to make new friends, see a different culture as well as represent my own country in the United States. YES program will also give me a chance to become an independent individual. My whole life can change by applying in the YES program.','I would like to share the Bangladeshi cuisine with my family because the Bangladeshi cuisine is the completely different from the American cuisine. I would make them try our national fish, \'ilish\' in the Bangladeshi style with our traditional \'panta bhaat\'. Along with the fish and rice, I also want to feed them some mashed potato, \'alur bhorta\' because it tastes delicious with the rice. It is mostly cold in the United States, so feeding them some \'pitha\' would be a good idea too. \r\nOur desserts are also pretty different from theirs and also easier to make, but the taste is delicious. The one dessert I will make them for sure is the \'sujir halwa\'. This is the best dessert I have tasted in the wide varieties of Bangladeshi desserts. \r\nI know how to make most of the dishes like the \'alur bhorta\' and \'panta bhat\', so I just need to learn how to make the fish because it is the most important and difficult. Making the dessert is also easy and it will take just a day to learn.',1,'My Family Member',NULL,2,'2019-11-23','2019-10-01',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/93/school_seal/Cc8NVXz9PPBzuQpXRjJsKR4SPPxLU4nRSXII1pP6.jpeg'),
	(14,'Fouzia Fatima',2,0,NULL,'Chattogram, Chattogram',NULL,19,'I would like to work against \'Child Marriage\'.Girls who get involved in this issue suffer from social,physical and mental problems.After marriage their education get stopped.The drudgeries of married life can get in the immature minds.Responsibilities has to be shouldered at a very young age,used to get conceived in every end of a year,both mother and child mortality rate increases,sometimes their spouse leave them.The children that they give birth suffers from malnutrition,homelessness due to poverty and proper guidance & thus get themselves involved into drugs,smuggling and other illegal activities and I see the main reason is child marriage.So if I get any opportunity I\'ll work for these girls.I need to start my work from slum areas.My first aim will be to council the families by empowering them with intensive,economic support and skill based workshops.As most of the poor family in our country force their girls to get married early, I want to start my work from slum (poor) families.',NULL,'House no:442,Road no:04,Block no:B,Chandgoan R/A,Chattogram',NULL,94,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/94/certification/ZiqtmXAFVXiq50WxIAPsWK4Xb6wesr62GaRCWfBJ.jpeg','Bangladeshi','11',10,9,'01860884450','70','2004-01-03','fatimanaz.fouzia@gmail.com','https://www.facebook.com/profile.php?id=100009114777357','1','1','1','N/A',NULL,'Zinnur Raihan',NULL,NULL,'N/A',NULL,'1',NULL,'https://www.instagram.com/fouzia.anhar/','Nazneen',NULL,'01714289486',NULL,'Khadiza Akther Banu',NULL,NULL,'Service',70,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/94/student_photo/vBIXLtEamWDQVWaHKyTjmRKA1rI4KRsZLd031eRZ.jpeg',NULL,'4212','1','N/A','Chattogram Cantonment,Chattogram','Chattogram Cantonment Public College','2019-11-27 06:43:17','2584400','female',NULL,'Chandgoan','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/94/marksheet_previous/u7KJh2nZQCFGqpGld8JIcJCFTCG1HZtbMY8NAPXS.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/94/marksheet_previous_two/OypOykB1bFSLAPxHQVIfvX6ANmkpTwM3g9OCT1q3.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/94/marksheet_current/eyCUSbdq3clrIv2AGg0wcilI4HDDY1yh4ISjaQpp.jpeg','N/A',1,'0','N/A',NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,'N/A','N/A','20041594116030058','2020-10-07','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/94/student_passport/pPuLB9kHMwR2aMxkDjVV2nc30S3NiheyfhzYhQWh.jpeg','Chattogram',1,'N/A',-1,2,'1594116435224',240000,'Chattogram, Chattogram',4220,'Cantonment','Mohammad Moniruzzaman Jewel,psc','N/A','N/A',1,'N/A',1,NULL,'In this 21st century its very easy to know about other cultures through internet.But in my opinion learning something practically is more enjoyable and informative to create a smooth global network.I want to know American culture and their lifestyle realistically and as well as I want to let them know about Bangladeshi culture too and want to remove their negative thinking about my country (if there) which will create a sustainable understanding specifically between two cultures of the two different region of the world.Since there will be some other country ambassadors too it will be a great platform for me to represent my country to other countries partially ,apart from only the United States of America','My very first focus will be my mother tongue Bangla.I want to let them know that BD is the only country who gave blood for their language.In case of cuisine first of all I\'ll introduce rice,fish(specially mustard hilsha),different sorts of spicy mashed salad platter,haleem,native curries,bengali cakes,sweets and what not.Besides I want to share them that we take our meal by right hand and I must share them how hospital and rich cultured we are! I\'ll share about saree,salwar kamiz,lungi and teep!(I may take some Bengali dresses,earthenware & bamboo things for my host family & friends as gift)&surely about boisakh,sovajatra,dance and music.BD is a 6 seasoned country and carries a rich tourism too.I\'ll show them how we follow our rituals & etiquette( giving salam/adab/nomoskar depending on religion).One thing I must share that we touch the feet of elders as a show of respect to them.I must not forget to share about our folk culture!! last but not least I\'ll share about our Liberation War.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-10-24','2019-10-24',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/94/school_seal/GWeUhDF092ulJd41l6iQw2t6A7b8Xl2gBSAA63bL.jpeg'),
	(15,'PARAMITA HAQUE PROMA',2,0,NULL,'Dinajpur, Rangpur',NULL,19,'Community service can have a lot of positive effects on students, such as helping them to develop skills, making contacts and allowing them to improve the quality of life of others. Few months ago our school organized a math Olympiad in our school campus. And the students from our school were the scouts. Many students from other schools participated in the Olympiad just to boost the mathematics knowledge among the students. We have welcomed their visitation in our school. We helped them to take them inside our school. We served them food and we gave them the introduction of the math Olympiad. Also we distributed them educational material. We shared the little that we had. Students were awarded with certificates. I feel so honored to be a part of the program. It will be a great opportunity for me to be a part of community service. I will try to participate in various activities to make my community better. And I will also encourage others to participate in community service.',NULL,'kismat Madhobpur, Pulhat',NULL,95,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/95/certification/k8lR5MNOMMduzYUGWWA19PFwsG42TpCfYRXzLHcG.jpeg','Bangladesh','10',9,8,'+8801712572645','85','2004-10-10','itzarpa@gmail.com','https://www.facebook.com/pro.ma.35728','1','1','2','+88017 1257 2645','aminulh1956@gmail.com','Md Aminul Haque',NULL,NULL,'Government Officer (Retired)',NULL,'1',NULL,NULL,'ARPA',NULL,'+8801718836425','sarwarshaon566@gmail.com','Shamima Akhter',NULL,NULL,'Government Officer (Retired)',86,89,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/95/student_photo/WDIlhzl4JxlrLHl3KFoTz8lFIBZZEsHTIkG5jTyy.jpeg',NULL,'5200','1',NULL,'Dinajpur','Tulip International School & College','2019-11-27 06:43:17','053166827','female',NULL,'Dinajpur Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/95/marksheet_previous/bpnxFKyjv2ry5GHyREnP4MfQdLyMn3VejL3TMfjp.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/95/marksheet_previous_two/j3IO3aRMNTXABd0Cuv6FArytT7vEJzzZK3KuJ7Cc.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/95/marksheet_current/QYdehJxkSf4eogkHA2Myw0ay7nww30YqjJNsZBzn.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,'BK0875692','2021-05-10','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/95/student_passport/jM0GqknDbFNENzJNVajS2iYdMgN5wokYG6KWHmXR.jpeg','DINAJPUR',2,'4605521311',1700000,1,'8205652533',1150000,'Dinajpur, Rangpur',5200,'Dinajpur Sadar','Tulen Hansdak','+880 17 1516 9699',NULL,2,'India',1,NULL,'YES program comes up with a bunch of opportunities for every student to step out of their regular routine and see the world through their eyes. I have dreamt of traveling and exploring the world. Through this program I want to experience new people and know about their cultures and lives apart from getting the taste of American education. I want to learn new and exciting things which can make learning fun and expand our minds in the process and be inspired to learn more. I want to experience different levels of courses to improve my knowledge. I wish to have new friends from other countries with whom I can exchange information about our country like culture, language, lives, festivals etc. And I am too excited to learn about the cultures, lives and histories of different countries. And I believe this program will provide me with all the scopes to work across the globe and build up a better career.','The culture of a society is the complete picture of a nation and the most important concept. It means the way of living, eating habit, cultural functions, dresses and different kinds of festivals. I will really feel proud to share Bangladeshi culture with my American family. As an independent country we have our own culture. Bangladesh has a rich and diverse culture. The three primary religions of Bangladesh (Hinduism, Buddhism and Islam) have had a great influence on its culture and history. As I am from a different country, it will be more exciting to share information about our country. I will teach my American family how to speak Bengali, how to wear sari, I will cook Bangladeshi food for them etc. As a representative from Bangladesh I will try to give out my American family everything I can and also invite them here to look how beautiful my Bangladesh is and how humble my people are and how they enjoy their simple life.',1,'A Friend',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/95/school_seal/XKnx9rPC9jinEd51Do4mlAXChxILQxR6N8ld8tGU.jpeg'),
	(16,'Salman Saleem',2,0,NULL,'Chattogram, Chattogram',NULL,19,'Just on the 12th of October of this year, I visited an old home for the elderly, known as Amena-Bashar Old Home in Raozan, Chattogram, to distribute food and medicines. This was an initiative of the Inner Wheel Club of Green Hills, Chittagong. I\'ve also went to the Play Park; for the village of Bhatiary. This park is an after school arena for learning and fun dedicated to the children of Bhatiary, a small village near Chattogram, Bangladesh. It was founded in 2000, by Dr. Caroline Feller Bauer and her husband, Mr. Peter Bauer. I\'ve gone there to help teach certain classes; these include storytelling, taekwondo, computer classes, art, and English classes.',NULL,'Rahimafrooz Bangladesh Limited, 15, Agrabad C/A, Chattogram',NULL,98,NULL,'Bangladeshi','10',9,8,'+8801713103593','94','2003-11-25','salmanwcabd@gmail.com',NULL,'1','1','1','+8801713103764','saleem.sheikh@rahimafrooz.com','Mian Saleem Sheikh',NULL,NULL,'Management Executive',NULL,'2','2020-03-22','@salman17sheikh','Sheikh',NULL,'+8801713103593','znsctg@gmail.com','Zareen Nizam Sheikh',NULL,NULL,'Homemaker',92,94,NULL,NULL,'4000','2','New Jersey (Monmouth County), Washington (Sammamish), Connecticut.','G.P.O Box 96, 1986/A Jakir Hossain By-Lane, East Nasirabad, Chattogram','William Carey Academy','2019-11-27 06:43:17','+88031657585 or +88031652034','male',NULL,'Khulshi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/98/marksheet_previous/dOnalxP3tawDDNG562cX9DjycZ1vKToLbZknajHG.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/98/marksheet_previous_two/FcKqvFtRgxaFdFwmBVDLGnPsmalU9W6YLLS7GPTN.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/98/marksheet_current/yZuvwBGKvrqEUsqZM5puNFotjnl5uESrRlg5WHgu.jpeg',NULL,2,'35','Visiting relatives and friends & tourism',NULL,NULL,'2019-11-30 08:30:20',NULL,1,1,NULL,NULL,'BJ0784464','2021-01-03','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/98/student_passport/a44SkqrfxyXEKnxBjXrwFVGmSFIF77ysKKWa9RNX.jpeg','Chattogram',2,'8661889207',3600000,2,'3711864094',-1,'Chattogram, Chattogram',4000,'Khulshi','Paul Beatty','+8801730359075','2015: New Jersey, New York, Illinois, Connecticut, D.C., Maryland, Minnesota, Virginia, Pennsylvania; 2018: New York, New Jersey',2,'Canada (visiting relatives), Indonesia (tourism), Thailand (tourism), India (tourism), Malaysia (tourism)',1,NULL,'I\'ve had a few friends who have gone with the YES program for their exchange year. Ever since I have heard about it from them, I became very interested and wanted to take part. I\'d love the idea of spending a year away from all of my regular activities and school so I can explore new opportunities halfway across the world. I\'d love to make new friends and learn about their cultures; this would also give me a chance to expand my network, so that after I finish my schooling, I have multiple connections around the world. It\'s a type of personal development for me as well, because a year away from home is going to teach me a lot about responsibility. And lastly, I\'m still a young kid; I\'m trying to seize every opportunity to better my life with amazing experiences.','I\'d love to share so many aspects of Bangladeshi culture with my American family. Some of these would be Pohela Boishakh (Bengali New Year), the language and its history, and our food and music\r\n\r\nFor Pohela Boishakh, I could show my family multiple pictures of what people do on Boishakh and how they dress, and I love to sing, so I could sing them a song about Boishakh.\r\n\r\nFor our language and history, I could tell them firstly about International Mother Language Day and the history behind it. I would also tell them about the Liberation War we fought in 1971. Lastly, I would tell them about Bangabandhu Sheikh Mujibur Rahman, the Father of the Nation, and how he played the most major part in our fight. \r\n\r\nFor food, I would tell them that Bangladesh is famous for fish. If possible, I could take some dry fish for them. Otherwise, I could cook fish for them. And for music, I love to sing, so I could sing Bengali songs for them and take some on a hard drive.',1,'A Friend',NULL,2,'2019-10-31','2019-10-29',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/98/school_seal/aMfKxr4YAVGCjAx7xH2VeEnn730slP5rtKOWwRp9.jpeg'),
	(17,'A S M',2,0,NULL,'Dhaka, Dhaka',NULL,19,'From my childhood I\'ve always wanted to take part in any social service but never had the chance to do so.However,if I\'m ever given the opportunity to participate in a community welfare service, I\'d create a website for fund raising for the education of the underprivileged children of our country. This may help to reduce the inequality between the rich and the poor and also the country may experience an economic growth in the long term as a result.',NULL,'Apartment\'s name: Melody Flat A-2 House no 3/A Road no 74 Gulshan-2',NULL,100,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/100/certification/pf70dV0mb1pTYBazLjhMgTUxkoCilOvETq6fSjEc.jpeg','Bangladesh','9',8,7,'+8801793532905','69','2003-12-17','sayadat_samin@outlook.com',NULL,'1','1','2','+8801755543227','qaisaribbl@gmail.com','Muhammad Qaisar Ali',NULL,NULL,'Banker',NULL,'1',NULL,NULL,'Samin',NULL,'+8801755528176','yasminqaisar23@gmail.com','Yasmin Qaisar',NULL,NULL,'Unemployed',95,96,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/100/student_photo/c4VEOYPSIALoRpdnLfIKlUOLdQ5qWBpEq6orY6Yz.jpeg',NULL,'1212','2','California','House no: 95, Road no 11/A Dhanmondi Dhaka','Maple Leaf International School','2019-11-27 06:43:17','+88028154932','male',NULL,'Gulshan-2','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/100/marksheet_previous/QfkjLfuRG5Do0SJJVd79N3ZFu1xPeKINdBcWT6cP.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/100/marksheet_previous_two/ngciGjzuhC0wVXWB1tgAh5StGqVNK8f50VpGkE8l.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/100/marksheet_current/vQZ2AlpLnc59qTFtNqaWbh9FGzEfFF7OLxfTAU3d.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dinajpur',2,'6000045564',3000000,2,'4650048145',-1,'Dhaka, Dhaka',1209,'Dhanmondi','Mr. Ali Karam Reza Principal',': +880255029138',NULL,2,'Singapore for Tourism purposes and Saudi Arabia for cultural purposes.',1,NULL,'It has always been my dream to study in a developed country like the USA and to complete my high school there would be a dream come true for me.Also, I\'ve heard and seen that America is one of the most welcoming nations in the world so that\'s one of the reasons why I\'m interested in applying for the YES program.','First of all I\'d be taking our traditional bengali clothes such as Panjabis and Sarees for my American family and would ask them to try the clothes and I\'m pretty sure they would be really excited to try them out.\r\n\r\nSecondly, I\'d be bringing a book with me which has the history of our country written in it and would be giving that book to my American family so that they\'d get to know how our nation struggled and fought to establish \'Bangla\' as the national language of our beloved nation. As a result, I\'m quite confident that they\'d be interested in learning our language and for that I\'d be more than happy to assist them.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-19','2019-11-09',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/100/school_seal/cqlLyQvUHMe8QnLeds1eXUzGr7MyVmzFWdS3EAsC.jpeg'),
	(18,'Faiza',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have an experience participating in a community service project in the past. I am a member of our local youth group which organised a project to clean our streets. It took us around 3 days to clean our streets by picking up trash. It was organised by the leader of the local youth group and me. The initiative was taken by me.',NULL,'214/1 West Nakhalpara (2nd floor)',NULL,102,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/102/certification/ao3LApEdzPX7kJfg3uTEJrnjvgONijgwkYef23qP.jpeg','Bangladesh','10',9,8,'+8801770166877','80','2004-09-21','nnminu71@gmail.com',NULL,'1','1','1',NULL,NULL,'Masum Hossain Khan',NULL,NULL,NULL,NULL,'1',NULL,'@_faiza.a__','Amira',NULL,'01770166877','Lailarunu72@gmail.com','Runa Laila',NULL,NULL,'Housewife',80,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/102/student_photo/CRHPzFkCJag1Etwev9o5IKaVtLoaVYlv07oVELU9.jpeg',NULL,'1215','2','New York','105/4,Monipuripara,Tejgaon,Dhaka','BACHA English Medium School','2019-11-27 06:43:17','+88029114525','female',NULL,'Tejgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/102/marksheet_previous/Eu0Auy5jJGuZZVoYexaN9qdiE8ZOSto13EcU07LN.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/102/marksheet_previous_two/IifDU27TeYHjs0fn5YySxCzFX0VJb7c66am6Z8JP.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/102/marksheet_current/t9AXsQlNvnR8lnzzNz8c3PNMix75sFvpAuDIHlid.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-27 11:29:17',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',1,NULL,-1,2,'777 807 5965',-1,'Dhaka, Dhaka',1215,'Tejgaon','Sr. Miriam Perlewitz. M. M.','+88029114525',NULL,2,'India for vacation',1,NULL,'I want to apply for the YES program because I want to know more about their culture, lifestyle and share more about my culture. I will also learn to be more independent. I want to experience new things so that when I come back I can share my experience and what I learned with my friends.','The aspect of Bangladeshi culture that I want to share the most is cuisine. I feel like sharing our cuisine is a good way to know more about our culture since we have very different food preferences. A way to someone\'s heart is through their stomach. \r\n Another aspect that I want to share is our clothing. They will look good in our desi attires like saree or salwar kameez.',1,'A Friend',NULL,2,'2019-11-13','2019-11-12',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/102/school_seal/72Fs7cvLydJhrEXsBvlImxXbj6DDQs2ITzwzPDJQ.jpeg'),
	(19,'Sayeeda Tanzim',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have been actively involved in community service since December of 2016. I was 12 when I first participated in the Save the Children awareness run. For the next 3 years, I have participated in more than 10 awareness programs. Those included cancer awareness, making a healthy Bangladesh, women empowerment, children awareness, suicide awareness, breast cancer awareness and many more. These programs were mainly running events organized by different organizations. Being the youngest one in these programs was a privilege for me. I got to learn many things and meet some amazing people and hear about their life stories. With the help of this program, I got to learn that age is just a number and you can achieve anything if you want.\r\nFor a year I was involved in scouting too. I learned many skills through scouting. I plan to continue with the scouting program in America too. \r\nI want to continue making a positive impact on the community throughout my time in America and later.',NULL,'1/F, Evergreen Salim Bhaduri Paribagh, Dhaka-1000 Flat#3C',NULL,107,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/107/certification/Hfj7u2trePOwdsf1XVx2IKmlxlWixyEKiuDmgqD0.jpeg','Bangladeshi','8',7,6,'+8801612159279','75','2004-03-19','sayeeda1704@gmail.com',NULL,'1','1','2','01613432002','nipu_bhai@yahoo.com','Saifur Rahman Khan',NULL,NULL,'Education Entrepreneur',NULL,'1',NULL,'@sayeeda.tanzim','Khan',NULL,'01713432001','mursheda14@gmail.com','Mursheda Rahman Khan',NULL,NULL,'Unemployed',70,72,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/107/student_photo/NudOw7rx0k4zaZRpMGJGwNQ70lrideIyo50xKBBM.jpeg',NULL,'1000','2','Minnesota and Wisconsin','1, A, New Baily Rd, Dhaka 1000','Viqarunnisa Noon School & College','2019-11-27 06:43:17','02-58310500','female',NULL,'Ramna','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/107/marksheet_previous/fec6fwkgOr8zbuFj5kdVZoObMtfjzF3d3Di2iylK.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/107/marksheet_previous_two/FUX9slsjaq1A9HESGmMaEvKAuL9CvHs5N1uFwMve.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/107/marksheet_current/q0RhnEcSuHsoc3aPfXdTT877JJcffH70PTVF6ZhJ.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,'BR0429169','2023-01-07','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/107/student_passport/LD2mweNY67uwgVs8g4DFnQG0JUWNwtoQbiWLPRHI.jpeg','Dhaka',2,'19662699027000014',20000000,2,'2699040501935',240000,'Dhaka, Dhaka',1000,'Ramna','Wahida Jafar','+8801819218516',NULL,1,NULL,1,NULL,'Through YES, I can learn about a new country, people, traditions, family values, etc. Living with my American host family would allow me to learn about Western family values and observe cultural differences. I will be recognized as an international student instead of a tourist. Furthermore, I can be educated about other religions and learn about the challenges of being a Muslim in a Muslim minority country. This program will expose me to various opportunities that would push me out of my comfort zone, help me grow and make life-long friends all over the world. Moreover, I can explore different professional careers that I may not be aware of now. Being a youth and cultural ambassador and a representative of my country at the age of 16 will be a new experience for me. I hope to be more self-dependent and confident by the end of the program and also develop my communication and leadership skills, along with being more of a team player.','I want to share our festival, faith, custom, attire, and cuisine with my host family. I want to show the generosity my culture has taught me and prepare Bengali meals for them at times. Staying with them for ten months, I will be able to share two Eids and show how we observe it here. I will arrange a playdate for my host siblings and play games that are popular here. These will be a bonding experience for us and an opportunity for them to learn about my culture. I would like to give them our national clothes to wear on Pahela Baishakh. Besides, I will take some artifacts from here and also show the pictures of the historical landmarks and tourist places I have clicked and visited. I would like to wear the jersey of our team and watch cricket match with my family. Furthermore, I will share some subtle things about our culture which go unseen usually like, taking off shoes before entering the house and eating with hands, along with taking part in cultural events.',1,'My Family Member',NULL,2,'2019-11-21','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/107/school_seal/MAcwuPcYpoXhxAHyA5COiwJGJntT1IZg9HUQTYDA.jpeg'),
	(20,'Fairuj Nazia',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I have volunteered for a very profound institute with the simple value of  Humanism.They have a fantastic way of working where they provide food for the unprivileged children and older people by 1taka only!Every day they provide food to 2000+ children amid the country.They made this 1taka rule so that the children and the older people receiving the advantages do not feel like they are getting it for free.The institute makes sure the poverty-stricken people get at least the fundamental rights, which include clothing, shelter, education, and food.\r\nEvery day all the volunteers cook together and then serve the food on different locations;the institute also provides\r\neducation to unprivileged children for free and they are also served with food after class.\r\nIn the future I would love to have an organisation of my own, where I would stand beside the unprivileged children and women of our country.also,for mother Earth I want to have a strong platform to educate people about Global warming.',NULL,'Panthonibash-4,19,21,Janata Housing,Mirpur-1',NULL,113,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/113/certification/o1ppiOhcVEpuSJk1LFwMUNCek6Z39ypWmegCcPxB.jpeg','Bangladeshi','11',10,9,'+8801933302211','60','2002-05-16','fairujnazia@gmail.com',NULL,'1','1','1','+8801712012895','niajur.fp@gmail.com','Md. Niajur Rahman',NULL,NULL,'Government official',NULL,'1',NULL,NULL,'Prethula',NULL,'+8801715361404','jeneva.incap@gmail.com','Nasrin Nahar Jeneva',NULL,NULL,'Private Organisation',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/113/student_photo/w8DlF3yC9UhS7pEWzR5aPMo3ymGO0IIQ5Y0MuGkI.jpeg',NULL,'1216','2','Virginia','250/1, 2nd Colony, Mazar Road, Mirpur-1','Methodist English Medium School','2019-11-27 06:43:17','9009762','female',NULL,'Mirpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/113/marksheet_previous/FtvBnojhtSGok6VVFZprxrMrfzLjeDLHAxy7CnrP.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/113/marksheet_previous_two/WXRtPozYz16QEzGeeiR3yBxytvyBJsugltAXXdau.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/113/marksheet_current/t3cAfBC9cxBGNc7mlQhCebN17xEqylsPIZPrJXeu.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,'BM0091384','2021-10-05','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/113/student_passport/XJR86NRu7fiuVMHauuheHyI2EFGHcrxSvHD7J0zA.jpeg','Lalmonirhat',2,'NID-19702694812066183',1500000,2,'NID: 5225508138186',3600000,'Dhaka, Dhaka',1218,'Mirpur','Subrata Edward Gomes','principal.mems@yahoo.com',NULL,1,NULL,1,NULL,'It has always been my dream to visit America at some point in my life. As America is the leading country of this world. It would be an excellent opportunity for me to attend a program like YES. I want to know more about the great history behind the United States of America, their rich culture, and more about their ethnicity and background. Moreover, I would love to share my experience, my mesmerizing culture, and my ethnic history. It would help me to enrich my career and build me as a person. This program could help me fabricate my future for the better.','We have a very diverse and rich culture. Primarily Bangladesh is world famous because of its magnificent culture, language, our lush green landscape, numerous mouthwatering cuisines, and definitely our traditional clothing.\r\nI would love to share all the small details about my culture, ethnicity, spirituality, and country. I would let them know how important family is for us and how we were taught to welcome our guests  the small manner we were up-skilled with.\r\nGenerally, I want my host family to experience Bangladesh through me. Our country is the only country to fight for its language, and after sacrificing 3 million freedom fighters, we achieved our freedom. Also, in exchange, I would love to know more about their history.I can share some appetizing recipes and teach them about the spices we use and the way we cook. We make varieties of food on different occasions. And share stories about how people from all religions celebrate together on festivals.',1,'A YES Alumni Member',NULL,2,'2019-10-22','2019-10-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/113/school_seal/9D6CDqft2xDgn0g5HbvMPvmt7YPHoXQuj4jh0LOB.jpeg'),
	(21,'MD. Sanzad',2,0,NULL,'Dhaka, Dhaka',NULL,19,'In my 5 years of scouting journey, I got the opportunity to participate in many community service programme. Also, I\'ve organized some community service project with my scouting group. Last year, we organized and event on National Traffic week. We made aware people not to cross the roads during green & yellow signals and we interested people in a different way to use over-bridges. Our main intention was to aware them about road accident. We made a group of 5-6 people for one area and we took our stand besides the over-bridge.Whenever anyone tried to cross the roads, we made aware him and informed that if he use over-bridge, he\'ll get a chocolate as reward from our scouts, opposite side of the roads. And  hearing this everyone became interested. We did this whole week and tried to interest people to use over-bridge habitually. Also we helped our traffic police regarding traffic rules. \r\nI think our community service project helped a lot of people to save their life from road accident.',NULL,'Ga-6/10 Bangladesh Bank Colony, Arambagh, Motijheel, Dhaka-1000',NULL,125,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/125/certification/4JqnQOPebQo8fgCvysKFa0wCj0DWILQP1tB2UVrm.jpeg','Bangladesh','11',10,9,'+8801829958367','90','2004-01-10','sanzadhossain3254@gmail.com','https://www.facebook.com/sanzad.hossain','1','1','1','01552348784','sanwarbb@gmail.com','MD. Sanwar Hossain',NULL,NULL,'Govt. Service Holder',NULL,'1',NULL,NULL,'Hossain',NULL,'01552348784','sanwarbb@gmail.com','Mrs. Parven Akter',NULL,NULL,'Unemployed',75,75,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/125/student_photo/6mTAgDxzNdpiOZLmdGWpwEwwq2jyHlIeIg7FsS5H.jpeg',NULL,'1000','1',NULL,'Mirpur Rd, New market, Dhanmondi,Dhaka','Dhaka College','2019-11-27 06:43:17','02-8618350','male',NULL,'Motijheel','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/125/marksheet_previous/84IE7ZNPYMXPgb0GOgiS0nPAM9gbp8PZ4K1DlfYE.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/125/marksheet_previous_two/mGZXevyxlLQkDsLRZsVx2pu6v1SLEMAU1PBZ4KFy.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/125/marksheet_current/3UtRDu9FL3cwfJRYiHaFiZ1SvQdVUWCN08nlSBHh.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,'BT0015444','2023-03-10','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/125/student_passport/vZszGFZWFu41BJm5sKXbLoRQpU5KVK4TRVDOX3CH.jpeg','Dhaka',2,'4159010810',600000,2,'3709117679',-1,'Dhaka, Dhaka',1205,'Mirpur','Professor Nehal Ahmed','02-8618350',NULL,2,'1)\'India\' for participating in an International Competition.  2) Turkey-  Govt. Scholarship tour for being the best talent student. 3) Sri lanka for participating in an International Project & Innovation Competition. 4) South Korea - Govt. Scholarship tour for being the best talent student.',1,NULL,'From my childhood, I\'ve a great interest on learing different culture.I\'ve visted 4 countries to learn about their culture but visiting a country for 1/2 weeks doesnt give a clear concept about their culture.I believe,the best way to learn about one countrys culture is, by living with them rather than visiting.Thus, living with host family I\'ll learn about their actual history, culture directly from them, alike I\'ll  share my culture. As an amicable person I always want to make some new freinds when I go to new places.Thus I\'ll make some new American freinds to share my culture while studying in American school, which is my dream. I hope living 1 year without my family will increase my adaptability. As my dream is to study in America this experience will help me to get lot of opportunities. Also,I want to learn more about cultural exchange and want to do co-curricular activities whole 1 year, so I think YES programme will be an inimatable opportunity to represent my country by myself.','After meeting with my host family I\'ll gift them some Bangladeshi clothes. Then, in family discussion I\'ll share a clear concept about Bangladesh as many people thinks, Bangladesh is a province of India. I will tell them about the history of Bangladesh, liberation war, freedom fighters & the unity of Bangladeshi people\'s. After that, I\'ll present them some photo about the natural beauty & prominent feature of Bangladesh such as Sundarbans, Coxs bazar etc. Besides I will try my best to teach our language & alphabet & introduce them our Bengali words. In spare time, I will sing some Bengali song with them.  Also I can cook some dishes like rice, biriyani. So I will cook there and share some concept about Bangladeshi food. Besides,in holiday I\'ll share with them how we enjoy that holiday. Lastly I\'ll gift them some popular bengali books to give an idea about bengali literature. I think 1 year is enough time to share all aspects. And in this way I\'ll present my country & culture.',1,'Facebook',NULL,2,'2019-11-12','2019-11-06',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/125/school_seal/9Vh2bJSxPJvUWoUpjBTvFyq4WZGQYIN3b14PHkil.jpeg'),
	(22,'Zalal Uddin',1,0,NULL,'Dhaka, Dhaka',NULL,19,'This Eid I worked on a project as a volunteer. The name of the project is :\"project Eid smile: season 6\". I learned so many things from this project, like how to work on a team. I share my opinion with others . And i have been able to improve my communication skills . Now i want to say what was our main goal.Our main goal was to give Eid gifts to under privileged children. we give Eid gifts 200 children. Those children was amazing and so lovely . They were very adorable. I still remember those kids smile. It was a great day for me . I feel proud my self to helping them.They are very talented but they are just behind for neglect. They are not getting proper education. If we all come forward to help them then they will go a long way. They will illuminate their future and this is great learning for me.\r\nNow I\'m intern on a project and that is project Snigdho Shovab at shishu charit we works on children behavior and manners . We are trying to tech them good behavior and etiquette.',NULL,'224, NABI NAGAR , ASHRAFABAD',NULL,127,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/127/certification/ahZCn83VeJIrw1HGo1enNToj6XcUjP9ATfSmTRWa.jpeg','Bangladesh','11',10,9,'01830710648','58','2002-12-01','zumakram@gmail.com','https://www.facebook.com/zumakram','1','1','1','01728935698','mdbazlu096@gmail.com','MD BAZLUR RAHMAN',NULL,NULL,'Teacher',NULL,'1',NULL,'__.akram_khan_','Md Akram',NULL,'01533587952','rabiyakhatun834@gmail.com','RABIYA KHATUN',NULL,NULL,'Teacher',75,61,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/127/student_photo/6VX2lV75FHcBjWgd3daGvIYydar1SquKz63cLNqJ.jpeg',NULL,'1211','1',NULL,'Satmasjid Road, Dhaka','Mohammadpur govt College','2019-11-27 06:43:17','02-9122892','male',NULL,'KAMRANGIR CHAR','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/127/marksheet_previous/7kyZRi9t8SnHN231ohdeCXCOr2lSRKLGy5EqVhCv.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/127/marksheet_previous_two/js2PV0sZdVz3RVidCqMHiSmwxQO6ffAgKLLNVNI9.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/127/marksheet_current/NHVpw2sY54fHjmsQD1QE5oiMDu5bNleXGpklhuKc.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,'EE0021432','2024-09-25','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/127/student_passport/JGEpd0BFzdekNZzINT5Wzw2EkjO7Fki5PqnA82l8.jpeg','Dhaka',2,'9111947413',180000,2,'1005947799',50000,'Dhaka, Dhaka',1207,'Mohammadpur','Prof Humayun kabir','02-9111656',NULL,1,NULL,1,NULL,'Last year I did a leadership training program .It was Building Bridges through Leadership Training Junior , organized by Bangladesh Youth Leadership Center.This program changed my life my thought and way of thinking. I started thinking about my society. I heard about YES program from an alumni of the BYLC and he also a YES alumni.\r\nThen i did research about YES program and tried to find out what they do? The main thing is when i see the students of YES impact the society , like they are doing some project and work on it, I like it very much .\r\nIt\'s very important to do something for our society and YES student are doing that.\r\nYES student\'s are very confident and they made lot of changes in themselves. Now they are busy to change this society. That\'s why I want to apply the YES program.\r\nI want to join this wonderful community. I can learn a lot from my host family and local school. I will represent my culture among them. I believe, it will be the most amazing year of my life.','I will share with my host family all the traditional things in my country. Our culture, Our food, what we do at our festival.\r\nI love cooking and i know lot\'s of recipe. So at first i would like to share our traditional recipe and cuisine with my host family. like fish curry, Rice, Pitha, briyani etc. I know how to make this food.I know many briyani and desert recipes  . In this Eid , I cooked Kacchi briyani in my house and invite all the relatives. It was a great day for me because they liked it very much.The funny thing is , When i am upset about something , I go to cooking.\r\n\r\nI would like to share our country\'s traditional clothes with my host family. I have a plan. I want to give them a surprise. I will take our traditional clothes for them from Bangladesh. like Lungi, Panjabi, shari  and gift them . I think it would be great.',1,'Facebook',NULL,2,'2019-10-20','2019-10-17',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/127/school_seal/B8ZaU9e4WcnyxRKz794Fs1UeDMgdv66ZHGIERnYv.jpeg'),
	(23,'Samannaz Tasmim',2,0,NULL,'Dhaka, Dhaka',NULL,19,'The youth in Bangladesh and worldwide are increasingly expected to learn to speak, read, and write in English, in addition to their native tongue.  English has become a global language, and fluency in English is quite helpful to anyone aiming to have a successful career in adulthood. I was very fortunate to learn English at a young age from my father and in an English class, and I have spent much of my life since then perfecting my fluency in reading, writing, and speaking in English.  \r\nMost of my peers are not as fluent in English as I am, so, if I were aiming to serve my community, I would organize a program to teach local children English.  As someone who has developed full fluency in English as a second language, I believe my experience can guide my methodology for teaching these children.  I would make it fun for them.  I would gradually increase their level of immersion in the English language while they are in the class. And help them develop their language skills.',NULL,'325, Monipur, Mirpur-2, Dhaka-1216, Bangladesh',NULL,132,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/132/certification/sivtixej1HAPoVo8WLQrlmgQZavZFGZxDqbLc5mH.jpeg','Bangladesh','11',10,9,'+8801978881578','70','2003-08-25','ksamannaz@gmail.com','https://www.facebook.com/SamannazKhandaker','1','1','1','+8801715191902','mifahim@gmail.com','Mazharul Islam',NULL,NULL,'Banker',NULL,'1',NULL,'@samannazk','Khandaker',NULL,'+8801915166402','swapnafahim@gmail.com','Ferdoush Ara Zinnate',NULL,NULL,'Housewife',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/132/student_photo/1X0BT55Lcvh0ov2m24EbFKmtAG4gbT7HT6V1qIfy.jpeg',NULL,'1216','1',NULL,'Dhaka Commerce College Road, Mirpur, Dhaka 1216, Bangladesh','Dhaka Commerce College','2019-11-27 06:43:17','+8802-9023338','female',NULL,'Mirpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/132/marksheet_previous/UhBiRXd7r6dlE86X5ROg0bYC7vBTuPTOV2QKi1bv.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/132/marksheet_previous_two/mFZZLOBRW1XGxLzXRfxZW4L4h0XVTpDu7XBsauYC.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/132/marksheet_current/bZkFKOLwc4yWRcEeLzRvZPkSg1e1SNWJJy5U1NDZ.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,1,NULL,NULL,'BM0816637','2021-12-13','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/132/student_passport/hN1sRvy0XkpVF18vBrUJ8U3ICTcK5g6jJCgXj6De.jpeg','Tangail',2,'2694813875495',1200000,2,'2694813872681',-1,'Dhaka, Dhaka',1216,'Mirpur','Prof. Dr. A.F.M Shafiqur Rahman','+8802-9007945',NULL,2,'Bhutan and India for vacation.',1,NULL,'I have always wanted to study abroad ever since I was very young. And what better opportunity would I have than the YES program? Studying abroad and living in another country has always been a fascination to me. It provides me with the opportutiny to live in a different country and meet people and make friends from all around the world. It also allows me to become more independent and self-reliant while exposing myself to a different culture, and learning and growing in a new environment. This experience will broaden my horizon and let me see things from a different perspective.','Bangladesh has a very rich culture. We have a rich fictional legacy with the first form of literature being over a thousand years old. And the Bengali language movement in 1971 is the reason why Bengalis can still speak Bangla. I\'d love to share the history of my language and teach my American family some of the Bangla language. I love teaching people about my own language and it\'d be quite fun to do.\r\nSince American cuisine is very influenced by numerous cultures, I would share certain items that are part of Bangladeshi cuisine, such as fuchka, to help connect with my American family. I would be interested, as well, in trying various American dishes that I haven\'t had before.\r\nI would share with them certain aspects of Bangladeshi clothing, such as the saree and henna, among other articles of clothing traditionally worn in Bangladesh. \r\nI would be happy to teach my American family anything they want to learn. Despite our differences, I am sure we have many, many values in common.',1,'Other','I googles \"exchange programs for high school students and found out about this opportunity',2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/132/school_seal/xHueHfdsIPDqVQrriTOoOX39p4AUoM6rKE6UQ6Dd.jpeg'),
	(24,'H R',2,0,NULL,'Dhaka, Dhaka',NULL,19,'If I looked outside from the window I could roads filled with rubbish. A bad smell is coming from it which makes the passenger difficult to pass through. There are also some public places in my community such as parks where people through rubbish and make the place dirty.  There is a river in my community when I looked at the water I dont see any fish over there rather I see litter floating in the water First of all, we have to clean them. Then we have to make the people aware of this and tell them not to throw rubbish expect the dustbin. If we were able to clean our surrounding it would be much more beautiful. If we plant trees in our community would be much more beautiful and reduce global warming.\r\nWhen I pass through the road I see slums beside my community where lots of people are deprived of clean water, food, education and many more. We have to Supply clean water and food to those poor people. We can also provide Education to poor people who cannot afford to study.',NULL,'C-137, Lalkuthi, 3rd Colony, Mirpur, Darussalam, Dhaka',NULL,133,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/133/certification/SiMTa4RmTjLT13STytUtx97Nn2I6qm4qQH9BQC0u.jpeg','Bangladesh','11',9,8,'+8801864038343','98','2004-10-03','hrshowhardo@gmail.com',NULL,'1','1','1','+8801819230210','tajululafaruk@gmail.com','A.K.M. Tajul ula (Farok)',NULL,NULL,'business',NULL,'1',NULL,'@hrshowhardo','Showhardo',NULL,'+8801712145919','muktiprinters@gmail.com','Umma Tayaba Mosammed Moriom',NULL,NULL,'Business',96,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/133/student_photo/jDcQLsce9ZP52tpCLDtAlMyuMzwIfcwkGX302XD6.jpeg',NULL,'1216','1',NULL,'250/1,2nd Colony,Mazar Road, Mirpur-1,Dhaka-1216','Methodist English Medium School','2019-11-27 06:43:17','+8801713117967','male',NULL,'Darussalam','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/133/marksheet_previous/dNeLuByaToVrAvzce7ox0rBCQxFwiUDBWpi1Kqpx.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/133/marksheet_previous_two/E2MbW3I9oC8lLtt72BCaTsslUa1m6urIZ7zJacC1.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/133/marksheet_current/kDvWhyvrksqTVh31eh70RHtuFqi0x5CqdZ36QM0Y.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:19',NULL,1,2,NULL,'I have vision disability','BY0367300','2023-12-26','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/133/student_passport/deQtG2WQFBTirBrURQcGqnOodLed2srfkuEIUdph.jpeg','Dhaka',2,'4820605424814',1800000,2,'3705815037',800000,'Dhaka, Dhaka',1216,'Darussalam','Subrata Edward Gomes','+8801711703942',NULL,1,NULL,1,NULL,'I always want to visit other countries so I found this opportunity. I am also very much interested to learn about other cultures. There are tons of beautiful places in America that I can visit that I have only seen in movies or pictures. I can also taste the American foods. I can also experience a new lifestyle of an American teen that I had never had. Furthermore, I can make friends with people from a different country, and from them, I can learn about the culture and customs of America. I can develops skills that didnt know about I had and I can also improve me.   I will also learn to look at the world from a different perspective. More than that, I can gain a new Family.','I would like to share all the aspect of Bangladeshi culture with my American family that I know. First of all, I would like to tell them about our festivals and how we celebrate in Bangladesh. Pohela Boishakh the first day of Bengali year. In this day many concerts happen across the whole country start from the morning many people attend them by wearing new clothes. Cricket and football are the most popular sports in Bangladesh.Steamed rice is very popular in Bangladesh and is served with other dishes.  Rice is usually served with vegetables, egg, different type of soup, Meat and fish curry. Bangladeshi also eat lots of sweets which are mainly made of milk namely, rasgulla, shondesh, rasmalai, chom-chom and many more. Bangladeshi men normally wear Panjabi,  lungi and fotua. The women also wear a traditional dress Sharee mainly in festivals or any other popular dress like Salwar kameez, they would like to wear. I would also like to share the history of the Bangla Language Movement',1,'A Friend',NULL,2,'2019-11-20','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/133/school_seal/4rTCy9zJ7SofW7x4NA7oknIthxWHPYnkqun3tNNQ.jpeg'),
	(25,'Sabyasachi Dash',2,0,NULL,'Habiganj, Sylhet',NULL,19,'First of all, I have no experience of participating in a community service . But\r\nif I get the opportunity, I will like to do that in the field of education .\r\n\r\nBecause, a good number of people in our country are illiterate . Though our government has lessened much the cost of education as well as provided much opportunities, the illiteracy is not decreasing with a significant number because the children are not taught the importance of education ! And also there are some places where parents don\'t want to relate their children with education .\r\nI will try to work for  creating a concussion among people about education and also try my best to get them understood of the importance of education. And to spread my service, I will start working from the remote areas.\r\n\r\nThen, it is my believe that, I will be able to bring a specific positive change in my community through my community service .',NULL,'1899,Garningpark R/A,Habiganj',NULL,139,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/139/certification/VF4LTT3gB7bT9jxafeS6IZ5abCMcHBJLM7Yh1bvw.jpeg','Bangladesh','10',9,8,'01993396127','88','2004-06-10','dashsabyasachi1234@gmail.com','https://web.facebook.com/sabyasachiannoy.nirjhar.7','1','1','1','01915082295','hcdnitai67@gmail.com','Hemendra Chandra Dash',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'NIrjhar',NULL,'01675001601','ritabiswas4790@gmail.com','Rita Biswas',NULL,NULL,'Teacher',85,89,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/139/student_photo/dgMGAE5NsPXb1lOWjRakOm43iw0WlHu2rG4dKImj.jpeg',NULL,'3300','1',NULL,'Tinkona pukurpar rd,Habiganj Sadar','Habiganj Govt. High School','2019-11-27 06:43:17','083154341','male',NULL,'Habiganj Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/139/marksheet_previous/cncwJ4Wq8Ws5LKyAaxuGrJSyDgEUugF276i07N6o.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/139/marksheet_previous_two/0xWrY6CSyV1hzIKtN4JKCspjwkESvq59XO9voYRB.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/139/marksheet_current/KovVO2NqQwMA8mUGKQdeXNPk0KlHm4h7hqr5Qc95.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Habiganj',2,'3611194340793',180000,2,'3611194340794',350000,'Habiganj, Sylhet',3300,'Habiganj Sadar','Sheikh Alfaz Uddin','01716870494',NULL,2,'India for family tour',1,NULL,'I want to apply for the YES program to share my country\'s culture and also to know about American culture . I also want to develop my ability of leadership and to create the vision of globalization . In brief,actually I want to apply for this program to develop me as described up as well as to be a part of this great initiative !','I wish to share language and literature  of Bangladeshi culture with my American family.\r\n\r\nOur literature is very rich . I will specially help them entering  to the big world of our literature and show them the unopened rich sites of our literature . I will also tell them about those great Bangladeshi litterateurs and their legendary works  .\r\n\r\nI also want to share our culture of language with them . I will tell them of our glorious and bloody history of our language - for example, how our language martyrs had given their lives for our language . I will help them to know the enrichness of our language .\r\n\r\nThat\'s how I will try my best to share these aspects of Bangladeshi culture.',1,'A YES Alumni Member',NULL,2,'2019-11-23','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/139/school_seal/qWeF1Vfrogm4MWGd7VYsCYKdHtYI8V7gTrbnOTqT.jpeg'),
	(26,'Justin',2,0,NULL,'Dhaka, Dhaka',NULL,19,'If I get the opportunity to bring a specific positive change in my community through community service, I will build free hospitals. Hospitals are important. People die everyday through accidents or by getting sick. A person should go to hospitals if they have an accident or if they get sick. Sadly, the poor cannot afford going to the hospital. Even if they get, they do not get good service. I want to stop this. If I ever get a chance, I will build free hospitals for everyone. It will have great service for both poor and rich. \r\n\r\nMoreover, I will build free schools so that the ones who cannot afford going to schools can go to school and receive good education. If more people are educated than there would be no boundaries between poor and rich, and the country would be a better place to live in.\r\n\r\nFurthermore, I will also provide housing for the poor so that they don\'t have to sleep in the open.\r\n\r\nI believe that these changes will affect the community positively.',NULL,'105/9 (1st Floor), Monipuripara, Tejgaon, Dhaka',NULL,145,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/145/certification/8geiNB5NGnfgcLKooKU40atct2HwqqhQ6MLqyzvn.jpeg','Bangladesh','10',9,8,'+8801850263891','90','2004-04-04','justindcosta1202@gmail.com','https://www.facebook.com/JustinDCosta4','1','1','1','+8801768255587','andrewdcosta003@gmail.com','Andrew D\'Costa',NULL,NULL,'Chef',NULL,'1',NULL,'@justin.d.costa','D\'Costa',NULL,'01768255587','mariadcosta080@gmail.com','Maria D\'Costa',NULL,NULL,'Unemployed',88,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/145/student_photo/0ADV2FklBS8kk4GwphSgSNSS0xthAxDddbaqYbYW.jpeg',NULL,'1215','1',NULL,'105/4, Monipuripara, Tejgaon, Dhaka - 1215, Bangladesh','BACHA English Medium School','2019-11-27 06:43:17','+88029114525','male',NULL,'Tejgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/145/marksheet_previous/gmCuelfJUFMhhscfP2hvAzqnau4FY3VdpDAnEz9K.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/145/marksheet_previous_two/jmgPhszrnxlRBUQG6EApUu54XJhQwKO7hx8acOBq.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/145/marksheet_current/ibxjGI0CPAxZ1UTZyKp3VYIrFCwKw5u3SDYZlGEw.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'2699040707393',600000,2,'2699040707392',-1,'Dhaka, Dhaka',1215,'Tejgaon','Sr. Miriam Perlewitz. M. M.','+88029114525',NULL,1,NULL,1,NULL,'I want to apply for the YES program because I see this program as an opportunity to meet new people and get to know about new things. I want to know about the culture of the people in the USA. I want to know how they are, what they do, and more. Not only that, I want to know them and learn from them, and I also would love to share all my knowledge about Bangladesh and its people and culture with them.','I want to share my language(Bengali language) with them. I want to do this by teaching them some words or sentences in Bangla, at least the basics because the language will be hard for them to understand and also remember.\r\n\r\nI want to share our cultural food with them, such as Panta Bhat and Hilsha fish, Biryani, Dal and more. I want to do this by cooking them these dishes and give them the real taste of Bangladesh.\r\n\r\nI even wish to share our cultural clothing style with them. Clothes such as Panjabi, Sari and more. If possible, I would love to take this kinds of clothes for them, as gifts.\r\n\r\nI would also love to share about the cultural festivals that we celebrate in Bangladesh. Festivals such as Pohela Boishakh, Eid and Durga Puja. I would tell them how we celebrate these festivals and why we celebrate them. I will share all my experience about these festivals, with them.',1,'A Friend',NULL,2,'2019-10-25','2019-10-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/145/school_seal/DaGYzCdrZg7sSu5x1fFbNT2fNTOTXF1tUcyGNaBd.jpeg'),
	(27,'EASTERLY',2,0,1,'Mymensingh, Mymensingh',NULL,19,'Im fond of engaging in community service & create change in the community. From last 3 years Ive been working with the Taiz Community as a volunteer in Mymensingh. I visit \'street children\' every week with Taiz Brother & distribute toys, color books, pencils & other things to them. We also teach them about health, hygiene & sanitation etc. Now, I have a close connection with the poor & street children. Whenever they saw me they hug me & tell me about their problem with a lot of hope.  \r\nI went to many places with my father to give relief to flood victims. Me & some of my friends made a club named Peace which motto is If you dont need something, give it to them who need these.  In winter, we collect blankets, warm clothes to distribute among the distressed people. \r\nI hope that Ill continue my activities. If I get chance I can do other volunteering activities like these. In future, I want to open a school for the street children who are deprived from the light of education.',NULL,'CCDB, Women Degree College,Fulbaria, Mymensingh',NULL,151,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/151/certification/vYfYzHOMrkGQQUTGTIzolniVaIZOFjeNhqtQxN42.jpeg','BANGLADESH','11',10,9,'01307908370','60','2003-09-18','easterlydobey79@gmail.com','https://www.facebook.com/easterly.dobey.7','1','1','1','01795371390','richardccdb@gmail.com','RICHARD DOBEY',NULL,NULL,'Private Job(NGO)',NULL,'1',NULL,NULL,'DOBEY',NULL,'01776685171','easterlydobey79@gmail.com','ELI BAROI',NULL,NULL,'House Wife',87,59,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/151/student_photo/xNccUj4nptKuqaWV4QepSErCj0ESxDQmDoKdvbUo.jpeg',NULL,'2216','1','N/A','1 NO,COLLEGE ROAD, MYMENSINGH SADAR-2200','Govt. Ananda Mohan College','2019-11-27 06:43:17','091-66769/091-66859','male',NULL,'Fulbaria','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/151/marksheet_previous/KSZVGlWL3u1lTeLHUWVnOIfrZL01P1JFLjFpXf7p.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/151/marksheet_previous_two/dDNB8fn4PSSE6hXY5atmhMg1gCHGsimrARAVtF57.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/151/marksheet_current/KWbVvPN6eTNlUFNhPCafYEbvBPNdKq7pJLuNwWCo.jpeg',NULL,1,NULL,'N/A',NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Naogaon',2,'7623907533248',490000,2,'7623907533249',-1,'Mymensingh, Mymensingh',5201,'MYMENSINGHH,SADAR','Professor Narayan Chandra Bhowmik','01536226922','N/A',1,'N/A',1,'N/A','Language & cultural diversity fascinates me from my childhood. To explore American culture, history, create memories & making friends are some of the reasons to apply for the YES program. I can know about American culture through the Host family & friends. It will give me an opportunity to show & teach them my culture, language etc. Through this program I can get to know about American education system as well as improve my social & communication skill are also factors to consider. Above all, its an opportunity for me to re-present my country as well as my community.','During my stay in USA, I can teach  the Basic Bangla Language to my host family members. We have our traditional dresses like lungi, Panjabi, sari. I will carry some of them for my host family & friends. \r\nI can also carry some musical instrument like flute, Aektara, small drum with me & teach them how to play these.\r\n  I love to cook & decorate my dishes. In our culture, we have our own food habits like eating rice with curry, various type of varta, hotchpot, fish curry, vegetables, different types of cakes etc .I will cook some of the dishes for them  & try to teach them how to cook Bengali foods. One of my favorite pastimes is collecting stamps, coins & I have some very rare collections. I will share my collections with them & encourages others.',1,'My High School/Teacher','N/A',1,'2019-11-17','2019-10-03',1,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/239/file/leUaLe6SOIZ0x3x32kHxhOXk4z2g4FEiQf91YWGc.pdf',NULL),
	(28,'Anik',2,0,NULL,'Jashore, Khulna',NULL,19,'Every man live in society. So every man should do social work .  I am a social worker . I take part in different social work. I get very pleasure by doing social work. Everyone should take part in social work. I will be very happy if I can do more and more social work.',NULL,'Hakoba,manirampur,jashore',NULL,152,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/152/certification/KKrmGqDpwqD29SKbc4TCB1JwVQx657YQ1fyuM8a5.jpeg','Bangladeshi','11',10,9,'01310202284','80','2004-03-04','anikdebnath2004@gmail.com',NULL,'1','1','1','01721515013',NULL,'Meher Debnath',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Debnath',NULL,'01768191970',NULL,'Taposhi Debnath',NULL,NULL,'House wife',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/152/student_photo/X68DimEu5YwiqBZ1NXGD1ivWcefJY0UWlb1lCcdi.jpeg',NULL,'7440','1',NULL,'Jashore airbase mtr','BAF shaheen collage jashore','2019-11-27 06:43:17','686019','male',NULL,'Manirampur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/152/marksheet_previous/5AKvgklleqnhwlIO5Vyt8XGye67DW8HBCxePcCGy.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/152/marksheet_previous_two/XeVQ6ZapHGz1bVq7a13O0AsaTF4hhUAoyHNnf4kn.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/152/marksheet_current/7pzEPoOOCqUQAQiH4mZAJS61TTbpmBsATwICQhO5.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-30 12:49:38',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Hakoba,manirampur,jashore',2,'4126101712465',12000,2,'4126101712459',-1,'Jashore, Khulna',7404,'Jashore','Md Moinul Hasnian','01769405574',NULL,1,NULL,1,NULL,'I want to learn the culture of different countries and teach them our culture so that we can know each other.','Bangladesh is a land of beauty.  I live in Bangladesh. Our Main food is rice. We eat fish, visitable and manything with it. Hilsha is our national fish. Panther ilish is a traditional food. Fried hilsha fish served with watre rice, onion,green chlies. We have different kind of sweet. There are many kind of sweets that called Pitha. Those are very sweet and delicious. There are many kind of fish in Bangladesh. So many kind of Dish make with fish. All those dish are so delicious and loving to all. So I want to share  about the food of Bangladesh to all so that they can know about Bangladesh.',1,'A Friend',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/152/school_seal/sauB59QtfGTHD0RKgNENrOUerLItYXm74rwcjC0P.jpeg'),
	(29,'Labiba',1,0,NULL,'Dhaka, Dhaka',NULL,19,'Bangladesh being a developing country, we have a big population that needs different kind of help. I have taken part in several community works in rural Bangladesh. I have given out warm clothes in winter to the villagers who have less than what I have. I have also done financial donation to the people in need using my pocket money. I have encouraged the other children in my class to help people as much as they can. Additionally, since my father is an ophthalmologists, he has carried out several charity sessions to treat poor people with eye condition in rural Bangladesh. I have helped him arranging these sessions. I have handed out the free medicines to the poor patients who couldn\'t afford those. I believe all these experiences in community welfare services will help me grow a bigger mind and personality that will eventually help not only the Bangladeshi people but also the world people.',NULL,'68/1 East Hajipara, Rampura',NULL,153,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/153/certification/JbfUiyFdTKyLrpSSwTfzj29OMuIRkhBwj78mtZXp.jpeg','Bangladesh','10',9,8,'+8801763832791','80','2002-11-21','mbintewa@purdue.edu',NULL,'1','1','2','+8801763832791','akmwaliullah@gmail.com','A K M Waliullah',NULL,NULL,'Doctor',NULL,'1',NULL,NULL,'Binte Wali',NULL,'+8801923865440','musbihabintewali@gmail.com','Roushan Ara Begum',NULL,NULL,'Teacher',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/153/student_photo/CKy5g1xBW29n3Vryb9dUHq7YFFCfJVFAx5WsJccd.jpeg',NULL,'1219','1','Indiana','25 Abhay Das Ln, Dhaka','Kamrunnesa Government Girls\' High School','2019-11-27 06:43:17','+88029561153','female',NULL,'Rampura','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/153/marksheet_previous/OAZWuPU5apDZfSURQ6POhRM0xTqb2r5ol7JNxhrx.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/153/marksheet_previous_two/2hxDe1qYOrVUpOLhkwsgeNXOqrgrqGMeuxcoouH4.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/153/marksheet_current/bWPCxvtkhpKt2g84L23VVhvzMogbxDSBYuCJsX0c.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BE0812692','2020-03-08','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/153/student_passport/Cv9GvvE2NPIU7kFahbTq6ejIe6Zi0RQeZe9MXhp3.jpeg','Dhaka',2,'2693623887491',300000,2,'19642693623887428',240000,'Dhaka, Dhaka',1203,'Motijheel','Obaida Banu','+88029561153',NULL,2,'Turkey for tourism',1,NULL,'I have an interest in mingling with people from different parts of all over the world. I dream to be rich enough to be able to visit all places in the world and see all culture. I came to learn that the United States is a diverse country, racially and ethnically. This country welcomes and accommodates people from different cultural backgrounds. If I go to USA I will be able to partially fulfill this dream of mine. My presence may also add to the rich diversity in there. I learnt that YES program allows a student to stay with a caring host family where the student gets not only the environment to build up their career but also opportunities that may broaden their horizons. I believe if I get to participate in this program it will be the greatest adventure of my life as well as a big step towards my pursuit for higher study.','I wish to share my Language and Cuisine with my American family. If opportunity allows I wish to teach a few Bengali songs to my friends in USA. Also I wish to introduce my friends to the flavorful spices we use in Bangladeshi foods.',1,'iEARN-BD Website',NULL,2,'2019-11-23','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/153/school_seal/yXhweSgJPgqHWS8HJvxa9ttxfChL3hjeppEg7Tx7.jpeg'),
	(30,'Senjuti',2,0,NULL,'Sylhet, Sylhet',NULL,19,'If I get this kind of opportunity in future, I\'ll make a well plan of serving the people before the project to make my service better.',NULL,'51/D, Sadipur, Shibganj, Sylhet',NULL,159,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/159/certification/o2UifFZdaCPTVLxoedhyomlbyQ5UmgRlNah7FzkF.jpeg','Bangladeshi','10',9,8,'01711983997','75','2004-01-06','senjuti.ds2004@gmail.com','https://www.facebook.com/profile.php?id=100021748908832','1','1','1','01711983997','himangshudas312@gmail.com','Himangshu Ranjon Das',NULL,NULL,'Teacher',NULL,'1',NULL,'@senjuti__','Das',NULL,'01717926323',NULL,'Sumita Rani Saha',NULL,NULL,'Teacher',80,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/159/student_photo/hWDAByX6x7X0BmdKdk9K0KeIXPpzVBB0L68vkgmY.jpeg',NULL,'3100','1',NULL,'Zindabazar, Sylhet','Govt. Agragami Girl\'s High School and College','2019-11-27 06:43:17','0821716237','female',NULL,'Shahporan','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/159/marksheet_previous/KkRLxvDtjg3aYsC4a1ceX2yw9sha6j3dEkTrFAv5.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/159/marksheet_previous_two/k3i4JgPdViQN2i1wJGLFd6frVFkpIoeYQmprIut5.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/159/marksheet_current/J6hRgjKlNHSuBu8SYzuL9BbUtmJDtNlAPgfbgR14.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BT0594956','2023-05-23','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/159/student_passport/wIcK9yOmAuSTlMsFuQPcX2652iu5feRwZqueH1KJ.jpeg','Sylhet',2,'6900619229',600000,2,'2850622362',300000,'Sylhet, Sylhet',3100,'Kutuyali','Babli Purkayastha','01718197713',NULL,1,NULL,1,NULL,'I can learn a lot from being with other culture for one year. Besides I\'m very interested to know about others culture. And yes If I apply for this program, I\'ll be able to share my culture too. So yeah this one year will be very beneficial for me.','Our mother language is Bangla. Sometimes I could talk to my American family by using Bangla. By this way they\'ll be able to know some Bengali words! Bangladeshi cuisine is the most attractive thing. The British introduced black tea, which is calledchain Bangla.Riceandfishare the main staple food ofBangladeshi people. The famous proverb \"mache bhate bangali\" translates as \"Bangali by fish and rice.\" Bangladeshimenwearlungi as casualwear(in rural areas). Due to the British influence during colonization, shirt-pant and suits are very common. Shari is the main and traditional dress ofBangladeshiwomen also and some young female also wears salwar kameez.The majorreligioninBangladeshis Islam (90%), but a significant percentage of the population adheres to Hinduism (9%). Otherreligiousgroups include Buddhists 0.6%, (mostly Theravada), Christians (0.3%, mostly Roman Catholics), and Animists (0.1%).',1,'Facebook',NULL,2,'2019-11-18','2019-11-18',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/159/school_seal/yjX9uY8igj7dU8DeGFdT2hCgEjjWNltjDWKRo6ej.jpeg'),
	(31,'Noushin Nur',1,0,NULL,'Chattogram, Chattogram',NULL,19,'Community service is most important thing for one\'s nation. By community service a nation can improve much. I have experience about community service. I plant trees, distribute educational thing between poor children, share food with street children, raise voice against noise pollution, clean roads, teach underprivileged children. By create awareness among folk, And tell them the benefits of community service I can bring a specific positive change in my community. In future if I have the change to serve the nation or society I will feel my-self bliss',NULL,'Bohodderhat, Barai Para, Chattogram',NULL,162,NULL,'Bangladesh','11',10,9,'+8801647533881','5','2004-05-18','noushinnur.com@gmail.com',NULL,'1','1','1','+8801814323489',NULL,'Md. Nur Uddin',NULL,NULL,'Carpenter',NULL,'1',NULL,NULL,'Tuly',NULL,'+8801814323488',NULL,'Hasina Begum',NULL,NULL,'Housewife',5,5,NULL,NULL,'4212','1',NULL,'Chawkbazar, Kapasgola Road, Chattogram','Kapasgola City Corporation Mohila College','2019-11-27 06:43:17','+88031656143','female',NULL,'Chandgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/162/marksheet_previous/Ula30StKmNOzJ8kpPKUB6OpVyKO8uIf5fPhNuVjW.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/162/marksheet_previous_two/dyKClQ1HPXmLUpdwpngxDonHiccgWCirB00BHkLL.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/162/marksheet_current/tV9Pj240aXjctWqOEBTOub9sn7RW8mRmuMexrX1F.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-30 08:35:43',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Chattogram',2,'7780741331',72000,2,'1930948953',-1,'Chattogram, Chattogram',4203,'Kotowali','Monwar Jahan Begum','+88031656143',NULL,1,NULL,1,NULL,'I want to apply for the yes program because I want study in Abroads. And I hear that U.S.A is one of the best country for abroads studies. Yes program can give me the best opportunity to get full-filles my dreams to studies in U.SA. I feel curious when I hear about U.S.A\'s cultures, education systems, peoples, histories etc from my \" Access teacher\'s. I think \"Yes- program\" can help e to clear my curiosity . I really want to past of the \" Yes- program Journey. I will be much great full to U.S.A embassy.','Our\'s country is culture one. In our country there are many culture and festival, like pohela Boishak,pita festival, hospitality. In regional festival like Edi-UL-Azhar, Edi-ul-Fithar, puja etc. If I ever have the opportunity to share my culture with My American family. I will be fell blessedness. I will cook our culture cuisine for my American family I will share my culture festivals with the. I will share ours cloth culture like \" Sub caste\'s\" dressing, ornaments, etc with my host family.',1,'iEARN-BD Website',NULL,2,'2019-11-21','2019-10-04',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/162/school_seal/NqeyoVN8EXKCGWAcNDGNkps1BbKyYG1AtYneqPKd.jpeg'),
	(32,'Asadullah Hill Galib',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Social service is not confined to those isolated deeds and works of charity towards the disabled, helpless or the poverty-stricken. Every one of us can render social service from their places if they pursue their own works honestly.\r\nFor me, I want to uphold the ideal of Help ever, hurt never as my motto and contribute a bit to make this wonderful world socially stable, economically efficient and spiritually strong. \r\nI want to contribute something to this world for my heart\'s content. I want to stand against poverty and work on environmental issues and mental health concerns. Though science and technology are dramatically evolving, these problems are still considered as global issues.  \r\nIn order to find out something that might help, I do research whenever I get time. Actually, everybody needs a purpose to live. I have found my purpose and that is- to contribute something for humanity and the mother earth which will make this planet a better place to live for everyone.',NULL,'House No#38, Rafique Housing, Shekhertek, Road No#9, Adabor, Dhaka-1207',NULL,164,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/164/certification/feCbJGPgiPj2oAgdLbyjXsMwExYAoruUjrZ1KnYY.jpeg','Bangladesh','10',9,8,'01931772317','80','2003-12-31','galib102938@gmail.com','https://www.facebook.com/asadullah.hill.galib.01','1','1','1','+8801707197611',NULL,'Md. Ashraful Islam',NULL,NULL,'Businessmen',NULL,'1',NULL,NULL,'Galib',NULL,'01718531127',NULL,'Mrs. Sheuli Akter',NULL,NULL,'Housewife',79,100,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/164/student_photo/L91MNtkZZGaRTGuD5fpskGMXr95OnXhqXw06vrtG.jpeg',NULL,'1207','1',NULL,'Mirpur Road, Dhaka-1207','Dhaka Residential Model College','2019-11-27 06:43:17','+88028118834','male',NULL,'Adabor','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/164/marksheet_previous/hCqyfvssx3SFPEEVI8rZgOnv2U0adeGS0kGvGNLO.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/164/marksheet_previous_two/0dZHXFoD8uDlnLQcjgOddxKhQwzI3eHtafcUyKmY.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/164/marksheet_current/NLHuqLt1f55WqdyH8NWzOem5YYfKiaofLrLzekfe.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Thakurgaon',2,'4195807484',360000,2,'5545848862',36000,'Dhaka, Dhaka',1207,'Mohammadpur','Brigadier General Kazi Shameem Farhad','+88028118834',NULL,1,NULL,2,'My Cousin','Traveling, meeting with new people, sharing the facets of my origin and assimilating into versatile aspects of a different culture has always fascinated me inevitably. \"YES Programme\" enables a global platform for students to spread the harmony which lies beneath in every distinct culture. By grabbing the chance I want to be a part of this community, from where I can be a member of a new family in another country, make a group of new peers, learn a bunch of new skills through discovering myself in a new social atmosphere, earn leadership experiences and become an ambassador to my country and my culture on International arena along with studying into a remarkable academic environment. Hence, this opportunity gives me a chance to achieve my dream to view the world with a different lens, enhancing my alternative perspectives.','I have prepared a list of tasks that I intend to do in future after getting the chance of representing my culture in the YES.\r\n The very first thing I would like to share with my new family and my friends is my mother tongue, Bangla.\r\n I hope to share the delicious taste of Bangladeshi Cuisine and craziness of Bangalis about food. Already I am in the process of learning to prepare different dishes of our traditional cuisine. I wish to decorate Bengali New Year platter with \'Panta Bhat\', \'Elish Vaaja\' and varieties of \'vorta-vaji\' for them.\r\n  Along with language and foods, I have planned to share the tradition of our culture-the typical Bengali apparels- Saree, Panjabi, Pajama, Orna, Kamij, Selowar-kami, Lungi, Gamcha. I have intended to take a few samples there. \r\n I want to celebrate all the religious and traditional festivals with them to spread the non-communal ideology. \r\n After all, it would be my delight to let people know there about our traditional essence, heritage and history.',1,'A YES Alumni Member',NULL,2,'2019-11-21','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/164/school_seal/OPwAjCnYqVyAkkHAXzVNePKGenysN4psORgJ8wmD.jpeg'),
	(33,'Ahsan Ahmed',2,0,NULL,'Sylhet, Sylhet',NULL,19,'When I was a student of English Access Microscholarship Program, I had celebrated International Workers\' Day and participated a community service on \"Cleanliness\". I along with a team of Access students cleaned the roadside and made social awareness at Uposhohor, Sylhet.\r\n\r\nLooking at our interests on community services, one of our Access teacher and also an International Exchange Alumni at U.S. Department of State Nowrin Koly gave us a little fund from International Research and Exchanges Board-(IREX). Then me along with some Access Alumni made an action plan and we launched a workshop on \"Anti-Bullying\" with some students of class 8 and 9 at Muhibur Rahman Academy, Sylhet. There I taught them some valuable information about bullying behaviors.\r\n\r\nAfter few days later we, the Access Alumni organized a workshop on \"Cyber Security\" by ourselves at \"Hazrat Shahjalal Darussunnah Yakubia Kamil Madrashah\", Sylhet. There I taught the madrashah students, \"How to open an E-mail account\".',NULL,'79, Foysal Monjil, Showdagertula, Sylhet',NULL,166,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/166/certification/HI7xvJVaxdHhZRl6An4OkP2mbx0d2VEDiUk0wYYn.jpeg','Bangladeshi','11',10,9,'+8801300417266','84','2004-04-17','Ahsanahmedmuho@gmail.com','www.facebook.com/ahsanahmed.jmst','1','1','1','+8801716394727',NULL,'Md. Kawsar Ahmed',NULL,NULL,'Homeopathic Doctor',NULL,'1',NULL,NULL,'Muho',NULL,'+8801712321285',NULL,'Shahnaj Parven Rohima',NULL,NULL,'Swimming instructor',80,58,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/166/student_photo/I8MAMUgygIrZm18Chbanxmm3rTdrqfS2WUtNfhzA.jpeg',NULL,'3100','1',NULL,'Tilagor, Tamabil Road, Sylhet','Sylhet Government College, Sylhet','2019-11-27 06:43:17','0821-760435','male',NULL,'Kotuwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/166/marksheet_previous/ISsVQmMNIpFYgXSl2MFz7FK6lqi8H3iIo9Uioe2Z.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/166/marksheet_previous_two/SaZqx7fRKxmXPswwT3KQOtmyEuZssd6PmIHKUVDP.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/166/marksheet_current/QvTGDyDS10JKRsh9b11u9Wg1FToEa6S7xpmn5WXx.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Sylhet',2,'7350576000',150000,2,'6900508380',96000,'Sylhet, Sylhet',3100,'Sodor','Nasima Hoq khan (In charge)','+8801911453471',NULL,1,NULL,1,NULL,'I was a student of English Access Microscholarship Program,but now i\'m an Access Alumni. So, during this Access program I came to known about various kinds of culture of USA. But I couldn\'t learned all of them. I have so much curiosity and interest to know more about U.S. culture. I also want to study in different educational curriculum. So that, I can develop my learning ability.','While I will learn about US culture, in the main time I wish to share my Bangladeshi culture with my American family.\r\n1. Language: I will so happy to teach them my mother tongue Bangla. I will teach them by taking some session at home and everyday practicing them.\r\n2. I\'m a food lover. I wish to share some of our well known local foods. Such as;\r\n(i) Qurma : This curry is an unique food in Bangladesh. Basically it\'s made by mix of meat,egg and milk. I will cook this delicious food by myself.\r\n(ii) Hilsa Fish fry : This fish fry is the most popular food in Bangladesh. It\'s fried by mustard oil and onions.\r\n(iii) Pop cake : This cake is so delicious because, it\'s made by coconut.\r\n3.Clothing: I will share how we celebrate our Bangla New Year. I will gift them our traditional cloth. Such as: For men and boys-- Panjabi, Pajama, Lungi and for the women and girls-- Shari and Kamij.\r\n4. The women use Henna and Alta for fashion. People wear Nokshi katha in winter. I\'ll teach them how to use these.',1,'YES Program Website',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/166/school_seal/2qxEPIBznUPHkMHNEDP65QW3xRLOrmZ4hcnPWPT8.jpeg'),
	(34,'Md Jarif Mujahid',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Among my community services work, mentionable was raising fund for the winter clothes of homeless.\r\n\r\nIt was last winter. There was a social media event where organizers organized each team of volunteers from every area of our city. Each team worked for their own area. Our team raised fund from the people of our area and from various charitable organizations. We bought a lot of winter clothes from nearby thrift stores and distributed between the homeless people. We ensured the clothes of every homeless in our area. That was the best experience in community service till now. \r\n\r\nSpecifically my role in that event was to go door to door and asked for the money of our charity fund.\r\n\r\nOther than that, I have participated in various community service works. Some of them were-\r\ni)   volunteered in charity auction.\r\nii)  Participated in National Youth Service Day in April.\r\niii) Participated in a car wash and donated the profit to charity fund.\r\niv) Collected baby clothes and donated to new parents.',NULL,'Saudi Colony, Cantonment, Dhaka (Niharika Tower-11F)',NULL,168,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/168/certification/wYkYwTFiTNMJ9lGscHcPZATtyMFViKp9BnO3FQ7P.jpeg','Bangladesh','10',9,8,'01853639534','72','2003-08-01','mujahid.jarif770@gmail.com',NULL,'1','1','1','01921117811','hossainiqbal613@gmail.com','Md Iqbal Hossain',NULL,NULL,'Service Holdier',NULL,'1',NULL,NULL,'Mujahid',NULL,'01966606484','siddika.ayesha.phone@gmail.com','Mrs Ayesha Siddika',NULL,NULL,'House Wife',72,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/168/student_photo/jXu390foR4GYtxxzmSh2dq4AODx0oVj4vrQfr5O1.jpeg',NULL,'1206','1',NULL,'Jahangir gate, Cantonment','BAF Shaheen College Dhaka','2019-11-27 06:43:17','(02)8826100','male',NULL,'Cantonment','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/168/marksheet_previous/A3ffEvj3wMrSlLkPa3r87i2BFUDagKD9BPHEQLaI.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/168/marksheet_previous_two/CDGqr4rRDs4CBmTkHOjEDWUeHsaS5h0cYson3H3n.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/168/marksheet_current/Qe86tSqcDy0NDS6ArcYiiZHizslsh3rQXlrDu2Z6.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Khulna',2,'8205172474',720000,2,'1596541048242',-1,'Dhaka, Dhaka',1206,'cantonment','Shah Kawsar Ahmed Chowdhury','(02)9858440',NULL,1,NULL,1,NULL,'I want to apply in this program to primarily expose myself to a different culture while understanding the importance of tolerating differences in cultures. I want to be more flexible in my interaction and broaden up my mind between diversified cultural ethics. Further, I want to meet people from all over the globe to know about their lifestyle and history, and wish to experience their lifestyle. Of the many fascinations, I would love to hold my pride, history and culture on an international platform as a blessed Bangladeshi citizen.','I wish to share the history behind our language, the only nation to fight for language. Through mass revolution from 1947, we sacrificed our toil and blood and finally we achieved our mother language (Bangla) in 1952.\r\n\r\nI want to represent our cuisine to my American family and mention how remarkably our diet includes rice, fish, dairy, vegetables, etc. \r\n\r\nAs our culture is diverse, we bear variety in our clothing style in various ceremonies. So I will carry some ceremonial cloth with me to show them and explain their cause, reasons, and how unique our culture is when it comes to attires. \r\n\r\nOne of the most important aspect of our life is religion. I will explain my religion to my host family and will illustrate the very basics of it to give them a clear idea of my religion, and also mention the fact that we are a nation of multiple religions, and explain how we coexisted since our inception.Im equally curious to know about theirs.',1,'A YES Alumni Member',NULL,2,'2019-11-17','2019-11-17',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/168/school_seal/qsMjIZUE0NxEqGQAvz7TbrUDQ8X7fZKEpJgWlUPZ.jpeg'),
	(35,'Tashfin Tahsin',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have worked with \'Project Kombol\' in the year 2018. It was a project to help the needy ones with warm clothes in winter. I worked as a donation collector to collect money to be spent upon the purpose of the project. It was a really amazing project. I got mental-satisfaction after working for the poor ones. Community services are really wonderful and pleasing. It would be nice if I get the chance to give such services again and spread positivity.',NULL,'Flat no. 5i, Atashi Apartment, 109, Kazi Office Lane, Boro Moghbazar',NULL,174,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/174/certification/SBCDKzhPFtz2mnAZ7JC9VJVVIZ8pfLzerNm3uqoq.jpeg','Bangladesh','10',9,8,'+8801711249299','70','2004-10-16','tashtrbl.16@gmail.com','https://www.facebook.com/tashai1016','1','1','1','+8801713030195','kamrul.ahsan@fakirgroup.com','Md. Kamrul Ahsan',NULL,NULL,'Private Service Holder',NULL,'1',NULL,'https://www.instagram.com/tashtrbl','Moumi',NULL,'+8801711249299','akter.juma16@gmail.com','Juma Akter',NULL,NULL,'Householder',70,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/174/student_photo/FRhUDDttnF5847nOLVuLhmqytJfg056sjcDfTScU.jpeg',NULL,'1000','1',NULL,'Baily Road','Viqarunnisa Noon School','2019-11-27 06:43:17','+88029666359','female',NULL,'Ramna','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/174/marksheet_previous/uvFFp0UTGpoum6JqAf4kgjDZoohiPCYdQgxsdieH.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/174/marksheet_previous_two/2AWlIQvIowb2FAW3OE0kIIaEzhLLcTDbtnIY2hNf.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/174/marksheet_current/iww1jQQ1eeSFMuSKFm7APha0PdWnWeoDTD2JLQ6L.jpeg','https://twitter.com/tashfin011016',1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BW0935430','2023-09-03','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/174/student_passport/kL7q5VMUZuS35HRyGQt9mv8ks6Y7dUx3MSv8mt9a.jpeg','Narayanganj',2,'2692618513142',340000,2,'2692618513143',-1,'Dhaka, Dhaka',1000,'Ramna','Nazmus Sehar','+8801682332896',NULL,2,'Malaysia for a Family Trip',1,NULL,'I am interested to go out of my boundaries to know deeply about a different system and culture. I also think it is a program that helps to learn how to be more communicative along with being independent and self-reliant, which makes me concerned.','I would like to share the way of hospitality of our Bangladeshi culture with my American family, as it is very welcoming and uplifting. Side by side, I would like to share the Bengali cuisine, clothing and the language with them.',1,'A YES Alumni Member',NULL,2,'2019-11-13','2019-11-10',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/174/school_seal/OmOd5ZJphE35PCwQSOlqmZsqHxBBBtfZ9XaKY6CK.jpeg'),
	(36,'Sauda Hossain',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have participated in various voluntary activities but none of them were involved with my school as my school isnt involved in these activities but I like to work for the deprived people and see the happiness they get by my small contribution. I have done Ramadan Remedy18, Reviving Ramadan18, Ramadan Remedy19 and Reviving Ramadan19 it was of providing iftar to the deprived but the smile that was brought to their faces made me happier than they were and so I feel like YES program is a great platform where I can polish my voluntary skills and much more.',NULL,'272/6, Shahid Bodiuzzaman Road, Dhaka Cantonment, Dhaka',NULL,176,NULL,'Bangladesh','8',7,6,'+8801757098219','80','2005-05-11','sauda.sneha@icloud.com','N/A','1','1','1','+8801913497868','shawkat@mapleleafhotels.com','Md. Shawkat Hossain',NULL,NULL,'Businessman',NULL,'2','2023-06-05','@south_uh','Hossain',NULL,'+8801921167821',NULL,'Farzana Hossain Luna',NULL,NULL,'Housewife',84,83,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/176/student_photo/vM9zNxxKE88sHKxZ6FfJNRpyegTky5CsF0g39MEq.jpeg',NULL,'1206','2','Florida and New York','Road Number-27, New Mohakhali DOHS, Dhaka','Bangladesh International School and College','2019-11-27 06:43:17','+88029888413','female',NULL,'Dhaka Cantonment','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/176/marksheet_previous/xczpPCq5LspZUVWuaOm6Sh7iHUx25ioOR55h5qyh.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/176/marksheet_previous_two/lgclp8XW6oKccu9vwIbwrqAN9XnEumnUGZ0b1wPG.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/176/marksheet_current/bzj61z3Y2EqNHBmZ5go5ugm8kWxF0S1MtvmNICrc.jpeg','N/A',2,'21','Travelling',NULL,NULL,'2019-11-30 17:11:45',NULL,1,1,'N/A','N/A','BR0397499','2023-01-03','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/176/student_passport/BDzQfeha7xpWQhATayUfKZBW34r7ycGG2Cg6vZkU.jpeg','Dhaka',2,'7756292202',180000,2,'19726125207000002',-1,'Dhaka, Dhaka',1206,'Dhaka Cantonment','Brig Gen Gazi Md Solaiman','01769002420','Washington and New York',2,'India for vacation. America for vacation. Thailand for vacation. Nepal for vacation.',1,NULL,'If I am able to go to USA there are many things I can learn. As I am a Volleyball, Soccer and Handball player here I can improve my skills for either one of the sports. I can learn about their culture and teach the good thing about it to the people around me nevertheless I want to represent my country in an international platform and let the people over there know about how rich and diverse is the culture of my country.','I can teach them a lot of our Bangladeshi culture by showing them videos I have of various festivals celebrated in our country, wearing our traditional clothes, teaching them a bit of Bangla language like writing their names also some greetings and cooking Bengali food for them.',1,'A YES Alumni Member',NULL,2,'2019-10-29','2019-10-28',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/176/school_seal/tIYgkgd9If8sCQCpmb8BKEtMaHn7OaNErQ7EuABF.jpeg'),
	(37,'Tassen Raihan',2,0,NULL,'Dhaka, Dhaka',NULL,19,'If I have the opportunity to participate in a community service program, then I will try to bring a few specific positive changes in our community. At first, I will look out for the types of problem people in my community are facing. Then I will try to improve the living standard of the poor people and transfer them into a suitable environment, with the help of all the people present in my locality. I will collect money from people and repair the damaged roads. After that, I will gladly clean the roads and dirty places in our society. I will give my level best to provide poor people, their basic needs. I\'ll make different posters and banners to create awareness among people regarding various things. I will try to arrange different recreational sectors for all the people and make them happy. This is how I will bring specific positive changes in my community through community service.',NULL,'House-86, Road-17, Sector-14, Uttara',NULL,177,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/177/certification/BuefSHK3e418sCP0Ooc4vv98GEOELNXYyj1aen51.jpeg','Bangladesh','9',8,7,'+8801734859851','70','2003-09-18','tassenraihan.jr@gmail.com',NULL,'1','1','1','+8801713001377','gleh.bd@gmail.com','Md. Raihan Nabi',NULL,NULL,'Business',NULL,'1',NULL,'@trima_raihan','Trima',NULL,'+8801915163192','www.jharnaakhter12@gmail.com','Mrs. Jharna Akhter',NULL,NULL,'Housewife',85,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/177/student_photo/re96jVxoOeySVIZCTiD3j6S2KEtHSjX35BQyMa5a.jpeg',NULL,'1230','1',NULL,'44, Gareeb-e-Newaz Avenue, Sector-11, Uttara Model Town','Milestone College','2019-11-27 06:43:17','+880258957733','female',NULL,'Uttara (West)','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/177/marksheet_previous/ZeLGZA05IhK2A7mZqwSIhYp9WpgEs1tUSYLMuWJd.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/177/marksheet_previous_two/JIafX7vfCvqIgN3rD22AK6TefVedEfqutF81iArs.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/177/marksheet_current/JcjdLuic0oBIVXueQuWK6SNTrdZw5ED442r2lstb.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BN0007235','2022-01-02','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/177/student_passport/PfDdfL374JMGO29fra0YBJuSWUVQOMJVBJEVIYMc.jpeg','Dhaka',2,'461 952 1984',2000000,2,'506 944 0948',1000000,'Dhaka, Dhaka',1230,'Uttara (West)','Kamal Uddin Bhuiyan','+88027913437',NULL,2,'Malaysia for summer vacation. Singapore for Summer vacation. India for Winter vacation.',1,NULL,'I want to apply for the YES program to know about the culture of the Americans. Well, I am a Bengali and I have Bangladeshi culture. I am very proud of my culture. But I have a wish to know about the culture of other people too. I find it very interesting that different people have different ways to celebrate their own culture. I want to be a part of it. According to me, the YES program is the best way to fulfil my wish. It will be a great opportunity for me. I can know about the culture of an American family and make new friends of a different culture, through this program. Besides, I can represent the culture of my own country. The YES program will also help me to learn adaptation. It will teach me how to adapt and cope up in a completely new environment. That\'s why I am applying for the YES program.','At first, I want to share the language of my country with my American family. It will help me to form a nice bonding with them. While sharing my language, I will get more time to spend with my American family. As a result, our bonding will get stronger. Next, I want to share the Bengali cuisine with them. Through this, they will get to know about the Bengali cuisine and taste the food of my culture. It will be a proud moment for me to represent the culture of my country with my American family. I want to share my religion with them as well. They can get to know about my religion and religious activities. Another thing I want to share is the different kinds of Bengali festivals and what happens during that period. So, I want to share these aspects of Bangladeshi culture with my American family.',1,'Instagram',NULL,2,'2019-11-21','2019-10-07',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/177/school_seal/daj7NLpRWCyM1AWqxb2PEcjYaR9SrEEsQdkwKfkp.jpeg'),
	(38,'Faiaz',2,0,NULL,'Chattogram, Chattogram',NULL,19,'Community service is something I\'ve always been interested in. And for a while, ever since I\'ve been able to, I\'ve also invested myself in it whichever way I could, given the opportunity. For example, my school often holds events in which a lot of students take part in. There I always enlist myself in the volunteer group. Then we have to help in organizing a successful event by doing tasks such as crowd management, stage preparation, coordination, etc. I am also a part of the Red Crescent in our school where we\'re given a small training on first aid and other related tasks. We also do water duty during sports festivals for the participants, set up small clinics for the injured and such. Since last year I\'ve also joined a non-profit organization called \"Young Steps\" based in Chittagong. It\'s a youth organization that helps in providing charity to causes, holding certain events for motivating students and raising awareness for mental health.',NULL,'Hillview Housing Society, Road No. 2,Block A,House No. 38',NULL,182,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/182/certification/Ae7U7zo2wEyTExpQ1oI5bkQ9il8MofqqPcvCqW7F.jpeg','Bangladeshi','9',8,7,'01688406392','71','2004-08-05','Faiazjion@gmail.com',NULL,'1','1','1','01677085017',NULL,'Monir Ahmed',NULL,NULL,'Service Holder',NULL,'1',NULL,NULL,'Ahmed',NULL,'01688406392',NULL,'Rozy Akter',NULL,NULL,'Service Holder',71,77,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/182/student_photo/lQD6eFD69goIE4T3EIvdNjdY1hKQUFXTPbibZ6Tc.jpeg',NULL,'4211','1',NULL,'Nasirabad Government High School, CDA Avenue','Nasirabad Government High School','2019-11-27 06:43:17','031654131','male',NULL,'Panchlaish','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/182/marksheet_previous/DB6dnUOjbJEcBMORHvtA2O8QyGqgRICknHugJmIs.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/182/marksheet_previous_two/lxfvmXhocrH6YtZy9EVQdadABkVzz4qPYV9Xx3N4.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/182/marksheet_current/dogeLFI03FQrigZ0ymaLYDZ22oqChUirXrBOuqUj.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Chittagong,Bangladesh',1,'5518578496',500000,2,'19741595707245629',300000,'Chattogram, Chattogram',4000,'Panchlaish','Foridul alom Hossain','031654131',NULL,1,NULL,1,NULL,'I have always been interested in western culture ever since I was little. Their clothing, holidays, beliefs are VERY different from us here in Bangladesh. For me, going to America and experiencing their culture first hand would be a once in a lifetime opportunity. All the information I have is from either online media or Movies which are not always accurate, that is why seeing and experiencing the western culture first hand would be a great opportunity. Going to a new place and meeting people of various ethnicities will be an eye-opening experience, getting to know about new cultures and sharing my own culture is something I am looking forward to, other than that going to a new location and staying with a host family will be a very exciting experience. Various western holidays and Community events are something I am looking forward to, for example, Halloween, Christmas, Thanksgiving, etc. as they are not celebrated in Bangladesh.','Bangladeshi Cooking and Cuisine are something I\'d love to share with my host family, I feel like the spice heavy Asian foods we enjoy are not all that common in America, also sweets like \"bhapa pitha\" \"puli pitha\" \"nokshi pitha\" etc so Bangladeshi Cuisine will be something new for them. Sharing our local recipes would be an easy way to share our cuisine. Our holidays are also something that I\'d like to share with my host family as some of our holidays are exclusive to Bangladesh. Holidays like \"Pohela Boishakh\" and \"Bijoy Dibosh\" are examples of holidays that are only celebrated in Bangladesh. I would love to inform them about the various national and cultural events that happen throughout the year. other than that our traditional clothing is something that is very different from them, things like \"panjabi\" \"fotua\" \"saree\". Most of our culture is very different from their culture, so I am looking forward to sharing my culture and learning more about their culture as well.',1,'A YES Alumni Member','Someone I know is a Yes alumni and he suggested that I should participate',2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/182/school_seal/CQvxCIgX9I19NseAXzpa3ucxhzbrhf4Mnq4IZTMv.jpeg'),
	(39,'Shahtaj Qaium',2,0,NULL,'Chattogram, Chattogram',NULL,19,'My whole family starting from my grandfathers have engaged themselves in community services. So it is my utmost responsibility to carry out such actions.\r\nMy community services are not very wide enough. But I tried to do my best to help others. \r\nMy locality has many classes of people. Some of them are very poor and cant effort extra tution classes. So I helped the students younger than me in their lessons. Furthermore I supplied them with stationery and books free of cost.Me and couple of my friends also enhanced greenery of our locality.',NULL,'House No# 01, Lane No# 01, Road No# 01, Block #G, Halishahar H/E, Chattogram.',NULL,183,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/183/certification/9k1CHtQeTfW0fBWU6ttPIbKLwdi9Y6Tf0EELRH0v.jpeg','Bangladeshi','10',9,8,'+8801864479974','70','2005-02-28','shehetaj720@gmail.com',NULL,'1','1','1','+8801817204314',NULL,'Md Zahirul Khaium Chowdhury',NULL,NULL,'College Teacher',NULL,'1',NULL,NULL,'Qaium',NULL,'+8801864479974','hudamunmun51@gmail.com','Farzana Huda',NULL,NULL,'College Teacher',75,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/183/student_photo/5JnwgKBSwF7jttrRcR7WTVrdVMv8PInfkdAEJFl2.jpeg',NULL,'4216','1',NULL,'\"L\" Block, Halishahar, Housing Estate, Chattogram','Silver Bells Kindergarten and Girls\' High School','2019-11-27 06:43:17','+880312520643','female',NULL,'Halishahar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/183/marksheet_previous/4X62AEGCnEwsV0JmLadQ15NUZTMrQYZdHKXcCNlU.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/183/marksheet_previous_two/jKh7f7WQvBuRLDRJVWGHMusr7vdVDsnqmG5zTiGu.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/183/marksheet_current/9plAgotpwAoHjjobsPSVKmdVZfkvxiH39FcWnnVY.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BK0067653','2021-01-30','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/183/student_passport/5wxeqSncwXoGHC1T1qO6WWFose2GrWwzs3ZLuevl.jpeg','Chattogram',2,'9114935225',672000,2,'5514914729',168000,'Chattogram, Chattogram',4224,'Halishahar','Shajeda Akhter','+8801856405080',NULL,2,'India for a vacation',1,NULL,'I want to prove myself worthy in any academic and extra curricular activity. Morever I want to know what my position is compared to the rest of my fellow mates.','I want to share my language along with various traditional  attitude and songs. I want to teach them Bangla. I will tell them about the fun festivals of Bengalis as well as its speciality.',1,'A Friend',NULL,2,'2019-11-13','2019-11-13',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/183/school_seal/f7ZGPGpjH2lL4WwH0DS58ReIvZ4wOALj9Rwxdi8V.jpeg'),
	(40,'Tanzil',2,0,NULL,'Dhaka, Dhaka',NULL,19,'In the exquisite beauty of Bangladesh\'s nature, it is obvious that climate change is a real issue. It is already taking a toll on our already tarnished-by-humans nature. If provided the proper opportunity, I plan to lead and organize a cleaning campaign in the vulnerable parts of the Earth, including the United States of America. This means, eradicating the disposal of plastics and cleaning of wastage dispersed in and around of water bodies, forests, and habitation. Hopefully this will motivate the community into making themselves: the center of the problem in the wider spectrum, so that they too work towards a healthier and cleaner future. This will greatly help the community and specifically work in order to bring positive changes in our community, through an interactive activity for everyone to participate in.',NULL,'Flat: A4, House: 187/C, House Name: Prantik, Road: 9, Block: I, Bashundhara R/A',NULL,198,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/198/certification/kvEe8zYrVyETnJJcPu3PK1tGzwtthBKsLxchNz66.jpeg','Bangladesh','9',8,7,'+8801842625725','87','2003-10-14','tanzilkabir101@gmail.com','N/A','1','1','1','+8801711625725','marufkabir@gmail.com','A.S.M Maruf Kabir',NULL,NULL,'Teacher',NULL,'1',NULL,'N/A','Kabir',NULL,'+8801711868100','polly.jononi@gmail.com','Tanjum Ara Polly',NULL,NULL,'Job-Holder',77,83,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/198/student_photo/9FaFZj6bPto0loPnaaNHsDdTfAcwjeyMZBbbTU1T.jpeg',NULL,'1229','1',NULL,'House-36, Road-43, Gulshan-2, Dhaka','Bangladesh International Tutorial Ltd.','2019-11-27 06:43:17','9845983','male',NULL,'Bhatara','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/198/marksheet_previous/3kRpay3Qixt3eFQUgpdR7bRmSkjJWgoJGvIKN1y2.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/198/marksheet_previous_two/HsbltW0pbBuQ71wEHCXHxYuWyw68v6M39qCg2m1w.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/198/marksheet_current/IGijO2IXdFJYidd2XkZNMdRtY5tCYAtygqb7UzU9.jpeg','N/A',1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BM0661755','2021-11-29','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/198/student_passport/u9f9bNrlWAG1Noosfu2cD4J9SzfnJ40qrra1coBW.jpeg','Dhaka',2,'4174162604',1000000,2,'2696654358120',840000,'Dhaka, Dhaka',1212,'Gulshan','Ms. Lubna Choudhury','02-8821065',NULL,2,'France, Netherlands, Germany, Italy - 2018 (Winter tour), India - 2017(Autumn Break), Singapore - 2015(Summer Vacation)',1,NULL,'Learning about new cultures, have always had a magnetic attraction on me. Everything about how people lives their lives intrigues me to my very core. Being an extroverted person, I always deemed myself to be more communicable and transparent, to people in new environments. Hence, I wholeheartedly want to apply for the YES program to learn more about the culture, community and people of the United States of America.','I wish to share my extensive and exemplary culture, in all aspects feasible. Being a cook by hobby, I wish to share my unique and remarkable cuisine; which I plan to succeed by cooking some native land favorites to my American family. I also wish to share one of the few languages in the world, for which tens of thousands had sacrificed their lives happily. I am of course referring to the Bengali language. I wish to achieve so; by providing important pieces of literature, and extend my family\'s knowledge by providing the proper and exclusive meaning of the pieces. Last but not least, I wish to share my knowledge on creative arts. This means, I strive to extend my family\'s knowledge on music and theater. I have been active in the theater for the last few years, and took part in a film making course and acted on a few side roles in stage dramas. I plan on doing so, by showing my family graphical proof of certain actors\' and musicians\' work and even act on my own to properly demonstrate.',1,'A Friend',NULL,2,'2019-11-17','2019-11-14',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/198/school_seal/RicCyJNQuJtQ38txPZlCoyyS5RJEJTwvhwxpl3mv.jpeg'),
	(41,'Ivana Jade',2,0,NULL,'Chattogram, Chattogram',NULL,19,'In the past months the dengue epidemic has been a concerning factor all around Bangladeshi communities. There has been a rise in the death toll and people being admitted to hospitals every single day in the hundreds. Before this I have not had the opportunity to participate or to organize a community service project. However if I did have the chance and opportunity, it would definitely be raising awareness about the dengue outbreak. I think it is important for people who have less knowledge regarding the epidemic to be better educated, especially in the rural areas and around my community where I could definitely be a driving force against the Dengue. Our voices matter. And together with the help of my peers and as well as my elders I think I could make a positive difference.',NULL,'17 Alkaran Lane, Chittagong, Bangladesh',NULL,202,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/202/certification/8vHsq1sRaAf22kQT2qXciDOQyNChTNRbLRkGhvZ2.jpeg','Bangladeshi','8',7,6,'01713234493','92','2004-03-25','ivanadsilva25@gmail.com',NULL,'1','1','1','+8801741654687','newjan9@gmail.com','Newton Dominic D\'Silva',NULL,NULL,'Service Hold',NULL,'1',NULL,NULL,'Dsilva',NULL,'+8801713234493','salgadojanice@gmail.com','Janice A D\'Silva',NULL,NULL,'Banker',86,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/202/student_photo/csgnNN3tB7CLTYszy31NrmnaE9JFjyEFkbnETqnW.jpeg',NULL,'4000','2','Los Angeles','Nasirabad, Chattagram','William Carey Academy','2019-11-27 06:43:17','01910843483','female',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/202/marksheet_previous/3oEPaFL7aZOuG29vE4sEudo1EhKkT21lemR7BKri.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/202/marksheet_previous_two/SNtSScJ9cGY7AJaK8Fe7lzDydB22Uxr8bGsH2DPy.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/202/marksheet_current/gKLjEZTQyTxQIhQbRt7HIHGuc4kswhsFgtr7KDEH.jpeg',NULL,1,NULL,'n/a',NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/202/student_passport/0CQuWsaOhsyAkFbO85Z5pbIucbkixbRPhgIKYyAT.jpeg','Chattogram',2,'5970303524',600000,2,'1470281906',1100000,'Chattogram, Chattogram',4202,'Khulshi Police Station','Mr.Paul Beatty','01730359075','n/a',2,'Thailand for vacation',1,'n/a','Reasons to why I want to apply for the YES program is because I want to spread the diverse Bangladeshi culture and also experience the versatile American culture. I also am taking this as an opportunity to prepare myself and to get myself ready for higher studies which I plan on completing in the US, given the opportunity. I plan on applying for a renowned university in the US once I graduate from WCA, Bangladesh. Hence I believe I will greatly be aided academically by an opportunity like this. On a more personal note I would like to push myself and get out of my comfort zone. I would like to travel and experience a part of the world which intrigues me.','Bangladesh is a country full of lush greenery and diversity. Starting from our clothing to our cuisine, everything is unique in it\'s own way. If I were asked to share the best aspect of Bangladeshi culture, it would definitely be our clothing and fashion.\r\nBangladeshi men\'s casual wear in rural and urban areas is the traditional lungi with formal clothing being suits, shirts and trousers, occasionally. On cultural and religious occasions, men have traditional wear called, the Panjabi. In women, the traditional and main dress is the Saree, with young females also wearing salwar kameez.\r\n I think Bangladeshi fashion is simple yet very elegant and modest, hence I would be more than proud to let someone from a different culture know about my culture.',1,'A YES Alumni Member','N/A',2,'2019-11-21','2019-11-19',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/202/school_seal/PFyQswcC7jAKViedgYWgEGPitSkO4fVipLVZ6QBd.jpeg'),
	(42,'Md Maimun',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Till today i have not get any chance of participating in any community service work. But I have a strong desire to serve the community. If I get a chance for this I will surely participate in there. I have an interest to help the homeless and poor people by creating charity. By this way I can help the poor people by giving them food, medicine and clothes. I can inspire the people of my community to help the poor people by donating the change they get after purchasing any products no matter how small it is. This will bring a great  change in the community and the sufferings of the poor people will be less. I hope my service will encourage the other people of my society to help the poor',NULL,'Flat:6/A, MRF Gafur Heights, House No:335,Road-12,West Nakhalpara,Tejgaon,Dhaka',NULL,203,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/203/certification/onLlAScrdzLWTLnGgzyTPMODN2RbIX0sfWkTQrn2.jpeg','Bangladeshi','11',10,9,'+8801876886285','75','2004-03-02','mbm.pulak@gmail.com',NULL,'1','1','1','+8801674790916','mdmahfuzur56@gmail.com','Md Mahfuzur Rahman',NULL,NULL,'Retired (Private Service)',NULL,'1',NULL,NULL,'Bin Mahfuz',NULL,'+8801712592736','suraya.sultana.htc@gmail.com','Suraya Sultana',NULL,NULL,'Homemaker',91,82,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/203/student_photo/hf1hMpb8IYFJdfZI4SHhsDZTm4nq0TrfDfeXCpfx.jpeg',NULL,'1215','1','N/A','Shaheed Sharani, Dhaka 1205','Adamjee Cantonment College, Dhaka','2019-11-27 06:43:17','+88028872446','male',NULL,'Tejgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/203/marksheet_previous/X794wH74uoG9ndzlHnU1uU7X195TdF4UUpi0Djma.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/203/marksheet_previous_two/djVP9OZQDny8U2mrOeK8vCpiqzDOzysl4qAvHvwx.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/203/marksheet_current/y7jLuuc9fdPI8Z9zUbyLGUHtHuJkZA4McqiyIEJ0.jpeg',NULL,1,'0','N/A',NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,'N/A','N/A',NULL,NULL,NULL,'Dhaka',2,'1927645885',120000,2,'5077592409',-1,'Dhaka, Dhaka',1205,'Cantonment','Brigadier General Mohammad Hafizur Rahman','+88028872446','N/A',1,'N/A',1,'N/A','Since the very childhood I had a strong desire to know about the culture and lifestyle of the people of other countries. Thus I want to apply for the YES Program which is the best platform for me to known about the culture of the inhabitants of the USA. Besides, through this program there will be a chance to represent my country and our culture in front of them. And it is a matter of proud for anyone to represent one\'s own country in front of the people of the other countries.So, if I get the opportunity then I will represent my country as well as gather knowledge about the culture of their country through this  program, Thus I want to apply for YES Program.','Bangladesh is a country with lots of variations in its culture. The aspects of culture our country is not familiar to the inhabitants of western countries. So I want to share my ideas about the language of our country. Bangla is the mother tongue of our country, In 1952, the brave students of our country gave their life for the demand of Bangla as the state language. We are the only nation in the world to give life for the language. I can share this with my American family.Besides, I can talk to them in Bangla. Many videos and documents of that time are found. I can show them those videos and inform them how painful the way was for us to establish Bangla as the state language. Besides in our country various ethnic group live. They have their own language. I can share mu ideas about those languages with them. In this way I can share the facts about our language which is one of the most important aspect in our culture.',1,'iEARN-BD Website',NULL,2,'2019-11-14','2019-11-09',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/203/school_seal/zxxHjIorgprUQ09GgzdsVz2NLtKIpAJGsEHt9z6n.jpeg'),
	(43,'Nabiha Tahsin',2,0,NULL,'Dhaka, Dhaka',NULL,19,'If I have the opportunity,  I would like to stand beside the people who need mental support and a reason to smile. I am a normal teenager with normal parents. Even though I never faced any identity crisis or any other family problems, I sometimes found myself becoming vulnerable because of the absence of a hand which could pull me towards happiness from the corner of my \"perfect \" room. Since I am aware of the pain it causes, I am willing to extend my hand towards them to pull them away from their pains and be a reason behind their smiles because it would ultimately make me smile.',NULL,'4,4/1, Dom Inno Clemencia, Malibag, Dhaka-1217, Bangladesh',NULL,205,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/205/certification/rzLEYlQj7XYeIlefAXwQPyQazBXSzkGiy442kTnq.jpeg','Bangladeshi','10',9,8,'+8801911341404','82','2004-04-21','nabiha21042002@gmail.com',NULL,'1','1','1','+8801911341404','mozahedulsalim@gmail.com','Mohd. Mozahedul Islam',NULL,NULL,'Business',NULL,'2','2023-07-21','@___nabiha.07','Islam',NULL,'01711151717','mozahedulsalim@gmail.com','Suraiya Akter',NULL,NULL,'Unemployed',74,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/205/student_photo/kjSVgW4YkRQwSHJODlOzP3MtElIUDQq3sLR5rDq5.jpeg',NULL,'1217','1',NULL,'1, A, New Bailey Road, Dhaka 1000','Viqarunnisa Noon School','2019-11-27 06:43:17','+880258310500','female',NULL,'Shahjahanpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/205/marksheet_previous/oxAskt284615aRVXo2BD0o1wjKDo7peorRZeVHn5.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/205/marksheet_previous_two/kHxouPPRDIxq4uw1d4qvUxeUQ6qCPDjdC5ADq7m1.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/205/marksheet_current/MCDPi1THEYwz8EZyGc1d4MmNyKTO5K8Vm4g4Y6DQ.jpeg',NULL,2,'20','Travelling',NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BK0226800','2021-02-16','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/205/student_passport/SO7EkT5Efuy98lCCTDiFsfOEitCVFpy712tEbr5O.jpeg','Dhaka',2,'5096051791',2000000,2,'2695434055381',-1,'Dhaka, Dhaka',1000,'Ramna','Prof. Fougia','+880258310500','I have traveled to New York, Washington DC, Chicago last year in August',2,'India, Germany and Switzerland for travelling',1,NULL,'Andre Gide once said, \"One can discover the ocean only if he has the courage to leave the sight of the shore.\" To me, this program is like the \"courage\". Once I have it, I can finally discover the \"ocean\" of diversity because of the opportunity this program facilitates to the youths all over the world in order to get to know each other. I believe interaction and a strongly built network with people is the base of gaining success at any level. By getting this opportunity, I can come in contact with people of versatile culture, society and behaviour which would ultimately help me to enrich my knowledge and enhance my strategies to interact with others. Furthermore,  this would also require me to live in a completely new environment than my usual one. Consequently,  i would be able to find out the pros and cons about my own survival instincts while surviving in a foreign environment and thus it would help me to evaluate my ownself and rectify my mistakes for the upcoming adventures.','People all over the world have the misconception to regard us, the Bangladeshis as Indians. This is mainly because of the dominance of Indian culture over ours and due to our anthropological similarities. However,  our culture is very much different from Indian culture. Actually,  our culture is a mixture of various diverse cultures. The most spectacular part of it is the mixture of both Hindu and Muslim culture. Another important aspect of our culture is the influence of six diverse seasons over our culture. Also, our country is known as the country of festivals. A proverb goes like, \"Baro maashe tero parbon,\" the literal meaning of which is \"Occurrence of thirteen festivals in twelve months. The most spectacular features of these festivals are that they are non communal and not bound to any religious community particularly. These cultural aspects, their glorious histories and stories of my country people would be the aspects that I\'m willing to put forward in front of my host family.',1,'iEARN-BD Website',NULL,2,'2019-11-22','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/205/school_seal/z10RtNALlK3NfLzeaPfpzkF0MAgN04Nb5Ey2hj3v.jpeg'),
	(44,'Lamiya',1,0,NULL,'Dhaka, Dhaka',NULL,19,'Since grade 6 I have been active in community service in and out of my school. It made me open to the world and made me meet new people from different areas of life. I did many projects in OIS community service club as a volunteer like warm clothes distribution, education for the school\'s staffs, shoe box project, anti-littering, etc. Later I was elected as the club president. I together with my club members initiated several projects in and out of school. The first project I began was the anti-bullying awareness followed by neat and tidy classrooms, iftaar Mahfil for school staffs and fund raising activities in different events like sports day or cultural events. To help the flood victims we even went outside Dhaka and interacted directly with the people. Often we go to old homes and orphanages. The recent project is about climate change and last month I led groups of people and marched a climate strike which was very fruitful. Voluntarily I work in Bangladesh Youth Leadership Center.',NULL,'CB 189/1 Kachukhet, Dhaka. Cantonment, Dhaka- 1206',NULL,218,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/218/certification/RU50qvRqN3KyMkCUjn4T41MZAJeTbZVTR0T75cb4.jpeg','Bangladesh','10',9,8,'01902727131, 01715537358','1','2005-10-09','lamiyaazom@gmail.com','https://www.facebook.com/lamiyaazomfiha','1','1','1','+8801715245472','azomce@gmail.com','Saiful Azom',NULL,NULL,'Government service',NULL,'1',NULL,'lamiyaazom','Azom',NULL,'01715537358','isratazom@gmail.com','Israt Azom',NULL,NULL,'unemployed',94,81,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/218/student_photo/EjkKgJp5F7G5EaUcw0RRsSJx18TdGCJUl1O6cMI9.jpeg',NULL,'1206','2','New York','House # 34, Road # 27 (old), New 16, Dhanmondi R/A, Dhaka-1209','Oxford International School','2019-11-27 06:43:17','9115392','female',NULL,'Kafrul','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/218/marksheet_previous/NrX3JXalPUcXLAobGAvUEMsEFEMIGZklyh2ngApe.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/218/marksheet_previous_two/ihwnVw5gCSWi5iVqE6hMHtEvZz7TkhY6XPG4KT0W.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/218/marksheet_current/28rGybah0PG1jYckY8vLmrvCpN3wG3snt4TGh2Qd.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BT0321153','2023-04-10','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/218/student_passport/6rA5h1JkbhjiWL1jFypDdrCTgmbkCTX4p3F3W37R.jpeg','Dhaka',2,'7311219120770',850000,2,'7311219121572',-1,'Dhaka, Dhaka',1209,'Dhanmodi','Dr. Shanthi Perera','9118156',NULL,2,'Indonesia for International ALOHA Mental Math Arithmetic Competition 2016, England for youth study camp 2017, Scotland and England for youth study camp 2018 and Germany for PASCH Jugend camp (German language and cultural youth camp) 2018',1,NULL,'Since grade 7, I have been following the YES program and tagging myself as an \"exchange student\" would be more than just a dream for me. I can say I am pretty much the candidate this program searches for (not to brag).\r\n Learning has no limit; we learn at every stage of our lives I believe through hardships, gaining experiences and getting new opportunities. Thus we get to discover our other selves and know more than what we knew before. I find a different version of myself every time I try something new. Human connection is very important to me as I am more of a person who likes to meet new people and hold esteem the similarities despite of the differences. Exploring new things and places and connecting have become my yearning. There are uncountable reasons why I want to apply for the YES program and these are few of the many reasons and I can go on and on. Through this program I really wish to see what else I can do, broaden my horizon and create an impact.','I believe whenever we get to to live with a group of people we share our lifestyle and way of living with them. The finest way to represent a country is by representing the culture and heritage of it.\r\nThe land of six seasons can be very well displayed by celebrating the cultural and religious festivals with the host community. Letting people know your culture through activities make them more curious and joyful. \r\nI want my host community to taste the food of Bangladesh by cooking for them the traditional items. We will together watch movies of our independent war that will represent the love for our language; I will teach them Bangla phrases for sure and how to write their names. \r\nDo not think this was ever talked about or not but I will let my host community know of the games and sports of my country like \'Hadudu\' or \'Dariabana\' and teach them. Inside my mind I always imagine my host family gesturing me with their hands full of \'Mehendi\' (henna) wearing Bengali attires!',1,'A YES Alumni Member','Also through Facebook and websites.',2,'2019-11-02','2019-11-01',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/218/school_seal/TisavxfODbniInUDWrWRELPaoqx5pGs6ZdChFUeK.jpeg'),
	(45,'Karibin hasan',1,0,NULL,'Dhaka, Dhaka',NULL,19,'We are all part of some community as human beings.  So I believe that as we keep our homes neat and tidy, it is our responsibility to keep our community beautiful and clean.  Our school is one of the few educational institutions in Dhaka city.  On behalf of the school\'s social club, I once went to a park cleanup in our area . In addition, I have taken a public-conscious action initiative in personal pursuit.  Many people in our building used to dry clothes in the stove.  To me, this seems a waste, and it seems to be causing a lot of damage to natural resources.  So I went to all the buildings in my area and tried to make the residents aware.  Not that everyone has heard of me.  However, I feel that I have done my duty.If I get the chance, I would like to have a public awareness campaign in my area.  I have seen people in my community not aware of the use of resources like electricity, water and gas.  People are not aware of it without being aware of it and do not even know the conseque',NULL,'151/1/2ka tilpapara khilgaon ,1219',NULL,227,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/227/certification/CXq6GwIvyPP2D5JiEnjeiuRmH9B5qTAOICvVycTd.jpeg','Bangladesh','10',9,8,'01906426721','50','2004-03-30','akonprangon@gmail.com','https://www.facebook.com/profile.php?id=100009079479265','1','1','1','01711278414','hasan73md@gmail.com','Md. Shahid Hasan',NULL,NULL,'Govt. service',NULL,'1',NULL,'@karibin_hasan','Hasan',NULL,'01732700959','sahidhasan78@yahoo.com','Mrs. Nasrin Akter',NULL,NULL,'Unemployed',50,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/227/student_photo/yOr3FOuE0BlJnJyi3V3hMSuCCyRpopIwnqkYA5zK.jpeg',NULL,'1219','2','Dallas','Motijheel,Dhaka-1000','Ideal school and college','2019-11-27 06:43:17','9330177','male',NULL,'Khilgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/227/marksheet_previous/w4diHZqQoMxWG8FAChVSkteI1Qy1zpgWxjGxgf9S.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/227/marksheet_previous_two/2cgLdAJ7I5NMfrBGSpFVrIib6T9btjbw1LQvu2h7.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/227/marksheet_current/ld5P3PicAIPAcMaYcASt0kU8zUlgJDMPshkSoi5k.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Kushtiya',2,'19731820704000007',800000,2,'2807483249',-1,'Dhaka, Dhaka',1000,'Motijheel','Dr. Shahan Ara Begum','02-9330177',NULL,1,NULL,2,'My cousin for the academic year 2010','In 2010 my cousin got scholarship and went to America via K-L YES program. Ever since i have been dreaming about this opportunity to participate in this program. My cousin told me how she worked there and everything she learnt from there. She was in Kentucky and she was the only Bangladeshi in her community.  American people came to know about Bangladeshand our culture. The family she lived with came Bangladesh in 2019 to attend her wedding too. That\'s why I think that the connection which is made by this program is forever unbreakable. I want to represent my country too. As a citizen of Bangladesh i want to show the good sides of our country. To be an youth ambassador K-L YES is the only platform in front of me. So I want to take part in this program.','Bengali language and Bengali culture is a matter of pride for every Bangladeshi.  So as a Bangladeshi, I want to highlight these two issues to my American family\r\n\r\n Bangla language is a language for which we did a language movement in 1952.  Because of this language movement, UNESCO declared February 20 as International Mother Language Day worldwide.  Such history is seen in very few countries of the world.  I will help my American family learn the small Bangla words.  I will teach them how the dominance of other languages such as English in the vocabulary of Bengali language  For this reason, we will also talk about the history of Bengal with my family.  I will also talk about how Bangladesh became independent.  This will allow my American family to know our country, know the history of the country, and in turn create a positive perception of Bangladesh.\r\n\r\n I will also share Bengali culture with my Americ',1,'My Family Member',NULL,2,'2019-11-23','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/227/school_seal/UWHjEQuAAHMEaYBt8ahOsFarOzhOaiaAUt4UvM5t.jpeg'),
	(46,'Ahnaf Abrar',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Firstly, I would like to mention that I am currently working as the President of Bhoroshasthol, a social service organization working for the betterment of the distressed, deprived and poor people of Bangladesh. Under my presidency, 150 people and 285 poor people were provided with food in 2 respective events; one in the holy month of Ramadan and another just after Eid-ul-Azha. Besides, as a scout, I also attend many social service programs including a Metro Camp in 2017 and International Scout Jamboree this year. I with my 2 friends founded the DRMC Social Service Club. I am also the to be Organizing Secretary of this club. Other than these, I also worked with the youth wing of Jaago Foundation, Volunteer for Bangladesh (Dhaka District) in a joint event between Jaago, Dhaka Metropolitan Police and Suzuki Motors. So, these are my little contribution in this sector and hope that no one remains unfed, clothless or shelterless.',NULL,'Flat: 2/B, House: 42 (2nd Gate), Road: 4/A',NULL,231,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/231/certification/oqjkRcnhQcyroW6z1dh338PznRvR34g1M69DVYtN.jpeg','Bangladesh','9',8,7,'+8801700731746','76','2005-07-30','ahnaf7399@gmail.com',NULL,'1','1','1','+8801711560911','mustafa786bd@yahoo.com','Mustafa Husain',NULL,NULL,'Bank Executive',NULL,'1',NULL,NULL,'Husain',NULL,'+8801713205397','mohosina786bd@gmail.com','Mohosina Khatun',NULL,NULL,'Housewife',90,78,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/231/student_photo/DzoeDgIwKoGdCFmabRvuircy3ZFEiJqvz5VHc8By.jpeg',NULL,'1209','1',NULL,'Mirpur Road(Opposite of Prime Minister\'s Residence)','Dhaka Residential Model College','2019-11-27 06:43:17','+88029135530','male',NULL,'Dhanmondi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/231/marksheet_previous/pZwXFrUKnjJBI65BYiPFfsKdguSBOjLsHJ9cWKYI.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/231/marksheet_previous_two/iMbbfHpNWY1wgEScRZys4kbJgNMylwbpcGeqRJ2Z.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/231/marksheet_current/vZEMNXO4My1vkawfhnzJS8C0zMwVlVLIA9cwkAMG.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BP0845477','2022-07-30','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/231/student_passport/8j5Nrwv6jiVtvcVS8fYHUml7Xz6MkBZTC0SpUq8c.jpeg','Dhaka',2,'552 323 8235',4796634,2,'597 349 1193',409560,'Dhaka, Dhaka',1207,'Mohammadpur','Brigadier General Kazi Shameem Farhad','+88029135530',NULL,2,'Malaysia for Vacation',1,NULL,'I want to apply for the YES program to learn the culture and traditions of the people of the USA. Besides, studying in such a country would be surely a great experience for me and this would help me to adapt to a new environment in the future. Lastly, I should mention that this experience will lead me to learn about international cultures from foreign students.','I wish to share the language, clothing and religion with the American Family. Making them learn some commonly used Bangla words will be a great way to share our language with them. Besides, I will be wearing Panjabi-Payjama on occasions to represent the clothing of the common people of Bangladesh. Being from a Muslim family, I would also share my religious views on certain matters so that they can get an idea about my religion. I love to eat but I can\'t cook all those spicy tasty foods of Bangladesh. So, it will be tough for me to share the cuisine by making myself but it will be completely okay to describe my cuisine culture.',1,'YES Program Website',NULL,2,'2019-10-31','2019-10-31',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/231/school_seal/fvB211SGTVzMJbNIXoQ7LxDn1V9IdjUBZlHIq6z7.jpeg'),
	(47,'Irfan Sharif',1,0,NULL,'Chattogram, Chattogram',NULL,19,'Personally I\'ve conducted some small scale social services like giving food to the poors, Cleaning my own school etc.But I\'ve always wanted to do a significant project. Recently I got a theme for my project. \r\nI want to create awareness among people about the severe effects of using Polybags, plastic cups other plastic materials in our environment.I want to give the common people and shop owners eco-friendly jute or hessian bags and paper cups.Many people in our country actually doesn\'t even know that plastic is non-biodegradable product which takes more than 1000years to decompose and pollutes our environment.While,Jute bags or plastic cups are bio degradable and decomposes easily.\r\nFor conducting such big project I\'ll need a lot more help. So recently I\'ve applied to be a member of \"Third Smile\" a social organisation that conducts community services in Chittagong.I\'m hoping to actualize this project with their help in 3-4months. If successful, this will help the whole human community.',NULL,'JomJom Tower, High level Road, Wasa Circle Khulshi, Chittagong',NULL,233,NULL,'Bangladesh','10',9,8,'+8801773670574','77','2004-12-17','irfanccs656@gmail.com','https://www.facebook.com/irfan.sharif.927543','1','1','1','01753442277','irfan.sharif770@gmail.com','MD. IBRAHIM',NULL,NULL,'Government Employee',NULL,'1',NULL,NULL,'Pulok',NULL,'01720065656','ukulsum656@gmail.com','Umme Kulsum',NULL,NULL,'Unemployed',75,80,NULL,NULL,'4216','2','Florida','Ice Factory Road, Chittagong','Chittagong Collegiate School','2019-11-27 06:43:17','+88-031-2863055','male',NULL,'Khulshi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/233/marksheet_previous/InFjG8nvn0iRMl8CNDML9TIsWu8HBNOFUYkaBBCN.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/233/marksheet_previous_two/q60TmtJRq3nsWQHduQBmKBvEwWepaBZEtPRIYuTk.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/233/marksheet_current/o9WCpOxK4VG72fLpEQRr1Ha29AmTGF38axEcKCyd.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,2,NULL,'I have a vision problem.. I use power glasses.',NULL,NULL,NULL,'Chittagong',2,'4168324491',200000,1,'8218110016',-1,'Chattogram, Chattogram',4200,'Double Mooring','Debabrata Das','01869295087',NULL,1,NULL,1,NULL,'I have 3 reasons to apply for the KL-YES programme 2020-21 session. Firstly, I want to experience and know the American culture, heritage and lifestyle. The program will allow me to stay with an American host family for a year which will help me to observe the American culture closely as well as sharing my own culture. Secondly I want to complete my higher education in abroad. Attending a global program like KL-YES would surely help me on that. Lastly, If we compare Bangladeshi and US education system we can see that US education system is far advance and effective. Kl-YES program will allow me to study in  US high school for a year. By doing so, i can observe their education system keenly and in future i can develop my country\'s education system by working in the Bangladesh education ministry.. Beside these facts, I\'ve never been outside Bangladesh, So I\'m hoping to gather a whole new experience by participating in the KL-YES programme.','When two differently cultured people spend a period of time together, usually both sides exchange some of their   cultural aspects.\r\n \r\nIf i get selected for the KL-YES program I\'ll try my best to represent Bangladeshi cultures to my host family and everyone else.For doing so,I\'ll gift them our traditional clothes as Saree, Punjabi,Lungi to give them conception about bangladeshi fashion. If possible,I\'ll also cook some bangladeshi foods for my host family and friends.Also as a muslim I\'ll practice my prayers everyday and go to mosque for Juma prayer,thus share my religious aspect to the Americans.In addition to these I\'ll try to write about Bangladesh and her culture in School Magazine which i think will be very effective in sharing our aspects and cultures.\r\n\r\nAs KL-YES program lets the participants to live in USA for a year,it\'s actually a great opportunity for sharing my culture and gaining knowledge about theirs.',1,'Facebook',NULL,2,'2019-11-14','2019-11-14',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/233/school_seal/V8tHvgS6LY0E2rj3T5H8Ke5VYmYQjlht19RfbVcV.jpeg'),
	(48,'Hossain Mohammed',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I\'ve once served for the \'\'DRMC IT Club\'\' on January, this year. I served as a junior member. We were a team full of enthusiased volunteers. We worked with one and only target- to arrange this event properly and no mismanagement. From 6th February to 8th February, the event days, we worked with all our mights, from morning, till night. We had been so busy that we couldn\'t even go to home to rest and relax as we feared that it may lower down our enthusiasm. We stayed those nights in our school hostel planning for the next day, next event. We distributed all the roles and works among us and hoped for the best. Next day, again, Woke up before sunshine, after only 2 hours of sleep, we started working and following the provided schedules. And after 3 days of late sleep and working, I could get all the rest I needed. It was hard, working as a volunteer, but I enjoyed it to its fullest. I won\'t say that we arranged a flawlessly successful program, but the hard works we did was very real.',NULL,'Intex Nadira, E-2 (3rd floor), Arambagh, Mirpur, Dhaka, Bangladesh',NULL,235,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/235/certification/EeOgXh49bQ2Hj4Q7WOesoSRpoPZ5XzceTuGNSdej.jpeg','Bangladesh','8',7,6,'01976682341','75','2004-12-20','hossainnahdi8051@gmail.com','https://www.facebook.com/hossain.nahdi','1','1','2','01730328441','mdmosharraf195928@gmail.com','Mohammad Mosharraf Hossain',NULL,NULL,'Service Holder',NULL,'1',NULL,NULL,'Nahdi',NULL,'01755650757','shahinamosharraf@gmail.com','Akhtarunnesa',NULL,NULL,'Unemployed',80,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/235/student_photo/FUr6uc95xd1497elKmWUqzYYAZ7pnDjB0CRWMYRL.jpeg',NULL,'1216','1','I don\'t have any relatives who is currently living in america.','Mirpur Rd, Dhaka 1207','Dhaka Residential Model College','2019-11-27 06:43:17','+8802-9129917','male',NULL,'Rupnagar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/235/marksheet_previous/O3o90KwgnXpSwYMee9JY8vgteRfHf2GOJjcEBjOj.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/235/marksheet_previous_two/bEo8RsdChCHWN6rgKNrKax8L8WdYt7WVFkTg3sUr.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/235/marksheet_current/qg8wQH64k3GoX40hL6XYN06K2V3EHyVI8qoZSy4p.jpeg',NULL,1,'0','My main purpose to visit America is to get quality study and educations. I also want to know about their cultures, their traditions and their lifestyles. I also have a sister who is studying through F1 Visa in America, and in the meantime, visiting her is',NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BJ0563653','2020-12-13','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/235/student_passport/0jWdOesk92vEtf4vMOQDy45mqHsZdxG2fOpXKrQU.jpeg','Dhaka',2,'2696406028361',30000,2,'6893245735',-1,'Dhaka, Dhaka',1207,'Mohammadpur','Kazi Shameem Farhad','+8802-9135530','No, I have never visited United States in my whole life.',2,'India for a family trip.',1,NULL,'I want to apply for the YES program in the purpose to get a better and quality higher educations. America is and was one of the best country to study in. I also want to improvise my adapting skills, the skill to adopt anywhere, anytime on a difficult or problematic situation. I also want once-in a lifetime experience to study 1 year and to know exactly how it feels.','I want to share Bangla language and Bengali\'s traditional lifestyle, clothings, and religional aspects with my American family. I want to tell them how it feels to be a Bengali and the things and aspects we are proud of. I have always lived a Bengali life using all these Bengali material and abstract cultures. So I want to represent then all those aspects I\'ve relied on to live.',1,'My Family Member',NULL,2,'2019-10-30','2019-10-27',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/235/school_seal/O22EpUPUA6PZWYKGQlhMnfWWlOW3dV3ljVfBcVGX.jpeg'),
	(49,'Areeba',2,0,NULL,'Dhaka, Dhaka',NULL,19,'A group of my seniors started the organization called \"We Live to Save\" which mainly focuses on climate actions and providing aid to people affected by climate change. I joined this organization as a volunteer this year. We had a success in our first event \"Clean to Save\" held in October in which we targeted a few areas and helped the local cleaners with waste management. We are also executing Tree Plantation and Dustbin Installation program. Currently we are also developing a fund to distribute food and clothing to the distressed people this winter. My area of work includes recruiting new members, helping with the outreach for events held by the organization and contributing to the contents for its social media handles and workshops - in which I spend about 6 hours a week. Besides this, I also work as a volunteer and Campus Ambassador in \"Oroddho\" Foundation which is a non-profit working on issues of social injustice such as gender discrimination, sexual harassment and violence etc.',NULL,'212/4-E, (2nd Floor), Lalbagh Road',NULL,236,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/236/certification/kXrH9etDPI9BwCdIx12b9ggzVfG7pAym2AvraSUg.jpeg','Bangladesh','10',9,8,'+8801880274977','80','2004-02-06','alia.ahanaf@gmail.com','https://www.facebook.com/areeba.afrah','1','1','1','+8801715816526','zamanarif.dhaka555@gmail.com','Kazi Md. Arifuzzaman',NULL,NULL,'Service Holder',NULL,'1',NULL,NULL,'Afrah',NULL,'+8801836535109',NULL,'Kazi Toiwoba Tahmina',NULL,NULL,'Unemployed/Housewife',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/236/student_photo/7HyXGvQTBC3ohWDhQiXhLivYsBnsK1r4DksxmhFC.jpeg',NULL,'1211','2','Maryland','Peelkhana, Dhaka','Birshreshtha Noor Mohammad Public College','2019-11-27 06:43:17','+8802-58613870','female',NULL,'Lalbagh','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/236/marksheet_previous/ptLKPXknZ2c6TK1xHPGnISdQpZKIbj94szDa3AKb.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/236/marksheet_previous_two/iXrGfnEbyX4wRwoukckCpwo2j90liBTZEO0X0IQo.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/236/marksheet_current/hDxSVV4gNgNu8Dgz1oQivuudlSMXGZ2UBDz9R4do.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'EB0858813','2024-09-08','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/236/student_passport/2rMbB0noG4uS9rCkPXHK3KKsWQvKjyUuty25F6wK.jpeg','Dhaka',2,'6856240335',240000,2,'2806368565',-1,'Dhaka, Dhaka',1205,'Lalbagh','Lt. Col. Mollah Mesbahuddin Ahmed','+8801769600206',NULL,1,NULL,1,NULL,'Dreaming of a world of harmony, diversity and good cheers all around, I have always envisioned myself being part of something that promotes the idea of multiculturalism. My avidity of knowing and working with people from different cultures and nationalities seemed to have found its happiness as I continued my research more into The Kennedy-Lugar Youth Exchange and Study (YES) Program. Applying to it is my first step towards achieving this dream. My integration into a family of different culture will let me grow closer to global diversity and enhance my personal flexibility. This program will allow me a mix of freedom, responsibility and accountability. I will gain experiential learning of confronting challenges outside my comfort zone or a familiar support network. Not to mention the endless opportunities I will be introduced to based on my skills and experience gained from this program once I successfully complete it.','The question should be what aspect of Bangladeshi culture do I not want to share. Because truly speaking, the melting pot of traditions and heritage that Bangladesh is, every single aspect of it deserves to be extended beyond borders. I think the easiest would be to share our food with my American family. I can cook Bangladeshi cuisines for them as well as teach them. I can guarantee they will fall in love with the Khichuri I learnt to cook from my mother. I love wearing Sharee and of course I will share my love for this particular attire with them too. I can celebrate Pohela Baishakh and Eid with them enjoying typical Bengali festivities and religious customs. And in my two years of staying with them, they will definitely learn a bit of Bangla from hearing me. They will love my Bangla music playlist just as much as I do. One thing I can confirm is that when my two-year journey with them comes to an end, they will undoubtedly miss the little Bangladesh they had at their home.',1,'Facebook',NULL,2,'2019-11-20','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/236/school_seal/qbKU4Vytmn76o81BCeF9r6Eo09KYZi6QpZfFHV0x.jpeg'),
	(50,'Xavier Plaban',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Yes, community or social service plays a great part. Not only does it play a great part in this program but also in our society. I am currently connected to a youth group name Bandon Youth Organization(facebook page link:https://www.facebook.com/bandhonyouthorg/). I am the Cultural Secretary of Bandon Youth Organization. I am learning a lot by working as a part of this organization. \r\nIt is not because I am Cultural Secretary, but in almost all the youth group the first priority goes to culture. Culture is also the main focus of Bandon. It also gives the young people a chance to reveal themselves to people. It encourages extra curricular activities like singing, dancing, music, art and games. It provides great opportunity to get ourselves connected together and share our ideas to each other. Specially for the current generation, who do not get the chance to meet and talk but sit down and chat with each other on social media. Overall, our main goal is to build up a better youth group.',NULL,'KA-118/19 Mohakhali',NULL,237,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/237/certification/bG83ee3OmXxNTq9PL6m7aH4KkZOhrCKSbwK7MUhx.jpeg','Bangladesh','10',9,8,'+8801302308614','100','2004-07-15','xavierplabanpiris@gmail.com','https://www.facebook.com/profile.php?id=100013891656839','1','1','1','+8801733456798','shishir.piris64@gmail.com','Shishir Louis Piris',NULL,NULL,'Computer Operator(contractual)',NULL,'1',NULL,'@mal_aime59','Piris',NULL,'+8801720959569','sara.mukta11@gmail.com','Sara Mukta Das',NULL,NULL,'Nursing',81,73,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/237/student_photo/NOt358QGRSWD6qlnWOVa9G0tNRV3uEeGdjIrh2Mb.jpeg',NULL,'1213','1',NULL,'105/4 Monipuripara','BACHA English Medium School','2019-11-27 06:43:17','+88029114525','male',NULL,'Banani','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/237/marksheet_previous/kPy8ol7uZlHlaTtpwLYY1BCqLDcoRnKeVgkBYAhn.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/237/marksheet_previous_two/cUUt0WC3n6ppb9LjdHwitFHMeLJjRGzjzSGav9Nz.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/237/marksheet_current/RVwr1Y0XC5jWFVjFcTeAykBVTA5tYXSYDc7Rrc11.jpeg','https://twitter.com/aime_mal',1,NULL,NULL,NULL,NULL,'2019-11-30 10:40:47',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'3313497648987',300000,2,'3313497648988',600000,'Dhaka, Dhaka',1215,'Tejgaon','Sr. Miriam Perlewitz, M.M.','+88029114525',NULL,NULL,NULL,1,NULL,'It gives me a very good chance to share my culture with the U.S. citizens and know about their culture. On the other hand, I have the eager to visit the U.S. at least once in my life time and this is the best opportunity.','Starting with language, it would not be easy to teach them Bengali but I hope I will be able to teach them at least some basics of Bengali language. Food and clothing are two obvious things that they need to know. I could cook some dishes for them so that they can taste what we eat and have a general idea about Bangladeshi meal. I am Christian yet I have enough idea about Hinduism and Muslim religion(the amount I learned from my friends, family and society) so I can teach them about Hinduism and Muslim religion besides Christianity. Except these, I would also share information about environment and how most of us live(quality of life). I also know a bit about political situation of our country, therefore, it would be great to share that too. I would like to say almost everything about Bangladesh so that I can portray my country to them as vividly as possible.',1,'A Friend',NULL,2,'2019-10-18','2019-10-16',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/237/school_seal/kqcDsrFytWF5sgFQUJHVQVrStagsAjK1VbdQUJBX.jpeg'),
	(51,'Sayeda Rubya Hassan Tashri',1,0,NULL,'Rangpur, Rangpur',NULL,19,'Community service is that \"feel good\" activity to me and I have been doing it from last four years.Few months ago,after getting admitted in 11th grade,I joined the Bangladesh National Cadet Corps as an official cadet which is the second line of defence and also a volunteering organisation.After joining BNCC I have done various social services as a volunteer. Every year in our we observe \"Clean and Green Program\" where every student cleans the campus and this year I volunteered near about 50 students which was both tough and interesting. I have also worked for an organisation named \"Youth Change Maker\" where I was the only female leader in my town.As a cadet,once I guarded for 10 hours at a stretch which was my toughest experience ever.\r\nSo,community service betters our community and everytime I do any social service, I can see the world differently which inspires to do it again and alao makes me more confident and I can feel the leadership aptitude growing on me each time.',NULL,'Nurpur, Alamnagar,Rangpur ,House no:11,Road no:1',NULL,238,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/238/certification/ayRcCx86LGAJ5ZpNw4GstvyW9NIWH50zeo8uFhZ2.jpeg','Bangladesh','11',10,9,'01744347242','92','2003-12-06','tashrihassan16@gmail.com',NULL,'1','1','1','01711851680','hasan@seastar-bd.com','Md.Saud Hasan',NULL,NULL,'Assistant General Manager (AGM)',NULL,'1',NULL,NULL,'Hassan',NULL,'01744347242',NULL,'Mst. Rabeya Bashri',NULL,NULL,'Unemployed',40,97,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/238/student_photo/qcO7j3wBNUP9jCUsmE45BtfTA1Sn4kdkAtRWu7NG.jpeg',NULL,'5402','1',NULL,'Rangpur Cantonment','The Millenium Stars School And College, Rangpur','2019-11-27 06:43:17','01723513973','female',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/238/marksheet_previous/0F77oYeBynyf0sYwUoir80Jw01omfxKE0HEo5cYR.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/238/marksheet_previous_two/BmjyAMVKPAdGEIbLLNW8SS7XHVFrOqIxql2GnoTJ.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/238/marksheet_current/hfeTw7kTrVcHi3wDbY2D1FjGCVVJsLncjVt1Tnz1.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'AB6536885','2017-01-24','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/238/student_passport/QyJNIqYqMik1IyaRWT02IlpFlpBlXUKovfQxkacJ.jpeg','Rangpur',2,'492114331924',686000,2,'9563775593',-1,'Rangpur, Rangpur',5400,'Kotwali','Syed Nazmur Rahman','01769663174',NULL,1,NULL,1,NULL,'Sayeda Rubya Hassan: It would be a matter of huge pleasure when it  will comes to represent my culture to the people of another culture while living with a host family and also get to knowabout their culture.I am very eagered to participate on such a program where I can not only share my own culture but also get to know about those cultures which are different  from my homr country and also get to live like an American teenager,can make lasting relationships with the host family and community,get to know about new places and meet new peoples.I always love  meeting with new peoples,making new friends and moreover when it comes to people from another culture, then it is more fun.Moreover,it can give me a chance to create cultural bridges between two cultures. So,I want to apply to the YES program to get an opportunity to exchange my culture in the American community.','Bangladesh is country full of cultures.The culture of Bangladesh includes the great history of Bengal,liberation war,lifestyle, folk musics,traditional foods and sports such as hadudu and much more.\r\nA very easy way to exchange culture like norms,language and ideals is through sharing entertainment. By watching movies,television series,reading a book together, tell a traditional folk tale,listening to a perform music, teaching them a cultural skill,cooking a traditional meal and helping them understand my native language is a great way to share my culture. Telling them my favourite thing about home will encourage them to tell me similar details about American culture and will help them to share their culture.',1,'Facebook',NULL,2,'2019-11-18','2019-11-18',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/238/school_seal/ZFlCZirlYAoiYPdaHOcuwvCXomX7LOuTKjdWkgNV.jpeg'),
	(52,'Muhammad Labib',1,0,NULL,'Rangpur, Rangpur',NULL,19,'I\'m a Quantier at Quantum Foundation. Quantum Foundation is an humanitarian non-profit organization. I work for the people. Mostly I lead many events to help the destitutes and poor people of different places of our country. We donate food and cloths during winter and during any natural calamities. Recently, we\'ve worked for the flood affected in the northern part of our country.',NULL,'House no:32, Road no:3/1, Shahjalal Road, Keranipara, Rangpur',NULL,246,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/246/certification/7VbpHQ4qPdzGJPDnyUNnBN7xEZ1txPfjZnraY0IV.jpeg','Bangladeshi','9',8,7,'+8801727024933','74','2003-01-31','labibsadademail3113@gmail.com','https://www.facebook.com/LabibSadad2003.TMSSCR.U.S.A','1','1','1','+8801712700941','nazmulhuda_76@yahoo.com','A.T.M Nazmul Huda',NULL,NULL,'Civil service',NULL,'1',NULL,'@labib_sadad_','Sadad',NULL,'+8801710044871',NULL,'Ayesha Anzuman Ara',NULL,NULL,'Housewife',62,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/246/student_photo/GE5dcn2Q3u8LaBYxk2MRYCEbrCJb8lSvEgx0osA9.jpeg',NULL,'5400','1',NULL,'Rangpur-Dinajpur Highway','The Millennium Stars School and College Rangpur Cantonment, Rangpur','2019-11-27 06:43:17','0521-64220','male',NULL,'Rangpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/246/marksheet_previous/rAnISzXBL4yjzoREl6oWqSuea7RMXkuebesiATN2.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/246/marksheet_previous_two/4PwS6dYqku8JGrunSBoaWkGRPn3dp1luCdI4O1FV.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/246/marksheet_current/vkXpCwVwEmnQKRmRb7NyIP7NyiUn5fAs3pwDLuVj.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BQ0881101','2022-11-13','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/246/student_passport/cJdtylqdvTlWd1VQeLTtjejsOHHxOcYZ5H9oBj42.jpeg','Rangpur',2,'7313658662595',720000,2,'7323602604962',36000,'Rangpur, Rangpur',5400,'Rangpur','Lt. Col Syed Nazmur Rahman','+8801769663174',NULL,2,'India in winter vacation',1,NULL,'Basically I love to travel. And most importantly I want to share our country\'s culture and obviously know other country\'s culture. That strengthens our brotherhood among the world. I love to gain knowledge. And if it\'s from renowned country like USA, then obviously it\'s a great opportunity for knowledge hunger person like me. If I\'m given a chance to represent my country, it\'ll be very proudful for me.','Yeah obviously I\'ll share about our cultural dress, our language, our religion etc with my host family. I\'ll teach them our lifestyle and the way we are mostly dependent for our livelihood in this country. I\'ll try my best to share my country\'s culture with them.',1,'A YES Alumni Member',NULL,2,'2019-11-08','2019-10-09',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/246/school_seal/cPWSIZmiP67B0WKv3SrRmXKcH2bHwnFt5goIB7Dv.jpeg'),
	(53,'RITWIK',2,0,NULL,'Kushtia, Khulna',NULL,19,'I have not work much as volunteers. But I wish to work as a volunteer for my society,poor,education deprived children by gathering experiences. Nowadays global warming is a buzzword. So I want to serve by taking part in tree plantation program, cleaning program etc. to make our world habitable.',NULL,'21 S.C.B. Road Amlapara, kushtia',NULL,251,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/251/certification/aPtsBj0GN0MLvHDMUplFyFJzZmD3vcoGe2WqJFhF.jpeg','Bangladeshi','10',9,8,'01718436445','86','2005-05-14','rrsonga15@gmail.com',NULL,'1','1','1','01716000759','songajewellers@gmail.com','Sugit Kumar Ghosh',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'GHOSH',NULL,'01718436445','ghoshmukite@gmail.com','MUKITE RANI GHOSH',NULL,NULL,'Housewife',74,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/251/student_photo/5m3zth8hlA8x36qrSgwWzle4VJhlS8q95D99FgZv.jpeg',NULL,'7000','1',NULL,'Mojompur, Kushtia','Kushtia Zilla School, Kushtia','2019-11-27 06:43:17','07161507','male',NULL,'Kushtia','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/251/marksheet_previous/Ef9sCAotTUS17tsNjXI79bgXoggKdJxEdRK8WB7G.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/251/marksheet_previous_two/5MgKuW2IhEAuRDzrAV4vHqxeysblSQ0n2ZQcJyTo.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/251/marksheet_current/AUsRzODrYhVSO4zUxVsQ6Wc11I6AgHCjTEHDBgpj.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,'2019-11-01',NULL,'Kushtia, Bangladesh',2,'4602395115',300000,2,'7302399410',-1,'Kushtia, Khulna',7000,'Kushtia','MD. Afte Khairul Islam','01714603030',NULL,1,NULL,1,NULL,'I want to apply for the program because I want to learn in a wide range. Whereas there is an opportunity to study along with the students of different countries of the world, I want to have the chance. Again I can uphold my country education and culture before the world as well as I can know about others.','I wish to share some aspects of Bangladeshi culture. I can cook some Bangladeshi cultural food. I will serve my host family those cultural foods. Again I will take some clothings like lungi,sari,panjabi etc. Apart from that I will try to communicate with them in cultural way to uphold Bangladeshi culture before them.',1,'Newspaper',NULL,2,'2019-11-19','2019-11-18',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/251/school_seal/Cw5oTDPFKP3R8TrgcYvyeANiFOvSaMXvBG7sZkkp.jpeg'),
	(54,'Sadiba',2,0,NULL,'Dhaka, Dhaka',NULL,19,'In Bangladesh it is quite troublesome for a female student to engage in social work or community service. This not because for the social conditions that has been prevailing since early years. But a psychological perspective male counterparts believe that females are not capable of taking up hard work or doing field work on daily basis. The age old believe is that females are to sit indoors and do the desk jobs and there some perspective that females should not do any kind of job other than doing the household chores. But I have taken part in my school club. Ive dreams and high hopes that I would be able to do community service and social work after I enroll in undergrad program in any of the reputed university. I also hope that I can use the experience and knowledge that will be gaining from this program in all over the country and also set up a new module to alleviate poverty.',NULL,'House No. 13/1, Road No. 2, Shyamoli',NULL,253,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/253/certification/Ci9ztvgNJsbdgHeYjduVFM8Gkrwp3F0EBK3a6mWN.jpeg','Bangladshi','10',9,8,'+8801302612616','72','2003-11-11','lekhon13@gmail.com',NULL,'1','1','1','+8801712116667','gosaifuddin@gmail.com','Saifuddin Ahmed',NULL,NULL,'Private Service',NULL,'1',NULL,NULL,'Ahmed',NULL,'+8801552380706','sherinakhter12@gmail.com','Sherin Akher',NULL,NULL,'Teacher',76,72,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/253/student_photo/iPcYIC2ZCeL92MdlQVq2XU8XvuRvsP5zAdLzFaap.jpeg',NULL,'1207','1',NULL,'15/1, Iqbal Road, Block-A','Mohammadpur Preparatory School & College','2019-11-27 06:43:17','+8801302612616','female',NULL,'Mohammadpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/253/marksheet_previous/bSP1ox2ZN1TTYtaAyvwW3GcAtI56IfTnROiuWuBK.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/253/marksheet_previous_two/ndRa1gNpMt3f9tEpfi3LlUA8B9rUlALJleqbSLrL.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/253/marksheet_current/a5enPomGwcZQBxHCTIqiJcgQdsaxijspzBhpfkoD.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'2832595892',2500000,2,'7782592617',1200000,'Dhaka, Dhaka',1207,'Mohammadpur','Md. Belayet Hussain','+88029112663',NULL,1,NULL,1,NULL,'As apart of Youth Exchange & Study I\'ve the opportunity to present my culture to the young and innovative minds from all over the world. YES Program allow us to understand the true meaning of global village a world without borders. Apart from improving my English, I wish to learn how the other innovative minds are planning to develop their country as we are the future leaders of our country. YES gives me the opportunity to exchange views with other young minds like me. I expect to enhance my knowledge and skills.','Bangladesh is the only country in the world that has six seasons and many festivals. I belong a country where people celebrate every festivals of every religion. We believe that religious views are of someones own belief but festivals are everybody. In my culture we celebrate not only Bengali New Year, we celebrate the cutting of new crops and also seasons. I would present my culture to the young and innovative minds who would be participating in the YES program through the songs and poetry of my country. I believe that my countrys songs and poems would help them understand my culture as many of my cultures song and poems are translated in English. It would be easy for all to understand my culture. My culture is a colorful and jolly culture and it would a delight to know the other cultures too.',1,'YES Program Website',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/253/school_seal/9phRRs6Bh7OlZWsiMbhCkINDkSQCudNwA9OZn2uP.jpeg'),
	(55,'Azizul',1,0,NULL,'Dhaka, Dhaka',NULL,19,'In order to participate in a community service I got several experiences by participating in Bangladesh Scouts.As a scout I got some opportunity to work for the community,such as giving warm clothes to the poor people in the coldest area of our country,distributing foods and medicines to the flood affected area\'s,tree plantation etc.After the completion of YES program I am sure that I will gather more ideas about community works which I can implement to my Bangladeshi communities.',NULL,'7/7 North brook hall road,Banglabazar',NULL,255,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/255/certification/2dvemOdRIziEDqtAF9k2LGtn7uWP3znl8wHPQ3y7.jpeg','Bangladesh','12',11,10,'01813849375','50','2003-10-16','azizulalam120@gmail.com',NULL,'1','1','1','01967134208','alam.ziaul.bulbul@gmail.com','Ziaul Alam',NULL,NULL,'Retired businessman',NULL,'1',NULL,NULL,'Alam',NULL,'01711124933','momotazb389@gmail.com','Momotaz Begum',NULL,NULL,'Housewife',75,60,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/255/student_photo/hadqhyYkQt8hHasVfvzzeGt6mbUb7YdFhTcQcccd.jpeg',NULL,'1100','1',NULL,'65 Central Road Dhanmondi','Ideal College','2019-11-27 06:43:17','0258612445','male',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/255/marksheet_previous/GqISnz1nmggZXGkgh2ZgqvG2rP0udh1sEXg5hs9z.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/255/marksheet_previous_two/TPLX9osbBOXlJduwyA9eOJKH0jdsLbrMVl6MyFo3.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/255/marksheet_current/NVok3WuyS6hMKUj1unYrFqcn17jWxDDiLVYNN2Dx.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'2694073732155',120000,2,'2694073723156',-1,'Dhaka, Dhaka',1205,'Dhanmondi','Jasim Uddin Ahmed','0258612446',NULL,1,NULL,1,NULL,'YES program is a platform where I can represent my dearest country by expanding its histories and  cultural heritage to the exchange students all over the world and to my host family. The most important reason for participating in YES program is to be self independent,confident and be able to cope up with other culture and community as well as to gain all the qualities to become a future leader.YES program will give me the opportunity to exchange the cultural and educational similarities as well as differences between U.S and Bangladesh.YES program is also a platform where I can meet with the international students along with the students of U.S from whom I can cherish and broaden my knowledge about the education system of the whole world.','To share a culture,all of these aspects(Language,Cuisine,Clothing,Religion,etc) I am willing to share.Because my country is all about these aspects.It has a majestic and great histories with these aspects.I will try my level best to share all of these aspects along with all necessary information about Bangladesh such as famous and historical places,history of independence and mother language,foods on different occasions,cultural program and celebration,natural beauties and most importantly the history of our mother language and liberation war.I wil also share about the great hospitality of the people of Bangladesh.Additionally I will also invite them to visit the beautiful Bangladesh.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-14','2019-11-14',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/255/school_seal/Gb5NkLtyFquBMzmcQNSgq1IxbvyfbenHeiBzKg6i.jpeg'),
	(56,'Md.Mehedi',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have done a let\'s clean Bangladesh in MARIA CRISTINA FOUNDATION. Through this program, I used to keep our locality clean by removing garbage and making people aware about this,So that they can live in a clean and hygienic environment. \r\nI will bring a specific positive change in your community through telling them about tree plantation;about the harmful effects of using polythene;about burning garbage in such fires, with emissions that can substantially affect human health and climate.',NULL,'House#718,Gawair,Kazi-Bari,Matir Masjid,',NULL,260,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/260/certification/UYaQnaS3VBg890BGKUCUqLR2mw3fmNIugI9Lg579.jpeg','Bangladeshi','8',7,6,'+8801828191563','64','2004-12-20','mehedihasanmcf0@gmail.com','https://www.facebook.com/mh0987','1','1','1','+8801828191563','hu543830@gmail.com','Helal Uddin',NULL,NULL,'Shopkeeper',NULL,'1',NULL,'N/A','Hasan',NULL,'+8801828191563','josnakhatun0987@gmail.com','Most.Josnara Khatun',NULL,NULL,'Unemployed',58,58,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/260/student_photo/09oqPPXhTw1qEmgOa9iaMpPB4lmOReqCAL0CxqNc.jpeg',NULL,'1230','1',NULL,'Sector#13,Road#05,House#41','Mahaad School','2019-11-27 06:43:17','+8801753-555222','male',NULL,'Dakkhinkhan','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/260/marksheet_previous/6hGN4Tc81309M81C4Tz3fi3tgLXr8arYh0XWSoxZ.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/260/marksheet_previous_two/fv5Em41oYuzwwXvbYQbSiMxAx6LufUyk96Rxoklk.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/260/marksheet_current/ue37vzEoU1EPI1VfFRUlNEjWqVa50Tjs69jKwoTU.jpeg','https://twitter.com/md_mehedi1234',1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'4627765581',800,2,'5952439924',-1,'Dhaka, Dhaka',1230,'Uttara Purbo Thana','N/A','N/A',NULL,1,NULL,1,NULL,'I want to acquire leadership skills, and engage in all activities to learn about U.S. society,values,their culture and tradition.','I will share my Bangladeshi culture to American family in various forms, including music, dance, drama; languages literature; philosophy religion; festivals celebrations; as well as in a distinct cuisine culinary tradition.',1,'Other','From MARIA CRISTINA FOUNDATION.',2,'2019-11-13','2019-11-12',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/260/school_seal/HtgbHpLnAumlqsQKXTJd6BzLYxokQPOCjCKYrjkK.jpeg'),
	(57,'Arafa',2,0,NULL,'Chattogram, Chattogram',NULL,19,'Last year I had the opportunity to participate in a community service project. It was the best decision i have ever made. I was given the chance to teach the underprivileged children Bangla and English at an orphanage. Education is a key to changing the world, and i wanted to hand them this key. They were very sweet and kind. I had an amazing time teaching them. By participating on this service, my prospective of everything took a 180 turn. I\'m not the same person who used to waste food, clothes, and so forth. Now I understand how blessed I am to have amazing parents, and to be studying in an American curriculum school.',NULL,'Road#1, House#48, South Khulshi, Chattogram, Bangladesh',NULL,261,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/261/certification/Ir2pFB0M3R2tC11Gt0esURZzC0Lgk8QllBAi7ktl.jpeg','Bangladesh','9',8,7,'+8801811481480','96','2004-01-03','arafaahmed510@gmail.com','N/A','1','1','1','+8801819310392','bazalbd@hotmail.com','Bazal Ahmed',NULL,NULL,'Businessman',NULL,'1',NULL,'arafa.aa','Ahmed',NULL,'+8801711348589','azizakarim71@gmail.com','Aziza Karim',NULL,NULL,'Unemployed',96,96,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/261/student_photo/qhgUE4H0EBULSr4XnoAJkYwq9CaFIv4xBGHR23hX.jpeg',NULL,'4225','1',NULL,'1986/A Zakir Hossain By-Lane, East Nasirabad, Chattogram, Bangladesh','William Carey Academy','2019-11-27 06:43:17','+880-31-652034','female',NULL,'Khulshi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/261/marksheet_previous/A9Rlp9yuOVGa4l6YuxtWBNXTVDCXmeUT9ZfSJi8U.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/261/marksheet_previous_two/OQVNYjwLqHlCtbjyeypRv9ZBrUXME4rOzbrC1OKr.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/261/marksheet_current/gaGPJ8r93LQS7z2btoCHiZaYD2Dr9g3AetPI1IAK.jpeg','N/A',1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'AA9239209','2021-11-26','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/261/student_passport/1Oy2FU4VdfVcdCSdEKXXVILe7njLR9FUC5gQFGge.jpeg','Chattogram',2,'465 145 9945',100000,2,'865 171 4175',-1,'Chattogram, Chattogram',4000,'Khulshi','Mr. Paul Beatty','+8801730359075',NULL,2,'Indonesia for summer vacation, Singapore for summer vacation, Saudi Arabia for religious pilgrimage, United Arab Emirates for summer vacation',1,NULL,'I want to apply for the YES program for various reasons. One of the major reasons being- to expand my cultural and educational horizon.I have always been surrounded by the same people my whole life. That is why I would love to befriend people with different cultures and backgrounds. I want to explore a completely new country while experiencing life as a local on a day-to-day basis. I have been dependent on my family my whole life, but with the help of this program, I would learn how to grow independently. I believe that this experience will help me develop a stronger sense of self; it will help me improve my social skills, communication skills, and improve my ability to adapt to new environments.','Bangladesh is the only country who fought for their language. I would definitely want to share my mother language with my American family. I would teach them Bengali words and share the story of our independence. Bangladesh is known for its delicious food as well. I would love to share Bangladeshi food by cooking for my American family.',1,'A YES Alumni Member',NULL,2,'2019-11-11','2019-11-06',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/261/school_seal/w3wVdvPyFMEiqIJgtDrMlztVHTZCcyRoZsEvv6kT.jpeg'),
	(58,'Syeda Nishat Tasnim',2,0,NULL,'Dhaka, Dhaka',NULL,19,'In this world, there are many kids who are orphans and handicapped and can\'t afford to go to school. If i have an opportunity, I want to help by educating them. I want them to know how it feels to write their name in their books and read the first lines of their text books on their own. Teaching them how to use a computer as technology is in the top level in this generation. These kid are the future of this country. I will take few hours from my daily schedule in order to spend time with them. As one great man said brightness and talent is in every kid. As getting education can help kids to be more smart and they can contribute by helping the country to be more advance and developed in the future. If I ever get an opportunity to help the kids who are in need and make them capable for their future I will be very lucky and proud of myself for doing it and not step back as not every people want to do it but doing this act will encourage other people to do it for a positive change.',NULL,'House No.7, Road No. 2, Block-B, Dhaka Uddayan',NULL,262,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/262/certification/SbNNRzZ72LftshWPQaGFhvB4lEv62fJv1GWPxew8.jpeg','Bangladeshi','9',8,7,'+8801315598267','64','2004-06-15','syedasadia150604@gmail.com','https://www.facebook.com/syedanishattasnim.sadia','1','1','1','01817094584','ugiomar@gmail.com','Syed Mohammad Omar',NULL,NULL,'Commercial Manager',NULL,'1',NULL,'@syeda_sadia97','Sadia',NULL,'01315598267','syedasadia150604@gmail.com','Syeda Shaheen Khanam',NULL,NULL,'Housewife',80,77,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/262/student_photo/c4XlPVhCvOnqEQlMLNE4Z5aXaBuZb1GRUAWtj7mA.jpeg',NULL,'1207','1',NULL,'8/7 Pallabi, Mirpur','Juvenile English Medium School','2019-11-27 06:43:17','01819285002','female',NULL,'Mohammadpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/262/marksheet_previous/Wwx9cFRksRhEs6iBBDF8RRiZDTNvc51m5zqNrZeA.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/262/marksheet_previous_two/gWofoapIJeB5JQWKxVGiCVUNrJoLnrMc5YJRhfyv.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/262/marksheet_current/TaSi0c7j1ptR3xphlIyQQq16bru2GYkbckUSiH3y.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,2,NULL,'Vision disability',NULL,NULL,NULL,'Dhaka',2,'4643342704',300000,2,'3743320321',-1,'Dhaka, Dhaka',1216,'Pallabi','Mini Musharrat Sayeed','01711635906',NULL,1,NULL,2,'My older sister for the academic year of 2017','From a very young age, i have a dream of going to America, 2 years ago when i got to know about the YES program i thought of applying for it. Now, when i have the opportunity, i am applying for this program. It is quite crazy to go to America at such a young age. In such a young age and through this program \r\n I can see the other side of the world before anyone in this age can and meet new people, explore new places and try new things out and step out of my comfort zone. I belong from a really beautiful country, where every culture and traditions is celebrated and respected. Through this program i can meet new people from all around the world and know about their country, their culture and traditions, and also share about my country\'s culture and traditions. From this program i can know who i am, what i am capable of and finally i will be able to find myself in amidst of exploring the world on my own.','Bangladesh is a very beautiful and ever-green country. In every corner of Bangladesh there are so many cultures and traditions. Bangladesh is filled with diversity. As, for my host American family, I want to share with them about our country\'s history, how we fought for mother tongue(language), how our country\'s men sacrificed their lives for the freedom of our mother land and after nine months we finally got our freedom and independence. We celebrate Bengali New Year in Baishakh and it\'s a festival for us. In this festival we Bengali people wear red and white dress and eat Rice and Illish in lunch by following our tradition. As we are Muslims we fast for a whole month called Ramadan and after fasting for a whole month we celebrate Eid-Ul-Fitr. In Eid-Ul Azha we sacrifice cows and goats as per our religion. Here, women loves to wear churis, tip, saree and salwar kameez as per our tradition. Our main food is Rice and Fish. Bangladeshis are fond of eating Rice, Fish and Dal.',1,'My High School/Teacher',NULL,2,'2019-11-22','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/262/school_seal/FLst3YYHL0TaNJqyUlq4WW00M8EZBrUXHtIADgzr.jpeg'),
