	(60,'Daw Thien',2,0,1,'Chattogram, Chattogram',NULL,19,'In our community there are lots of problems.The main problems are population density,poverty,unemployment,crime corruption,lack of nutrition,dowry and woman repression ,drug addition,etc.I want to bring change how people in our community takes dowry lightly.Some changes can be brought by raising awareness and ensuring women\'s right.This only can be possible when all of us protest against it and ask the government to punish those people who demand dowry.',NULL,'Amirbag R/A Mehedibag Hs.54/D,Rd.1 (3rd floor),Chittagong',NULL,266,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/266/certification/lkOEYBqHyo3z8Kt7oeGLk8vzXBwctbyy6qby5YEI.jpeg','Bangladesh','9',8,7,'+8801713100833','86','2003-09-02','dawthien22002@gmail.com',NULL,'1','1','1','+8801552502526','mathinmong80@gmail.com','Me Thin Mong Marma',NULL,NULL,'Agriculture Cultivator',NULL,'1',NULL,NULL,'Sein',NULL,'01552481895',NULL,'Ma Kyaunu Marma',NULL,NULL,'Housewife',83,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/266/student_photo/27oVWv5lfkyZVx9IYQbpYs8Nw3dtVR6gSFJeTEc9.jpeg',NULL,'4021','2','Idaho','1986/A Jakir Hossain Road,Chittagong','William Carey Academy','2019-11-27 06:43:17','+880 31 652034','female',NULL,'Panchlaish','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/266/marksheet_previous/e9smJAeBXzUNzgGa2YsxKC4ovGhVqiQNAjuq2RHV.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/266/marksheet_previous_two/Ywwv7TfLHfkJj2H9uwihRMDXiUV5wZEtGmHWqcNM.jpeg',NULL,NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Rangamati',2,'1002618963',75000,2,'84178786188',50000,'Chattogram, Chattogram',4202,'Khulshi','Paul Beatty','+880 31 652034',NULL,1,NULL,2,'Older cousin brother','As far as I know I will get to interact with people from different communities and that may contribute me a better understanding of those people around me.Also I will get to explore more of United States and know how the people there put in with their everyday life.I\'m much more eager about the family members whom I am going to live in with.And also being a student exchange is once a lifetime experience,to travel such long distance from home to a foreign place is something not everyone can dare to do.','Language plays a huge role in the culture of Bangladesh. Everyone has their own language. I belong to a tribal group of Bangladesh.There are 13 ethnics groups,I\'m from a group called Marma. Though I\'m from the tribal groups I had to move in to the city for better education and a good social life. I have come to know different people from different communities after moving into the city. Not only people but also different language,religion,cuisine, clothing, etc. I wish to share all the different things that I learn with my host family and also people around me.Since I know variety of cuisines in Bangladesh I would love to cook food sometimes and as far for language maybe sometimes I would tell them about my language and the languages in Bangladesh.',1,'My Family Member',NULL,1,'2019-11-18','2019-10-12',1,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/239/file/YyjqPR9Ydp217ms55yT0E6vE5o1quZpKIjWu3wrC.pdf',NULL),
	(61,'M M Nishat',1,0,NULL,'Tangail, Dhaka',NULL,19,'I have volunteered in several organizations like NCTF, SJF etc.\r\nI was Secretary in NCTF (National Children\'s Task Force) and that organization worked for children who are homeless. We gave clothes to them, feed them. Also we stopped child abuse, under aged marriage etc.\r\nSJF is also a organization that works for children. We teach poor and homeless children and we run a school for them.',NULL,'Alam Kutir, Bottola, Akur Takur Para, Tangail',NULL,270,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/270/certification/AoX4LiFc0GZVideQNgpkK7WygA1ZwcQ1MiHdlFhE.jpeg','Bangladesh','11',10,9,'+8801752949081','75','2004-02-03','nishat12sikdar@gmail.com','https://www.facebook.com/pikachu.0111','1','1','1','01715444860',NULL,'Md. Mohasin Sikder',NULL,NULL,'Advocate',NULL,'1',NULL,NULL,'Sikder',NULL,'01752949081',NULL,'Shafali Akter',NULL,NULL,'Unemployed',86,84,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/270/student_photo/5FcPZGIXZJpJc9r67OHvOZ2PdqsidQZFvnkVwsGF.jpeg',NULL,'1900','1',NULL,'Nirala more, Tangail','Bindubasini Govt. Boys\' High School','2019-11-27 06:43:17','0921-63414','male',NULL,'Tangail','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/270/marksheet_previous/Edo34VwnOG5aOpC6TpQOHqPohMI28gV7rTehd82L.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/270/marksheet_previous_two/9faczGYdzjrCTwWdWpbA77ucM7dmMW43jTMrLmQl.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/270/marksheet_current/rnkI7kFgwSOjq2u86oe07hBxeuefi4xFabdhYcDE.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Tangail',2,'9314780384138',400000,2,'9314780384137',-1,'Tangail, Dhaka',1900,'Tangail','Md. Abdul Karim','01718118777',NULL,1,NULL,1,NULL,'YES program helps in knowing about American culture and society. I have a cherish desire to know about American education system. It is always a pleasure to know about people from around the world. Also, it will bring me experiences. Also, I want to travel there because America is my dream country.','Bangladeshi culture are praised around the world specially for food, sweet language and beautiful clothes. The things that I will share with my American family are given below:\r\n1. Food: People love our spicy and delicious food like beef curry, mutton curry, biriyani, kacchi etc.\r\n2. Language: We have sweetest language. Our people sacrificed their life in language movement.\r\n3.Clothing: Usually people wear Saree (for female), Lungi and Panjabi (for male).\r\n4.Religion:There are mostly Muslims, Hindus and Christians.',1,'A Friend',NULL,2,'2019-11-13','2019-11-12',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/270/school_seal/aMZgMlSaxkZCyD5UwO5yoRNcrq7oTq5g26fzBya4.jpeg'),
	(62,'NAFIS',2,0,NULL,'Rajshahi, Rajshahi',NULL,19,'I have an experience participating a community service project called \"Bondhushova\"-a part of The daily Prothomalo in the past. I am still an active member of the community.Bondhushova is one of the largest platform for youths of Bangladesh to inculcate human values to work for mankind through self development. As an active member of the organization I went to give relief to the people affected by the flood in Bagha; donated money and worked for the distribution of clothing among the street child. I have also worked as an organizing member in Rajshahi and as a cultural artist in the Math Olympiad in Bangladesh in 2018.',NULL,'FLAT: H, FAMILY SUITS, INSTITUTE OF BANGLADESH STUDIES, RAJSHAHI UNIVERSITY',NULL,272,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/272/certification/FOv29RU45cQ3TBzEyT3KMBYriZppf8fMkCpprUEb.jpeg','BANGLADESHI','11',10,9,'+8801989545917','70','2003-12-26','anynaz@gmail.com',NULL,'1','1','1','I don\'t know.',NULL,'NAZMUL HOSEN',NULL,NULL,'I don\'t know.',NULL,'1',NULL,NULL,'FUYAD',NULL,'+8801989545917','anynaz@gmail.com','NAZNIN NAHAR',NULL,NULL,'B.C.S. (General Education)',89,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/272/student_photo/T6NCgirh22dEt6Cfh3sAlt3j3JWITOvLPr4U1nhG.jpeg',NULL,'6205','1',NULL,'COLLEGE GATE, MIRPUR ROAD, MOHAMMADPUR, DHAKA, 1207, BANGLADESH','Dhaka Residential Model College (DRMC)','2019-11-27 06:43:17','+88028118834','male',NULL,'MATIHAR','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/272/marksheet_previous/JFx1qj20JiFRUG10sO6klH0NHI9VmDAI0MQcejan.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/272/marksheet_previous_two/GecPAPoJYYnnICUif3xY2RTF7Krnf2XtH0OdurWM.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/272/marksheet_current/JQciiYSWwd6l9YZPLY5HZ8I1rLfEuS3Hs8HS9QPB.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-12-01 05:53:44',NULL,1,1,NULL,NULL,'BP0342516','2022-05-29','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/272/student_passport/kqfCv43s5jQ0IP9Z7UBeawhoBbn6X1wl5ly3CiWI.jpeg','MAGURA',2,'I don\'t know.',-1,2,'19792611038815280',493000,'Dhaka, Dhaka',1207,'MOHAMMADPUR','BRIGADIER GENERAL KAZI SHAMEEM FARHAD, NDC, PSC','+88029135530',NULL,1,NULL,1,NULL,'I had an ambition to study abroad, specially in the United States.The education system of United States caught my attraction and YES Program seems to be a great opportunity to accomplish my goal.','I would like to represent the vast cultural heritage of Bangladesh.The most noteworthy part of our culture is the relationship among the people of our country. We look after each other even in our inconvenient situation.There is a strong bonding among our people.The root of this bonding is our language and our nationalism.We have an active communication with everyone of our society. We give priority to every single religion. I would also like to mention that the  people of our country sacrificed their life for the supreme protection of our mother language \"BANGLA\" in 21st February,1952. It is a matter of pride that the UNESCO announced this very day as the International Mother Language Day in 17 November,1999.',1,'My High School/Teacher',NULL,2,'2019-11-14','2019-11-14',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/272/school_seal/jTOZ26BZ3fzo0bx3lLwgXic6k1ISnqp35VaPmhCj.jpeg'),
