tside my country. I think i will come to know about their various cultures and norms. Besides, I want to see their education system.basically I think meeting with the people outside my country will give me a whole new experience.','I wish to share our country\'s  folk culture, festivals , heritage, and cuisine with my American family.\r\ni think it will be easy for me to share our folk culture because Im a singer, reciter in bangladesh radio station, sylhet. and I know about different instruments and i think it wont be a big deal for me to share some of the parts of our folk culture with them.\r\n\r\n I  i think the people of Bangladesh celebrates different festivals like language movement day,independent day, durga puja etc. I will share these with them by telling them about the backgrounds of the festivals, or performing some things that we usually do in these festivals.\r\n And i think i will cook my country\'s famous food items and this way they will know about bangladeshi cuisine, \r\nand the most attractive part of my country that is the heritage of it,historical places or the tourists spots  of it,i will share these things by showing them or telling them about these places.',1,'iEARN-BD Website',NULL,2,'2019-10-14','2019-10-13',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/277/school_seal/m73c6SkeP6G0N3ZBt7ISePTwOPgyxRKTRj1JInZo.jpeg'),
	(64,'NAFISA ISLAM',2,0,NULL,'Dhaka, Dhaka',NULL,19,'As a young student, I did not get enough opportunity to involve with some community or social services, which is also not that visible if you look into the Dhaka city, but I have very interest to do such activity so that our community or society can grow as American society. If I able to grab this opportunity to see the activity in America, I must use my experience to develop my own community in Dhaka. Always I think if I could do something about the cleaning, hygiene and health of the people especially the women and children in my areas as they really need.',NULL,'ANANDA KANAN, FLAT: E-3, 275 GULBAGH ROAD, MALIBAGH, DHAKA',NULL,279,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/279/certification/Okj8j2Z54UmdYeWyvXvov83RGtNCF9b7esEkoBaW.jpeg','BANGLADESH','8',7,6,'+8801784619792','69','2005-01-05','sjibon.london10@gmail.com','https://www.facebook.com/nafisaislam.jefin.1','1','1','1','+8801729683549','INFO@GSCL.COM.BD','MD SHAFIQUL ISLAM',NULL,NULL,'Owner, CEO & Lead Consultant, Global Study Consultancy, Advanced Melinda (Level-2), 72 Malibagh, DIT Road, Dhaka-1217, Bangladesh',NULL,'1',NULL,'https://www.instagram.com/islamjefin/','JEFIN',NULL,'+8801751625196','INFO@GSCL.COM.BD','FAKRIA NAZMUN',NULL,NULL,'HOUSEWIFE',79,79,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/279/student_photo/qWuEKOHuMJgu3zVQhb3UfdNfPkdXiFtc7CQgazSw.jpeg',NULL,'1217','1',NULL,'House # 89/A & B North, Malibagh Chowdhury Para Road, Dhaka 1219','SOUTH POINT SCHOOL AND COLLEGE','2019-11-27 06:43:17','+88049362874','female',NULL,'SHAJAHANPUR','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/279/marksheet_previous/ycQP3bhEME3BfBxSAX7VdHqtDqqsc44XB7J195RV.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/279/marksheet_previous_two/uXGJ7netBW2m2XMuXqbQrEvrW2GriEn6rBmldzol.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/279/marksheet_current/D2TniiA7K2Yi4VnRIrwNNOpBA7wprT4PEnPNZEiX.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'EA0227880','2024-03-30','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/279/student_passport/RbxQLgVihGQvh4Wj0zvbOCaQ7A1o4HBP1OkJjEnA.jpeg','DHAKA',2,'5083484500',1000000,2,'8233571242',-1,'Dhaka, Dhaka',1219,'KHILGAON','HAMIDA ALI','+88049362874',NULL,1,NULL,1,NULL,'I love America. Because America is now leading the world in economy, culture and many more. I think if I able to get an opportunity to stay in American society and culture, I will be learning about the modern life, education and how American people behave which I would share to people in my home country. So when I heard about this opportunity and I have shown my interest to apply for this exchange program.','I have learned some cooking like vegetables, fish and meat curry also some local breakfast which I can show to my American friends. I know better speaking in Bengali, so I can teach some beautiful Bengali words who likes to learn it.',1,'My Family Member',NULL,2,'2019-10-16','2019-10-16',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/279/school_seal/Qmgd4z4V53rADM2gh00TRaTCynWqnKjTvUmies7U.jpeg'),
