	(66,'Muhtasim Mahmud',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Community service is a non-paying job performed by one person or a group of people for the benefit of a community or an institution. I had participated in some community services in my educational institution recently.\r\nIn our institution we often perform some community service or social service for the benefit of our area. Recently we have done some community service which is very essential for our society.\r\nNow a days Dengue fever has become the most dangerous disease because of which many people had died. Thats why we had sparyed mosquito killing medicines in different places and tried to aware the people. We did this programme for 2-3 hours\r\nAnother community service was performed by me in my institution and that was cleaning our school, classroom and surroundings of our institution. By this cleanliness programme people understood the importance of cleanliness. We did this programme from 9am to 2:15 pm.',NULL,'Flat no# 5A, Build no# 01, MF Village, TA-160/3/D, Middle Badda',NULL,320,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/320/certification/djjOfNW0qSqIOgxA6E8WotEiR4QBaqREd71SC9Vc.jpeg','Bangladesh','10',9,8,'+8801713333340','75','2004-08-26','msalovely1970@gmail.com',NULL,'1','1','1','01713333340','firoz7717@yahoo.com','A.K.M Saleh Uddin',NULL,NULL,'Service Holder',NULL,'1',NULL,NULL,'Taamim',NULL,'01720552552','msalovely1970@gmail.com','Momotaj Shanaj Akther',NULL,NULL,'Unemployed',72,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/320/student_photo/fHLr5C9UaEk7yWKKXSH73MJf8mdoI0eboTh8GQ5t.jpeg',NULL,'1212','2','New york','DOHS, Baridhara, Dhaka Cantonment, Dhaka','Baridhara Scholars\' International School & College','2019-11-27 06:43:17','+88028415585','male',NULL,'Badda','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/320/marksheet_previous/WUhaxK2sCu5t02zsyoetEjmuiz9XoEbInv6BgHyH.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/320/marksheet_previous_two/sqwdA74WKyylAhZrVJVkP5Gep4VizePZF2Jn6Tsr.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/320/marksheet_current/zqNhkp6S5FqwmMVS9GRptVjVcEhC3nsq8Bi3GBRz.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'EB0892590','2024-09-15','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/320/student_passport/TrCAN2eMILBJlUdkjj107LQzqlARAJR0TiDBX2id.jpeg','Dhaka',2,'9550119474',1380000,2,'5050232429',-1,'Dhaka, Dhaka',1206,'Cantonment','Brig. Gen. (Retd.) Mirza Ezazur Rahman','01738911879',NULL,2,'India for tour',1,NULL,'I want to apply in the YES programme because of some reasons.YES programme is a programme where i will be able to know about the cultures, tradition etc. things of USA. Knowing the other countries culture & tradition is an interesting thing by which i will be able to develop my countries cultures and tradition. And by attending in this programme i will be able to share my countries culture with the people of USA because our culture is one of the richest cultures of all countries in the world. I also want to apply in this programme because i always had a wish to study in a American high school and by attending in this programme i will be able to fullfill my wish. Another thing is that one of my hobby is travelling. I like to travel different new places so that i can know about that place because The Almighty has made this world so beautiful i wish to travel all that places. By attending in this programme i will be able to travel America where i wanted to go.','Bangladesh has a culture which is very rich and divesed. Its heritage is deeply reflected in its architecture, dance, literature, music, painting, cuisine and clothing. Hinduism, Buddhism and Islam is the three primary religion of Bangladesh which had a great influence on its culture and history.\r\nAmong all these cultural aspects i want to share the music of our country. In Bangladesh, there are three catagories of musical styles which are folk,classical and modern. Love is the main theme which makes this countrys traditional folk songs so rich. From the nations culture, mysticism, and spirituality these lyrics come. Folk songs are included with Baul, Murshidi, and Bhatiali, and some of the lyricists include Hason Raja and Abbas Uddin among others. I will share these aspects with them by showing and make them listen these songs which are one of the most important aspects of our bengali culture.',1,'My Family Member',NULL,2,'2019-11-20','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/320/school_seal/BNCALV3ll6jP206syV5eiIeKdidIlXCSh0uiidRD.jpeg');
