VALUES
	(67,'ISRAT JAHAN',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I am grateful that I got the opportunity to work for my community and will do more in future. Recently there was a Dengue fever outbreak in our country. Dengue took a serious turn this year, thousands of people got affected by this disease and many were admitted to the hospitals and many died due to this disease. As we know Prevention is better that cure. People were not aware of this disease neither could they prevent it. As a result a large number of people were affected by this disease. The most important prevention for this disease was public awareness. For creating awareness we instantly formed groups and we were spread all around our community and aware them about this disease.  We took various steps to prevent this disease. Local public representative Mr. Joinal Abedin the councilor of our ward (45) of Dhaka North City Corporation helped us to preventing this disease. Still our community groups remain active.',NULL,'2214/1 SHAHERTEK, PURANPARA, UTTARKHAN, DHAKA',NULL,326,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/326/certification/ThdHLPadYmK9MeUWojVp3W7WO7G1pd7ef6qr5bvy.jpeg','BANGLADESHI','11',10,9,'01819237359','52','2003-08-02','isratjahansanjana475@gmail.com',NULL,'1','1','1','+8801819237359','royalembo@gmail.com','Shah Alam Al Masud',NULL,NULL,'Business Man',NULL,'1',NULL,NULL,'SANJANA',NULL,'01816768760','royalembo@gmail.com','Jasmin Akter',NULL,NULL,'Housewife',81,71,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/326/student_photo/VxdBMUqq5njVSdHL43UJHVqtzK4TwlmkEEKmmqFa.jpeg',NULL,'1230','1',NULL,'\"Forida Tower\" House#22, Gareeb-e-Newaz Avenue, Sector#11, Uttara Model Town','Milestone College','2019-11-27 06:43:17','+88027913437, +88028932724','female',NULL,'UTTARKHAN','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/326/marksheet_previous/zYcMXWDQHdBHtIrf6YfiB7l9jwfS6na7KsnXUgMj.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/326/marksheet_previous_two/kh8mMnvPEBZ4jSqVye6s2zdMevABb59FNbPWfDPJ.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/326/marksheet_current/Ru76t7Eithn0TtCyi3hZ2kEX0wKQ5Zrpw8AHH8G7.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BQ0252353','2022-09-11','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/326/student_passport/6UdMCWpqVUD86n1i0K8WsjJpsGXYQdGo5tWh2JeN.jpeg','DHAKA',2,'2826965325',1920000,2,'5976998822',-1,'Dhaka, Dhaka',1230,'Uttara West','Iftekhar Hossain','+8801719582062',NULL,2,'Thailand for tourism, India for tourism total: two',1,NULL,'I want to apply for the YES program because this program is facilitating me and giving me the opportunity to represent my nation, culture and religion in front of a great nation like America. By this program I can gather knowledge about them, their nation which I can\'t have sitting here in Bangladesh. Also I can portray my nation and culture before them by which they can know about us without visiting Bangladesh. Besides I am really interested to have a fellow friendship with an American host family along with the people of that country. Above all I always dream to have an opportunity to demonstrate, to symbolize my nation meeting the people who don\'t know about us properly. And for me this program is the best scope to execute everything I mentioned above.','The aspect of Bangladeshi culture, I wish to share first is my Language. We have such a historical background to get the freedom of speaking, our brave people sacrifice their blood for the sake of Mothers tongue on 21st February 1952 & it became the International Language Day . Secondly, I will tell about our glorious history & how we struggle and sacrificed life to get the freedom and the independence of our country. Then I will tell them our traditional dress for men is Lungi and Panjabi and for Women is sari, while young females also wear salwar-kameez. Then our cuisine, Bengali has a name Mache Vat e Bengali which indicates our favorite foods are rice and fish. We have a strong tradition of food; here the specialty is the use of different spices. If get chance I would love to cook some of our cuisines for them. Next I will explain our religion, we all live here altogether with mutual harmony. Besides there are a lot to let them know, which I will if I get the opportunity.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-06','2019-11-06',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/326/school_seal/n96HArsksgJevJ73djMqw9GLWizk2MXbMpxJHvvx.jpeg'),
	(68,'Lum Yea Hossain',2,0,NULL,'Bogura, Rajshahi',NULL,19,'Being born and raised in a least developed country, I have seen the effects of poverty, over population and climate change more profoundly than others. These sights have encouraged me to involve myself in social services that can bring actual changes. Therefore, I have participated and arranged various plantation programs, recycling seminars, traffic awareness movements and have been a part of \"Global Citizen\", Nat GEO newsletter campaigns so far.\r\nBesides, I\'m a national level debater and several award winning participant of Model United Nations.It\'s because despite my participation in various services I feel like the issues need a voice to speak for them. I want to be that strong and clear voice!\r\nOne time I was giving a motivational speech to the students about the safety of women. After the end of that program something changed my perspective forever.Several of the girls approached me confronting about their harassment for the first time.That\'s when I decided to be a leader.',NULL,'A-7, Shah Sultan Sadia Garden Apartment, Joleshwaritola, Bogura.',NULL,327,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/327/certification/aNFpPs3YQlIBimzkIHoGgvH8RYzVroc2vvkjTrYs.jpeg','Bangladesh','11',10,9,'+8801713727813','95','2004-08-27','lumyeahossainan@gmail.com','https://www.facebook.com/profile.php?id=100012771823155','1','1','1','+8801713727813','baniathossain@gmail.com','Md. Baniat Hossain',NULL,NULL,'Businessman',NULL,'1',NULL,'@lum_yea','Hossain',NULL,'+8801712455907','hira.hossain777@gmail.com','Shamima Naznin',NULL,NULL,'Housewife',82,86,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/327/student_photo/uuqr7mVHwyr7W9mI5zzSAsaDLlJMDg5SuVaHx3rY.jpeg',NULL,'5800','1',NULL,'College Road, Fulbari, Bogura.','Government Azizul Haque College, Bogura.','2019-11-27 06:43:17','+8805151700','female',NULL,'Bogura','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/327/marksheet_previous/Hj4gslZgH6QI1NaVTr9eknbXjuxQQ09aIjUGWuGq.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/327/marksheet_previous_two/K2TaTc92TWVyL2nTS7wzwUm9L43sV9qTbesIFHd2.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/327/marksheet_current/YyEBOOEVnMCfwbhUCX7XBGFM4HeNP4G0CCcTAQ4u.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BF0600512','2020-06-22','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/327/student_passport/rMqj2Op2PpSfVGI3aPDJSYRqf2rt1xjOI8rtGwZG.jpeg','Bogura',2,'1944782042',2500000,2,'6892186823',-1,'Bogura, Rajshahi',5800,'Bogura','Professor Md. Shahjahan Ali','+8801716476594',NULL,2,'India for winter vacation.',1,NULL,'Since I have comprehended the actual meaning of passion, I have found myself deeply engrossed in fields like cultural exchange, globalisation and leadership. Till now I have kept a constant engagement with public speaking and ways that will enhance my quality to represent my country as an eligible leader. This is the perfect opportunity for me to take my first step and also practically analyse my efficiency and flaws as a representative of my country. As much as I love my culture and heritage, the American culture and educational system has always seemed one of very best to me. Utilising this fruitful campaign I want to deliver the best of Bangladesh and take with me the best of America while I\'ll be returning to my homeland. I equally want to explore the cultures and distinctions of the students joining from other countries. In a word, this will be my dream program for the future I want to mold for myself.','Bangladesh and it\'s age old history and sophisticated traditions are nothing less than intriguing if depicted perfectly. \r\nOur people are biologically developed to be friendly, cooperative and open minded. That is why even after being a country of almost all religions, color and caste, we celebrate as one. That is what I mainly aim to represent, the oneness and diversity I hold within. \r\nBesides, we are originated from a very aesthetic civilisation and thus our cultural aspects like music, literature and dance are world famous. For seven years I have engaged myself in learning our classical dances like Folk,Bharatnattom,katthak. I intend to display my skills while I\'m on this program and show a glimpse of our richness to the world.\r\nAlso, we have entirely different cuisines than that of Europe, a mother tongue we have fought to achieve, our own new year that has an unique way of celebration and so much more. I aim to introduce them to my host family and school as well.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-10-27','2019-10-27',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/327/school_seal/0l7UXmTaB3mx2SxxHz1xR9UDSX0U2sakruj3KowZ.jpeg'),
	(69,'Thaminuzzaman',1,0,NULL,'Dhaka, Dhaka',NULL,19,'It is a great sorrow that I didnt have any opportunities of participating a community service in the past but if I had I would like to create a possitive change through clear analysis and strategy. \r\n \r\nBy proper analysis we can identify the root causes of problems that the project implementation must address. If we solve this problems we can make a permanent change only if it is an inner oneand the greatest form of community service is encouraging that inner change.\r\n\r\nI should also take the suggestion from the local residents, since they have firsthand knowledge of the inside realities of their community\'s current state. By their support and through the help of my fellow social service teammates, I belive that I can make a positive change in my community through community service.',NULL,'6 mirbag, noyatola, dhaka',NULL,333,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/333/certification/R90sEBq5x3toSIvSyVazCuZT1xItZuAGkrh5I8fu.jpeg','Bangladeshi','11',10,9,'01732388462','70','2003-12-30','shumona1989@gmail.com',NULL,'1','1','1','01712718246','uydok95@gmail.com','Md.Moniruzzaman',NULL,NULL,'Government Employ',NULL,'1',NULL,NULL,'Nahian',NULL,'01732388462','shumona1989@gmail.com','Thamina Khan',NULL,NULL,'Housewife',60,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/333/student_photo/nAhg4XUxp43jtKQZdWIjmN5HqbTqFTLF849i2SqT.jpeg',NULL,'1217','2','New York','Khilgaon chourasta, khilgaon, Dhaka','Khilgaon Model College and University','2019-11-27 06:43:17','55122188','male',NULL,'Romna','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/333/marksheet_previous/eZQqyqntY2kJbsHcLwv24EuERZYdqiWxLKgRqXu6.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/333/marksheet_previous_two/Mk87tcxiIT80vvNNIKNB2KHg7YoALgRpSia5kb6m.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/333/marksheet_current/cr7eKSEK7nVFqtQ4WHSLI9ZDvxsVbjecifgPdj99.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'7914747727818',360000,2,'8674873792',-1,'Dhaka, Dhaka',1219,'Khilgaon','Kanai Lal Shorkar','01714219458',NULL,2,'India',1,NULL,'I want to apply for the YES program because i want to get an experience of a new culture. Based on which, I would be able to create a peaceful relationship among my classmates and a society abroad. Besides, through this program I wish to improve my career.','First of all, I want to share my mother language Bangla, traditional cuisine of Bangladesh and few cultural aspects including clothing and moral values with American family. I can make them interested by telling them about our proud historical past. Our language movement shall be the unique example for them to listen. I also want them to feel the deliciousness of our traditional food by cooking it for them. Besides, through picture and movies I would like to share family values and relationship',1,'Facebook',NULL,2,'2019-10-30','2019-10-24',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/333/school_seal/VsUlFGdsfDPCZTPR0MGNytDlO7S91hguzvzM7gAS.jpeg'),
	(70,'Apshora RoseMary',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I am a girl of Garo community. My home district is in Tangail. The population of the Garo community living in Bangladesh is around 1 lakh. Garos are lives in Tangail, Mymensingh, Sylhet, Sherpur, Netrokona districts. The Garo communities are suffering various problems in this country. Bangladesh Garo Student Organization works to secure the rights of Garo. In order to gain the rights of the Garos, I have attended demonstration rally with the organization to draw the government\'s attention. I attended various seminars. \r\nMost of people in the village are illiterate. I have given them various suggestions and encouraged them for education. I would like to continue my service in such a way if I have the opportunity in the future.',NULL,'17, Purbo Rajabajar, Flat-F-5(5th floor), Moricha Garden',NULL,336,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/336/certification/0Oqja5nuPEnO0Z7gfwXjSGmCLPUx65x7I9nrhml9.jpeg','Bangladesh','9',8,7,'+8801620116337, +8801781789082','70','2003-12-29','snokrek99@gmail.com','https://www.facebook.com/apshora.nokrek','1','1','1',NULL,NULL,'Late Borun Doffo',NULL,NULL,NULL,NULL,'1',NULL,'https://www.instagram.com/apshora_n_marak/','Nokrek',NULL,'+8801712228438','benunokrek@gmail.com','Benu Nokrek',NULL,NULL,'Makeup Artist at Ekushey Television (ETV)',78,69,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/336/student_photo/MRRMmvwByy666J3vRip8VNHuNarfnuRMhtcaPEcF.jpeg',NULL,'1215','2','New york','42, west Tejturi Bazar, Farmgate','Morning Glory High School','2019-11-27 06:43:17','+8801915808727','female',NULL,'Tejgoan','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/336/marksheet_previous/IvO04IdfT9IA954crwC5TNfqpooP5kYaqWg1odx7.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/336/marksheet_previous_two/Uh75cCm39RziMs7UuMc9HK2ANVhfx4xfRObIFEqa.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/336/marksheet_current/BVGcp2cIFEyfxhKBezDVP8UHLMpKTrdQdTNrSMSF.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-28 22:42:31',NULL,1,1,NULL,NULL,'BL0027132','2021-05-31','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/336/student_passport/dNl0gWokuoAekgmodlqUYia6uXgi62F44JQgxvHB.jpeg','Madhupur, Tangail.',1,NULL,-1,2,'2699040684284',200000,'Dhaka, Dhaka',1215,'Tejgoan','Narayan Chandra Halder','+8801717048696',NULL,2,'India for summer vacation, Bhutan for summer vacation',1,NULL,'I want to go to this program to get some experience. I would like to know about the USA Culture and their country. I would like to share with them about the culture of my country and the culture of my nation. I want to get acquainted with new family and new country. I want to attend an American High school and engage in activities to learn about USA society and value. If I get chance to join in YES program it will help me to achieve my long term goals. Im going to work very hard in the program and learn all that I can.  First of all, I\'m on the lookout for something new.','I am Bangladeshi. I grew up in a Bangladeshi culture. But my community is Garo (one of aboriginal community in Bangladesh). I would like to share about my culture with the USA family. I will take my cultural garments and various ornaments for them from Bangladesh. I can show cultural dance to them. I will cook our traditional food for them. By sharing aspects of my culture Im creating and exchange that has many benefits, I can hold on to the heritage and traditions I left behind, while also introducing my world to my new family.',1,'A Friend',NULL,2,'2019-11-15','2019-11-13',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/336/school_seal/TOj9EGnhoOwHYkZKmlchuaQFAv0wud5BRJs0qke0.jpeg'),
	(71,'Md. Muhsin Alam',2,0,NULL,'Sylhet, Sylhet',NULL,19,'I am a teenager, going through ups and downs of life .I was in depression for 7/9 months.I will try my best to help same age teenagers to overcome that.\r\n\r\n\r\nSecondly, raise consciousness about importance of the time, as many teenagers waste their time valuable time browsing nonsense (Facebook Instagram) social site.\r\n\r\nThirdly, I will be elated to do some errands such as grass mowing, to spread my hands to neighbourhood for small household tasks, helping little kids to play any sports , cleaning garbage etc. \r\n\r\nFourthly, to teach weak students \'math\'. \r\n\r\nFurthermore, I would be enthusiastic to work with many NGO or other organisation to do welfare works. \r\n\r\nI will be working hard to aware children\'s guardians about child obesity. \r\nAgain, I will try motivating people to use green house energy in a large extent. \r\n\r\nFinally, I have never gone to any agricultural Lands or helped any farmers. I will be buzzing to assist farmers to do their farming works,if it is possible.',NULL,'West pirmahalla 177/6,Sylhet',NULL,341,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/341/certification/3uYEEg3isnalZqSKCAdUwJqGU65JkAAQDpT82ixI.jpeg','Bangladesh','10',9,8,'01644122974','80','2005-01-05','bogusdreamer7@gmail.com','Muhsin Alam','1','1','1','01889467960',NULL,'Md. Asikur Rahman',NULL,NULL,'Businessman (Easy Bikes)',NULL,'1',NULL,'titbit_muj','Hasan',NULL,'01788760889',NULL,'MST ANOWARA BEGUM',NULL,NULL,'Housewife',70,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/341/student_photo/n30njwYbfd8tkv48XiMIVpNKsm2SeSc8OFNJWlg7.jpeg',NULL,'3100','1',NULL,'Mirer Moydan, Sylhet','Blue Bird school and college','2019-11-27 06:43:17','0821-716615','male',NULL,'Airport','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/341/marksheet_previous/F5IBDgcEzOWWXy6LvmEELgjmLRulsLQtue9NGTRX.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/341/marksheet_previous_two/CSyEYHeXrnPrgZ9fLTsgzNB8rfc6tYGASxaZtYt9.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/341/marksheet_current/OuipSnbI5loh3drWBfs0efnml4SMjDZ5yuIXRaYw.jpeg','@titbit_muz',1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Sylhet',2,'4',222000,2,'5550307655',-1,'Sylhet, Sylhet',3100,'Kotwali','Husne Ara','0821-716615',NULL,1,NULL,1,NULL,'Want to see  colossal America  and its people. Further, how is the educational system of America. If it is possible, I have ardent desire to see the Statute of Liberty. American average teenagers lifestyle and people outlook towards me precisely how I am perceived by them. I have never been to any country. So, it would be amazing visiting such a country like this.','Language where I will try delineate (Sylheti accent)(sylhet is hometown) . Cause it is really funny and easy to learn. Communication through this language, would be the best way to share.\r\n\r\nFood [Macher Borta, Shutki, Piyaji(handmade)]. All of them are really spicy and tasty simply breathtaking. Cocking by Myself or chef will cock according to my order and distributing to the people is a simply way  to share Bengali cuisines though the list goes on forever.\r\n\r\nClothes [sharies for girls (Jamdani, Tati, Ethnic people created ones) and Punjabi with duti/saluwar are my personal choice, will best suit with Americans. Depicting the merit, arts and design to be given on the clothes;arranging a small fashion show (medium large room), I think is the best way to express bengali traditional dresses.\r\n\r\nReligion (Hindu, Islam) I will expressing the colossal tales and positive aspects each of them. Finally to motivate to respect every religion.',1,'Facebook',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/341/school_seal/C