	(72,'Md',1,0,NULL,'Sylhet, Sylhet',NULL,19,'As I know this community service is very important part of this program.I would like to share some of my work for my community.\r\nvolunteer: Basically I am a student but I love to help people who are unable to send their child to the school.I fixed a time for them to teach how to learn and write.From my side I feel good to teach them for free.\r\nI also help the elderly people who cannot do their house work, shopping,shovel the driveway etc.\r\nAnd donating is my hobby,I donate blood in every 3months or after for free.\r\nAll I can say is ,If i have the opportunity I can do my best to give a positive change from my experience.',NULL,'Nowa Gaw,Danaram,Fenchuganj,Sylhet',NULL,346,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/346/certification/sDdV1C2UNH75MSUWupUJ4xYnuydkDztWmG7C7LBX.jpeg','Bangladesh','8',7,5,'+8801799860132','50','2004-01-17','khosru.miah93@gmail.com',NULL,'1','1','1','+33753377601',NULL,'Ranu Miah',NULL,NULL,'Abroad',NULL,'1',NULL,NULL,'Hasan',NULL,'+8801761222383',NULL,'Dilara Begum',NULL,NULL,'House wife',60,75,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/346/student_photo/ScaJYV7li5HMfUks5tE1M7wYDZDH648xec3MxiCG.jpeg',NULL,'3116','1',NULL,'Danaram,Fenchugonj','Danaram High School','2019-11-27 06:43:17','+8801712402719','male',NULL,'Fenchuganj','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/346/marksheet_previous/CnVmdu0dBfutqrHkCBrpmwB0Jy6ckYI0oEvl9cu2.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/346/marksheet_previous_two/OZUpUR4ucNkBzYfAlDxwT74raxn9GMDXvA4t8nNn.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/346/marksheet_current/OmKWSUdHCwJmRCV44hM7KSfTjkFjoIRcFVMOGy7X.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BX0390596','2020-10-12','http://connect-techynaf.s3-ap-sout