ry\'s culture.',1,'Facebook',NULL,2,'2019-10-22','2019-10-17',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/348/school_seal/sgqNGZrlBwWhNm0bC4FQ4PKCqndt2K5fMyN9IRua.jpeg'),
