techynaf.com/380/student_passport/9SaiWxCtJ3GRWGmncn7OKXRD3waPu0qP5YuljRy8.jpeg','Moulvibazar',1,'9126929240',96000,1,'1977-5821408878763',360000,'Moulvibazar, Sylhet',3250,'Barlekha','Iqbal Ahmed','+8801842441972','N/ A',2,'France national scout jamboree 22-26 July 2019 in France',1,'N/A','The I.C.T education quality of Bangladesh is not so higher. America is a devolapen country and it\'s I.C.T education quality is too higher. So that with the \"YES \"programs help I get the higher education in I.C.T and I also interested in the world wid social education.','I especially want to share the Language  aspect of Bangali culture with my American family. Because our Language is the most wonderful Language in the world.Many students have died to acquire this Language.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center','N/A',2,'2019-10-15','2019-10-15',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/380/school_seal/kiEdiZ2EB9ERIouherkcVzR33gyN5G1BZ8aovUfu.jpeg'),
	(76,'Fairuze Binte Alam',2,0,NULL,'Dhaka, Dhaka',NULL,19,'As humans we all belong to some kind of a community,Responsibility is one of the key aspect of community.It has always been one of my biggest wishes to take part in different community services and help in bringing a Positive change in the community.Especially I would like to help the kids in need of our community by giving them warm clothes in winter.I feel sad to see kids in need freezing in the cold not having a healthy shelter nor having warm clothes.They are also an integral part of our community.They cant help themselves but we are more than capable to help them being together.For example,building a team of volunteers and bring donations for these kids,by collecting funds,used warm clothes from the community.Taking this simple step we will be able to put a huge impact in the community.Since the community is like a family. And also community services are such a big part of the\"YES PROGRAM\"and I will be glad to have the opportunity and bring an actual Positive change to the Society',NULL,'74/1 South Maniknagar, Dhaka-1203',NULL,391,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/391/certification/uS1c2dXgBXinF6aXcBAi9UZSk7ztyvNOae5mQaHj.jpeg','Bangladeshi','10',9,8,'+8801643354940','60','2004-03-31','fairoze.nora@gmail.com',NULL,'1','1','1','+8801683444813',NULL,'Md.Shah Alam',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Alam',NULL,'+8801683444813','begumkohinoor70@gmail.com','Kohinoor Begum',NULL,NULL,'Teacher',70,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/391/student_photo/Ibixj70T2AzmdEUvCxZAYulwSuzwewOSG8G0sTHK.jpeg',NULL,'1203','2','new jersey','Maniknagar,p.o:wari','Maniknagar Model High School','2019-11-27 06:43:17','7546119,7552076','female',NULL,'Mugda','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/391/marksheet_previous/xSSUoE3mAXouwbQSc89Mp8ApCS18rFzjv0I8vuZL.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/391/marksheet_previous_two/cbGV9z8ldZAMHLVorbKQ0aIja8smnysPdlDsLgdM.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/391/marksheet_current/gGSRPXYxmJjQBhELdm0zFyOqAZqd5PwJbKlAYPun.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'74/1,South Maniknagar, Dhaka',2,'418 257 6803',600000,2,'553 256 2591',120000,'Dhaka, Dhaka',1203,'Mugda','Ferdousi Yeasmin','+8801552370342',NULL,1,NULL,1,NULL,'I live in a small area of Dhaka in Bangladesh, but I want to explore the world.\r\nAnd america is a country where different people from around the world lives together.\'\'Yes program\'\' is providing the opportunity to be a part of those communities. I\'m sure I\'ll have the access to outstanding career support and advice for life, as well as exclusive resources and opportunities If I got the chance. And I would love  to learn about Amarican Culture and society and also will try my best to deliver my cultures to them . based on the above written things and  to enlighten my future I want to apply for this program','Bangladeshi Culture is one of the most Graceful Culture. Theres just so much Id love to share with my American family, starting with the language of Bangla. Id like to share how our language varies in different parts. A person from Dhaka district will not speak the same way a person from Sylhet district would. It will be a fun sharing this aspect to them. When it comes to cuisine Id love to teach my American family to make Pithas. Pithas are the best to have in winter. We enjoy having together with the family and Id love to have with my American family. Clothing is such a colorful part of Bangla culture. I wear Saree in most festivals & men wears Punjabi is something that caries tradition. it will be lovely to see my American family try it out. Since Bangladesh is a religious country & I also come from a religious Muslim family.Islam says to love your family and people around you. Ill try to show them the right path & my American family will love this aspect of our religion.',1,'My Family Member',NULL,2,'2019-11-20','2019-11-16',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/391/school_seal/qsOcv9hkWHsDinYA9DZ7C4HTvryHgjJqXfAe1CpP.jpeg'),
	(77,'Tashdid Bin',2,0,NULL,'Chattogram, Chattogram',NULL,19,'I have the experience of doing community service in our school for almost 3 years. Our school has a \"Community School\' for the unfortunate and willing youths of the city. Every year, in January we are given a chance to donate our old uniforms and other useful things to it as well. For the past 3 years I have volunteered to teach some of the students at the community school during my last period, on a weekly basis. Every Wednesday I, along my friends would go there and sit at different tables with the students. I used to talk to them about their lives and how\'s everything going for them. Often they responded being happy and cheerful about their lives. Some students there didn\'t really understand their notes that they were given, so they memorized it. I didn\'t like it, so, I would rather go on about the topic and make them understand about it. I didn\'t want my students to feel afraid of me, so I would go around making jokes,playing games and high fiving them for understanding my lessons.',NULL,'307 Anowara Mansion (2nd Floor), Mohammadpur, Haji Emdad Ali Road By Lane,',NULL,394,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/394/certification/W1JvVfSW0DGR8mKIqM6TQih3bvTBmejvirL7ANax.jpeg','Bangladeshi','9',8,7,'+8801819625726','70','2004-03-31','smnizam777@yahoo.com',NULL,'1','1','1','+8801819625726','smnizam777@gmail.com','Nizam Uddin',NULL,NULL,'Banker',NULL,'1',NULL,'@me_trashdid','Nizam',NULL,'+8801817781574','tahurajesminkhan@gmail.com','Tahura Jesmin Khan',NULL,NULL,'Teacher',79,82,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/394/student_photo/Ekt4NYrMGB9r2ZxABdjMFLquYWdFeazi4JNxqCC5.jpeg',NULL,'4212','1',NULL,'39 K.B. Fazlul Kader Road','Chittagong Grammar School','2019-11-27 06:43:17','+880312554533, +880312555605','male',NULL,'Panchlaish','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/394/marksheet_previous/OUAmylN7dXwYBbY317RDA8fKAxO4E0XLMPOXzgka.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/394/marksheet_previous_two/AqgIxGxRenjqdG5LP9teXMwOX5LuNaaJDvEaAl7v.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/394/marksheet_current/HbqZaYIq99Qjafk9UOFo3RBVOori2XEk3cpI3FUB.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BW0641359','2023-06-29','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/394/student_passport/VlBAn0Q68lgqTFcu2k5q38RKs2uQWkUFCfSUkmUa.jpeg','Chattogram',2,'1595707044546',1500000,2,'1595707044545',780000,'Chattogram, Chattogram',4000,'Panchlaish','Tohsin Khan','+880312554533',NULL,1,NULL,1,NULL,'I want to apply for YES program to share my culture and hospitality of this country with abroad. Even though the countries are far apart from themselves, I believe that they do share the same interest in enjoying and prospering life, in mainly two different ways. I want to help creating a fusion of these two different ways and help increase diversity, so that both of these two cultures can learn to embrace new ways of life and provide hospitality to one another while doing so.','I want to share mainly the hospitality of Bangladeshi culture with my American family. We, as Bangladeshis, love to form community and stick together. Starting from our cuisine, it is very popular to have food, snacks etc sitting together as a family in our culture. Whether, a cold breezy morning, a rainy day or just any festival, it is very common to have different pithas, pakoras, snacks etc together enjoying quality time together as a family. Bangla language also teaches us to pay respect and affection to members of the society, as we have various pronouns for \"you\" and other words as well. Speaking in Bangla appropriately helps us to establish a kind feeling and a mutual bond among the members of the society.',1,'Facebook',NULL,2,'2019-11-19','2019-11-11',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/394/school_seal/3dc4pYq2tS7lgqKcgPfLGtIthJEMtvbSfuYnAXOO.jpeg'),
