	(82,'S M Abdullah-Al',2,0,NULL,'Dhaka, Dhaka',NULL,19,'A major problem in the present world is Global Warming and Deforestation. If I ever get an opportunity,  I would like to help reduce the effects of Global Warming around the world. I would like to plant more trees, so that people can understand the beauty of the green environment. I had taken part in a plant growing competition, been a part of our Student Council and have done services related to reducing the effects of Global Warming in our school, in particular, helping with organising recycling; from there, I have got the passion to do something to reduce Global Warming. I would like to share it with others and spread more about the benefits of Afforestation.',NULL,'72/7/C-1(1st Floor), North Jatrabari',NULL,412,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/412/certification/2qIGgVF0DYK5ge5BvjvWqY0NyQAWmQuNygsKEVY8.jpeg','Bangladesh','10',9,8,'+8801752744866','80','2003-10-03','smaamr2003@gmail.com',NULL,'1','1','1','+8801911027299','moheb2e2011@gmail.com','Md. Moheb Ullah',NULL,NULL,'Marine Engineer',NULL,'1',NULL,NULL,'Mahmud Rakib',NULL,'+8801631252555','shamsunnahar.roji@gmail.com','Shamsun Nahar Roji',NULL,NULL,'Lawyer(Advocate)',71,74,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/412/student_photo/iANRfrFOekAAqw4TAYTpgpxI9kHOSz8dQ7IJoyI1.jpeg',NULL,'1204','2','Texas','11/A/1, Golapbagh, Sydabad','Golgotha English Medium School','2019-11-27 06:43:18','+88027545466','male',NULL,'Jatrabari','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/412/marksheet_previous/I2f3PnRkmQSeDBV4wTXRGnVz9oY66byQMFeFoPQO.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/412/marksheet_previous_two/AHTXWlaLnrlT7cYQe6ROjExYRAIiKgQciIWtuC3O.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/412/marksheet_current/UlP5wZ4glpPYNJjO2yqqucEXW2VPNO