	(90,'Sanzana Tarannum',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have not have the chance to participate in a specific community service program, but if I have the chance, I want to engage in a clean-up program. A lot of harm is done to the environment everyday, and this has a negative impact on us. Pollution, one of the greatest problems in today\'s world, seems like it is unstoppable. But no, this is not it. If we wish, we will be successful in stopping the damage to the environment. As part of the program, I want to volunteer on cleaning roads and pick up the trash for disposal. This way, we can get a cleaner place to live. Also, I want to host awareness programs where the effects and prevention of pollution can be discussed. This will have a minute effect on people, but I am absolutely sure that I will be able to make a difference with the help of the others who will understand and support me.',NULL,'180/6/11/3 East Rampura, Titas Road, Islami Bank Colony',NULL,458,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/458/certification/7HNNtqD8bbHWKdgURZUrcnoaH1oJAc191Ipe1wUQ.jpeg','Bangladesh','10',9,8,'01917615121','70','2004-06-01','sanzanaahmed9@gmail.com',NULL,'1','1','1','01720086194',NULL,'Md. Sagir Ahmed Imtiaz',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Ahmed',NULL,'01917615121','sanzana10@gmail.com','Mst. Nadira Ahmed',NULL,NULL,'Nurse',70,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/458/student_photo/fizXPH7294AMyzR5l6rc9Ohlpf8PgqIsBs9k5DLJ.jpeg',NULL,'1219','1',NULL,'105/4, Monipuripara, Tejgaon, Dhaka','BACHA English Medium School','2019-11-27 06:43:18','9114525','female',NULL,'Rampura Police Station','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/458/marksheet_previous/0fzARfXddfoQhD2LR4gZ5kjMhLFiaibiBUUXAwVM.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/458/marksheet_previous_two/JGnBpvIAdEWiGTlAp6pGQij9npfTTX6z2HtgxHRp.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/458/marksheet_current/UYQOBbggESVPz1pC79UQMgJ2sk2DNuWt2hXL3Imy.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'8677701719',600000,1,'9563704304',500000,'Dhaka, Dhaka',1212,'Tejgaon Thana','Sr. Miriam Perlewitz, MM','9114525',NULL,1,NULL,1,NULL,'Back from when I was a child, I have always wanted to study abroad. Now that I have the golden opportunity to apply for this program, I want to make full use of it. I want to make studying in America not only beneficial for myself, but also for my country Bangladesh. I want to explore my own self and also explore all aspects of American culture. I want to take in all of what America has to offer and also represent my own culture in the country. As America is one of the most developed countries on the world, be it economically or socially, I want to take its ingenious ideas into my own country. I wish to share my ideas and culture with America, too, and I am sure this program will provide me with the chance to do so.','Bangladesh has gained recognition to other countries mainly because of the citizens\' bravery to fight for their mother-tongue. Which is why, the first aspect of my culture I would like to share with my American family is the language. I want to share with them the history of all the struggles and sacrifices the people have made only so they could speak in the language they love. The bravery and love of these people is unparalleled. This is exactly what I want my American family to know and understand.\r\nAnother aspect of culture I want to share with my American family is the bonding of a family in our country. We like to live in joint families as one except for living alone. I wish to share the same sort of bond with my American family as well as represent the culture of my country.',1,'A Friend',NULL,2,'2019-10-24','2019-10-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/458/school_seal/UzpeRXdm3IK1xDl07EI44lG11t5qJwgrRK9G6ajM.jpeg'),
	(91,'Shopnil',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I love to work for people. I  have an experience working as a Volunteer.In the past.I involved myself with 3 welfare foundation called Jaago Foundation,Somvabona Youth for Foundation and Oporanho  that work for underprivileged children.Oporanho was a foundation that conducted by us in our area.We served food to the poor people during Ramadan.I have also worked for a animal welfare society called CFP.we rescued a street dog.Through these work i feel that i am doing my duty as a citizen and i think throughout my work i might able to feel underprivileged children that they are not alone we are here to help them .I think they will feel motivated and know about their rights.Finally if i get ant opportunity in future working for people and animal i will surely do that .',NULL,'House-09,Road-09,Sector-04,Uttara',NULL,476,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/476/certification/Y52kCPpChiQfamatv14BPH8MU4KPVsiKw83mip3X.jpeg','Bangladesh','11',10,9,'01996384696','77','2004-09-21','shopnilshopno1979@gmail.com',NULL,'1','1','1',NULL,NULL,'Saye Baten Shah',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Islam',NULL,'01996 384696','shopnilshopno1979@gmail.com','Salina Akter',NULL,NULL,'Business',62,64,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/476/student_photo/MAQ6jfJZo6zzg0z0GPwKxadqEfsaPJN7A3Xs9bv1.jpeg',NULL,'1230','1',NULL,'House-03,Road-03,Sector-,06Uttara','Milestone School And College','2019-11-27 06:43:18','01710571085','male',NULL,'Uttara East','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/476/marksheet_previous/c4gyzSw9L0TlETSIz5uXcygatnEKaAH1QV1ol1x9.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/476/marksheet_previous_two/kJEzoGYotHAK7cMOx9kmz4eqGrklu75TECDVBESc.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/476/marksheet_current/T6zcj6JDknEBd6GpeJmMPrdpZ4FvPu5eoNO34Dj8.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 13:41:31',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Uttarkhan,Uttara,Dhaka',1,NULL,-1,1,'6426847098',400000,'Dhaka, Dhaka',1230,'Uttara East','Captain Mir Golam Sobur (retd) BN','01798597266',NULL,1,NULL,1,NULL,'As i love diversity, so this program will allow me to meet people from different backgrounds .Throughout this program, i will get the opportunity to visit and know more about America and their culture. Beside i will also be able to express more about my country\'s such as our culture, language natural resource, etc. in front of my host family in brief, i will be able to hold the honor of my nation and share the image of the country with my host family. On the other hand, this program will let me learn about networking, which will help me to build invaluable relationships with people.I will be more skilled in networking after this program.  This program will make me adaptable and confident.I will get the opportunity to improve my leadership skill .It will also broaden my mind and outlook .My communication skill sharpen. Overall the discipline and lifestyle that i will learn from my host will leave a significant impact over me. i will turn into action every quality in my life.','First of i will tell my host family about our language .I will express them how we prevented our mother tongue from the Rural Pakistan government.Then it comes about cuisine. We have a lot of delicious dishes among them i will serve some of cuisine So that they can get the real taste of our food.I am also thinking to gift them some traditional clothes  such as Punjabi,Shari etc.I think this thing will be more effective to put up our tradition.I will also sing Bangla song so that they can feel the rhythm of our song.We have also dance tradition.I will try to show our dance style specially classical dance.Our religion has also assimilated influences of Islam, Hinduism, Buddhism, Christianity.So i will show them how take part in one another\'s event.We have a lot of festivals i will show them how we go through these festivals.I will tell them story about how  the people of our country welcome guest in their house.I will share about out wedding style.I will play our national sports Kabadi.',1,'Facebook',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/476/school_seal/yENVtYxA3iTdxhA1Nsm9L3GVHBnr1tCTNXVOEZp4.jpeg'),
