',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-16','2019-11-09',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/483/school_seal/YgZ5GjPuRWVZKT94p7ELfpK1518T5Rl7Nee2vm6B.jpeg'),
	(93,'Mohammed Ala',2,0,NULL,'Chattogram, Chattogram',NULL,19,'I have a lot of plans lined up for the future. Ours is an under developing country.  I could hope to bring a specific and positive change in my community by using my experiences and knowledge gained by the programs like YES. It includes public awareness, sharing the concepts of the other people about us, the necessity and requirements of education and community services. There are also a lot things that I can think and hope for. But these are the primary concerns.',NULL,'Hamid Jamider Bari, Middle Mohara, Chandgaon, Chittagong, Bangladesh.',NULL,486,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/486/certification/uoVy4Azr2tMAagvDPsCeDu374FBBwpHKrRFGwo7D.jpeg','Bangladeshi','10',9,8,'+8801811216392','65','2004-07-14','alauddin.alve@yahoo.com',NULL,'1','1','1','+96899040724',NULL,'MD. JASHIM UDDIN',NULL,NULL,'Mechanic',NULL,'1',NULL,NULL,'Uddin',NULL,'+8801811216392',NULL,'DILOARA BEGUM',NULL,NULL,'Housewife',65,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/486/student_photo/MRvEcFTnuqk8f3LGn3pA4QBu7ghQiM3OQo6IOYFt.jpeg',NULL,'4208','1',NULL,'Moulabibazar, Mohara, Chandgaon, Chattogram','Mirza Ahmed Ispahani Smriti Biddalaya','2019-11-27 06:43:18','031672391','male',NULL,'Chandgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/486/marksheet_previous/EUr9Xwtu5qMU4nUFPi4PHQAoZKVqNb8osdHYp0Ok.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/486/marksheet_previous_two/qwPZgkZCqQD0a4RCajU2xKjq5DCQbT5XpGceJgI6.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/486/marksheet_current/JFW2S6TA8X6NjeYORpePUUAgKXijNrgsAdgysFMC.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BF0313364','2020-04-28','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/486/student_passport/ZPRYycUvYnAWe1QTOBrktVRg5RamVY8grHfMz89s.jpeg','Al Khoud, Al Seeb, Oman',2,'7781687772',360000,2,'1905867444',-1,'Chattogram, Chattogram',4208,'Chandgaon','Pankaj Kumar Bhattacharjee','+8801991945852',NULL,2,'Oman for vacation',1,NULL,'I just want to know and enhance my knowledge about USA and. I want to know people participating from different parts of the world and looking for a chance to meet them and know about them. Plus, I want to boost up my experience and make up my courage by participating in the YES program. That\'s all.','I want to share about my country, my family, our lifestyles, my life and cultures. And I wish to share by co-operating with them. First, I gotta understand them, their mentality and their lifestyles. Then I\'d tell about my cultural aspect and all me picking a right time and right environment. To share mine with them, first I need to know and have a taste of their own.',1,'Facebook',NULL,2,'2019-10-23','2019-10-19',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/486/school_seal/RroB8ZFKGVTtc6hfJtQbBqn4GFJVkleie3N6nIGe.jpeg'),
	(94,'Ishmum',2,0,NULL,'Dhaka, Dhaka',NULL,19,'As I\'ve mentioned earlier that I am amicable and friendly towards others so, it is a great pleasure for me to take part in community services. I believe that community services are very important for a conscious student because he/she has some commitments for the society. Whenever I get a chance, I get involved in community services. \r\n\r\nI am the Organizing Secretary of the \"Green Club\" of my school. Every week we launch the cleaning program ln the campus. Besides, every month we take part in the cleaning program of our neighborhoods. I am also an active member of \"Social Welfare Club\" of my school. During the winter, we distribute warm clothes among the poor and disadvantaged people. Every week we get involved in controlling traffics of the neighborhoods. In this way I try to contribute and serve within my community.',NULL,'F:3/B,H:506,R:12/A,Adabor,Mohammadpur, Dhaka-1207',NULL,496,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/496/certification/SG63XvaPFCbqYnrEl1E7hgf3HsuQh6y7LbWjjN7G.jpeg','Bangladesh','10',9,8,'01711220320','82','2004-01-15','ishmumnawar@gmail.com',NULL,'1','1','1','01715181947','elahi2930@gmail.com','H. R. M. Elahi Dad',NULL,NULL,'Government Job (Professor, BCS General Education)',NULL,'1',NULL,'@ishmum_nawar','Nawar',NULL,'01711220320','takterluna@gmail.com','Thomina Akter',NULL,NULL,'House wife',72,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/496/student_photo/Rtfc7b3mQFz15I1Bb1eTNnHZB3zfp26VBz87EIFW.jpeg',NULL,'1207','2','New York','Gaznabi Road, College Gate, Mohammadpur, Dhaka-1207','Govt. Mohammadpur Model School & College','2019-11-27 06:43:18','+8801769111190','female',NULL,'Adabor','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/496/marksheet_previous/CTPFfiI48Tl69sWJkqISB0kYK634RFUudnnUuh6E.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/496/marksheet_previous_two/DVThmnwR7Naf08qIr57yKjtNvHAKesdsmSP6tcu1.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/496/marksheet_current/1vzrl18UE5zme8bIVheI1rYeeqwtqHAIQJJZVXoI.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Domar,Nilphamary',2,'8524902011136',1100000,2,'2399392360',360000,'Dhaka, Dhaka',1207,'Mohammadpur','Lieutenant Colonel Kazi Sharif Uddin','+8801769111190',NULL,1,NULL,1,NULL,'I belong to a conservative Muslim family of Bangladesh. Though I belong to such family, I love to get involved in cultural and social activities. I\'ve always wanted to cherish the spirit of Bengali culture and spread  among the people around me. To be specific, I am a singer, dancer. I love recitation and painting.I also love acting and I have played different roles in various programs. I think that \"YES Program\" can present me a great window for sharing my cultural spirit with the American people.\r\nAt present I live in a male dominated society where females struggle to express their dream and right.They cannot materialize their dreams but defying all the obstacles I want to chase my dreams. \"YES Program\" can be the door to my journey of success.\r\n\r\nAs a person I\'m amicable and liberal. I can easily adjust with new people and situations. Moreover, I love to enjoy things with others. I believe that if I apply for the \"YES Program\" and get selected I can be a true Ambassador of Bangladesh.','My beloved Bangladesh is rich with various unique cultural aspects. We have a very rich language, mouth watering foods, special clothing and co-existence  of various religions. As I love all the aspects of Bengali culture, I can share all those with the American family. Specially I would like to focus on my language, cuisine, fashion and religious values. \r\n\r\nI am a simple Bengali girl who loves to taste traditional Bengali foods, wear traditional bengali dresses  like Saree and Salwar-Kamij. I can share our lifestyles  with my American family. Again, I will be able to share our religious values which emphasis peace and harmony. Furthermore, I would love to share the great history of our language movement of 1952 as well the background of our liberation war of 1971. I want to give them a message that the Bangladeshi people are peace loving, tolerant and passionate about making sacrifices for man kind.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/496/school_seal/QFyuv9obMJVMHyFvWTtIDA1JCp8mITXCmmoduHqr.jpeg'),
	(95,'Mahajabeen',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I love to do community service.  This is something by which we can help our  community easily. I am a member of roverscout and campasika magazine. I took part in a event to do community service. \r\nI took part in a event of campasika magazine programme which was \"asho shudhu vasha chorcha kori \". I found this very helpful because we,  bangali fought for our mother language but now for the lack of supervising our language is being effected. Many people is using some word which dont even exist. In this  event we talk about the problems and tried to findout the solution of the problem.\r\nWe discussed that if we talk with the writer who are very famouse, to be sensible for using bangla instead of english then we can be careful for the spelling of banners. Many people read those out and if they put a wrong word then they will learn the mistake and this way some day we will lost the real bangla words\r\nSo by doing this we can make our community great.',NULL,'House#12,Road#5,Block#G,Section#2',NULL,499,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/499/certification/2omOcWZj8V1zUDNPnWJ7jU65btV4bx9dOqNX9TOM.jpeg','Bangladesh','11',10,9,'01552481117','98','2003-06-03','mahajabeensreya@gmail.com','Mahajabeen Zaman','1','1','1','+8801716171146','mahajabeensreya@gmail.com','S.M.Moniruzzaman',NULL,NULL,'Businessman',NULL,'1',NULL,'mahajabeen_sreya','Binta Zaman',NULL,'+8801552481117','mahajabeensreya@gmail.com','Umme kulsum',NULL,NULL,'Unemployed',60,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/499/student_photo/Xq2hMnlNjN4GbiysQlT8WdATUoAUDL6Z99E1Kxef.jpeg',NULL,'1216','1',NULL,'1/A, New Baily Road','Viqarunnisa Noon School and College','2019-11-27 06:43:18','+880258310500','female',NULL,'Mirpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/499/marksheet_previous/0zgbuKRkv13h4rEf0KpF2vyTfrg05FUrKvkRTm95.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/499/marksheet_previous_two/Q3ihZ8Lu8DtFd2S0agBKaDrF23xqef5jLD9qe6yX.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/499/marksheet_current/6pj3trQJeVM2WeQrWpC9IZdWbgFMrczQbxRQJepg.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,2,NULL,'I have a vision disability','BR0567302','2023-01-22','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/499/student_passport/OXFavInLqsI7HH3TPhmNkCsGP15SJMkPO6IdZzYe.jpeg','Dhaka',2,'0116077861814',300000,2,'8693528955',-1,'Dhaka, Dhaka',1000,'Ramna','Fouzia Rezwan','+880258310500',NULL,2,'India for scout camp',1,NULL,'YES stands for Youth Exchange and Study.It means the culture exchange between two countries.Every country has ot own culture which make it differen.  Though I am a bangladeshi but the American culture attract me the most after Bangladeshi culture . I want to apply to experience the culture by myself and to teach them about my culture so that they can experience some new thing that they have never done.','We have our own way of living,eating habit, cultural function,Festivals,clothes,language, religion and tradition. These are the complete picture of our nation and the most important and basic concept of our culture. \r\nWe have some specific characteristics of our culture. We have our own food habits. Like eating rice and fish. Again we have our traditional dress like lungi,Punjabi,Shirt,Saree and Blouse.\r\nWe have a lot of famous festivals which are celebrated by all people. \"Pahela Boishak\" is known as the first day of bangla year. In this festival we wear red and white combination dress. We eat \"panta ilish\". We also celebrate \" pohela falgun\". We represent the falgun in our costume. We were \'bashonti\' colour dress.\r\nWe do not discriminant any people by their religion. We always love and respect eachother. We celebrate all of our religious function with pride and everyone attend the festivals.',1,'Other','From my aunt',2,'2019-11-13','2019-11-05',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/499/school_seal/HPU4bfviUuaJA1re9B73x6ONS6c1HFaFhayTCQF0.jpeg'),
	(96,'Md Hasan',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I am an active member of the scouting team here in my college. I actively participate in the cleaning program of the college. We also have some program of teaching street children in the nearby areas, i did participate in that as well. I think i can help on any type cleaning program in the US, i can volunteer to work in any school programs, help elder people, help gather food for poor, help out in nearby hospitals etc.',NULL,'35 Dhalka nagar, Gandaria',NULL,508,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/508/certification/YF3kaoWHuIxvowILnRwfzziBInDJesyZuaL8fDSc.jpeg','Bangladesh','11',10,9,'+8801403901046','60','2004-03-05','hasanalif128@gmail.com',NULL,'1','1','1','+8801715993167','towhid.ahamed@gmail.com','Md Sahed Ali',NULL,NULL,'Mechanic',NULL,'1',NULL,NULL,'Alif',NULL,'+8801942757976','towhid.ahamed@gmail.com','Ms Halima Khatun',NULL,NULL,'Unemployed',78,82,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/508/student_photo/NlotjIu11xGj0MU9h3nm7uME8KtcjSxOOx4qVPbX.jpeg',NULL,'1204','2','Virginia','Toyenbee Circular Rd','Dhaka Notre Dame College','2019-11-27 06:43:18','+88027192325','male',NULL,'Gandaria','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/508/marksheet_previous/VrFERIAeUcu0ryJhU3DyK8JHjnpjhVLjHNcIa5ZK.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/508/marksheet_previous_two/8recAXrGstjV8pQt5DYdRolZVTX4V9hSD14W83NY.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/508/marksheet_current/leXcZTOKQSBAfXgHTmD8ZGLe8zpPi9mVOQMAOiL1.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-30 17:19:59',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'6891341668',900000,2,'6440371075',-1,'Dhaka, Dhaka',1000,'Motijheel','Dr. Father Hemanto Pius Rozario, CSC','+88027192325',NULL,1,NULL,1,NULL,'The education system of United States is one of the tops in the whole world. If i get the chance to study for 1 year in US i think i can boost up my level of knowledge at a very high standard. This should also help me in future since i have plans to complete my masters and PhD from United States. This should help me understand the education system as well which will certainly help getting admission at a higher level later on. It should provide me a high-level knowledge of diverse culture in the United States and a different approach to learn things practically. As far as i know things are taught more in a practical way compared to a book-based education in the United States. At the end i would say this can boost up my confidence as a student and help me go so far in my career.','I would love to share some simple Bengali lines and words to the American family. I can certainly try to make some Bengali dishes and show them the difference, i am pretty sure they will like the Bengali foods. I will certainly bring some traditional cloths for them like Panjabi, Sari, Kamiz etc for them to make them know more and like the tradition. Would also love to share some pictures of some of the beautiful locations of Bangladesh.',1,'Facebook',NULL,2,'2019-11-21','2019-11-19',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/508/school_seal/DJPpG8Dj8JBeIczyCmuNR9FQ0NioGy9s4tyDq0bE.jpeg'),
	(97,'Humayra',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Community service is a very important part of the program. If I have the opportunity to bring a specific positive change in my community through community service, I\'ll choose to educate illiterate people and children.\r\n\r\nEducation is one of the most effective agents of change in society. When a child is able to go to school today, he or she sets off a cycle of positive change. But, thousands of children in Bangladesh lack access to education and cant even write their own names. Moreover, underprivileged children between the ages of 11 to 14 years are highly vulnerable to dropping out of schools. An educated child stays away from an early marriage and is empowered to stand up against exploitation. With so many factors playing a role in Bangladeshs illiteracy issue, there is no single solution that can bring about immediate change. But there are some small steps that I can pave the way for higher literacy rates: Free education, Flexible schedules, Vocational training, Raising awareness.',NULL,'3/A/B,(3rd floor), 1st Colony, Mazar Road, Mirpur',NULL,518,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/518/certification/Pbz2Btf9Y6PqIXhdAFJgfpxrrEOQmIrK5J7btYu5.jpeg','Bangladesh','9',8,7,'+8801955255676','70','2004-11-03','humayra7800@gmail.com',NULL,'1','1','1','+8801678095263','akter2010zaman@gmail.com','Md. Akhtaruzzaman',NULL,NULL,'Deputy Gen. Manager',NULL,'1',NULL,NULL,'Akter',NULL,'01819630782','akter2010zaman@gmail.com','Hosna Ara Akhtar',NULL,NULL,'Housewife',100,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/518/student_photo/jHDwChSkBW70j5tjG52Dx4GQymUAQu8135rcaqN5.jpeg',NULL,'1216','1',NULL,'101, Pilkhana Road, Azimpur','Viqarunnisa Noon School','2019-11-27 06:43:18','+88029666359','female',NULL,'Darussalam','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/518/marksheet_previous/ppF2zM2iiYhlT6v6yNyCIJ7mOfCQ5T2M50pqDf5f.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/518/marksheet_previous_two/Mx2HaGoQKwbTzaH6QizfFZtXVpFjjvcehgz2yTeg.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/518/marksheet_current/o3duk0IAB0w8BDOFhapzyA9Ll0Dygl1ezN8bddcR.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'5503867342',360000,2,'2353869049',-1,'Dhaka, Dhaka',1205,'Lalbagh','Shamsun Ara Sultana','+8801715613953',NULL,2,'Saudi Arabia for visiting relatives.',1,NULL,'I want to apply for the YES program because the YES Abroad program is a cultural exchange between the U.S. and countries with significant Muslim populations. YES Abroad participants live with a host family and attend a local school, promoting mutual understanding between the United States and the host country by forming lasting relationships with their host families and friends. It will increase my knowledge about other people which is from another country and improve my communication system with other countries.it will be helpful for my future betterment.','I wish to share bangladeshi cuisine with my American family. Everybody test different food in life. Bangladeshi food is different from other countries\' food.\r\n\r\nour daily food in life is Rice and fish,a day without a meal with rice is nearly inconceivable. Fish, meats, poultry, and vegetables are cooked in  curry ( torkari ) sauces that incorporate cumin, coriander, cloves, cinnamon, garlic, and other spices.Increasingly common is the preparation of ruti, a whole wheat circular flatbread, in the morning, which is eaten with curries from the night before. Also important to the diet is dal, a thin soup based on ground lentils.\r\nOur food is very easy to cook so I can cook food and share with them. Any occasion I\'ll  invite them to attend our program and share our food with them.',1,'My Family Member',NULL,2,'2019-10-22','2019-10-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/518/school_seal/xmWa0p5N5hOYkRBQAIFBm5wKHL3jmlT6OKbteleZ.jpeg'),
