	(104,'Asma',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I have volunteered in an NGO Program, \'Feed One\', whose principal aim was to influence the underrated youth to be kind to donate food for one if not many. One small act multiplied by hundreds can transform the world. We walked through the streets of Dhanmondi, in search of hungry homeless people, to provide them a package of warm \'biriyani\'. I am proud to be a part of it. Another recent community work that I have been involved in was the Human Chain for supporting the protests for the increased roadside accidents of students, and youngsters due to careless drivers, some without licences, and the poor road safety regulations. The students took it upon their hands, forfeiting school hours, to regulate, run and re-establish order into road safety. I saw the need to stand with them as the nation must be reformed from the crisis. One time during the many Human Chains, we made a long procession with placards in hand, protesting along an around three kilometres section of Manik Mia Avenue.',NULL,'House 4, Road 8/B, Mohammadi Housing Society, Mohammadpur, Dhaka',NULL,537,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/537/certification/1xKYdcEjPzXMPBYliN6oJ5B7WqRAA6rd6EBbuyyi.jpeg','Bangladeshi','10',9,8,'01876890381','74','2003-03-06','duhita5700@gmail.com',NULL,'1','1','1','+8801715909844','abu23july@yahoo.com','Abu Taher Salahuddin Ahmed',NULL,NULL,'Research Fellow (retd.), BIISS',NULL,'1',NULL,NULL,'Ahmed',NULL,'01715909843','layeqa.bashir@gmail.com','Layeqa Bashir',NULL,NULL,'Teacher',74,79,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/537/student_photo/f2CSAii8p8oAmm1FcFRONx7ZAGhMTlB2e8bDwwbk.jpeg',NULL,'1207','2','Detroit','24 Asad Avenue, Mohammadpur, Dhaka','S.F.X. Greenherald International School','2019-11-27 06:43:18','+88029115200','female',NULL,'Adabor','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/537/marksheet_previous/TXLNe5XLDykjLwxyqQhoB4bKswOrQWIQXq2Q8HBp.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/537/marksheet_previous_two/ccJ9kZkguJqKuiQ92QFPzLuu1FEKom3yJdPr4ZHC.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/537/marksheet_current/lP0AaIYYCUA21QREg1FhfRrlUVKrR6G07Z8KNvOY.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BH0615780','2020-09-15','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/537/student_passport/GlgRSaljoD2aTSUJI9TfGzakBVRY5ugG1DVqz5Zi.jpeg','Canberra, Australia',2,'2690246970836',480000,2,'5983922377',960000,'Dhaka, Dhaka',1207,'Mohammadpur','Sr. Virginia Asha Gomes, RNDM','+88029115200',NULL,2,'India, as a tourist.',1,NULL,'I apprehend it to be an ebullient experience which may assist in developing my social and cultural notions. It will aid me in discovering who I truly am as a human being, by interacting with peers of diversified cultures, traditions, ethnicity, religions, etc.; from whom I may learn to view the world, the conduct of living and its beauty in different perspectives, to those I may compare how i view the world. Therefore, I may further decipher on how to live a full vivacious life by discovery of a connotation to life, hence contributing to my my country. I would love to meet new people, enjoy, and share my country\'s rich history and brotherhood. Furthermore, by this interchange between our disparate nations we may attain a grand positive outcome through \"sociological imagination\", by absorbing the nourishment of the ways of lifestyles of each other. When the globe\'s puissant positive forces amalgamate, broadening our lenses, a sagacious persona arises among us.','As Bangladesh is the only country ever to fight millions of troops, sacrificing lives for their freedom of being able to speak and use Bangla, their beloved mother tongue, Bengal has immense pride. With the Language Movement of 21st February 1952, the date has been announced International Mother Language Day. Bangla alphabets have a unique sound to them. I would like to teach my American family about the rich history and disparate enunciation of Bangla. Our cuisine is specialised in explicitly hot flavourful savory kinds, not to mention the beautifully hand made sweat-meat. The \'sari\' is known to be the most meticulous, with attention to details of needlework, preeminent feminine outfit of Bengal; women corroborate equivalence to male in performing any task dressed in the intricately complex sophisticated attire. Moreover, an important value found absent in many nations, is the care and time forfeited for the well-being of the elderly population.',1,'A Friend',NULL,2,'2019-11-07','2019-11-07',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/537/school_seal/RkSwvxfxtn6nZnvVSnYxQjCBWk2PEC688ctz09Jg.jpeg'),
	(105,'MD. IRTESHAMUL',1,0,NULL,'Dhaka, Dhaka',NULL,19,'No matter where you live, there is always chance to contribute to social cause. Usually, the city school goers do not get a direct chance to do community service. However, I took part in the relief program in my village. I distributed winter clothing to the poor in 2017. This year, I have also collected clothing from my relatives and friends for a similar program which was participated by my older brother.',NULL,'24/3, Tipu Sultan Road',NULL,548,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/548/certification/gqNFgbLiDNT1xYmI0sGtjoTx3MKqv5asSvtqZ1TE.jpeg','Bangladeshi','9',8,7,'+8801629624629','70','2006-05-05','md.irteshamulhaquelabib@gmail.com','https://www.facebook.com/mdirteshamulhaque.labib','1','1','1','+8801711181988','universaltradecorporation71@gmail.com','Mohammad Ohidul Haque',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Haque',NULL,'+8801716802971',NULL,'MST BILKIS AKTER',NULL,NULL,'Housewife',70,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/548/student_photo/ze9DLHkbrNAnLAaGFqrPe3pfGlwDjbQSoJ6Fh277.jpeg',NULL,'1203','1',NULL,'82, Municipal Office Street','St. Gregory\'s High School & College','2019-11-27 06:43:18','+880247113689','male',NULL,'Wari','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/548/marksheet_previous/sa6W3vTDe8rrYUCOESWekXQcqAXvkmbmlOLHBLGw.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/548/marksheet_previous_two/OSyVJmJsGb9Tdgne05jUogAvCyKZYlG2qbVBJlpX.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/548/marksheet_current/qCUZksDWCNJ9pf5sdCHBDCJpeig7c3eEvE5oEEpp.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BN0172581','2022-01-21','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/548/student_passport/3bMCZOMZmvqqpqA33q1T2skuY8D3VXTG3Lo8YO2C.jpeg','Jessore',2,'26988743478280',360000,2,'2698874348214',-1,'Dhaka, Dhaka',1100,'Sutrapur','Brother Prodip Placid Gomes C.S.C.','+8801723653748',NULL,2,'India for Winter Vacation',1,NULL,'The reasons behind my interest about the Kennedy-Lugar Youth Exchange and Study program\r\nWho wouldnt want to get an opportunity to study under one of the best education systems? Being a teenager, we cannot but notice the changes that have been happening all around in our community, specially in education sector. We have revised curriculum for secondary level as well. So, it is obvious we are following international and up-to-date education system of the world. Many of the students like me who have been studying in good city schools in Bangladesh are aware of the possibilities and so I have been planning to apply for such a program. A team from my school attended a program  .  in the USA and ever since I have talked to my classmates who participated in the program, I have nurturing a desire to participate in a program offered by the relevant departments of the USA. I have also had several conversations with the teachers about it and the more I hear about it, the more encouraged I beco','Actually the idea of living with an American host family has made the whole K-L YES program even more exciting. As I can cook, it gives me a good chance to get along with the members of my host family. I am a practicing Muslim and so my host family can know about the religious practices as well as festivities we celebrate in Bangladesh. I can exchange emails with my host parents and get to know about their interests too. I would take various traditional clothing and jewelries which I think they would be curious to try them on.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/548/school_seal/Rhh0M0wGhQNzF4DbWWFpqg0ECBDHW2ji68V83Tih.jpeg'),
	(106,'Nigar',1,0,NULL,'Chattogram, Chattogram',NULL,19,'Social Service is one of those jobs, I enjoy doing the most.I have volunteered for \"Youth\'s voice\",couples of times.It is a Non-Profitable organization,under the Mother Organization-\"Youth Worldwide Foundation\".This organization basically works for poor people,especially children.It employs many of helpless women too.Fortunately,I\'ll be volunteering for the foundation again in this month,on an event which will be conducted to help the winter affected people of Bangladesh.\r\nBesides,I was a part of Bangladesh Girls\' Guide Association and currently working for Red Crescent in my college unit.Another most important thing is I have recently launched an English learning club in my campus which is working to improve the spoken English of the girls who came from villages or small towns.They got a chance to learn English for free.',NULL,'Road:03,Lane:06,House:10 (1st Floor),Halishahar,Chittagong,Bangladesh.',NULL,552,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/552/certification/PXi1BCnrDWTHTYbmxttZCx0gJB76LHNMxyxGqAjM.jpeg','Bangladesh','11',10,9,'+8801857712278','80','2003-01-01','isratnigar.13@gmail.com','https://www.facebook.com/nigar.israt.37','1','2','1','+8801554326987',NULL,'Abul Kashem',NULL,NULL,'Service Holder',NULL,'1',NULL,NULL,'Israt',NULL,'+8801867742655',NULL,'Shamsun Nahar',NULL,NULL,'Housewife',80,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/552/student_photo/zU763AD6EriVSQjhIhZNiUV7DcZKEjcpV9wtgFCx.jpeg',NULL,'4217','2','New York.','Khulshi 01,East Nasirabad,Chittagong.','Chittagong Government Women\'s College,Chittagong.','2019-11-27 06:43:18','031-655814,031-2554004','female',NULL,'Halishahar Thana.','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/552/marksheet_previous/uf8annrT3UpyTRm3hMTKzwdveVPDQbKWyg4BikpR.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/552/marksheet_previous_two/kOunERK50zjorfLBcGaOSIvS1lpa1pWfsXssxwyt.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/552/marksheet_current/yfJ5C8by8avz4lSwRrmoX0ynNpuSxqqY1pTLjKmm.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'BR0610851','2023-01-28','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/552/student_passport/VBHqkqxTAkYQK9rCxsyvokRzd3J6mrGTVULZAmnO.jpeg','Chittagong.',2,'4162794566',600000,2,'1913015689',-1,'Chattogram, Chattogram',4217,'Khulshi Thana','Professor Swapan Chowdhury.','+8801819325782',NULL,1,NULL,1,NULL,'I\'m that kind of a person who is always keen to know the culture and traditions of people of different countries.Having a highly enriched culture of own nation makes me more inquisitive of that.When I first heard of YES Program,all I could think about is getting to know new people,new minds,new cultures and traditions.I realized it was undoubtedly my type of thing.Studying for ten months is USA is obviously a great thing.I\'ll learn many things I had never known.This is another thing that felt really nice.But I won\'t lie in this sharing culture and getting to know new people of various religions or traditions attracted me even more than the academics did.','I\'ll be short of words if I want to explain how much in love I\'m with the Bangladeshi culture.This thing gets even bigger when you can spread what you love.It is going to be the happiest thing for me if I can share any of my Bengali culture with my American family.\r\nSaying of sharing culture,the first thing came up on my mind is \"Clothing\".The traditional dress of Bengali women is \"Saree\".This is a very unique type of cloth.And personally I believe that,every woman looks beautiful in Saree.As I wear it a lot,I can easily teach them how to wear it.If I get selected,I will buy traditional Sarees for the female family members and Punjabis for the Men.\r\nThe second thing I want to share is \"Language\".I know that Bangla is a bit difficult to speak for the foreigners.So I want to teach them the most beautiful word of this world.That is \"Ami Tomake Bhalobashi\"; it means \"I love you\".It definitely touches hearts when someone says it in Bangla.Besides,I\'ll let them hear my favorite Bengali songs.',1,'My Family Member',NULL,2,'2019-11-18','2019-11-11',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/552/school_seal/Mh3Y7dOCpNEVuN839p1IYpjg3wrlrL2PUgjNK3Gv.jpeg'),
