 Md Zahirul Islam ( Retd)','9126198',NULL,2,'India travelling vacation time',1,NULL,'I am always interested in learning something new.I love to travel a lot and if it was a dream country like Americ. If i had the chance to then i would consider myself very lucky. I will bring my country to them and try to know their country from them.','I want highlight my culture as well as my language and food.I have been involved with cultural programme since my student life. I also share my food. Another country to share it with and good luck.which i did during our neighbours country travels to Indi.',1,'Facebook',NULL,2,'2019-10-24','2019-10-24',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/553/school_seal/7Loz9Ona0yNN399ZaNxx6wg6QpegEFm6PqToOQOS.jpeg'),
	(108,'Ramisa',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have taken part in some community service programs recently and in the past as well. When there was flood in some parts of Bangladesh, I actively participated in collecting funds from different people. During the time of dengue epidemic, I took part in the campaign of keeping our surroundings clean and hygienic. Our locality also launches a program of serving free foods to the people in Ramadan. I love taking part in this program every year. Hence, I will eagerly participate in any kind of social service as a responsible member of the community for bringing positive changes.',NULL,'2F/3 Nasimbagh ,Mirpur 2, Dhaka 1216 , Flat A2C',NULL,602,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/602/certification/7J61DpISOShq5gtz0Y4w8vIKgCzVcXKzDkMUQ99y.jpeg','Bangladeshi','10',9,8,'01847099500','64','2004-10-02','ramisaislam765@gmail.com','https://www.facebook.com/profile.php?id=100013452037759','1','1','1','01712152337','azharislams@yahoo.com','Md.Azharul Islam',NULL,NULL,'Service Holder',NULL,'1',NULL,NULL,'Islam',NULL,'01847099500','spervin@sfdw.org','Shahida Pervin',NULL,NULL,'Service Holder',65,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/602/student_photo/x4hT4n6bHeDxyDKtDZODXIVGXsTsogooBnEBZNhH.jpeg',NULL,'1216','2','California','Mirpur Cantonment Dhaka','Mirpur Cantonment Public School And College','2019-11-27 06:43:18','01787712115','female',NULL,'Mirpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/602/marksheet_previous/fEcyyk0VSlqaZ7YSwrpUvZBaTIaBLYS3ln3FyFDC.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/602/marksheet_previous_two/iDooM4skZlL0jM1E99CbXoqrF5OpbvALp0OhmeL6.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/602/marksheet_current/6EyoIRlMPAkRRfcA2Tw50QNDgbn09QmAjjXVRNog.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,'EB0097817','2024-06-24','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/602/student_passport/sRx0OhtBwWmqFJCdPzSXhhdyzWzxDsl6RpCAK7GB.jpeg','Dhaka',2,'5992526250',960000,2,'7342551012',960000,'Dhaka, Dhaka',1216,'Pallabi','Lt Col G M Asaduzzaman, psc','01722236865',NULL,1,NULL,1,NULL,'I want to apply for the YES program because it will allow me to study in a better education system and expand the horizon of my knowledge. Through this program, I will also get an opportunity to get acquainted with people of different cultures','Culture in my country is quite different from that of America. When I will start living with my American family, I will make them familiar with Bangla language through verbal communication, showing the alphabets, films and songs. Bengali  dishes are amazingly  popular for their taste and nutritive values. I will be delighted to cook for everyone and get them acquainted with the taste of my country\'s dishes. I will also display the type and styles of clothing of my culture. I would like to perform the activities of my religion and associate them with the festival of my religion if they want to. By sharing my culture,  I want to know about their language, religion, cuisine and clothing as well.',1,'A YES Alumni Member',NULL,2,'2019-11-14','2019-10-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/602/school_seal/FFIR3JSzrxDzL98iebiHiSxwBDfReQrK5SRyzHhW.jpeg'),
	(109,'Prema Gupta',2,0,NULL,'Chattogram, Chattogram',NULL,19,'I have plan to learn how to help people, neighbor, and engaging in community service. I believe my positive attitude; behavior and good negotiations will help for Social Service. Community service is the way to exchange views and opinions and liable to take part in decision making process by giving ideas to people about positivity, being away from differentiating caste, creed, religion. In this way I will bring a positive changes in my country.',NULL,'House # Cha 108/1, AL Ayn Villa, North Badda, Dhaka',NULL,608,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/608/certification/PbIedJVNuejLYA6j4qTkrNE4j7v7NpfE6sO8kiib.jpeg','Bangladeshi','10',9,8,'+8801798445442','70','2004-09-11','Guptachotan@gmail.com',NULL,'1','1','1','+8801798445442','Guptachotan@gmail.com','Chotan Kumar Gupta',NULL,NULL,'Private Job',NULL,'2','2023-10-22',NULL,'Mohana',NULL,'+8801816027101','Chotan_beauty@yahoo.com','Beauty Gupta',NULL,NULL,'Unemployed',61,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/608/student_photo/KuPDBaDKBKcVJsg11qXFZPl1zgAm6lBcXAUXBGe9.jpeg',NULL,'1212','1',NULL,'House# 743, Road#11,Block # J, Baridhara, Dhaka','South Point School and College','2019-11-27 06:43:18','+88029894643,8836280','female',NULL,'Badda','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/608/marksheet_previous/owNl2hbKIzewTpDIb2xyKIJ5rgIKj9SDiDaOWpNM.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/608/marksheet_previous_two/XVFOeBQzjoxdhOtAW7uGGDxv9EfvWxgu3tLK013W.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/608/marksheet_current/cxykO9FI8Bd8KfiBDQESz83NtTfi8J3JpU1gcEQd.jpeg',NULL,2,'8','Tourist',NULL,NULL,'2019-11-30 14:16:41',NULL,1,1,NULL,NULL,'BN0205749','2022-01-24','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/608/student_passport/UrEsTTE3P9ThELCPxVLckMLJ9xDZnxZOfL9EYgt1.jpeg','Chattogram',2,'2690421367628',3836777,2,'2690421367629',-1,'Dhaka, Dhaka',1212,'Gulshan','AM Amjad Hossain','+8801710683637','We have traveled New York this year (Manhattan)',2,'Singapore Thailand and India visit as tourist with my parents',1,NULL,'I want to apply for the YES program as it is an opportunity for broadening my future. I would like to design my future with different culture and education which is my aim to success in my life. There is a chance to become immersed in a totally different environment. My goal is always going to be to get the highest possible quality of education.','I would like to exchange our country culture by upholding its glory. Bangladesh has a rich, diverse culture. The language of Bangladesh is Bangla. Many of the Bangladeshi sacrificed their lives since 1947 to 1952. The Bangladeshi were fighting to make Bangla at the state language of East Pakistan the then. All religion\'s live here as big family and enjoy festival together during Eid Festival and Durga Puja. We are very happy to buy new clothing during festival. Our main food is rice and fish. At first I will take American family as my family and exchange our culture, sociality with nice manner.',1,'My Family Member',NULL,2,'2019-11-06','2019-11-06',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/608/school_seal/8vgdWSDx93dg3ch6VTbEHUK2XKMBo62xmWSMZp7X.jpeg'),
	(110,'Jannatul Mawa',2,0,NULL,'Cumilla, Chattogram',NULL,19,'I have been participating in some of community services before. There\'s \"The Dengue Awareness Program\" in my school, the\"Rohinga crisis charity program\".\r\nRecently the Dengue got an epidemic scale in our country.For increasing awareness and prevention our school community club arranges a rally and we work for cleaning our near environment. At the Rohinga crisis,I took part collecting money and clothes.\r\nIn the near future I want to work against the \"Rumors\". Recently we have seen some shocking impact of rumors across the country.Like as the Padma bridge requires human head, Islam insults on Facebook in Viola, Child kidnapper fear or the Salt price rising crisis. Every rumor gets viral in a fraction of a day and creates a bad impact on our life and economy. It\'s mainly caused by lack of education and the prejudices. I want to make a team for educating people and when a rumor gets viral, we\'ll make an announcement in social media and the local community as making in the colonies or mosque.',NULL,'Namtola Road , Shahdulatpur , Burichong , Cumilla.',NULL,620,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/620/certification/0oJ6sCKercdqQ0ZxiCFRIVczaIKHAlBF8zviNe8N.jpeg','Bangladeshi','10',9,8,'01318806262','80','2004-05-09','jjelane2@gmail.com',NULL,'1','1','1','+8801853975070','jjelane2@gmail.com','Md. Ayub Ali',NULL,NULL,'Banker',NULL,'1',NULL,NULL,'Mawa',NULL,'+8801318806262','jjelane2@gmail.com','Saleha Begum',NULL,NULL,'Housewife',75,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/620/student_photo/vtHzymNZSWQQVookbkLPnYzHFZJDr1xsIJh0Wi9Y.jpeg',NULL,'3521','2','Texas','Comilla Cantonment 3501, Comilla','Ispahani Public School and College','2019-11-27 06:43:18','081-80114','female',NULL,'Burichong','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/620/marksheet_previous/kBI2NGA1IEsyXfyR4GoKMO09eIwO4Ipc5m6ThEvS.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/620/marksheet_previous_two/Zfa8P3BWJoPCannYuybxNo2WNca7rP3Nj93qy3PF.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/620/marksheet_current/YYfrF76vLlvWSDfPmnEXnbpeZasbIWnQpKpV0WR7.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:20',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Cumilla',2,'1914023250734',420000,2,'1914023250735',-1,'Cumilla, Chattogram',3501,'Adarsha Sadar','Lt.Colonel Montasir Mamun','+880176933170',NULL,1,NULL,1,NULL,'Volunteering, acquiring leadership skill and being introduced with the similarities and all the new things of their schools, clubs and local communities are the main particular purposes of my appealing for the yes program.\r\nInternational community experience is regarded as the most important and emphasizing experience in today\'s interdependent world. In the way of my dream, being a Google CEO, I planned for studying in the USA and the YES program is the opportunity for me to introducing with the USA. USA is quietly a world leading country and the birthplace of lots trends and innovation.  So, there should be some differences in their institutions, teaching technique, community and values. By living with a host family and attending a local school in Yes program, I\'ll must be able to acquire leadership skills, participate voluntary programs and engage in activities to learn about the American society and values and also educate others.','As a Bangladeshi, I have worlds, one of the most diversified cultures. From this huge and expandable culture, I have lots of things to share Americans. Specially our delicious traditional foods, classic songs and dance and our glorious history \"our liberation war 1971\".\r\nI want to perform our classic songs and dance in Americans family and local school or clubs. By cooking our traditional foods, I want to introduce them the Bangladeshi flavor.\r\nI\'ll celebrate our traditional festival like as \"The Pohela Boishakh\" and our national holiday\'s with them and educate them, how do we celebrate that.I want to give a short speech about the great sacrificing for our \" mother tongue\"in 1952 and the \"liberation war 1971\" in school-club and there\'s family discussion.\r\nI think this aspect of our culture helps them to get a clear image about us and our traditions.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/620/school_seal/lsWU7lll7nsNAfQLi1MNAHRhzwkbOhcZyDy7yUQv.jpeg'),
