	(114,'MD.FAHIM MORSHED',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I had an opportunity to work with a social service group in my school.I along with my team had arranged the program from my school.We took effective measures to raise awareness among the people of the Society about the dengue fever.Recently an epedimic of dengue fever have broken in my locality. I and some of my friend of my team could bring positive change in our community by aware them about dengue.We tried to make them aware about health and sanitation.',NULL,'Grand Plaza,29/2, Pach Bai ghat lan,Sutrapur,Dhaka-1100',NULL,654,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/654/certification/SGDrsDwdXi8rp4NtmIRXAwKQhU84ahAaMR2GxdvV.jpeg','Bangladesh','10',9,8,'01929374604','60','2004-11-13','khorshedalam8683@gmail.com',NULL,'1','1','1','+8801672317243','mkhorshed.alam@ucb.com.bd','Md.Khorshed Alam',NULL,NULL,'Banker',NULL,'1',NULL,NULL,'MIAJEE',NULL,'+8801929374604',NULL,'Masuda Parvin',NULL,NULL,'Unemployed',69,79,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/654/student_photo/y7LctAPrVXFP4oTxxbN5YXywz8doBvZN5n9eC2vP.jpeg',NULL,'1100','1',NULL,'2 MUNICIPAL STREET, LAXMIBAZAR,DHAKA-1100','Dhaka Govt. Muslim High School','2019-11-27 06:43:18','47116801','male',NULL,'Sutrapur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/654/marksheet_previous/9eQo7bXc7ZjRnDCCg4yXosoQfagPJht8UIFW2MY3.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/654/marksheet_previous_two/NBsPSggv7PuzYyQHOsimU0XpgnCzPh0StkqjbRPL.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/654/marksheet_current/GWIRe9RnhzZSh6rXDYsdgT1b4VIO9fvQYj1lG36V.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:17:02',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Chandpur',2,'19721315863469749',200000,2,'19811315863470766',-1,'Dhaka, Dhaka',1100,'Sutrapur','Rezina Akhter','0247116801',NULL,1,NULL,1,NULL,'From my childhood, i am very interested to know about American culture and custom.I wanted to know them more closely.So, When i  see YES program i just can not miss this opportunity to fullfill my long cherished dream.With this program, i want to share myself and my country with some of my American friends and their family.I also want to know about them personally.','I would like to share my Bengali language and culture.Secondly,i like to share the custom of my country.Our clothing such as both male and female dress,their clothing habit etc.\r\nBengali cuisine such as rice with fish,vegetable, \"dal\" etc are the famous one in our country.I want to share this kinds of food with them.I would like to share about my religion with them.Such as about 90% people of our country are muslim.Rest of the population of this country are Hindues,Buddhist, etc.All the people of our country live here happily.Our country is a nonsectarian country.I would like to share it with them.',1,'Facebook',NULL,2,'2019-11-02','2019-11-02',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/654/school_seal/2N0LJPCKkuXdAi1YozFOWSEJMKoh2cUct1C5wcXX.jpeg'),
