	(116,'Maliha Nashat',2,0,NULL,'Mymensingh, Mymensingh',NULL,19,'Community is important for us as we grew up in it and it taught us the basic things of life.So i wanna work for the society in return\r\nI have been a member of the Red Crescent for the past 7 years. In every natural calamity or disaste,  whenever our community needed me,we tried my best. Our team also collected relief materials for the flood affected people who lost their last remaining earning source in the flood  .  In the Rohingya crisis,we sent then food and tents,cloths etc. I organised a book club in our area. I arranged tree plantation projects with my team. We raised awareness among the local people to stop early marriage,  importance of education, stop dowry, taught them about family planning and so one.  We made a team to help the poor, the homeless, hungry stray kids under my lead. We\'re trying to broaden our circle of helping the society as we grow up to be a good person from heart.',NULL,'39/3,Bagmara Road',NULL,664,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/664/certification/drWWkcg0RLrUwtJwCMI1L7B5oMTKjR8u2og4M6bZ.jpeg','Bangladeshi','11',10,9,'01684766764','84','2003-09-07','malihanashat@gmail.com',NULL,'1','1','1','01711135633','ahammadmohiuddin6@gmail.com','Mohiuddin Ahammad',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Ahammod',NULL,'01816024642','selinamunni123@gmail.com','Selina Akter Parvin',NULL,NULL,'Teacher',84,89,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/664/student_photo/h0KpmoqUXR53y0cyo2Pwe8wjhkrhN2V7IbHIOs5M.jpeg',NULL,'2200','1',NULL,'Fulbaria road, Aqua','Mymensingh Govt. College','2019-11-27 06:43:18','01712955375','female',NULL,'Mymensingh Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/664/marksheet_previous/XJkhnFn298NpndG4o6Q6QhvNBkm4JVtxUtabVnoT.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/664/marksheet_previous_two/HmQUDC5XPoLSIhmxrKtPpfUPHcDmHWz0RDeGvkh7.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/664/marksheet_current/6jFbzJNtDoQQp4FUviL8nUyjt6qKVIwixdXbBt38.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:19:32',NULL,1,1,NULL,NULL,'EA0453954','2024-04-17','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/664/student_passport/M8ohzlWPiHITeEEIeDyvAjG6L2rCrl1lt9M9MdUI.jpeg','Mymensingh',2,'4180867204',500000,2,'3731246421',700000,'Mymensingh, Mymensingh',2200,'Mymensingh Sadar','M.A.M Zakir Hossain','01712955375',NULL,2,'Malaysia for vacation.  Saudi for Umrah purposes',1,NULL,'For me, Knowledge and skills got no limits. I want to apply for the YES program to enhance my socializing skills, to globalise,learn more about different cultures and spread my own.I want to represent my country as well. I wish to communication with people all around the world,see their life style,be a part of it,experience their way of things, experience their education system and learn as much as i can. Aside from these, i hope to let them know about our rich culture and prosperous history. I wish to share all my experiences With them as well. For these reason,  just Visiting a country is not enoug, or to say, is laughable to even try. The YES program, for me,was the best possible way to achieve this goal. To push my boundaries and be the best of what i can be for the world,YES program is the best plan.','History: since long ago, our country has been a meet up place for people all around the world.  As a result,  it has many historic events and  all those influences our culture more and more. I can tell my  American family about these heart racing history of our country, Which may interest them in exploring the turns and twists of histories of different people \r\nCuisine: For starters, i can tell my family about the diversity of Bangladeshi cuisine as it got shaped by the cultural mixture of people.  I can also try to make some easy items  for them to try out. \r\nClothing: Banglades, being a nation where culture playes a huge part in daily life,clothing, more accordingly,  cultural clothing playes a huge part here. I can show my family and friends our cultural clothing like shaari,Jamdani, muslin etc.\r\nLiterature: our Literature is enriched with talented writers,nobel winning poets and song writers and so.I can share books of poems,novel, Short stories of Tagore, poems of Nazrul etc.',1,'Facebook',NULL,2,'2019-11-20','2019-11-18',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/664/school_seal/nMnkmXMY5O7xjAkMEiXMiOwUUuCfwlJ2iulU8L8s.jpeg'),
	(117,'Shamiha Tasnim',1,0,NULL,'Jashore, Khulna',NULL,19,'I\'ll leave my exchange home more beautiful than it was before I left . I can clean up and organize the house with that family and a bunch of friends. I can plant tree and make a community garden. Being volunteer at libraries and serving food to those in need will also spread a positive vibe.',NULL,'BAF Base Bir Sreshtho Matiur Rahman , Niharika 45\\1, Jashore,Bangladesh.',NULL,665,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/665/certification/ef0xAU8BJZeZGgthS9KdDxzFJMdNfT1HRF95rfTC.jpeg','Bangladeshi','11',10,9,'01678639212','70','2003-12-18','shamihatasnim0@gmail.com','https://web.facebook.com/shamiha.tasnim.589','1','1','1','01730311105','ershad488@gmail.com','Md Ershadur Rahman',NULL,NULL,'Service holder',NULL,'1',NULL,NULL,'Tasnim',NULL,'01733065086','shahana@gmail.com','Mossa Shahanara Khatun',NULL,NULL,'Nurse',90,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/665/student_photo/eBlH2tmzr1MIpo6bL17fepSmwYx1kr9jOnbLgrw6.jpeg',NULL,'7404','1',NULL,'BAF Cantonment, Jessore Cantonment, Shaheen College Rd, Jessore','BAF Shaheen College, Jashore.','2019-11-27 06:43:18','+8801711-245003','female',NULL,'Jashore Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/665/marksheet_previous/otRh8uZDHJqHThSfi0T48t9yU6budiPx5WyM24F9.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/665/marksheet_previous_two/pHKvopsbvjo92zYEAYMWDXYIzL84NZf17TAxTUfl.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/665/marksheet_current/9V9XetJBi1f4HWbXyoVRKmcOw5PpbcZypgc14PEW.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:20:37',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Jashore , Khulna',2,'19741596541051405',375120,2,'4154798197738',354438,'Jashore, Khulna',7404,'Jashore Sadar','Group Captain Mohammad Moinul Hasnain','+8801769405574',NULL,1,NULL,1,NULL,'I\'m applying for this because I want to taste what studying abroad really means. By knowing all those culture I\'ll be inspired and motivated. I\'ll represent Bangladesh in front of world . It\'s a source of making friends all over the world and although traveling will become a part of everyday life','The culture of a society means the way of living, eating habit, cultural functions, different kinds of festivals, clothes, language, religion, values, policies, tradition etc. It is the complete picture of a nation and the most important and basic concept of sociology.Firstly, it must be social and it is developed from the society and social communication. Secondly, all the rules of a culture are not learnt by the people in the society. Some are learned and some are acquired. The cultural activities of a society are totally different from another society. Cultural elements like the way of living, eating habit, cultural functions, different kinds of festivals, clothes, language, religion, values, policies, tradition etc. are totally different from other cultural elements. In our culture, our songs are based on rural and idyllic pictures of life. We have jari, sari, bhatiali, polligiti, religious and mystic songs. Similarly, we have our own food',1,'Facebook',NULL,2,'2019-10-22','2019-10-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/665/school_seal/LW1IjHadHA3OeokFl3AvfRssqu3TbIuhYfkU0s2U.jpeg'),
	(118,'sanjidul islam',2,0,NULL,'Dhaka, Dhaka',NULL,19,'If I have the opportunity ,I will first change the community service of our society. Then I would be able to spread the light of education among the people .For that reason our society will develop quickly.',NULL,'55/9-K matikata,Dhaka cantonment, Dhaka-1206',NULL,666,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/666/certification/al0S0vcOoHFHRSGbED2TTb7lladJku9ESKSbOGPH.jpeg','Bangladeshi','8',7,6,'01712542631','69','2004-08-01','plabonsanjidul@gmail.com',NULL,'1','1','1','01712542631','tofayel2631@gmail.com','Tofayel Hossain',NULL,NULL,'service holder',NULL,'1',NULL,NULL,'plabon',NULL,'01929737166','sayedaaktersweety@gmail.com','Sayeda Akter',NULL,NULL,'Housewife',70,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/666/student_photo/q0EKTAXOGUq99gsrfq7kAX6fP6zLGBSYB1VL9PzG.jpeg',NULL,'1206','1',NULL,'Dhaka Cantonment','Adamjee Cantonment Public School Dhaka,1206','2019-11-27 06:43:18','+80256987456','male',NULL,'Dhaka Cantonment  Thana','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/666/marksheet_previous/wEFgVTxDs8D81HZLwNqgtYHu2mbL4OjfGWVPtRJx.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/666/marksheet_previous_two/eUkt6Act5UcpLcOKWGtIKfvHCfh4NTI49k47UMzz.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/666/marksheet_current/nMfrwDY9vr1cTRJuRvKRsso6z00iLDfmFfGGaNCb.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:23:14',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka,Bangladesh',2,'5058651521',400000,2,'5058655746',-1,'Dhaka, Dhaka',1206,'Dhaka Cantonment  Thana','Lieutenant Colonel Masud Rana','01994080066',NULL,1,NULL,1,NULL,'I am Sanjidul Islam.I want to shine in my life.I want to revealed my knowledge in that programme.And also doing it for my parents.That\'s why I want to apply for the YES program.','I am a Bangali.