L,1,NULL,1,NULL,'I want to apply for the YES programme in order to represent my country,culture and the hospitality of the people of my community. Through this,i would like to share the polite and decent behaviour and manners of Bangladeshi people.','I would like to share diferent religion and food culture of Bangladesh with my American family.Bangladesh is a country  of different religious communities. But people of different religious live with communial harmony.There is no communial riot among the people of different Religious. In a word Bangladesh is a country of communial harmony.On the other hand Bangladesh is a low laying country of South Asia.Naturally Bangladesh is a land of rivers.As fishes available here,fish is the main food of the people in Bangladesh.Rice is grown amply.Rice is also the main food of Bangladesh.Besides people eat a number of other foods such as vegetables, meat and other foods.\r\n\r\nI would like to share all this with my American  family through providing community service as i have provided in Bangladesh .',1,'Newspaper',NULL,2,'2019-10-29','2019-10-28',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/681/school_seal/qXA838Zo6jyzKvNF4NygavCOE7oXsfONds3vzpxi.jpeg'),
