ld  like to share  our language  and culture. Because, it is totally different thing for them',1,'Newspaper',NULL,2,'2019-11-19','2019-11-18',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/684/school_seal/66ecwxePiLr47ghX0W6uU1ctMGdWTlKkFHSAvGxz.jpeg'),
	(121,'MD. Shafin Rahman',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I have experienced participating/organizing a community service in the past. I was  part of a organization and with them I had done some works like educating street children and used to make the street people aware  of their health issues especially the women. I was a part of a program where we tried to make understand the parents about the importance of education on them who were poor and lived a hard life. They usually didn\'t educate the children because they thought it unnecessary.',NULL,'768, Ibrahimpur bazar road, kafrul, Dhaka-1206',NULL,690,NULL,'Bangladesh','11',10,9,'01851152660','70','2002-10-31','shafinrahman01@gmail.com','https://www.facebook.com/shafinrahman01','1','1','1','01711909792','shafiq_rahman08@yahoo.com','Md. Shafiqur Rahman',NULL,NULL,'retired government officer',NULL,'1',NULL,NULL,'Rahman',NULL,'01752477090','nakter045@gmail.com','Nasrin Akter',NULL,NULL,'unemployed',70,70,NULL,NULL,'1206','1',NULL,'Mirpur-14','Shaheed Police Smrity College','2019-11-27 06:43:18','9012125','male',NULL,'Kafrul','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/690/marksheet_previous/apb9IjYiBFuGvUuK30zrv2ElanShNdv3FgZOcRK0.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/690/marksheet_previous_two/VjYAAUuTXT7lyuMBzh5B0G257KUP37UM6yjk5r3d.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/690/marksheet_current/RRLTPwAcLklBC9yj2e18meHNuOTg7Bt9Hgyg6xc7.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:26:51',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'5953820734',600000,2,'1903775912',-1,'Dhaka, Dhaka',1206,'Kafrul','Md. Mahmudul Hasan','0171870032',NULL,1,NULL,1,NULL,'I want to go abroad because I cherished a dream to flourish my mental faculty and this is the best chance to be acquainted. This will also help me to study abroad.','I want to share everything of our culture like language, cuisine, religion etc. with my American family and wish to have the same from them.\r\n\r\nFor sharing these, I need to learn the communication system first and then have the liberal mentality to share. I need to have patience to make them understand what I really want to mean. I will keep patience and have trying mentality.',1,'My High School/Teacher',NULL,2,'2019-11-19','2019-11-18',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/690/school_seal/1DClxO1L8jdynFs8drj4fqEY1xUWY090MOl6GOU4.jpeg'),
	(122,'Samrat Nur A',1,0,NULL,'Dhaka, Dhaka',NULL,19,'Community service is one of those things that I have always taken an initiative towards.I have always stepped forward to do any kind of community service.Even though I have never got a opportunity to do something big for my community but I have always did something at an individual level.For example, not throwing garbage on the street, giving away my old warm clothes to poor people during winter, giving homeless people food etc.\r\nIf I get the opportunity to bring a specific positive change in our community that will be for the welfare of our environment and our nature. Environmental pollution and climate change has been an serious issue in this 21st century. And as an environment lover this has been really upsetting for me. I wish to ran various campaign around the world to spread awareness about the climate change and what we all can do at an individual level to save our planet.I will stop deforestation and plant more trees and spread awareness about how our species are going extinct.',NULL,'70/1 Kalabagan 2nd Lane',NULL,715,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/715/certification/v5VDl5mwzTt7dYlbYha5Ds7QImvYjUgGLVKds6QN.jpeg','Bangladesh','10',9,8,'01795705465','70','2002-03-10','jesannur555@gmail.com',NULL,'1','1','1','01973332211',NULL,'Md. Anisuzzaman',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Zaman',NULL,'01730954263',NULL,'Mr. Farzana',NULL,NULL,'Housewife',65,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/715/student_photo/lkQ9tPDqjzdm8yBrXdFQO3RS814Nn0k3c6Sf2sH3.jpeg',NULL,'1205','1',NULL,'House # 62(New), Road # 2/A (New), Dhanmondi, R/A, Dhaka 1209 Dhaka, Bangladesh 1209','Wordbridge School','2019-11-27 06:43:18','01786-300100','male',NULL,'Dhanmondi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/715/marksheet_previous/koWGcnaQhthzLQeh5SNfxIc36WLedjWqfRGeEJD0.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/715/marksheet_previous_two/TKYXdg7NtyD1txKYmRWQyt2x7vMKzmJ7BuAY0DaC.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/715/marksheet_current/uYTgdRPmcdSFsgdp77ywWao2fY4yrUvruLhUMGSg.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:27:41',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'5067786300',1200000,2,'7317811235',-1,'Dhaka, Dhaka',1209,'Dhanmondi','Ruhi Zaman','01786-300100',NULL,1,NULL,1,NULL,'I am a type of person who loves travelling, exploring new places, meeting new faces, making new friends and embracing new cultures. And YES program will actually give me this opportunity to follow up my this passion.This program is going to help me learn more about the different American culture and will give me this opportunity to share my beautiful tradition and culture of Bangladesh.And most importantly the experience that I am going to get and the memories that I am going to make will be my biggest takeaway from this YES program.','I wish to share about the different types of Bangladeshi festivals that are widely celebrated in Bangladesh. For example the Eid ul-Fitr, Eid ul-Adhha, Pohela Boishakh and many more. Pohela Boishakh is one of my most favorite once. It is the first day of the Bengali calendar and it is celebrated with a lot of pride and respect towards our culture. On this day everyone embraces the culture. They start it off by eating the traditional Bengali meal called the \"Panta Ilish\". If I get this opportunity I will surely make this meal for my American family and I believe they are going to be really impressed.\r\nI wish to share about the different types of clothes that we wear which are way different than those wore in United States.For example a casual bottom wear for men in US would a short or a trouser but here in Bangladesh it is a Lungi. I would love to share about the religion in Bangladesh.As a follower of Islam I would love to share the history of our religion and how we follow it.',1,'A Friend',NULL,2,'2019-10-23','2019-10-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/715/school_seal/9dz8BXZgb5os33sxz0vbJE05usjDTfyG50rJUtvv.jpeg'),
	(123,'Md Jaber',1,0,NULL,'Sylhet, Sylhet',NULL,19,'As I know this community service is very important part of this program.I would like to share some of my work for my community.\r\n1.volunteer: Basically I am a student but I love to help people who are unable to send their child to the school.I fixed a time for them to teach how to learn and write.From my side I feel good to teach them for free.\r\nI also help the elderly people who cannot do their house work, shopping,shovel the driveway etc.\r\nAnd donating is my hobby,I donate blood in every 3months or after for free.\r\nAll I can say is ,If i have the opportunity I can do my best to give a positive change from my experience.',NULL,'Khoraria,Birahimpur',NULL,735,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/735/certification/OM8X0WFuUEUQKxBvqvvG7jfFMbSVxsu3RI0EoDLh.jpeg','Bangladesh','12',12,11,'+8801961009040','70','2000-10-19','md.jaberahmed00@gmail.com',NULL,'1','1','1','+8801976878540',NULL,'MD Kholil Miah',NULL,NULL,'Farmer',NULL,'1',NULL,NULL,'Ahmed',NULL,'+8801766878540',NULL,'Mst Hasna Begum',NULL,NULL,'Housewife',70,65,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/735/student_photo/iZdAPaQ14cANPkZj6HDmi4Qu0Y89no03GRRJauyM.jpeg',NULL,'3106','1',NULL,'Technical Road','Sylhet Polytechnic Institute','2019-11-27 06:43:18','0821-716372','male',NULL,'Muglabazar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/735/marksheet_previous/7H5mty3AgPkjaw1xRJZTzivRLsREBW3bINT6tRfR.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/735/marksheet_previous_two/QEvkBIvlfz03o0C3VeT0wRBkN62l4jtYjasgnLud.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/735/marksheet_current/UAFfK3w08i72o6cyX3v8dHGeg7Fw0cWTGpYPcbvT.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:28:01',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Sylhet',2,'19559113175111336',120000,2,'9113175335026',-1,'Sylhet, Sylhet',3100,'Dakshin surma','Dr. Engr. Md. Abdullah','01746494392',NULL,1,NULL,1,NULL,'Youth Exchange Study Program\r\n\r\nWell I would love to do this program other than any other program.Because,\r\n1. The program is crucial for expanding communication between the people of the United State and Bangladesh to promote mutual understanding and respect.\r\n2. By doing this program I can learn about American society and values leadership skills and help educate Americans about my Bangladeshi culture.\r\n3. The program support student to encourage their participation.\r\n\r\nBut on the other hand improving English language is also important,but I can do it anytime, anywhere even in Bangladesh.','I would like to share with my American family about Bangladeshi culture like festivals, religion, clothing and sports.\r\nBasically in Bangladesh we celebrate some festivals.The culture of Bangladesh incorporates festivals and celebration this events includes Eid-Ul-Adha,Eid-Ul-Fitre as well as Janmashtami and Durga Puja.\r\nThe most  widespread religion in Bangladesh is Islam, which constitutes 87-90% of the citizen of the nation.\r\nWe Bengali people love to ware traditional clothes like Panjabi, Pajama and lungi as well as Sari.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-04','2019-11-04',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/735/school_seal/0QQqABadQ12NF3ceciRGDpZn1RAmT671PcPxNHER.jpeg'),
