	(125,'Mst. Sumaiya Arafin',2,0,NULL,'Kishoreganj, Dhaka',NULL,19,'If I have got an opportunity to serve the social community service, yet I shall remove superstition and I shall work to eradicate illiteracy among of us realize discrimination.',NULL,'Tomaltola, Ishakha Road, Kishoreganj',NULL,748,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/748/certification/tGL0LyWbaP46g4mKADTFcd43rvnPSHPV9W2eqW6u.jpeg','Bangladesh','10',9,8,'01739153111','4','2004-08-20','afsumaiya898@gmail.com',NULL,'1','1','1','01712959275',NULL,'Md. Anwar Hossain',NULL,NULL,'Branch Manager, Brac NGO',NULL,'1',NULL,NULL,'Akhi',NULL,'01786239990',NULL,'Mst. Shirin',NULL,NULL,'Housewife',4,5,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/748/student_photo/yDR9SSdg3LH2pRObKifc0xPGKK88TRLx6OjzHBWN.jpeg',NULL,'2300','2','Newyork, Michigan','Akhrabazar, Kishoreganj','Kishoreganj Girls\' High School','2019-11-27 06:43:18','094162298','female',NULL,'Kishoreganj','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/748/marksheet_previous/CdpCdOuGbrWb0291GHsnYrvyxo4GweeBe6vFdvov.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/748/marksheet_previous_two/QajRMA4xEThQfJg0ozVT7fJoFiz6pa0W2kX8S4YU.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/748/marksheet_current/QaD7Rt6TLdVHiBDes6YRUjBx2me2iquBI22xyS2M.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:31:14',NULL,1,2,NULL,'I have vision disability',NULL,NULL,NULL,'Kishoreganj',2,'4819294810630',504000,2,'4819213712684',-1,'Kishoreganj, Dhaka',2300,'Kishoreganj','Lutfunnahar','01621422009',NULL,1,NULL,1,NULL,'I want to participate on YES program to develop my skill, even want to become a good citizen, want to remove limitation of our society and want to contribute ICT through the helping of YES program.','I want to share language, cuisine and clothing as Bangladeshi culture with American family. It may be happend through social network or the function may be celebrate to share personal culture where I Shall share about our cultural culture as a Bangladeshi',1,'Newspaper',NULL,2,'2019-10-22','2019-10-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/748/school_seal/AoyKThjTtSCsXfooMGCV8Lb8mctFDYgWMuuJHMOX.jpeg'),
	(126,'Kanij',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Community service can have a lot of positive effects on us, such as helping us to develop skills, making contacts and allowing us to improve the quality of life of others. My role as a social volunteer can also give me a sense of pride and identity.\r\n\r\nBy taking part in cleaning up trash and debris, planting trees, serving food to those in need, bringing awareness about drug effects recycling program, donating blood etc. I hope I will bring a specific positive change in our community through community service.',NULL,'Nobodoy Housing, Road No- 6/A, House No- 10/9, 3rd Floor- 3B',NULL,749,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/749/certification/fqSN68cbOxxUJlUio3yyys3ExxjzImcolcvlqiey.jpeg','Bangladesh','11',10,9,'01884495771','80','2003-12-24','rifasanjitalamia@gmail.com',NULL,'1','1','1','+8801884495771','aw248478@gmail.com','Abdul Wahab Talukdar',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Fatema',NULL,'+8801717673503',NULL,'Zannatul Ferdous',NULL,NULL,'Unemployed',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/749/student_photo/QFYuJrPEpaUGbG9Y9AcDgcFZSNERgzlTJlZ9sBS1.jpeg',NULL,'1207','1',NULL,'Mirpur- 14, Dhaka','Shaheed Police Smrity College','2019-11-27 06:43:18','+88029012125','female',NULL,'Adabar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/749/marksheet_previous/n7gdOVTy6fXixT3YIhF0S9V3syxez9A8gbaaTfdC.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/749/marksheet_previous_two/0p5QAsPJqP7Qaoul9DtnzJ0lncsYZjGsNlsBXqHT.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/749/marksheet_current/HSsNKdRGr20PRCHdiRFExC7diXEJCnCgLEKMPKSg.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:33:05',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Sirajganj',2,'5967424788',150000,2,'8827803115401',-1,'Dhaka, Dhaka',1206,'Kafrul','Mahmudul Hassan','+8801718700732',NULL,1,NULL,1,NULL,'The K-L YES program is a high school exchange program. By participating in this program, I am expected to become active member of my local communities by attending in extra curricular activities and volunteer projects. It will also develop my leadership skills. That\'s why I want to apply for the YES program.','The culture of Bangladesh incorporates festivals and celebrations. Bengali is the national language of Bangladesh. The major religion in Bangladesh is Islam but a significant percentage of the population adheres to Hinduism. Our cuisine is rich and varied with the use of many spices. Rice, fish curry and lentil is the most common traditional Bangladeshi food. Bangladeshi women habitually wear Sarees and males wear Panjabies and Pajamas.\r\n\r\nBy sharing my experiences and exchanging of Bangladeshi culture, I hope it will inspire so much of American family a lot.',1,'Facebook',NULL,2,'2019-11-05','2019-11-05',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/749/school_seal/kIW128Bh26Y05bGdwut8btJrbgDd5jguGQBCxaZb.jpeg'),
	(127,'MD. Tanvir',2,0,NULL,'Bogura, Rajshahi',NULL,19,'Well, I will rather share my experience instead.I am privileged that I have been a proud member of Red Crescent while studying in class 8 in Bogra\r\nZilla School.Fortunately, I had opportunities to serve and assist helpless and wounded people in many accidental situations.For instance, I helped out\r\nthe people of flood affected areas as a RCYS member.However, I participated the Pundra International Model United Nations Conference at Momo\r\nInn Hotel & Resort in Bogura as a campus ambassador of Bogra Zilla School where other people of various countries participated as well.I was so\r\nmuch privileged there to have some opportunities to discuss and sort out some of international issues under UNDP.Participation of all creative people\r\nfrom different countries made the conference influenced for sharing knowledge and experience.Eventually, I will definitely say that becoming a RCYS\r\nmember did open doors for me to satisfy my heart by serving and assisting other helpless human being.',NULL,'Naruli Dakkhin Para, Bogura Sadar, Bogura',NULL,751,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/751/certification/Rcg41PqF6iGBAIptOvmGiHtoHewbYz97mks586Yd.jpeg','Bangladeshi','10',9,8,'+8801627025827','70','2004-11-30','tanvir336@yahoo.com','https://www.facebook.com/hasan.tanmoy.3','1','1','1','+8801761607268',NULL,'MD. Emdadul Haque',NULL,NULL,'Qatar Expatriates',NULL,'1',NULL,NULL,'Hasan',NULL,'+8801732175201',NULL,'MST. Taslima Haque',NULL,NULL,'Housewife',71,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/751/student_photo/QDBs2tuterDWmqoL5S1zGwzUmivQcyObWOKT0ZxN.jpeg',NULL,'5800','1',NULL,'Sathmatha, Nawabbari Road','Bogra Zilla School','2019-11-27 06:43:18','+8805165127','male',NULL,'Bogura Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/751/marksheet_previous/Ak0a5xlSsiQ7mBH5FobbbVzsGA0S1ou4skSwits6.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/751/marksheet_previous_two/r7zBgSFjbHEzTzdLR3pqBkh0nFegYWB8GGWGABoK.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/751/marksheet_current/LXcAhKlsV7wHL4i9P6ZUL7mrHxl4Wvpkq63UkPLS.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:34:42',NULL,1,1,NULL,NULL,'EA 0080223','2024-03-09','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/751/student_passport/RGTlvVdzQfc7mrvwHeRzWp3EAW6WVoQ2l8Dauq3V.jpeg','Bogura',2,'19771022020000024',360000,2,'1018131007537',-1,'Bogura, Rajshahi',5800,'Bogura Sadar','MD. Mostaque Habib','+8801711972279',NULL,1,NULL,1,NULL,'I\'m so much excited to apply for the YES program to uphold the culture of my beloved country. As an ambassador from Bangladesh, I would like to\r\nshow the aspect of our culture. Furthermore, I can share the histories and talk about developments, touristic places and cuisines etc. However, It\'ll\r\nbe a great pleasure for me to represent and uphold the culture of beloved Bangladesh.','Bangladesh achieved its independence in 1971 against Pakistan. Before our independence, we tought for our mother tongue against the occupied Pakistani Rulers. We are the only nation in the history of the world that has fought for its mother tongue and sacrificed lives. Because of our sacrifice, the UN has given the recognition as the 4th international language. Moreover, UN has declared 21st February as the International Mother Language Day. Besides these, Ill talk about the special food of Bangladesh which is cakes. In Bengali, we call it Pitha. I can also share the ideas how to make cakes. Men wear traditional dress called Lungi and Panjabi. The women wear traditional dress called Shari. We are peaceful people with various religion. They are Muslim, Hindu, Buddism,Christian.',1,'My High School/Teacher',NULL,2,'2019-10-26','2019-10-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/751/school_seal/ir1IldverpBf1Hp6zVMKoYfP9kob9TO9jU2dOETl.jpeg'),
	(128,'Nicholas Shanto',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I am a member of a nonprofit organization (NGO) named  Durnibar Foundation.  I participated in the Hunger Action 2019, a very popular event held by this organization. This program is dedicated in reducing our country poverty and malnutrition. We gather donations from the public and organizations which we use to buy food in bulk, for the poor who can not afford their daily meals, especially orphan children.\r\nThe experience was quite difficult yet very fulfilling. I along with my team had to work hard all day long, convincing people about our motives and agenda. I hope I can continue this type of projects and help develop my society.',NULL,'House# 104/2, Monipuripara, Tejgoan, Dhaka.',NULL,756,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/756/certification/kS60wl9O4tOfs9852UFRBzciOXAZs0XwEuLdsRvx.jpeg','Bangladesh','10',9,8,'01643567687','78','2003-11-24','nicholasgomes801@gmail.com',NULL,'1','1','1','01755569730','dominic.enterprise20@gmail.com','John Ricky Gomes',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Gomes',NULL,'01572498531',NULL,'Merelin Gomes',NULL,NULL,'Housewife',83,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/756/student_photo/7QfNuG37u412Szdn1BoyNSluejcQog5YIN74MVmR.jpeg',NULL,'1215','1',NULL,'House# 04, Road# 28 (Old) 15 (New)','British Columbia School','2019-11-27 06:43:18','01680465853','male',NULL,'Tejgoan','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/756/marksheet_previous/G7k7g7V1Wphpb3JE1eVDalMf5uTTnv7ue1ejgBxi.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/756/marksheet_previous_two/wVLk4mKlze4gOXbIun2uEwiZW8hESsA8gcyVygth.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/756/marksheet_current/ODuYmJrPUxMAdHEZUVUB88MDJVYFKeCHriYxsQoF.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:36:22',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'2699040685641',1000000,2,'2699040685640',-1,'Dhaka, Dhaka',1209,'Dhanmondi','Farjana Ahmed','01680465853',NULL,1,NULL,1,NULL,'The KL-YES program will enhance my opportunities to proceed in future. By studying in the United States  I can make the first step towards a successful international career. Firstly, I love the American lifestyle and their people. Staying with my host family, I will get the chance to experience the most interesting cultures.  I will be able to make friend from all corners of the world. US is a top choice for most international students, we should expect meeting people from all corners of the world in a daily basis.\r\nBeing aware of the fact that US high schools have a good reputation and are well-known for the quality of their education. Moreover, studying abroad is always an interesting experience. I will not only grow professionally but personally as well.','I want to introduce my Bangladesh cuisine . Having a mother who is expert in cooking , I have a first hand taste and knowledge when it comes to Bangladeshs cuisine.  First , when you think about Bangladeshs cuisine, the first thing that comes up to our mind is rice and fish along with multiple side dishes known as Bhortas .  It might sound plain but once when you have tasted it, you will get to know why it is so popular. There is a very popular scenario when Bengalis visit a foreign country, they tend to miss and crave for their domestic delicacies so much that they get really homesick, such is the power of Bengali dishes.       \r\nAs previously mentioned, I come from a gastronomical  background. I would like to share my experience with my host family by cooking exclusive traditional Bengali dishes and some of my secret family recipes. Without any doubt, I can state that this will be an enriching experience for all of us.',1,'A Friend',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/756/school_seal/sAwzCeFR8sa1nefNS9WEgGSUN3cewT5auDTsPcj1.jpeg'),
	(129,'Sunehri Sahel',2,0,NULL,'Chattogram, Chattogram',NULL,19,'Mental disorders significantly affect the youths of Bangladesh. If I have the opportunity, I would focus on this topic. Because of the societal stigma around depression/ mental disorders, teenagers often hold themselves back from seeking help or even talking about it. In Bangladesh, there is lack of peer support groups that meet for better mental health and support. Through support groups, I want to work towards addressing the stigma around mental disorders and bring necessary help for people who need it. The environment in Bangladeshi hospitals, especially the pediatric wards are dull and do not contribute to the mental recovery or post-traumatic stress of the children.  I would like to initiate activities like painting the walls of the pediatric wards; have toys and child friendly items available to bring a more colorful change to their environment. Then will form a group of high school volunteers who will commit to spend some time with these children for their speedy recovery.',NULL,'4,Zakir Hossain Road,Khulshi South Apartment,Flat #:5A,South Khulshi,Chaottogram',NULL,758,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/758/certification/ynOorE6kfxP26RTX8jbtegpJ7kHjG9Mo59Bfm3Cw.jpeg','Bangladesh','9',8,7,'01844462977','96','2003-08-07','sunehri.shamam@gmail.com','https://www.facebook.com/sunehrisahell','1','1','1','+8801819026165','mrashidsm@gmail.com','Md. Mamunur Rashid',NULL,NULL,'Marine Engineer',NULL,'1',NULL,NULL,'Shamam',NULL,'+8801815434437','simasm.banu@gmail.com','Zubeda Banu Sima',NULL,NULL,'Unemployed',97,99,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/758/student_photo/AwKqSWYRTGlDk6ZDnL36QToEM8uOcbUn9Z6YQMW3.jpeg',NULL,'4202','1',NULL,'1986/A Zakir Hossain By-Lane, East Nasirabad, Chittagong 4000, Bangladesh.','William Carey Academy','2019-11-27 06:43:18','+880-31-652034, +880-31-657585','female',NULL,'Khulshi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/758/marksheet_previous/nTswabsnBXX10pZJBxCLaghrjDpyJcm3qXOqYJRh.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/758/marksheet_previous_two/npYRXHzntxXviPDHJf659xNIyjrUKK5zqVVBipk4.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/758/marksheet_current/hDvqlmagCStf59G3JokewufM8CHJl7MhdAKY7K6S.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:38:20',NULL,1,1,NULL,NULL,'BP0192625','2022-05-14','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/758/student_passport/LK9hDI63Oe1en9EnrLgBCTgUeVgSJL1ExZQMBb39.jpeg','Chittagong',2,'19621594313000013',36000,2,'238 009 3530',-1,'Chattogram, Chattogram',4000,'Khulshi','Mr. Paul Beatty','+88017 3035 9075',NULL,2,'Nepal for summer vacation. Malaysia for summer vacation.',1,NULL,'There are multiple reasons motivating me to apply to this program. First of all, this is an opportunity that will allow me to explore the culture of United States of America (USA) and to represent the rich culture of Bangladesh in an international platform. In addition, as this program will gather students from different countries, I will also be able to learn about those countries and cultures from my peers. Secondly, as this will be my first time visiting a developed country, it will provide me with the chance to experience the quality of life over there and to learn about a different lifestyle, sports alongside exploring a new education system. Lastly, if I become a YES scholar, I would like to share my experiences with the interested future applicants and help them catch a glimpse of this highly interesting program.','I would utilize the opportunity to share the popular Bangladeshi dishes through showing pictures and discussions with my host family. We have different dishes devoured during festivals such as Pohela Boishak and Eid. So, besides sharing about food, I would introduce these festivals to them as well. If provided with the chance, I would cook a few dishes for them so that they can enjoy the Bangladeshi cuisine. \r\n\r\nIf they are open to accepting gifts, I would be happy to take traditional attires like salwar kameez or saree, panjabi or lungi wear them all together on a day of festival.\r\n\r\nDance and music are an integral part of Bangladeshs rich culture. I wish to share videos of different genres of dances with my host family. The Bangladeshi musical history is continuing to play a major role in peoples lives. Additionally, Bangladesh has plethora of literature pieces and artists. I would not miss the opportunity to share about literature and music.',1,'My Family Member',NULL,2,'2019-11-18','2019-11-17',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/758/school_seal/ZUSM7GPdhwf4YxTGCi6SQ7EjlVmQShXfVEJECYzr.jpeg'),
