c. Pahela Baishakh is the first day of Baishakh. The first month of bangle year, on this day in keeping with the age-old traditional traders and shopkeepers open halkhata, that is tress account books and offer sweets to their clients, young and old boy\'s and girl\'s, men and women wearing traditional dresses. Victory Day- 16th December is observed as the \'\'Victory Day\" in Bangladesh. We achieved independence from the Pakistani rule. Bangabandhu Sheikh-Mujibur Rahman was The leader of our liberation war.','I will share about my language with my American family. I am Bangladeshi My Language is Bangla 21 February, The International Mother Language day is a glorious chapter in the history of our national life, on the 21 February In 1952 the police fired on a demonstration which demanded bangla as one of the state languages of Pakistan. A number of mother language loving sons namely Rafiq, Abul Barkat and Salam laid down their lives and established their lives and established Bangla to it\'s rightful place,In November 21, February , 1999 The UNESCO Declared 21 February as The International Mother Language Day\"',1,'Newspaper',NULL,2,'2019-11-12','2019-11-12',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/767/school_seal/20SJ5unLjhKAy1HU4o7e3Y5Ee1NVUDCkZVdiPHbb.jpeg'),
