	(136,'Tasin',2,0,NULL,'Barishal, Barishal',NULL,19,'Few weeks ago,some of my friends and I arranged a meal for the stray animals.We raised fund and donated our money for this.We cooked food for them.We also fostered the animals living on the streets.I was the foster dad.I gave foster home to them.I fostered three cats.I raised them up and put them on adoption.We arranged a seminar and encouraged people to adopt animals.We discouraged them to buy animals.Because the stray dogs and cats can be the best companion for people.They are loveable.I want a society without hungry and ill treated animals.Thus the society will become liveable for all.We try to do it thrice a month.',NULL,'6-A,Rafiq Palace,Masjid gate,Bm college road, Barishal',NULL,776,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/776/certification/NDcvXAbSV2o2QA2HM0qcQof5jzb0sMOGFzdlMK8e.jpeg','Bangladesh','10',9,8,'01734015985','81','2004-11-14','shpurbaa@gmail.com',NULL,'1','1','1','+8801712740525','hmsagar000@gmail.com','Hasan Mahmud',NULL,NULL,'Project Manager of a Private farm',NULL,'1',NULL,NULL,'Hasan',NULL,'01734015985','shpurbaa@gmail.com','Nazmin Nahar',NULL,NULL,'Unemployed',84,87,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/776/student_photo/LFHf9cot0ladMtsgnRgy9YIenTMrBHLRiNk971Nm.jpeg',NULL,'8200','1',NULL,'Sadar Road,Barishal-8200,Bangladesh.','Barishal Zilla School','2019-11-27 06:43:18','+88043164417','male',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/776/marksheet_previous/lCnqDlvWwoqG5Rt3aUn5EMC8iyMCqxM7s6aWXWEd.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/776/marksheet_previous_two/qxKpfW1I3BmO8XMAmG1WCuPssLVS8ZCSChHqpWwb.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/776/marksheet_current/wFK76nwgCZ2w4WtZeBA6JV2ImCNjvsvjyfQjUVLH.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29