l harmony.The cultures of Bangladesh are composite over the centuries have bengali languages literature; philosophy religion; festivals celebrations; as well as in a city homes in the villages to share the joy of the festival with friends and relatives.',1,'My High School/Teacher',NULL,2,'2019-10-23','2019-10-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/797/school_seal/XGZVukgphkeTTgUUuvx78KANDMHF1BntmwmJ2Sfq.jpeg'),
