	(140,'Fariha Salwa',2,0,NULL,'Rangpur, Rangpur',NULL,19,'No matter in what community I will stay, I will always be active in bringing positive change through community service if I have the opportunity. In this case, working in a library would really be an enjoyable task for me since I love to surround with books and communicate with people of all ages. I will welcome the children, new comers and readers who come to read books, give necessary  guidelines and offer help. I can manage to decorate books and keep records. Thus, i will bring a positive change by inspiring people to read books and offer them a healthy environment. \r\n\r\nI will join various social clubs like volunteerism, arts and culture. I will involve in club activities which will enhance my performance as well as help other members to nourish their intellectual growth. I will take part in sports, music, drawing and arts, martial arts etc. and teach the youngers and mates to do better, which will definitely be a positive impact.',NULL,'Masterpara Islampur, Honumantola, Kotwali, Rangpur',NULL,804,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/804/certification/eGEoG6aot5JQA1ouOgeJo1SPjjIE26pYlzNo00nN.jpeg','Bangladesh','11',10,9,'+8801925339144','80','2004-09-27','fariha.bushra.27@gmail.com',NULL,'1','1','1','+8801718933924','abdussalam1172@gmail.com','Dr. Abu Saleh Md. Abdus Salam',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Bushra',NULL,'+8801725023256','fatema.begum.2511976@gmail.com','Most. Fatema Begum',NULL,NULL,'Teacher',78,68,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/804/student_photo/YQTmt7sI2AKo4MLuN5QrhIu57Gb3fR0lnmPEU25x.jpeg',NULL,'5400','1','NA','R.K. Road, Rangpur Cantonment, Rangpur','The Millennium Stars School & College, Rangpur Cantonment, Rangpur','2019-11-27 06:43:18','0521-64220','female',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/804/marksheet_previous/XLlFE8HtXTNK8134rElczMQS3B3mCYiO9s3clsRL.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/804/marksheet_previous_two/cWweiG0iDPWuiXGmBzwE5GjIOKsLJnWFRdnnPcEB.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/804/marksheet_current/cF3VDej1y12NX7Tr0qchljZmzcKwjQ9tWJJUI0BF.jpeg',NULL,1,'0','NA',NULL,NULL,'2019-11-29 19:54:18',NULL,1,1,'NA','NA',NULL,NULL,NULL,'Masterpara Islampur, Rangpur',2,'1014205924',600000,2,'6878402814',360000,'Rangpur, Rangpur',5400,'Kotwali','Lt Col Syed Nazmur Rahman','+8801769663174','NA',1,'NA',1,'NA','Getting acquainted with people of various lifestyles, cultures and ideologies is the dream I\'ve been carrying since childhood. To me, life is never a fulfilling one if you just read the one page of it repeatedly. And to move to the other pages, one must be broaden enough to look at the world with widen eyes, to feel the ecstasy of variance among people, to bear the tendency to learn from, tolerate and respect every culture and tradition.  The American tradition of community service has highly attracted me . Besides, knowing about the humility, cooperative attitude of American men and women, I feel a great interest in them. Staying with an American family, studying in an American high school, mixing with a lot of friends there, participating in various activities with my labour and intelligence- are my deepest cherishments. I\'ve found that this program could help me to reach my dreams and  put a mark of leadership and intelligence to their great approach which encouraged me to apply.','Language is a preferable aspect of Bangladeshi culture which I would like to share with my American family. Bangla language is related to the significant history of language movement in 21 February, 1952 which is observed as International Mother Language Day. This day not only reminds us of our deep passion to our mother tongue but also teaches us to be respectful to all languages and cultures. I will talk to my family members about these and also my history. Besides, I will teach them the basic Bangla words to speak and write. I hope they will be entertained learning a new language.\r\n\r\nAnother prominent Bangladeshi culture is religion which I wish to share with \r\nmy American family. This is more about sharing ideas rather than any concrete religious views. I would like to share about the religious viewpoints and ideology which would enable my American family to know more about other religious rituals, festivals, prayers, divine books, life codes or conducts etc. and observe theirs too.',1,'A YES Alumni Member','NA',2,'2019-10-23','2019-10-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/804/school_seal/tv8GwoBTWKBs6Y2hOfs1gPx8XdYICRapslIlyLYR.jpeg'),
	(141,'Mahpara',1,0,NULL,'Noakhali, Chattogram',NULL,19,'I personally involve with school base some social service and If I had an opportunity to do connect with any organization or community to do social service then I\'ll try to do my best effort to serve society.',NULL,'West Side of Barlington Mor, Guptanko, Ward # 05',NULL,806,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/806/certification/NI6CkxAkF90z6EVuL0K5uK010emLaqLbVoPONtck.jpeg','Bangladesh','9',8,7,'+8801872726195','73','2005-09-19','infodreamlinkbd@gmail.com',NULL,'1','1','1','+8801887513130','infodreamlinkbd@gmail.com','Masud Parvez',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Parvez',NULL,'+8801872726195','infodreamlinkbd@gmail.com','Inur Nahar Begum',NULL,NULL,'Teacher',75,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/806/student_photo/TQVjD6bG889DnGA8s8o621nfyUa9TIzFOm6ys7tA.jpeg',NULL,'3800','1',NULL,'Notun Bus Stand, Jail Road, Maijdee','Mosharef Grammar School','2019-11-27 06:43:18','+88032161369','female',NULL,'Sudharam','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/806/marksheet_previous/gVcAi8SFnFXTkKw6vLqZql4FE3iiIcxuXd8zpchA.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/806/marksheet_previous_two/YToCDN36jKTeXi2wIbvR8LV0WXSdQBjZCUjzh18n.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/806/marksheet_current/SYplrp2d5ieul7g83dmnIltzWvLbOPc5QPPf3QEw.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:54:50',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Noakhali',2,'7528701102775',360000,2,'7528701102776',144000,'Noakhali, Chattogram',3800,'Sudharam','Mosharef Hossain','+88032161369',NULL,1,NULL,1,NULL,'I think it will be an opportunity for me to engage with a new & different culture & community. It will be also give a chance to study in the worlds top class education system of USA, which will be great steps for my future education & carrier.','Bangladesh is land of river; Most of the people of Bangladesh speak in Bengali. Bengali is mother tongue. In the year of 1952 we gave blood for establishing Bengali as our mother language. There is lots of local language included so many tribe language.\r\nOur main food is Fish & Rice but there is a lots of food variety in all over the Bangladesh. We have different kinds of local foods item included Pitha (Cake), Payesh (Desert) etc.\r\n\r\nOur common dress for men is Lungi, Panjabi, Gamcha, Shirt but now almost every society people adopted Pent, Shirt, Blazer, T-Shirt etc from western country. Our urban women also wear Pent, Shirt, Blazer, T-Shirt but our rural & common women dress is Shari, Blawus, Shaloar, Kamiz etc. \r\nOur country is a secular religious country, where greater then 89% peoples are Muslim and other major percentage is Hindu, Christians, Buddhist & others. We live in country with social hermoneys.\r\nAnd there are a lot of different kinds of local & religious festivals.',1,'My Family Member',NULL,2,'2019-10-23','2019-10-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/806/school_seal/IMLGIoiJMQTD413wfxNBJ76ZMNlXKtrhQoEbYYt1.jpeg'),
	(142,'M.M. Tariqul Islam',2,0,NULL,'Dhaka, Dhaka',NULL,19,'If I have got the opportunities I would try to change our education system because this education system is not equivalent to the international system and students do not get the proper chance to show their creativity. This education system surely killing many talents by pressuring them. There is no space for sports and also no co-curricular activities in school (especially in Govt. Schools) as I also didn\'t get a proper chance to participate in fests like science fest, cultural fest, etc. If I got chance I would change this first so that student become pres',NULL,'9,Kazi Abdur Rouf Road,Luxmibazar',NULL,807,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/807/certification/I7Bh8fbHi0QG9EcZOBPwXY4Bc2owdI07J7ywHvT6.jpeg','Bangladesh','11',10,9,'+8801871195829','50','2003-09-18','tariqulislamsiam@gmail.com','https://www.facebook.com/siam1891','1','1','1','+8801552309826','mkmolla18@gmail.com','Md. Khurrom Molla',NULL,NULL,'Govt. Employee',NULL,'1',NULL,NULL,'Siam',NULL,'+8801715016250','faridabr18@gmail.com','Farida Begum',NULL,NULL,'Lecturer',75,60,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/807/student_photo/M5NPEXzz34cTHl7U6cyTGq6ncJQaqHQhbU7PgyOr.jpeg',NULL,'1100','1',NULL,'Rajarbag Policeline,Motijheel','Rajarbagh Police Lines School & College','2019-11-27 06:43:18','+8802-9338382','male',NULL,'Sutrapur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/807/marksheet_previous/Zqg7hPbDzdPgMGo5iLPcaVvtPAW4tUTMTjhZ13Gk.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/807/marksheet_previous_two/zWX3DrJeqeI0tcBu4Yi5dCAkShNWfQKn1DwrTA71.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/807/marksheet_current/YgRMpb9Uzmdvm1i7GwohL6ZQVeDAQf3xbyWtwdFR.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-12-01 05:23:45',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Narayanganj',2,'6710287483835',300000,2,'6710287483836',300000,'Dhaka, Dhaka',1217,'Motijheel','MD. Liakat Ali','+8802-9338382',NULL,1,NULL,1,NULL,'I want to apply for the YES program because I want to know about US culture and the education system of US. As I am Bengali we always heard since childhood about US culture, people, education system, etc. are the best system in the world. So, like other people, I also have a dream to be a part of this wonderful system. I want to adopt different kinds of skills from the people of the country. As the YES program has provided me this dream opportunity I wanted to grab it and that\'s why I want to apply for the YES program.','I can share Bangladeshi Culture in many ways with my American family like Bangladeshi music, Bangladeshi cinema, etc. But I would rather take Bangladeshi Music or Bangla literature to Introduce them Bangladeshi Culture. As there is a great history of Bangla music and I love music and also  I have also interest in music It would be easier for me to share Bangladeshi Culture. Bangla literature can also be interesting to introduce to them about Bengali culture. I am also a huge Bengali literature fan, It would be also easy for me to do.',1,'My Family Member',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/807/school_seal/DUuqNBF1QmXjEfwGOvQevK3DDBZBoyHN62oyjLeP.jpeg'),
