gh school leadership skill engage in activities to learn about u.s society and values and their home country and culture and I want  to services human being as well as development of Bangladeshi medical sector.','I want to share my culture with American host family which culture I have belong such  as  1.traditional food 2. Traditional puppet show 3. Traditional dress  4. Traditional musical instruments 5. Traditional beliefs and customs.\r\n I have individual language cloth food tradition and culture. I have pride tradition about Bengali language, folk song,   bhatiali, baul songit, murshidi and the most Lalon Shah, Hasan raja and rabindra sonjit, Nazrul Sonjit and I have also our cultural dress for both men and women lungi, sarry, which culture I want to share with American host family.',1,'Newspaper',NULL,2,'2019-10-29','2019-10-29',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/814/school_seal/sjEHggInYAcN65tav2uInRd2yZoVy5JKOYsv10z2.jpeg'),
	(145,'Md. Asif Hossain Khan',1,0,NULL,'Dhaka, Dhaka',NULL,19,'Man is a social animal. He cannot live alone. Society provides all comforts and necessities of life to man. Man has an obligation towards the society. Especially, it is the duty of the students to do social service to others. Students have no worries about earning their livelihood. They have strength and capacity. Eighty per cent of our population lives in villages. Students should go to the villages and serve the villagers during vacation. Villagers are illiterate, innocent and ignorant about their rights and responsibilities. Students can provide help to these people. They can also help people when there are earthquakes, famines or epidemics. Students should not waste their free time in watching movies or leading a dull life. They should do some kind of social service.',NULL,'10, East Nandipara, Road: 6/A, P.O: Bashabo, Dhaka.',NULL,815,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/815/certification/sI56fmKHNXcQ2PUwn2ywzF5LSkAkQbmnnyB2lprm.jpeg','Bangladesh','11',10,9,'+8801876607546','80','2002-11-02','hossainrk1@gmail.com',NULL,'1','1','1','+8801711065822','hossainrk1@gmail.com','Md. Anwar Hossain Khan',NULL,NULL,'Private Service',NULL,'1',NULL,NULL,'Asgar',NULL,'+8801935735759','hossainrk1@gmail.com','Rahana Parvin',NULL,NULL,'Housewife',75,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/815/student_photo/XVZwvp5nwsfZD4pF09f2IZQATgR09dpAEF7aVXej.jpeg',NULL,'1214','2','New York','560, Block-C, Khilgaon, Dhaka.','Khilgaon Govt. Colony Higher Secondary School','2019-11-27 06:43:18','+880255122686','male',NULL,'Sabujbagh','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/815/marksheet_previous/xvuI8bRjnVOVucHtkgpUvM1KzabcLoVrujw4KgY5.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/815/marksheet_previous_two/y8pYJvVjw9HItQczezk1YCu1KUjglWNdHNZAHqpk.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/815/marksheet_current/dTHIWv4mD10QL0idTyvXbJdNp3my73REdRawVkiM.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 19:59:45',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'2696829714623',240000,2,'2696829714624',-1,'Dhaka, Dhaka',1219,'Khilgaon','Md. Nasir Haider','+880255122686',NULL,1,NULL,1,NULL,'The program is funded by the U.S. Department of State, Bureau of Educational & Cultural Affairs (ECA) to provide scholarships for high school students from countries with significant Muslim populations to study for one academic year in the United States. YES students serve as youth ambassadors of their home country, promoting mutual understanding by forming lasting relationships with their host families and communities. Participants live with a host family, attend an American high school, acquire leadership skills, and engage in activities to learn about U.S. society and values; they also help educate Americans about their home country and culture.','The people of Bangladeshs way of life make up the culture of Bangladesh. The country has a diverse culture that has evolved over time with influences from diverse social groups. Bangladeshs primary religions, Islam, Buddhism, and Hinduism, have played a critical role in influencing the countrys culture. Development of the Bengali culture proliferated in the 19th century and part of the 20th century during the Bengal Renaissance, with renowned Bengali writers, scientists, filmmakers, musicians, artists, and researchers playing a critical role. This culture manifests in the nations dance, music, literature, architecture, and even clothing.',1,'Newspaper',NULL,2,'2019-11-05','2019-10-30',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/815/school_seal/LbH4q6uo9MSxzcUaVTt1ZlMs36CH6pvBRuaLVQzP.jpeg'),
	(146,'Uchingma',1,0,NULL,'Khagrachhari, Chattogram',NULL,19,'if I have the opportunity, I will bring a specific positive change in my community through encouraging people to involve in different humanitarian and social activities like teaching deprived students, participating in cleanliness and tree plantation, creating awareness about the importance of education etc. I will also encourage to take part in sports, literary and cultural activities to strengthen the student\'s academic and performances in different subjects.',NULL,'Pankhaiya para, 07 no. Ward, khagrachari sadar',NULL,829,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/829/certification/zz1JY3shgdzESq2Sfiirp97YGl8Z8SlZcEFc2Do9.jpeg','Bangladeshi','9',8,7,'+8801837844537','68','2004-09-07','chinglafrumarma@gmail.com',NULL,'1','1','1','+8801852189206','chinglafrumarma@gmail.com','Chailau marma',NULL,NULL,'BGB',NULL,'1',NULL,NULL,'Marma',NULL,'+8801837844537','chinglafrumarma@gmail.com','Arema marma',NULL,NULL,'Unemployed',77,68,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/829/student_photo/VaduMQ4uBpQedoClndscgOTznq4ugGFeQy56r1ii.jpeg',NULL,'4400','1',NULL,'Chengi square, khagrachari sadar','Khagrachari cantonment public school & college','2019-11-27 06:43:18','+88-0371-61526','female',NULL,'Khagrachari sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/829/marksheet_previous/mhVE6a2nNX6e9wALu5Mi3gFbH6RxhCCYSAEnSrob.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/829/marksheet_previous_two/USlbsgVbm0p8gweucdggiMigLH0ttWAauquwNyRj.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/829/marksheet_current/daaLchynku8tWZe3yhtBfZ2zAhWFhzv7RGfPrjr2.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:01:25',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Khagrachari',2,'7350964057',240000,2,'9150881671',-1,'Khagrachhari, Chattogram',4400,'Khagrachari sadar','Lt col Mohammad kamruzzaman pitu','+88-0371-61526',NULL,1,NULL,1,NULL,'I want to apply for the yes program because I want to explore new places, people, culture etc. moreover, I will learn to adapt to the way people live in the new environment. There I will learn a lot about festivals, events, socio-educational system. I also wish I could make the country a second home country.','if I go to America I will share with my host family about the language, food, clothing, religion of my culture.\r\nFollowing are the ways;\r\nThe official language of our country is Bangla. there are also a variety of indigenous people languages. I belong to the marma community and I will share them my own dialect called \"marma language\" and the community resides in the south-eastern part of the country. The staple food is fish-rice along with vegetables, fruits. we primarily depend on Jhum cultivation( Hill cultivation). in our community, women wear them(traditional attire) and men wear a t-shirt with a lungi. the religion we practise is Buddhism and celebrate a grand religious festival called \"Buddha Purnima\".',1,'My Family Member',NULL,2,'2019-11-21','2019-11-11',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/829/school_seal/N7ClmvyFBjcHoCmCcShD0aJQYiegeBZFn0CBvdW0.jpeg'),
	(147,'Samin Ibteda',1,0,NULL,'Dhaka, Dhaka',NULL,19,'A couple of months ago, during the start of the semester, I was made an executive of the Greenworld Earth Club. Being an executive, opened my eyes. I noticed that there were plastic bottles everywhere in the field, in the class and even in the canteen. Even I subconsciously did not dispose of these plastic bottles properly.\r\nI discussed the problem with my friends and after some time we found a solution. The solution had two parts- the first part included us to clean up the entire campus. The second part was the real challenge.\r\nThe second part involved me writing a letter to the principal seeking permission to use glass bottles at school. Whenever a student had to buy a cold drink, they had to deposit something (for example -their ID card), which will allow them to have a cold drink. Then they would have to return the bottle in exchange for their deposit.\r\nA problem might be very difficult but with some thought, proper planning, prioritization, teamwork any problem can be resolved.',NULL,'9/24, Iqbal Road, Mohmmadpur, Dhaka',NULL,838,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/838/certification/Pnqdn0w0bNkoAjzeGoN3Bwu6WVVYYM3lXGqbfAjF.jpeg','Bangladeshi','8',7,6,'+8801711386960','80','2005-09-14','methu77@gmail.com',NULL,'1','1','1','+8801711386960','methu77@gmail.com','Mohammed Shofiqul Islam',NULL,NULL,'Service Holder',NULL,'1',NULL,NULL,'Chowdhury',NULL,'+8801711076068','irfath76iva@gmail.com','Irfath Ara Iva',NULL,NULL,'Service Holder',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/838/student_photo/x3r3rJtcqPe9zsDb01KrTSksfE3ExiZOcCEOW4qI.jpeg',NULL,'1207','2','Florida','24,Asad Avenue, Dhaka-1207','Saint Francis Xavier\'s Greenherald International School','2019-11-27 06:43:18','02-9115200','male',NULL,'Mohammadpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/838/marksheet_previous/9Ku1hunpX7S6DVUBMRO0XccAyLaToExbWSrDMtnG.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/838/marksheet_previous_two/yZS63GmP8OKPpKgDd5jN9WEKoH4ufqwVxcBnQ7PX.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/838/marksheet_current/4M3EG2IHQ0ArzYkGp8JY4qzOqQJfWqcOkXhAiL2d.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:02:44',NULL,1,1,NULL,NULL,'EB0991031','2024-09-23','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/838/student_passport/4HbN07Wu1A2fBrWWUsOuTNfJNvwuadDKuo0YggbK.jpeg','Dhaka',2,'7759001808',900000,2,'28090071894',2500000,'Dhaka, Dhaka',1207,'Mohammadpur','Sr. Virginia Asha Gomes','02-9115200',NULL,2,'India for summer vacation , Thailand for summer vacation , India(again) for winter vacation',1,NULL,'I want to develop my leadership quality in the field of composite heritage (which heritage connects all the people). Different countries, societies, religions, people, ethnic groups belong to diversified heritage. I want to find and explore the most number of heritages. This will allow me to find the common part of all heritages which will connect the people of each community across the world. This will help to bring harmony and peace among society. In Bangladesh, above one-fifth of the population are youth. I want to lead the youth to develop their knowledge, skill, and attitude towards composite heritage. USA culture is very diverse. Going to the USA will enable me to learn about their diverse cultures, values, attitude, behavior, ideologies, and heritages.','Firstly, I would share my traditional food and cultural practice with the American family. Bangladeshis have some special and diverse cuisine on various religious occasions like Eid or Puja. When the time arrives for such occasions like Eid I will inform them about the special cuisine for that particular event. I will connect my family and the foster family through Skype and let them know about what we do at that particular event.\r\nSecondly, I will inform the family about our traditional clothes. Some of our traditional clothes are lungi, Panjabi, Traditional Sarees (like Manipuri, Jamdani), etc. I will often wear my traditional clothes so that the family gets our traditional clothing.\r\nLastly, I would like to share about the different religions. Our country has many religions such as Islam, Hinduism, Christianity, Buddhism, etc. Living in such a country has its perks. I know about the norms of these different religions. This will help me to adjust anywhere without offending anyone.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-17','2019-11-16',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/838/school_seal/hC3i4qgRWL0WXOeY9y8Hs0GGhEA7l1TCX8QYCuYq.jpeg'),
	(148,'Shaykot',2,0,NULL,'Sylhet, Sylhet',NULL,19,'In my life athletics bears a great significance. I have earned so many prizes in my school co-curricular activities.such as sprinting,high jump,long jump,football,cricket,handball etc. I have also earned prizes from the district and sub district level. I have organised a football event once with my friends. I have participated in many social organisation.such as workshop,working on a project with other etc...And now if i get a chance to bring a significant change in the society i would like to bring a change in the women rights. Weather the world is developing day by day but in somewhere girls are being treated like a slave and thought to be a burden to the society. So, i would like to bring a significant change in that subject. And i would like to spread the humanity religion rather than the hindu,muslim or buddhist! And i also would like to take a step against the early marraige..',NULL,'347/33,North bagbari,Akhra road,Sylhet',NULL,840,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/840/certification/P36J5Yj528iP6B4mcoW3iEiq2g44P3Xi34AKZi6n.jpeg','Bangladeshi','10',9,8,'01874670152','77','2004-02-26','shaykotpaul0880@gmail.com','Black020squash@gmail.com','1','1','1','01712177792','ashitpaul070@gmail.com','Ashit Kumar Paul',NULL,NULL,'Govt. Employee',NULL,'1',NULL,'Lucifer_shaykot','Paul',NULL,'01705713981','shikharanipaul1234@gmail.com','Shikha Rani Paul',NULL,NULL,'Housewife',78,95,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/840/student_photo/NYek9tyMPgZTnLABQHsjImSJuCzTUz9ATTf4PMzb.jpeg',NULL,'3100','1',NULL,'Mirer moydan,Subid bazar,Sylhet','Blue Bird school & college','2019-11-27 06:43:18','0821716615','male',NULL,'Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/840/marksheet_previous/Eajkxz8yhzJwUxIre8dcYdwtTca1QUe2YVpa2iE5.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/840/marksheet_previous_two/Mt45D3ZaoSama0bo28L2mQBxYsihNhv4EdrIP2Rr.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/840/marksheet_current/JswljZ2429qrRKGpET1R8C209PmbfL7rVNuj07hH.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-30 17:00:33',NULL,1,1,NULL,NULL,'EB0912604','2024-09-16','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/840/student_passport/SePdcH62jI9L39oYkinr3lTTHYNpV8Xacfg1B87j.jpeg','Sylhet',2,'2849669946',400000,2,'2849666736',-1,'Sylhet, Sylhet',3100,'Sadar','Mrs.Husne Ara','0821716615',NULL,2,'I had gone to india 2 years ago for visiting. Also for the medical treatment.',1,NULL,'Many people dreams to go to the U.S.A. But many remains behind for the lack of financial fund. I am one of them.I really want to go to the U.S.A. from my very childhood. Actually its like my dreams are coming through to me. I have an eagerness to know about the U.S.A. culture,their tradition,how they celebrate there festivals,how the people are,how the governance system goes thorugh there,how the education system they are having etc.YES programme is giving a chance to everybody on this regard and many people had been succeeded also. So,i also want to see my eagerness comes true. YES programme is that one kind of programme that will able to help me with that.For that purpose i want to apply for the YES programme.','In Bangladesh our main language is Bengali.People here use Bengali as there first language.We the people of Bangladesh had earned its mother tongue with a lot of bloodshed in the year 1952.At that time Bangladesh was known as the East-Pakistan.With a fight of around 5 years(1948-1952)Bangladesh had earned it mother tongue on 21 february,1952.The people of bangladesh are very fond of eating. People here eat Ilisha as the national fish.Beside that they also eat wallago attu,anabas,ghat etc fishes.Mango is our national fruit.people here use many spices to make the food more tasty.As meat people take beef,chicken,duck etc. People here also use to take many kinds of sweets.such as rosgulla,chomchom etc.People here wear pant,shirts,t-shirts.And as traditional dresses they wear payjama-punjabi,sari.Though bangladesh is a muslim country but in the parliament hindu,christian,Buddha all the religions have equal rights.',1,'My Family Member',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/840/school_seal/tpjjbeYjwtiQLqa4xiMspl94vOgSAbgzAeBJ7feB.jpeg');
