VALUES
	(149,'Raiyan Bin Reza',2,0,NULL,'Rangpur, Rangpur',NULL,19,'Community service is a work done by a person or group of people that benefits others. Attending community service program provide acquire life skills, knowledge, experience as well as provide a service to those who need it most.There are many benefits of participating in a community service program.Such as: psychological benefits\r\nsocial benefits,cognitive benefit. So, it is a very important part of program.\r\n  If I have the opportunity firstly, I\'ll find \r\nout what is needed in my community. Asking my family members, friends, neighbour I can find out problems in my\r\ncommunity.Secondly,I see What I have ability to do.Thirdly, I have to choose a project.Fourthly,I recruit my volunteers and I will tell them about my project. \r\nSixthly, I have to make a budget which is\r\nvery important part of my project.\r\nSeventhly,I have to make a timeline.\r\nFinally, I have to raise money.After that, I\r\ncan execute my project.Thus,I can bring a positive change in my community through social servic',NULL,'Circuit House Lane, Dhap,Rangpur',NULL,841,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/841/certification/hglBWZc6NmOGfwGGSM5zijHSGbrWaDvDaYtK77tU.jpeg','Bangladeshi','10',9,8,'01799300241','85','2004-12-19','raiyanreza19@yahoo.com',NULL,'1','1','1','01778449955','rezamdnurealam@gmail.com','Reza Md Nure Alam',NULL,NULL,'Engineer',NULL,'1',NULL,NULL,'Reza',NULL,'01799300241','tonima1303@gmail.com','Tonima Yasmin',NULL,NULL,'Unemployed',84,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/841/student_photo/FAtWao6oZMqnrcE87O7VEet2Iv276eaUSYY7PUhO.jpeg',NULL,'5400','2','New York','Kachari Bazar Road,Rangpur.','Rangpur Zilla School','2019-11-27 06:43:18','0521-63416','male',NULL,'Kotoyali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/841/marksheet_previous/RgFXIy3naDLlEqV4QjbDhd8xVTgvsQxo4lPOuNGt.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/841/marksheet_previous_two/PZ9prmxM9LvoBQd2A1mgPkzNzCKZKtV2rMWf2Kxo.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/841/marksheet_current/WO3yPElMBNwxZWFnlHAVsyJ6N5cdgQGLio0hmrxa.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:08:19',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Rajshahi',2,'7026602206456',600000,2,'8816147661688',-1,'Rangpur, Rangpur',5400,'Sadar','Abu Rayhan Mijanur Rahman','0521-63416',NULL,1,NULL,1,NULL,'The Yes program is one of the the biggest platform where I can represent about my county and culture.Actually, my aim is to introduce my country and culture to other Muslim countries so that  they learn about my country and culture. Besides, other Muslim country also represent their countries and cultures.So, I can learn a vast of knowledge about other Muslim countries and cultures from the Yes program.For the Yes program I can attend high school, engage in activities to learn about  American society, values and culture. I can educate my American friends about my country and culture. Most importantly, from the Yes program I can acquire leadership skills which is vital for my future life. However, staying with my foreign  friends I will be able to select good friends which is very important for my life.Moreover, this program also teach me about good manner, unity, punctuality etc.The Yes program is totally beneficial for me and my life. That\'s why I want to apply for the Yes program.','Culture refers to the characteristics and knowledge of a particular group of people encompassing language,cuisine,\r\nreligion, clothing, arts,music etc.Every county has a culture of it\'s own.The culture of Bangladesh is as old as it is rich and diversified. \r\n      Cuisine is an important part of culture.Bangladesh is country of great cuisine.peole here make many delicious snacks,dishes,sweets and they have been making them tarditionally. Boiled rice is the main course here.Vegetables, fish, meat,curry, lentil soup etc serve along with boiled rice.Fish is the main source of protein.People likes Hilsha fish most.Panta ilish is a traditional platter of panta bhat.It is boiled rice in water and served with a hilsha fry, dried-\r\nfish,pickels,green chillies and onion.It\'s a popular dish on the \"Pohela Baishakh\".\r\nBangladeshis are fond of sweets.\"Pitha\"\r\nis a traditional sweets made from sugar,\r\nrice flour,syrup,molasses etc.Visiting here my American family can taste my countries cuisine.',1,'iEARN-BD Website',NULL,2,'2019-11-19','2019-11-19',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/841/school_seal/GbMeuqIDsPkDCvCnd59afjBmYmkuymWZ3i15S9o3.jpeg'),
	(150,'Nafisa',2,0,NULL,'Chattogram, Chattogram',NULL,19,'I started voluntary activities with my dad when I was 5 years old. In Bangladesh there is a culture to give charity twice in a year just day before Eid festival. Normally we prepared a list for poor people and helped them by giving financial support or food and cloths, even building small house which helped me to connect native community. Doing smallest tasks can make a real difference. Volunteering also helps to boost social skills and expand network. It gives a sense of accomplishment, achievement and self-confidence to try something new. People become more empathetic towards community.\r\nI had an experience with my family for fundraising and awareness for Rohinga refugee. That wasnt included with institution rather conducted ourselves. But YES program is organizational learning, can change life through training and education. Surely, Ill become more independent, mature, open-minded and willing to help others. Look forward to helping people in my country when I return to Bangladesh.',NULL,'Al-Noor Garden, Zakir Hossain Road, Khulshi',NULL,845,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/845/certification/n736yFsg74zzGzRoz7nNAxEYSTblHQ4m4wVr6vzc.jpeg','Bangladeshi','8',7,6,'+8801817796956','73','2005-07-31','nafisasubahnishat@gmail.com',NULL,'1','1','1','+8801817203057','br2783@bangla.net','Md. Jashim Uddin',NULL,NULL,'Government Service Holder (Banker)',NULL,'1',NULL,NULL,'Subah',NULL,'+8801817796956','nafisasubahnishat@gmail.com','Pervin Akther',NULL,NULL,'Housewife',70,78,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/845/student_photo/tSrqslU3NNbxF4UdzbSsmGshbAERJOvZufz8fm8O.jpeg',NULL,'4225','1',NULL,'Zakir Hossain Road','Ispahani Public School & College','2019-11-27 06:43:18','+88031616323','female',NULL,'Panchlaish','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/845/marksheet_previous/DhUEGWv45zb7mNTqqMLySS1m3AvnJQjh7wxunb0a.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/845/marksheet_previous_two/YpFvevMWamjkbhT0tLZX4R5yt0MaW9En9vPhfAbT.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/845/marksheet_current/dLDm0w6Yy6BAQy3Pc3PeOY4yyanhT0w6I6Jv8Mb4.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:10:29',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Chattogram',2,'1590602771411',700000,2,'1595511294902',-1,'Chattogram, Chattogram',4225,'Doublemooring','Lt Col Mohammad Moinul Islam Chowdhury, AEC (LPR)','+88031616323',NULL,1,NULL,1,NULL,'In order to enhance my knowledge and increase personal skill the following points I have been considered:-\r\n1.	Get out from my comfort zone and explore the world.\r\n2.	Become a member of an American family; create lifelong friendships.\r\n3.	Discover the real by seeing how others view towards Bangladeshi.\r\n4.	Build cultural awareness; broaden my perspectives on global issues.\r\n5.	Be a youth ambassador of Bangladesh.\r\n6.	Experience an international education at a U.S. high school.\r\n7.	Develop leadership and community service skills I can bring back to Bangladesh.\r\n8.	Develop skills to stand out in the competitive modern job market.\r\n9.	Join 10,000 plus YES alumni from more than 40 countries around the globe.','People say HOME is where the heart is, but for me the home with heart where the dream is. United States is a multicultural country and living with a new family will be an amazing venture and obviously unique. I read in webpage different YES student stories and I imagine how big of a part host families play in the exchange experience. Thinking, the day I got news of KL YES program, this may led to learning much about American culture and people; but what is so incredible is that Im going to get learned much more if I get a chance I will try to expand my horizons.\r\n\r\nFestivals and celebrations are an integral part of the Bangladeshi culture. Eid ul-Fitr, Durga Puja, Buddha Purnima, Christmas, Pohela Boishakh are widespread celebrations. Through this program there is a chance to share my view in exchange I shall bring some new experience; lifes problems and pleasures, food, people live a life that is different from mine can help my community to adapt a modern life style.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-10-29','2019-10-29',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/845/school_seal/ygY2XDwxwwit1fgQbF5K1avPl8Au5iAUYcYrCsBK.jpeg'),
	(151,'MD. Nurul Hasanat',2,0,NULL,'Jamalpur, Mymensingh',NULL,19,'If I have the opportunity to organizing a community service project, I will bring a specific change by doing helpful work for everyone. I will advertise for the organization. I will introduce the organization among the general people. I will invite the general people for joining organization to do good work.',NULL,'Boshpara, Jamalpur',NULL,855,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/855/certification/RxTPwccuFTkZKpHUQLARRpToFYRjEZKKv3UIbPtX.jpeg','Bangladesh','10',9,8,'+8801925576971','70','2003-12-29','jjilan237@gmail.com','https://facebook.com/Hasnat G','1','1','1','+8801720996566',NULL,'Md. Jahangir Alam',NULL,NULL,'Retired bank officer',NULL,'1',NULL,NULL,'Jilan',NULL,'+8801925576971',NULL,'Nasrin Begum',NULL,NULL,'Unemployed',60,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/855/student_photo/ZtNJyAVm6eOYeMtmeLGo69R9WMa2DKagOIZxy53u.jpeg',NULL,'2000','2','New york','Kacharipara, Jamalpur','Singhjani M.l High School','2019-11-27 06:43:18','+8801925576971','male',NULL,'Jamalpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/855/marksheet_previous/5aNVe831yDFsTykwBmNvNtAhky1IRlSs5Cv3vOGT.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/855/marksheet_previous_two/hhhSWstZel614N9zaBMmDyh62BJuCIQl37p3j2Du.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/855/marksheet_current/sCsbgrlvqjTVQV7Gy000Ggy7bLexgyU9I0zIlvEY.jpeg','https://twitter.com/hasnat jilan',1,NULL,NULL,NULL,NULL,'2019-11-29 20:11:15',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Jamalpur',2,'688 466 3318',120000,2,'643 447 2343',-1,'Jamalpur, Mymensingh',2000,'Jamalpur','Md. Shofiur Rahman','+8801711225334',NULL,1,NULL,1,NULL,'I am student. So I have a ambition to know more and more. I want to go outside of our country and want to spread the culture of my own country. I want to improve my communicating skills also.','I wish to share language with my american friends and families. If i may go America, l have to communicate with other specially in English language. But as a Bangladeshi I want to introduce them about Bangla language. We struggled for Bangla in 1952. For the purpose  of struggling, UNESCO has declared 21st February as \'International Mother Language Day\'. So it is a matter of pride for us. So when i will talk with friends about the history of Bangla they might be wanted to listen the language. Then I will say a sentence in Bangla and then I will translate the sentence into English.',1,'Newspaper',NULL,2,'2019-10-29','2019-10-28',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/855/school_seal/Zq1xmJTIkIAurE5wzhXK4nyQ00FU80Rux0u2ilpz.jpeg'),
	(152,'Md. Al Amin',1,0,NULL,'Tangail, Dhaka',NULL,19,'I would very much interested for social service in both county either in Bangladesh or USA.',NULL,'Nursary Road, Kodalia, Tangail',NULL,856,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/856/certification/t2x6OsAGwaVeWQOyqSLqVat7xF1ovb4jPk5AjhXw.jpeg','Bangladesh','11',10,9,'+1881933300','70','2002-08-08','harun@live.com.sg','Facebook','1','1','1','+8801881933300','akterlovely15@gmail.com','Md. Babul Akter',NULL,NULL,'Teacher Assitant',NULL,'1',NULL,'Yes Bangladesh','Al Amin',NULL,'+8801881933300','akterlovely15@gmail.com','Rekha Akter',NULL,NULL,'unempolyed',80,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/856/student_photo/q6s9eBsXN9zDs8jTdMZ6Ibur9eDGZfD0niJatPPw.jpeg',NULL,'1900','2','Forida','Aulatail, Kalihati, Tangail, Dhaka','Aulatail Darul Islam Dakil Madarasha, Tangail','2019-11-27 06:43:18','+8801782448475','male',NULL,'Kalihati','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/856/marksheet_previous/O4xdx0uqaoy06LvFfSa5ltzaQmCAlcZsCdMstJQ6.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/856/marksheet_previous_two/zsTJEYDKxEXfqDnjunbcGzlnaiZ2jsMks009vELs.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/856/marksheet_current/wHDWB6sXRPpTuRNN9Z20s3VpRuRgiqrJuQ3uyI7J.jpeg','iearn BD',1,NULL,'NIL',NULL,NULL,'2019-11-29 20:11:36',NULL,1,1,'Not Applicable','Not Applicable','B078411','2022-12-27','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/856/student_passport/hHZGDLa5vc54opYfZ73t6zNJdEnbEX6wgGPV3r3E.jpeg','Aulatail , Kalihati, Tangail',2,'9314765484815',100000,2,'9314765484814',20000,'Tangail, Dhaka',1900,'Kalihati','SM Kamruzzaman','+8801736710585','NIL',1,'NA',1,'NA','I would like study English and live in USA for higher study.','I would like to developed my cultural program as USA & Bangladesh program.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-10-27','2019-10-27',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/856/school_seal/wHD0zzi558K5hfKsbnanUp04D809ecTFXrupELYL.jpeg'),
	(153,'Md. Ashif Hossain',2,0,NULL,'Rangpur, Rangpur',NULL,19,'I am a cadet of BNCC. The organization BNCC greatly aims at doing social services. We have the priviledge to serve the society by several programmes. I have contributed in several programmes like these such as tree plantation, cloth distribution for poor in winter, blood donation campaign etc. And I want to continue doing such services wherever I go.',NULL,'House no. 4, Road no. 4/4, Samoli Lane, Police Fari, Dhap, Rangpur',NULL,859,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/859/certification/mPy23klvB4p2gV4bDWkkNpCZmzQNIYWIHxYBbA14.jpeg','Bangladeshi','10',9,8,'+8801832265071','80','2004-10-26','md.ashif16sajid@gmail.com',NULL,'1','1','1','+8801918086500',NULL,'Dr. Md. Mir Hossen',NULL,NULL,'Doctor',NULL,'1',NULL,NULL,'Sajid',NULL,'+8801864111011',NULL,'Mst Ajmeri Sultana Soma',NULL,NULL,'Unemployed',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/859/student_photo/pr51a1POTOg9oyJeyjqMG9rFgfxcwPPYBkQT61zo.jpeg',NULL,'5400','1',NULL,'Rangpur Cantonment, Rangpur','Cantonment Public School and College, Rangpur','2019-11-27 06:43:18','0521-63051','male',NULL,'Rangpur Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/859/marksheet_previous/G9en0jrry0m4XGoncwYg4T2PBZHdEeWqTyN1L7C4.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/859/marksheet_previous_two/15Ev6FmQ8aeDwqy11KawBEVp4kbammv9YM1kO1uY.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/859/marksheet_current/eyi0svAKlWO4nN75F4ClpobytgJ4PJNqB4jbQxLe.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:13:01',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Rangpur',2,'7784084282',750000,2,'8514923333933',-1,'Rangpur, Rangpur',5400,'Rangpur Sadar','Col Kazi Shamim Hasan, psc','+8801769663170',NULL,1,NULL,1,NULL,'Since past 1-2 years, I have been attracted towards getting a scholarship in a renowned institution outside my own country, to meet my thirst of knowledge, to adapt myself with foreign environment and equip myself with adaptive skills. I wish to work hard and achieve educational qualities that might not be supportive here and possible in my country. And along with that, living in foreign, that too with a whole loving family has been a dream for many youths, so for me. Going there, I want to learn about US culture, lifestyle and perspective as well.','I mainly wish to share the food habit of our culture with my american family. I also wish to share our clothing styles. I can share the fooding by letting them know the way we cook, the ammount of spices we use, and also the traditional way of serving foods. Along with that, I wish to share the loving aspect of Bangladeshi people by letting them know how sweetly we talk, greet, show hospitality and help each other.',1,'My High School/Teacher',NULL,2,'2019-11-20','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/859/school_seal/gcjOpwtig3X7FJ09JZGEsFpZFrYs95NiteYYNzpg.jpeg'),
	(154,'Mujtaniba',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have unfortunately never had the opportunity to actively participate in community service in the past, but I do have plans for future action. An unfortunate but prevalent issue in our country has always been child marriage, specifically for females. I believe this is an issue that desperately needs to be addressed and made more aware of, and therefore, I would like to participate in a service dedicated to raising awareness about and reducing child marriages in our rural areas.\r\n\r\nIn order for there to be a significant change in this field, we need to raise awareness about the risks and lost opportunities surrounding child marriage to both the young girls in rural places as well as their parents. Financially struggling parents need to be made aware of that marrying off their daughters at a very young age only hampers the possibilities for her future, and girls need to be told that there are many more opportunities more them out there and they have a choice in deciding their futures.',NULL,'28/5, Teacher\'s Quarters, BUET, Dhaka',NULL,865,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/865/certification/I5AndHbA4xP5pheMt7S2DWybJWEthNWcrfcOqBFE.jpeg','Bangladesh','8',7,6,'01712085970','98','2005-05-31','islammujtaniba@gmail.com',NULL,'1','1','1','+8801712088318','advfarid@yahoo.com','Mohammed Faridul Islam',NULL,NULL,'Lawyer',NULL,'2','2023-04-04',NULL,'Islam',NULL,'01712085970','salpar73@gmail.com','Salma Parvin',NULL,NULL,'Teacher',98,98,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/865/student_photo/9TVReQpmfv0ZJJOXen0kYPRnM3dXmb9hlLfhfGPF.jpeg',NULL,'1000','1',NULL,'House#31/A, Road#8, Dhanmondi, Dhaka','European Standard School','2019-11-27 06:43:18','+88029104620','female',NULL,'Chawkbazar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/865/marksheet_previous/7s6ezWeGHcXtmwNic0rKQMZKlCxIHY6R2zyIUJLv.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/865/marksheet_previous_two/CqgSumPd6jg3dbTbMne6Xpf6ZR4e1SgrHil56AKk.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/865/marksheet_current/ApDb2wtdbpFhO5EIPrAbz2gPbtbGX5jtrhV7NCjb.jpeg',NULL,2,'10','Tourism',NULL,NULL,'2019-11-30 15:22:42',NULL,1,1,NULL,NULL,'EA0230703','2024-03-30','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/865/student_passport/Pp4wAMNIBt4LqqOcqz8URNX3WbqlkCCgE5r5JVRR.jpeg','Dhaka',2,'5086244513',1200000,2,'1518291813084',800000,'Dhaka, Dhaka',1205,'Dhanmondi','Engr. Abdullah','+8801713080265','I have traveled to New York and Washington DC, three years ago',2,'Germany for youth camp; Italy, India, Turkey, Canada, USA, Malaysia and Singapore for tourism',1,NULL,'I see the YES program as not only an excellent opportunity to further the understanding towards my country\'s culture, but also to satiate my own personal interest in the lifestyle and education of American students. Other than my obvious interest in learning more about the societal values in America and sharing Bangladeshi culture with them, I am also particularly interested in more opportunities for acquiring leadership skills and participating in community service. Furthermore, the experience gained from a year spent studying in the USA would be more valuable to me than I could possibly say, since it is my wish to pursue higher education in a developed country like the USA.','Among the various cultural aspects of our country, it is our language that I am personally the most interested in sharing. Our language is the only one in the world that has had to shed blood for it to be spoken freely. It was in light of our forefathers\' fight for our mother tongue that the 21st of February was christened as the International Mother Language Day. Furthermore, it is also extremely rich in literature, having produced some of the most sophisticated and well-written works that I, personally, have ever encountered.\r\n\r\nThe independence of our entire country boasts of a history as rich as our language. The tale of how Bangladesh even came to be Bangladesh in the first place is an intricate and heart-warming one, and it is certainly a tale that deserves to be told to as many people as possible.\r\n\r\nOur cuisine is another aspect that I want to share. Bangladeshi cuisine boasts of some of the most delicious and intricate dishes imaginable and it would be a waste not to introduce it.',1,'My High School/Teacher',NULL,2,'2019-11-18','2019-11-15',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/865/school_seal/tuqSYUE31XizBqJXT2p7tjMRE0kiZCGdfTMU8i9G.jpeg'),
	(155,'Samuel Aldrine',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I havent participated in this type of experience but in future if I get this kind of opportunity I have decided to use the writing skills to develop in English to volunteer at a local non-profit that raises awareness of Alzheimers disease. As a strong writer, I start out writing press releases for the charity. Immediately I will be developing a new skill: the ability to write for a targeted, non-academic audience. Working with a team, I will gain a better understanding of the importance of sharing information in a usable way. I may eventually expand my duties into other areas, such as managing the organizations social media accounts, which would further develop my writing skills.',NULL,'104/2, Monipuripara, Tejgaon, Dhaka',NULL,867,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/867/certification/kDGHV2XCXgctLnCYNSZ3ikd5ZXMmU1cWI9ehG4gb.jpeg','Bangladesh','9',8,7,'+8801754499312','80','2004-01-14','monindub@yahoo.com','https://www.facebook.com/andy.dcosta.315','1','1','1','+88-01552630378','prodipdcosta1@gmail.com','Prodip D\'Costa',NULL,NULL,'Demi Chef De Partie',NULL,'1',NULL,NULL,'D\'Costa',NULL,'+8801754499312',NULL,'Adline Subarna D\'Costa',NULL,NULL,'Housewife',86,86,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/867/student_photo/YgwGYN4MIS6YxNd8WJiBn4GvjivxkArZA4uWoh3e.jpeg',NULL,'1215','1','N/A','105/4, Monipuripara, Tejgaon, Dhaka','BACHA English Medium School','2019-11-27 06:43:18','+88-9114525','male',NULL,'Tejgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/867/marksheet_previous/Fkl7OKTlxgX7fmpKb4edf2On8raP1CM5o4xUyLTL.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/867/marksheet_previous_two/SniYNddbVSfT465gkw29bKVbjwGHWffJBuibSNvR.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/867/marksheet_current/hUAsH16UOjrGpicD1LGbCJ7ZySUlNhOUnlskDllU.jpeg',NULL,1,NULL,'N/A',NULL,NULL,'2019-11-29 20:15:59',NULL,1,1,'N/A','N/A',NULL,NULL,NULL,'Dhaka',2,'327 785 7672',780000,2,'462 788 2873',360000,'Dhaka, Dhaka',1215,'Tejgaon','Sr. Miriam Perlewitz, MM','+88-9114525','N/A',1,'N/A',1,'N/A','I want to work very hard so I can help other people. My goal for apply for the YES program is to drive myself toward my goal, experience building new friendships, taking responsibility for yourself, respecting differences and tolerating the beliefs of others, develop leadership skills, self-confidence and a greater understanding of the complexities of the world around them, getting to know the locals, experiencing the culture, discover new aspects of yourself.','I wish to share with my American family about the Bangladeshi Clothing and Cuisine culture. The dress preferences in Bangladesh are unique. Bangladeshi mens casual wear in rural areas is the lungi with formal clothing being suits or shirts and trousers. On cultural and religious occasions, men have traditional wear called Panjabi. In women, the traditional and main dress is the Shari, with young females also wearing salwar kameez. Bangladeshs cuisine is renowned for having a distinctive culinary tradition. The nations staple food is rice served with various food items such as vegetables, fish, meat, eggs, curries, and thick lentil soups. The country has many sweet preparations including Bangladeshs sweetmeats which are milk based. These delicacies include shondesh, rasmalai, Chom-Chom, rasgulla, and Kala jam. The primary source of protein in Bangladesh is fish, with over 40 types of freshwater fish including Katla, catfish called magur, and shutki machh. Eating beef is not a taboo',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center','N/A',2,'2019-11-16','2019-11-13',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/867/school_seal/7Cf8wzNDESCZbSOSio6JPSJnCBOm75g3oVkRZd8H.jpeg'),
	(156,'Dowrin Anjum',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I am very interested doing community work. If I get a opportunity I can work for the society, i can help others doing social works. i can make people to understand the negativity of any harmful thing or any negative work which destroys the peace of mind and also society.',NULL,'Ga 69, 1st floor, Middle Badda, Dhaka',NULL,870,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/870/certification/hYTdnvgd9MLrf8Gk7RIZhTKGllLV1xvzw7iAt9nn.jpeg','Bangladeshi','11',10,9,'01765256666','86','2003-11-13','farukulislamakash786@gmail.com','http://facebook.com/anjum.prity.3','1','1','1','+8801819144933','farukulislamakash786@gmail.com','Md. Farukul Islam',NULL,NULL,'Service',NULL,'1',NULL,NULL,'Prity',NULL,'01816334750',NULL,'Fatama Akter Panna',NULL,NULL,'Housewife',83,82,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/870/student_photo/gL9Qg4nBarjanlbFf2I2PLbs6qlT25oePNmwSYlv.jpeg',NULL,'1212','1',NULL,'Ga 72/1, Progati Sarani, Middle badda, Dhaka','National College','2019-11-27 06:43:18','+8801745993722','female',NULL,'Badda','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/870/marksheet_previous/G9VpgMMLK1Xl3z6r7KBdxbWoCld5HrOmQgdP0M2g.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/870/marksheet_previous_two/diEzLB4JlaYVGrshQqhGNMxrNgskGjRjjo0Pu2sn.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/870/marksheet_current/1IgFYAI6rjjpzWys7NBt0dFUeflAaMfPGambnoMF.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:19:42',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Brahmanbaria',2,'1219476354629',120000,2,'1219476354630',-1,'Dhaka, Dhaka',1212,'Badda','Shahidul Alam','+8801745993722',NULL,1,NULL,1,NULL,'I want to know American culture. I also want to study there. It is my dream to study there.','I will talk to them using my language and will try to understand them, my language. \r\nI will tell them about our food habits, our main cuisine, what type of food usually we eat etc.\r\nI can wear our traditional clothes on any occasion there, this will make them attracted to our clothing.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-22','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/870/school_seal/UrgEv312j8FxeByUbU038QJ1CVcChNRgANCYhlUe.jpeg'),
	(157,'Shromona',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have been volunteered in NGO based programs which is related to our womens right and women movement organisation. I felt great honor being a part of the program. And in the near future, if I get a chance in participating in any community service, I would give my best and work to the fullest. I would like to spread awareness among my surroundings and try my best to bring positive response to the people and help them.',NULL,'House#2 Road#9 Nobodoy Housing Society , Mohammadpur, Dhaka',NULL,873,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/873/certification/t4JIte6LEIyGE9z1rhoxYQT3MrwovDXhcyxAi2ZM.jpeg','Bangladeshi','11',10,9,'01781439449','74','2004-02-01','rowshon_987@yahoo.com',NULL,'1','1','1','01712720105','zakir62bd@gmail.com','Md. Zakir Hossain',NULL,NULL,'Accounts Officer',NULL,'1',NULL,'_shromo_02','Hossain',NULL,'01781439449','ismotharadolly@gmail.com','Ismot Ara Dolly',NULL,NULL,'Unemployed',66,66,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/873/student_photo/JLfYHC6oIcEABl3T5Ce1VxjtLMDIQ7Nc5Rgac2jx.jpeg',NULL,'1207','1',NULL,'15/1 Iqbal road ,  Dhaka','Mohammadpur Preparatory School & College','2019-11-27 06:43:18','8802 9112663','female',NULL,'Mohammadpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/873/marksheet_previous/hujirTIPdjjBe7sHbET87d1KrjC9YWOVoezQCtty.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/873/marksheet_previous_two/KSPWVjTLqBfzeRC7O9cuFFKU2doIfxD5Z7pm8QMR.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/873/marksheet_current/dMoPQlrngbvvVjoBNKtyyNQJjxrhdBk5zIUWTlm7.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:21:16',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'508 216 6363',720000,2,'2690243819576',-1,'Dhaka, Dhaka',1207,'Mohammadpur','Dilruba Begum','01552343148',NULL,1,NULL,1,NULL,'Im very interested in their culture, language, clothing, cuisine, educational system and their society. I want to socialize with them and know more about them practically. I want to create a bond of friendship with them and enjoy my time with them. I want to exchange my culture with them.','There is a lot of things I would like to share with them about my country. First will be our language. Our Bengali culture is something I would like to share. Our traditions on festivals, our culture, our clothing,etc.With great joy I would like to explain how we feel on our festive days, the excitement we share with our family. I would also like to share my countrys history to them. The sacrifice, the torture, the fight for our freedom, all the obstacle we had to face, the mother who had lost their child, every details I would like to share with them. Our historical monument and historical places, our natural green scenery, beauty of nature is something I would tell them with pride.',1,'iEARN-BD Website',NULL,2,'2019-10-31','2019-10-31',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/873/school_seal/7t3guF8Mf4bnDaN0vJa3Gubi8m5SiPY31VKqSPCM.jpeg'),
	(158,'Sm Tashmiah',2,0,NULL,'Sylhet, Sylhet',NULL,19,'Officially I have never participated in community service related events but I am very passionate about it. I am looking for an opportunity to give it a go. \r\n\r\nIf I have the chance to do so I will firstly raise awareness among the rural people to let their children participate in sports. Because I notice Bangladesh is quite low in the athletic and sports field even if it is developing. I want to engage more people to find their careers in sports and make Bangladesh proud in front of the world. \r\n\r\nI want involve in more community service related events and try to bring a positive change in my community.',NULL,'12, Nur Manjil, Nawab Road, Sylhet',NULL,882,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/882/certification/qC6q8qlhIuXOdIVKJCZ5jBdmfcHFCdMx4aE4sQ1j.jpeg','Bangladesh','10',9,8,'01725167927','80','2004-09-07','isratazom@gmail.com',NULL,'1','1','1','01716440338','smrafi500226@gmail.com','Md. Rabiul Islam',NULL,NULL,'Government service',NULL,'1',NULL,NULL,'Huda Rafi',NULL,'01725167927','smrafi500226@gmail.com','Mst. Taslima Bulbul',NULL,NULL,'unemployed',80,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/882/student_photo/0X7QT8728gPn8ailGpXLqGzLgjTz6ntP6CG0uHh6.jpeg',NULL,'3100','1',NULL,'Dak Bungalow Rd, Sylhet','Sylhet Govt. Pilot High School, Sylhet','2019-11-27 06:43:18','0821716382','male',NULL,'Kotwali Model Police Station','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/882/marksheet_previous/tHKmoTiIn8QGnERMEazEsQbkOYz6DruBNHxR5t8G.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/882/marksheet_previous_two/RaPnHLxGMuDWF9tcsF9gTcPcwHtEZmjCRLc9mWAo.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/882/marksheet_current/WRDvnXCBQf4uunFB0FWfaKTw473vt2Lip7wAeD7f.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:22:46',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Jhenaidah',2,'8249729487',400000,2,'5017994411737',-1,'Sylhet, Sylhet',3100,'Kotwali Model Police Station','Kabir Khan','0821716382',NULL,1,NULL,1,NULL,'Recently I got to know about the YES program and since then I am really motivated to apply. The culture of Bangladesh fascinates me and I always look for ways to represent my culture to the world. I want to go out of my comfort zone and discover myself. I want to be an example for my school and city and inspire people to try new things. This opportunity will let me share my culture with the world and make me learn about their culture as well. I want to go out and see the world and what it has to offer.','Bangladesh has a colourful culture and anyone would love to know about it! This is my dream to share my culture with people outside my land. Everything about our culture would impress people but especially I will make my American family learn about the varieties of food that we have by making for them often, wear Bengali clothes together and inform them about our heritage.\r\n\r\n Our language is the heart of our culture so I will make them write their names in Bangla alphabets and let them know about our history. We will together celebrate all the Bengali festivals and religious festivals. This way we can share culture and create bond among us.\r\n\r\nI too will celebrate the American festivals.',1,'A Friend',NULL,2,'2019-11-01','2019-11-01',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/882/school_seal/KJg21hpYaa548nYsTIXGXYVPb7DdjbpOVoW4NsXl.jpeg'),
	(159,'Ahnaf Mahiat Samiha',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have participated some social activities.I have worked for the street children with an organization named NCTF(National Children Task Force) for last few years.I have passed an auspicious time with them.I was inspired to do something for their betterment and well being by participating this kind of social activities.Actually it was an amazing experience for me.',NULL,'15/F #2/A, Zigatola',NULL,883,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/883/certification/Z7sBDYt7OFgjGm3BPtcLPfV38hURKAX5SGmEdEkg.jpeg','Bangladeshi','11',10,9,'01878535554','85','2004-01-10','ahnaf.harappa10@gmail.com','https://www.facebook.com/profile.php?id=100009221548421','1','1','1','01711962368','mokshud.aziz@gmail.com','Md.Azizur Rahman',NULL,NULL,'Government employee',NULL,'1',NULL,'https://instagram.com/uzumaki_shishumi?igshid=fb7tf6qz4qjl','Harappa',NULL,'01818284727','shameemakter@gmail.com','Shameem Akter',NULL,NULL,'Government employee',82,81,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/883/student_photo/NjeIYBeUvIQcBonI1QdeERaCri5Tndw95AiP6V8j.jpeg',NULL,'1209','1',NULL,'Peelkhana,Dhaka','Birshreshtha Noor  Mohammad Public College','2019-11-27 06:43:18','02-58613870','female',NULL,'Dhanmondi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/883/marksheet_previous/kLsmG6Kj2azVgJwCleIbH369ZcjXmSuHetIaK4Jh.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/883/marksheet_previous_two/9yB8jMNJPHwye5ekL8vyYg14RRR4rM5YtiNR0LwV.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/883/marksheet_current/8TvEFoi2TZsfQ8ngxoThakxxEqEK31FRuFXdKuuR.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BE0387472','2020-02-01','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/883/student_passport/cHo7qD4CAIaL562vHgZUm9KlCjpfxTk8hGnpCABW.jpeg','Chattogram',2,'3022901115011',1200000,2,'3022901115012',1200000,'Dhaka, Dhaka',1205,'Dhanmondi','LT COL MOLLAH MESBAHUDDIN AHMED','02-58613870',NULL,2,'India for visiting historical place',1,NULL,'The main reason why I want to be a part of YES program is,I want to move out of my comfort zone and try something unique.Being an exchange student is a once in a lifetime experience, to travel such a long distance away from home to foreign place is something that few ever dare to do.It will be a expedition which will give me memories of lifetime.And along with that I want people of all ethnicities to know about the rich tradition and culture of our country.I want people to know about our deeply rooted heritage and diverse briony.','Bangladesh is a country of diversity in every aspect.Its culture is rich in all respects.Our cultural elements like the way of living,eating habits,clothes,language,religion,values,policies,tradition etc are totally different from others.In our culture we have our own food habits like eating rice and fish. we have own traditional dress like lungi,panjabi,saree etc.Our songs are based on rural and idyllic pictures of life.Moreover,there are so many other things which I want to share with my host family.I want to share these things with my host family so that they can know about our lifestyle.And I want to know about their culture,tradition and moral values so that I can experience their lifestyle too.',1,'Facebook',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/883/school_seal/23N3xxBZKkd3jWxaFUQqkE4SxVe1p4dKQMqzjfTR.jpeg'),
	(160,'Abdul Aziz',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I would like to take part in something which would improve our Climate and Reduce Carbon Emission So The Future Generation Can Live in a Planet which is Not Always Under natural disasters.',NULL,'20 No Hossain Uddin Khan,1st Lane,Dhaka,Bangladesh',NULL,886,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/886/certification/CV3xTTbgyFsPVeHQR63FuLxxORLQ0qm49k1sOgwr.jpeg','Bangladeshi','10',9,8,'01988156938','52','2004-09-11','ohirifat@gmail.com',NULL,'1','1','1','01988156936','hsohrab652@gmail.com','Md.Sohrab Hossain',NULL,NULL,'Works In A Private Company',NULL,'1',NULL,NULL,'Rifat',NULL,'01734647068','reham4939@gmail.com','Yesmin Akter',NULL,NULL,'Housewife',58,74,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/886/student_photo/3RyO7YHk8m8eWRyfdI8uUZZRubwUqqosY0ZcGJ73.jpeg',NULL,'1211','1',NULL,'37/6-A Azimpur Road,Dhaka','Rayhan School And College','2019-11-27 06:43:18','01711534497','male',NULL,'Lalbagh','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/886/marksheet_previous/Db063fqVINvDqWvOKAgqQqbTiEYHbiJ4aMPCVbPJ.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/886/marksheet_previous_two/FZUC6YGBeNX2lVBadptXu6qRpi5iln8WX2ckvZ7t.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/886/marksheet_current/new3QGn7bBwXk1luObDF0m2JOWeBIl7koC2t5qnX.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'14,Hormon Wheel Street,Posta',2,'326 397 8722',480000,2,'190 992 1239',-1,'Dhaka, Dhaka',1205,'Lalbagh','Rahima Afroj Mili','01777826230',NULL,1,NULL,1,NULL,'To Get a Chance to Study in USA','Language and Cuisine',1,'Newspaper',NULL,2,'2019-11-20','2019-11-19',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/886/school_seal/ZvlqSEucjiBVAPDHdwBwmQMi2bP4084bDiDzkCd2.jpeg'),
	(161,'Bridget',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I believe community services help a country develop environmentally. It is our duty to reduce pollution and keep our environment clean but as humans, we are failing. As a result, pollution is a big environmental issue and the amount just increases every time. In the future I would like to start a social service where I will pick up plastic wastes, to decrease plastic pollution, and plant more trees, to beat air and soil pollution, desertification and global warming.',NULL,'61/5 Tejkunipara, Tejgaon, Dhaka.',NULL,900,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/900/certification/ScOG001Ni6FTHyimAIiA47zsSCL47TABE5tZceqL.jpeg','Bangladeshi','10',9,8,'01721000652','90','2004-03-11','bridget.gomes11@gmail.com','https://www.facebook.com/bridgetgomes.11','1','1','2','01712587146','gmes65@yahoo.com','Michael Gomes',NULL,NULL,'Service',NULL,'1',NULL,'bridget_gomes','Gomes',NULL,'01721000652','roseline.kony72@gmail.com','Roseline Kony D\' Costa',NULL,NULL,'Unemployed',70,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/900/student_photo/QbfrQYa3O6c6mhGW0tJGJ5X4lspDAirccjilJ716.jpeg',NULL,'1215','1',NULL,'105/4, Monipuripara, Tejgaon, Dhaka.','BACHA English Medium School','2019-11-27 06:43:18','9114525','female',NULL,'Tejgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/900/marksheet_previous/Lqk947tCEhB4zRRNQWD3kOrclBiEXPzOhjCGbow5.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/900/marksheet_previous_two/azbsfp2NStWMEAc2FCf8wGKFSXM8UaKjaFWHvPFP.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/900/marksheet_current/9wegvEiKlaIsRgydcZFHXPVI8s5TZd6R2oEqstm2.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'EB0554380','2024-07-27','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/900/student_passport/keWwBRcNpbamNH1GJc7pwbnlpcRnj5215RGdDIY8.jpeg','Dhaka',2,'5977111995',900000,2,'5977120756',-1,'Dhaka, Dhaka',1215,'Tejgaon','Sr. Miriam Perlewitz, MM','9114525',NULL,2,'Family Trip to: Singapore, Malaysia and Thailand. Pilgrimage to: Egypt.',1,NULL,'I want to apply for the YES program because I see this program as an opportunity to explore the American culture, tradition, and learn about their lifestyles. Also, studying in abroad has always been my dream. If I achieve this chance, I will get to see and venture a new country, its different weather, socialize and make new friends and even develop new hobbies. To conclude, the YES program will be a life-long experience I will always remember and cherish.','I will be glad to share my mother tongue (Bangla),cook cultural cuisine and tell my American family about our traditional clothing style. I will tell them about our Bengali Language Movement, the conflict that took place to fight for our mother tongue, and the Liberation War, the conflict where thousands of lives were sacrificed for Bangladesh\'s independence.\r\nTraditions cuisines like- panta bhaat, daal, biriyani, Iilish fry and kheer are some of the items I would like to share with my host family. Traditional clothing- Panjabi, lungi, sharee, salwar kameez are clothes that preserve our culture. I\'ll be glad to inform them more about my clothing style.',1,'A Friend',NULL,2,'2019-11-14','2019-11-12',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/900/school_seal/Aap0Ee5k5G8o7Xl0spvQJdLEqd4kcQ5kA4u0SptJ.jpeg'),
	(162,'Afiya Aziza',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I think we can make a big positive change by doing small good deeds in our community. Likewise if I get the opportunity I would love to work for the unprivileged children. By providing basic and proper education to the unwanted and uneducated poor children through campaign, tuition, awareness I want to bring the change.',NULL,'Basundhara R/A  Aftab uddin shorok  Block-C,House no 413',NULL,902,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/902/certification/MKFfDmx7QgIku5r3WuhXX5rLkTRBfGge5Te5FTbv.jpeg','Bangladesh','9',8,7,'01627123224','70','2005-09-09','begumtaslima1965@gmail.com',NULL,'1','1','1','+8801855961994','alamgiralam@gmail.com','Alamgir Alam',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Tanisha',NULL,'01626123224','begumtaslima1965@gmail.com','Taslima Begum',NULL,NULL,'Unemployed',85,75,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/902/student_photo/3lu5FDnJUzXtwJO3bSsq9mHrTwoENvtLR8GFo9Au.jpeg',NULL,'1229','2','New York','Road-6, Block-f, Basundhara, Dhaka.','Viqarunnisa Noon School','2019-11-27 06:43:18','+88028845424','female',NULL,'Bhatata','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/902/marksheet_previous/hyycJuzt0PIjyKyDGkbjgT3sqZ5FqYBYBi3L7nxB.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/902/marksheet_previous_two/Qg3NLVn3OePgQ7U3S3ThwPLU9d9VBTnp6HUylBx4.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/902/marksheet_current/lVdpdBlWUOkD1VzZhEikkeEwqEDQht8pKiX12L7J.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'3289552261',1200000,2,'4189550140',-1,'Dhaka, Dhaka',1229,'Bhatara','Syeda Dil Afroze','01720646133',NULL,1,NULL,1,NULL,'I want to embrace the opportunity of exchange two culture and enhance my acknowledgement through the academic year. Later on I would love to apply the aquirement and distinguish skill in my local place as well as career. Beside through this wonderful journey I will get a chance to know myself newly.','I want to share about our language since it\'s one of our biggest achievements in history. I will tell my American family about the sacrifice of the martyrs to establish \"Bengali Language\" as state language. Beside I will give them Bengali songs, poem to listen, series to watch and make conversation with them in Bangla.\r\nI also want to make several types of traditional delicious foods every month for them to let them have an idea about our cuisines since I am a good cook.\r\nLastly I will bring our traditional clothes to my American family as a gift to let them know about how we dress.',1,'A YES Alumni Member',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/902/school_seal/o8UjZ48zabuAXbvlpl3ZaYuonA5DyJ5RBFjKupzB.jpeg'),
	(163,'Mahir',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I used to be an active member of BNCC (a popular scouts group in our country) a few years back. Our prime objectives were to maintain discipline and order whenever there was some kind of program at our school. I left it after a few months of volunteering activities for the sake of focusing better on my studies. \r\nMore recently, along with my fellow classmates, I once again worked as a volunteer during our schools Annual Athletic Meet. Many kinds of sports events had been arranged, and the chief objectives of us volunteers were to ensure that the program went on with proper orderliness and harmony. It was a fantastic opportunity for us friends to engage in a combined endeavor, as we all pre-planned our positions and tasks and held group discussions to strategize for the sake of ensuring maximum efficiency, so that the function could work itself out meticulously.',NULL,'Flat-C/5, House-164, West Arjatpara, Mohakhali, Dhaka',NULL,904,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/904/certification/0FjSLYsdDG7F0bWc4VxrYSLHIYAd5RHvsnvaQofh.jpeg','Bangladesh','10',9,8,'01712927605','81','2003-03-11','mahirwasif2000@gmail.com',NULL,'1','1','1','+8801712927605','mafizulislam1971@gmail.com','Md. Mafizul Islam',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Wasif',NULL,'+8801715489197','maksudamafizul@gmail.com','Maksuda Khatun',NULL,NULL,'Teacher',82,87,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/904/student_photo/DaDVvWVkUQjK5T1tew3siSptVtPN3ugFzdYbHmW9.jpeg',NULL,'1215','1',NULL,'Road No - 27, Mohakhali DOHS, Dhaka','Bangladesh International School and College','2019-11-27 06:43:18','+88029860621','male',NULL,'Tejgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/904/marksheet_previous/ch7deGrRAXun6zKiw1GAbtzrIcsQqxXcsIDyMPV4.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/904/marksheet_previous_two/gx7N3ZIzaUvsjpUxHT2P96T0LNaXnGDEz26u9qTd.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/904/marksheet_current/KON75XK0yPDxrwd0FOwJTPFibQgK44TO8fZNlVnf.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BX0630682','2023-10-27','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/904/student_passport/ceR9YfzNNx2kiv2YjebLZSukTi2qWoKmrbDnhYPs.jpeg','Dhaka',2,'2693622289555',1000000,2,'2693622289556',700000,'Dhaka, Dhaka',1206,'Kafrul','Brigadier General Gazi Muhammad Solaiman','+8801769002420',NULL,2,'Nepal for a vacation.',1,NULL,'Id say that if I were granted the chance to study abroad, that too, in a country such as America, then Id put this prospect to its best use by engaging in as much self-development as possible. It would allow me to develop a healthy tolerance coping with a different environment, and it may help me get a much clearer vision of what line of profession would be best suitable for me in the conceivable future, and what I as a person am capable of. \r\nFurthermore, my interaction with such pupils will not only be of value to me, but enrich their knowledge of other ethnicities. This peer-to-peer interaction is the kind of thing that may be of great benefit in the future for society as a whole, as it will help combat the presence of misinformation, something from which many problems of our current society take birth from.','Bangladesh has one of the most cultivated and prosperous cultures, especially from the point of view of cookery and apparels. As the son of two teachers on the topic, I am well acquainted with it, and its rich content from food and clothing to literature and poetry.\r\nI personally would say that the best way for my American family to get a taste of Bangladeshi culture would be to physically try certain aspects of it out. I would present to my host family, and the wider community, the highest aspects of Bengali culture. From the intricately woven Jamdani (muslin) to a wide selection of pitha varying in taste. I would present to them the poems of Nazrul, the songs of Rabindranath, the writings of Zafar Iqbal and Humayun Ahmed; and the sheer depth of our culture.\r\nIt is through this that I wish to widen the views of my host family, and the greater society; I intended to give them a deep understanding of the nations and cultures so far away in distance, yet so close diplomatically.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/904/school_seal/QLR81B0BtOjV84kd4F5mmZomIeSVtDOqfsHpr5G8.jpeg'),
	(164,'MOSTOFA SHAKIL',2,0,NULL,'Narayanganj, Dhaka',NULL,19,'I want to mention the role in the social service during the last flood affected people I participate to help people who are suffering during the last floods I have them without any cost how they can free from various diseases from the flood affected people.',NULL,'Painadi Ntun Moholla',NULL,911,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/911/certification/74mJmGudthaHIlqjEclOTMaLPL2p0In1lApzMIsP.jpeg','BANGLADESH','10',9,8,'01631474356','70','2005-01-22','rifatchowdhury404@gmail.com',NULL,'1','1','1','01676181986',NULL,'MD. DADON BEPARY',NULL,NULL,'Business',NULL,'1',NULL,NULL,'RIFAT',NULL,'01626100129',NULL,'RINA AKTER',NULL,NULL,'HOUSEWIFE',70,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/911/student_photo/TRlSj3kDrDVIn7cySfBPpwUR49jkg4Fm2vbRlecs.jpeg',NULL,'1430','1',NULL,'Painadi Ntun Moholla','MIZMIZI PAINADI REKMOT ALI HIGH SCHOOL','2019-11-27 06:43:18','01918-019435','male',NULL,'SIDDHIRGANJ','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/911/marksheet_previous/rPlx1PN2O5FLnOHPew6hsQanyHa6g63mMHDf1FVZ.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/911/marksheet_previous_two/WoJaD2ooEhXYQ7Ob4bx9K5Drs7M1vXKuiaHHJcAF.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/911/marksheet_current/8DtRNQ4ysxmpoYU6bUUUItF5Y6FasCxfKH8ymSFb.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Narayanganj',2,'5985180503',130000,2,'6435138836',-1,'Narayanganj, Dhaka',1430,'SIDDHIRGANJ','MOHAMMAD ALI','01918-019435',NULL,1,NULL,1,NULL,'I want to apply for the yes program because I want to work as  a  ambassador for my home country and I  also  want  to exchange my own culture with  an American host family. Attent  an American high school leadership skill engage in activities to learn about u.s society and values and their home country and culture and I want  to services human being as well as development of Bangladeshi medical sector.','I want to share my culture with American host family which culture I have belong such  as  1.traditional food 2. Traditional puppet show 3. Traditional dress  4. Traditional musical instruments 5. Traditional beliefs and customs.\r\n I have individual language cloth food tradition and culture. I have pride tradition about Bengali language, folk song,   bhatiali, baul songit, murshidi and the most Lalon Shah, Hasan raja and rabindra sonjit, Nazrul Sonjit and I have also our cultural dress for both men and women lungi, sarry, which culture I want to share with American host family.',1,'Newspaper',NULL,2,'2019-11-21','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/911/school_seal/5hL8z0ah1lpU5EJjBJRCdqy6whceGWDgOMbhrkv0.jpeg'),
	(165,'Imtiaz Labeeb',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I have been involved with our school club called \"Z Club\" sponsored by Zonta Club Bangladesh for the last one year. It is an organization that helps\r\nto provide food for underprivileged people. We also distributed winter clothes for people in need. Our club also focuses on empowering women and\r\nteach female students of our school to focus on their independency and their own freedom. We have the motive to help each girl say \" It is our life\r\nand it is our decision\" I have also worked with Rotary Club Bangladesh to distribute food and winter clothes to under privilege people in rural areas.\r\nCommunity service is not just helping the poor and needy, I consider them as a message to the upper class society. We live a lavish life while there\r\nare people who aren\'t lucky enough to even sleep properly on a comfortable bed. I wish to spread my message to the society that if we all come\r\nforward with a single track, we will have 18 core taka for the underprivelge people of this country.',NULL,'Moinul Road, Dhaka Cantonment',NULL,914,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/914/certification/uHIZSf4MjhjFERzuS6THmTfkynBIFDZq8Qnqzo2u.jpeg','Bangladesh','10',9,8,'01711544984','78','2003-03-03','rimtiazlabeeb@gmail.com',NULL,'1','1','1','+8801912324094','robaid3@gmail.com','Mohammad Obaidur Rahman Talukdar',NULL,NULL,'Business',NULL,'1',NULL,'@katbadam','Rahman',NULL,'01711544984','zakia@acc.edu.bd','Zakia Sultana',NULL,NULL,'English Teacher',59,56,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/914/student_photo/BO3WP1zeput7m8vBmes4X0BcZksAjnSRmKthglg8.jpeg',NULL,'1206','1',NULL,'United City, Satarkul, Dhaka','Sir John Wilson School','2019-11-27 06:43:18','09666 785 785','male',NULL,'Cantontment','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/914/marksheet_previous/1WngICQJYrxlCqnLAdfR3bdYbj4ZzdbVDqjR880O.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/914/marksheet_previous_two/lXaEQM9zNYAKklfqPxweO63PfoSYhvrgJbWcuwx4.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/914/marksheet_current/IBry1UpaEpYdm78lAo1IVQX2ZNVxE4ajOij5PbtN.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BM0944860','2021-12-27','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/914/student_passport/PF3yCMYaobZZTFFQ7ouMpH30jfW7AZKdtoNRyZm1.jpeg','Dhaka',2,'5505825629',6000000,2,'2803680541',914022,'Dhaka, Dhaka',1212,'Satarkul','Sabrina Shaheed','09666 785 785',NULL,2,'India for vacation and Saudi Arab for Omrah',1,NULL,'I have always wanted to travel around the globe to learn new cultures and share the culture of Bangladesh among others. I feel it is very important\r\nas a citizen of this country to represent Bangladesh to others. I wish to remove the stereotypes foreigners have about our country and bridge the\r\ngaps with whatever correct knowledge I have. At the same time I got inspired by my mother who is an US State Department Alumni. She participated in \"The Intensive English Language Program\" (IELP) 2015. On the other hand I have always dreamt of going to a US High School to try their education system and play American football.','I would like to share almost everything mentioned above. But if I am asked to share something specific, I would share the cuisine, clothing and language of Bangladesh. Bangladesh is known to have one of the most unique ways of cooking food. Our country is mainly based on rice and curry. It consists different types of herbs and spices that is not even known by the American people. I would share about our cuisine by making a few and also showing pictures of food cooked by my mother. I would take a few ready made mixed spices and just add them to rice or meat. And try my level best to express my culture\'s cuisine. On the other hand, I would be very interested to share the clothing sense of Bangladesh by displaying myself by wearing my cultural attire, for example, \"Punjabi\" and \"Lungi\". And last but not least, I would be proud to share my country\'s history and the story behind our flag. It will still keep the imprint of my country on the community even after I return.',1,'My Family Member',NULL,2,'2019-11-04','2019-11-02',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/914/school_seal/Dye1HGoSLmKDFZxSK83DY9I86v0yUwSbbx1dxJg3.jpeg'),
	(166,'Tasin',2,0,NULL,'Barishal, Barishal',NULL,19,'Few weeks ago,some of my friends and I arranged a meal for the stray animals.We raised fund and donated our money for this.We cooked food for them.We also fostered the animals living on the streets.I was the foster dad.I gave foster home to them.I fostered three cats.I raised them up and put them on adoption.We arranged a seminar and encouraged people to adopt animals.We discouraged them to buy animals.Because the stray dogs and cats can be the best companion for people.They are love able.I want a society without hungry and ill treated animals.Thus the society will become live able for all.We also gave food to the street children.',NULL,'6-A,Rafiq Palace,Masjid gate,Bm college road',NULL,919,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/919/certification/jY4vByM9kcpgifQnuiYY2A56CPwJUVU8T6IMqdP9.jpeg','Bangladesh','10',9,8,'+8801734015985','81','2004-11-14','tasinhasanpurno@gmail.com',NULL,'1','1','1','+8801712740525','hmsagar000@gmail.com','Hasan Mahmud',NULL,NULL,'Project Manager',NULL,'1',NULL,NULL,'Hasan',NULL,'+8801734015985','shpurbaa@gmail.com','Nazmin Nahar',NULL,NULL,'Unemployed',84,87,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/919/student_photo/I539H7vqoNGC7jPGmFOfJ1sNnZyZPVqybfZ1bksx.jpeg',NULL,'8200','1',NULL,'Sadar Road,Barishal-8200','Barishal Zilla School','2019-11-27 06:43:18','+88043164417','male',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/919/marksheet_previous/4JP1H7JutDSEM4TWW9Jaj9tIRrxLnGzCYNI3lT1z.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/919/marksheet_previous_two/KKFLfu92XXVW7q8mHIjFo1px3Y6oeAVdtXXyhfj8.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/919/marksheet_current/3phoa8sCYpvKsuuppGnNCtm5KF4x31GNfcoabAsb.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Barishal',2,'7792922069',420000,2,'5543172851',-1,'Barishal, Barishal',8200,'Kotwali','Bishwanath Saha','+88043164417',NULL,1,NULL,1,NULL,'By participating in the YES program, I will represent Bangladeshi culture around the world.Also,I will know about the culture of other people living in America.I want to make my second family in America.I will gain leadership qualities like honesty,Integrity,communicator & delegation.I will get to know about the education system in America.I will make friends throughout the world.I will know my power to get acquainted with new culture,new believe ,new education system,new people,new ambience and new family.I want to get more experience in life by being a part of the YES program.','I want to share Bangla language,the delicious cuisine and the gorgeous clothing of Bangladesh.I will give them books both written in Bangla and translated in English by famous writers of Bangla.I have great skills in cooking.I will cook them the famous Mustard seed Ilish,mashed potato and Pitha.Also,I will gift them to the finest hand loomed saree,Dhoti and embroidered quilt(Nakshi Kantha) of Bangladesh.I will teach them how to wear and use  them.',1,'Newspaper',NULL,2,'2019-10-31','2019-10-31',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/919/school_seal/SgDM3tAyNIrP70JSf96KGZbNA53dN3tnFx2c69EZ.jpeg'),
	(167,'Farhana Yasmin',2,0,NULL,'Dinajpur, Rangpur',NULL,19,'I am involved with an organization called \"AHC\" in our division. I work with the poor and deprived children. These children are all primary school going students from a particular slum. I help them financially. In addition, I give value education.',NULL,'Balubari Sadar, Dinajpur - 5200',NULL,921,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/921/certification/rT4y65es1YxENh0Hr2fyRszmP7DgnR7Nk0GGUJ02.jpeg','Bangladeshi','10',9,8,'+8801556318728','71','2003-10-26','farhanalabonno.bd@gmail.com',NULL,'1','1','1','01788269236','md.mosharafhossainchowdhury@gmail.com','Md. Mosharaf Hossain Chowdhury',NULL,NULL,'Engineer',NULL,'1',NULL,NULL,'Labonno',NULL,'01556318728','mst.sabinayeasmin01@gmail.com','Mst. Sabina Yasmin',NULL,NULL,'House wife',65,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/921/student_photo/vJYUWazZmFOLBzJDPoNbtodXWMl9A536cBjwYKja.jpeg',NULL,'5200','1',NULL,'Kosba Sadar, Dinajpur','St. Philip\'s High School & College','2019-11-27 06:43:18','053165460','female',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/921/marksheet_previous/SkR8QKcZlwZcKDzSuGMAQ42hamu8BnsholB3TOLQ.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/921/marksheet_previous_two/xXwiJJXzzgqL32UZRODmqmJxGCKq4Pib0Ql0VuS9.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/921/marksheet_current/w3iOM2j4Jz8Eo7OXlvjk43cvd3rIPZ0S6dpgmEbs.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dinajpur',2,'19672717769000006',300000,2,'8203188605',-1,'Dinajpur, Rangpur',5200,'Kotwali','Bro. Kajol Linus Costa, CSC','01726693633',NULL,1,NULL,1,NULL,'I want to apply for the YES program for various reasons. First of all, I want to represent my country. In addition, I want to know more about American culture and its society. I want to experience the American dream. I know American people are very hardworking, honest and punctual. I want to learn all these qualities from American people. Above all, I want to become a good human being using this experience.','Our people in Bangladesh are very hospitable and so I want to share the unique quality of hospitality with the American family. Our mother tongue, Bengali is the sweetest language on the planet. It has a musical quality. I want to teach my American family some of the typical greetings of my language. I can also cook some typical Bengali dishes like chicken curry, fish curry and many other dishes. Though they are a bit spicy, I hope my American family will like them.',1,'A YES Alumni Member',NULL,2,'2019-11-11','2019-11-05',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/921/school_seal/NPMRc1njONzKD88trRo43yoDVOG8eooqpzw62sed.jpeg'),
	(168,'Saba',2,0,NULL,'Gazipur, Dhaka',NULL,19,'Social Service is best service.',NULL,'C-104, South Chayabithi',NULL,932,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/932/certification/zfcWcPET5DQPLBOUYJdmXThRhR5WKt3Q0xz25ZDx.jpeg','Bangladesh','9',8,7,'+8801712079979','63','2005-05-21','abdussalamplabon@gmail.com',NULL,'1','1','1','+8801307214517','kohinoor5188@gmail.com','Shah Zaman Md. Sihab Uddin Pathan',NULL,NULL,'Engineer',NULL,'1',NULL,NULL,'Tasnuba',NULL,'+8801721288242','kohinoor5188@gmail.com','Kohinur Begum',NULL,NULL,'Housewife',78,67,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/932/student_photo/DDpeEWpxmBczl79tnuBDMH1kM9fugXWZlwE81W2Q.jpeg',NULL,'1700','1',NULL,'Joydebpur','Joydebpur Govt. Girls\' High School','2019-11-27 06:43:18','+8801715222129','female',NULL,'Gazipur Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/932/marksheet_previous/acvdxFmNfizl93mTCU0espvUzswefWzs8k0PuvHv.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/932/marksheet_previous_two/ZZLQz66JvDG2D6nLQpEhmxmjNSx8ZeohLz6Lcp4M.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/932/marksheet_current/cTZcf6bbIb20Lko83Fv37r4tRgGNOHJwdfg39Bw5.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Gazipur',2,'2395351097',600000,2,'9108874331',-1,'Gazipur, Dhaka',1700,'Gazipur Sadar','Hamidur Rahman','+8801715222129',NULL,1,NULL,1,NULL,'For better Education.','Mediation of both countries.',1,'My Family Member','Higher degrees are my special needs.',2,'2019-11-20','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/932/school_seal/AjoCzMHSXDUD4CS3DS9aCupUmGUsxXI0GMJi7FlM.jpeg'),
	(169,'Shafee Bin',1,0,NULL,'Dhaka, Dhaka',NULL,19,'Speaking of community services, I\'ve not much experience about this because there are not such many opportunities in here but I had some opportunities to perform in community services. Last year several floods hit the rural areas. So, as I am scout, I along with my other friends planned to help the flood affected people as much we can. We started to collect donations and gathered as much we can and went to the flood affected place. We tried our best to help them. Also some month earlier there was strikes for demanding safe transport system because of a truck driver, two of school students died. The truck driver was driving violently. There were several school strikes and I attended those as much i can.\r\nI didn\'t had much opportunities to attend in community services. But if got chance then I will definitely try my best to attend.',NULL,'74/1 Sharat Gupta Road, Narinda,Dhaka-1100, Bangladesh.',NULL,939,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/939/certification/2vnWYi0FUMRFPqhrTJ9AVtq8gkvH4JeqIGh1i6bq.jpeg','Bangladesh','9',8,7,'+8801768105491','52','2005-03-22','shafeeAD1510@gmail.com','https://www.facebook.com/','1','1','1','+8801716524970','adv.imran524970@gmail.com','Imran Bin Younus.',NULL,NULL,'Advocate',NULL,'1',NULL,'https://www.instagram.com/','Imran',NULL,'+8801704882063','shailasharmin04@gmail.com','Shaila Sharmin',NULL,NULL,'Housewife',80,71,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/939/student_photo/OhhYlF6FuDyk6jku4j5a5KLUHCddRP5WMqqkWD1O.jpeg',NULL,'1100','1',NULL,'82 Municipal Office Street,Dhaka-1100','St. Gregory\'s High School and College','2019-11-27 06:43:18','47113687','male',NULL,'Gandaria','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/939/marksheet_previous/w8IXxhYQmbo9HVP21Uprywg8vQyum30KRddiVYxB.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/939/marksheet_previous_two/hOviqjQuAd5Wo10wunoUgtDGgxw4iRbrpokaST5V.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/939/marksheet_current/fGFApV8mPyWgStsVrwEAsYWcWLxmDnVu2jstM0t8.jpeg',NULL,2,'15','For participating in the STEAM program.',NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'EB0706649','2024-08-19','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/939/student_passport/FbuwJJnxsW7oyHt58WttAKrTtwplV21fxaEDGTEA.jpeg','Dhaka',2,'955 930 0075',2400000,1,'461 862 9168',1560000,'Dhaka, Dhaka',1100,'Sutrapur','Bro.Prodip Placid Gomes CSC','+8801723653748','I have travelled in Washington DC. Virginia, Merryland, Pennsylvania and New York.',2,'Thailand for winter vacation, India for winter vacation and USA for the STEAM program.',1,NULL,'The main reason for applying for the YES program that I want to secure a good life for me. I want to study aboard after HSC and get settled over there and I think this program will help me a lot to fulfill my dream. Another reason is I want to know the whole world\'s education system, why the world is so developed than my country, how the children of the country are receiving education and doing such wonder. As this program offers to study in an academic school in USA so, it will be so much beneficial to me. To be honest I\'ve been to USA earlier this year. I took a training at George Mason University in Virginia and a full day tour at NASA The main thing I noticed that the schools of our country just give us the theoretical knowledge but the professors at the university, they were all giving us practical knowledge. So, i became very much interested in USA education system. Also I closely observed the culture of USA and i really enjoyed sharing my culture with them and knowing them.','As our Bangladeshi culture is very rich so there are very much to share. I can share my language aspects by singing Bengali songs to them or by trying to help them to understand Bengali. In our Bengali cuisine we have a rich collection of spices. If I get selected for the program then i can share cuisine aspects with them by telling them or by making Bengali foods. We, Bangladeshis are  traditional type people. We have very big collection of clothing. We choose cloths according to festivals.But most of the time boys wear panjabi and pajamas; girls were sarees. i can share this with them by wearing these clothes at USA and by encourage them to wear too. As I am a Muslim,so we have two Eids, many religious days and a full month of fasting.I can share this aspect by maintaining these over there.We have Bengali New Year, Kite festival.I can encourage them to celebrate these. We play cricket a lot but Amrecians play soccer, baseball. If i got selected then I can help them to play cricket.',1,'Facebook',NULL,2,'2019-11-21','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/939/school_seal/m8jHyIwjxvBUyLSRke0iBdgamq2YvxTwhwa1auLr.jpeg'),
	(170,'Anik',2,0,NULL,'Dhaka, Dhaka',NULL,19,'If I have the opportunity for being participating in Community that includes service towards welfare of the society. Includes development of the society. Care to the nature and beauty is our duty to preserve. It is also our moral duty to keep our environment clean. Love towards younger with honesty is also a part of community service. Shows respect towards elders also effects in community service. Preserve the historical things for feature generation is also moral duty. Community service also includes hygiene of society. Truth fullness is also helps society to development a clear mentality of each member of the community. Development is only can reflect in the society with the equality, brotherhood, prosperity with each other. Plantation is also highly required to preserve availability oxygen. Love towards pets and animals also needed to preserve community wealth. Every member of the community need to be disciplined in there work attitude time for healthy society.',NULL,'5/7, Lalmatia, Block-A , Dhanmondi , Dhaka.',NULL,940,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/940/certification/kCZOWu8JrfVGCB85oQU25PWEHQ2NTCIqQz8tTMXl.jpeg','Bangladesh','10',9,8,'01715896209','1','2003-10-25','anikhasan941@gmail.com',NULL,'1','1','1','01817520924',NULL,'Md.Hanif',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Hasan',NULL,'01715896209',NULL,'Mst. Shamima Akter',NULL,NULL,'Housewife',71,75,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/940/student_photo/eEH7SEU4pV3Ug5yt1BzAbVFohPQgfOt7MNcvqK56.jpeg',NULL,'1207','1',NULL,'House:34, Road:27(old),New 16, Dhanmondi.','Oxford International School','2019-11-27 06:43:18','9115392,9145587','male',NULL,'Muhammadpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/940/marksheet_previous/r46oqNUV0N0bmKo0JNX60RsPOBcfCpNFNdOkx1dr.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/940/marksheet_previous_two/gzKNIXmeXg97JicW1KN1EPj2yxRsiJXH1M9JnKpd.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/940/marksheet_current/TiYOLFe5tvxqorojik3rAbM3MzrI9F8VNfHhQTqk.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BN0688285','2022-03-15','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/940/student_passport/gu3hPuIb8wnMJeabByBzYV1owrRfkk3BkP4VgdpU.jpeg','Dhaka',2,'4181753106',840000,2,'4631773134',840000,'Dhaka, Dhaka',1207,'Muhammadpur','Naullage Shanthi Perera Padukka','9115392,9145587',NULL,2,'India',1,NULL,'I am Anik Hasan. I am a tenth-grader at Oxford International School. The reason behind why I conducted this \'YES\' examination is that this program will give me many experience and opportunities in life. I want to be a part of other cultures and in the same time share my own homeland cultures with others. Moreover, the opportunities that are provided by this program will be helpful for me. I really hope I will be lucky enough to be selected for this amazing program.','The official language is Bangla, also known as Bengali. It is the first language of more than 98 percent of the population. It is written in its own script, derived from that of Sanskrit. Some people in Bangladesh can also speak English. English has also had an influence on Bangla. During the many words of English origin such as \"tebil\" (table), \"tiffin\" (English meaning snack box) entered Bangla. In more recent time the ever-rising global nature of English has lead to words such as \"television\", \"telephone\", \"video\" and \"radio\" being adopted by Bangla. Bangladesh is a hierarchical society. People are respected because of their age and position. Older people are naturally viewed as wise and are granted respect. The majority of Bangladeshis are Muslim. However, most still very much mix this with pre-Islam folk traditions. Bangladeshis identify with the folk traditions of Bengali culture. Therefore these things I would like to share with the American family.',1,'A Friend',NULL,2,'2019-11-15','2019-11-13',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/940/school_seal/nlFsMMaafeLv7R4zy11PvkAJwmPrCaV3S62gnsQ5.jpeg'),
