ven though I live in a country other than Vin, it is definitely possible',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-02','2019-11-02',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/945/school_seal/YhOYmsLv4sI869vakUQew3SqoMKQE38QvPBjJwBI.jpeg'),
	(173,'JIHAD',2,0,NULL,'Narayanganj, Dhaka',NULL,19,'Social service is a great thing to all of us. If anyone get to know something, he/she should make others know about that thing. It is our social duty. I didn\'t get chance of something like this. But in which programs I have attended, I always told my friends about the incidents or something which were new to me. I want to know something to serve it to others properly. If I get a chance to participate in the YES program, I will be always ready to share what I learned in that. I would arrange discussion meeting in many schools and obviously in my school. I have also a plan to join the YES program activities when I come from USA. I want to learn something which would be used for the welfare of my country, my nation and my society. I can give the surety that I would do my best to serve my country with what I got and would get. I would inspire our youth to serve the country. At last, I want to say that I can bring a change.',NULL,'85/2 KHANPUR MAIN ROAD,NARAYANGANJ',NULL,946,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/946/certification/SxSeMaq0RSQVBRfs91DWIPlNCCg7EJ8qDnAbAm73.jpeg','Bangladeshi','9',8,7,'01814174263','77','2004-04-16','khandokerjihad89@gmail.com',NULL,'1','1','1','01921572667',NULL,'KHANDOKER KAMAL HOSSAIN',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'KHANDOKER',NULL,'01814174263',NULL,'AFRUJA JAHAN',NULL,NULL,'Housewife',83,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/946/student_photo/e20k8gYMLmE2NVNw8p8JlluXxrnPJ7gwG1XitqY4.jpeg',NULL,'1400','1',NULL,'47 K B SHAHA ROAD,AMLAPARA,NARAYANGANJ','NARAYANGANJ IDEAL SCHOOL','2019-11-27 06:43:18','01713-414183','male',NULL,'NARAYANGANJ SADAR','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/946/marksheet_previous/ZwCDXoGj5hg00dRIpJxPfaHRQcqGntCTIK5eeWPE.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/946/marksheet_previous_two/Mpptc1PwVLX9TkB0l6KvLMvS2QynXZDYgfgOcX9Z.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/946/marksheet_current/OaKuyyyFQfolUdwAahLNTYC65aL0cKmgkA9w789C.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Narayanganj',2,'4188437612',720000,2,'3288449741',-1,'Narayanganj, Dhaka',1400,'NARAYANGANJ SADAR','ANWAR HOSSAIN','01713-414183',NULL,1,NULL,1,NULL,'I always want to gain knowledge and experience something new.And YES program is the perfect platform for this.I want to apply for Yes program because I want to gain experience for my future.Besides it is a dream for me to go foreign and take study.I think it has a great importance to me.It will experience me something new and I love to do new things.Morever I want to gain new knowledge and it is essential for me.If I get the chance I wil surely work hard.Besides I am very happy to apply for such a useful program.I want to apply for the purpose because it will ensure me a bright future.Morever by it I can gain new knowledge.It\'s a dream to go U.S.A and study.I have realized the importance of the purpose and I sure that it will help me in future.The most important thing is that I will go U.S for study and it is a best way to ensure a successful career.I hope I will have the opportunity .Thus, I am thirsting for knowledge and my whole family have encouraged me to apply for the purpose.','The culture of a society means the way of living, eating habit, cultural functions, clothes, language, religion, values, policies, tradition etc. I think I can present it to the American family with whom I would live very sowbelly. I can present it to the family with my own sleight. I hope they would like it if it is set forth to them properly. We have our own cultural elements like the way of living, eating habit, clothes etc. I can share our sacrifices during Liberation War in 1971. Similarly, we have our own food habits like rice and fish. I can give them an account of tasting our own recipe. Besides, we have our own dresses like punjabi, saree and blouse. I can inform about our handmade dresses which are really comfortable and made with only yearn. In our country, the main religion is muslim. I can make them know about our Prophet Hazrat Muhammad (Sm). Over and above, there is a lot of things to share with them. Concededly, I will share my culture with them.',1,'A Friend',NULL,2,'2019-11-04','2019-11-02',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/946/school_seal/wLaxnpeG6Ge3RJVsiCnik5ad6SVLKMAQXSVrqlR2.jpeg'),
	(174,'Nusrat',2,0,NULL,'Habiganj, Sylhet',NULL,19,'If I have the opportunity, I\'ll bring a positive change in my community. Many people of Bangladesh are illiterate. I want to start a community service so that they can be literate. Most of the people of our country specially my regions are superstitious. I\'ll do meetings with these kinds of people and make them aware about the reality and I\'ll make them realize the scientific facts. By this I can remove early marriage, dowry, polygamy etc. I\'ll be able to make a huge change in the thinking of the people of my community. I\'ll do medical camps in many places where I\'ll ensure free medical treatment for the poor people. I\'ll make a team and clean our environment and also I\'ll make people conscious about environmental pollution. I want to work for the autistic children and make people conscious about them so that they will not be treated as a burden and no one will neglect them. I\'ll bring gender equality. I\'ll arrange various seminars to make the rural women self dependent.',NULL,'Garning Park R/A, Ward-03, Habiganj Sadar Habiganj, Sylhet.',NULL,947,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/947/certification/cXSboHoPdlx3Db2Nmq7KU5PSAAUjFprofnenunpd.jpeg','Bangladeshi','9',8,7,'+8801759008313','87','2004-01-04','nj.goni_444@yahoo.com',NULL,'1','1','1','+8801718604909','goniabdul430@gmail.com','Md. Abdul Goni',NULL,NULL,'Lawyer',NULL,'1',NULL,NULL,'Jahan',NULL,'+8801722103881','farhanagoni5@gmail.com','Farhana Goni',NULL,NULL,'Unemployed',80,89,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/947/student_photo/gdcCE4NbGUt77MHTUzSLafAKJkeTm1lNZEFcQKM5.jpeg',NULL,'3300','1',NULL,'College Road,Rajnagar,Habiganj Sadar,Habiganj,Sylhet.','Buds High School','2019-11-27 06:43:18','+8801920728661','female',NULL,'Habiganj','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/947/marksheet_previous/c5zM1SpJVxDBs1T00WZgJViBls1oCaGAY6b5HsMt.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/947/marksheet_previous_two/etrrUFTuAyxkfFsbPOBHUPAAf0naVGvjnWK2ZYFz.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/947/marksheet_current/Cl7mur7BgkjDAeHHOxkfg1D6Uc9yuaG9tkK89sXz.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BN0315953','2022-02-05','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/947/student_passport/ARzurIUigSYQAdJA8WdcIkYnEz4zQTTnI0qp3IqA.jpeg','Habiganj',2,'5535484728',150000,2,'5085459252',-1,'Habiganj, Sylhet',3300,'Habiganj','Md. Nuruddin Jahangir','+8801920728661',NULL,1,NULL,1,NULL,'Yes, I want to apply for the YES program.The reasons,want to do it are written below-I want to learn about the American people and their culture. I want to explore the historical places of USA and want to know about them. I want to learn about many things and after coming back to my country. I want to teach others about the USA. As a student of a developing country I want to compete with the students of America which is a developed country. By doing this, I want to adjust with the developed world. I want to learn many scientific facts practically. I want to introduce my country and its culture to the people of the USA. By YES program I\'ll gain leadership skills and after becoming an YES alumni, I can contribute to my society.','The aspects of Bangladeshi culture I want to share with my American family are given below: I can cook Bangladeshi food for my American family which indicates our culture and tradition. Our Bengali literature is enriched with many outstanding writings. The poets like Kazi Nazrul Islam, Jashim Uddin, Robindranath Tagore and so on are born in my country. I know a lot of their poems and their other writings. I can translate these and share my Bengali literature with my American family. By doing these, I can also share my Bengali language. Bangladesh is country of different festivals like Pohela Baishakh, Nobanna, Eid, Durgapuja etc. By exchanging these festivals I can enrich myself and give them pleasure. I can play the Bangladeshi traditional games with my American family like Kutkut, Gullachut, Bouchi etc. I am from Sylhet division of Bangladesh which is famous for traditional folk songs. I\'ll sing these songs and translate them as well. By this I\'ll share my culture.',1,'My High School/Teacher',NULL,2,'2019-11-03','2019-11-02',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/947/school_seal/fsMVopC2eC3iFJ1xtpIPlMOVlLfaXu0j8eCf8C3s.jpeg'),
