ication skills.','I wish to share my language and by this I will use my time to share words, so my American family is learning new language . I wish to share about my clothing and tell them about our festive occasion that the clothes are worn and the special food that we make in our culture on special day like Eid.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/953/school_seal/Ufa1r7SrNDNvD4vSn5IS1eEnu5UlmlKvTiyzHLuU.jpeg'),
