an family with my behaviour and lifestyle.',1,'My High School/Teacher',NULL,2,'2019-11-20','2019-11-16',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/956/school_seal/ne2x53FukLdBs9MGbYCoFY70tM6wLHg0bRocugcr.jpeg'),
	(178,'Asfiya',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have been quite involved in volunteering but the one project that stuck with me is the with ActionAid. One of their home for girls housed some of the brightest children. We took gifts,books and goody bags for them and spent quite a lot of time there; they had prepared performances for us! The warm goodbye and smiles of gratitude that we received still floats in front of me even though it has been quite long. I will not hesitate to grab another chance like that!',NULL,'Suvastu Ruchira,House-41, Flat-4C, Road 9A, Dhanmondi',NULL,957,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/957/certification/vjk0zqDuc6Xx8TKByqs8gLoOhYB0JSV4Ed9p3Ram.jpeg','Bangladesh','9',8,7,'+8801816493576','77','2004-02-22','amiarwa01@gmail.com',NULL,'1','1','1','+8801712723656','atik1971@gmail.com','Md Atikur Rahman',NULL,NULL,'Service',NULL,'1',NULL,NULL,'Arzu',NULL,'+8801711003402','rasheda_khatun@yahoo.com','Rasheda Khatun',NULL,NULL,'Service',78,87,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/957/student_photo/Hp6abhr7sUhRf5TMEXB2bgkt2fUJtTRh3WjLJm2p.jpeg',NULL,'1209','2','New York','Road#11A, House#95, Dhanmondi R/A','Siddiqui\'s International School','2019-11-27 06:43:18','+8801841-684684','female',NULL,'Dhanmondi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/957/marksheet_previous/iXghjOVkm0YYcCbpA3zVvGPaWc66J280PdKxhzCn.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/957/marksheet_previous_two/ArrVvWVxkjThj0RJk2VXa4sEeqst6rPsKehmUDwU.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/957/marksheet_current/vq3uhnYZlf4u8edUI5o1WvKw6VL2mnmJQi6XOi6a.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'6407529699',900000,2,'1457533972',2600000,'Dhaka, Dhaka',1209,'Dhanmondi','Nahid Arefa Siddiqui','+8801677534744',NULL,1,NULL,1,NULL,'I have always been a gallivanter. New places and people excite me. I have grown up in a land with an extensive history, each event unique in its own way. The YES program is a golden opportunity for me to let people know more about my country, to break misconceptions regarding a Muslim-major country and to create an identity for my self as a proud Bangladeshi girl.','3 million people sacrificed their lives to free our mother tongue Bangla. It was my bed time story:our liberation war, growing up. As I grew I read so much about it and it sends chills to my bones thinking about they had to go through. It would mean so much if I could let others know. \r\n\r\nBangladeshi cuisine is truly exquisite. We grow a wide array of spices in our country varying in color and taste.We as Bangladeshis, not only love to eat but love to feed as well. Seeing that smile appear on one\'s face makes all the kitchen hours worth it. It will be the first thing that I would introduce my host family to (it\'s probably going to be either narus or laddoos or any other food I am allowed to carry).\r\n\r\nFood brings us to our next aspect of our culture:the festivals. With so many people of different religion, you will always find a festival around the corner. Eid is celebrated with the same passion and so is Pujas, Christmases and Buddha Purnimas. I would love to share the stories about them.',1,'A YES Alumni Member',NULL,2,'2019-11-19','2019-11-17',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/957/school_seal/GwfYEgYHu3B9ooMYTTLZkwNKoKyWbDYMltZyTZav.jpeg'),
	(179,'MOHAMMOD MINHAJ AHMED',2,0,NULL,'Sylhet, Sylhet',NULL,19,'A very dear topic that takes a role in the volunteering / social services act I enact is based on Education. This roots to me from seeing the lack of availability of Education due to scarcity in a lot of my family members, and also the constant effort my parents have made to put me through a system of Education. This has led me on many occasions to embark on sessions and events where in my free time I would volunteer to teach and educate the youth in my village, community, and just share a sense of inspiration by the means of me speaking about my educational results. whenever there is local volunteering opportunities wherever I could help, be at feeding the orphans at an orphanage, lending a hand in my home town, providing advice/teaching on education, or simply just smiling and asking someone about their feelings and day, Im always more than delighted to be doing these things.',NULL,'house-16/A;road-28;block-D;Shahjalal Uposhahar,Sylhet',NULL,960,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/960/certification/W4T1Uc7jKqBMf4AN2ieZENDk3TR5QQ0k2eYsUyDA.jpeg','Bangladesh','10',9,8,'01723917701','85','2003-08-24','aminhaj97@gmail.com','https://facebook.com/ahmminhaj.chowdhury','1','1','1','01716022148','moshudahmed1965@gmail.com','MOSHUD AHMED CHOWDHURY',NULL,NULL,'physician',NULL,'1',NULL,NULL,'CHOWDHURY',NULL,'01723917701','jutsna1977@gmail.com','MUSAMMAT JUTHSNA BEGUM CHOWDHURY',NULL,NULL,'Unemployed',80,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/960/student_photo/STGvhcMNG8aAbUJkmlCTHS9o9Ai1QcCcjxlVAdnM.jpeg',NULL,'3100','2','Newark','Kalighat,Sylhet','Sylhet Government Pilot High School,Sylhet','2019-11-27 06:43:18','01711449576','male',NULL,'kotwali thana','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/960/marksheet_previous/tsbaagKsazi7CTUkUxr14L30VwKIWdvFmWNBdoyi.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/960/marksheet_previous_two/My7MRWlkiBqUDHCv3LoGc1e1ySLt2v5nToMUbahX.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/960/marksheet_current/nBGNfENZ0S4gvNtCN2bj7eIGMSs0ylqsXCNzUp2a.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BX0982630','2023-11-21','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/960/student_passport/CjhdMV23ITGaaKWNNXkE9Eg7fDuqMI3JPNpb33NE.jpeg','Sylhet',2,'9119415765965',600000,2,'9119415765967',-1,'Sylhet, Sylhet',3100,'Kotwali thana','Md. Kobir Khan','01711449576',NULL,1,NULL,1,NULL,'Ive always wanted and its core in my heart is the ability to see beyond the stretch of my current environment.Being able to interact and see more human beings outside the vicinity of Bangladesh.I was once taught that we are based off the books we read and the people we meet and that feeling constantly resonates in me, being able to read books is great,but to meet people would add a dimension of exceptional life experience allowing me to grow as an individual.Also with the love of my country and other countries and their people, Id be a humbling opportunity for me to be able to exchange emotions,culture,interactions and experiences with people if the YES program would allow me to do so.I not only would this be an individual venture if I were to be accepted in the program, but a collective one. Id not only enjoy the learnings by my self,rather I would provide what learnings and experience I have via interaction with my family in US and bring back it to share with the people of Bangla!','A great deal of appreciation for Bengali Food was enamored in me naturally growing up. I always enjoyed eating delicious ethnic food. For someone who grew up not in the best financial state, it made me feel rich and proud that I got to eat such rich and enticing foods. The food was not only heightened within my emotions just by food, but the love and culture that went into it, the process, the getting together, and the aftermath. Ive read in books what is considered soul food in western societies, but this is something Id definitely love to share as it fed my spirit.',1,'My Family Member',NULL,2,'2019-11-11','2019-11-09',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/960/school_seal/Skl1Ul1gwuTLqOFZCXEW1AMIzYa0xzxN2jIE14rc.jpeg'),
	(180,'ORTHEE JAHAN',2,0,NULL,'Dhaka, Dhaka',NULL,19,'NO, I HAVE NEVER WORKED IN ANY COMMUNITY SERVICE. BUT SOME OF MY AREAS POOR PEOPLE WHO SUFFER FROM BASIC EDUCATION AND FOR THIS THEY SUFFER FROM MANY PROBLEM. SO, SOMETIMES I GO THERE AND I TEACH THEM HOW TO BE SAFE FROM GERMS.',NULL,'HOUSE # 56, ROAD # 03, SECTOR # 05',NULL,963,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/963/certification/55d0sazNCqxuvJWiIoCPIUy5z6VzAdyk6ajecU4K.jpeg','BANGLADESHI','8',7,6,'+8801710930949','80','2005-01-16','ns.ortheesami@gmail.com','NA','1','1','1','+8801715317288',NULL,'MD. SHAHJALAL',NULL,NULL,'BUSINESS',NULL,'1',NULL,'NA','OISHI',NULL,'+8801710930949',NULL,'KOHINUR AKTAR',NULL,NULL,'HOUSEWIFE',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/963/student_photo/A3Pz5Y1DMYYknaOCIuV3N0fot3snnfhMn0vltHpX.jpeg',NULL,'1230','1',NULL,'HOUSE # 35, ROAD # 06, SECTOR # 13','SKY TOUCH SCHOOL-STS','2019-11-27 06:43:18','+8801763498333','female',NULL,'UTTARA','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/963/marksheet_previous/BGtPFXEwdBt2O0A37i2knsIukLmh5ep0XcJiAdYp.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/963/marksheet_previous_two/6UXQdUXH7tKF8xeJWEc7gg49IkQoDNofdXhH3pjk.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/963/marksheet_current/V5c7pmlHIdEB9wfYBoVNpgLIDuC3SHFeW8mDpYBV.jpeg','NA',1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BH0217448','2020-08-10','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/963/student_passport/HsSuagH0YaK1umgXI7eVM9raZRBcstvwWg3OzApM.jpeg','DHAKA',2,'9127007517',2000000,2,'19846710424000059',-1,'Dhaka, Dhaka',1230,'UTTARA','MUNSHI MD. HARUN-AR-RASHID','+880196034875',NULL,2,'UAE FOR MEETING RELATIVE',1,NULL,'I WANT TO APPLY FOR YES PROGRAM, BECAUSE I LOVE AMERICA, IT WAS MY DREAM TO STUDY HIGHER