	(181,'Sharmila Mustari',2,0,NULL,'Madaripur, Dhaka',NULL,19,'I haven\'t done any social work yet.But if I would get any opportunity,I want to establish old age home.We see that many of our grandparents stay in old age home.Their children don\'t take care of them in their old age.I always feel for them.Because,I haven\'t seen my grandparents as they expired before my birth.Mother Teresa said \"love begins at home\"That\'s the reason.',NULL,'Kalkini',NULL,965,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/965/certification/i2wG1W2JezBM8wrFWjrnIo2zERAZmzGsWfFk85m5.jpeg','Bangladesh','10',9,8,'01720970810','93','2004-04-04','sharmilamustarinandita@gmail.com',NULL,'1','1','1','01777369737',NULL,'Md. Mogbool Ahmed',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Nandita',NULL,'01720970810',NULL,'Maslina Akter',NULL,NULL,'Unemployed',91,95,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/965/student_photo/ylGNshdj1w4bIBGkajBCizb3IipCLbc1ekMkzgyX.jpeg',NULL,'7920','1',NULL,'Rajdi','Kalkini Syed Abul Hossain Academy','2019-11-27 06:43:18','01718923291','female',NULL,'Kalkini','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/965/marksheet_previous/5KSm51fafk2Y9GmkXm1OS0DKsppcsPBfkBCGKJzE.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/965/marksheet_previous_two/BMknuMHoHuqcTffzbdpBOyZWzzUoPrPihtWECdGP.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/965/marksheet_current/ADpgKlcRsgNHUXLb4XYXtnCeZfg4DqHOGpG1kUvz.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Barishal',2,'0613223451079',250000,2,'0613223451087',-1,'Madaripur, Dhaka',7920,'Kalkini','B.M Hemayet Hossain','01712542880',NULL,1,NULL,1,NULL,'Actually,I always wanted to visit the U.S.A.One of my neighbors applied for Yes program.When she returned,she told me about culture and atmosphere of U.S.A.In short,I want to learn the cultural and atmospheric diversity.','Obviously first comes my language.Religion has a commanding place in our way of life.So I would like to share my religious background.I love eating.I would like to know their cuisine and share mine.If I would get any chance I will tell them what I used to wear in festival and what I used to eat.To represent my culture and country through my visit as a whole.',1,'My High School/Teacher',NULL,2,'2019-11-17','2019-11-17',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/965/school_seal/Dwv1NsgWjOu5kXs1l8GjIUMG8KWuT522N0R9eESC.jpeg'),
	(182,'Samir Rahman',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have been doing community service for the last two years and it is very helpful program for the poor people of my country.\r\nIt is a amazing social work. Last winter we donated 200 blankets to the poor people.',NULL,'8/9,block-c,lalmatia,Dhaka',NULL,974,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/974/certification/tA0dHi76VUsC4I4r59AN0PfeIpm6W3rrWAyiBeSV.jpeg','Bangladesh','8',7,6,'+8801704975902','85','2005-02-01','samirsamrat256@gmail.com',NULL,'1','1','1','+8801715105680','mohammadrahman256@gmail.com','Mohammad Saidur Rahman',NULL,NULL,'Businessman',NULL,'1',NULL,'@samrat.66','Samrat',NULL,'+8801704975902','evana2643@gmail.com','Jasmin Ara Ratna',NULL,NULL,'Unemployed',85,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/974/student_photo/M5NKQdQAdsLwmFP1G7F7FiIqzPrnmKCINqxjSseI.jpeg',NULL,'1207','1',NULL,'H-34,road-27,dhanmondi,dhaka','Oxford International School','2019-11-27 06:43:18','+88029115392','male',NULL,'Mohammadpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/974/marksheet_previous/dOkkVfXZkwxs4BYoWVO5D8FBW6BVMc1PsNCihtm4.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/974/marksheet_previous_two/rikLljNT22C0csemqkpOTtEXiLUEaaMxT0Kv1Xr4.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/974/marksheet_current/zENbxH6wdmmru7tP5s0eFg0ldILTyPgClrL1FfPL.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BW0774626','2023-08-10','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/974/student_passport/D50kdePazIXTEA1bJhMaqPItfb0IDmTVbVyRQZ0j.jpeg','Dhaka',2,'2694814909435',2000000,2,'2694814909434',-1,'Dhaka, Dhaka',1209,'Dhanmondi','Dr.N Shanthi Perera','+88029145587',NULL,2,'India for summer vacation,Thailand for summer vacation and Saudi Arabia for summer vacation',1,NULL,'I can meet young friends from different countries. I can also spend time with them. I can exchange my cultural activities with foreign students.','Bangladeshi culture is very colourful. The language of Bangladesh is bangla. I can share my culture with the foreign students. Bangladeshi cuisine is very tasty and the clothes Bangladeshi people wear are wonderful and colourful. People in Bangladesh follow Muslim religion mostly.',1,'A Friend',NULL,2,'2019-11-13','2019-11-13',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/974/school_seal/XeYuarqNr6Qvj3M4EQKMMkXTWzloJwAIb7fRAPLG.jpeg'),
	(183,'TA-SEEN TABSHIR',2,0,NULL,'Dhaka, Dhaka',NULL,19,'There are many ways I could bring a positive  change through community service. \r\n1. Collect Food\r\nContact my  local food bank and they will provide with the necessary information and materials to have a food drive. Encourage people to donate their favorite food items. I can even offer prizes to individuals who donate the most!\r\n2. I could start a Recycling Program\r\n3. Blood drive\r\nEvery two seconds, someone  needs blood. By hosting a blood drive, I can make a real difference. The American Red Cross provides planning assistance, equipment, supplies, and a trained staff to screen and collect donations safely.\r\n4. Give New Coats to Kids in Need\r\nStarting an Operation Warm coat program for my local low-income school is a great way to serve my community. Select the school, set my fundraising goal, and hand out new coats myself helping local children stay warm.\r\n5. Tree plantation\r\nI would plant trees, as it is a solution to a lots of vital problems in the world now (i.e:global warming)',NULL,'M/12,NOORJAHAN ROAD',NULL,975,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/975/certification/48SXocK9D63NtcvIFRgMsR13kptm518TXFbloovM.jpeg','BANGLADESHI','11',10,9,'01919090230','82','2003-05-11','taseentabshir3@gmail.com','https://m.facebook.com/taseentabshir2003?ref=bookmarks','1','1','1','01919090230','gsarfaraz68@gmail.com','GIASUDDIN SARFARZ',NULL,NULL,'SERVICE IN BIMAN (BFCC)',NULL,'1',NULL,'https://www.instagram.com/taseen.tabshir/','TABSHIR',NULL,'01978405804',NULL,'JANIFER RIFFAT ARA',NULL,NULL,'HOUSE WIFE',73,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/975/student_photo/nccPrRUWtADFYNmzLytLq8PmUlwiFQ5dlnx08zUH.jpeg',NULL,'1207','2','VIRGINIA','97 ASAD AVE,DHAKA','SAINT JOSEPH HIGHER SECONDARY SCHOOL','2019-11-27 06:43:18','029112917','male',NULL,'MOHAMMADPUR','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/975/marksheet_previous/SiSongptFUDdPWBlFCUYi7cPi26HKlQyCg8mONVS.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/975/marksheet_previous_two/yjHSD3qdp6idn9QOz7X8ON7SOrLPcYYEklBggGyr.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/975/marksheet_current/YrRhUKYq33lW2JgKKrMWyxoepARFIMhXWczAgA8G.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BC 0643064','2019-11-15','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/975/student_passport/d6alqh1h894LHKWL16qfJzePBVarhnP1ZcLoK7PA.jpeg','DHAKA,BANGLADESH',2,'1481990032',800000,2,'5531986106',-1,'Dhaka, Dhaka',1207,'MOHAMMADPUR','BRO.CSE ROBI PURIFICATION','+88029112917',NULL,1,NULL,1,NULL,'Since I was young, I always wanted to know and learn the US culture for a long time. This opportunity will help me fulfill my goal. Again,there are more purposes for applying for it. These are:\r\nFirstly, It will help me study in a new education system(US\r\nEDUCATION SYSTEM) which will help me get a new and different experience.\r\n\r\nSecondly, It will help me to represent myself and my country, including its culture over there, which will increase my country\'s recognition.\r\n\r\nThirdly,  I will be able to study about the US culture by learning through the education system.\r\n\r\nFourthly, US culture have been an attraction throughout the whole world, as it helps in adaptation of globalisation for its rich tradition, behaviour and many more things. Hence, I will be able adopt the rich culture which will help me in present and future.\r\n\r\nLastly, If I get an opportunity of scholarship through this, I will be able to meet many participants  of the other country and learn about them.','Our language Bangla dates from well before the birth of Christ. Most peoples are lived in village and houses are made of dried Mud, bamboo or corrugated tin and having minimal furniture. Women construct hearths in their courtyard. 75% work force are involved in agriculture. Flood and cyclone is a regular phenomenon. Most women give birth in their natal household, rather than going to hospital. Age dictates how people will be addressed or treated.It is customary used to open gift in private.It is not acceptable to start eating before senior starts.We have a proverb that\"Whatever the religion is,festival is for everyone\".We celebrate all religious festivals regardless religion,colour,caste and creed.We are giving emphasis on women education and empowerment.And manymore\r\n\r\nI will present the above things by picture,videos and telling stories to the American family.Try some of the etiquettes with them for them to practically visualize our culture.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/975/school_seal/4NN6gnEHooVb6bvA6T9KLpZK6qkpic0XU7b2JfzJ.jpeg'),
	(184,'Marian Ritu',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I am a member of the youth group of our church.Through church we have done various programs of social service in which i have participated.Every year in winter we arrange a programme to distribute warm clothes to the poor people who lives in the street.we collect clothes from people\'s house and distribute to the poor people.we have done a programme to clean our area.if i get a chance through YES I would like to arrange a programme on road safety and also on road cleaning.',NULL,'43/5 Senpara Porbota Mirpur-10',NULL,978,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/978/certification/VsPBSxABKEH2h6XPqzF3MUQFeoK18GyW5lEGrQlX.jpeg','Bangladeshi','11',10,9,'01648955177','70','2002-11-20','maryanfalia@gmail.com',NULL,'1','1','2','01712016065','rahulrjph@yahoo.com','Robi D Falia',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Falia',NULL,'01759059283','provatifalia@yahoo.com','Provati Falia',NULL,NULL,'service holder',65,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/978/student_photo/7U0Tm9Ljnpvy1UNBcqEhZ5WhfQ9R7hWBYZJirj0S.jpeg',NULL,'1216','2','Michigan','Mirpur 1','Dhaka Adventist pre seminary and school','2019-11-27 06:43:18','01992710250','female',NULL,'mirpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/978/marksheet_previous/BiJFSPj25kXvnZnmSyGeZJBLt4UAK2BWjWPREjhe.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/978/marksheet_previous_two/l5ppdQQBpAbN92ux7pTTjnzxhO7ufSfClnxhkOlz.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/978/marksheet_current/hOKmov8H6RG5V9LAbHe8pvmbCKGR0s6U35p20pDK.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'3705400251',2000000,2,'4605402132',360000,'Dhaka, Dhaka',1216,'mirpur','Mr.Anupam Ritchil','88029028236',NULL,1,NULL,2,'My older brother','Well,I want to earn the experience of living in another country with different cultured people and also  want to represent my country to them.I want to learn the American standard of life.','Bangladesh is a country full of natural beauty assets.It is an developing country.But it is sad that more than half of the population of the world doesn\'t know about our country.Bangladeshi culture is way different than other country\'s culture.i want to share out family values and traditions with my American family.',1,'My Family Member',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/978/school_seal/WYp4VALMnZyC7aYhgbFQUNRZJwGRi54JHjOaJlTb.jpeg'),
