	(187,'Nishat Yeasmin',2,0,NULL,'Moulvibazar, Sylhet',NULL,19,'If I have the opportunity of community service, I will remove the illiteracy problem from our country and I will also try to remove, the crime from our country. The uneducated people can not learn more for the cause of money and many other things. They have no knowledge about crime, health, environment etc. That\'s why their children joined different kinds of crime. The uneducated people suffer from many diseases because they have no knowledge about crime, health, environment and many other things. So, by getting the opportunity of community service, I will open a school for uneducated and the culprits people and teach them about the basic rules of crime, health, environment without getting any fees.',NULL,'Uttar Uttarsur, Sreemangal, Moulvibazar, Bangladesh',NULL,984,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/984/certification/dPDgBdBmj6LevMcuc4bUEn3UpzlrRtYigA7OmyOJ.jpeg','Bangladeshi','10',9,8,'+8801744847902','76','2004-09-21','nishatyeasminbushra@gmail.com','N/A','1','1','1','+8801728548784','uddinikram371@gmail.com','Md. Ikram Uddin',NULL,NULL,'Imam',NULL,'1',NULL,NULL,'Bushra',NULL,'+8801744847902','sabitunnesa3@gmail.com','Mst. Sabitun Nesa',NULL,NULL,'Unemployed',79,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/984/student_photo/dnRYZkdbogLRtAPQRt1uQRmSErIgZaC0f6nz4rGV.jpeg',NULL,'3210','1',NULL,'Moulvibazar Road, Sreemangal, Moulvibazar','Sreemangal Govt. Girls High School','2019-11-27 06:43:18','+88062671217','female',NULL,'Sreemangal','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/984/marksheet_previous/i3Ht1rfzDVsvzQrI8vjUf1DELVwrlciefcqTvOeP.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/984/marksheet_previous_two/EDvR8A14f4lq2OxCyLB7L8t91KI3h4Yj1WIMi69a.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/984/marksheet_current/nacOpKwrw8YzjPf1FkGK5ROoq0eiR5fHWjhrRWgH.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Moulvibazar',2,'5818385126591',60000,2,'5818385126592',-1,'Moulvibazar, Sylhet',3210,'Sreemangal','Sudangshu Ranjan Debnath','+88062671217',NULL,1,NULL,1,NULL,'I want to apply for the Yes programme because of Globalization. Globalization means the free movement of goods, service, people and information across the national borders. The process of globalization will make our world a better place of live in. I am very interested to know about different culture of different countries. That\'s why I want to apply for the Yes programme.','I wish to share with my American family about the clothtings of Bangladeshi culture. The clothes of Bangladesh is different from American cloth. The Bangladeshi women mainly wear shari, girls mainly wear salowar-kamiz and the man wear shirt-pent, lungi-panjabi. These clothes are different from American clothes. These clothes are not common for American clothes. So, I say the people of America, about the different and beautiful clothes of Bangladeshi culture.',1,'My Family Member',NULL,2,'2019-11-06','2019-11-06',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/984/school_seal/nKgPUDWioJ3aXolljvw0i9jtZIQEByOFKa9jTo3z.jpeg'),
	(188,'Tasmim Kabir',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Community services have always inclined me . \r\n\r\nIn this view, I try to take part in various club and volunteering programs. I had been a member of the scout group of my school . But because of some medical issues I couldn\'t go on with scouting. So now I am trying to participate in community services through my school clubs. I am the Treasurer of the Green Club of my school. We take part in tree plantation programs in the neighborhood places of our school. We also held cleaning programs as much as we can. Now our club is planning to do something besides environmental programs. It is my wish to raise public awareness regarding over usage of mobile phone and drug addiction. Because at present, these r two alarming problems in our society.\r\n\r\nThrough these programs, I am trying to serve the society I am living in. Because as a member of my society , even I have some duties to it and I really find peace and respect in performing them.',NULL,'64/5/A Rashid Mansion , Darus Salam Mosjid road, Section-2, Mirpur, Darussalam,',NULL,985,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/985/certification/MR9LQDLOskROcvJYfRGR9VCAJN6Zze4jm5RWm1xZ.jpeg','Bangladeshi','10',9,8,'+8801756738478','75','2004-04-12','kabirmahim54@gmail.com',NULL,'1','1','1','+8801716919404','kabir.nesu@gmail.com','Md. Humayun Kabir',NULL,NULL,'Service-holder',NULL,'1',NULL,NULL,'Mahim',NULL,'+8801675213957','akterrokhsana47@gmail.com','Rokhsana Akter',NULL,NULL,'Service-holder',77,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/985/student_photo/6TjVEKr877IKEoaniIIaKXjA7Se7htSy368OrQQs.jpeg',NULL,'1216','2','Texas','Gaznabi Road, College Gate, Mohammadpur, Dhaka-1207','Govt. Mohammadpur Model School & College','2019-11-27 06:43:18','+8801769111190','male',NULL,'Darussalam','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/985/marksheet_previous/EcVYjX35Y8m6345PZAkJxKnrn98tfdFlbcrUbIue.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/985/marksheet_previous_two/1hwOPxZlBC11kuFvLpTVc0eZvTAZytdIZlcPPil2.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/985/marksheet_current/JUpgoQgRaUZKtPbTGc8vsD44GqGAPJW4fTa3eLP5.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BY0629419','2024-01-21','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/985/student_passport/KDQMNuvSonG4aWoQm153cULXqSMwwD8e6yiN6rbb.jpeg','Dhaka',2,'7334722787',480000,2,'3707195552',360000,'Dhaka, Dhaka',1207,'Mohammadpur','Lt Col Kazi Sharif Uddin','+8801769111190',NULL,2,'I have visited Nepal for a study tour.',1,NULL,'I have always heard that counties like the USA are developed because of their  different kind of views & perspectives. Therefore, it has always  been my cherished wish to know about the lifestyle, mentality of the other countries of the world that why they r different from us, why they are so respect and developed. On the other hand, with the will of representing my country, I want to show the world that even we have appreciative cultures and ethnics so that the world may have a right & good idea about our country, about our race. Moreover I would surely like to experience the education system of a developed country like the USA for  my being greatly curious about it. If I get selected for this program, this would be a dream come true for a middle class boy like me whose parents could never bear his foreign education expenses or give him the chance to represent his country cultures to the world and explore theirs through such great experience that KL YES program is providing.','Despite being an small country, Bangladesh is enriched with various traditions and cultures. I would like to share some prime aspects among them with my American family that behold unique significance. To be specific, I would like to share our appetizing cuisine, our clothing , views , lifestyle, history, language etc. In a word, I would like to give them an idea about my Bangladesh and it\'s people.\r\n\r\nThen the question arises that how would I do that. I would  bring some traditional clothes of Bangladesh like Punjabi or Saree to give them an idea about those. I would like to taste them some traditional foods of our country. I would try to teach them our very sweet mother tongue and tell them the story of the martyrs who fought for it. I also have an desire of making a video documentary on Bengali New Year & display it to them.\r\n\r\nAs I love and follow the traditions of my country, through me or my way of living, I wish to give them an idea about the traditional aspects of my country.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/985/school_seal/m1dRgBtdhnscFvF59oPnUEfp4ewJQt1xZovXwhl9.jpeg'),
