	(192,'Md.Istiak Kadir Tasfiq',2,0,NULL,'Rajshahi, Rajshahi',NULL,19,'Actually I had this opportunity several times through the English access like I have done tree plantation twice,distributing eftar,distributing goats twice,awaring people about the effects of dengue.I had the opportunities but as they say there is no end of good so if again get the opportunity I would make sure that I could change the society to be a better place to live.',NULL,'Tarrokhadia Rajshai Bangladesh',NULL,997,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/997/certification/h3sYZ6JzOoLqENoqGXwjbiLZEjAIBkUu3lxw59E6.jpeg','Bangladesh','10',9,8,'01705109982','81','2004-11-06','mdliakatkadir@gmail.com','Alex T Asfiq','1','1','1','01718822970','mdliakatkadir@gmail.com','Md.Liakat kadir Kumkum',NULL,NULL,'Teacher',NULL,'1',NULL,'tasfiq_6958_ace','Kadir',NULL,'01705109982',NULL,'Mst.Tohmina Khatun',NULL,NULL,'Housewife',76,74,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/997/student_photo/3DsgBPbDrVctF8OlVQxkc1amX7oO4giCaFTeYdJZ.jpeg',NULL,'6202','1',NULL,'Zinnanogor, Rajshai Bangladesh','Rajshahi Cantonment Board School &College','2019-11-27 06:43:19','0721761037','male',NULL,'Rajpara','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/997/marksheet_previous/jCxKCYwSlJWw4vIYXiIqlI6x5IpymsaIlCS22lRS.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/997/marksheet_previous_two/2XmFxt53e7s2Pwz2QTEij51h1aJOdmG7IpGXNFTv.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/997/marksheet_current/w3crWtVW4dqP1ZdWhKbPjiSmxc6j2SBoiVIV8mkq.jpeg','Md.Istiak Kadir',1,NULL,NULL,NULL,NULL,'2019-11-30 17:18:08',NULL,1,1,NULL,NULL,'BK0436545','2021-03-12','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/997/student_passport/JV7cM5rBKCekB65vTxkKzpCxtHNwroeGEljrworC.jpeg','Rajshahi',2,'2386125138',30000,2,'6435954471',-1,'Rajshahi, Rajshahi',6202,'Rajpara','Mahfoza Nasrin','01732450447',NULL,2,'India for my winter vacation in 2016 to visit my relatives',1,NULL,'First of all I am really interested to know to discover the outer world and thiss maybe the best way. Also since my childhood I had a soft corner for the subject English so I really want to do something in that field and by going to America I will be surrounded by all the people talking the languge as listening is important fact it will help to reach my goal.Also as we know America is one of the most well developed country and by staying there it will help to know about their daily affairs and how did the achieve it so I could use it in my practical life.Actually one of the main reasons is I am really curious to know to learn to gain and the main fact and my intention is to represent my country to show the world we are not worthless we are also something to be hold up to respect and this program is the best way to do this because you have created such an excellent environment which is really amazing and will also help me live in this age o science.And I want to show who I am.','Actually America is now a role model of all the county because they are really developed in all sectors.And on the other hand we are a developing country so we can take many anote from them but still like they say help may even come from the smallest one so we can also give them new ideas we can also show our rich culture. We can share them about our liberation war that how hard working and brave nation we are we can show them hard work can bring anything like we achieved our nationality in just 9 months.Also we can teach them unity is strength  as we can share how we celebrate our new year as a nation forgetting all the deference and also we can share our culture with them through art and also we can also share our poems with them like the writings of Rabindronath tagore,Kazi nazrul islam any many more mostly I can aware them about our culture by expressing myself as I am son of this soil.So I can easily share my culture by poems,art,history,expressions.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/997/school_seal/myi4X7zRyO6CHlxlSV6z4j6LLqJbtELViWcbnFwF.jpeg'),
	(193,'Mahatab Ahmed',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I had experienced a few community services, where my friend\'s and I helped poor people. One day my friend\'s and I  were walking along the street and we saw that poor people were shivering due to cold in the harsh winter, so we felt bad for them.So we decided to help them,so that\'s why we went around our neighborhood asking for old or tight winter clothing and collected all the clothing we could and donated it to the poor people. They were really happy and after seeing smile\'s on their faces, we felt really good.\r\n\r\nAnother community service that my friends and I did was plant trees. In the cities there were a huge lack of trees, due to mass constructions. So my friend\'s and I planted trees around our school and organised a campaign, and  told people what is the importance of a tree and why we shouldn\'t cut trees, and what would happen in the future without trees.',NULL,'House:12, Road:8, Pallabi, Mirpur, Dhaka-1216',NULL,1001,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1001/certification/46KlWVW412ZyuaK5M4CwIUgktzRPTCOd6HzSmQZJ.jpeg','Bangladeshi','8',7,6,'+8801818665299','85','2005-05-29','mahatabyash33@gmail.com',NULL,'1','1','1','+8801714399009','imtiazjabed@gmail.com','Md. Imtiaz Ahmed',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Yash',NULL,'+8801818665299','mini.jabed@gmail.com','Mst. Shamsunnahar Begum',NULL,NULL,'Unemployed',94,84,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1001/student_photo/wZfhCduLBDUD7LzXwD4E4tyd9Og7ZdPA1Rj6kwU9.jpeg',NULL,'1216','1',NULL,'House:7, Road:8, Pallabi, Mirpur, Dhaka-1216','Juvenile English Medium School','2019-11-27 06:43:19','9039020 (landline)','male',NULL,'Pallabi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1001/marksheet_previous/myWF7yazudEYVzdisds8PiGS8nSlcNFOpW8Ds90C.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1001/marksheet_previous_two/vBQyLa3XzXhuK7FkisPynsvdIDKUuBviIY3Hz0HL.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1001/marksheet_current/Yvxzx5jaRAP97TL0RXCGuBtM1H1WtLgGjpgI15lE.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Cumilla',2,'19711913651910485',600000,2,'1913651001072',-1,'Dhaka, Dhaka',1216,'Pallabi','Mini Musharrat Sayeed','+8801711635906',NULL,1,NULL,1,NULL,'I want to apply for the YES program because It is a lifetime opportunity for me. I can learn a lot of things, and I want to experience a new lifestyle, leaving behind my regular and boring lifestyle. I want to make new friends, and travel around America, and the most important \r\nthing, I want to discover myself while gaining a better understanding of a culture I am not familiar with and I want to test my abilities to adapt to diverse situation.','I wish to share the aspect of Iconic Bangladeshi cuisine, by cooking my favorite foods that I love to have in Bangladesh. Like the Famous Fish Dish called \"Hilsa Curry\", the Infamous Kachchi Biryani is a Special Bangladeshi Food which consists of layers of meat, rice and potatoes infused with warm and delectable blends of aromatic spices. The all favorite Rasgulla which is a delicate and delicious dessert native to Bangladesh. These cuisine are only well-known in the regions of Bangladesh, I want these to be known throughout America.\r\n\r\nI also want to share about Bangladesh\'s heritage and history.We have a long history concerning our language,and we are the only country to have fought for their language. The liberation war that lasted for nine months starting from March 26 and ending on December 16,1971. Bengali also celebrate their festivals very grandly, like the two \"Eid\", \"Kalipuja\", \"Christmas\" and one of Bengali\'s favorite festival \"Pohela Boishakh\".',1,'My High School/Teacher',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1001/school_seal/xVfIabIWtAIcExmWmuL19uFg6BvPNxDEg30SiHiQ.jpeg'),
	(194,'Mahmudul',2,0,NULL,'Sylhet, Sylhet',NULL,19,'A very dear topic that takes a role in the volunteering/social services act I enact is based on Education. This roots to me froom seeing the lack of availability of Education due to scarcity in a lot of my family members, and also the constant effort my parents have made to put me through a system of Education.This has led me on many occasions to embark on sessions and events where in my free time I would volunteer to teach and educate this youth in my village,community and just share a sense of inspiration by the means of me speaking about my eductional results.Whenever there is local volunteering opportunities wherever I could help, be at feeding the orphans at an orphanage,lending a hard in my home town,providing advice/teaching on education or simply just smiling and asking someone about their fellings and day.I\'m always more than delighted to be doing these things.',NULL,'house no -6,hazi suwab ali bhabon,(2nd floor),mendibag',NULL,1006,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1006/certification/Lfv2wrtr26tsC8pxJV6Q8sqeTWg9C401CmsyWrQu.jpeg','Bangladesh','10',9,8,'+8801718044411','75','2004-02-17','sakibmahmud5455158@gmail.com',NULL,'1','1','1',NULL,NULL,'Late. Md. Abdus Salam',NULL,NULL,NULL,NULL,'1',NULL,NULL,'Amin',NULL,'01718044411',NULL,'Moriam Begum',NULL,NULL,'pension',80,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1006/student_photo/os1cVA2VSlrpVKrHlihQku8GLqvOsx2Cj9IB3eSw.jpeg',NULL,'3100','1',NULL,'Kalighat,Sylhet','Sylhet Govt Pilot High School,Sylhet','2019-11-27 06:43:19','01711449576','male',NULL,'kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1006/marksheet_previous/Zc9zZcB7tM9rQINkhZz434w4sS55ovn4bqUEkFhM.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1006/marksheet_previous_two/1LlSTm0TGkZVYomGsIdNwaid5YdzNSBbQynsK78n.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1006/marksheet_current/qi6sHQ519fjkLgxf9R5Tdm8G5hLWONdTYL2sgREp.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-27 13:46:27',NULL,1,1,NULL,NULL,'EB0751960','2024-08-24','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1006/student_passport/boDr45v3Iqsh2KuMMxOBq8xa8p9ykKlSz0S0IVVl.jpeg','Sylhet',1,NULL,-1,2,'9196219323004',400000,'Sylhet, Sylhet',3100,'Kotwali','Md. Kabir Khan','01711449576',NULL,1,NULL,1,NULL,'I\'ve always wanted and it\'s core in my heart is the ability to see beyond the stretch of my current environment.Being able to interact and see more homan beings outside the vicinity of Bangladesh.I was once taught that we are based off the books we read and the people we meet and that feeling constantly resonates in me, being able to read books is great,but to meet people would add a dimension of exceptional life experience allowing me to grow as an individual.Also with the love of my country and other countries and their people, I\'d be a humbling opportunity for me to be able to exchange emotions,culture,interactions and experiences with people.If the yes program would allow me to do so.I not only would this be an individual venture.If I were to be accepted in the program, but a collective one.I\'d not only enjoy the learnings by my self,rather I would provide what learnings and experience.I have via interaction with my family in US and bring back it to share with the people of Bangla!','A great deal of application for Bengali Food was enamored in me naturally growing up.I always enjoyed eating delicious ethnic food. For someone who grew up not in the best financial state,it made me feel rich and proud that I got to eat such rich and enticing foods.The food was not only heightened within my emotions just by food,but the love and culture that went into it,the process,the getting together, and the aftermath.I\'ve read in books what is considered \'soul food\' in western societies,but this is something I\'d definitely love to share as it fed my spirit.',1,'My Family Member',NULL,2,'2019-11-23','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1006/school_seal/fX6QQOo9GzhdTRNeY0et8tTMCvyb4EXg2XQON75s.jpeg'),
	(195,'Faiza',2,0,NULL,'Sylhet, Sylhet',NULL,19,'No. But I want to feel the pain of the distressed people and help them out in any way I can. The biggest problem my community faces is girls not being able to learn about proper menstrual health. The period is still frowned upon although its a natural female body procedure and its very crucial. Most girls don\'t get menstrual hygiene lessons and suffer through various menstrual problems. I would like that situation to change and I would like to know more about and tell more girls about menstrual hygiene.\r\nI think every effort counts and I will try my level best to make that specific change.',NULL,'Mohona B-30 Kalibari, Modina market,  Pathantula, Sylhet',NULL,1008,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1008/certification/C12hDrY3PCMrzQZNIha10OOzz3Pw6TeWpZktQOu5.jpeg','Bangladesh','10',9,8,'01828739958','65','2004-10-12','samianahmedjcpsc@gmail.com',NULL,'1','1','1','01716765664',NULL,'Md Abdul Maleque',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Tabassum',NULL,'01787528885',NULL,'Dilara Begum',NULL,NULL,'Teacher',65,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1008/student_photo/aPN5m1DeSqcqJpCfhNnCWTpjGENqUoAomnsOvg5y.jpeg',NULL,'3100','1',NULL,'BGB camp, Akhalia , Sylhet','Border Guard Public School and College','2019-11-27 06:43:19','0821719363','female',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1008/marksheet_previous/32FZ0ERqumGXpVIu2wOaOzVPfDpt314uO0cha3K7.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1008/marksheet_previous_two/lIZciB42hhU4dDBi4ZcWtGd7doQwWIFCUT39dk49.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1008/marksheet_current/TYbGRWL9pNgYBCX78RiRdOM4XhAi72Gqh7wNpVUL.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-30 08:29:47',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Sylhet',2,'4194401537',420000,2,'9113137376947',420000,'Sylhet, Sylhet',3100,'Kotwali','Md Fayzul Haque','01712254694',NULL,1,NULL,1,NULL,'I want to take the essence of our culture worldwide. I want to show the world how my culture has this unique signature throughout history. I believe in global cultural infusion and I would be more than happy if I get the chance to be a cultural torchbearer of my country to the world. I am proud to be a Bengali and a Bangladeshi and I want to prove the world that we are worthy.','Bangladesh is a country of different religions, classes, cast, and ethnicity. Yet one thing unites us all. Our Identity as a citizen of this country. And I want to show it to my hosts that living in harmony is easy if your hearts at the right place. I would like to share and walk them through our cultural festival, our glorious journey of independence, etc.',1,'A Friend',NULL,2,'2019-11-13','2019-11-07',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1008/school_seal/oABzgReKaRslvERwxZwdFxuFr70QpSUyoiIjeVYz.jpeg'),
	(196,'Ayen Hossain',1,0,NULL,'Narayanganj, Dhaka',NULL,19,'If I have an opportunity to bring some specific positive changes in my community through community services, I\'ll fight against the environmental issues, child marriage, \r\nchild labor and so on. These are some probIems which occur in our country, especially in rural areas  .I also worked as a child researcher in National  Children Task Force(NCTF) already. I have some experiences of solving these problems. \r\nSo I\'ll try to make some positive changes through these community services.',NULL,'4 no mojid khanpur,  Narayanganj',NULL,1009,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1009/certification/4ZP0uEc79IQOeOLgLH9g9S2GWegnQrN8X9ArvnqU.jpeg','Bangladeshi','10',9,8,'01819447900','60','2003-06-28','Ayanhossainadia@gmail.com','https://m.facebook.com/profile.php?id=100010392558453&ref=content_filter','1','1','1','01819062576','azmalhossainbabu@gmail.com','Azmal Hossain Babu',NULL,NULL,'Teacher',NULL,'1',NULL,'Ayan Hossain Adia(Adi)','Adia',NULL,'01819447900','azmalhossainbabu@gmail.com','Sayma Sultana',NULL,NULL,'Housewife',60,80,NULL,NULL,'1400','1',NULL,'Masdair, Narayanganj','Narayanganj Government Girls\' High School','2019-11-27 06:43:19','027633079','female',NULL,'Narayanganj Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1009/marksheet_previous/k3tHS1GRsA88alsT7EeWYdMJBxDdzX7d4rWXB44X.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1009/marksheet_previous_two/FWytiSSRmDv9DN7kOGp2sLHJbVhF0LUTmTE4c9ZX.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1009/marksheet_current/v6oNU4uCcX0Dh4rrfwRq5c24UYzVu2HscHyR8EAj.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'3738883028',300000,2,'5538892992',-1,'Narayanganj, Dhaka',2522,'Fatulla','Abul Kalam Mustafa','01712048128',NULL,1,NULL,1,NULL,'It\'s one of my dream. I think that if I get a chance to go to USA from the YES program,one of my dream will come true.everybody used to say to my parents that I\'m good for nothing. So I want to proof to those people, who used to say that I\'m good at nothing that I can also do something great on my own ability and make my parents fell proud on me.\r\nThat\'s why I\'m applying for the YES program.','First of all, I would like to share the clothing culture and the language of Bangladesh with my American host family . The main cultural cloth in our country is Saree. So I\'ll try my best to introduce them with wearing it. And then there is also our language.  Bangla language  is one of the sweetest language in the world. I\'ll try to share the history of Bangla language and the story behind The International Mother Language Day  with them.\r\nI love the cultaral activities of our country. The agriculture and culture are very rich in our country. I\'m a folk dancer also. So I\'ll try my best introduce them with it.',1,'My High School/Teacher',NULL,2,'2019-11-19','2019-11-16',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1009/school_seal/Cb3YsTGsFZ4OvoZkA2hgRX6Q7EmHr3eQvkWcta1h.jpeg'),
	(197,'Mohammad Nasif',2,0,NULL,'Dhaka, Dhaka',NULL,19,'A few years ago, I participated in a event in my school. We gave warm clothes to the unprivileged children, who suffer a lot in winter season . My duty was to collect the warm clothes from the other students of the school. Then we distributed the clothes among the unprivileged children. I feel really very lucky when I get an opportunity to do something better for my society.',NULL,'19 Hatkhola,Wari, Dhaka',NULL,1010,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1010/certification/GhoXS0Um8hZe2S6Gz37HlOaS5TBibBypJ3FBajak.jpeg','Bangladesh','11',10,9,'+8801558231007','86','2003-12-11','nasifchowdhury12@gmail.com',NULL,'1','1','1','+8801714007084','mscebd@yahoo.com','Mohammad Shamim Chowdhury',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Chowdhury',NULL,'+8801712832777','riktachowdhury45@gmail.com','Mst. Nasima Chowdhury',NULL,NULL,'Housewife',80,75,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1010/student_photo/t66APs74wfh1qNxcN5aOhIYckfwxG5dyiWdfp5T4.jpeg',NULL,'1203','1',NULL,'34/B Farmgate - Tejturi Bazar Rd, Dhaka 1215','Govt. Science College','2019-11-27 06:43:19','02-8122717','male',NULL,'Wari','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1010/marksheet_previous/YrdnexVURJ4LnKgUV6l9cSgDQy7udwT71S0SQrOI.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1010/marksheet_previous_two/b9ZOoU1IQ5uDX6Guj8UPlBKcLjo1OGOyIzKSkP52.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1010/marksheet_current/QDvS7SWteTcC1u3jySF4arGnEXn3SQrdnC82zDWb.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BJ0992730','2021-01-20','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1010/student_passport/eA3W15qSXjDXjDT0jLbFVwkgxkLURfuinOuDAFr7.jpeg','Bangladesh',2,'9317636078541',600000,2,'8676586640',-1,'Dhaka, Dhaka',1215,'Tejgaon','Banamali Mohan Bhattacharya','02-8122717',NULL,2,'1. India for Tech competition (IIT KANPUR) 2. Singapore for vacation. 3. Malaysia for vacation.',1,NULL,'I love to travel and I\'ve visited a few countries in last 2 years. Besides I went to India in 2018 for a robotic competition and then i got a chance to stay 7 days in Indian Institute of Technology (IIT, Kanpur). I have noticed that most of foreign people, even Indians don\'t have a good knowledge about my country. So, I decided to do something which will help foreign people to about my country. I think, YES PROGRAM is a huge opportunity to represent Bangladesh in front of the world. As the alumni are going to live with a host family, it will be easy to share the culture, language, and clothing of Bangladesh with the people of US. Besides, I am very much interested in robotics and I have participated in different robotics competition. So I think my dream will get a new dimension if I go to US and get an opportunity to work with them. That\'s why I want to apply for the YES program.','I am really very friendly and I can easily make friendship with new people. So I think I will be able to make a close relation with the members of my host family within a very short time. I will tell and show them different types of stories which are related to our history. I will tell them about our cultural activities and celebrate our festival of Bangladesh with them.I will gift them some clothes such as Punjabi and sharee.Besides, I will cook bengali food for them. I will also tell them about the achievements of Bangladesh. Thus I will share the culture, language,religion,cuisine with my American family.',1,'iEARN-BD Website',NULL,2,'2019-11-21','2019-11-13',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1010/school_seal/zw4tq0IXyTgID9lpXzfBh9TZUTZ82O5xMIchxrnW.jpeg'),
	(198,'Madina',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Community service can have a lot of positive effects on a person. If I have the opportunity to participate or organise a community service then I would love to do it because it will help me to utilize my own talents. I love to help those who are in need of  guidance and extra help by donating them food, clothes or by giving them shelter. I am also interested in keeping the streets clean by throwing the trashes in their proper place. This community service project will increase my patience and flexibility and allow me to meet people at various age groups. I want to help the poor animals who are in need of extra guidance. I think this will help me to become more mature person and teach me to appreciate the value of hard works.',NULL,'House -5, Road -2, Block - A, Section -7, Arifabad Housing Society, Mirpur',NULL,1017,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1017/certification/qa7mOcMGyYHzELR80EgFjn7lOw7YHjxmJDUOfJDp.jpeg','Bangladesh','9',8,7,'01980456446','66','2003-09-09','madinajahan03@gmail.com',NULL,'1','1','1','01980456446','madinajahan03@gmail.com','MD Nurulla Emon',NULL,NULL,'Umeployed',NULL,'1',NULL,NULL,'Jahan',NULL,'01980456446','madinajahan03@gmail.com','Nusrat Islam',NULL,NULL,'Unemployed',76,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1017/student_photo/CG9GrcYssSsGB7yQbUvuLtOMfnjsrmo3mgUAiIOF.jpeg',NULL,'1216','1',NULL,'8/7 Pallabi, Mirpur','Juvenile English Medium School','2019-11-27 06:43:19','01711635906','female',NULL,'Pallabi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1017/marksheet_previous/94oCWh1M6EWDmaDjzSoNkRs6uUchtnnpfznhd9zJ.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1017/marksheet_previous_two/y1V7AdHHhpzlpxrnCKEjrbEa2N3FOAhsk9zPUo0P.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1017/marksheet_current/nUz9gPdGosqc6G1vkorwIz3Sf0Yx55xn7FSXAXIg.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Chattogram',2,'4150877373',-1,2,'4150894568',-1,'Dhaka, Dhaka',1216,'Pallabi','Mini Musharat Sayeed','01711635906',NULL,1,NULL,1,NULL,'I have always wanted to study abroad because it is an experience of a lifetime. i want to apply for the YES Program because it will give me benefits in many ways, it will help me gaining knowlegde of other country for which i am really interested. I love meeting new people and sharing the cultures of my country with them. I love to visit new places to get an unique experience and it will also allow me to do things that i want to. I will also learn how to live on my own to become someone responsible.','The cultures of Bangladesh are really nice and enjoyable. There are many things that I would love to share with my American family. In Bangladesh mostly women wear sari and men wear Punjabi. The people here like to eat rice, fish and many fruits such as bananas and mangos. \r\nI want to share with them about the independence of our country that how our people sacrificed their lives and how our men fought for our mother language. \r\nIslam is the major religion of Bangladesh. Eid ul fitre and Eid ul adha are the biggest festivals for Muslims. There is also a month of Ramadan in Muslim calendar where we have to keep fast till the sun sets for a whole month. There are also other Bengali festivals that we celebrate such as pohela baishakh in the first day of the month baishakh. In this festival people wear red and white dresses and eat   panta rice with fish. There are also other Bengali festivals such as Nabanna. So these are some of the cultural aspects that I want to share.',1,'A YES Alumni Member',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1017/school_seal/vXde4YmA82VoSqInM1295f1CWiWrDmLMDIis7grQ.jpeg'),
	(199,'Aungshita Annan',2,0,NULL,'Dhaka, Dhaka',NULL,19,'There are many poor and needy people in the world. I want to provide food,shelter and education for those people so that they can have a better life. This will help the economy to grow and as a result our next generation will be able to see a better world. \r\nI want to speak about the human rights. Their are many people who are not getting the right judgement. I want to speak up for those people in future.',NULL,'House no. 10 road no.28(old) 15(new) Dhanmondi',NULL,1018,NULL,'Bangladesh','9',8,7,'01819237443','78','2003-10-29','aungshita@gmail.com',NULL,'1','1','1','01819237443','dolonislam1955@gmail.com','Munshi Fakrul Islam',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Annan',NULL,'01713038909','kanan.islam@gmail.com','Mahbuba Islam',NULL,NULL,'Service',85,93,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1018/student_photo/dz1X4wh3Q7YemuWjppmG5GxyL2XjcYCPf2b99Zri.jpeg',NULL,'1209','2','Louisiana','House no.95 Road nom 11/A Dhanmondin-R/A','Siddiqui\'s International School','2019-11-27 06:43:19','01677534744','female',NULL,'Dhanmondi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1018/marksheet_previous/gUxRMuxYw5JlKoFa6XZmnDQyNfzmYazKJ2dyfTLD.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1018/marksheet_previous_two/8peqb1rVkdQULijUPNBLlvSVFAfdIDmOsIwV3IAX.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1018/marksheet_current/Yn6WvBozNpLkbBjdC5IPrIzPzEX6YhScSfkuroGO.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-30 17:13:44',NULL,1,1,NULL,NULL,'BY 0445436','2024-01-03','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1018/student_passport/8VN7KNQftZ9L6wNcm2bY1xl7jQg2xaQgv7U65aFx.jpeg','Dhaka',2,'2691649423770',1250000,2,'2691649423771',1200000,'Dhaka, Dhaka',1209,'Dhanmondi','Nahid Arefa Siddiqui','01677534744',NULL,1,NULL,1,NULL,'I want to know about different cultures. I think that applying for YES program will help me to have a newer perspective of the world. It will also help to gain a different experience which will be helpful in building my career.','Bangladesh has a very different culture. The 1952 language movement was a very important in our country. I want to share with my American family that how the people of Bangladesh fought to have a language of it\'s own. \r\nBangladesh also has an interesting cuisine. The traditional lunch/dinner in every Bengali family simply lightens up anyone\'s mood. I want to share the food of Bangladesh with them and prove them that the cuisine of Bangladesh is just as tasty as theirs!',1,'iEARN-BD Staff Member',NULL,2,'2019-11-20','2019-11-19',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1018/school_seal/KQGdnHMkIJZenap16VKxmznwCkA3rTloNyW9MkXH.jpeg'),
	(200,'Sarwat',2,0,NULL,'Dhaka, Dhaka',NULL,19,'If I have the opportunity for Community service I would first look into the problems of my country. In Bangladesh the majority of women suffer from the problems of sanitation. Enough sanitary requirements are not there to fulfill the problem.\r\nWomen are an integral part of our community. They are the reasons of a child growing up, of a family being united as well as at times an earning source but unfortunately in rural areas as well as few urban areas do not have the requirements of the sanitation women need.\r\nHence if I have the opportunity I would definitely provide the requirements, encourage shops to sell them at a price people can afford as well as let the women know how the society should be strict regarding this matter and they should always raise their voice against it.',NULL,'Flat-16C1, Tower-2, GA-2, Suvastu Nazar Valley, Shajadpur, Gulshan, Dhaka-1212',NULL,1022,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1022/certification/Z7rzzoWRAGviNLU6B18j73nrec2E5ML7apRS6Dnk.jpeg','Bangladeshi','8',7,6,'+8801777775391','88','2005-01-04','nnkutubi@hotmail.com','NA','1','1','1','+971507536635 (UAE)','sururul@gmail.com','Shareef Md. Sururul Akbar',NULL,NULL,'Private Service (at UAE)',NULL,'1',NULL,'NA','Shareef Suha',NULL,'+8801777775391','nnkutubi@hotmail.com','Nuzhat Nazneen Kutubi',NULL,NULL,'Private Service',92,87,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1022/student_photo/mGdYc3QrwKwRkQOfaxhvaDz3tLezt88Ey1R6cChE.jpeg',NULL,'1212','1','NA','House # 34, Road # 27 (old), New 16, Dhanmondi R/A, Dhaka-1209','Oxford International School','2019-11-27 06:43:19','+8809115392, +8809118156','female',NULL,'Gulshan','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1022/marksheet_previous/Ii8QM7aiJQ55PpjDlfvAXR8VcVMjQGGjLnb9g5yE.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1022/marksheet_previous_two/yyItVQVl3RKhZ0xN2wwUHequsZYP450Nyq6p12y4.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1022/marksheet_current/DCPAiRGBMIESxNGIOshEJlcqpl7VQgAzdozNA4Ej.jpeg','NA',1,'0','NA',NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,'N/A','N/A','BP0249462','2022-05-20','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1022/student_passport/ahP73Rr387H2BXKKB55WKdR2WkK6t5QawdDuaWE2.jpeg','Chittagong',2,'1595510713758',1200000,2,'1594314329997',840000,'Dhaka, Dhaka',1209,'Dhanmondi','Dr. Shanthi Perera','+8809118156','NA',2,'Thailand, Malaysia, Singapore, India, Vietnam. The purpose of all visit were summer/winter vacation.',1,'NA','Visiting any foreign country and studying there is the dream of almost every child. I am one of them and I can undoubtedly say USA has always been my one and only dream destination for education. Other than education, exploring the country, exploring the cuisine, exploring the people there and etc has also been my dream. Living in Bangladesh is indeed a great opportunity because of its culture, history as well as partial diversification but exploring USA was a dream. The famous universities, the progression and development of the country, broad history are a major part of my attraction towards this country. Living with a host family will be a way of learning about the people of USA, their culture and alot more things. Within the duration of 6 months I might be present there in any occasion such as Christmas . This would be an opportunity to see how they celebrate their functions. All of this combined in YES program attracts me to participate in it and a desire to not miss this chance.','Bangladeshi culture indeed is one of the richest cultures. Starting from language, clothes till our way of celebrating function, each detail of the daily lives of Bangladeshis come purely from Bengali culture.\r\nStarting from the language is a must. Bangla is a very rich language. Its pronunciation, tone, the way each word is pronounced using different parts of the face makes it very different from other languages. It would be an honor to represent such a fine language.\r\nNext would be clothing and I specifically would like to mention Sari. The way it is wore is very different and it would be a pleasure to teach the women of my family to wear Sari concerning its authenticity.\r\nThirdly the cuisine. Bengali food is one of the most unique cuisines due to its variety of spice and flavor. I would cook few Bengali food that I learned and would look forward to my American family commenting on it.\r\nJust like these 3 details I would present few more aspects of my culture to the family.',1,'iEARN-BD Website',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1022/school_seal/iYF8aMtJ0Eq4mZEu7oP0rpLYxwToti2FNGkO7HVM.jpeg'),
	(201,'SADIKA TASNIM',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Humans are social beings. We care for each other and therefore we exist and our service to the community we live in is important to maintain a healthy state of it. Some of the ways in which I would like to serve my part are as described.\r\n        Clean the a park or some frequently visited social space for once every weekends.\r\n        Collect leftover foods from restaurants with their support to deliver it to poor and starving people.\r\n        Organize cultural programs or open mic extempore speech competitions on topics of current critical situations to hear their ideas out and the best idea would initiate the next event and to fund raise for buying warm blankets for the vagrant people.\r\n        Hold \'sharing\' meetings to hear people ot who feel shut out and offer them advices and suggestions if they need.Hearing heals. \r\n        Make handcraft materials from undisposible materials, such as a flowervase from a plastic bottle or a mask from plastic bags and a lot more.',NULL,'HOUSE 10,FLAT B-4, ROAD 5, MIRPUR 11.5 PALLABI, PALLABI, DHAKA',NULL,1024,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1024/certification/GtOQ8zOSeWNr1K6Dhf2j16rDbykhTVJ7cMvb7ry3.jpeg','Bangladesh','8',7,6,'01711541566','70','2005-06-22','shoaib.dmo@gmail.com',NULL,'1','1','1','01711541566','shoaib.dmo@gmail.com','AKM SHOAIB',NULL,NULL,'SERVICE-HOLDER',NULL,'1',NULL,'@sadika.t.o','ORNELA',NULL,'01675078636',NULL,'DILRUBA ARA ROB',NULL,NULL,'TEACHER',70,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1024/student_photo/qVYXRGrnAZ4yllyDVf4itJjgLqIfJR7J96xfeusb.jpeg',NULL,'1216','1',NULL,'24 ASAD AVENUE, MOHAMMADPUR, DHAKA','SAINT FRANCIS XAVIERS GREENHERALD INTERNATIONAL SCHOOL','2019-11-27 06:43:19','9115200','female',NULL,'PALLABI','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1024/marksheet_previous/7EGyB4tDvEmBECbLmkU1OEbmRQM3hG1N1WhbteR2.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1024/marksheet_previous_two/LpLYSXVUMIKqnI5f6ppqcTViOJDJFDmqLLbRo0Jy.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1024/marksheet_current/iWMfzbBdpSCEp2fDBn6cD4Qzxwvzaj7yrnTwWU9R.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-30 11:39:00',NULL,1,1,NULL,NULL,'BR0800976','2023-02-18','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1024/student_passport/cQp5WLHIvfHUy1r82sKKFs6vYXERXBGgIY5Wvpiy.jpeg','DHAKA',2,'1481973731',3200000,2,'2381981634',240000,'Dhaka, Dhaka',1207,'MOHAMMADPUR','SR.VIRGINIA ASHA GOMES','9115200',NULL,2,'INDIA, SUMMER VACATION TO MEGHALAYA',1,NULL,'Being a Bangladeshi, Im used to not much chances coming up my alley and the YES program is more than what I can be gifted with. \r\n     The venture would not only serve to academic purposes but also for  for my prority interests of exchange in ideas, innovations and experiences that the program upholds and thus makes me apply for it.','Bangladesh possesses a rich,diverse and unique culture, which id try to represent with fair justice through my 14 years old observation and Ive estimated some of the ways of doing so.\r\n        I plan on having this session everyday in the time span of the journey for at least 10 to 20 minutes, whered Id share something new about the Bangladeshi culture and living.\r\n         Id learn them frequently used phrases of our state language Bangla, tell them stories of our hostilities and campaigns.\r\n          Some days Id throw in an apron and cook some of Bnagladesh\'s traditional favorites with the supervision of an elder and other days Id exhibit a speical form of drawing in our country called alpona, or clothing that i may carry with myself called saree. \r\n         I would also offer to sing some of the folk musics of the country and share works of renowned authors of Bangladesh.\r\n        Most importantly I would mirror the reflection of Bangladeshi people\'s love and compassion through myself.',1,'My Family Member',NULL,2,'2019-11-14','2019-11-09',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1024/school_seal/QhJPswr83pYqd2xN9hJLBEVkLOteQIIXAqUcJyER.jpeg'),
	(202,'Simran',2,0,NULL,'Dhaka, Dhaka',NULL,19,'There is trash everywhere, Every place is getting polluted our country is getting polluted i want to see the beauty of nature not trash everywhere \r\nI want to put dustbins everywhere so that people throw trash over there not on the road or beaches and all the beaches are full or trash and footpaths are full of trash i want to collaborate with city corporation to take the trashes everyday after the bins are full of trash \r\nI want to make my country clean \r\nPeople are having various kind of diseases for this wastage, pollution, the polluted air',NULL,'Nakshi Pallabi, Flat#8/B, Plot#3/6, Road#02, Mirpur, Pallabi, Dhaka',NULL,1025,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1025/certification/zV3avt78S1QlYpkICFYCVzWdwWLNbxOBSzx8CCMY.jpeg','Bangladesh','9',8,7,'01552340893','68','2004-07-04','simihossain04@gmail.com',NULL,'1','1','1','01751624862','ssamakal@gmail.com','Kamal Hossain',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Hossain',NULL,'01552340893','hossainsimran@yahoo.com','Soufiya Sultana',NULL,NULL,'Business Women',74,81,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1025/student_photo/1BGSnVSCU4ntfpiw99iNgUSPSOEvMtEZWw1hhYTg.jpeg',NULL,'1216','1',NULL,'8/7,pallabi, Mirpur-12, Dhaka-1216','Juvenile English Medium School','2019-11-27 06:43:19','01711635906','female',NULL,'Pallabi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1025/marksheet_previous/43fIiFEMlAAyQ3nKkFQjDYIM9UWqNkrLb0KdtQnx.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1025/marksheet_previous_two/K3S3FXTd4ZZlq7qSiIy5iTK33VxkMdXOcWNPbGSW.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1025/marksheet_current/QkgXS7zG3KCUJ53OsN7dzfpFiYXQbO2T3BpnKCGE.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,2,NULL,'Vision Disability',NULL,NULL,NULL,'Dhaka',2,'329198731',1800000,2,'5992007525',1400000,'Dhaka, Dhaka',1216,'Pallabi','Mini Musharat Sayeed','01711635906',NULL,1,NULL,1,NULL,'Its a dream of everyone to go abroad and so it is mine.The main reason is to find my true self.KL YES is giving me an once in a lifetime oppurtunity to fulfil my dream so why wouldnt I take a chance.I want to meet new people out there.The ones with whom I might even change me myself.Sharing life stories and my culture is also a crucial part of my dream as you know a bengali without the culture is incomplete.Among all this when I get to fulfil my dreams only then I guess I will find my true self.','The bengali culture has no boundaries and when it is about to be sharing with other people it is very difficult to decide where to start and where to end.But if i had to start with any it wouldve obviously been our mother language Bangla.One thing that everyone should know about.The difficulties the country faced to earn it and the lifes that were lost.An unforbiddable incident which led to the freedom of a beautiful language.\r\n\r\nThen comes the bengali festivals.Starting from the celebration of the bengali new year through pohela boishakh to the pitha melas in winters.What culture we have.In between those beautiful events of pohela falgun nobonno uthshob etcetera.All in one is our bengali culture.\r\n\r\nNow comes the turn of the taste of asian spices.',1,'My High School/Teacher',NULL,2,'2019-11-22','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1025/school_seal/bdrZIHpqI7I7Fp0wm9NnDhv8eE1u0E0G90xCWXzf.jpeg'),
