	(204,'Maisha',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Since my childhood i have always dreamed of helping the poor and needy people. Therefore if i ever get the chance to do any kind of community service,i would open a NGO of my own. i would visit orphanages and provide those kids with clothes and food. I would also donate money for their education every month. I will make sure they never feel that they are unfortunate and different from others.This will give those poor and innocent kids an opportunity to prove their intelligence and potential. This will increase the literacy rate in Bangladesh which will be a great asset for our country. Every time whenever i will be able to bloom a wide smile on those kids face, my heart will be filled with ecstasy.',NULL,'Section-12,Block-A,Road-34,Plot-3/kha,Pallabi,Mirpur,Dhaka-1216',NULL,1032,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1032/certification/psW71CkuHOU4vpNixU1G4818drUTU77jSlXmk9fD.jpeg','Bangladesh','9',8,7,'+8801798626343','74','2003-08-30','maishamirza1@gmail.com',NULL,'1','1','1','+8801709796651','shiponmirz@gmail.com','Mirza Mohammed Abul Hasib.',NULL,NULL,'Business man',NULL,'1',NULL,NULL,'Mirza',NULL,'+8801795714827','champamirza@gmail.com','Nuuria Saied Chompa',NULL,NULL,'Housewife',85,91,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1032/student_photo/oFp2rDvHs4bNPp8MM3EEwlt82u1ywFbSvReVNpHQ.jpeg',NULL,'1216','1',NULL,'8/7, Pallabi, Mirpur-12,Dhaka-1216','Juvenile English Medium School','2019-11-27 06:43:19','+8801711635906','female',NULL,'Pallabi thana.','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1032/marksheet_previous/pIli0raS06lSUi7AW9HWhlBnJgIfcrqWfMzfzDuK.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1032/marksheet_previous_two/AOUz2F6EGvZJ2VTcP2TUOdWSKp3mh4gpNoawjs1T.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1032/marksheet_current/82QskF0xuxqqHwPKYdPsUPgCrnnPtuCvsdnm4j5D.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,2,NULL,'vision disability.',NULL,NULL,NULL,'Dhaka',2,'5992106079',600000,2,'9141635111',-1,'Dhaka, Dhaka',1216,'Pallabi thana.','Mini Musharrat sayeed','+8801711635906',NULL,1,NULL,1,NULL,'i am enthusiastic about participating in YES program because i to want let the people over there know about Bangladesh.very little people know about the complete history of Bangladesh,so with the help of this program,i would be able to proudly represent how our brave martyrs struggled for nine months for our mother tongue (Bangla) and acquired independence. Besides, i want to meet people from all around the world and know about their country,their culture and religion. I want to learn new languages and have new experiences. I want to let them know about the wonderful places that we have in Bangladesh, for example : shundor bon, cox bazar etc.I want to let them know how ever-green Bangladesh is! I want to visit the places that i have always dreamed of visiting since i was a child. I want to make my curiosity of seeing the snow and touching it come to reality.I want to be one of those, who, at such a young age was able to do something great for their country with their own potential.','Bangladesh is ever-green country filled with diversity and joy. Our festivals, food and cloth reflects our culture. I want to tell them my experience of festivals such as: Eid-Ul-Fitr, Eid-Ul-Azha, Bengali new year etc.i want to show them the pictures of me celebrating these festivals with my friends and family, i want to show them our historical things such as: ektara, kula, kolsi,wooden fan, churi etc. I want to let them know about our clothing style, how we represent our religion and culture n our dress. people in Bangladesh mostly wear salwar-kamiz and hijab. Bangladeshi people wear sharee(our historical dress) in special events and festivals. I want to show them how a unsewn piece of cloth can be worn in such a beautiful and mesmerizing way. Bengali food is very unique and delicious, i want to make some Bengali food such as pitha, Bengali curry and rice to let them know how heart warming and delicious Bengali food is.',1,'My High School/Teacher',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1032/school_seal/5tpFRxcx0G1QpxqQaFu0wym8D9U1IAnUgHYShvmy.jpeg'),
	(205,'Mahfuzul Qayum',2,0,NULL,'Sylhet, Sylhet',NULL,19,'Most of the people of Bangladesh has superstition. They are religious but a lack of proper education. Most of them are unemployed. They hardly know  about science and information technology. So I want to earn progressive knowledge, cultural aspect and information.By sharing this I want to change their superstitious belief.',NULL,'Azad Cottage-2. 11/1-Ingulal Road-Kuarpar Sylhet',NULL,1033,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1033/certification/190qlFEfRCtL68PVYo66q5d62UlRMubSvwWCW0CV.jpeg','Bangladeshi','10',9,8,'01319388967','72','2003-12-29','qayumht@gmail.com',NULL,'1','1','1','01712328649','qayumht@gmail.com','Md.Abdul Qayum',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Shihab',NULL,'01728520209',NULL,'Nazmun Nahar',NULL,NULL,'House wife',76,78,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1033/student_photo/VFAmXdWLuwsJksaoR9wfv1F8UALSJKyMbfBeXMz0.jpeg',NULL,'3100','2','New york','kalighat sylhet','Sylhet govt.Pilot High School Sylhet','2019-11-27 06:43:19','0821-712507','male',NULL,'kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1033/marksheet_previous/QHHv2qC1VugsAi9DJIQ4eBEtNI2aDhYJLDaoTqrn.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1033/marksheet_previous_two/OlwI05oAQaVDvd1c0fUDzgJcZ2iPuRywO6eindbC.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1033/marksheet_current/rVTdes0fFtNQa0IpIrgyLu79Ur8BpyVOJiH3VHy8.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Sylhet',2,'19709013378276697',588560,2,'2400323735',48000,'Sylhet, Sylhet',3100,'kotowali','Md.Kabir Khan','0821-712507',NULL,1,NULL,1,NULL,'I want to know about the people of USA, their culture, food habits, religion, skills, techniques  and attitudes. I also want to exchange our culture, food habits, skills and attitudes.','Bangladesh is a populous country. Though it has a populous country. It has a rich culture. Most of the people of this country is polite. One of the part of culture is hospitality.\r\nMost of the people of Bangladesh lives in rural areas. They live in extended family. A lot of family member live in the family. They go shopping, fishing together.We have many seasonal food habits. Specially in winter we have a lot of fun and functions. I want to exchange this aspect by doing or participating with an American family.',1,'Facebook',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1033/school_seal/tediObrK9m8MuNZR4q79IncCXKkPnjAbMxxqETLz.jpeg'),
	(206,'mivasa chowdhury',1,0,NULL,'Chattogram, Chattogram',NULL,19,'Being a student, I\'ve always tried to contribute myself to social services as we are the future rendezvous. so, I\'ve participated in community services on different social issues like- rally against eve-teasing, tree plantation and education week under the supervision of GEIST International Foundation I\'ve worked to ensure a sustainable environment and to create greenery. Problems may differ from the country but it\'s our duty to cope up with them. That\'s why, whenever I get a chance to do any social service, I will utilize it.',NULL,'rahimia manssion, road-1, bibirhat, panchlish, chattogram',NULL,1039,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1039/certification/22AuxdGlfsNSYJi1lrWA0cR9pAP1yexowIQc5prS.jpeg','Bangladesh','10',9,8,'+8801819108940','70','2003-04-11','ruksana.sultana8348@gmail.com',NULL,'1','1','1','+8801819108940',NULL,'Mohammed Mohsin Chowdhury',NULL,NULL,'Business',NULL,'1',NULL,NULL,'chowdhury',NULL,'+8801818178348','ruksana.sultana8348@gmail.com','Ruksana Sultana Chowdhuri',NULL,NULL,'Service holder',79,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1039/student_photo/wfnU0PPY5pC1pon21ZTdMCWXUyVF7Hstdjpaldnb.jpeg',NULL,'4211','1',NULL,'Road-02, housing society, nasirabad, panchlish, chattogram','Aunkur Socciety Girls\' High School','2019-11-27 06:43:19','+8801819624649','female',NULL,'panchlish','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1039/marksheet_previous/zQZaaFQdBAnUmmKCGUgf8u22Alj7Sh3RzhZ9Gued.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1039/marksheet_previous_two/PehHgYjU06muHUmMss8UXEYtuwjcpnvZi0nn7wG0.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1039/marksheet_current/iq1t9iyOw4rGmRSUHgyHdDz8qNOGdRmSGOIGQOU4.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BR0759306','2023-02-13','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1039/student_passport/Se5KdO6XiVqJf960PhHtziA7Uw6dvz7mEeZGTHoN.jpeg','chattogram',2,'1511217238267',500000,2,'1595707663326',400000,'Chattogram, Chattogram',3999,'panchlish','Lily Barua','+8801816842370',NULL,2,'India for summer vacation.',1,NULL,'I want to apply for the YES program because I want to explore the different cultures and also want to share my culture with them.','I want to share the whole combination of Bangladeshi culture as a culture that doesn\'t consist in one thing. So, I\'ll share all the aspects of Bengali cultures with my American family. For me, the festivals of our culture are the best way of sharing our culture and that could be my way to share my native cculture.',1,'My High School/Teacher',NULL,2,'2019-11-18','2019-11-18',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1039/school_seal/T201nVvUfxDhprQ566r8bKuLHmxbBEkvOj04PFM2.jpeg'),
	(207,'Syed Tasassuk Imam',2,0,NULL,'Jashore, Khulna',NULL,19,'At first i\'ll like to thanks for this question. As i know that humanity is the great religion. And my parents always teach me about social service. And if i have the opportunity that will be great joy for me. I\'ll like to tell people about living together, helping others, trees and animals have also live. We can help together to those person who need help, We all are same inside. Colors, height, religion, power or money doesnt matter. In the end we all will die, And we can\'t bring our money, power or any kind of assets. So we shouldnt care about these silly things what we should care about is humanity. Because i think there is nothing better religion than humanity. We should care about humanity. If i get opportunity i\'ll like to join any kind of social services or community services group that helps people, Thanks.',NULL,'Kazipara, Puraton Kashba, Aziz City, Jashore',NULL,1043,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1043/certification/WZoG1d6MEB9jlrWz5uHpcp9QQodR0iwnq73CKJAZ.jpeg','Bangladeshi','9',8,7,'+8801610551190','70','2004-10-09','iamsyednirjhor@gmail.com','https://facebook.com/TheNirjhor','1','1','1','+8801718551574','syed.jessore@gmail.com','Syed Saruwar Alam',NULL,NULL,'Resort Center\'s Manager',NULL,'1',NULL,'@syednir','Nirjhor',NULL,'+8801646158600',NULL,'Mst. Shamima Akter',NULL,NULL,'Unemployed',70,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1043/student_photo/zOd57IdFCTaQRS0SceBnUdffWtQkMi2NZbD6UXPq.jpeg',NULL,'7400','1',NULL,'Akbar Manzi,  39 MMC Stadium Rd, Near Jashore Pouro Park','Municipal Preparatory High School','2019-11-27 06:43:19','0421-63359','male',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1043/marksheet_previous/ExDoE1su17lscf6YynAxpBs8qX38M9HuWsXX8HdB.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.t