andard higher education.','I wish to share my country\'s songs, cuisine, clothing through admiring them myself and revealing their true potential and specialities.By accurately representing my country\'s unique culture and its aspects I want to unfold the true power of eastern culture and heritage before my western family.',1,'A Friend',NULL,2,'2019-11-17','2019-11-17',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1045/school_seal/8aYVNDc7l1Z5xCPQ6ZmwpDSbh7A9IKliV5rk3MAu.jpeg'),
	(209,'Munzir',1,0,NULL,'Gazipur, Dhaka',NULL,19,'If I have the opportunity to do social services in my community, I\'ll try my level best to eradicate environmental pollution.\r\nDue to the rapid increase of vehicles,the ozone layer of the atmosphere is getting damaged.Carbon-di-Oxide and Methane is increasing in atmosphere causing global environmental imbalance. If I can raise support and awareness for running vehicles by solar energy or renewable energies,it will help to save the world from environmental damage/imbalance.\r\nI would also like to innovate new ideas to reduce environmental pollution by recycling wastages.Planting trees can also reduce the damage of environment.Raising awareness about the advantage of planting trees is also one of my community services.\r\nI hope,I would be able to eradicate environmental pollution.',NULL,'B-1/2, SPCBL OFFICERS RESIDENCE, GAZIPUR.',NULL,1070,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1070/certification/zNOUaxlECfIjF1Mi8zbAV1GaNk1veSwcvD7mlluw.jpeg','Bangladeshi','9',8,7,'+8801714449999','58','2004-05-28','smsnsufi@gmail.com',NULL,'1','1','1','+8801714449999','smsnsufi@gmail.com','Sheikh Mohammad Shoaib Nazir',NULL,NULL,'Service Holder,SPCBL,Gazipur,Bangladesh',NULL,'1',NULL,NULL,'Munif',NULL,'+8801869848555','nazmafd@gmail.com','Nazma Ferdousi',NULL,NULL,'Unemployed',78,69,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1070/student_photo/07ZXWNMJItXZOGoDluUGGhKhwHZZSJ2Xv3wAR9yu.jpeg',NULL,'1703','2','Pennsylvania','Gazipur Cantonment,Gazipur','Gazipur Cantonment Public School and College','2019-11-27 06:43:19','+88029204611','male',NULL,'Joydebpur.','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1070/marksheet_previous/RmVVBsKNvXNx5m2l0oRBt8cnPNYbJjOHJC8V8OYG.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1070/marksheet_previous_two/VAgGsxOvkvTpxXNQSVJRrYStG3