	(212,'Md.Raaisur Rahman',2,0,NULL,'Munshiganj, Dhaka',NULL,19,'Recently I took part a cleanliness activity in my society with my friends to make our surroundings clean and hygiene. I always believe it is our own responsibility to keep our environment clean and fresh. But lacking of right education and awareness, gradually we are destroying our environment day by day. So, I wish to work to make a positive change in the society by increasing awareness among the people through social media. At present, social media is an essential instrument to connect people easily. \r\nMoreover, I want to work for the deprived and street children who are not getting opportunity to receive education due to financial inability. They go to work to help their family by earning money rather than going to school. So, I have a plan to collect money from my relatives, friends, family members and like-minded people to create a fund to provide education free of cost to the deprived and street children. Also I will provide them nutritious meal to fulfill requirement nutrition.',NULL,'P/H-1244,Manikpur,Munshiganj-1500',NULL,1090,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1090/certification/Ij5Oh2oEBFVIdvDhHQqDMeU4UWt0XiyyDZxgqjkl.jpeg','Bangladeshi','10',9,8,'+8801911205293','77','2004-09-09','md.raaisur.rahman@gmail.com','N/A','1','1','1','+8801713538611','harisur1969@gmail.com','Md.Harisur Rahman',NULL,NULL,'Businessman',NULL,'1',NULL,'N/A','Rahman',NULL,'+8801911205293','haris.choby@gmail.com','Razia Khatun',NULL,NULL,'Housewife',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1090/student_photo/M7pLmInkGxMztyjVQNDYgnoNwpVuJi7O6JsvoAiP.jpeg',NULL,'1500','1',NULL,'Moddho Courtgaon Road,Munshiganj Sodor','K.k.Govt.Institution','2019-11-27 06:43:19','+8801711783554','male',NULL,'Munshiganj','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1090/marksheet_previous/AcZfbHfz7KbZvA1Ug6LIvt2SkHEFlD3NfZ1yQOf7.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1090/marksheet_previous_two/aw4gmSdMU0c3Uh3mgIoXhpNVybEG4ISARPKKkHDW.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1090/marksheet_current/CHxGhPHHcE5WOpEedjLjFHZLeqRGVFHRQHq058Lp.jpeg','N/A',1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Munshiganj',2,'1001207420',360000,2,'6852401014',-1,'Munshiganj, Dhaka',1500,'Munshiganj','Md.Monsur Rahman Khan','+8801711783554',NULL,1,NULL,1,NULL,'I want to apply in YES program to learn about the foreign culture as well as I will share about our culture with the people of others country. In this program, many people from different countries can exchange their culture with others and can gather knowledge. I think it will be a great opportunity to me to know the foreign culture.','I wish to share aspect of Bangladeshi glorious language to my American family. We have achieved \"Bangla\" language as a mother tongue through the sacrifice of many lives in 1952. International Mother Language Day was declared in 1999 by UNESCO and it has been observed throughout the world since 21 February 2000. \r\n\r\nAt present, more than 6000 varieties of language exist around the world. But all over the world, our martyrs are very recognized and honored as they are sacrificed their lives for the language. Bangla is very rich language and it has a long history. I would like to share our liberation war, freedom and historical glory to my American family.',1,'Newspaper',NULL,2,'2019-11-20','2019-11-19',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1090/school_seal/DKQ31Irnd4RO2A7Glftg17RvM5Uz3LCVrzPKr0wn.jpeg'),
	(213,'Hasan Md. Hasirul Haque Eram',1,0,NULL,'Dhaka, Dhaka',NULL,19,'As a member of \'West End High School Scout Team\' I have got various opportunity to work with road/ traffic safety to encourage people to use zebra cross or foot over bridge. On the other hand, I also work with school cleaning team and program management committee. My social service activities are not so big but those are enough to make me happy and think more for my society.',NULL,'32/V(New), Azimpur gov. Colony, Lalbagh, New market, Dhaka.',NULL,1091,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1091/certification/CoeA8eXUd40i6B1OxhX9JByYlnS8F1sQRqQdqYj0.jpeg','Bangladeshi','10',9,8,'+8801631477530','60','2005-01-12','erameram81@gmail.com',NULL,'1','1','1','01817698060','erameram81@gmail.com','Md. Imdadul Haque',NULL,NULL,'Government service(Retired)',NULL,'1',NULL,NULL,'Haque',NULL,'01673496260','chefemonkhan@gmail.com','Halima Akhter',NULL,NULL,'Government employee',76,78,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1091/student_photo/MNdepwF2o3dSGgQBfybad5lpsDWJa44Enr1NRV3r.jpeg',NULL,'1205','1',NULL,'Lalbagh road, Dhaka-1205','West End High School','2019-11-27 06:43:19','01718105144','male',NULL,'Lalbagh','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1091/marksheet_previous/89b7NhXODhS4pfzulUSjfNmRX2YITci832YCc77J.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1091/marksheet_previous_two/CeUomRudPxZd4zRjq8XvG6d7gBLmi8RCaPcgIyOx.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1091/marksheet_current/3uCp9FP763w3YOXaF5FPhN1g5P6nMHC9SyESfJpz.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BK0073131','2021-01-30','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1091/student_passport/HATHI4SOHKnjMawwE3wziEz6hvelv5Lz38r3LC0M.jpeg','Dhaka',2,'19532611293184843',300000,2,'19662611293184844#',450000,'Dhaka, Dhaka',1205,'Lalbagh','Arun Kanti Bishwash','01718105144',NULL,1,NULL,1,NULL,'Firstly, I want to explore American culture and norms, specially my interest is to know about the up-growing students from different community. Secondly, I strongly believe that this experience will help me to shape up my aim in life. And finally, YES program is a very well reputed platform to engage with new friends and influences. I remain, I will be able to incorporate the experience with my future vision, after I come back from the program.','I want to share my Bangladeshi local games, cuisine, fairy tales and funny local proverbs with my American family. I would love to teach Bengali local games like \'Shologuti\' or \'Gollachhut\' in the evening, also share funny local jokes and quizzes before sleep. As I am born and grown up in Dhaka, which is considered as the \'city of mosque\' so I\'ll also share my \'Friday mosque stories\' with them. Besides, it would be more interesting to me if I can cook any easy Bengali recipe for them, probably \'Khichuri\'.',1,'My Family Member',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1091/school_seal/rsabrAZl0ZrxlVSf2OdDnwVzVMQJEdFwFePLBxNS.jpeg'),
	(214,'Soha Farhin',1,0,NULL,'Dhaka, Dhaka',NULL,19,'No, not yet. But I have recent plans to teach younger students',NULL,'House-231/B,  Road-10/A(new), 19(old), West Dhanmondi, Dhaka-1209',NULL,1107,NULL,'Bangladesh','10',9,7,'+8801715010411','85','2004-09-23','sohapine123@gmail.com',NULL,'1','1','1','+8801715010411','fattah1707@gmail.com','Md. Abul Fattah Pine',NULL,NULL,'Software Engineer',NULL,'1',NULL,NULL,'Pine',NULL,'+8801916504871','qsalma2020@gmail.com','Quazi Salma Islam',NULL,NULL,'Unemployed',85,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1107/student_photo/J61nMWeNU31i62taQG3h9tGrsXU62bJi5Z1C5EyU.jpeg',NULL,'1209','2','San Antonio, Texas','Road#14, House#11, Dhaka, Bangladesh','Daffodil International School','2019-11-27 06:43:19','01713493291','female',NULL,'West Dhanmondi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1107/marksheet_previous/p5na5Ruxos22ytVkhma9l6pennO4MVrCicmKfN9F.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1107/marksheet_previous_two/X78p937x8eo9VpKxqVn5XpJeHqJdzUxc2v7JubxP.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1107/marksheet_current/Y5JVQanhfgeCszmcKz9cfhiwf8R2zm6Y4xUgGLA4.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Lakshmipasha, Lohagara, Narail',2,'19722691648051837',900000,2,'2691648051836',-1,'Dhaka, Dhaka',1209,'Dhanmondi','Dr. Md. Mahmudul Hassan','+88029135455',NULL,1,NULL,1,NULL,'Wanting to improve my English skills is only one of the reasons I wish to apply for the YES program. I think limiting it to just the sole purpose of improving ones English strips the program of its essence. There is a whole lot more to it than just that. For me the prospect of living in America is thrilling, and not for just the obvious reasons either. I see it as not only providing me with the privilege of being able to explore America, discover and learn more about the American culture, but also instilling in me various important qualities. To wit---developing independence; adjusting to different places, cultures and people; and coping with drastic changes in life. And about the high school---I feel exhilarated thinking of all the memorable experiences that I could be having. Spending one entire school year abroad means all the different opportunities it offers. Various extracurricular activities that are not always as readily available here in Bangladesh like ModelUN, volunteering.','I feel from the bottom of my heart that the Bangladeshi culture is diverse, rich and colourful. I might not be able to represent the entirety of the culture in one year, but I\'m confident I will be at least able to give them a glimpse into this wonderful richness that our culture is. There\'s the cuisine, of course-the mouth-watering variety of delicacies based mostly on the spicy, gravy side. There\'s a lot to impart about the various festivities and events. Also, about the people: how festive and cheerful Bangladeshi people tend to be and most importantly, that they make the most wonderful hosts, catering to guests with perfection and respect. How the culture demands respect for elders, how close-knit families tend to and how warm family gatherings tend to be. The warmth and love that Bangladeshi culture is.',1,'A YES Alumni Member',NULL,2,'2019-11-24','2019-11-10',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1107/school_seal/qwLeJpoWWCXS50Ojw6JksYFPVOFnmcLU6r74vKMM.jpeg'),
	(215,'Saifur Rahman',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I\'ve been a shy type of person since childhood which means I didn\'t really like participating in programs that required me to be more talkative or communicative with others. But in the past few years I\'ve changed myself and worked on my communication skills so that I can present myself as someone more open towards the people around me. I didn\'t get any chances to be in a social service type situation but if I get this kind of opportunity I will try my best to make the members in my community overcome the similar issue that I had in childhood and get their real persona out.',NULL,'496, North Shahjahanpur',NULL,1113,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1113/certification/b9xn1UTUB32IvNAIvI3Twl8NqCD4ctg1jmUkvSGq.jpeg','Bangladeshi','10',9,8,'+8801753333542','66','2004-08-11','sayed.saifr@gmail.com','https://www.facebook.com/Sayedsaifur.rahmansn/','1','1','1','+8801673538027',NULL,'Sayed Safiqur Rahman',NULL,NULL,'Private Service',NULL,'1',NULL,'https://www.instagram.com/saif_.ur/','Sayed',NULL,'+8801937626091',NULL,'Jannat Chowdhury',NULL,NULL,'Beautician',66,66,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1113/student_photo/jvfq26qdT4xtVTn3ZV46Zej3GQ9jAUrc5k68el8j.jpeg',NULL,'1217','1',NULL,'48 Shantibag, Dhaka','Shantibag High School','2019-11-27 06:43:19','+880258310107','male',NULL,'Shahjahanpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1113/marksheet_previous/a2MFrREpZ45yCCX582z7gUtFq8vPOTo2ioUvpBcp.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1113/marksheet_previous_two/NvNKUBIGO8Nw2yYDPxA7VzaoxU3HRiW8OCVtEhBV.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1113/marksheet_current/208GRqfKUIbIkqKxXawc4dBrxdsJVMAhd1EqKaIG.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-12-01 05:19:35',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'2693624614558',180000,2,'7764376690',120000,'Dhaka, Dhaka',1217,'Shahjahanpur','M.A. Rahim','+8801718583250',NULL,1,NULL,1,NULL,'i want to apply because i am getting a chance to travel this beautiful country, I\'ve always wanted to travel around the world but it\'s expensive and this might be my first opportunity to do it','There are quite a number of misperceptions about my religion which are very misleading and make my religion and my people seem hostile and that is absolutely not true, I\'d like to clear that with my american family. Our cuisine is one of the richest and most delicious in the whole world and I want to let them know about it. We do have some different clothing\'s that american\'s don\'t know about which I\'d like to share as well. the weather here is  different than any other country in the world and it has a big effect on our culture, it\'s a unique one. That is something I need to share with my american family.',1,'A Friend',NULL,2,'2019-11-11','2019-11-11',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1113/school_seal/gkkJ3cxCvzijvTcyJwwIqDgvfdD9D79PUx8Vyptz.jpeg'),
	(216,'Md. Aftab',2,0,NULL,'Chattogram, Chattogram',NULL,19,'I haven\'t any experience participating or organizing a community service project ,but if have the opportunity I will try to eridicate illiteracy from the community. Because of being illiterate we are lag behind. If I have the opportunity I will try spread out the light of the education among villagers.',NULL,'Care of:Mr.Harun\'s House,Holding :2102,Road no:5,Akbarshah Mazar Road,Chattogram',NULL,1119,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1119/certification/HPGfu7DkifZWXrSzJnSA19O5kNxL1x5QrKKmbvYk.jpeg','Bangladesh','10',9,8,'+8801817203657','77','2004-03-18','m.aftabelias57@gmail.com',NULL,'1','1','1','+8801817203657',NULL,'Md.Harun Or Rashid',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Elias',NULL,'+8801630206251',NULL,'Rabeya Rashid',NULL,NULL,'Unemployed',75,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1119/student_photo/LILvBigdOPO3W1gW8bMFCtAcq4FcvIyrbUQg7RTe.jpeg',NULL,'4202','1',NULL,'Ice Factory Road, Chattogram','Chattogram Collegiate School','2019-11-27 06:43:19','+880312863055','male',NULL,'Akbarshah','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1119/marksheet_previous/5frPzAZpAtBVobpmyxTnBaUVzeCId2srHO2f0ooh.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1119/marksheet_previous_two/Kt0gJ8Nplz270ANJdCyVjXNULQ7rKichjA65Zixv.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1119/marksheet_current/jGiPmqoxyKorHoVL5FgTj9VOAH9GduD6tj02G6zk.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Chattogram',2,'2825686526',300000,1,'1925742908',-1,'Chattogram, Chattogram',4200,'Double Mooring','Mr. Debabrata Das','0',NULL,1,NULL,1,NULL,'I have a great interest to know about abroad culture and I haven\'t travel to any other country yet,truly I have never get a chance to travel. So I\'m thinking ,that is a great chance and I always wants to represent my country before others. Moreover I want to know about others too, as well as I am so interested in advanced America . That\'s why I would like to apply.','I wish to share about my country\'s variation of language and religion.\r\nMy country Bangladesh is a small country,but there a great variation is present. Language varies from district to district and culture too.\r\nMainly there are four religions are seen in our country. Islam, Hinduism, Buddhism and Christian. But the people of our country behaves with others as they are brothers and help each other. The people of our country may be poor but they\'re very cordial and mutual. \r\nI wish to share with my American family about all those.',1,'Newspaper',NULL,2,'2019-11-23','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1119/school_seal/QbvW0biVrFm1ZBneDzheV27uRlO4xXPyv6309pDV.jpeg'),
	(217,'Ashik Bin',1,0,NULL,'Mymensingh, Mymensingh',NULL,19,'I feel better because community service is a very important part of the program',NULL,'Mymensingh,Bhaluka',NULL,1121,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1121/certification/MSgjwx8ZbBMOLco2NZXkLpcn0VmClwcu2yF108hW.jpeg','Bangladeshi','10',9,8,'01300652456','70','2004-02-22','aliffabrar720@gmail.com','Aliff abrar','1','1','1','01726411809',NULL,'Ibrahim Sharker',NULL,NULL,'immigrants',NULL,'1',NULL,'a__l____i__f','Ibrahim',NULL,'01300626328',NULL,'Lipi Nasrin',NULL,NULL,'housewife',70,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1121/student_photo/EUBRS46AmCGptB8YEfWvuMzlwenyBsXFq80GYDhU.jpeg',NULL,'2240','1','Bangladesh','Bhaluka upazila','Bhaluka pilot high school','2019-11-27 06:43:19','01300652456','male',NULL,'Bhaluka','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1121/marksheet_previous/CQgrwbuSNQj2uD35rXUcgStMGDBzEy5Nj25kUO0M.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1121/marksheet_previous_two/nBKjtCmWsFVKjxbJUlZIf2ohJ2lYY8fkBTKSwSdD.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1121/marksheet_current/zbjYCoRtE4jQZPp1wot5IxcoapzH5cSPRg93HFfb.jpeg',NULL,1,NULL,'study',NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,'I am a citizen of Bangladesh','i have vision disabil',NULL,NULL,NULL,'Mymensingh',2,'no',500000,2,'6111314703438',100000,'Mymensingh, Mymensingh',2240,'Bhaluka','ashikkulla Chowdhury','no','No',1,NULL,1,NULL,'I want to study in america. Because I had many dreams of going to America','I would like to highlight the culture of our country in kitchen clothing and so on And I want to do it in peace with everyone',1,'A Friend','I googled scholarship opportunities',2,'2019-11-11','2019-11-11',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1121/school_seal/tMN03Bpez2FLahIoB9soIWCpJvy92uiW6V8fP5vz.jpeg'),
	(218,'Afifa',1,0,NULL,'Chattogram, Chattogram',NULL,19,'In the last few months, I have been involved in a community service of teaching 10 young slum dwellers near my house. I have joined a club known as BetterWe, which is ran by one of my teachers from 9th grade. It is a free evening school for underprivileged children allowing them to work in the morning and carry on with their studies in the evening. The schedule is designed this way to not hamper their personal lives and studies. I take classes thrice a week from 5pm to 7pm. I teach them Bangla, Mathematics and basic English. One of the students has already sat for her Junior School Certificate board exams, and another student is yet to sit for her Primary School Certificate board exam. Through teaching, I motivate them to set their life goals, and acknowledge them how education can help change their lives for better. Besides, I help them to take their own decisions and make them aware of their rights. This as a result will help them navigate through life and secure a brighter future.',NULL,'392/E by lane Chandmari Road, Lalkhan Bazar, Chattagram',NULL,1122,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1122/certification/SyADA9yNnkrzkPhq1zhWc8AdUvHYCxB5SpUjIqXE.jpeg','Bangladesh','10',9,8,'01711829585','92','2003-05-10','tabassumdibba1@gmail.com',NULL,'1','1','1','01711829585','alamgir.hispeed@gmail.com','A.N.M Shahid Uddin',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Tabassum',NULL,'01749451292','salinashelly1969@gmail.com','Salina Akter',NULL,NULL,'Unemployed',89,79,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1122/student_photo/ksID5LbggWv9iF76B3TFw8gcyUWNAmYlVW7tcFwW.jpeg',NULL,'1212','1',NULL,'House 51, Road 2, Panchlaish R/A, Chattagram, Bangladesh','Presidency International School','2019-11-27 06:43:19','031-655108','female',NULL,'Khulshi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1122/marksheet_previous/kF3mNfi37mxShaPawCjNj3YIPDK1fDp0CeAP4yAU.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1122/marksheet_previous_two/QiVvNj3tti1ccRWiU7DYKlbVQq0bCApZYcYPQR1u.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1122/marksheet_current/ZAsJY9Q2xihdUxA3thV5QdYrvCTzsDqf8lC2toeC.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Chattagram',2,'19621594314266210',1500000,2,'1594314266211',-1,'Chattogram, Chattogram',1216,'Panchlaish','Mohammad Jashim Uddin','01610130317',NULL,1,NULL,1,NULL,'Growing up, I always had a keen interest in exploring the outer world. Knowing about others culture and lifestyle has always been fascinating to me. Recently, I came to learn that YES Program provides these opportunities for young learners. Upon realizing that this could be a life-changing event, I fixed my mind to go ahead and apply for it. It would be very thrilling for me to know about the American society and schools. Besides, I want to challenge myself and test my own limits compared to other learners. In order to build myself up, I wish to find my strengths and weaknesses and come out of my comfort-zone. Moreover, I am sure this program will help me to carve myself and fit into new environments and achieve experiences. Apart from these, I want to overcome my homesickness and take my own responsibilities. This program will not only give me confidence, but it will also develop my leadership skills. Lastly, I want to get into Ivy League university with scholarship opportunities.','Bangladesh is immensely fraught with enriched culture which has multifarious aspects.The aspect that I wish to share with my American family is the cuisine of it. \r\nRice and fish are the foundation of diet. A large span of fish from the Bay of Bengal, meat, various vegetables are cooked in spicy curry (torkari) for regular lunch and dinner with sauces that incorporate cumin, coriander, cloves, cinnamon, garlic etc.  I would like to cook savory chicken with curry and rice for my family and notify them of its delicious taste.\r\nThere is a tradition is making roti, made of wheat for breakfast, and eaten with eggs and curries. I would like to make roti as breakfast for my family and tell them how healthy it is. Another liked item is pitha, which has wide ranges. Pithas are made in aesthetic designs on special events, such as Pahela Baishakh. The common ingredients are flour, molasses, coconut, dates, etc. I would like to make Khejur pitha for my family so they have its delightful taste.',1,'My Family Member',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1122/school_seal/43tFsqaqTGl7KFFDDuXOol0d685yf8dBmrzHVoCA.jpeg'),
	(219,'Al Shams',2,0,1,'Pabna, Rajshahi',NULL,19,'If I get a chance to do something for the society,surely I will do it.In Bangladesh,illiteracy is one of the main problem of it.It is the reason for backwater of a country.At present many people of Bangladesh are illiterate.They can\'t read or write.Bangladesh can be promoted by decreasing the percentage of illiteracy. So, If I get a chance I will teach the illiterate people of villages means I will start a night school.At there I will give them the common knowledges and the knowledges they need about.By doing this, they can do something better for the country and society.Many of the people don\'t know how to survive well.They don\'t know well about what they do and their work.I can teach them all these at the night school.By getting the knowledges,they can do better their work.By doing this,surely it will make a positive change to the society.',NULL,'Bhangura Bazar, Bhangura, Pabna',NULL,1124,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1124/certification/3uOiyfc8TmOw1JYKi4Z2FuiIBeY4sbG5OeTRx7cs.jpeg','Bangladeshi','11',10,9,'01979683411','60','2004-08-19','anisuzzaman223@gmail.com',NULL,'1','1','1','01719536595','alshamstamim2@gmail.com','Md Arifuzzaman',NULL,NULL,'Non Government Job',NULL,'1',NULL,NULL,'Tamim',NULL,'01739170373','alshamstamim2@gmail.com','Mst. Zibon Afroz',NULL,NULL,'Housewifr',83,88,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1124/student_photo/LRjbE0kbzuxvmUFrwDUpKZY7cPNyCD7HZQ1WrVQ9.jpeg',NULL,'6640','1',NULL,'Bhangura Bazar, Bhangura, Pabna','Govt. Bhangura Union High School and College','2019-11-27 06:43:19','0732856039','male',NULL,'Bhangura','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1124/marksheet_previous/NyeruyxYm0S6SXJuavfVi006Kd7cL8DTETNh45v0.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1124/marksheet_previous_two/bRz96NdVPvoa6NEKbFYeswgZRT3QP4MWBRHYhFKb.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1124/marksheet_current/8BhV3G6KLzVgikeeuzMYIVKDr8fYViiG9UIky5HN.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Bhangura Bazar, Bhangura, Pabn',2,'6111317653353',300000,2,'6111317662388',-1,'Pabna, Rajshahi',6640,'Bhangura','Md. Rofikul Islam','01712351001',NULL,1,NULL,1,NULL,'I will say very shortly.The main reason of applying for the YES program is my love for travelling ,met new peoples,make new friends and spend some time with them.I also love to live my life.I get self-possession when I travel,met new people,make new friends and when I see the Nature.From my childhood,my dream is to go abroad and to see how the world is !But in my life , I never got a chance to go abroad and do all this things I love.This is the first time I got a chance to go abroad and fulfil my dreams.So, I don\'t wanna miss this chance at any cost.Honestly this is the reason but studying in the U.S.A and doing something extraordinary is also the reason of my applying for the YES program.Thank you.','The people of Bangladesh\'s way of life makeup the culture of Bangladesh.The way of Bangladeshi people\'s life is very simple. But there is a proverb says,\"Gorgeous in simple\".I think I can use this for representing Bangladeshi cultures to others. Bangledesh\'s primary religions Islam,Buddhism and Hinduism have played a critical role in influencing the country\'s culture. The most wide spread religion in Bangladesh is Islam,which constitutes 87% of the citizen of the nation.Buddhism and Hinduism are also popular religions. The dress preferences in Bangladesh are unique.Bangladeshi men\'s wear in rural areas is the lungi with formal clothing being suits and trousers. In women the main dress is saree.Bangladesh\'s cuisine is renowed for having e distinctive culinary tradition.I can share all these with them in many ways and I think If I stay some days with them,they will get known about Bangladeshi cultures by having me with them.',1,'Newspaper',NULL,NULL,'2019-11-17','2019-11-11',1,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/239/file/2X3ABcceP3q6RrKAnaKQnCWEW80jFMSMy4F73iiI.pdf',NULL),
	(220,'Tanannum Azad',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Like many other countries of South Asia, child labour persists in Bangladesh. A child has to work for his livelihood when the child is supposed to go to school for education. The poor economic condition is the first and foremost reason for child labour in Bangladesh. It is not possible for the parents of a poor family to bear the cost of the children\'s education after arranging their living cost. As a result, the guardians of these children lose interest of sending their children to school. In these circumstances, their father or mother thinks that it would be beneficial for them if their children engage in any occupation and earn bread for the family. Education deprived children easily get involved with crimes. Children are the precious wealth of the nation. That\'s why I want to open a free night school that helps poor primary school students with their studies. I want to teach the students up to class 8 and teach them an assortment of skills.',NULL,'Sector-11, Road-15, House-53',NULL,1126,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1126/certification/rTyTnlv4K27QqcmuGvTk5REiaoJzMDkDY355MWrM.jpeg','Bangladeshi','10',9,8,'01840203885','62','2004-02-26','tanannum.arufa2004@gmail.com','https://www.facebook.com/profile.php?id=100009771150591','1','1','1','00966557923483','azad.hossain.bd20@gmail.com','Azad Hossain',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Arufa',NULL,'01840203885','sharminprokrity@gmail.com','Sharmin Azad',NULL,NULL,'House-wife',65,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1126/student_photo/cAS2mPvgogb8694DJJrB9VUXD7KiNlCYLS4vlPqu.jpeg',NULL,'1230','1',NULL,'Sector-11, Road-09, House-22 Uttara Model Town.','Milestone School & College','2019-11-27 06:43:19','02-48963437','female',NULL,'Uttara','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1126/marksheet_previous/lWpCQ3JfpTkLpQitZiqlqsw2WWtq3qCXu7IJctnM.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1126/marksheet_previous_two/mHu50ycbach5w0Kiug1csd5zDy06EcyoM5CVFaPq.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1126/marksheet_current/KUiSjGkT1IIN9ofTXHnKKodCZDhLwhPQlzhC7UaG.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'EA0439677','2024-04-16','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1126/student_passport/CiY9uZvzXVVAHPK5PFMWX0B2LcLvBT0xiQjDmTCS.jpeg','Dhaka',2,'BC0983651',1000000,2,'BB0221770',-1,'Dhaka, Dhaka',1230,'Uttara','Lt. Col. M. Kamaluddin Bhuiyan','02-58957733',NULL,1,NULL,2,'My older brother for the academic year 2016-2017','YES program is a great platform to talk about cultural diversity and breaking down barriers between people of different cultures. Which will help us to recognize and respect ways of being that are not necessarily our own. So that as we interact with others we can build bridges to trust, respect, and understanding across cultures. Through YES program I can meet a group of people that shares a complete different cultural background than mine and we can share our own aspects of our culture. Which hopefully will help me to increase my level of understanding about other cultures by interacting with people outside of my own culture. The K-L YES program serves me an opportunity to create a new level of awareness for people in my new home who may not yet know about my culture and lead them to an understanding that we are all more similar than different.','By sharing aspects of my culture, I am creating an exchange that has many benefits. I can hold on to the heritage that I left behind while also introducing my world to my new home. I can bridge the gap by sharing aspects of my culture like the language, traditions, cuisine, clothing etc. For this, I may take the time to share with my new home how I celebrated important milestones like births, religious events in my home country. Also the way we talk and interact with so many different people.\r\nDisplaying a traditional dance can also provide me with an opportunity to share the story of my ancestors with my new home.\r\nI can also start small by just talking and sharing stories and experiences of my home country. By talking to the people around me about my culture, I can maintain my identity and traditions while adapting to my new surroundings and bonding with new people.',1,'My Family Member',NULL,2,'2019-11-21','2019-11-11',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1126/school_seal/QG0mmZ2X7vrlISerKbCpdH96qd6eqbOHX1bpNLNx.jpeg'),
	(221,'Samia',1,0,NULL,'Narayanganj, Dhaka',NULL,19,'I didn\'t get any chance yet to do any community service in a wide range. But I\'m willing to do something to bring a specific positive change in our community.  As we know menstrual hygiene is a serious issue for all of the girls and women. So we all should be concerned about it. In some rural area of our country it considered as a taboo to talk about openly and girls don\'t know the proper sanitation. It causes many diseases and some are life-threatening. Girls even don\'t go school on their menstrual cycle. In some area they don\'t get proper sanitary goods. So I want to break these stereotypes by working for them. If i get a platform like YES program, It\'ll give me experience and I also can gain knowledge and their thoughts that would definitely help me to accomplish my aim.',NULL,'2/1 Sher-e-Bangla road, N.Ganj sadar,Narayanganj',NULL,1128,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1128/certification/nm6Wnl2Z8EsUGELvFiSQwiRkYmKPuSZfhF2fycg3.jpeg','Bangladeshi','10',9,8,'008801675181333','70','2003-06-21','samiasahjee@gmail.com',NULL,'1','1','1','008801957817661','shahinsahjee@gmail.com','Md. Saheen',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Akter',NULL,'008801675181333',NULL,'Mst Pervin Begum',NULL,NULL,'Housewife',60,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1128/student_photo/WSpvX8ar8n62827tQ0GX64PgGpBhH0CACTTkz9zn.jpeg',NULL,'1400','1',NULL,'Sher-E-Bangla Road','Narayanganj Govt. Girl\'s High School','2019-11-27 06:43:19','008801712048128','female',NULL,'Narayanganj sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1128/marksheet_previous/gcSZvzkiwSefbKewv9girSqoMI1UOxLF5GXuZLJd.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1128/marksheet_previous_two/SMw6C13bQS47o32c4eifUwwNxuM3yzC1IcUNdWds.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1128/marksheet_current/7CXj8OED7ydJqkEES9acSzjlp0iEIhusS63BlF6c.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Narayanganj',2,'6725809034061',220000,2,'6725809034060',-1,'Narayanganj, Dhaka',1400,'Narayanganj sadar','Abul Kalam Mostafa','008801712048128',NULL,1,NULL,1,NULL,'YES program is giving me the opportunity to represent my country to the world. As I have a dream to go abroad for my higher studies and I always want to know people from different cultures and also want to share my colourful culture with them, so basically YES program is giving me a chance to fulfill my dream. That\'s why I am applying for the YES program.','We Bangladeshi are blessed with a colourful culture and glorious history of our language and Independence. I want to share our vibrant clothing tradition, our authentic south asian cuisine, our language, our significant history of our language and Independence etc with my American family. I also want to celebrate our colourful  festivals with them. We have a lot to share with different cultures people. I will try my best to share my culture with my American family by my activities.',1,'A YES Alumni Member',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1128/school_seal/0bLC0XkmQp4ly9BxcW3Feq92W04qQCJmtCExkBHP.jpeg'),
	(222,'ADIBA',1,0,NULL,'Dhaka, Dhaka',NULL,19,'NA',NULL,'NABINAGAR HOUSING, ROAD NO- 4, KHAN TOWER, FLAT NO-7C, DHAKA UDDAN',NULL,1131,NULL,'BANGLADESH','11',10,9,'01712490828','70','2004-07-25','raimcobangladesh@gmail.com','NA','1','1','1','01712490828','raimcobangladesh@gmail.com','MD. ASADUZZAMAN',NULL,NULL,'BUSINESS',NULL,'1',NULL,'NA','ZAMAN',NULL,'01749488696','raimcobangladesh@gmail.com','OMME SALMA',NULL,NULL,'HOUSEWIFE',70,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1131/student_photo/PRB4z5QldtraZuZGfneCtpojkpSBlwRAGNXt0ibi.jpeg',NULL,'1207','1','Florida','BAGHIA, NILNAGAR, GAZIPUR SADAR, GAZIPUR','BAGHIA MAMIN UDDIN SARKER ACADEMY','2019-11-27 06:43:19','01716345693','female',NULL,'MOHAMMADPUR','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1131/marksheet_previous/httkReVLAplZdLWjczjUfo6lWt5QrgT7S6hpXliN.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1131/marksheet_previous_two/4K1DKQznGUPwRyGHQnkFSgTxFwckAaDZFG4swF4M.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1131/marksheet_current/L4lF1AM8G8QQymULncK2r9b74IvEJ2Tvk3pyphLj.jpeg','NA',1,'0','NA',NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,'NA','NA',NULL,NULL,NULL,'TANGAIL',2,'9311967203189',360000,2,'9311967203188',-1,'Gazipur, Dhaka',1700,'Gazipur Sadar','MD. AMINUL ISLAM','01716345693','NA',1,'NA',1,'NA','Literacy to improve and lead a better life.','I want to live with a family that has Bangladeshi immigrant family living in America.',1,'Newspaper','Scholarship opportunitines',2,'2019-11-20','2019-11-11',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1131/school_seal/sjdtgnakYilMv0YxVWwEpzZxESuB08y3E7hWhEh5.jpeg'),
	(223,'Raihan Alam Ratul',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I participated in a lot of social service programs in my area. I worked as an organizer last year at a program where we distributed food(Iftar) to the poor and disputes in the month of Ramadan. I\'ve worked on a tree plantation program this year. I am also a new signing  member of The Lions Club. It\'s an international organization. We\'re the juniors so we\'re called the Leo\'s. We have more programs coming this December for tree plantation and distributing winter cloths. I love doing social works. I wanna do more for my country and this world. After all these experiences, I felt really amazing. Working for the people gave me inner satisfaction. And by doing all these social works, we can really bring a positive outcome. Like for example, the tree plantation program. We know the condition of our climate and atmosphere. If we plant more tree\'s worldwide and stop deforestation we can really bring a change and stop global warming. So social work is of course very important and effective.',NULL,'Sector 10, Road: 10, House:50 Uttara,Dhaka-1230',NULL,1134,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1134/certification/rR9Luk84pXSK4Jf9dcRXLEQ9PvPoD3gnqj6aBPqm.jpeg','Bangladesh','9',8,7,'01749901140','84','2005-09-18','ratulalamvlogs@gmail.com','https://www.facebook.com/Ratul.alam5454','1','1','1','01971433143','morshed001@outlook.com','Md. Morshed Alam',NULL,NULL,'Business man',NULL,'1',NULL,'@raetuzx','Ratul',NULL,'01778821540','to.morshedalam@gmail.com','Rokeya Begum',NULL,NULL,'Unemployed',78,75,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1134/student_photo/Wdl3x0DMHyklS2EXym8SQ6XVaSmYXsfnQMEdFoVp.jpeg',NULL,'1230','2','Michigan','30,43,44 Gareeb-e-Newaz Avenue Road, And Plot:37, Road:10/B, Sector:11 Uttara Model Town, Dhaka-1230','Milestone College','2019-11-27 06:43:19','58967733','male',NULL,'West Uttara','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1134/marksheet_previous/LYTiCybeNrM9GWle7xFXP3YsEvlH1g7ncDuVbl2U.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1134/marksheet_previous_two/tF4pdQL5ZTRFqkaf4gEgubfqQ16b9fGwMA2GdbN1.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1134/marksheet_current/cvnGfz0Z9NLSU3fXtsme38vKJZJAJVTfgCd6KAWa.jpeg','https://mobile.twitter.com/OfficialRatul',1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Comilla',2,'3323018439155',1500000,2,'9125249319',-1,'Dhaka, Dhaka',1230,'West Uttara','Lt. Col. Md KamalUddin Bhuiyan','02-58957733',NULL,1,NULL,1,NULL,'I am applying for the YES program to improve my education standards. I\'m willing to join this program because I want to improve my living standards as well. Also, I think if I complete this program successfully, I will be able to build up my career with high standard of qualifications and all that. Apart from that, I also wanna know more about the education systems, culture and different things about United States Of America. I think I can do some better things for my own country by knowing and gaining more knowledge about European countries like The United States. I\'m also looking forward to bring a better education procedure/system in my country in future. It\'s just a goal of mine. I really wanna do this course/program. I think, I\'ll learn a lot from this and maybe improve myself in different sectors and be a better version of myself. I am ready to go through any task to qualify myself as an eligible person for this program. I am confident enough to mark myself eligible for this.','Bangladesh is a very peaceful and friendly nation. It\'s a Muslim country but there are other religions too. The Bangladeshi culture is different from any other countries because we have so many occasions like The Bengali New year on 14th of April, Victory day, The Independence day, two Eid\'s, Puja\'s and many more. Women\'s here wear \"Saari\" and men\'s wear \"Punjabis\". Some  women\'s wear Kameez too. And men\'s wear Formal dresses. We speak in Bangla. Bangladesh is the only nation to sacrifice their lives for their mother language. The national food items are Hilsha fish and rice. We call it \"Pantha-Ilish\" in our language. Other than that, Chinese, Indian, European foods are deliciously made here. We also eat rice with beef, chicken or vegetables. Dhaka is the capital city. It\'s an amazing city. I\'m a proud citizen of this country. I\'ll surely invite them to visit Bangladesh. I love my country, Bangladesh.',1,'A Friend',NULL,2,'2019-11-21','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1134/school_seal/Dgfz9TMP2HlOP4I5vVaLS0C2m05uHU2kUp8T1HG4.jpeg');
