	(224,'Mashrafi Maherin',2,0,NULL,'Mymensingh, Mymensingh',NULL,19,'Community service is a very important and inseparable part of a community. As a student of a Government School, I have got a few opportunities to take part in community activities. Through the help of our school, we, the students have organized many seminars to create social awareness. We have discussed on various topics like early marriage, autism, women empowerment, health and sanitation and so on. Every year on 5th June, we come out of  a rally to create awareness about tree plantation on the occasion of Environment Day. We have also took part in creating awareness about saving the environment with the help of GEIST foundation.\r\n\r\nWe are way ahead with our social activities. We have arranged many rallies of students and teachers on these social subjects. Moreover, we have undertaken a plan to help the underprivileged children to get their basic needs. We are trying to encourage the mass to help in this noble purpose so that they can become more concerned about their community.',NULL,'26, Jamir Munshi Lane, Notun Bazar, Mymensing',NULL,1137,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1137/certification/Q7ULvhaCjJMzOAhCG8yIXqRUBuUGklj91WIdr3Yn.jpeg','Bangladesh','10',9,8,'+8801708538840','90','2004-10-25','mashrafimaherin05@gmail.com','m.me/mashrafi.maherin.7','1','1','1','+8801712220555','ruhul.fulbaria@gmail.com','Md. Ruhul Amin',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Rumpa Moni',NULL,'+8801712387510','dilara.fulbaria@gmail.com','Mst. Dilara Bithi',NULL,NULL,'Unemployed',88,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1137/student_photo/LKnVJJI3sjtqHRU2DCVqxWoolxOLIXf38IFW8w09.jpeg',NULL,'2200','1',NULL,'96, Gangadas Guha Road, Mymensingh','Government Laboratory High School, Mymensingh','2019-11-27 06:43:19','09162479','female',NULL,'Mymensingh Sadar, Mymensingh','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1137/marksheet_previous/uajCv4YyzTmWbjFI21veWuULOYXgkrzD8w28Njxe.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1137/marksheet_previous_two/V3Q7T0ZjxDfwfCvpk1AuHzPQs0BaLyjjJRzEAEMW.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1137/marksheet_current/uoZAQ01Bynd2Xyf1dMOQiqk7wSReDGvRYWoLkg8f.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Mymensingh',2,'6122008220074',150000,2,'6122008220016',-1,'Mymensingh, Mymensingh',2200,'Mymensingh Sadar, Mymensingh','Anjuman Ara Begum','+8801917028566',NULL,1,NULL,1,NULL,'YES is a platform that gathers the juveniles for a new experience of life. The experience which is beneficial for the further stages of life. If I get selected for YES, it will bring a turning point in my life. I will get a chance to get introduced with the most advanced education system of the world. More than that, I will get a one year opportunity for living in a new place, gathering new experiences and being acquainted with new culture and traditions. By living with a host family for a year, I can exchange many cultural habits and characteristics with them. Furthermore, there will be a bunch of exchange students like me coming from various countries of the world. I can build a sympathetic relationship with them and get acquainted with those various cultures of the world. When I will apply for the YES program, through a selection process, I will also get a chance to develop my qualifications as a student. For all these conveniences, I ardently want to apply for the YES program.','When I will stay with my host family, my every single activity will represent my country. However, I will try to share those cultural aspects with them for which Bangladesh is well-known. Language is one of them. I will try to teach them the basic forms of our language Bangla. As our country is well-known for folk music and instruments, I will try to introduce them with folk songs. I can also take some replicas of those instruments such as Monochord, Veena, Flute etc for them. \r\n\r\nI will try to make my host family introduced with our cultural attire and jewelleries. In fact, I will take our cultural attire like Saree and Punjabi for them from Bangladesh. I will also take some clay-made kitchenware and showpieces for them. Moreover, Bangladesh is famous for her spicy cuisines. I will cook some Bangladeshi dishes for them so that they can be acquainted with our food habit. Lastly, I will celebrate our cultural celebrations like Bangla New year, Eid and other cultural days with them.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1137/school_seal/6UB2sXYqoF2eHpuI7mbOUBlFWbn8xnhQVNie8gXx.jpeg'),
	(225,'Khushi T.',2,0,NULL,'Dinajpur, Rangpur',NULL,19,'I always try to be humble and polite. I love to help others. I always try to participate in any kind of volunteering work that helps the society. Last winter, in our school, I with my friends collected money for poor people to provide them blankets. We finished our project successfully by providing them blankets. I hope to give blankets to poor in this winter also. I did volunteering for my school. Our school arranged Math Olympiad. I, with the help of others, helped our school organising Math Olympiad. I gave inaugural speech on Math Olympiad then I played the harmonium for National Anthem. I gave question papers to the students and guarded them during the time of Olympiad. Then with the help of teachers we checked all the questions and marked them. This is how I participated on volunteering work. I prefer community services. If I get opportunity to help community, I will try my level best to help.',NULL,'Tulip International School (Y.M.C.A Station Road)',NULL,1150,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1150/certification/6qXtEPu5VxorrZIYPPpvqcz63IbdhlNu9700o4mo.jpeg','Bangladeshi','10',9,8,'+8801715169699','95','2003-10-31','khushi.hansdak@gmail.com',NULL,'1','1','1','+8801715169699','tulen.hansdak@gmail.com','Tulen Hansdak',NULL,NULL,'Founder and Principal',NULL,'1',NULL,NULL,'Hansdak',NULL,'+8801767780804','popidashansdak11@gmail.com','Popi Das Hansdak',NULL,NULL,'Teacher',90,91,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1150/student_photo/7IWdZvSIrCrvtJjBAcIPmfCVgEWuUaC1LxRHNASx.jpeg',NULL,'5200','1',NULL,'YMCA Bhaban, Station Road','Tulip International School and College','2019-11-27 06:43:19','+8801715169699','female',NULL,'Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1150/marksheet_previous/VQfPqX6BePBvwrM4B2dljhleVCEhMq8TrcTtpWQ2.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1150/marksheet_previous_two/uYLfFvrHf9b7rg43uAKjddWTQmpLY2VYygu4pppL.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1150/marksheet_current/592JPrbBHFNpTVJRqtqNejHvRh7JYDiC4Q3YZVMy.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BE0057779','2019-12-28','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1150/student_passport/M1UEaeAOZbtyelH0KC6cXTyyXA7EI3eGvBRenkvT.jpeg','Dinajpur',2,'6853439302',310000,2,'8652594804',120000,'Dinajpur, Rangpur',5200,'Sadar','Tulen Hansdak','+8801715169699',NULL,2,'India for vacation for a week, Sri Lanka for youth exchange program for a week',1,NULL,'There are numerous things to learn from America, the highest social status of citizens in the world, the centre for cultures of the world, religious freedom, dominating economic status of the world and the story of civilisation of hundred years, as well as its supremacy of being super power of the world. Qualifying in YES Program will me the opportunity to find the answers of my questions which are cherished and I dream about. I am excited to discover the highest educational standard of America to benefit my future. I am so curious to know about the lifestyles, fashions, food habits and daily practices of Americans. Moreover, it will provide me the opportunity to represent my country to Americans and other friends. I am really tempted to share the stories of Bangldesh with Americans.','Bangladesh is rich in culture. We have a lot of religious festivals, social festivals, clothing variations, several languages (mixed tribals country) and cuisine distinctions. Being a youth ambassador, I would like to share my American family about cultures, practices, traditions, creeds, religions, political and geographical phenomenon. It totally reflects the flora and fauna of this country. The independence of Bangladesh was achieved on 26th March, 1971. Our victory day is on 16th December. We have also fought for our mother language (Bangla). We have many national days such as National Martyr Day, National Mother Language Day and Pohela Baishakh (the first day of Bengali year). We have also many religious festivals like Muslims observe Eid Ul Fitr, Eid Ul Adha, Christians observe Easter Sunday, Christmas Day and Hindus observe Durga Puja, Laxmi Puja etc. I am excited to share much more about my country with my host family.',1,'My High School/Teacher',NULL,2,'2019-11-22','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1150/school_seal/tkxheMy68fIS3wNxoZhTifiD6ADwtZx7oxsfeUns.jpeg'),
	(226,'SUBORNA',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I am an active member of \"Angikar Foundation\". This foundation is found by my Elder brother. We work to educate deprived Street children. We have donated and collected a huge amount of money from different organization and renowned personal of our country in the service of poor people and lower earning community. \r\n\r\nI have participated in voluntary work of 1 National science fest, one flood relief camping & 2 National blood donation and blood group checking camping.\r\n\r\nI\'m currently working with \"Young Bangla\", the largest student community of Bangladesh. I am encouraging our youth to give themselves more involved in entrepreneurship and thus creating job opportunity for many unemployed youth.',NULL,'259/2, IBRAHIMPUR, Kafrul, DHAKA',NULL,1157,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1157/certification/holnrsyNKEAb4Js5O3DVsyMmNHrDrGPLxI6bDpsp.jpeg','Bangladesh','12',11,10,'+8801747993422','78','2001-04-19','sobur112@gmail.com','https://mobile.facebook.com/profile.php?id=100017129504277&_rdc=1&_rdr','1','1','1','+8801714713825','sobur101325@gmail.com','MD BAHAR UDDIN',NULL,NULL,'Government employee',NULL,'1',NULL,NULL,'AKTER',NULL,'+8801747993422','sobur33333@gmail.com','SABINA KHATUN',NULL,NULL,'Housewife',78,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1157/student_photo/5iFxQ3uo6UwicJynEO2tIt1t1iNRKqGuQcOHrn2A.jpeg',NULL,'1206','1',NULL,'IBRAHIMPUR, Kafrul, DHAKA','Shahid Police Smrity college','2019-11-27 06:43:19','+8801795714277','female',NULL,'KAFRUL','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1157/marksheet_previous/E8lUbuCScEoxU8JhZ38LYdGpOl5yHYPE7GItVwKW.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1157/marksheet_previous_two/svcPpYOrFGVDm9Nmr6g8DCGtHtYKNq8oUStRODnz.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1157/marksheet_current/HY7xhllyFG4yF8RHNLJXlEOsbxxB5AqSJwvrLGdR.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dinajpur',2,'1013880180',120000,2,'5986217866',-1,'Dhaka, Dhaka',1206,'KAFRUL','PPM Shahidul Islam','+8801521437953',NULL,1,NULL,1,NULL,'I want to get to know the culture of USA. Acquire Leadership skill from experienced teaches. Live in a new environment and fight with the challenging situation to be a world leader. I will learn from the society, culture and Creed\'s of USA and make a difference in Bangladesh, my Homeland.','I will be very pleased to teach my classmates the \"Bengali language\". We Bengali people had laid out life for our mother toung Bengali. I will let them know that, International Mother Language Day in 21 February every year is on honour of our Sacrifice. I will participate in all cultural and sport event to represent my culture and clothings. I will practice my Religion and believe that USA people will honour and learn from me. I will try to understand their religion too!',1,'iEARN-BD Staff Member',NULL,2,'2019-11-22','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1157/school_seal/3Q2ngAXuSX282UwWNAafBdmFWzkB39mb3diQ19dC.jpeg'),
	(227,'MD ZARIF',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Yes, I have organised many community services before. The most important thing to organised a community service is positiveness. One should be always very positive when a man is organizing a community service or any kind of program. And secondly a man should very helpful about their program.',NULL,'SIMIS TOUCH, FLAT-6/D, HOUSE NO-1098, ROAD NO-9/C, SECTOR-05',NULL,1158,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1158/certification/BwzFYpo5hWJDAZkjm61tpWVV1651bWBLrIbd5n42.jpeg','BANGLADESHI','11',10,9,'+8801910983647','80','2004-12-24','mzarifhossain@gmail.com','https://www.facebook.com/khela.hobe069','1','1','1','+8801857174960',NULL,'MD. ZAKIR HOSSAIN',NULL,NULL,'Govt. Service',NULL,'1',NULL,NULL,'HOSSAIN',NULL,'+8801626845992',NULL,'MAHFUZA KHANUM',NULL,NULL,'Govt. Service',75,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1158/student_photo/zgC7P386X8G190x4XiGIiBYlbMY3DQiP2Q2kHMlp.jpeg',NULL,'1230','1',NULL,'Road: 1 & 27, Sector-7','Uttara High School & College','2019-11-27 06:43:19','02-8912944','male',NULL,'UTTARA','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1158/marksheet_previous/zB5Q0sVewRQ0Jv0f5jWGApIOiES9inj5V9ozPdxk.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1158/marksheet_previous_two/Lr2CCv3qR3FSIPszgAxCY4u7n5qIJWGfXah6Dv4T.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1158/marksheet_current/13gncrQixQ2FFNbClVOi3slq6AJDKsIom96gF0QN.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-12-01 05:47:14',NULL,1,1,NULL,NULL,'BY0599498','2024-01-19','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1158/student_passport/NY5EzzBBrWVtqre2pqGgGRg8cpGhJzVTei0GFWMi.jpeg','DHAKA',2,'7319847179',500000,2,'2369859117',500000,'Dhaka, Dhaka',1230,'UTTARA','Hafizur Rahman Mollah','02-8912944',NULL,2,'Qatar',1,NULL,'I want to apply for myself betterment and also my dream is to study abroad from my childhood. And this is very important for out country.','Yes, I want to share my culture to them because our culture is so traditional. I think every country should know about our Bangladeshi culture and our culture is very colorful with lots of love.',1,'My Family Member',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1158/school_seal/nf4CzMfJHhn7yVO4ZMONynSibtkGYrq3TKseVXsW.jpeg'),
	(228,'Azrin',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I havent got the opportunity yet.  But if I can,  I would like to teach the child labors through out our country. I believe education brings development and I want my bangladesh to be a developed country.  I would gather my friends & youth. This service should be spread throughout the country.  We would open two shifts to teach throughout the country so that they can atleast earn a minimum knowledge.',NULL,'C-2/A, 2-F/3, Selpark, nasimbag, mirpur-2,dhaka',NULL,1173,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1173/certification/DnFPVOsbrbVfC3xkhRzyH63aBePApvgyWLk5GbnN.jpeg','Bangladeshi','10',9,8,'01783559424','75','2004-03-09','azrinselpark7@gmail.com','Azrin anika','1','1','1','01711932436','drashrafuddin92@gmail.com','DR.MD ASHRAF UDDIN',NULL,NULL,'DOCTOR',NULL,'1',NULL,'azrin.anika','Anika',NULL,'01721344741','drashrafuddin92@gmail.com','ZAHEDA KHATUN',NULL,NULL,'Unemployed',70,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1173/student_photo/AasLKUzLIo03ALnWtF2zCWNkj3NvyepiuSg84tYE.jpeg',NULL,'1216','2','Newyork','1/A,NEW BAILY ROAD,RAMNA, DHAKA-1000','VIQARUNNISA NOON SCHOOL & COLLEGE','2019-11-27 06:43:19','9333598','female',NULL,'Mirpur2','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1173/marksheet_previous/ZlNUe4EJ2VNacGKeGABIlOkVYxXq2jzM6lSZhRPp.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1173/marksheet_previous_two/6bhQFHUdLFIYjjiUOVydRLoMqFMfSgnfq0qAusQP.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1173/marksheet_current/DXUepss09PYvgsoAlAvpv4fCBRtqGCqqsdozLhJC.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BK0492529','2021-03-20','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1173/student_passport/LjhV8d4jKfJamgOLFU7GQ2KB9rz0oUG8MYrv037f.jpeg','Dhaka',2,'2694263701584',2000000,2,'19782694263700471',-1,'Dhaka, Dhaka',1216,'RAMNA','SHAMSUN ARA SULTANA','01684411706',NULL,2,'Kingdom of Saudi Arabia',1,NULL,'I always dreamt of reading in a school or college in outskirts. I want to get to their educational system & how I hold up myself in it. One of the other reasons I love to travel & this\'ll be a great chance for me to visit the USA as well as to get through their study system.  I would also love a chance to represent my country.','I would want to share our fearless history of language movement & liberation war with them. I love saree. I would like to get them know about our traditions & how people live here together.  I learnt singing at an early age. So I can definitely intoduce them with some wonderful bangladeshi music & I would love to do so.',1,'A Friend',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1173/school_seal/rp2pI4K4DHffuIs1KwMl8FBLV7TKM6NcefwzYLrq.jpeg'),
	(229,'ANIKA TABASSUM',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Well, I am engaged with Girl Guide, a non-political and international youth association for women devoted to educational and social services. Fulfilling all the requirements, I was honored with the Tenderfoot badge. I participated in a regional camp and also I am one of the co-leaders.',NULL,'150, East Tejturi Bazar. Dhaka-1215',NULL,1174,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1174/certification/d7vKVfR3MtyOEooRRhpSMjTp8MNJWVW5R0XM4Ang.jpeg','BANGLADESHI','9',8,7,'01552370905','80','2005-02-01','aklimaakter2370@gmail.com',NULL,'1','1','1','01819295142','barnaad@gmail.com','Mohammad Jaker Hossain',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'ADRITA',NULL,'01552370905','aklimaakter2370@gmail.com','Mst Aklima Begum',NULL,NULL,'Govt. Employee',80,84,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1174/student_photo/hj4ZCrRY6OxWmlKQFL4tuUsvXAT8OSjnmZt3wGcU.jpeg',NULL,'1215','1',NULL,'80,  kazi Nazrul Islam Avenue, Farmgate, Dhaka-1215','Tejgaon Govt. Girls\' High School','2019-11-27 06:43:19','029113348','female',NULL,'Tejgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1174/marksheet_previous/6Kky6zsCiGTQ55ZSO6M4gKPvERRbP7eegvXIL3Xo.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1174/marksheet_previous_two/sJh0RW3dSodsSkBFxbnD4uCbuMq2qcvn4yQO7Mq4.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1174/marksheet_current/jPJIpZmkI2eM00HVK5H97SnXyC5xIBw7QZZi0p7C.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,2,NULL,'I have a slight vision disability.','BT0354661','2023-04-16','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1174/student_passport/W5wpFahlSELzJ4Lg2Eh5ktkR6fQNtrym7Xy2AbkC.jpeg','Dhaka',2,'7778370549',480000,2,'7778668355',360000,'Dhaka, Dhaka',1215,'Tejgaon','Rebeka Sultana','029113348',NULL,1,NULL,1,NULL,'Because I want to explore American culture. Witnessing such a multicultural way of living will be truly extraordinary. Being able to relate to people in other countries is a great way of becoming more compassionate of different cultures. I know that I will enjoy learning about the country by delving into its history and traditions. And also their interesting lifestyle really fascinates me.','Representing the culture of my own country will be a pleasure. I don\'t think that I will be able to resist the pleasure of sharing the tremendous culture of Bangladesh if I ever get the chance to do so. Especially our cuisine and clothing. Bangladeshi cuisine is rich with spices but we can never deny our desire towards the dozens of sweets. I can surely introduce those mouth watering foods with the family by cooking them and they are gonna love it for sure.\r\nBangladesh is the home of a diverse range of traditional clothing which is still worn by people in their everyday life. We have unique dress preferences. I guess the members of the American family will absolutely love seeing themselves wearing saree or Punjabi. Introducing them to the fabulous traditional outfits of our culture will be something I will be looking forward to.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1174/school_seal/nMlGpSur5nppFjMRiAKo2Df5utuSOuvPV0Ua9a9n.jpeg'),
	(230,'Zubaida',2,0,NULL,'Dhaka, Dhaka',NULL,19,'from a young age, I was very enthusiastic about the concept of  community service. Yet I never really got a chance.\r\nI believe community service influences people a lot so, given the opportunity, I would like to work with matters like human rights, racism and climate change.\r\nI plan to help people who are bullied for their disabilities or colour and spread message of positivity and self love.\r\nI would also like to raise awareness about global warming and climate change. I would tell people how it can affect us and how we can prevent it.\r\nBeside those, I also plan on doing any other form of community service and if I get a chance, I hope to be the first to come forward and give it my best.',NULL,'House-429, Road-6, Mirpur DOHS, Mirpur 12, Dhaka',NULL,1175,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1175/certification/nTtdUZLn1ZklH8V6vqTFreTOuZrefNSTfovmXq9x.jpeg','Bangladesh','9',8,7,'01643395202','85','2004-06-01','zubaidakarim1437@gmail.com',NULL,'1','1','1','966556596658',NULL,'Monirul Karim Sujon',NULL,NULL,'Doctor',NULL,'1',NULL,NULL,'Karim',NULL,'01682713150',NULL,'Sharmin Ferdoushy',NULL,NULL,'Dentist',92,94,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1175/student_photo/wrr8n29slknpX2dmKREe7zuZj4QXdHwoJ2xnSciQ.jpeg',NULL,'1216','1',NULL,'8/7 Pallabi, Mirpur-12, Dhaka','Juvenile English Medium School','2019-11-27 06:43:19','01819285002','female',NULL,'Pallabi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1175/marksheet_previous/jZeZCtO68JeAicZ1YPQP61My5mLJd6wHT8pxxwDG.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1175/marksheet_previous_two/XKLngwkTnEasTemq6zVYYSI9NaLfEAV4uPXK4ILi.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1175/marksheet_current/dhgRT5SIsPQTIGm3UPcsgMPOmxJ90A26Kc2c9eTM.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'19722695434000012',480000,2,'19792695434707611',-1,'Dhaka, Dhaka',1216,'Pallabi','Mini Musharrat Sayeed','01711635906',NULL,2,'India for vacation, Saudi Arabia for visiting father',1,NULL,'I an interested in the YES program because of the opportunities it provide. I was always interested in exploring new lifestyles and cultures through YES program I could do just that. I want to meet new people from various backgrounds and nationalities and I would love to get to know them. I want to share my culture as well as learn about theirs and try to look at the world from a new and different point of view. also, YES program allows me to visit new places and explore, all while learning a lot. Lastly, by applying, I can test my potential, learn more, gather experience and see what I am capable of.','we Bengalis have a very rich and diverse culture and I would like to share it with my American family as much as I can. I want to take traditional Bengali clothes, ornaments, dry food and souvenirs that represent our culture and show it to them. I would show pictures of the various places and festivals of Bangladesh and share my experiences with them. I would tell them how we Bengali people love bright colours, music and spicy food. I would show them Bangla movies, play my favourite Bengali music, tell hem about Bengali folklore and literature to show our way of thinking.\r\nI will also tell them about my religion, Islam which is a majority in Bangladesh. I would tell them how peace loving people we are and would spread word about our values and virtues.\r\nFinally, I would share the history of our language and country. I would say how we fought for our mother tongue and independence. I would tell them of our struggles for independence and how patriotic we are.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1175/school_seal/kxbFLgsoFj0CglWXdJTOHey0iNUTlw573yqP1sas.jpeg'),
