	(233,'Ash-Shuara',1,0,NULL,'Dhaka, Dhaka',NULL,19,'The joy of doing something for the people and bringing a smile on their faces has always been priceless.To be honest, I never got into such events but I am anticipating to volunteer in such events and ensure to give my enough time to it because this quality of doing something selflessly for someone is a quality that we should have to make this world a better place.Community service can be anything like doing a public service, doing something for the needy ones,giving time to those who have disabilities, be there for people who don\'t have a family. then doing campaign for save the planet, women empowerment, self love, reducing child labour and sexual abuse. For me I don\'t want to stick to one thing but do a lot of projects because I am really fervent about it. I want to be a part of an organisation to do my work efficiently. In this way I want to bring a change to the society through community service.',NULL,'Mirpur-12 , Road-1, Block-C, House-8',NULL,1184,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1184/certification/5Ev0XHYlcsG7mv6NVCAWba1QMDyE5XAXLIMhX7ZX.jpeg','Bangladeshi','9',8,7,'01914012284','70','2003-05-18','ashfannana58@gmail.com',NULL,'1','1','1','01914012284','skjamal06@yahoo.com','MD Jamal Uddin Ahmed',NULL,NULL,'businessman',NULL,'1',NULL,'ash_fannana','Fannana',NULL,'01953927600','ashfannana58@gmail.com','Naznin Sultana',NULL,NULL,'housewife',77,88,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1184/student_photo/8E8HIsZRuAszGSbKxhZ92x1QypfU2Ne2PZIM7CNq.jpeg',NULL,'1216','1',NULL,'8\\7 , Mirpur-11.5 , Pallabi , Dhaka','Juvenile English Medium School','2019-11-27 06:43:19','01819285002','female',NULL,'Pallabi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1184/marksheet_previous/Z3XiMFTC5owfRAs1AdX9vRBUBOldRO1wMVPRuiZb.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1184/marksheet_previous_two/yXxw2luFo8iAZXS2bLnNFo8WIAqX4MdNaNDM029R.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1184/marksheet_current/rTEatMhbSLQVWQG1RHTRYtwIlLeEd8zqFAJO9J1V.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BY0673026','2024-01-26','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1184/student_passport/qcHbVHmPhyDc6IAynnN2AiA5WkmXaEfXWoZNFbPg.jpeg','Dhaka',2,'7339543352',1200000,2,'2696402502799',-1,'Dhaka, Dhaka',1216,'pallabi','Mini Mushrat Sayeed','01711635906',NULL,1,NULL,1,NULL,'Being an ambitious person, I want to stand out among the crowd. I want to have this feeling that yes, I accomplished so much in my life at such a young age. And I feel like for this participating in YES program can\'t get any better. Communicating with people,making friends have always been my thing to do. I want to talk to people from all age groups, religion, nationality, sexuality and just be there at the moment having fun ,learning new stuffs, sharing our mood together. Looking at the bright side, I can take a deep breath and say that for almost an year I didn\'t have a regular life,it was like riding on a roller coaster for me. So going ahead for this program plays an important role for me that is to get out of my comfort zone, getting to know about my capability, finding the path of my own and of course minding myself.','Sharing my culture , well that is what I will be there for.During my exchange year I will be presenting my culture in numerous ways starting from how we greet people to how we dress, what songs we like murmuring to and what not. I\'ll be telling the folks about how loud we get when it comes to celebrations and that we make people our own very easily. For us meals are not so plain, we look for a variety dishes in our plate like rice, lentils, curries, mashed dishes, fried dishes , pickles etc. Talking about our hospitality, that is to never let a guest leave the house in empty stomach and lot of formalities we like to perform. Letting them know how people from my land are really drawn towards emotions, how we love sticking by each other\'s side. And how can I forget to talk about how my motherland emerged as an independent one and the breathtaking history behind it. It will be so great representing my culture to them which is a combo pack of so many euphoric elements in it.',1,'A YES Alumni Member',NULL,2,'2019-11-22','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1184/school_seal/U2JHfYSxkwiJFKkSiKoxwb3dtfLBU0yObyiOrQ2f.jpeg'),
	(234,'Rifah Tasnia',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I have done very few social services. Once few months ago I used to work as a volunteer of USAID. Through them I held 3 workshops two in my village and one in a school.And once I was selected in the expo of Husky canal care for paws as a volunteer. And as participating in different organization I worked as head of security/director of conference manager in many MODEL UNITED NATIONS.',NULL,'HOUSE # 110/A, FLAT # C-06 5TH-FL',NULL,1185,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1185/certification/NquDH3fDBXsBXVY4Bfr7lZfhBwsr4MVg9PJIUjaV.jpeg','Bangldeshi','12',11,10,'+8801782248703','95','2002-09-02','inforifah0209@gmail.com','https://www.facebook.com/tasnia.rifah.75','1','1','1','+8801720100333','infolam2312@gmail.com','Muhd Sh Alam',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Bintee Alam',NULL,'+8801719367670','raktar0812@gmail.com','Ruksana Aktar',NULL,NULL,'Housewife',90,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1185/student_photo/Ag4wdpuEcUca9cItS4k1S3MvfgdeKJu4HBT9rGmK.jpeg',NULL,'1217','2','New York','85, Kakrail','Willes Little Flower School and College','2019-11-27 06:43:19','+88-02-9330703','female',NULL,'Ramna','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1185/marksheet_previous/Ok5DKUZ9lrKrcl3hj580GBauRaXrB5bGJH8O1twX.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1185/marksheet_previous_two/LVrQreMuM4xs3L7JavTvrG4pdwGoEpxRbCZKe3jG.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1185/marksheet_current/wJcMCYmctSJlx6jBj1TeQAfmIIipPNhnHKecqgD5.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BF 0305930','2020-04-26','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1185/student_passport/zDTFhRtFNXSAFO5VHZa2WbUgTCoAuoXycXmb5MOn.jpeg','Dhaka',2,'2822722688',1500000,2,'5972735053',-1,'Dhaka, Dhaka',1000,'Ramna','Syed Abul Hossain','+88-02-9330703',NULL,2,'India, Tourist',1,NULL,'YES Program is one of my dream program. I wanted to be a part of this from a really long time. I want to apply for YES Program to complete my higher studies under British US curriculum. And to enlighten my norms and culture with them.','So I will share our current problems, natural disaster we face in our country for our carelessness. I will try to give them the message how we Bangladeshi people survive from them. Moreover I will share my happy loving moments with my family which I would love to share with them too.',1,'A Friend',NULL,2,'2019-11-17','2019-11-17',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1185/school_seal/DQ578WJBXVUmI49zUv0vubg7Z7SXha7Llhd1UWrk.jpeg'),
	(235,'Tahsin',2,0,NULL,'Dhaka, Dhaka',NULL,19,'As i have mentioned before that i am amicable and friendly with others.So it is a great pleasure  for me to take part in the community services. A conscious student always takes part in the community service. When i have been given or got a chance I get involved in community services.\r\n\r\nI am an active member of \"Green Club\" of my school.I am the \"Vice President\"of our club.Every week we launch the cleaning program  on the school campus.Morever every month we take part in the cleaning programs of our neighbourhood\'s.I am also an active member of \"Social Welfare Club\".In the winter season we donate money for warm cloths and give it away to the poor people of our country. In this qay i serve my society.',NULL,'41/4,chand miah,housing. Road no:1 Mohammadpur',NULL,1191,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1191/certification/jwZhuBWRQdetzeWSZ9Y9x16qK2kbrc247fBpeihS.jpeg','Bangladesh','10',9,8,'01713438946','62','2004-10-18','zadidtausif@gmail.com',NULL,'1','1','1','01713438946','faruque@newage-group.com','Md.Faruque Hossen Mondol',NULL,NULL,'Service Holder',NULL,'1',NULL,'_tahsinoway_','Tausif',NULL,'01716588294','faruque@newage-group.com','Sultana Jahan',NULL,NULL,'Teacher',61,78,NULL,NULL,'1207','2','New York','Gaznabi Road,College Gate Mohammadpur, Dhaka','Government Mohammadpur Model School','2019-11-27 06:43:19','9138649','male',NULL,'Mohammadpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1191/marksheet_previous/GUsdWPNFAQtKG79K0VARAmX5JMzFjhmr4dDfO5Hn.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1191/marksheet_previous_two/YXPdutRswhDm8dl63f6I7SpXfSFWVwp6Ug6NY2K3.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1191/marksheet_current/Oc2DWEpRVv2U9eK1nhjRiKzpvwhK5E3ySXXRkqtn.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Jessore',2,'2696406680753',1500000,2,'4120408760923',350000,'Dhaka, Dhaka',1207,'Mohammadpur','Lt col Kazi Sharif Uddin,BIR','9138649',NULL,2,'India for visiting.',1,NULL,'I have a exceptional goal in my life.I want to go out of my country and study further.I think that YES program is that platform for me to go out of my country and study further.I want to be an exceptional person in my society.I want to have an exceptional value in my life in every sphere.I think that in Bangladesh people have to struggle much for shining in life.In here we face many different situations which are not acceptable for everyone. \r\n\r\nI think that YES program holds that power to help me in future. I want to study in America and   by this i can be a important person in my country.If i get the chance to study in America, I would have an exceptional value in my country. As i am a student ,i have that eager to learn and write. As a world citizen i want to make my country and family proud.','My beloved country Bangladesh is found with unique cultural aspects. We have a very unique language ,mouth watering foods, special clothing and co-existence of love. I would like to share my traditional food items with my american family .Specially I would like to focus on my cuisine and fashion and also religious values.\r\n\r\nI am a Single boy who loves to taste traditional foods and outfits like punjabi and pajams, The religious values of our country like peace and harmony.In addition I would like to shane my traditional food item with my american family.I want  pay them that the Bangladeshi people are peace loving, tolerant and passionate about the mankind.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1191/school_seal/ubEpPXgp38eleSlzjyVH3AfHhrioE8tQo1hSbuv8.jpeg'),
	(236,'Iamoon Nahar',2,0,NULL,'Chattogram, Chattogram',NULL,19,'Unfortunately, I don\'t have any experience in participating or organizing a community service.If I get any opportunity; I will make the best use of it.\r\nI love to help people and I will try my best to help people. I just want to make the society different by doing some social service.\r\nThere are so many people around us who don\'t get foods to satisfy their hunger.But some people are wasting foods day after day.I will collect foods from those people and give those foods to the poor.I will also discourage people to waste food and encourage them to serve the poor.\r\nThere are many orphan children around us who don\'t get opportunity for education,treatment,clothing.I will try my level best to help them.\r\nIn a word,I  will try to make the society a lovely and living place for all.',NULL,'Baki Mansion,Hares Shah Lane,South Badurtala,Chandgaon,Chattogram',NULL,1193,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1193/certification/di6Z4UMO0umVlUtgbQGNx5mrCwBNyEvHk2juuQQs.jpeg','Bangladeshi','10',9,8,'+8801837610251','85','2004-04-11','imaisrat6@gmail.com',NULL,'1','1','1','+8801823733203','iftekhariftu32@gmail.com','Md. Selim',NULL,NULL,'Police',NULL,'1',NULL,NULL,'Ifa',NULL,'01837610251','sathinmc34@gmail.com','Hasina Akther',NULL,NULL,'Unemployed',95,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1193/student_photo/N7akbteJ1rkbvgNTbmPBwJNOw2Kbehleg9r58foe.jpeg',NULL,'4212','1',NULL,'Kapasgola Road, Chawk Bazar, Chattogram','Kapasgola City Corporation Girls High School','2019-11-27 06:43:19','0312558170','female',NULL,'Chandgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1193/marksheet_previous/tnJzUDJmgPJ74B02Axfkp0qdh3F6KymafgNLCJkp.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1193/marksheet_previous_two/3dBrdjA8hoQh0qbQ0GroxQI5nLaHSimhUUSF2MGr.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1193/marksheet_current/eTRmkP58QYtMoEtpdn536U7XujTn6Ni8HFADEsJu.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Chattogram',2,'3029405999111',144000,2,'2363495561',-1,'Chattogram, Chattogram',4203,'Chawk Bazar','Mohammed Alauddin','01819634490',NULL,1,NULL,1,NULL,'There are many reasons behind my applying for the K-L YES program.\r\nFirst of all I\'m applying for this program to quench may thirst for something new. By applying for the K-L YES program I will be able to know and face something new. Going to abroad,meeting a large number of people who are different from me,living in a host family,having host mother and father and siblings also having some new friends; all will be new to me.The culture,the heritage everything will be different from my country.I want to taste something new.\r\nI know one thing that by testing yourself more and more you will be able to know how far you can go.As K-L YES  program is giving me a chance to testify myself I will surely grab that chance.','I want to share every aspect of Bangladeshi culture with my American family and friends.\r\nFirst of all, I will share about our mother tongue Bangla and the glorious history behind this language specially the Language Movement of 1952.I would love to make them know how to say \'I love you\' in Bangla.\r\nI am a food lover. I love all types of Bangladeshi foods.I will make sure that my host family gets taste of Bangladeshi cuisine.I will prepare the Bangladeshi foods for my host family and friends.Also, I will teach them how to make some Bangladeshi cuisine.\r\nI will introduce bengali clothing to my host family specially saari and punjabi. I will gift them bengali clothes.',1,'A YES Alumni Member',NULL,2,'2019-11-21','2019-11-19',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1193/school_seal/CnNUthOms8Q45kDJfbzgtnPLKjNiZnphJNw4fw3x.jpeg'),
	(237,'Musafa Mamur',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I have participated in a project of an organization called SCARS. The project was to collect money from people and arrange iftar for rickshaw pullers. We divided into some groups. There were four members in each group. We had our t-shirt and id card of the organization. I hold the money box and we visited some areas. People gave money more than our expectation.\r\n\r\nActually, people always try to help other but they hesitate because there are some cheats. I wish to participate in these kind of projects in future and also wish to donate blood when I will be eighteen.',NULL,'30/6, Sher Shah Suri Road, Mohammadpur, Dhaka.',NULL,1196,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1196/certification/6Br5jaBzTXRbftAaf7txCvGSoHK13miRra9tOyj2.jpeg','Bangladeshi','10',9,8,'+8801716224232','73','2004-10-16','musafa180akon@gmail.com',NULL,'1','1','1','+8801716224232','tazmohua@gmail.com','Md Mostafa Kamal',NULL,NULL,'Engineer',NULL,'1',NULL,NULL,'Akon',NULL,'+8801981169249','taslimabegum1800@gmail.com','Taslima Begum',NULL,NULL,'Homemaker',74,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1196/student_photo/uyY2D8Go5wWqlIWrzcaIA50w2idSjBzKLWOFSvHl.jpeg',NULL,'1207','1',NULL,'Mohammadpur, Dhaka','Dhaka Residential Model College','2019-11-27 06:43:19','+8801558010874','male',NULL,'Mohammadpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1196/marksheet_previous/zmGraHm1U4ErmTrzIS5T4LSbdZPLGtYFrzNwj3JV.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1196/marksheet_previous_two/2aIid1BOlQadKJK2aFPKauHzW5ptEk6Q6njvnZ9C.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1196/marksheet_current/PtcfvzmM57KBvHxjuYw5esqsTJkNhiafwlHKgEm5.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'EA0960550','2024-06-11','htt