	(238,'Nusrat Jahan',1,0,NULL,'Bhola, Barishal',NULL,19,'I am a science student at my school. I feel i am a global citizen. I have leadership mind. I love my school. I love my community. So i know i have lot of duties for my community pupils. I have involved many community\r\nvolunteer service program in my school. I am a Girls Guide.  I always Leading my school volunteer leadership Program.  Example : School cabinet election, Satata store, Red cross, If i will get the chance of Yes program. And i have finished the program. I will back my school & i will make a Community service  group in my school. That group support poor Illiterate people  for inspired taking Education. It will be Social Welfare group and i will be leader of this group.',NULL,'Muslim para, Bhola Sadar',NULL,1205,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1205/certification/z6c35RnCGjkqZSuBYHJAIvBztvhuHMQkQn9UY2ht.jpeg','Bangladesh','9',8,7,'+8801775898275','70','2005-10-31','sheikhabutaleb@gmail.com',NULL,'1','1','1','+8801775898275','sheikhabutaleb@gmail.com','Md. Nashar Uddin',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Nadia',NULL,'+8801775898275','sheikhabutaleb@gmail.com','Mst. Marjia Begum',NULL,NULL,'Unemployed',80,78,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1205/student_photo/2ooFcnRR9LdsYMnF9CpyWLpTDdwCnjd4cy5SZFrN.jpeg',NULL,'8300','2','Queens New York','Bhola Sadar','Bhola Govt. Secondary Girl\'s School.','2019-11-27 06:43:19','+8801775898275','female',NULL,'Bhola sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1205/marksheet_previous/bL3E2OONqeBcN4dba0ijlCVulAzAn0u9MveZ7dAx.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1205/marksheet_previous_two/jem6FGkjYWqi74kZ5zJn0Km6YI8cFj9tqGTmBPLs.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1205/marksheet_current/7XRemaWGp0mLS3onwqtA4XR