	(239,'SAYED EAKTEDAR AHMED',1,0,1,'Dhaka, Dhaka',NULL,19,'3.	Our country has narrow roads we a group from our school sometime help traffic to control traffic jam. We also participate in cleaning roads and drains, so our community people can be saved from mosquitoes and files. Sometimes we help blinds to cross the roads safely. This kind and also in other community services there which I usually participate. We also participate to make aware about the people to make the country clean.',NULL,'HOUSE-170/9/B, WEST KAFRUL, MIRPUR, DHAKA-1216',NULL,1206,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1206/certification/BzFThmzUcYkck5BYPD3X0oLyM5aR5d6GyUjgPVcW.jpeg','BANGLADESH','10',9,8,'+8801921486490','45','2003-09-13','eaktedar2003@gmail.com',NULL,'1','1','1','+8801711327605','monkir71@gmail.com','MONKIR AHMED',NULL,NULL,'BUSINESS',NULL,'1',NULL,NULL,'ALVI',NULL,'+880151520266',NULL,'AMENA BEGUM',NULL,NULL,'HOUSEWIFE',47,78,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1206/student_photo/p1beR4D68Wof6swHUjAAoHZlt9erZfFKinLNFqGn.jpeg',NULL,'1216','2','NEW YORK CITY','BEGUM ROKEYA AVENUE, DHAKA- 1207','SHER-E-BANGLA NAGAR GOVT. BOY\'S HIGH SCHOOL','2019-11-27 06:43:19','+88029114105','male',NULL,'SHERE-E-BANGLA NAGAR','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1206/marksheet_previous/TUa7DTfeXxy2MHtjLotOVPnGqQT4Puk4TNyaKFjN.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1206/marksheet_previous_two/i2lXTPZDljKThGg8q7o9kakgRWnlUc9JrAwIHAur.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1206/marksheet_current/Fi49RD3zpZlgAIroA7Qcwch6dg0IOzys0vCAyNKr.jpeg',NULL,1,NULL,'N/A',NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,'N/A','N/A','BX0684623','2023-10-31','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1206/student_passport/asGhPdrvpXknxaBYJy5WqDml