	(242,'Md. Rifaz-ul Alam',2,0,NULL,'Bogura, Rajshahi',NULL,19,'I didn\'t participate in a community service before. But yes,  I had plans previously. The social services cover for children includes integrated development of children, care and protection to abandoned, neglected, unwanted, destitute children, setting up creches for working and ailing mothers children, nutrition programmes etc. I would like implement on these issues.  Mostly i prefer to do for the orphans. In our country child labor number is just a matter which stabs me all the time.  I want to make a good future for them.  Though it\'s not possible only for me to do all these together,  I will do my best.  At least if i can manage to build perfection in 5 children throughout my life still it will be great. If people around the globe and throughout the country make their mind to bring perfection in poor children it will turn the whole condition of the country.',NULL,'B-block, Bogura cantonment, Bogura',NULL,1210,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1210/certification/vWQeh3UNCVLxsqAksdLC57B5CgmU9nmUtFCFAbEU.jpeg','Bangladesh','10',9,8,'01701430019','84','2003-10-30','rifnaz59@gmail.com','https://m.me/rifaz.mask','1','1','1','01733793609','rifaz.miller@gmail.com','Md. Shafiul Alam',NULL,NULL,'Army personnel',NULL,'1',NULL,'rif_az_0_o','Alam',NULL,'01719514498','rifaz.ggm@gmail.com','Mst. Rina parvin',NULL,NULL,'Housewife',81,95,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1210/student_photo/cT6Ebln6oEJYejbc7Wam8q9tNXhtZotmJvAHKAKY.jpeg',NULL,'5801','1',NULL,'B-block, Bogura cantonment, Bogura','Bogura Cantonment Public School and College','2019-11-27 06:43:19','01701430019','male',NULL,'Shahjahanpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1210/marksheet_previous/ymrsYDaSxguCzHvXu0xh0OyFZLmUljZp1GphsvcL.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1210/marksheet_previous_two/GcpHihYbILLqAnQCZpw7NoiBXdcs2jPoBXRfxiTg.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1210/marksheet_current/sumSNJ4DUvI4BOLZ7ZtpwkUhcsDRcEfSbq9mimpQ.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Bogura',2,'2717777523651',420000,2,'2717777523652',-1,'Bogura, Rajshahi',4350,'Shahjahanpur','Colonel Mohammad Solmon Ibne A Rouf','+880-1309-119251',NULL,1,NULL,1,NULL,'Previously i was in Rajshahi Cadet College. I was transferred to Bogura Cantonment public school and college as a punishment of my deed. So, I lost many opportunities which i could have taken when I was  there. But still i want to build myself with the best components.  So, I want to take this opportunity to justify myself and try my capabilities.','I want to share all of the things relating our great history. \r\nI want to share our struggling of building this nation and developing.  How our living is.  Mostly i want to share about the educational process of our country. Because they have a different process and system.i would like to ask them about our education system, how they feel about it.  I would tell them the mixture of the religions here. How we live and stay together. If I could a chance i would share the struggling of many people living here.',1,'My Family Member',NULL,2,'2019-11-23','2019-11-14',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1210/school_seal/xVTT6svQZlhMBnU8XrTSeCPkm6mUt1O9JGaipOk0.jpeg'),
	(243,'Irfan Sharif',2,0,NULL,'Chattogram, Chattogram',NULL,19,'Personally I\'ve conducted some small scale social services like giving food to the poors, Cleaning my own school etc.But I\'ve always wanted to do a significant project. Recently I got a theme for my project. I want to create awareness among people about the severe effects of using Polybags, plastic cups other plastic materials in our environment.I want to give the common people and shop owners eco-friendly jute or hessian bags and paper cups.Many people in our country actually doesn\'t even know that plastic is non-biodegradable product which takes more than 1000years to decompose and pollutes our environment.While,Jute bags or plastic cups are bio degradable and decomposes easily. For conducting such big project I\'ll need a lot more help. So recently I\'ve applied to be a member of \"Third Smile\" a social organisation that conducts community services in Chittagong.I\'m hoping to actualize this project with their help in 3-4months. If successful, this will help the whole human community.',NULL,'JomJom Tower, High level Road, Wasa Circle Khulshi, Chittagong',NULL,1214,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1214/certification/t3HIwouhbPneQHY9kH3GTFwPem2vHGbsX7JOWIKp.jpeg','Bangladesh','10',9,8,'+8801773670574','77','2004-12-17','irfan.sharif770@gmail.com','https://www.facebook.com/irfan.sharif.927543','1','1','1','01630969948','irfan.sharif770@gmail.com','MD. IBRAHIM',NULL,NULL,'Government Employee',NULL,'1',NULL,NULL,'Pulok',NULL,'01869295087','ukulsum656@gmail.com','Umme Kulsum',NULL,NULL,'Unemployed',75,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1214/student_photo/RtIBDUtj4lWHVrUBovDuqsaDONVc3gIy2bLUNBxf.jpeg',NULL,'4216','2','Florida','Ice Factory Road, Chittagong','Chittagong Collegiate School','2019-11-27 06:43:19','+88-031-2863055','male',NULL,'Khulshi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1214/marksheet_previous/9Cnu2HNpLXw9OqRyHxfqoSjH0ZBKFWviP0OQkMrT.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1214/marksheet_previous_two/nYx5lY9KI9TGwnehZnjFFJAfGBUQMxokAU0ox6Qf.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1214/marksheet_current/3CUGsGoSmuubjiOipxF9EjfwHZuhsj4BszeBF4tZ.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Chittagong',2,'4168324491',200000,2,'8218110016',-1,'Chattogram, Chattogram',4200,'Double Mooring','Debabrata Das','01869295087',NULL,1,NULL,1,NULL,'I have 3 reasons to apply for the KL-YES programme 2020-21 session. Firstly, I want to experience and know the American culture, heritage and lifestyle. The program will allow me to stay with an American host family for a year which will help me to observe the American culture closely as well as sharing my own culture. Secondly I want to complete my higher education in abroad. Attending a global program like KL-YES would surely help me on that. Lastly, If we compare Bangladeshi and US education system we can see that US education system is far advance and effective. Kl-YES program will allow me to study in US high school for a year. By doing so, i can observe their education system keenly and in future i can develop my country\'s education system by working in the Bangladesh education ministry.. Beside these facts, I\'ve never been outside Bangladesh, So I\'m hoping to gather a whole new experience by participating in the KL-YES programme.','When two differently cultured people spend a period of time together, usually both sides exchange some of their cultural aspects. If i get selected for the KL-YES program I\'ll try my best to represent Bangladeshi cultures to my host family and everyone else.For doing so,I\'ll gift them our traditional clothes as Saree, Punjabi,Lungi to give them conception about bangladeshi fashion. If possible,I\'ll also cook some bangladeshi foods for my host family and friends.Also as a muslim I\'ll practice my prayers everyday and go to mosque for Juma prayer,thus share my religious aspect to the Americans.In addition to these I\'ll try to write about Bangladesh and her culture in School Magazine which i think will be very effective in sharing our aspects and cultures. As KL-YES program lets the participants to live in USA for a year,it\'s actually a great opportunity for sharing my culture and gaining knowledge about theirs.',1,'A Friend',NULL,2,'2019-11-14','2019-11-14',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1214/school_seal/ZrSgX6TAWvNlHDu0RbvXy1aayphDM0gpKy5F3rjZ.jpeg'),
	(244,'Jannatul Ferdous',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I want take steps to stop environment pollution. I want to thank Greta Thunberg for leading my future plan.I dont want to have the nightmares of being trapped  in a sinking island with millions of people without any food or safe water to drink anymore.Being a climate activist I want to save my country, as well as the whole world.',NULL,'37/f,North Begunbari Plytechnic,Tejgaon I/A,Dhaka-1208',NULL,1217,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1217/certification/NHO71aWwUkbdAx53C2wza5GWnNx0w8TDAcmqHM5H.jpeg','Bangladesh','10',9,8,'+8801812748281','76','2004-08-10','jahidul678k@gmail.com',NULL,'1','1','1','+8801918359350','hasanrokibul562@gmail.com','Khalilur Rahman',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Mim',NULL,'01812748281','hasanrokibul562@gmail.com','Roksana',NULL,NULL,'Unemployed',77,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1217/student_photo/IdfBr2UprICejWoPzucD1HO0VeysJVrzimrqSOT0.jpeg',NULL,'1208','1',NULL,'Tejgaon,Dhaka-1215','Tejgaon Govt. High School','2019-11-27 06:43:19','9115658','female',NULL,'Tejgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1217/marksheet_previous/YBMdLhFfcdyR13VHvzBu3gDOyVNOQoarQhpQFNlg.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1217/marksheet_previous_two/qJnu2X9N6KY3g6tujr8MSJOCO9yQ3w2mV6GzsnAz.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1217/marksheet_current/LF8HeGywEE1rdKnLb51kARQFd1XX7lErC4SvYlCn.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Mymensingh',2,'4628369706',40000,2,'2699237547595',-1,'Dhaka, Dhaka',1215,'Tejgaon','Shahrin Khan Rupa','9115658',NULL,1,NULL,1,NULL,'It has always been my dream to visit other countries and learn about their cultures.If there is a chance I want to follow that path.Since USA has been one of the leading cultural countries in the world, I thought why don\'t I give it a try.I have been always watching Hollywood movies and wondering how wonderful the country would be.Then how incredible the people of that country would be.Moreover, it would be a great opportunity to take my culture to them and show them, though the economy of our country is not great,we are among the greatest people in the world.','There is a vast amount of incredible aspects to share about Bangladeshi culture to an American family, but if someone directs me to  pick  one particular one then it must be our language. Because, this is one thing to make us recognise instantly in any part of the world.You take the name of Bangladesh,and the name of its language comes along with it.\r\nI want to share how this language made us a community as well as a country.Then I must introduce the language by its historical platform.For example,\"How the language turned into its own form thousand years ago.How the revolution occurred in the process of language movement,sacrificing life,in  total being an independent country.\" Basically in other words I will tell our history in a story line.\r\nThough Bangladesh has gained the fame of being one of the greatest clothing brands in  USA. This is the time to remind them that we,a Bengali, are also premium from inside.',1,'Facebook',NULL,2,'2019-11-16','2019-11-14',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1217/school_seal/RFSyxGMC8oywJ4wnM8xV2cqqhHrFnGDCxS4obeKx.jpeg'),
	(245,'MAHADI HASAN',1,0,NULL,'Sylhet, Sylhet',NULL,19,'N/A',NULL,'VILL- PORBOTPUR-28, LAWAI, P.O- SYLHET SADAR, P.S- SOUTH SURMA, DIST- SYLHET',NULL,1221,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1221/certification/vlVzCpqPqQE6UOajS5LBjO8wu5JWAcTJOhf2Llx7.jpeg','BANGLADESHI','9',8,7,'+8801730894525','70','2004-11-28','mehedisyl19@gmail.com','TAMIMTANVIR','1','1','1','01737283497',NULL,'MD. NAZRUL ISLAM',NULL,NULL,'FARMAR',NULL,'1',NULL,NULL,'TAMIM',NULL,'01730894525',NULL,'MST. SHAKERA BEGUM',NULL,NULL,'HOUSE WIFE',75,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1221/student_photo/UphoCpjxHJh0pc9yHucyST3rpHPGomPrCj2ZPNOo.jpeg',NULL,'3100','2','SILVER SPRING','SOUTH SURMA','SOUTH SURMA HIGH SCHOOL','2019-11-27 06:43:19','01722188531','male',NULL,'SOUTH SURMA','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1221/marksheet_previous/i0O2ARJOX3nvkBIbCZayTmuj32Cy9xnQX2i6UEec.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1221/marksheet_previous_two/mcep3FXJB6sbM2GfBMhGDpaGwZyDLhyjT6H4tIps.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1221/marksheet_current/BxIXHXqjCFLdWDWaUx7c2LGxx4lKPKolzwhUZJvI.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,'N/A','N/A',NULL,NULL,NULL,'sylhet',2,'7342167538',80000,2,'1492129539',-1,'Sylhet, Sylhet',3100,'SOUTH SURMA','MD. ABDUL HAQUE','01753354076',NULL,1,NULL,1,NULL,'Higher education','N/A',1,'Newspaper',NULL,2,'2019-11-18','2019-11-18',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1221/school_seal/1mJozLPV2oeMvGbKnEsSruvxQGfoEF7XDNbPcMTQ.jpeg'),
	(246,'Nafiza Islam Kalpo',1,0,NULL,'Netrokona, Mymensingh',NULL,19,'I want to bring positive change in my community.I think everyone\'s first identity is,their human.Humanity comes first in my point of view.If I have the opportunity to change the world at first we have to communicate with each other.Every country should respect and understand each other.Communication is a great way to do it.In my community I want to change their way of thinking. I want to make the world  a better place where there will be no difference between citizens of other countries. I want to make all people on the earth become one and fight for the earth together. People still are afraid to dream something big. I think every single person have the right to dream big despite of being a citizen of a small country or other differences. And for that social service is very important.  .And YES program will be my first step towards it.I want to share my goal with other students of different countries,so that we can bring the change together in both my community and also in theirs.',NULL,'West Nagra, Netrokona Shadar, Netrokona.',NULL,1223,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1223/certification/RMeUQUeTvcGtx3GGls62SVveJVBVSUk9rpbZFSNk.jpeg','Bangladeshi','9',8,7,'+8801727163646','88','2006-06-25','nafizaislamkalpo@gmail.com','https://www.facebook.com/profile.php?id=100004267876349','1','1','1','+8801718069244','nafizaislamkalpo@gmail.com','Shekh Aminul Islam',NULL,NULL,'Privet Service',NULL,'1',NULL,NULL,'Kalpo',NULL,'+8801727163646',NULL,'Saila Akter Ruby',NULL,NULL,'Teacher',90,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1223/student_photo/mOAQ9150KORUDSH3RdeyE57L4wu7wiCC359wQipe.jpeg',NULL,'2400','1',NULL,'Netrokona, Netrokona.','Netrokona Govt. Girls\' High School','2019-11-27 06:43:19','+8801912042916','female',NULL,'Netrakona Shadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1223/marksheet_previous/E3VwEmssmPuSQnC1EXTcxlatCdvpXMIpSybq0ERG.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1223/marksheet_previous_two/3QPHuVGpfnFy1POpGtkT2vZIlkX95G8WODDauVga.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1223/marksheet_current/RbFd59vD5zfXmdCGfUn4Sx2sFfd5WzGkirzuV5WE.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,2,1,'I am a citizen of Bangladesh','I don\'t have any disability',NULL,NULL,NULL,'Netrakona',2,'3297873907',300000,2,'3278424621',213600,'Netrokona, Mymensingh',2400,'Netrokona','Shibani Saha','+8801912042916',NULL,1,NULL,1,NULL,'I have a big dream as a girl from a small town. Sometimes  it is not acceptable or believable in society.I haven\'t went outside of my country ever.So,I wish to know how the wold works to gain more experience and to share my way of thinking.US is a country which will show me how the real world works.YES program will be the first step to show people that I am capable to lead myself into a bright future.I wish to be globally capable to face any difficulties. I wish to socialize with people of other countries to get to know how they process or how their thinking is like.This will be the first step to show people that no matter how big our dreams are,if we are determined about it,we can eventually make it come true.So,to be that capable person,to add more passion to my dreams,to learn about the real word,to share about my country and to set an example to the people of Bangladesh and the citizens of other countries,I want to apply for YES program.','I,myself have been a part of the culture of my country.I wish to teach citizens of other countries about my culture by telling them and sharing the Bengal region.Bengali writers,authors,painters,film makers,music composers have played a significant role in the development of Bengal culture.I,myself have taken part in most of those fields and have participated  many programs about those.So,I can represent the Bengali culture  through myself to others.I wish to represent not only Islam but also Hinduism because I\'ve felt both of these religions by my heart. I want to share my country\'s music,dance,drama,art craft,folklore folktale,language,literature, religion,festivals and cuisine culinary  tradition because I\'ve already been a part of it.I wish to share about my country in Bengali style. I want to show them how strong,passionate, hard working,big dreamer and determined Bangalis are by being an example myself.',1,'A YES Alumni Member',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1223/school_seal/MwbEPpvm25g8aDuI2jhxrdK8Jfx50iTpC7RB7tSO.jpeg'),
	(247,'Junnatul Mowa',2,0,NULL,'Chattogram, Chattogram',NULL,19,'Unfortunately,in my life I didn\'t get that much chance to do any community work.But i feel the importance doing community service in my near future.So,in order to do community service in near future I have schemed something.If i get the opportunity to work for the community I will work for an issue which is about child labour. It is a big social program in our community.Out of poverty many children don\'t get chance to go school rather they are sent to do work in a risky zone.Moreover ,they do this types of risky job at lowest payment.From my experience on incident about child labour hit my mind that eventually let me to take this issue seriously.One of my community child who has recently lost his hands for working in a sawmill.Now he is become burden to his family.His helpless crying and innocent look shook me from the core of my hrart.So,I think we all should work on thus issue and in my community I personally want to initiate to work against child labour from working in a risky zone.',NULL,'Isaque Villa, Surabi R/A, Halishahar,Chattogram',NULL,1224,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1224/certification/wCorpC84yjNbikiUpEIejnU8kOfGoVpzgVxPFOv0.jpeg','Bangladesh','11',10,9,'01731145955','70','2003-09-21','junnatulmowa0003@gmail.com',NULL,'1','1','1','01715658848',NULL,'Md. Mozammal Hossain',NULL,NULL,'business',NULL,'1',NULL,NULL,'Dina',NULL,'01731145955',NULL,'Ferdoushi Begum',NULL,NULL,'Homemaker',60,61,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1224/student_photo/cK4hV34PQtKAYpX6eP0l4m059XQJsbNzufXvRZy7.jpeg',NULL,'4216','1',NULL,'Zakir Hossian Road,Chattogram.','Ispahani Public School And College','2019-11-27 06:43:19','031616323','female',NULL,'Halishahar,Chattogram','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1224/marksheet_previous/DkW9e0xuIBb7vompOElZ2Flv1mlnRKccj1NWOJ34.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1224/marksheet_previous_two/1FRJ9le58wUrZKjF3nWgtlK7GyP4BNnax7rHM4mM.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1224/marksheet_current/gJuLEvn9YrnhRrCI0lBN32IEa5SMKVPPgI8OATIw.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Chattogram',2,'1595511482438',1400000,2,'1593511600013',-1,'Chattogram, Chattogram',4202,'Pahartoli','Lt Col Mohammad Moinul Islam Chowdhury','031616323',NULL,1,NULL,2,'My Brother,year of 2019-2020','\"The secret of success is to be ready when your opportunity comes.\"(Benjamin Disraeli).The biggest part of our life is opportunity and our success which is largely hides in this opportunity.So,when I came to know about this program,I became enthusiastic to grab it.It is an educational and cultural exchange program.Where I can get an opportunity to represent my country and my culture.In my country,there are lot of things to represent.In this program many youth ambassadors of their home countries will be there.So,i believe it will be the right time for exchanging cultural activities.Here is a chance to build a strong network,to learn new things to do community service.Apart from that I want to be a future community leader and I think this program will help me a lot.It will help me to learn about us society and values.After finishing this program i will be able to show about their country and culture to my country\'s people.For all these reasons i want to join the k l yes program.','The aspect of our culture which i wish to share with my American host family is clothing. Bangladesh has a lot of traditional clothes and tribal clothes. In our country man traditionally wear panjabi on religion and cultural occasion . Here usually wear shirt pent or suits on formal occasios . Shari is the main and traditional dress of bangladeshi women also and same young female also wear salwar kameez . Bangladesh has many tribal people minority of whome live in the chittagong hill tracts area. There are lot of tribals in Bangladesh like Chakma,Marma,Tripura,khumi,ect.All of this tribal clothes are very attractib=ve and i think this will be great to represent to any American host family .',1,'My High School/Teacher',NULL,2,'2019-11-18','2019-11-17',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1224/school_seal/GhRzh8pFzl2g8OWF2RcALZBTQYkgCM1acVZYojxW.jpeg'),
