terested in it. On the other hand i wanted to know about the other educational system other than ours. Also i feel i should take this opportunity to try myself at the best possible way. And i feel your program will insure it in the best way.','If i get a chance to share anything about my country i will surely tell them about the people of our country. How they live and they struggle to get through the days. Our people do need the help of others. They need supports and sympathy of others too.  Bangladesh is a small country with a vast culture. People here are the biggest part of the culture. \r\n\r\nI would tell them about our liberation war, the golden history of a golden country.',1,'A Friend',NULL,2,'2019-11-23','2019-11-17',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1231/school_seal/itBjT8DqMdz3radT07DBXIdvf8ogURHf9t7GW8m6.jpeg'),
