,-1,'Narayanganj, Dhaka',1400,'Narayanganj Sadar','Md.Anwar Hossian','+8801713414183',NULL,2,'India for summer vacation',1,NULL,'I want to apply for YES program to share our culture with other countries people . America is a well developed country . It is a great privilege for us to get a chance to share our culture with american people . By this they can know about our culture properly . My main goal is to make a brotherhood between these two \"countries culture\" .','I want to share my Language , Clothing with american people . We have a enrich treasure of language and clothing . We have also a historic incident of our mother language . So it is a very prideful matter for us to share this language to foreign people .',1,'My High School/Teacher',NULL,2,'2019-11-18','2019-11-17',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1257/school_seal/cOs5RxRZ7O8Q4NqKBDVvJwlRnqr9Xn0QKiapfvph.jpeg'),
	(254,'Munira',1,0,NULL,'Chattogram, Chattogram',NULL,19,'One community service that I have done is participating in the  first aid program by red crescent. In this program I had to help people in my community with first aids. I taught them the basics of first aids and of how it\'s very important. In that program I also talked about sanitation being a vital part of our lives and of how we should maintain our hygiene.\r\nAnother community service that I joined was the winter drift program. In this program I had to collect winter clothes for people in need. This experience was wonderful. This made me realize of how we all should be there for eachother to help eachother. Collecting those winter clothes band giving them out to the children in need gave me  so much pleasure.\r\nCommunity services are a great opportunity for people to help eachother and contribute for goodness. In the future I want to dedicate myself more to help bring a change in the world.\r\nI also did other community services through mime and singing about saving trees and environment.',NULL,'Sara Tower, Flat:-7A, 1475/2757 East Nasirabad (Masjid Ln), Chittagong',NULL,1259,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1259/certification/cNVkjE9FjkaEkWsSbEUE45wyrPmr05SK8VI5A9cR.jpeg','Bangladeshi','10',9,8,'01711109682','94','2003-06-25','munirasubah@gmail.com',NULL,'1','1','1','01670005943','hksamim@gmail.com','Hamidul Kabir',NULL,NULL,'Businessman at Renesa Company',NULL,'1',NULL,NULL,'Subah',NULL,'01671695939','hydere@gmail.com','Tarifa Hyder',NULL,NULL,'Banker in Standard Chartered Bank',93,96,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1259/student_photo/SuRYIFLAtOTuvt7yKwHebyBGOuXDNnuoIqk4hy9t.jpeg',NULL,'4000','2','New York, Texas','1986/A Zakir Hossain By-Lane, East Nasirabad','William Carey Academy','2019-11-27 06:43:19','+880-31-652034, 657585','female',NULL,'Panchlaish','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1259/marksheet_previous/FHDxDuWCns1piXlKcdB8HH4iT5UssDdx7Q7M16nK.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1259/marksheet_previous_two/w56bjIoUE8KINCPh7HggdGTDrPC0S6dhIry3cbrf.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1259/marksheet_current/V77rhuWrjel35fLl41SIe6QJXTnTnoaM6vYdmGtF.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BL0731046','2021-08-28','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1259/student_passport/lRKSUvKyOAjuSXi6uPXZQ6Nd7ehXgc1CI85UQ37J.jpeg','Chattagram',2,'15943314301970',1200000,2,'1594314301950',360000,'Chattogram, Chattogram',4000,'Khulshi','Mr. Paul Beatty','+880-31-652034, 657585',NULL,2,'India for family vacation',1,NULL,'Since the world is full of diversity and communication is key system of living, I want to contribute to this program to spread my culture and know the culture of the other country as well. I want foreigners to know about the colorful rich culture of Bangladesh and in return I will get to explore wonderful things about America. Other than just learning about the cultures, this program will also make me exchange ideas. This program has really interested me into getting to exchange ideas and, we might also be able to solve some big global challenges and help the world. Two countries exchanging ideas and spreading ideas not only makes the people know about each other but also gives everyone the opportunity to get together and think about helping the world. I want to be in this program to help make a change. I know this wonderful opportunity will boost my knowledge in in many different fields and ways, so that I can help other people around the world to have a better life.','Bangladesh is a country of rich culture and diversity so sharing the culture of my home country would be a great pleasure for me. And I am pretty sure it will also be an amazing experience for my American family to hear about Bangladesh. Some very rich aspects of Bangladeshi culture are our greenery and rivers which play the role of our main food sources.To share this culture of food, I\'ll probably cook for my host family to give them a taste of Bangladesh. Bangladesh is the only country in the world to have a war for mother language. I will do presentations to portray my culture and also teach them a few Bangla words. I\'ll spread the other aspects such as clothing, family tradition, and society cultures through being a Bengali myself. I will portray these by showing them. My behaviour towards them will surely show of how Bengalis are very hospitable and respectful. I will try my level best to share the rich aspects of Bangladesh with my host family.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1259/school_seal/UNQ69n8uYP8M9oFAJKAMPD8RW29aO53GO0bPFL39.jpeg'),
