	(257,'Farhan Rahman',1,0,NULL,'Narayanganj, Dhaka',NULL,19,'I am a member of one of our school clubs called PASHE ACHI (We are beside you) which provides food to the poor people. Besides, I am working as a volunteer for UNICEF Bangladesh who works for childrens rights and education. My first goal in life  is to work for Human Rights and underprivileged children who are deprived of Fundamental Rights. So if I get a chance to get into the YES program, I wish to work on my ideas for building up a good friendship between two counties and work for the people',NULL,'36,Mokarba Road,Nagar Khanpur',NULL,1268,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1268/certification/uVvWBdeF9OGyCyIY8fvq6UkaabPoj1h84g2Tyteg.jpeg','Bangladeshi','10',9,8,'+8801968821009','70','2003-04-23','farhanfarabi911@gmail.com','https://www.facebook.com/farhan.rahman.92317121','1','1','1','+8801711633906','habiburrahman1958@yahoo.com','Md. Habibur Rahman',NULL,NULL,'Advocate',NULL,'1',NULL,'https://instagram.com/farhan.rahman.farabi?igshid=lpsmpusuwpom','Farabi',NULL,'+8801712262722','jesmins103@gmail.com','Jesmin Sultana',NULL,NULL,'Homemaker',78,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1268/student_photo/8231yC7kkdimcW7obhRFfovhke6sf5Nh2BtMzm6o.jpeg',NULL,'1400','2','Michigan','47,KB Saha Road,Amlapara','Narayanganj Ideal School','2019-11-27 06:43:19','+8801817017819','male',NULL,'Narayanganj Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1268/marksheet_previous/tMywIHYil83QnwIyyy7giv1oD5PAQjkoIfhAmCP1.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1268/marksheet_previous_two/gWq97FBz1LmPCo2IXi5yr9Cboaou6CK0RAcwXIRb.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1268/marksheet_current/KRxlRdmc0a1w7y7Q0580vhszckwNbO9eacFboxmj.jpeg',NULL,1,'0','N/A',NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,'N/A','N/A','BC0650711','2019-11-15','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1268/student_passport/Ed6QQe24vi5F65XSegtL9c2r7Sp8g9s5CPBnD8m0.jpeg','36,Mokarba Road,Narayanganj',2,'19526725802732940',960000,2,'5988486527',-1,'Narayanganj, Dhaka',1400,'Narayanganj Sadar','Md. Anwar Hossain','+8801713414183','N/A',1,'N/A',1,'N/A','I want to participate in YES program because very few people around the world know about Bangladesh and its rich culture. Also, Bangladesh being a little country, many people confuse it as an Indian state. Even though South Asian countries share many similarities but Bangladesh has unique identity and distinctive traditions. By participating in YES program, I want to introduce my beautiful country and its uniqueness to the whole world. Besides, I also want to know people from other countries, especially USA. For this, I believe program like YES is the best platform. This will help me get to know the diverse American culture and the values the country stands for. To me, this program is also an opportunity to create friendship between our two countries.','First of all I will introduce my language (which is Bangla) to everyone as Bangladesh is the only country that fought for it mother tongue. And recognizing this sacrifice, UNESCO recognized 21 February as The International Mother Language Day. So, if I get a chance to go there, I will try to teach them Bangla language & Sometime we can have a Bangla movie night were they can learn Bangla Language and also Bangali culture.\r\nBangladesh is a country where people of different religions live together in harmony having respect towards each others belief. So I would like to share this aspect of our country where we are living in diversity.\r\nBengalis are fond of fish and rice and we also have so many spicy foods. So if I get a chance I also want to share our mouthwatering cuisine with the American family I will be living with.',1,'My High School/Teacher',