	(258,'Md. Rashidul Alam Osman',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I am a member of \'Green Club\' in our school. Our work is to keep our school ground and our compound fresh and clean. We also do seminars, debates with other schools on the importance of our nature and a green country and the ways to prevent others to destroy our environment. We also do human chain by doing rally to spread awareness about importance of trees in our life, rallies against the destructive effects of tobacco on our health. I\'m also a part of the debating club of our school and we join in different debating competition on important and grossing topics about our country and the other country. I believe in peace and I try my best to help others like helping little and the old ones crossing roads, helping others with their works and I would love to do the same at there too.',NULL,'38, Middle Paikara, Mirpur-1, Dhaka-1216, Mirpur, Dhaka, Dhaka - 1216',NULL,1270,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1270/certification/iH4XS2wCsf7cemB7niekw9vDMP0GdPSta1TbZpzZ.jpeg','Bangladeshi','10',9,8,'01728873938','84','2004-05-26','ra.omar.794@gmail.com','https://www.facebook.com/rashidul.alam.520','1','1','1','01728873938','shah.alam.gr5@gmail.com','Md. Shah Alam',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Osman',NULL,'01621916121','wow.osman.007@gmail.com','Ms. Rahenur Alam',NULL,NULL,'Householder',65,68,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1270/student_photo/ZZLoYnEWG63rq0swhqNpGLm0BlkwO8VG1bFOJqzq.jpeg',NULL,'1216','1',NULL,'Gaznabi Road, College Gate, Dhaka 1207, Mohammadpur, Dhaka, Dhaka - 1205','Govt. Mohammadpur Model School And College','2019-11-27 06:43:19','0963-9138649','male',NULL,'Mirpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1270/marksheet_previous/2KPD7Ak0gjv6j2NXkT0P2nyTNXYLdp3j5CLmG5m1.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1270/marksheet_previous_two/oTkZ9LNEzQDXSKYXC5wDsDGBpkpI6bwihNCVHk8J.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1270/marksheet_current/n0wHuBxkqZc4RACHdx489DqEOIL3FI8bVzovrSSf.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'5515400686',600000,2,'2803985932',-1,'Dhaka, Dhaka',1205,'Mohammadpur','Lt Col Kazi Sharif Uddin','0963-9103980',NULL,1,NULL,1,NULL,'I want to apply for the YES program because I\'m eager to know about their culture. By living with them I can get to know about their lifestyle. They have a rich cuisine and I can get familiar with it by my host family and I can even learn about their perspective on different topics and thus I can improve my social skills. I\'ve always cherished a dream to travel to other countries and the YES program is like a dream come true. I also can learn about their education system. There are a lot more to learn about them as they have a culture unlike ours.','Firstly I would like to let my host family know about our simple yet fascinating culture. I would tell them about our country, where it is located and about the Bangladeshi people. I would love to teach my American family, my friends about our mother tongue Bengali. I would love to teach them little things like \'Tumi Kemon Acho\', \'Dhonnobad\', \'Ami Tomake Bhalobashi\' and so on, by these they can know about the sweet language that we have. Another important thing is their aspects on our religion. They might not know well about Islam. I\'ll let them know about the social aspects that Islam has taught us. And I\'ll do this all with respect to their religion. Our clothing and American\'s clothing are somewhat same but yet we have our traditional cloths like men\'s Lungi, Panjabi and our women\'s wear Shari. I can wear Panjabi, Payjama on different occasions. Thus I want to share our culture with my American family.',1,'My High School/Teacher',NULL