.s society and values and their home country and culture and I want  to services human being as well as development of Bangladeshi medical sector.','I want to share my culture with American host family which culture I have belong such  as  1.traditional food 2. Traditional puppet show 3. Traditional dress  4. Traditional musical instruments 5. Traditional beliefs and customs.\r\n I have individual language cloth food tradition and culture. I have pride tradition about Bengali language, folk song,   bhatiali, baul songit, murshidi and the most Lalon Shah, Hasan raja and rabindra sonjit, Nazrul Sonjit and I have also our cultural dress for both men and women lungi, sarry, which culture I want to share with American host family.',1,'Newspaper',NULL,2,'2019-11-19','2019-11-19',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1276/school_seal/Wy1Fo2NhYK8pGAGVzwtaFeHyhlDyli6IuxBXGQ65.jpeg'),
