205,'Hajaribagh','Lt. Col. Mollah Mesbahuddin Ahmed, PhD,AEC','+880258613870',NULL,1,NULL,1,NULL,'I like to learn new things. I am very interested in learning new culture. YES program is a program through which I can learn new culture, new language and many more new things. I am always looking forward to meet new people and this program will help me with it. Experience matters a lot in succession and YES program will give me lifetime experience.','I am a very foodie person. I like to taste new food of course abiding my religion. Bangladesh\'s cuisine culture is really interesting. Bangladeshi people are always very fond and creative about food. I wish to share many tasty and healthy Bangladeshi food with my American family. One more thing I wish to share with my American family is our language. The sacrifice that our language martyrs made for our language Bangla has created history which is why the whole world can celebrate International Mother Language Day with respect. It will be a great pleasure to share our language with my American family.',1,'Facebook',NULL,2,'2019-11-20','2019-11-18',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1277/school_seal/05t9NV9ygZ07aXMMtNwod2BmH0ZejQkuJOPAxzm6.jpeg'),
