	(262,'Shahriar',1,0,NULL,'Dhaka, Dhaka',NULL,19,'*I joined in various volunteering works. One was Voice for change, where I talked about a social issue for which i was among the top 10 and received a cert.\r\n*I participated some small volunteering works where we collected funds and gave those to poor people\r\n*Currently I\'m a Permanent Volunteer at SpeakingAnimals where we collect funds and buy food for street animals.\r\n*In my lonely days I started this small thing called \"Good heart community\" in fb, where it was filled with people who is going through tough time and just needs some friends who aren\'t toxic. After every month we\'d have a group irl meetup,where we talk with one another and have a grand time. This initiative saved a guy who wanted to commit suicide.\r\nIf I\'m given an opportunity, I\'d create a platform/event/social gathering where it\'ll be filled with good heart people who\'d give mental support to other people regardless of their gender,race,age,class. Because Mental heath is overlooked and not considered as a big deal in bd.',NULL,'Moinar Bagh,Uttor Badda,Dhaka',NULL,1280,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1280/certification/I9psOtYNsf92oyiOO2LJSeN5YNJVZVBDMZjOv3Ns.jpeg','Bangladeshi','10',9,8,'01813350502','72','2003-05-21','itsshahriar532@gmail.com','https://www.facebook.com/itssaiftotalk','1','1','1','01715561185','siddikbdh@gmail.com','Md. Siddik Ur Rahman',NULL,NULL,'BusinessMan',NULL,'1',NULL,'@itssaiftoo','Rahman',NULL,'01715866255','sumedfx@gmail.com','Sume Akter',NULL,NULL,'Banker',76,73,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1280/student_photo/79xVaAopoxl561RkW5VhjG5ENSaT0sWADLq2wo5o.jpeg',NULL,'1212','1',NULL,'Holding-34, Road-1, Block-I, Banani Dhaka, Bangladesh','The New School Dhaka (NSD)','2019-11-27 06:43:19','02-9872410','male',NULL,'Badda','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1280/marksheet_previous/pvZKoQyck246gch2JCC85jsfUtoNk0wMGlQCcR1S.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1280/marksheet_previous_two/FRHutcqE8CrPbktlhO3RD9bYP7MG8pUqKfi9YqRM.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1280/marksheet_current/BoizMIvr4HFyS6E3wgvFqe9nhlHlAUPCtoSGuHl4.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'BP047890','2022-06-13','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1280/student_passport/MvUiJpIv2h1jirDNYYF80QbqDcCGgFZLkGknC0OK.jpeg','Barisal',2,'2693016094048',420000,2,'2693016094049',480000,'Dhaka, Dhaka',1213,'Banani','Sabuj Ahmed','01819431382',NULL,1,NULL,1,NULL,'There are several reasons, Firstly, I was an introvert, I couldn\'t maintain a proper eye contract,I\'d stutter when I talked, and I had huge stage fear. But, I was blessed with some amazing people in my life who changed me. Turned me into a better person. That\'s why I want to meet new people, throw myself in tough situation to get out of my comfort zone and to be better than what I am currently.YES program will allow me to do that. \r\nSecondly, the thought of exploring a new country, going to places, seeing how different people are in other country sounds intriguing\r\n\r\nLastly, I just want to talk with people and make some cool friends. (Not saying I don\'t have any) Friends who wants to do something more with their life rather than living an average life. Who constantly strives to get out of their comfort zone;Friends who lifts each other up;Friends who have ambitions and a purpose in life.','I just want to sit down with my American family and talk with one another. Starting with getting to know themselves and introducing myself then later on I want to share how my culture is different;how we enjoy the New Year, and boishakh; why ilish and panta bhat is considered a delicacy in my country; how the people in my country fought for their language and other random stuffs.',1,'Facebook',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1280/school_seal/Mx261QjBUvIGHSuaW5Tian8EwKJrrZhmOcrMryxP.jpeg'),
