qs9m6kacj37TW7Mma0.jpeg','Dhaka',2,'2839422660',480000,2,'6715863694390',120000,'Narayanganj, Dhaka',1400,'Narayanganj Sadar','Anwar Hossain','+8801713414183','I was in West Virginia and NYC , three months ago',2,'Turkey for 38th International Children Conference arranged by TRT',1,NULL,'YES program is a opportunity to me for living and studying in the America. I will also get a host family where I can learn about the American culture, history and their lifestyle.','I wish I would share with them about our Bangladeshi Cuisine  \'cause I had seen and experienced that many foreigners are curious about the traditional cuision of bangladesh and also like our foods. I can make some Bangladeshi dishes like Rice, Lentil Soup, Smashed Potato etc for sharing with them our cuisine.',1,'Facebook',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1292/school_seal/0OMfAiCg1xNVpXKOicBgIFfu7ZoLSMkbjselImqs.jpeg'),
	(268,'Sadia Islam',1,0,4,'Mymensingh, Mymensingh',NULL,19,'Community service has always been brought positive changes in our society. Even though I haven\'t participated in any sort of community services. While staying in the United States, I would love to arrange community service project for my community.\r\nI want to arrange a project for the disable, depressed and mentally disturbed people through Art. Art serves to enrich the mental stability of a human . I will make a group for this. We will go to different schools, homes, charities, orphanages and asylums to teach and attract them toward Art. The healing power of it has long been recognized around the world. And now it\'s emerging an as evidence based therapeutic modality for depression. Many of us try to ignore or avoid these type of people but while doing this work we\'ll talk with them, we\'ll know about them, this friendship with art can save their life even. They\'ll be able to forget about their disability and pains.And we will sell those arts and use that money for their betterment.',NULL,'Flat no-12, 4th floor, Mahin villa, Holding no-488, Aqua, Chukaitola,Purbopara',NULL,1293,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1293/certification/TacrrUNHjtprm43X7MU7uK7gb6w3j7Tsota5Y8vp.jpeg','Bangladesh','10',9,8,'+8801913951694','79','2003-01-17','sadiaislam1106@gmail.com',NULL,'1','1','1','+8801717300563','mhassanul98@gmail.com','MD. Hassanul Islam',NULL,NULL,'Defence Service',NULL,'1',NULL,NULL,'Islam',NULL,'+8801913951694','jewelsumi75@gmail.com','Mrs. Umme Kulsum Sumi',NULL,NULL,'Unemployed',75,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1293/student_photo/euzoMKLSEemsIawGVScW4zUPKlntENQwGXMIknJO.jpeg',NULL,'2200','1',NULL,'Mymensingh Cantonment, Mymensingh','Cantonment Public School and College , Momenshahi','2019-11-27 06:43:19','+8801703505053','female',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1293/marksheet_previous/pyvglZ2SWj5tWYqmPmgoWlPXuNDVPz8osFOlL4k6.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1293/marksheet_previous_two/tzx2WrBjJYXPqnaD15b1bbugSKHHKHcbPTfXdOUG.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1293/marksheet_current/HLp44jvNHfTnlo6eEt8MjvPgbZJ0WlCdmBd70KYH.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Jamalpur',2,'1058598704124',540000,2,'1018517511976',-1,'Mymensingh, Mymensingh',2200,'Kotwali','Lt. Col. MD Jalal Uddin','+8801769203170',NULL,1,NULL,1,NULL,'I must say one thing at first. From the childhood, my father is so much ambitious about me. And by earning this scholarship I want to make him proud of me. And I have a dream within me me since boyhood. That\'s I want to travel the whole world. To materialise my dream, this scholarship has a great impact. For me, foreign count,people,culture, lifestyle, tourist places, cuisine are the most interesting objects. Moreover,my academic career will get a major break through. And the last but not the least cause is I want to make myself independent and I myself want to do something for which my country and parents will be happy and satisfied for me.','Sharing own culture is one of the most amazing works a person can ever do. And it\'ll be a matter of great pleasure for me if I get the change to share my culture with my American host family. The aspects of Bangladeshi culture I want to share are Literature, Bangladeshi Art forms, Clothing and Cuisine.\r\n*I will make Bengali type snacks like Tea, Singara, Paratha etc for my host family. And I\'ll invite my neighbours For a Bangladeshi type dinner.\r\n*I will join my school cultural programs wearing Bengali dresses like Saree, Salwar etc. I will take Bangladeshi dresses with me to share them with my host family. \r\n*I\'ll take Bengali books to share them with my host family and friends. I\'ll try to arrange Bengali Drama in my school program.\r\n*I will write about our rich art culture in the local newspaper like Alpana, Nakshi katha and also about Bangladeshi artists art journey.\r\nThat\'s how I will share my culture with my host American family sprucely.',1,'iEARN-BD Website',NULL,2,'2019-11-26','2019-11-18',1,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/239/file/ITahT4TLlglE8Xv1GF2HhVPC5VVJORksVvHjzjYv.pdf','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1293/school_seal/0NR85ldMl19aqIuWAAwvDqlokPNIX6LeZAeoDCEp.jpeg'),
	(269,'MOHAMMAD TANVIRUL',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I could not attend any social services though I always wanted to attend community services. If I get chances to participate, I will try my best to create positive thoughts among people and will try to persuade them to do \"RRR\" (Reduce, Reuse, Recycle.)',NULL,'48 H.K. Das Road, Luxmibazar, Sutrapur, Dhaka.',NULL,1294,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1294/certification/EtSrPbeRIPqQlBT9WHLEGksFXsawplcf8PGUVeA4.jpeg','Bangladesh','9',8,7,'+880-1714-394967','82','2005-04-18','tanvirul170@gmail.com',NULL,'1','1','1','+880-1716-260317','nooralamtt@gmail.com','Md. Noor-E-Alam',NULL,NULL,'Private Service',NULL,'1',NULL,NULL,'ISLAM',NULL,'+880-1714-394967',NULL,'Mst. Nazma Akter',NULL,NULL,'House wife',80,88,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1294/student_photo/Zm1Gk6meBMy4V2qNJpWfwQOiRTtRrxv5Gs4Wfgsw.jpeg',NULL,'1100','1',NULL,'82 Municipal Office Street, Dhaka 1100','St. Gregory\'s High School & College','2019-11-27 06:43:19','02-47113687','male',NULL,'Sutrapur.','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1294/marksheet_previous/rqVMYwBTkH761WyuO4OLKsiuNenksfm54wrRdo3V.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1294/marksheet_previous_two/7RTE2ECIvxzOUUnCIQ6S7p3e6Ls9I7ZxpIOicSTS.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1294/marksheet_current/GTP6dF8bmGziMI5g2VCl848S5knIdia4hJhU5kj3.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,'EE 0251407','2024-10-15','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1294/student_passport/qHqwL9g1rhfGJS440yoa428eUw6DXWXNyu9eXEQz.jpeg','Dhaka.',2,'191 929 1854',240000,2,'596 928 0287',-1,'Dhaka, Dhaka',1100,'Sutrapur.','Brother Prodip Placid Gomes, CSC','+880-1723-653748',NULL,1,NULL,1,NULL,'I want to improve my knowledge about the culture of foreign countries. I also want to make my countrys culture and ethics known to others.','I would love to share every possible aspect of our culture with my American family. I would introduce Bangladeshi tradition on different occasions and Bengali language to them whenever I would get chance.',1,'A Friend',NULL,2,'2019-11-22','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1294/school_seal/S9qlDL2863GnByE5RIvTcsx5SMLpHBZAqMt691M3.jpeg'),
	(270,'Shrabosty',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I have done some community service in the past in an orphanage named families for children which is an done for disabled an underprivileged children. i have been there quite a few times to spend time with them by reading books and playing with them and spend a good time with them they have no close ones to spend leisure time with.\r\nI also participate in a charity event named \"RAMADAN REMEDY\" where young students come together to but food for the ones leaving on streets who cant buy good food for themselves on Eid. We distributed food to people living on the streets to share some joy of Eid they were deprived of.\r\n\r\nIn future, I would really like to do more of such community service works whenever i get a chance or opportunity to.  I would like more such work where i get to do activities, teaching, workshops etc with underprivileged needy children or people, or other service works where i can contribute to make a small change.',NULL,'House 34, Road 22, Sector 10, Uttara, Dhaka 1230',NULL,1298,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1298/certification/bRlW8bChWzvOefMztasR7vAP7MnGRhpvoCMJMVZO.jpeg','Bangladeshi','10',9,8,'01984417232','64','2003-01-22','shrabosty.b2003@gmail.com','https://www.facebook.com/shrabosty.biswas','1','1','1','+8801400410544','shankerbiswas@gmail.com','Shanker Biswas',NULL,NULL,'Businesseman',NULL,'1',NULL,'@shrabosty_07','Biswas',NULL,'01711370507','shikhaffc@gmail.com','Shikha Biswas',NULL,NULL,'Private Service',68,77,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1298/student_photo/4oWxytFjMfzAmo77j97bkqD2TeReooV2C8JM24Wu.jpeg',NULL,'1230','1',NULL,'Road 6A Sector 4, Uttara, Dhaka','The Aga Khan School Dhaka','2019-11-27 06:43:19','+880248959722','female',NULL,'West Uttara','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1298/marksheet_previous/aH9EA7TBnOdQ1TcfZCAaNR70rE8c0FwrDIkXVK05.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1298/marksheet_previous_two/tWJGWwA79QF5hitcZXBNjKCf6dDuven624AGq3jc.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1298/marksheet_current/rdjmwkpNzykRqMqvAwBF5KlOUT7F6Wu2AZrm9hEV.jpeg','https://twitter.com/Jibooty_lubher',1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,'none','none','EE0746790','2024-11-06','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1298/student_passport/oV4fkcRAIROKtVaTU64p1OE1DZ5gajj6TTuzhRfO.jpeg','Dhaka',2,'5050139137',1200000,2,'5950138486',360000,'Dhaka, Dhaka',1230,'East Uttara','Fahmida Choudhury','01911327929',NULL,1,NULL,1,NULL,'KL-YES Program can give em an opportunity to be familiar with the foreign culture an allow me to blend in to the environment and build a connection with the people around well as give me a completely new experience. i want to engage in community service activities as well as gain such an great experience as well as step out of my comfort zone and become more  independent as an teenager.','Bangladesh has a unique culture that i wish to present to my American Family. Our country has unique blends of food like different pithas, \"Ilish-maach bhaja\"(Ilsha fish fry), Jilapi,  and clothing like Saree, Salwar Kameez, Panjabee etc. I would like to show our culture and tradition through our food and clothing by how diverse and different it is from other cultures, styles and cuisines. I want to also show our attitude towards foreign cultures through my behavior and nature as an Bangladeshi.\r\n\r\nI would try my best to also help them gain some knowledge about our country\'s history, traditions, festivities, rituals etc as well as celebrations from different religions, in occasions where all religions mix in to celebrate happiness together.\r\n\r\nI would also like to introduce them to the beauty of our language and  the love an history behind it.\r\nIn conclusion, i would like to present myself as an Bangladeshi to showcase the diversity and uniqueness of our beautiful country.',1,'A YES Alumni Member',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1298/school_seal/U9noYO0DPM58wwk3ZPjc3SCWrhLXMJQgxg1vfUbx.jpeg'),
	(271,'Tonmoy karmakar',2,0,NULL,'Dhaka, Dhaka',NULL,19,'As I have mentioned earlier that I am outgiving and friendly towards others. So, it is a great delight for me to take part in community services. I also believe that community is very essential for a ware student because he has some duties for the society. So, whenever I get a scope, I enter into community services.\r\n\r\nAs a vice president of green club of my school. Every week, we enact a cleaning programme on the campus. Besides every month, we take part in cleaning programme of our neighbourhood. I am also an active member of social welfare club of my school. During the winter seasons we destibutes warm cloths among the poor people. Every week engaged in controlling traffic of the nearby roads. In this way I try to serve my society.',NULL,'362, Shoronika Vhaban, Ahammednagar, Ancer-camp, Mirpur-1, Dhaka',NULL,1299,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1299/certification/rt4yJyHy2RiCx8RxKbeiDOVygtNVmYxXcx3M6JR1.jpeg','Bangladeshi','10',9,8,'01613970625','71','2004-12-08','karmakarsagor.75@gmail.com','https://m.facebook.com/karmakarsagor.karmakarsagor?ref=bookmarks','1','1','1','01613970625','tondra2008@gmail.com','Bivu Rangan Karmakar',NULL,NULL,'Business man',NULL,'1',NULL,'@_bitter.taste','Sagor',NULL,'01911166614',NULL,'Anu Rupa Karmakar',NULL,NULL,'House Wife',69,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1299/student_photo/vG1qJs1rGa3I4vBPUU4rWTZW8O30wSUjpYYUZR9E.jpeg',NULL,'1216','1',NULL,'Gaznabi Raod, College Gate','Govt. Mohammadpur Model School and College','2019-11-27 06:43:19','9138649','male',NULL,'Mirpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1299/marksheet_previous/HTytVOd5ZCixD4aHSKs317P0Oy44zosqpczWULw0.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1299/marksheet_previous_two/WmP67prpzfzPwpJ6UMegEuBU2lc4BwgQG9tp4aqY.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1299/marksheet_current/IfJ1fliX3S0cj9ELumyJlIVftgtGBu2QqHhOj7sW.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:21',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'3707568667',160000,1,'5507576410',-1,'Dhaka, Dhaka',1207,'Mohammadpur','Lt. Col Kazi Sharif Uddin, BIR','9138649',NULL,1,NULL,1,NULL,'Being a member of ordinary Hindu family. We live in society where the Muslims are majority. So, In many cases we have to struggle to express our idea and views. Sometimes, we have to face a discrimination as a minority group. However, at present, the situation is changing positively. My country feels proud of it\'s glorious tradition, moral values, rich heritage and colourful fastivels. I love my country very and uphold it\'s image to world. Being a ambassador of Bangladesh I would like to spread messages regarding my beautiful country. This messages must cover our glorious comonial harmony  and a rich tradition. I believe can represent my country successfully and change negative views of my country.','My beloved Bangladesh is rich with various unique cultural aspects. We have a very rich language mouth wondering foods special clothing and co-extistance of various religions as I love all aspects of Bengali culture. I can share all those with American family. Specially  I would like to focus on cuisining fashion and religious values. I am a simple Bengali boy whom loves to test traditional Bengali foods, wear traditional bengali dress like Punjabi, Payjama. I can share our Bengali life style with my American family. Again, I can share our religious values which emphasis peace and harmony. Also I would love share the greatness of our language movement with the family and of our great liberation war. I want to give them a message that the Bangladeshi people are peaceloving, tolerant, passionate about making sacrifice for mankind.',1,'Newspaper',NULL,2,'2019-11-23','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1299/school_seal/V27kHz3uIk39NZTGLJyDkQV0atROdGhnclT9Yw2x.jpeg'),
	(272,'Raisul Islam',2,0,NULL,'Dhaka, Dhaka',NULL,19,'In Bangladesh, I live in a rural area where most people are illiterate. And many children do not get the opportunity of going to school. At the weekend, I teach them though I can\'t work with all of them.  And after going to the USA, I must join in community service platform.',NULL,'Maniknagor, kalatia, keranigonj.',NULL,1301,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1301/certification/OTfu6NzQxcUO1ykSzQM2mPaYMxr6FoI695ugTnPT.jpeg','Bangladesh','11',10,9,'+8801863748043','85','2003-12-13','islamraisul987@gmail.com',NULL,'1','1','1','+8801863748043','islamraisul987@gmail.com','Abul Hossain',NULL,NULL,'expatriate',NULL,'1',NULL,NULL,'Rohan',NULL,'01863748043','islamraisul987@gmail.com','Helena Akter',NULL,NULL,'Unemployed',90,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1301/student_photo/9V6ZLRz5JRfncFoKkh5CENSL2pBK6aDFwdL1o0ot.jpeg',NULL,'1313','1',NULL,'Gaznabi Road, College Gate, Mohammadpur, Dhaka','Government Mohammadpur Model School and College','2019-11-27 06:43:19','9138649','male',NULL,'Keranigonj','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1301/marksheet_previous/TnRRwBO7Mgol7nDgtClmrNVNaa1la7oB0618Z7PX.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1301/marksheet_previous_two/Uq4nOpUApPRyiL5daGOCFFMXAbYdH1EyZPjQsP3a.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1301/marksheet_current/oP6rFBN1h0KrY0rEHfDcNxvt03lJiP9anOUHIjHb.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,2,NULL,'I have speech disability.',NULL,NULL,NULL,'Dhaka',2,'19702613817000060',120000,2,'2613817057822',-1,'Dhaka, Dhaka',1207,'Mohammadpur','Lt. Col Sharif Uddin','0',NULL,1,NULL,1,NULL,'Meeting new people is one of the most exciting things for me. And here I\'m getting this opportunity. Besides, it gives me the opportunity of learning new things and traveling to another country. Overall, I think it will be a great journey.','Culture is something that differs from another nation. And I would like to share my culture with the Americans. For being a small country, many people do not know my country. I want people to know about my country and culture. I want to share every aspect of my country. I want them to know how we live, how our days go by, what we eat.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1301/school_seal/5J3vefFa1OhwhvenHHnmpDMmUHEmFluDOJ20BRFj.jpeg'),
	(273,'Masuma Tasnim',2,0,NULL,'Dinajpur, Rangpur',NULL,19,'I have participated in social service activities during flood of 2017.  I helped lots of people. Flood damaged the houses of poor people very badly. They had left nothing with them. During the flood, I offered them food and I also gave them shelter. Some people were suffering from water born deceases. I admitted them inn hospital and also gave medicines to other people. After flood I gave money as much as I could to construct their houses again. Beside this I also gave blankets to poor people during last winter. This is how I participated in the social service activities.',NULL,'Pulhat, Kasba Road',NULL,1304,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1304/certification/HdwcqLiiwgrMhfa2SjRn6fi3WLSt3rLYm48uZjJ6.jpeg','Bangladesh','10',9,8,'01725249863','90','2003-08-25','tamannarahman3734@gmail.com',NULL,'1','1','1','01740554915','monjurrahman089@gmail.com','Md Monjur Rahman',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Tamanna',NULL,'01725249863','rinarahman1281@gmail.com','Mst Rina Begum',NULL,NULL,'Unemployed',86,88,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1304/student_photo/OtNI7z2Bt2xq825ecFvdrmARMwCFTMDelMcWtUBX.jpeg',NULL,'5200','1',NULL,'YMCA Bhaban, Station Road','Tulip International School and College','2019-11-27 06:43:19','01715169699','female',NULL,'Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1304/marksheet_previous/X7NuQUbBWim4yQBr1imIZCWriqd4majtJENvvMlt.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1304/marksheet_previous_two/zr2GIPL8Pb5htl9opqy8skyR21wn3jI9JwZ57i7U.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1304/marksheet_current/xMoVcncDPqgN5A8UGlFF0VN1nIwbn8XXE6NoDPRt.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,'EB0697608','2024-08-18','http://