	(274,'Maliha Momotaj',1,0,NULL,'Rangamati, Chattogram',NULL,19,'Though I never got a chance to participate in community service, but I\'m very passionate about this.If I have the opportunity, I wish to work for a clean and green environment/surrounding. Availability of trash bins, proper management of wastes and raising awareness and knowledge about pollution free environment in my community are the changes I want to bring. Most of the people in my community are not aware of the current climatic condition of our country as we as the world. And those who are aware; are ignorant. There is lack of consciousness among them.Not only this, there is just a Single trash bin in our locality. Nevertheless to say, the bin remains empty but there remains load of trash around it. I want to bring a change to this situation. Plantation of trees and saplings and their care should be implemented. Overall, as a social worker my aim will be to help people come forward to give a hand for the change of a filthy surrounding to a clean, green and sound environment.',NULL,'125A/3, Kathaltoli, Rangamati.',NULL,1306,NULL,'Bangladesh','9',8,7,'+8801737454261','75','2006-03-17','lo33nelyunicorn4@gmail.com',NULL,'1','1','1','+8801556703080','mowdudur.rmt@gmail.com','Mahfuzur Rahman',NULL,NULL,'Teacher',NULL,'1',NULL,'@m_blossom','Sheikh',NULL,'+8801737454261','123jahanararht123@gmail.com','Jahanara Begum Nasima',NULL,NULL,'Unemployed',80,92,NULL,NULL,'4500','1',NULL,'N 106, Rangamati 4500','Lakers\'Public School and College','2019-11-27 06:43:19','035163071','female',NULL,'Rangamati','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1306/marksheet_previous/hYK1H02vRWN7QHOQKZhqZmqYMG9iHaerv1RVkyYY.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1306/marksheet_previous_two/b0ENBmvaZADYHN9EDnewYuYFG7dgiGw0AlWaGg1b.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1306/marksheet_