	(276,'Md: Nafeul Ikbal',2,0,NULL,'Rajshahi, Rajshahi',NULL,19,'Community Service is very important things. I did, when i was in my area i was working with an important volunteer team. Their activities were very important and helpful to everyone.Their activities included serving the wounded on tree-planted roads and raising donations and distributing them to the poor.Also through my school scout I have learned many important cultural and values issues and am very interested in serving people.I will highlight that I will be learning through the YES program that teach social activities.I will try to implement the social activities and important activities that I participate in and the education I receive in my life. In the lives of all.I will try to fully replace the good aspects of it with myself.',NULL,'Dorgapara,panna premises(6th floor),Rajshahi.',NULL,1317,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1317/certification/Wtaxrt1o4DAE3p181D9js8fhkZBLfK0oxy51lGAV.jpeg','Bangladesh','11',10,9,'01302199881','90','2003-12-22','nafeulikbal@gmail.com','http://facebook/nafeul iqbal','1','1','1','01721031585','abulkalam1764@gmail.com','Md.Abul Kalam',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Ikbal',NULL,'01404539552','khatunnaznin75@gmail.com','Mst. Naznin Khatun',NULL,NULL,'Housewife',90,89,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1317/student_photo/5vw0tuIqYcKoIVwurX5iynS88hMvQURR4Nkq61xp.jpeg',NULL,'6000','1',NULL,'Kajihata,Shaheb bazer road,N6 Rajshahi','New Government Degree College,Rajshahi','2019-11-27 06:43:19','0721-772630','male',NULL,'Boalia','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1317/marksheet_previous/vOVmmLc0q22hP4KP85I12KbzI4N8rrjBf9NhSQvU.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1317/marksheet_previous_two/QPnynXJVCjbvRpMQvpzi8N1Qq532R5Q60bfhTw2Y.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1317/marksheet_current/bGE0mTvDiroC715ofYLA1lD45x7wITmdlQz4FLek.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Natore',2,'6914181951894',150000,2,'6914181951884',-1,'Rajshahi, Rajshahi',6000,'Boalia','S.M Jarjis kader','0721-772630',NULL,1,NULL,1,NULL,'The activities of the YES program fascinated me, their activities are very good and very beautiful.Since I was a kid I was very keen to know the various clubs and activities of different ethnic groups and naw yes program gave me that opportunity.Through the YES program, I never want to miss this opportunity to learn about the activities of different nations, different castes, different types of people and their different rituals.The YES program will help me gain a wide variety of knowledge and will give me many adventures.That is why I am interested in participating in the YES program.','I will try to share our culture by mainly conversation and activities.When i will see their different culture, at that moment i will present our culture to them.I will describe this nicely.I want to share about our Geographical condition, Religions, Cultural clothes and other clothes, Natural beauties, Festival and Music, Travel place,Aboriginal,Education system,Traditional activist, Traditional day, Daily life of general people,Bangla literary, Captivating system,Village life and city life,Medical system,Frameworks of our country,Politics,Per capita income,\r\nEnvironment,Employment ect.  If I get the chance to do this, I will do my best to highlight the above mentioned aspects.',1,'A Friend',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1317/school_seal/z9P3CwanchV3a1xdhW1OoneBEYVABAWXMFeCXMYD.jpeg'),
