ing with foreigners. I want to adapt myself to the new environment. Since my father does not have financial transparency, I want to move towards the completion of my education program through the YES program.','I want to spread the language of my country Bangla. For this I would like to launch a voluntary program Bangla Language Education Program. I will arrange to teach Bangla to those who are interested.',1,'My High School/Teacher',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1324/school_seal/VmWatW3CyWtgo8UfEFQw38n3gOvSgaIUpQ2aQN9d.jpeg'),
	(279,'Safayet Haider',2,0,NULL,'Chattogram, Chattogram',NULL,19,'I will try to motivate people of my community  for the usages of renewable resources to extenuate   the effect of climate change as now-a-days  climate change is hot issue around the world.\r\n\r\nFirstly, I will try to make a team which will go to house to house and create awareness about climate change.Then I will collect a fund from all of the houses we went.I will use the fund money to buy trees and all the necessary things for planting trees and to take care of them.I will plant the trees in road sides.Secondly, I will try to make people aware about how they can save our planet by using renewable energy. (like:Solar energy, Biomass energy etc.)I will also inform them how they can do it.',NULL,'F-6,MDC Peace Tower,New chandgaon R/A,Bhadderhat',NULL,1325,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1325/certification/TshWxSD9y10l1Vn1bjX2R3W28rsAi47QgqBCnBes.jpeg','Bangladeshi','10',9,8,'01850924098','74','2004-07-01','safayet.haider@gmail.com',NULL,'1','1','1','01866216824','haidershakawat@gmail.com','Shakhawat Hossain Haider',NULL,NULL,'Banker',NULL,'1',NULL,NULL,'Haider',NULL,'0187756211','asad13609020@gmail.com','Farida Parvin',NULL,NULL,'Unemployed',71,83,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1325/student_photo/ynyjXFqF7cuDIapjKgBwQT3FiSvOBUI3IuXquzYt.jpeg',NULL,'4212','1',NULL,'College Road,Chittagong 4000','Chittagong Government High School','2019-11-27 06:43:19','031-2860035','male',NULL,'Chandgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1325/marksheet_previous/VEGqDQTtkRQM3MXPgbYXGSM7XQC4O0U5kFOiujha.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1325/marksheet_previous_two/5pwdetRXJJCalqR2Bdgl4pS7lAOlODAYjawUJj5K.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1325/marksheet_current/gu3ORvVTAs6f25bapQkBLjYzIvTvirsfqSXDP8ve.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Chattogra,Chattogram',2,'192 914 7161',540000,2,'867 934 6877',-1,'Chattogram, Chattogram',4203,'Chawkbazar','Mohammad Abu Yusuf','031-2860035',NULL,1,NULL,1,NULL,'I always want to represent my country and our culture in other country and this is a great opportunity for me.I desire to share my culture with American people and want to know their culture.Beside this I want to know about the United States of America\'s education system so that I can utilise it to my country.This is why I am applying for the YES program.','I wish to share our language and communication styles with my American family.\r\n\r\nI will show them our cultural activities one by one and try to teach them how we communicate with others.I will teach them 3 Bengali words per day.I think they will be able to know about all of our culture through me.',1,'My High School/Teacher',NULL,2,'2019-11-22','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1325/school_seal/JK0frlFCn48bpnrP8C5KlrJ2IsUqnlbXMKAjhPaT.jpeg'),
	(280,'Sharika Khan',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Sadly, I have never had any kind of chances to join a community service. But in future, if I ever have the opportunity to work for my community through community service, I will help the wandering kids who roams around roadside, to make them fix an aim for each of themselves and pursue their dreams. I hate it when they are being forced by some demon-like people or either circumstances to beg in the jammed traffic area. I want to help them pursue their dreams, fluently go on with their education. I also have this dream to work for those senior citizens who are being displaced from their families and live in old age homes. I want to make them feel like they\'re not displaceable, they\'re more worthy than they could ever imagine. \r\nThese are things I must do if I ever achieve an opportunity.',NULL,'103 Kalabagan Lakecircus, Abed Ali Road,beside of BakkatulMubara mosque 6thfloor',NULL,1331,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1331/certification/7RUcOFSOTTt1CsZvO3grXnXkBn7fBSaEBPXVNkth.jpeg','Bangladesh','9',8,7,'01717071190','70','2005-03-23','sarikauwu@gmail.com','https://www.facebook.com/oniketprantorjam','1','1','1',NULL,NULL,'Shafiul Azam Khan',NULL,NULL,NULL,NULL,'1',NULL,'@sarikauwu_','Khan',NULL,'01717071190','rituafrinsultana@gmail.com','Afrin Sultana Ritu',NULL,NULL,'Unemployed',80,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1331/student_photo/BXCYfUp9zg56C0dM0wuUn0pN8GeS5eNvaYB4PGK9.jpeg',NULL,'1205','1',NULL,'House No. 4/1Rd No. 11A, Dhaka, 1205','Dhanmondi Government Girl\'s High School','2019-11-27 06:43:19','+88-02-9111760','female',NULL,'Dhanmondi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1331/marksheet_previous/aDdVn2pf7cqZU6STxB7gtcDG4dXT6HC83suNkzSf.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1331/marksheet_previous_two/uCup4t0Wl8o0jAVoeSpCt7a5ClAqb2Xc0rwDq5b7.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1331/marksheet_current/cZNzZ94qtoJ2PUdqeGb7qRbtHD7NTVf4Pv050fw4.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-28 12:15:08',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',1,NULL,-1,2,'8673776350',-1,'Dhaka, Dhaka',1205,'Dhanmondi','Del Mahfooza Hossaine','01741117076',NULL,1,NULL,1,NULL,'Apart from the will to pursue my dreams, represent my motherland and it\'s culture, I really do want to meet new people, explore new culture and lifestyles which could possibly cause a change in my introverted self. Although, meeting new people decreases social awkwardness as well as increases wholesomeness.','I would love to share our Folk culture (i.e. songs, dances) through videos and images with my American family. I am going to cook our main and traditional meals for them. For sure, I will love them having gifts from me which is going to be our divine traditional dress termed as\"Saree\" and \"Earthen toys\" which describes the harmonious fair of our Bengali new year \"Pahela Baishakh\" the best. I would also represent the harmony in between our Bengali people along with their hospitable characteristics.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1331/school_seal/crz0miaBD5JCVkKg7LCZ51ZmFPKrXEqFMRc5n9pk.jpeg'),
	(281,'Ahmed Yeasir',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Man is a social animal. He cannot live alone. Society provides all comforts and necessities of life to us. So, we also have an obligation towards the society. I\'m pretty much worried about the environment pollution which is increasing drastically. So, I\'m recently a member of \"Green Club\" of our school. Right now I\'m acting as a Secretary of our club. Before that I also worked for the \"Jaago Foundation\" for a couple of years. And I\'m definitely going to participate in social service during my year in U.S.',NULL,'Mohonpur, Ring Road, Mohammadpur, Dhaka',NULL,1332,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1332/certification/sBABO0RYNzsYUvSVilNNacQLRMJqwkty1DwggF3Q.jpeg','Bangladesh','10',9,8,'+8801851372033','83','2003-12-25','ahmedyeasir420@gmail.com','https://www.facebook.com/profile.php?id=100010807217481','1','1','1','+8801919278333','starcomputerbm@gmail.com','Shahin Ahmed Bappi',NULL,NULL,'Buisnessman',NULL,'1',NULL,NULL,'Hasan',NULL,'+8801823801000','momota.ahmed@gmail.com','Mst. Momotaz Begum',NULL,NULL,'Job in IT Farm',80,96,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1332/student_photo/6VJPmFE3ZK0JUzuRy1HQfCY2BqmvKB43yGQffTOM.jpeg',NULL,'1207','1',NULL,'Gaznabi Road, College Gate, Dhaka','Govt. Mohammadpur Model School and College','2019-11-27 06:43:19','+8809639108264','male',NULL,'Adabor','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1332/marksheet_previous/ZT7WIwwW9vOPLkh5oPJbtIgeUUBqUPghU94MKLm7.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1332/marksheet_previous_two/HiPJQMWhI0Jl28ZrUysh6XlOBY98or0pzDamfCYA.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1332/marksheet_current/5Cfv2tJ09rrFZbGCDS1ZBGmx9ev06mU5SNeYFjZN.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dinajpur',2,'2726407157976',500000,2,'2726407157975',300000,'Dhaka, Dhaka',1207,'Mohammadpur','Kazi Sharif Uddin','+880963-9103980',NULL,1,NULL,1,NULL,'Well, from the official page of YES program I came to know that YES students live with a host family, acquire leadership skills and engage in activities to learn about the U.S. society. All these things attracted me a lot. Besides the U.S. culture has always fascinated me immensely. So, from the very early age it was my farm determination to visit the most wonderful country of the world, U.S. and get known about their culture. And I believe that YES program is a wonderful platform which is giving me the opportunity to fulfill my dreams.','I\'m very proud to be a citizen of Bangladesh as Bengali culture has always been very attracting to me. The people of Bangladesh have a rich fictional legacy, with the first available form of literature being over a thousand years old. Bengali literature developed considerably during the medieval period with the rise of popular poets such as Chandi Das, Daulat Kazi and Alaol. Bangladeshi cuisine is also very much enriched. The country has a tropical monsoon climate. Besides it also has six seasons. As a result Bengal people often taste various kinds of foods on various seasons. Bengali people speaks in Bangla. But we didn\'t get this language so easily. we achieved it at the cost of thousands of martyrs who sacrificed their lives. \r\n\r\nAll these Bangladeshi culture is very much fascinating to me and I\'m definitely going to share them with my host family and friends. Besides I\'ll explain about my culture more deeply during my school speeches.',1,'My High School/Teacher',NULL,2,'2019-11-19','2019-11-19',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1332/school_seal/f7Tdf7YGLl5v7i97TSGYvlJisvhww72D2UAjP3Yr.jpeg'),
	(282,'Shawvik Sarker (Galpo)',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I want to spread peach to the society as a member of Social Welfare Club and Green Club of my school. I with my team distribute warm cloths and blankets to the poor people during winter. Sometimes, we control traffic of nearby roads.We try our best to clean our school campus and the nearby roads. We also plant trees to our school campus and the nearby areas. Hence, I also have a plan in social service in near future. I want to set up an organisation for the welfare of the human being. I will like to found more people with me who will work with me in that organisation. I\'m planning to tech street children, help the people who are suffering badly for poverty by giving them technical education. Actually I want to do something to remove poverty from my country. Hence, in that organisation, I would like to work for that. This will help the poor people by giving them the self-confidence that even they also can do anything by themselves.',NULL,'5th floor,12/10 Mohammadi Housing Society,Mohammadpur,Dhaka-1207',NULL,1334,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1334/certification/iUFXd8wH4uRJJiSgB4ihZ0ylExcwcYqWMRqOMybW.jpeg','Bangladesh','10',9,8,'01720593970','62','2005-05-09','shawviksarker6@gmail.com','https://www.facebook.com/galpo.sarker.3','1','1','1','01786493648','miltonsrkr@gmail.com','Bhabesh Chandra Sarker',NULL,NULL,'Service Holder',NULL,'1',NULL,NULL,'Sarker',NULL,'01913494698','chabisrkr@gmail.com','Chabi Sarker',NULL,NULL,'Housewife',63,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1334/student_photo/bmZVNeEzg2BcxIxwD6aSp12FAeJWhNPUNkSGTdIG.jpeg',NULL,'845427','1',NULL,'Gaznabi Road,College Gate,Mohammadpur,Dhaka-1207','Govt. Mohammadpur Model School & College','2019-11-27 06:43:19','01977-108264','male',NULL,'Adabar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1334/marksheet_previous/udZqb6CDKVM1DBels72v9N0CCAr80bF3HHTMbe7D.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1334/marksheet_previous_two/QoqmmJqcYppwDEynvHH6QnBY5d8od74O9i7BvQgR.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1334/marksheet_current/eojLnEanKTqqWQhNJXZw24Zu7gs6FcyBm5dGa9up.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Pirojpur',2,'2696828671975',350000,2,'2696828671976',-1,'Dhaka, Dhaka',845427,'Adabar','Lt. Col. Kazi Sharif Uddin','0963-9103980',NULL,1,NULL,1,NULL,'I was born in an ordinary middle class Hindu family in such a society where Muslims are the majority and get more priority than us. Hence, in various cases we have to deal with various barriers in order to express our views and ideas. Sometimes, we also have to deal with discrimination here as a minority group. Albeit, now, the situation is changing positively. My beloved country Bangladesh is recognized by its rich heritage, colorful festivals and glorious traditions. Hence, if I get a chance to be a youth ambassador and represent my country to the world it will be the most glorious thing for me. Actually, there are so many students who belongs to an ordinary middle class Hindu family. They are struggling very hard to shine. Hence being a youth ambassador I want to be an inspiration for them. It will help all those students who are facing various discrimination as a minority group here. I want to set an example for them that if you are dedicated to something you can make it count.','I feel very proud whenever talk or think about the cultural aspects of my country because,my beloved Bangladesh is quite rich in having cultural aspects.We have recipes of literally mouth watering foods. We have very rich language,special traditional outfits. Here we are surrounded with co-existence of various religions.As I love all those things hence,I can share all the aspects with my american family.But I will specially like to focus on my religious values which I will share with my american family.My religion is stand for peace.My religious values are my most favorite aspect which I love the most. As I mentioned earlier that I want to spread peace among the world hence,I will eagerly like to share my religious values with my american family and I believe that my american family will really love those religious aspects which I follow as a Hindu.I will tell them about the various kinds of culture and colorful festivals.Thus I will share my religious aspects with my american family.',1,'A Friend',NULL,2,'2019-11-21','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1334/school_seal/EsvDeDz2keY1Wcq4ulNJwwWDAZghOROmTD8suNuk.jpeg'),
	(283,'SHAHRIA',2,0,NULL,'Sylhet, Sylhet',NULL,19,'I HAVE A LITTLE EXPERIENCE ABOUT COMMUNITY SERVICE. BUT I HAVE A DESCRIBE WHENEVER I GET A CHANCE TO SERVE COMMUNITY IN NEAR FUTURE.',NULL,'VILL: MISROPARA, DATTARAIL, DHAKADAKSHIN',NULL,1335,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1335/certification/7j9KoXYwi2qbCKTcjHr90Hs3CK1rCfNJoQV8MIQY.jpeg','BANGLADESH','9',8,7,'+8801715075164','16','2005-01-27','shahriamahmud189@gmail.com',NULL,'1','1','1','+8801715075164',NULL,'ABDUL KADER',NULL,NULL,'BUSINESSMAN',NULL,'1',NULL,NULL,'MAHMUD',NULL,'+8801728321739',NULL,'CHAYARUN NESSA',NULL,NULL,'HOUSEWIFE',24,24,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1335/student_photo/4njaSR1ce5Oqix1UVRNuGcdSD8wN0zxoLGvE51nz.jpeg',NULL,'3161','2','NEW YORK','VILL: MISROPARA, DATTARAIL, DHAKADAKSHIN','DHAKADAKSHIN MULTILATERAL HIGH SCHOOL & COLLEGE','2019-11-27 06:43:19','+8801715075164','male',NULL,'GOLAPGANJ','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1335/marksheet_previous/Zp7ntOP0XwTtlb8G4VEBV7cOW1OEkuhLJYXuWGEP.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1335/marksheet_previous_two/7QWxpqpx2gTqsaRJuZlLPOGEIv1ialDLAiqxF3LJ.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1335/marksheet_current/xe9b2JcJUr1zBrv9YiRklSF4tBvnZcV2ee0nAW8m.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'SYLHET',2,'9113877951247',150000,2,'9113877951094',-1,'Sylhet, Sylhet',3161,'GOLAPGANJ','MD REZAUL AMIN','+8801733083605',NULL,1,NULL,1,NULL,'STUDY IN US IS DREAM FOR EVERYONE. AMONG THEM I HAVE ALSO A DREAM TO STUDY IN US','BY ANY MEANS WE ARE ALWAYS CIRCLED TO CULTURE. IT\'S A REAL PLEASURE TO DESCRIBE MY CULTURE WITH ANY FOREIGNER HOWEVER HE/SHE IS A FOREIGNER RELATIVE OR UNKNOWN FOREIGNER .',1,'Newspaper',NULL,2,'2019-11-23','2019-11-19',1,NULL,'http:/