cessors laid down their lives in 1952 in demand of the establishment of our mother tongue as a state language. We are the unique nation in the world to have become successful. Salam, Rafiq, Jabbar, Barkat all our national serous made history and established Bangla as a state language That day 21st February, 1952 thus became memorable Rafiq living abroad claimed 21st February to be the International Mother Language Day . On November 17, 1999 UNESCO declared 21st February as the International Mother Language Day. Thes we proved our way form national establishment to international recognition. We are proud of our language and nation.',1,'Newspaper','One day i am reading newspaper and seen this K-L (YES) program news.',1,'2019-11-23','2019-11-19',1,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/239/file/yZlpEPLkFzO6srxLpKB1X18Uz6N6XXliSpzOPoRI.pdf',NULL),
