 can give me the opportunity to Represent my own culture and country .To me , the first one is always special.I am very much interested in sharing my culture and also experiencing the other cultures . I think it will change my life in a prosperous way .So , I eagerly want to take this glorious Prospect and optimistic to give my best . Who knows , it can be the turning point of my life .','I wish to share my mother language with my  American family.\r\n\r\nThe International Mother Language day , 21st February is based on the language movement in 1952 in Bangladesh. We are the first nation who gained the freedom to speak their mother language by  sacrificing  their valuable life. So, Bengali is one of our nation\'s proud .  \r\n\r\nAt first I want to inform my American family about the  importance of my mother language to me and my nation. Then I want share about the Bengali Literature written by famous poets ( specially Rabindranath Tagore and our national poet Kazi Nazrul Islam). In another way, I want to sing some beautiful songs from my country written in my language. So that , they can enjoy the beauty of Bengali. As time goes by , I want to teach them some vocabulary and common phrases in my mother language .',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1348/school_seal/sjeIkdrhc1A2CFPmRXzSzEHEpeNcT7J2fGqgpP2T.jpeg'),
