,NULL,1,NULL,1,NULL,'As a Bangladeshi I want to represent my country and my culture so that they can improve their mind about our country and our culture. Again I  am interested to know their culture to enrich my knowledge. Moreover I want  to know how they move to develop their country by hard work so that I can apply it to my country and improve my country as well.','Firstly, I wish to share them our language from our culture. Because we fought for it. we have a smashing history about it.I want to teach them some of our language so that they will feel some interest and wanted to provide them in their community.Then I wish to share them our religion.I think they have something wrong thought in mind about Muslim society. As a Muslim I would like to represent our religion to break their wrong think. Then other things can be shared with them.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1349/school_seal/gUVlxKJi3rYC6LaIVaQcxq6d8p5KQyWfGz7w1Djp.jpeg'),
