NULL,1,NULL,'I want to explore a new culture, a new country and want to make some new friends , which is going to be a philosophical experience for me. I also want to express our culture and traditions towards to the people .','I want to show the significance of our mother tongue by some documentaries. I am going to cook some traditional foods like Dal, Vaat , Bhorta , Biriyani etc. I want to wear our traditional cloths in front of them. I want to show the significance of our religional aspects. I want to give them knowledge about the social activities, functions etc. like Pohela Boishakh , International Mother Language Day , Victory Day, Eid-Ul-Fitr etc.',1,'A YES Alumni Member',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1355/school_seal/zrPWVxOglPkoEzm3ZXvyavjF87UR4dcQT7Lx20va.jpeg'),
