y religious cultures to my American family. I will celebrate all the religious events and i\'ll show them this',1,'A Friend',NULL,2,'2019-11-22','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1369/school_seal/PvTapksqTopDLEFoiuPrTqcwW7aXVlx3bQeneJMj.jpeg'),
	(298,'Debendra',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I possess a friendly character & am always eager to work for others.So, it\'s a pleasure for me to dedicate myself in community services. I think that community service is very crucial for a responsible  student because he/she has some promises for the society & country. Whenever I have an opportunity , I dedicate myself to community services. \r\n\r\nHere, it can be informed that I am an active member of  the Green Club of my college. Every week we launch the cleaning program throughout the campus. In addition,every month we take part in the cleaning program of our neighborhoods.I am also an active member of Social Welfare Club of my College. During the winter seasons we distribute warm clothes among the poor people.Every week we get involved in controlling traffics of our  neighborhoods.Thus I serve my community and society.',NULL,'11/A8, 5th floor, Aziz Moholla, Madrasa Road.',NULL,1370,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1370/certification/QWp49cQsLm6gh6AW5jurTZoVRXSbXLiKQw0MnnPk.jpeg','Bangladesh','11',10,9,'01556863560','80','2003-11-21','sheshu@mmsc.edu.bd',NULL,'1','1','1','01611856007',NULL,'Depalo Dewan',NULL,NULL,'Nill',NULL,'1',NULL,NULL,'Dewan',NULL,'01611856007',NULL,'Utpala Barna Khisa',NULL,NULL,'Private Service',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1370/student_photo/aeQA0RvojKUhPGjn3pAcsuwU6oJlnj2hbN5i5NhJ.jpeg',NULL,'1207','1',NULL,'Goznobi Road, College Gate.','Govt. Mohammadpur Model School and College.','2019-11-27 06:43:19','029138649','male',NULL,'Mohammadpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1370/marksheet_previous/8AhErn2XMP53gPaLDyZFk3I1THz2rducb0ayiopl.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1370/marksheet_previous_two/wO1uykKg1zeUHCOdM8rg5lWeKc9XBiNKdDBDETkP.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1370/marksheet_current/jrhGGe65obG2yCrIBWseddg85dNVHACv7ykAXNqw.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,'BR 0124459','2022-12-09','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1370/student_passport/BrpgooXKCryddWHUd6uOvJfjIx0s2GFdsu8YDvFZ.jpeg','Khagrachhari',1,'1488547959',-1,2,'7788564313',200000,'Dhaka, Dhaka',1207,'Mohammadpur','Lt. Colonel Kazi Sharif Udiin','01769111190',NULL,1,NULL,1,NULL,'I am a member of ethnic society of Bangladesh & obviously I represent a minority group.Though I belong to an ethnic society,I dream to to do something that makes my ethnic clan proud & at the same time,I would like to glorify my country.\r\n I love to get involved in cultural and social activities of my ethnic group & of my society.I\'ve always desires to cherish the spirit of Chakma &  Bengali culture and spread  among all the people around me .Here, I would like to mention that  I am a sportsman & have already earned a number of successes. So, I think that Yes program can give me a great horizon for sharing my cultural & sporting spirit with the American people.\r\nAt present, I live in a muslim dominated society where people belonging to the ethnic minority are to struggle to have their dreams and establish their rights.Here,all the people belonging to the minority class  can not materialize their dreams but overcoming all the hurdles, I want to make my dreams true.','My motherland Bangladesh is replete with  various unique cultural aspects.My own ethnic community has added a glorious addition to the Bangladeshi culture. We  are blessed with very rich languages , delicious foods , special clothing and  co-existence  of various religious communties. As I love all the aspects of Bangladeshi culture, I can share all those aspects with the American family. Specially I would like to emphasize our languages, cuisine, fashion , and religious & ethnic values. \r\n\r\nI am a boy from the the mountainous areas of Bangladesh  I  love to taste traditional Bengali & ethnical foods, wear traditional Bengali & ethnic cal dresses.I can share our lifestyles and fashions my American family. Again I can share our  values which emphasis peace and harmony. In addition I would love to share the great history of our language movement  & of my own ethnic language with the American family and of our great liberation war. I want to give them a message that the Bangladeshi people a',1,'My High School/Teacher','Md. Zahirul Islam, Lecturer in English.',2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1370/school_seal/nrAOvDnyUWWSVefuMuxCK9fyPcHtuRLs9aIN0kEg.jpeg'),
