nguage and cuisine with my American family .\r\nIn order to do that i can cook Bangladeshi food from them, inspire them to dress like us for a day at lest , i will celebrate our cultural program with them , i will also get them in touch with our traditional songs.',2,'Other','A friend of my father suggested me',2,'2019-11-23','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1375/school_seal/uq6CYuk40YqHoYoCrgIB9VGSMzwNHdmnkMtsbjZP.jpeg'),
