oples. This program help me to do so and by means of community sharing I will help my nation too.','As a subcontinental small country we have a well diversification in case of our language, cuisine, clothing and religion. But  if I have to choose between these i\'ll pick LANGUAGE for sure.\r\nWe are the only nation who got their mother language, Bangla by means of blood in 1952. It felt me proud and I\'ll share the event with each and every person with whom i\'ll meet from different countries and region',1,'A Friend',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1377/school_seal/YtaQmBC1viCjFRI276xnRWRO4u3CzX2g4wBHbUhr.jpeg'),
	(302,'Mehjabin',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I have not been involved in any community service project but I would love to help out poor people by giving them foods and clothes. Those things will be help poor people in a way. And I also want to do something for homeless children and who doesn\'t have a family. I have many plans for doing the community service for the betterment of the society. But if I ever have a chance to do then I will try my level best to make a world a better place to live.',NULL,'Pallabi Extension gate-1 house-(G-2) mirpur dhaka',NULL,1379,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1379/certification/v26KEl0s4jzK9q1giRuePARe4U6OevgiVYtZddCk.jpeg','Bangladeshi','10',8,7,'01643480482','70','2003-02-20','mehjabinh202@gmail.com',NULL,'1','1','1','01716817623','mehjabinh202@gmail.com','Md. Shahed Hossain',NULL,NULL,'Business man',NULL,'1',NULL,NULL,'Hossain',NULL,'01799665393','mehjabinh202@gmail.com','Shahana Tajnin Islam',NULL,NULL,'House wife',81,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1379/student_photo/PWkeFiTOsYyBYoZJQZjFu4bAZlceVgPfJB4i1jCr.jpeg',NULL,'1216','1',NULL,'8/7 Mirpur, Pallabi, Dhaka','Juvenile English Medium School','2019-11-27 06:43:19','029039020','female',NULL,'Pallabi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1379/marksheet_previous/4IpZeuSwP6EQoTlvEeoenvlddo6Jop6AFy9VrhRB.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1379/marksheet_previous_two/PkzSk9w1r4ki5H5qzoebnGgtrLeVWuDLgZfVIsKM.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1379/marksheet_current/QzX3RQzghYciNzcUBRK3oa4TwIBcU7nWk0UGQBX8.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'19692696402548540',660000,2,'1493425358',-1,'Dhaka, Dhaka',1216,'Pallabi','Mini Musharrat Sayeed','01711635906',NULL,2,'India for summer vacation',1,NULL,'I want to apply for the YES PROGRAM because I want to represent my country and share our cultures with so many new people. I really want to know and learn about their cultures and their lifestyles. I really want to see the former American lifestyle because I have been seeing it only in the movies, and now really eager to see it in real life. I would love to make friends from around the world and learn new cultures and values at the same time. It will be really interesting to know what activities American kids do at school.','Festivals plays an important role in the social life of a Bangladeshi. There are many things about Bangladesh that I want to share with my American host family. There are many festivals which is celebrated in Bangladesh. Such as:- Eid-ul-fitr, Eid-ul-azha, Muharram and many more. Bangladesh is a diverse country where every religions festivals is celebrated. Starting from Eid to Christma, we celebrate it really nicely. I also want to tell them about our foods. Like how it is so different from others. I would love to make some Bengali food for my family and let them know how it tastes. I also want to show them how to make food in Bangladeshi way.',1,'My High School/Teacher',NULL,2,'2019-11-22','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1379/school_seal/rTwoaQzaFRFR0pQFUJS9QMQ6vcvxStQpRU0SWDny.jpeg'),
	(303,'Mahatheer',2,0,NULL,'Dhaka, Dhaka',NULL,19,'If I ever obtain a chance of serving my community, my first target would be a clean and green environment. Secondly, I would make sure that my community is free from corruption.',NULL,'Road#28(old) 15(new),House#15,Flat#02-06,Dhanmondi,Dhaka,Bangladesh.',NULL,1383,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1383/certification/OdgAtElixZDGFnjyLPjNJlwquSGM1XiEttKMrEFr.jpeg','Bangladesh','8',7,6,'+8801715848787','88','2005-07-27','salam.rhd@gmail.com','N/A','2','1','2','+8801715848787','salam.rhd@gmail.com','Engr. Md. Abdus Salam',NULL,NULL,'Additional Chief Engineer (Rhd) Retired. Presently Business.',NULL,'2','2023-03-10','N/A','Muhammed',NULL,'+8801711438774','salam.rhd@gmail.com','Shireen Sultana',NULL,NULL,'Home Maker',87,79,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1383/student_photo/P64SouKRf7bdPbngy75xTMWNmo0DoenBn6svGP0o.jpeg',NULL,'1209','2','New York, Texas.','Road#7/A, House#84/1, Dhanmondi, Dhaka.','European Standard School (ESS)','2019-11-27 06:43:19','+8801755565762','male',NULL,'Dhanmondi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1383/marksheet_previous/zXzx7mvParLMhToVs3mDLSRNFoouozy8VJvOLsPh.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1383/marksheet_previous_two/9d2WuXxoR5grLlJYnAirMn6rBZsR7NkXOsWitkcD.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1383/marksheet_current/s0fJlHmE3EysIW3QHgZNmO5A4NBeSrWv4PGvymN8.jpeg','N/A',2,'62','Visit my Relatives, Elder Brother\'s Wedding, Cousin\'s Wedding.',NULL,NULL,'2019-12-01 09:56:13',NULL,1,1,NULL,NULL,'BW0617378','2023-06-27','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1383/student_passport/Xu431BnMVGgHtH3L7o54GbsL5SlwUPM1cMDW7WdM.jpeg','Dhaka',2,'5072673204',3000000,2,'2691649425949',-1,'Dhaka, Dhaka',1209,'D