	(305,'Syeda Jamila Bokul',2,0,NULL,'Sylhet, Sylhet',NULL,19,'With keeping the practice of cleanliness, I set foot on streets on September 13, 2018, with a group of 7 members. I walked on roadsides of Captain Academy, Sylhet and picked up trashes wherever found. I approached the nearby shop keepers to keep their surroundings clean. \r\nLast 30th September 2019, I implemented this project namely workshop on Anti-bullying behavior with 40 students of class 8-9 from both English and Bangla version of Muhibur Rahman Academy which was supported by International Research and Exchanges Board(IREX). Later on 20 October 2019,students of Muhibur Rahman Academy took an initiative to run a workshop on Drug Addiction that was a follow-up program of mine.\r\n22 October 2019, I joined a workshop based on Cybersecurity at Hazrat Shahjalal DaruSunnah Yaqubia Kamil Madrasa, Sylhet where I spoke about the privacy measures.\r\nIn 2018, I have been started to work as a Volunteer of Boi Pora Utshob. In 2019, I have been promoted as a chairperson of Shotota Shangho.',NULL,'House-22/4 Jalalabad R/A word No 07 Sylhet',NULL,1387,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1387/certification/tUqKXdVyyOAQWfcfJVO5lnPZNK48RbGwdLtZONto.jpeg','Bangladesh','10',9,8,'+8801732421983','80','2004-03-09','sjbjuthi09@gmail.com','https://facebook.com/sjbjuthi','1','1','1','+8801732421983','bokulahmad01@gmail.com','Md Bokul Ahmad',NULL,NULL,'Businessman',NULL,'1',NULL,'https://instagram.com/sjb_juthi','Juthi',NULL,'+8801730261569','mitabegum34@gmail.com','Mst Mita Begum',NULL,NULL,'House Wife',80,95,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1387/student_photo/5yddNlSDasiBNR8l1KtwUHisVsTs2djVu07MeGum.jpeg',NULL,'3100','1',NULL,'Housing Estate Road, Amberkhana, Sylhet','Amberkhana Girls\' School & College','2019-11-27 06:43:19','+880821717369','female',NULL,'Airport','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1387/marksheet_previous/8fQCQdQJuiY4f6Jmtrewaxkvw0ehh67bBhLgeuWS.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1387/marksheet_previous_two/XhaYh2Zz2CRu6k5WgioNS1mPK8YHfpEVRnlOrpTQ.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1387/marksheet_current/FBPkasrfcA3UPnBkrA0FvudwA2sbFSy1M4m3qxPI.jpeg','https://twitter.com/juthisjb',1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,'EE 0224884','2024-10-13','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1387/student_passport/HreTNsBjIKmtNBWkVKcbuAiPfe43oK28D6g0cRfZ.jpeg','Sylhet',2,'8249763072',120000,2,'1949820193',-1,'Sylhet, Sylhet',3100,'Airport','Syed Mohaddis Ahmed','+8801711984050',NULL,1,NULL,1,NULL,'The YES Program creates a platform for the students to exchange their culture and gain advanced knowledge in the USA. I think the best way to learn about a culture is to go there and experience it. If I can get a feel for the culture first-hand, it will be a lot easier to pick things up. Moreover, as a Bangladeshi, I can represent my customs, tradition, and culture by creating a view of it. Besides, by participating in the YES program, I can make a great communication field to interact with those people if I ever come in contact with them. Though I have got the chance to demonstrate my leadership in the English Access Micro \r\nScholarship Program, if I get the opportunity to participate in the YES program, I could develop my leadership skills more pragmatically. Also, the knowledge I would gather, it would bring some positive changes in my personality that would encourage me to solve the problems in my locality. As a result, I can be an Active Citizen of my own country, Bangladesh.','The aspects of Bangladeshi culture that I wish to share with my American family are: 21st February is known as Martyrs Day in Bangladesh, celebrate as the International Mother Language Day worldwide. We are called \"Mache Vathe Bengali.\" Rice, Fish, Curry and Lentil are the most common traditional food for general people. Generall, in rural areas, Bangladeshi men wear lungi and Panjabi whereas the\r\nI can share my own culture with my American family by talking with them and sharing information about my culture. Also, by showing them related documentary pictures and videos. I can wear traditional dress such as Salwar kameez and Shari as well as take Manipuri dress for them. Besides that, I can carry a Bangla book to provide them knowledge about our language practically. If I can go to the USA as a participant in the YES Program, I would celebrate the festivals with my host family that I observed while living in Bangladesh. I can cook Bangladeshi food to make them interested in my cuisine.',1,'Other','I came to know about the YES Program while Mr. A Q M Mushfiq Hassan, Outreach Coordinator, Education USA, described  about The YES Program on Awarding Ceremony of English Access Program 2019.',2,'2019-11-21','2019-11-20',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1387/school_seal/2Frohe5iJUzxfWHoovX8EV5avK6QKKym7VCzqrDx.jpeg'),
