	(308,'Labiba Raihan',1,0,NULL,'Dhaka, Dhaka',NULL,19,'Since 2017, I started working in the community services. My first social work was to plant trees around the area. The beauty of social work,can be felt by the smiles of the people. I worked with organizations such as Asha- The Light Of Hope, Scars, Smile more, Be a savior, With you and Yearning Aches. It is such a heavenly bliss to work for own country. I also worked to collect warm clothes for the unprivileged, fed the needy people and hardworking rickshaw pullers and also vaccinated the street dogs of our area. In addition, as my mother used to work for the eco-friendly environment, I am hugely inspired by her.',NULL,'Unit-A2,1st Floor, House-14, Road-2, Banani, Dhaka',NULL,1394,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1394/certification/8Ny2vzIjgeThbH4sBgODezqLu62v1e5MFM2ugS54.jpeg','Bangladeshi','8',7,6,'+8801856958571','80','2003-02-09','7juteboats@gmail.com','https://www.facebook.com/labiba.raihan','1','1','1',NULL,NULL,'Mohammed Faroque Raihan',NULL,NULL,NULL,NULL,'1',NULL,NULL,'Ocean',NULL,'+8801856958571','nazmanazamp@gmail.com','Nazma Ara Parvin',NULL,NULL,'Business',90,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1394/student_photo/qyJDbSlTusIFqHhpWs39rxssO2Z76picnz8PgnWN.jpeg',NULL,'1213','2','New York','House- 31, Road- 09, Sector- 04, Uttara, Dhaka','The Brilliant School & College','2019-11-27 06:43:20','+8801908885370','female',NULL,'Banani','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1394/marksheet_previous/IBPJ8xyzt0HufZGBdhnHyC6ziG7UeDJoqyRkRPg1.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1394/marksheet_previous_two/rc02ZHBc4ld60qeC7fhDYanzKNSjbvcLFc96Bbpm.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1394/marksheet_current/d0Jad9shzOXaW8JLVu0wty5C4IDo3Lf9QRUDRfe9.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 17:34:34',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka,Dhaka',1,NULL,-1,2,'6400214653',360000,'Dhaka, Dhaka',1230,'East Uttara','Janeh Alam (Joni)','+8801673626642',NULL,1,NULL,1,NULL,'I feel full emotional alignment with the spirit and philosophy of the K-L Yes Program. I want to share the country\'s unique, original and beautiful culture with the world. I want to develop public and community service skills for the women of my country. I also want to develop my skills in cultural diversity and different social customs. It is also one of my dreams that i hope to turn into reality. I want to contribute to turn my country into a developed and outstanding nation among Asia. I also want to experience a different culture and lifestyle other than my own to add value to my skills.','As i come from a very diverse background filled with the Bengal culture. Music instills in my blood. I have made Harmonium and Flute a part of me and i really think it holds a very big part of our culture. I can spread the music of our culture all the way to America. The history of our Bangla language is our pride and i wish to spread it all around the globe. Yes Program is definitely one of the Best platforms for a kick start. I am also involved with art which can help me also acknowledge the American people about the art of my Country. I want to spread the diversity and tolerance all around the globe. I can also spread my cuisine culture of Bengal by making them Bengali Dishes and adding variety to their taste. I will try my best to spread the rich Bangla language and share the glorious history of Bangladesh.',1,'Facebook',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1394/school_seal/KL8nw4zhr1CP7fItLE2UWy7FOecZd0gX3LxIagYH.jpeg'),
	(309,'Abdullah Al',2,0,NULL,'Rangpur, Rangpur',NULL,19,'I think It\'s a great idea to bring positive changes in our society through young generation like us.  Though I didnt get any chance to  participate in any community service program, but I would love to take part in it.  I have some interested friends those who will also love to do so. At first i will gather them & we will work for the child. Our aim is to acknowledging them about the rights of all kind of people. Secondly, i will teach them about sanitation & hygiene.i will aware of them about the Global worming, environment pollution, tree plantation etc. Then i will arrange educative programmes for the poor and needy children because only education can remove the diffence Between us. I hope that can bring specific chance in there behaviour.',NULL,'Pirgang House , RK-Road, Ideal Mor, Rangpur',NULL,1398,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1398/certification/fDnxrGYeTlOfN9f69xcnoI6nCu61aQLcLJf5kr0V.jpeg','Bangladeshi','10',9,8,'+8801628425482','80','2005-01-25','fahimabdullahaal9@gmail.com',NULL,'1','1','1','+8801750284628','fahimabdullahaal9@gmail.com','Shah Md. Masuder Rahman',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Fahim',NULL,'+8801628425482','fahimabdullahaal9@gmail.com','MST Nulufer Yesmin',NULL,NULL,'Unemployed',77,73,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1398/student_photo/dv9oM2nIp6cIIdMq5XadAk6PdFduNq68xmJspDKZ.jpeg',NULL,'5400','1',NULL,'Medical Mor, Rangpur','Cantonment Public School and College, Rangpur','2019-11-27 06:43:20','+88052163051','male',NULL,'Kotwali Thana, Rangpur-5400','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1398/marksheet_previous/YhpPHkEcRjhrVK56cWiPM4QVVt5dqVjhRxk614lA.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1398/marksheet_previous_two/pYexuGHF7QQiUQt3hJiVmfSd95KSDpeSdUL3TB3H.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1398/marksheet_current/d48ctBAk0MakK6kzt0ZFxrkcyrHbJd3GDadqRLcu.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Rangpur',2,'4643658091',420000,2,'4643656954',-1,'Rangpur, Rangpur',5400,'Kotwali Thana, Rangpur-5400','Col Kazi Shamim Hasan','+88052163051',NULL,1,NULL,1,NULL,'Well,our country is not highly rich in higher education. So i will be greatly benefited by the Program. Besides, this program is  not just a opportunity for me to visit or to study abroad but a opportunity to represent our culture, our habit, our lifestyle in front of the US civilization. There is a horrible terror among them that the Muslims are not safe for them,the Muslims  can do anything to fulfil their wills etc. I want to remove these misunderstanding, these fear by living with them. I would love to do whatever i can to be a bridge between them and us.','Culture is the customs, languages and traditions that reflect our past, as well as the shared experiences that help to shape our values and beliefs for today and tomorrow. Its the most important and basic concept for knowing a Civilization. So i would like to share my with my american family by performing some of our regular activists. I would tell them about our cuisine, i would make some common dish of our country that i can cook. I will show them some of our clothes. Not only that,i would love to learn about their culture too.',1,'A YES Alumni Member',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1398/school_seal/iz5h5lbmOgEHht8SgSNgr59Wh8h75uPurubPX89t.jpeg'),
	(310,'Tasnimul',1,0,NULL,'Thakurgaon, Rangpur',NULL,19,'I want to bring together the development community through communion with the community and by organizing with them. It is my dream to bring a certain positive change to my community by participating in this program and earning knowledge about community service from here.',NULL,'House Ho.-72, Clubpara, Morhum Samsul Haque Shanto Road, Ward No.-06',NULL,1399,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1399/certification/FCweEh5sqNM0p73VXJgbnnb2PTdHVQ4QRqFfC0tt.jpeg','Bangladesh','7',6,5,'01773338307','91','2007-07-03','shinyshahin@gmail.com',NULL,'1','1','1','01712715248','shahincomputer.com@gmail.com','Hossain Ahmed',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Hossain',NULL,'01747019862','shahinrahalitu@gmail.com','Sheuly Sultana',NULL,NULL,'Primary Head Teacher',90,98,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1399/student_photo/vAGGoXAH2l8gHVjzoOCQFDcKuWgSmnrIbjWBG1II.jpeg',NULL,'5100','1',NULL,'Bangabandhu Road, Thakurgoan','Thakurgaon Govt. Boys\' High School','2019-11-27 06:43:20','0561-53424','male',NULL,'Thakurgaon Sadar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1399/marksheet_previous/6AnCxqvKnb0CqOi6GM7kvg0g1nFG28ZiX0rOX3GG.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1399/marksheet_previous_two/BnrhwCkbfaqSw39jDGKqLirW9VER6Kke8fzoNcrV.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1399/marksheet_current/kyRHzGg1P0fI6Y4MxiwZc4OU4o30UMYJta9J1bef.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Thakurgaon',1,'9429406125599',463680,1,'9147235494',411180,'Thakurgaon, Rangpur',5100,'Thakurgaon Sadar','Pijushkanto Roy','01715359561',NULL,1,NULL,1,NULL,'I would like to apply for the YES program to benefit the society and the poorest people by getting higher education socially.','In fact, with my conscience knowledge, I would like to live in harmony with the American family, without any discrimination, and share the good aspects of my country\'s food, language and religion with them, and their curiosity and the content of their religion Let\'s publish.',1,'Newspaper',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1399/school_seal/cC8FNAhAu9lrnuygVnbuXg3qvWDGwidab5kmqcKt.jpeg'),
	(311,'Rudaba Rufaida',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Since I havent had the opportunity to make positive changes in my community yet, I want to share my dream plans for future execution.\r\n\r\nI will clean a local park and plant fruit trees by organizing a group of children. By plantation I will raise awareness about the ongoing climate crisis and global warming.\r\nThere is a slum near my house where many young girls lives without having proper knowledge on personal hygiene and sanitation. I would educate them on menstrual hygiene and how to take care properly and without any taboos. \r\n\r\nIt has been a dream of mine to run an awareness campaign in my community to educate people on mental health issues. I would like to invite experts by arranging seminars on this topic to develop consciousness in my locality and distribute leaflets, posters etc.. \r\n  \r\nI want to take care of stray dogs and cats and provide a home for them. I would set up a rescue team with my friends and will make a small shelter for the animals where I will work voluntarily.',NULL,'Mohona Sunflower, Flat C5, House 8/A/4, Road 14 (New), Dhanmondi R/A, Dhaka',NULL,1400,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1400/certification/zJq7eHNmyz0lg6wnmXHTbREWtO6q1N9Zem6oGNz3.jpeg','Bangladeshi','9',8,7,'+8801819979497','80','2004-01-31','rudabarufaidahasan@gmail.com',NULL,'1','1','1','+8801726707276','kamrulh@abbl.com','Mohammad Kamrul Hasan',NULL,NULL,'Assistant Vice President, AB Bank Ltd. Dhaka',NULL,'2','2022-09-30',NULL,'Hasan',NULL,'+8801819979497','akhatun@iom.int','Asma Khatun',NULL,NULL,'Head-Migrants Protection and Assistance, International Organization for Migration (IOM), Bangladesh',78,76,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1400/student_photo/23g6NJXxcV6d22i3DU6UCDBAyder4AwAtJhR0FYg.jpeg',NULL,'1209','2','Los Angles, California','95 Dhanmondi, Road 11/A, Dhaka','Siddiqui\'s International School','2019-11-27 06:43:20','+88029141975, +88029160767, +8801841684684','female',NULL,'Dhanmondi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1400/marksheet_previous/hTlbzqCbnpNJ3bxgvFBjz6w2Qr4P2a3Dh8lVGBVK.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1400/marksheet_previous_two/pGoxyALmmCmHLqrtSMxzOBhxB9ZKhqmrg2I9Pyzz.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1400/marksheet_current/STHW5BDq0FnPtt3FMHZ3FJikmff78QJL98JVY2NE.jpeg',NULL,2,'20','Visiting my relatives',NULL,NULL,'2019-11-30 15:59:07',NULL,1,1,NULL,NULL,'BW0739538','2023-07-04','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1400/student_passport/lFtc6jTBceYbfZo0gXJXQp4blwAQwKIfZrD6f8xH.jpeg','Dhaka',2,'5527313778',1650000,2,'2827310877',3480000,'Dhaka, Dhaka',1209,'Dhanmondi','Ms. Nahid Arefa Siddiqui','+8801677534744, +88029141975','I have traveled to Los Angels, California during December 2018 - January 2019',2,'Bhutan, Thailand, Malaysia and India for vacation, and Spain to attend the Children Program arranged in the Mobile World Congress in 2016',1,NULL,'I want to apply to the YES program to share my roots, to be able to represent my country and express my culture by showing people its essential aspects: such as books, films, music etc. Besides, Im curious to learn more about America: its history, customs and diverse culture. Im interested to participate in community projects and volunteer for causes that I support, as America offers a wider range of opportunities than Bangladesh does. Last but not least, I want to be a part of a new education system and take up extracurricular activities to get the chance to be a better version of myself.','Id like to tell them about the language movement of 1952 and the liberation war of 1971; when people of this land sacrificed their lives just so I could speak in my mother tongue in an independent land. I would tell them about our history and teach them the basics of  Bangla, simple phrases. I would share my culture through literature, films and music; and like to learn more about Americas culture as well.\r\n\r\nI would tell them of the spicy and flavorful food I enjoy back home such as a variety of curries, a myriad of pickle and different types of rice.  If they wish to try it, I would arrange a nice Bangladeshi meal for them with the food that we usually enjoy every day.\r\n\r\nI would share what my people wear traditionally; panjabis, salwar kameez, sarees and tribal clothing. \r\n\r\nSince I am a Muslim, I would tell them about Islam how it guides us for bringing peace upon mankind. I am interested to hear about their religion and see what similarities and differences in our respective beliefs.',1,'A YES Alumni Member',NULL,2,'2019-11-22','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1400/school_seal/wk11fTY3x9ca98G92rfqK4agWhPzzLVALQ0gsrZu.jpeg'),
