	(318,'Sami',2,0,NULL,'Chattogram, Chattogram',NULL,19,'English is very important for our society and community. We should know English to be global.\r\nI have a plan to work on education specifically on English language as a social work. English is the most commonly spoken language in the world. It is the language of science and technology, aviation, information technology, computer, diplomacy, tourism and media. Learning English and being fluent at it enables us to easily communicate with fellow global citizens.\r\n\r\nStill, in 21st century a huge population of Bangladesh doesnt know how to communicate in English. I set a goal to open a language school in the future for developing and teaching English, telling the importance of it to the people of my country. It would help them to get a good job at home and abroad. I think it would reduce unemployment issue of our society. This school would be free of cost for all.',NULL,'North Gasbaria(Badurpara), Ward no-1, Chandanaish Pourashava, P.O.-Gasbaria',NULL,1426,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1426/certification/phlActlQpZfU4CjcGzQHvoJuWvoCSRi94pl3ZxXJ.jpeg','Bangladesh','11',10,9,'+8801876628189','76','2004-02-14','sadnan033@gmail.com',NULL,'1','1','1','+8801819327252','fazlul275@gmail.com','Md. Fazlul Kader Sirajee',NULL,NULL,'Businessman',NULL,'1',NULL,NULL,'Adnan',NULL,'+8801815043286','najmab.cgsnc@gmail.com','Najma Bagum',NULL,NULL,'Teacher',89,86,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1426/student_photo/spBUOVNFejJYoXbpBIbPOPQnRGKAmLjNMnXurbI3.jpeg',NULL,'4217','2','New Jersey','51, Panchlaish R/A, Chattogram','Presidency International School','2019-11-27 06:43:20','+88031655108, +88031656771','male',NULL,'Chandanaish','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1426/marksheet_previous/2WwdhqjY7WRQ6NNggEPnIaYw0v8PIZbzKnRJuZ0X.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1426/marksheet_previous_two/luSWNQnxYl6Jf06rVMtplVgRkueCMiKad9gR3AoC.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1426/marksheet_current/b7jR5fwt9u3SvgFfh8HJPpTBiJdxf6aiclXUnnwu.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:26:28',NULL,1,1,NULL,NULL,'BR0086694','2022-12-04','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1426/student_passport/fUfXPQadXFpniTHjqWiHl7Nkq8xj1vJe2ww8rMz9.jpeg','Chattogram',2,'19641521801577415',450000,2,'19791521801469698',200000,'Chattogram, Chattogram',4203,'Panchlaish','Lt-Col.(Rtd) Md. Ziauddin Ahmed; BirUttam','+88031655108, +88031656771',NULL,1,NULL,1,NULL,'I always had a dream of studying in the U.S.A. as it still top in almost all aspects. This program will help me to be more familiar with American people, society, education, lifestyle, culture and educate the people of my country about them. In addition, I would get a chance to develop unique leadership and interpersonal skills. Furthermore, I would get an opportunity to represent my culture, religion, country and community to American people.','Our culture is very different from that of Americas culture or so called the western culture. So, I will have a lot to share with my American family about these. I will tell about the rich Bangladeshi cuisines and food habits. Bangladeshi food is best known for its rich, spicy flavors and alluring aroma. Rice and fish is the main food of Bangladeshis, there is even a proverb for it Bengali by rice and fish. There are many ways of cooking fish in Bangladesh, I will collect all of them and share with them. Mejbani beef curry is a historic and rich cuisine which is very different from other beef cuisines.\r\n\r\nI would cook some of the dishes for my American family. For example, we Bengalis have panta-eilish during bangla new year, I would prepare it for them during that day. Moreover, I would also show them how we eat rice with our hands, using no spoons or forks.',1,'My Family Member',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1426/school_seal/vvIRmN6WcZja8DaqiiohNndigV2y3aoyIQ2VO3L2.jpeg'),
	(319,'Fayza Farzana',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I possess an amiable &  friendly character. So, it\'s a great joy for me to dedicate myself in community services. I think that community service is very important for a conscious student because he/she has some commitments for the society. Whenever I have an opportunity c , I dedicate myself to community services. \r\n\r\nHere, it can be mentioned that I am an active member of  the Green Club of my college. Every week we launch the cleaning program throughout the campus. In addition,every month we take part in the cleaning program of our neighborhoods.I am also an active member of Social Welfare Club of my College. During the winter seasons we distribute warm clothes among the poor people.Every week we get involved in controlling traffics of our  neighborhoods.In this way I  try my best to serve my community & society.',NULL,'Flat-A3, 11/12, Aziz Moholla, Madrasa Road',NULL,1431,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1431/certification/Sy1fcqeH2JyRdrAGPgSlOrDRdNOOXRsJ5OSr7hLY.jpeg','Bangladesh','11',10,9,'01711181545','70','2004-01-08','md.zahirulislam71@yahoo.com',NULL,'1','1','1','01711181545','md.zahirulislam71@yahoo.com','Md. Zahirul Islam',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Islam',NULL,'01716039075',NULL,'Dilruba Islam',NULL,NULL,'House wife',70,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1431/student_photo/8VFeDZZRXTkOGvXqulBwSXU6jrNIEWkv6Iuh9Her.jpeg',NULL,'1207','1',NULL,'Goznobi Road, College Gate.','Govt. Mohammadpur Model School and College.','2019-11-27 06:43:20','029138649','female',NULL,'Mohammadpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1431/marksheet_previous/VNqoxsCix7bjoF1UcDvI1UJJavnf2mbHwIGCRFdT.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1431/marksheet_previous_two/aN0Q2bOBgieFPHf4Yq2JO9hcftveNaYfKdcgcLeA.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1431/marksheet_current/giBt21hUUGjtID0hMlxsAbJvMWcgqsZpB4YqFjfK.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:28:31',NULL,1,1,NULL,NULL,'BR 0429368','2023-01-07','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1431/student_passport/p96b055Gf4YvuCxk5FvRbyQBvy0AQ5CjqKquRc0R.jpeg','Dhaka',2,'19652915673048488',750000,2,'2915673048798',-1,'Dhaka, Dhaka',1207,'Mohammadpur','Lt. Col Kazi Sharif Udiin','01769111190',NULL,2,'India, Tour',1,NULL,'I am a member of a conservative muslim family of Bangladesh.Though I belong to a conservative family, I love to get involved in cultural and social activities. I\'ve always desires to cherish the spirit of Bengali culture and spread  among all the people around me . Frankly speaking, I am a musician. I also love recitation and painting.So, I think that Yes program can give me a great horizon for sharing my cultural spirit with the American people.\r\nSo far as I know through YES program a Bangladeshi student is able to share his ideas, views, attitudes, and visions with the foreign students.So if i am selected for the program I will be able to enrich my mind by sharing my own perceptions and ideas.','My loving Bangladesh boasts of  rich  various unique cultural aspects . We are blessed with a very rich language , delicious foods , special clothing and  co-existence  of various religions. As I love all the aspects of Bengali culture, I can share all those aspects with the American family. Specially I would like to emphasize  my language, cuisine, fashion , and religious values. \r\n\r\nI am an ordinary Bengali girl who loves to taste traditional Bengali foods, wear traditional bengali dresses  like sarees and salwar kamij. I can share our lifestyles and fashions my American family. Again I can share our religious values which emphasis peace and harmony. In addition I would love to share the great history of our language movement with the American family and of our great liberation war. I want to give them a message that the Bangladeshi people are peace loving, tolerant and passionate about making sacrifices for the sake of humanity.',1,'My High School/Teacher','Md. Zahirul Islam, Lecturer in English, Govt Mohammadpur Model School and College.',2,'2019-11-22','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1431/school_seal/YqXWPDsQ24kM32ZWHmQFIMBKY3bw5Aii5l4CJZWS.jpeg'),
	(320,'Rafi Rahaman',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Raising awareness among the community about global warming would be how I would like to bring changes in the community. Making the people aware about their daily activities which has increased global warming on earth in collaboration with other children in the community will be an effective way of increasing responsibility among the host community I will be living in. We can plan for different activities on weekends where the community people can participate and learn about how our daily activities are a cause for global warming.\r\nMoreover, during storms and cyclones in America, students and communities often take part in relief and rehabilitation activities. I would also like to take part in this as I feel the importance of helping and giving shelter to others in times of disasters because Bangladesh also faces such calamities. I will encourage my friends and community to take part with me and support the affected people.',NULL,'House 47 (4th Floor), Road 7, PC Culture Housing Society, SHekhertaque',NULL,1432,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1432/certification/qtMsqFtsZNYdbm2JudWfs2xUYLtaun7N2jH1DimR.jpeg','Bangladeshi','9',8,7,'+8801711475709','78','2004-10-11','majibur.rahamanru@gmail.com','https://www.facebook.com/profile.php?id=100010401633385','1','1','1','+8801711475709','majibor@gmail.com','MD MAJIBUR RAHAMAN',NULL,NULL,'Private Service (Winrock International)',NULL,'1',NULL,NULL,'JIM',NULL,'+8801748140186','sumi.choudhury76@gmail.com','RIATUN NESA CHOUDHURY',NULL,NULL,'Unemployed (House wife)',88,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1432/student_photo/DMXJl5b3gVlW0Gbj7BVGDJNyIWQr0hUkT2fODhZ6.jpeg',NULL,'1207','2','New York','97 asad avenue','St.Joseph Higher Secondary School','2019-11-27 06:43:20','+8802 9112917','male',NULL,'Mohammadpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1432/marksheet_previous/1VNOs4J1E3dZ5efdAJMMB856iEYVzhwvarliv3vQ.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1432/marksheet_previous_two/TyUUOAjun59YBX0RusKsTB2h1UY00uBqr66JzKGh.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1432/marksheet_current/J6T2QaOeKgXt1hgBslacXHjKq1ZBPvAnvW9hLJh4.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:30:26',NULL,1,1,NULL,NULL,'BR0032765','2022-11-11','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1432/student_passport/KEYKAZ47ZWGl2NXADoGNZBCBJ6CpkCelSB0iKU0A.jpeg','Barishal',2,'2845535786',1800000,2,'19802690243827291',-1,'Dhaka, Dhaka',1207,'Mohammadpur','Brother Robi Purification','+880 1911574282',NULL,2,'Nepal for winter vacation',1,NULL,'The YES program offers a student exchange of versatile experiences and life lessons. It teaches to be fully aware of your surroundings, to be confident, independent and responsible as a human being. I particularly want to apply for the YES program as it would give me a unique opportunity to socialize with new friends and families, a chance to become part of the global community. I would learn to be independent, mature and aware of my actions which will be an important lifelong lesson for me. I would also gain the experience of living with a host family in a healthy environment, make new friends, learn more about the people, the country, education system, and culture which I am particularly interested in. Through being a part of such a community, I will be able to enrich my knowledge, broaden my perspective, and most importantly, contribute to peace and sustainability in the global communities with the acquired knowledge.','I will have the privilege to share my countrys history- how we sacrificed for our mother tongue, how we became independent. I will share this when I get an opportunity to make a project or display in class. I can share this with my host family as well on various occasions such as on the international mother language day.\r\nI will showcase my countrys clothing and various traditions. For example, during Friday (weekly prayer) and on Eid (religious occasion) I will wear Punjabi/fatua which will hopefully create an interest among others to get introduced with and embrace the beauty of difference and diversity.\r\nI wish to share my countrys moral values that uphold self-respect and dignity while communicating with others. I will make a healthy relationship with the host family, whilst try to share a good vibe about my country by sharing information about her natural beauty, world heritage sites, ancient places, seasonal fruits and the appearances of nature through the six seasons.',1,'My High School/Teacher',NULL,2,'2019-11-22','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1432/school_seal/iRaJ3bFRaHGHguWhQd5ou2Tt66OgimhM6bdeQ9TE.jpeg'),
