	(322,'Naymul Huda',2,0,NULL,'Habiganj, Sylhet',NULL,19,'I am a member of Interect Club of Habiganj . It is a part of Rotary International. This club purpose is to help the people. Now I am working as a International service director of this club and now days I organised some social project. We gave cloth to the poor people who are not able to buy cloth. And in the last winter we distributed some blanket to the poor people. And we plant huge figure tree. So It is very easy for me. I like to work for the helpless people. I will be very glad if you select me for this programme',NULL,'Building No 1/B, staff quarter, Habiganj',NULL,1435,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1435/certification/ZE6ZewFjZsWPZEq2bq7bxcVcmsuUCHh4uEeDiVh3.jpeg','Bangladeshi','10',9,8,'01318405118','83','2003-11-11','mdnazirta1960@gmail.com','https://www.facebook.com/naymul.huda.39','1','1','1','01715682603','mdnazirta1960@gmail.com','Md Nazir Hossain',NULL,NULL,'Government Employee',NULL,'1',NULL,NULL,'Mahee',NULL,'01742286695','wizard.mahi2003@gmail.com','Syeda Masuda khatun',NULL,NULL,'Housewife',82,100,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1435/student_photo/6HIzGSuJTOrPQ2m1oRHHHaaN3lTtkeEzKOP5kJU4.jpeg',NULL,'3300','1',NULL,'Tin kuna pukur par, Habiganj','Habiganj Govt High School','2019-11-27 06:43:20','083154341','male',NULL,'Habiganj','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1435/marksheet_previous/IUO1PjFt8LDdEq7xm4Ky4C6WoFXiypwVF613vLvp.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1435/marksheet_previous_two/HUOg4nUZYgaaFR5Ehw5ilZDgtUA5NoiZCXDEk42y.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1435/marksheet_current/kyJg929GQ6mnBxhZghDTwwgemeXNO93eXVSjSOaN.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:33:29',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Habiganj',2,'6435201295',100000,2,'8235225607',-1,'Habiganj, Sylhet',3300,'Habiganj','Sheik Alfaz Uddin','01716870494',NULL,1,NULL,1,NULL,'I think that is a good platform for represent my country. I would like to represent my country to another nations.','I wish if you give me a opportunity to share them ( my american family) about our language by speaking them and i will try to  teach them about  my religion and also share about my cuisine by cooking.It is very easy for me  cause my family member says that my cooking was very delicious.',1,'iEARN-BD Website',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1435/school_seal/5tF1bKGJ5KDmbiqOoMX9YXtN9zWgBfPob13RdsaJ.jpeg'),
	(323,'Zulius Arabi',2,0,NULL,'Dhaka, Dhaka',NULL,19,'If I have the opportunity, I will bring specific positive change helping animals and the environment in our community through community service by taking care of cats and dogs at an animal shelter, cleaning up a local park, planting a tree for Arbor Day, placing a bird feeder and bird fountain in our backyard, starting a butterfly garden in your community,participating in the cleanup of a local river, pond, or lake, caring for a neighbors pet while they are away, building and setting up a bird house, campaigning for more bike lanes in our town, volunteering at a nature camp and teaching kids about the environment, sponsoring a recycling contest and planting native flowers or plants along highways. Besides, if I have the opportunity, I will  help the senior citizens through community service by reading to residents at a nursing home, delivering groceries and meals to elderly neighbors, making birthday cards for the elderly, mowing an elderly neighbors lawn.',NULL,'7/1 Tallabag, Sobahabag, Mohammad, Shere-E-Bangla Nagar',NULL,1436,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1436/certification/ebAoRy5xlGR50IUBd0J2ZRstiPyx35ocfdmLSqar.jpeg','Bangladesh','10',9,8,'+8801711044888','82','2004-06-11','stceduexpo@gmail.com',NULL,'1','1','1','+8801711-044888','zislam1971@gmail.com','Md. Zohurul Islam',NULL,NULL,'Program Manager',NULL,'1',NULL,NULL,'Mugdho',NULL,'+8801720-209430','gwfbd10@gmail.com','Most Amina Aktar',NULL,NULL,'Employed',81,81,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1436/student_photo/MJZFcfx9qXzRUzNdSe2LQmThZkB33PqRbbsYM3Rv.jpeg',NULL,'1207','1',NULL,'Road No. 8/A(Old 15), House No. 279/A, West Dhanmondi, Dhaka','Salvation International School & College','2019-11-27 06:43:20','+8801766-388607','male',NULL,'Shere-E-Bangla Nagar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1436/marksheet_previous/BITEPd6w1fMlTAb0shdQP4gBBB2Ib7tgjUhNkq36.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1436/marksheet_previous_two/Ud5P11v3uXbgjItIKz8UFlsi3d77J21BmTP32nhr.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1436/marksheet_current/0jXhZbcDZnDgMXXNwOpeLUBL8HA22BBvC3pJAGXl.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:34:41',NULL,1,1,NULL,NULL,'BR0183321','2022-12-13','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1436/student_passport/Q82Gp7oeol7VpUxHiI1GyE9sDwdQ40rVx5ePHAoi.jpeg','Naogaon',2,'5972073315',480000,2,'4622074906',240000,'Dhaka, Dhaka',1209,'Dhanmondi','Mohammad Yasin','+8801819-187275',NULL,2,'India for summer vacation.',1,NULL,'As a Bangladeshi student I want to apply YES program to get the opportunity to exchange my culture and tradition with the culture of the United States of America. I think exchanging culture with others is the best way to represent one\'s country. Moreover, I want to get this opportunity to share my ideas about my culture with the American family and learn their culture and tradition from them to broaden my outlook. That is why I want to apply YES program.','Bangladesh has a diverse culture. Our culture reflects the behavior of individuals, their dresses, occasions, languages, livelihood, dance, music, film, festivals, etc. It has a golden history. We have 21st February (International Mother Language day), 26th March (Independence day), 16th December (Victory day), Pahela Baishakh (First day of Bengali New year). We are the only nation in the world who sacrifices blood for the sake of Mothers tongue. It was 21st February in 1952. The first day of Bengali New Year, it is 14th April of the year. Bangladeshi people celebrate this day with great joy. Bangladeshi culture and traditions solely reflect in this day. Bangladeshi people have a strong tradition of food. Rice is the staple food here. Its available across the country. They usually take rice three times a day with delicious dishes and curry. Bengali has a name Mache Vat e Bengali indicates their favorite foods are rice and fish.',1,'A Friend',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1436/school_seal/jPZniU3YwqpERvpn0gNg9A1RjQ8W7YxKzv3zV0F4.jpeg'),
