	(325,'Anindya',1,0,NULL,'Dhaka, Dhaka',NULL,19,'This is the exact reason why I am applying for YES. It would provide me the stage where I can master my volunteering skills, and help the community. Particularly, I do support climate change, and have also taken initiatives to counter it through my small actions. Hopefully, I can continue my work regarding the issue with the Americans as well. \r\nYES has come up with this opportunity. I believe, if possible, I will utilize my opportunity if I am bestowed with one. Frankly speaking, till now I have not got a better chance than this, and I am ready to prove myself, for my country, in the American soil. Besides, as I said, I would love to help elders lead their lives.',NULL,'90, Kalabagan 2nd Lane',NULL,1445,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1445/certification/CtPVqx4AvEFgijr3iUei345WUyyf77o4alXsN35o.jpeg','Bangladesh','11',10,9,'+8801976654251','87','2001-12-31','royanindya2016@gmail.com',NULL,'1','1','1','+8801755654251','pijuskantibala@gmail.com','Pijus Kanti Bala',NULL,NULL,'Banker',NULL,'1',NULL,'im_the_walrus69','Roy',NULL,'+8801911400214','anamickabhowmick10@gmail.com','Anamicka Bhowmick',NULL,NULL,'Teacher',94,93,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1445/student_photo/c8Rn8OfIttf0NMcfvQuJn81K0ZmwwiQpcPGG7aqO.jpeg',NULL,'1205','1',NULL,'House#31/A, Road#8, Dhanmondi, Dhaka','European Standard School','2019-11-27 06:43:20','+8801713036442','male',NULL,'Kalabagan','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1445/marksheet_previous/W6Lr7g4C4fQ2WX1Lr7arTmkaUz4AufLkcDb1Ionv.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1445/marksheet_previous_two/6Z4Albuh1IbXj8KmbJYn8aCkbEQYpNzbGn1lQIBE.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1445/marksheet_current/dJUXYOvKq7ELQGiAsjhJ5olpC3O07cKJyipqEqY7.jp