am',4203,'Chawkbazar','Monwar Jahan Begum','+88031656143',NULL,1,NULL,1,NULL,'I want to apply for the yes program because I want study in Abroads. And I hear that U.S.A is one of the best country for abroads studies. Yes program can give me the best opportunity to get full-filles my dreams to studies in U.SA. I feel curious when I hear about U.S.A\'s cultures, education systems, peoples, histories etc from my \" Access teacher\'s. I think \"Yes- program\" can help e to clear my curiosity . I really want to past of the \" Yes- program Journey. I will be much great full to U.S.A embassy.','Our\'s country is culture one. In our country there are many culture and festival, like pohela Boishak,pita festival, hospitality. In regional festival like Edi-UL-Azhar, Edi-ul-Fithar, puja etc. If I ever have the opportunity to share my culture with My American family. I will be fell blessedness. I will cook our culture cuisine for my American family I will share my culture festivals with the. I will share ours cloth culture like \" Sub caste\'s\" dressing, ornaments, etc with my host family.',1,'iEARN-BD Website',NULL,2,'2019-11-21','2019-11-21',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1476/school_seal/rHfCdYVw5ul7UecFXiI87xQ8yIgB3QMBrfjN73Ea.jpeg'),
	(329,'Orthy',2,0,4,'Dinajpur, Rangpur',NULL,19,'Being in Yes program I will try to learn how to take part in community services and I will apply these skills to develop my Bangladeshi society. I havent got chance to engage myself in such community services. But once, in 2018, I went to a nearby old-age home where I had spent some times with some aged persons who are separated from their own family. I had donated some little amounts so they can have something they want.\r\nBut in future, I would like to form a training institute for all those middle aged women who have to travel on local buses or by walking to earn living for their families. This institute will be free of cost. This struck on my head when in the daily news I hear those middle aged women being victims of different types of harassment, including sexual harassment. In my institute I want to provide classes on self-prevention skills including martial arts. Though I am not trained to run this institute and provide this classes, but I will learn this when I will get chan',NULL,'Chawliapatty',NULL,1494,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1494/certification/iF4VSRi9IyzpDmnK4vHCnrO0jAtINswS4kNlzCqX.jpeg','Bangladesh','10',9,8,'+8801556319041','94','2004-10-04','orthysiscdjan2020@gmail.com',NULL,'1','1','1','+8801773298865','itibrahim0@gmail.com','Shah Ferdous Ibrahim',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Toor',NULL,'+8801714803474','khanpur1973@gmail.com','Mst Fowzia Begum',NULL,NULL,'Teacher',94,93,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1494/student_photo/vkHW3Gd1sz5rBvHDxcWjCSxHfQ7lxDgOR0dLBhoU.jpeg',NULL,'5200','1',NULL,'Mission Road','Scholars International School & College','2019-11-27 06:43:20','+8801788191778','female',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1494/marksheet_previous/B732olF1sPDatCUzeQCiUmfySlTXjWmbWVUDpIZi.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1494/marksheet_previous_two/pEFSTL2B7dpuhfWDnhRZZde7Ljn9c7kSn4b5l5tq.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1494/marksheet_current/BAJ4dzd6tj848lAUYVambgYM6JWCPdRsLBWFgqS6.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:41:58',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dinajpur',2,'5501125966',360000,2,'2801130283',360000,'Dinajpur, Rangpur',5200,'Kotwali','Md.Sadekul Kabir','+8801920900800',NULL,1,NULL,1,NULL,'I believe that YES program is the best way through which I can learn about the American culture and society. It is also the best opportunity for me to share my thoughts with some people with different upbringing. America is one of the most advanced and developed countries. I will learn a lot of advanced skills, education and educate myself with different activities, which later, after coming back to Bangladesh I will share with my Bangladeshi society. This will be my first step and right way to develop my inner plans to discover the world.','Language is an exceptional way through which one can interact with different cultures. Through direct access to Bengali language my American family can have an interaction with my culture. I will try to teach them some significant and valuable Bengali words that will be the most effective means of knowing my culture.\r\nBangladesh is the only country which has struggled through a long none months of liberation war for achieving Bengali as their mother tongue. Our language is our pride. Thats why I would like to share my language, Bengali, with my American family.',1,'My High School/Teacher',NULL,2,'2019-11-25','2019-11-22',1,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/239/file/gxyQhmHjlznTcrZGyrE7LAQQmht95EzBPJoJriiI.pdf','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1494/school_seal/0ismBOW87zTSychk1E38kyPvvnOmVK13XNymBTF9.jpeg'),
