	(337,'Rafiqua Anjum',2,0,NULL,'Chattogram, Chattogram',NULL,19,'It is without a doubt that community service is an essential undertaking in every community.Usually, volunteers get to work with different people who might require a helping hand such as children,the homeless and people recovering from various forms of addiction. In the course of my service work participation, I developed critical life skills that will go a long way in helping me with my career. I believe that through helping others,one plants an ever growing tree in their heart that never dies.',NULL,'kawsar building(4th floor),faridapara',NULL,1523,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1523/certification/Yzg7k2dj7gJVFjDHzMHyGvk55PhwghHuioMOqi3E.jpeg','Bangladesh','10',9,8,'01819392985,01876097705','80','2004-05-08','khawjaenterprise06@gmail.com',NULL,'1','1','1','01819392985','shabbiraff@gmail.com','Professor Shabbir Ahmad',NULL,NULL,'professor',NULL,'1',NULL,NULL,'Reshma',NULL,'01876097705',NULL,'Imteaj Begum',NULL,NULL,'House Wife',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1523/student_photo/QcIg4ZY0WcyHmGHiHhvpXtph3Jb00qlAl2FtStDD.jpeg',NULL,'4212','1',NULL,'Road#2,Block A,chandgaon R/A,ctg','Darul Irfan Academy','2019-11-27 06:43:20','031670799','female',NULL,'Chandgaon','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1523/marksheet_previous/aHZsjuoFaIYps1sc0K0nWDOK4EJnJ1dBTCWTqtfs.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1523/marksheet_previous_two/NKPqi9pwyWzfcEHZSwHLLexvGO1hfMgfbW4gqSdZ.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1523/marksheet_current/QUJGRUON6XiLSp9KSidScD4G0O2fkJIYyxq2bkdt.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 20:53:54',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'chattogram',2,'151829181337',30000,2,'1518291813368',-1,'Chattogram, Chattogram',4212,'Chandgaon','Kafait Ullah','01814394489',NULL,1,NULL,1,NULL,'American Universities are widely known for the quality of their teaching and research.The United states is the number one and largest destination for international students seeking higher education overseas.The education system in USA is the most versatile and flexible higher education system for international students in the world.\r\nI can teach the people of my country American culture and education.The culture of the United States Of America is primarily of western origin,but is influenced by a multicultural ethos so i can teach the people of my country about American culture and education system.','Why not?\r\nThe Culture and Customs of Bangladesh\r\nThe Culture of Bangladesh is an amalgamation of the cultures of the several social groups living in the country.\r\nThe Culture and Customs of Bangladesh Vibrant chimes handmade in Bangladesh.\r\nThe people of Bangladesh`s way of life make up the culture of Bangladesh. The country has a diverse culture that has evolved over time with influences from diverse social groups. Bangladesh\'s primary religions, Islam, Buddhism and Hinduism, have played a critical role in influencing the country\'s culture. Development of the Bengali culture proliferated in the 19th century and part of the 20th century during the Bengal Renaissance, with renowned Bengali writers,scientists, filmmakers, musicians,artists and researchers playing a critical role. This culture manifests in the nation\'s dance,music, literature, architecture, and even clothing. I want to make a positive change to my community.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1523/school_seal/eUlKGNYUhIbiHP1bzbn8tzAvVvoIRU2VJGGdNz7d.jpeg'),
