	(339,'Md. Muhit',2,0,NULL,'Rajshahi, Rajshahi',NULL,19,'Social service is very important part of a human\'s life. I took part in a volunteer service for the flood victims organized by \"Bangladesh Red Crescent Society\" in 2017 . It was a new experience for me. I was very much shocked for the food \r\nless, house less and sick people. Water was every where but there was not a single drop to drink. How a people helpless in the critical moment of nature. Many people came to help them by food or water, but there was none to give them the actual treatment they needed. Many child died in want of treatment. I had nothing to do for them. Seeing this situation, I intend to become a doctor. If Almighty blesses me, I would try my best to fulfill my dream and serve the people in their helpless period.',NULL,'55/2, Hatemkhan Shahajipara',NULL,1526,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1526/certification/UN1N8TH4ydya00vbrAIUd7uY6cvNJziJz59qojQ2.jpeg','Bangladesh','10',9,8,'+8801716535879','74','2004-12-14','habiburhpr@gmail.com',NULL,'1','1','1','+8801716535879','habiburhpr@gmail.com','Md. Habibur Rahaman',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Mustakim',NULL,'+8801790424666','habiburhpra@gmail.com','Mst. Shamima Akter',NULL,NULL,'Teacher',73,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1526/student_photo/bfBvFKTOfIzWk7TtH3yQ4mHNB9HLHtNHKAcbR8dA.jpeg',NULL,'6000','2','New york','Monichattar,','Rajshahi Collegiate School','2019-11-27 06:43:20','+880721-776347','male',NULL,'Boalia','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1526/marksheet_previous/1Ys3G5sLG3yJ5Dh2T6VWTjpr9xegwh5wEPfuX2EV.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1526/marksheet_previous_two/CJdFmMvnY2KDIe4Gtf7kIwyXJ5pEHB3BNFU3U8s9.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1526/marksheet_curre