t the same time with the help of YES i would get the chance to know about their culture,lifestyle and education system.','Being a Bengali, I am very proud of my own culture there are different aspects of my culture, which i would love to share. We are the only nation in the world to sacrifice our lives for our mother language \"Bangla\". I would love to let the american know about my language. We have our own distinct clothes such as: Saree and Lungi which i would be very happy to share. Last but not the least Bangladesh is famous for different food such as: Rice,Hilsha and different cakes.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1537/school_seal/aIbAb43bP42J1MIZvdTXwmgvCziBdrLeSwxDztaM.jpeg'),
