	(342,'Mohammad',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I would totally like to acknowledge the fact to everyone that there are a lot of people out there who die at the border or give a lot of time for the country.I want them to understand and how valuable they are for the country in several ways. I would want to make a community that would only look after this people at the border and keep a proper connection between them and the main sectors of the country and definitely their family.This community will also look forward in making sure that the military families are taken good care of and daily update of the soldiers at the border come frequently.In this way people in the country will get to know about this people and understand their importance.Also the people will understand how much effort they give for the country staying away from the family.This would result in the army knowing their importance and being more encouraged and I would just love to believe that I would be the reason for it.',NULL,'33/C Popular Garden, Milkvita Road, Mirpur-7, Apt:A2/D2',NULL,1540,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1540/certification/S6nPOIItrchK3lLPtGoeDHTRHNmI6acZHqAIAfvT.jpeg','Bangladeshi','9',8,7,'+8801841046791','85','2004-07-11','wasimahir9022@gmail.com','n/a','1','1','1','+8801713046791','arif@mediasoft-bd.net','Mohammad Arifuzzaman',NULL,NULL,'Private Service',NULL,'1',NULL,'n/a','Wasiuzzaman',NULL,'+8801713144259','rebeccasultana600@hotmail.com','Rebecca Sultana',NULL,NULL,'Private Service',93,86,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1540/student_photo/b8IZ2HptGhg5UrYN5KqAmKmDAFrYRN4auEYi3duu.jpeg',NULL,'1216','1',NULL,'8/7, Pallabi, Section-12, Mirpur','Juvenile English Medium School','2019-11-27 06:43:20','+8801819285002','male',NULL,'Mirpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1540/marksheet_previous/8NLg4WYcUTFlSPYwi1oBhqR3MJ8LW9QRAmDFyKuz.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1540/marksheet_previous_two/Bg9MitcdaTURWlSdKHtZ5KoI2IzT2ztnraWqrVrN.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1540/marksheet_current/U3RbF0Y8Kj0jydoEeF1Mves4zY1MHELbZ9fY5V7p.jpeg','n/a',1,NULL,NULL,NULL,NULL,'2019-11-29 21:00:07',NULL,1,1,NULL,NULL,'BT0300145','2023-04-08','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1540/student_passport/EZ1odFpr4FxPeclBAQy27e39e3lOt1APzI28PHxN.jpeg','Dhaka',2,'5992963792',1680000,2,'5992964824',600000,'Dhaka, Dhaka',1216,'Pallabi','Mini Musharrat Sayeed','+8801711635906',NULL,2,'India for tourism',1,NULL,'At the very beginning it will definitely be my immense gratitude to have the opportunity to visit to United States Of America.It has been a life long dream of mine to be a part of something like the YES and now I finally have the chance to fulfil it. Secondly I would love to learn the culture of a different country that even of a developed and a non Asian country. Also a dream has always been to have foreign friends and get to know foreign people.I am also a person who just wants to learn new and interesting things which includes representing Bangladesh at YES as an important part.YES will give me the opportunity to fulfill some of my life\'s most awaited wishes and dreams and obviously that is why I would like to apply for the YES program.','Starting with the very first thing I would want my American family to know about our culture is definitely our mother language because that is what makes us different from other countries as Bangladesh is the only country in the world who fought for their language and everyone should know about it specially my foreign family.Secondly I would like to give them a basic knowledge and idea about our amazing clothing style and spicy cuisine.The food of Bangladesh is really unique from all the other countries and as to be exact all type of cuisine gives a feeling of home made food and about our clothing, it is just what makes us who we are. Starting from clothing which includes saree to cuisine that includes different combination of many different foods I would want my foreign family to know all in all.Then comes the festivals.There is almost no festival that is not celebrated here.Starting from Eid new year to puja everything is celebrated her with full gratitude.This is what I would share.',1,'Facebook',NULL,2,'2019-11-22','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1540/school_seal/RLSlZHW3uYG8PjlWQTK9V0ydY0H3bwFAmja0cQ3f.jpeg'),
	(343,'Tahia Asmi',1,0,2,'Dinajpur, Rangpur',NULL,19,'I am currently involved in volunteer works with my school.For example,I was among the head of volunteering group in my school\'s inauguration program,prize giving ceremony,sports,annual meetings etc.As a part of my volunteering roles,I was involved previously in charity for poor slum dwellers.In collaboration with one of my elder sister from the school(Isheka Agarwal who participated in K-L Yes program for the academic year 2017-2018).We distributed clothes to the poor people.I was involved in another charity, where we gave clothes and some fooda to the aged care facilities.',NULL,'Eidgah Residential Area',NULL,1542,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1542/certification/csyNg54HYUCLP4H5ZxSQqWY8vu9wNIv4uLe6VMzI.jpeg','Bangladesh','10',9,8,'+8801919601814','94','2002-11-11','chowdhurytahiaasmi@gmail.com',NULL,'1','1','1','+8801919601814','chowdhurykamrulhasan0@gmail.com','Quamrul Hasan Chowdhury',NULL,NULL,'Business man',NULL,'1',NULL,NULL,'Chowdhury',NULL,'+8801919676387','mahfuzahasan4444@gmail.com','Mahfuza Hasan Chowdhury',NULL,NULL,'Unemployed',91,92,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1542/student_photo/ReG43qJbg25XDW8EM1414MejZAWcbpBk2MGYdJlb.jpeg',NULL,'5200','2','Atlanta,Georgia','Mission Road,Dinajpur','Scholars International School and College','2019-11-27 06:43:20','(0531)51860 or +8801788191778','female',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1542/marksheet_previous/70VXp01ISF8ZB12YI9BTJcy8qZE5TlXKLSqA25wz.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1542/marksheet_previous_two/XaAayTMbdcC6FrX4tN8e1Eh9Y6VlyXXcu4HOlMqn.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1542/marksheet_current/hVaj6U9etxYIbKlr5UmbMULFKwFrsX2HEHNtVDMl.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:00:33',NULL,1,1,NULL,NULL,NULL,'2023-07-08',NULL,'Dinajpur',2,'7753042345',300000,2,'9551410997',-1,'Dinajpur, Rangpur',5200,'Kotwali','Md.Sadekul Kabir','+8801788191778 or +8801920900800',NULL,2,'India for holiday',1,NULL,'The kennedy-Lugar Youth Exchange and study(YES)program offers a unique platform to learn about USA culture and history.It also enables exchange students to share their own cultural diversiry and stories to the U.S citizens.The mutual benefits and exchange of ideas that occur during the placements,offer fresh perspective on common human journeys and narrartives.To gain access to thus unique exchange of ideas was the main catalyst that prompted me to apply for this program.Among other reasons,I wish to builf a foundation for my future endeavours,while making lifelong friends.The YES program will help me immensely to build my pathway towards a prosperous future,and I wish to utilise this opportunity to help foster good relationship between USA and Bangladesh.Addiontionally ,I am hopeful to acquire good leadership skills to help global community,in particular Bangladesh and USA,to tackle some of the most important issues faced by our society.','I wish to share the history of my country embedded deeply in the identity of the Bengali Language.Additionally,I am willing to offer learnings around the different religion and indigenous stories that forged the national identity of Bangladesh.I will also try my best to share the traditional cuisine and clothing style unique to the country.Following are some of the ways I would like to initiate these cultural activites with USA:I wish to bring some English translation of books of our Bengali to read and share the literary roots of Bangladesh.I wish to bring my USA friends to Bengali festivals such as Bengali New Year.I wish to offer my understanding of different religious heritage.If permitted I would like to bring my USA friends and family to attend the month long Book fair that occurs each year in February l and mark the celebration of UN declared International Mother Language on 21st February.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-22',1,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/239/file/fZ9g1zUYQajG2siiRTA0cgflvybo3Nz1qoiG96F9.pdf','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1542/school_seal/Mz1qSP5FRdcE0NMIRZdAgvYp1cicmcvgdMhi8r72.jpeg'),
	(344,'Zulhara Myne',2,0,NULL,'Dinajpur, Rangpur',NULL,19,'Speaking of community service, I am not one of those widely known community workers in my town. What I did was I volunteered for my school several times when my school needed me. The last community service I was part of was about a year ago. I remember we gathered food and clothes for the senior citizens who were abandoned by their families. What I remember most were the tears of joy in those old faces. I also loved that those senior citizens were no relative to us but they received us as if we were there children.\r\nAnother memory of mine that I remember so vividly was when I was a part of a little project run by Isheka  Agarwal. She was one of my senior sisters from my school and also a YES Alumni member. In that project we gathered and bought clothes for the poor living in the slums of Dinajpur. At that time I was probably reading in grade 7.\r\nI do like to do community service because it gives me many unforgettable memories that inspire me to be more socially active.',NULL,'Churipatty',NULL,1549,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1549/certification/fim5DWEL9I0nOOohZPaG2aCX8sDs99YQaLamUCFS.jpeg','Bangladesh','10',9,8,'+8801748227244','93','2004-01-18','zulharamynemannow@gmail.com',NULL,'1','1','1','+8801712711563','mdmoslem1363@gmail.com','Md Moslem Uddin',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Mannow',NULL,'01748227244',NULL,'Jennurain Paru',NULL,NULL,'Teacher',94,93,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1549/student_photo/muoo9DqPHoLfjTOAHj8TpKGKIfdN7ItMwnCtUJJY.jpeg',NULL,'5200','1',NULL,'Mission Road','Scholars International School & College','2019-11-27 06:43:20','01788191778','male',NULL,'kotowali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1549/marksheet_previous/DjxNtY97gVggS62rLnhGo6u19Tcj7EDzkwrQfTvd.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1549/marksheet_previous_two/iL5byWAezwjH0jBmmEhDkb6B3QaHqXqTVefdnFSR.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1549/marksheet_current/OlMyWt9Ldi8LKLuQixL1NlMJurSN1oWzsHPPkjuk.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-30 17:08:59',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dinajpur',2,'2726405144573',456000,2,'2726405144574',139200,'Dinajpur, Rangpur',5200,'Kotwali','Md.Sadekul Kabir','+8801920900800',NULL,2,'India for winter vacation',1,NULL,'I do am a fond of the phrase The American Dream. Being in America for approximately 1 year has been the true dream for me. I also like the American culture such as Thanksgiving, Halloween and Christmas. Growing up in Bangladesh I never got the experience of American culture. Yeah, it can be said that being an enthusiast I am applying for the YES program. I dont know what the Americans think about us the Bangladeshis. I want them to know us by the process of us knowing them. Having a new family where my family members are Americans would really give me the opportunity of experiencing the life of an American teen. I also look forward in sharing the skills with my community that I will be learning. I want to be a part of this program because I want to represent my country.','Firstly I would try to share about our variation and colors in clothing in our festivals. I think sharing about our language will be interesting to the Americans as we are the only race that fought for its mother tongue for 9 month. I will also likely be sharing about our national holidays, festivals and rituals. \r\nSharing the story behind our liberation war will be worth it. I do like Pahela Baishak, the Bengali New Year. So I will try to dress up as a Bengali like wearing Panjabi,Dhuti and Fotua in various Bengali occasions. I will also ask my host family to dress up as Bengalis; I think it will be fun.\r\nI really like the spices and variation and flavors of Bangladeshi food. So I will try to prepare Bangladeshi food for getting along with my host family. Bangladesh has quantities of small colonies like Garo,Chakma, etc.',1,'My High School/Teacher',NULL,2,'2019-11-22','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1549/school_seal/9zihBeYzRtO5QhpJ77RvZbzOcRL2SHecRHsOjnkC.jpeg'),
	(345,'RAIYAN',2,0,NULL,'Jamalpur, Mymensingh',NULL,19,'I did a volunteer work in our community that was titled as \'Go JFCL Green\'. It was basically a volunteer program to remove all the plastic and paper wastage from our community and to ensure suitable dumping system in suitable places.',NULL,'House No. B-1/G, Jamuna Fertilizer Housing Colony, Tarakandi, Jamalpur-2055.',NULL,1552,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1552/certification/fwXitNbDJrIhtoJj2m7mByK7zhbflQSgRSyFEhLu.jpeg','Bangladesh','10',9,8,'+8801716671569','86','2005-07-18','alomgirul@gmail.com',NULL,'1','1','1','+8801716671569','alomgirul@gmail.com','MD. ALOMGIRUL ISLAM',NULL,NULL,'Service',NULL,'1',NULL,NULL,'ISLAM',NULL,'+8801735972111','lutfa.hasnayen@gmail.com','LUTFA HASNAYEN',NULL,NULL,'Teacher',85,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1552/student_photo/3wH7SVLJQPhO37Le6SYFinUpLZezhsURuBYSiRC1.jpeg',NULL,'2055','1',NULL,'Tarakandi, Sarishabari, Jamalpur-2055','Jamuna Sar Karkhana School and College','2019-11-27 06:43:20','+88075163884-5 Ext.170 / 172','male',NULL,'Sarishabari','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1552/marksheet_previous/9lafVUMWoH2BZlxxrY9ahxcYwek4dKfsFDz9ZVcW.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1552/marksheet_previous_two/fgnQsjnhsC2hp7NGNkF7kuNuUCfdnxAzS25p4KqR.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1552/marksheet_current/A4RrAzMiUGUZoXZYytBeb0nPSechEVyOC50nvDY1.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:04:04',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Kaligonj, Ullapara, Sirajgonj.',2,'19633918573026457',900000,2,'3918573024910',400000,'Jamalpur, Mymensingh',2055,'Sarishabari','Md.Mahbubul Alam / Nasir Mahmood','01710895760 / 01717699180',NULL,1,NULL,1,NULL,'Understanding the educational system of USA, to know the educational environment of the students there and gather idea of how suitable is USA for the international students, to know the culture of USA and the people of there.','I wish to share with my American Family the religious views,the cuisine and clothings which are the aspects of our resourceful culture.\r\n\r\nI will try to make them understand the religious thoughts and a clear view of my religion Islam and how we all live in peace with others of different religions. I will show some recipe that will be quite interesting to them. I will try to make them understand that we the  people of Bangladesh how fond of different kinds of food. I will share the clothing of our culture by wearing and offering them too.',1,'Newspaper',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1552/school_seal/vKeeez2p8B9tE04T6I729CuypGsQ4OqGcvdvFjku.jpeg'),
	(346,'Md. Rifatur',2,0,NULL,'Khulna, Khulna',NULL,19,'I have a little idea about community services. In past time, I would have an idea about cleanness of school campus and blood donating program. It will be more appropriate for me to involve community service like awareness of road accidents, Dengue Preventive work, AIDS, Drugging if I get a chance for this program.',NULL,'Raligate Housing Complex, Islambag Road ,Raligate, Daulatpur, Khulna',NULL,1555,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1555/certification/HKa6UQp18AFOcgudnRxwNaIuWVXi2wsER5O48zTN.jpeg','Bangladesh','10',9,8,'+8801717456135','73','2005-06-20','biplob2bd@yahoo.com','https://www.facebook.com/rifat.rahman.56211','1','1','1','+8801711006385','biplob2bd@gmail.com','Biplob Rahman',NULL,NULL,'Govt service (Teaching)',NULL,'1',NULL,'https://www.instagram.com/rifat_rahman_0612/','Rahman',NULL,'+8801751909293','shiuli2bd@yahoo.com','Shiuli Jahan',NULL,NULL,'Teaching (Lecturer)',74,78,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1555/student_photo/tyHr5c6WGD9ljJSie9UABScyzdGJoUSLdJ289rcf.jpeg',NULL,'9202','1',NULL,'Sailor\'s colony, Goalkhai, khulna','NAVY ANCHORAGE SCHOOL AND COLLEGE KHULNA (NASCK)','2019-11-27 06:43:20','01309135249','male',NULL,'Daulatpur','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1555/marksheet_previous/KHq02F1yl1Tdg5vaEMLH5fCMSRvF8NsOG5J4nCQS.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1555/marksheet_previous_two/KdfFdutofCVE84Cicuj9HXnJhHGVNomYSQrkmNRO.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1555/marksheet_current/dFu2JNcB9HGeaxnxEGehWZonqIXcj2lsoYqHMiD2.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:05:13',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'khulna',2,'1914766207',1000000,2,'6422567377',300000,'Khulna, Khulna',9000,'khalishpur','Md. Ruhul Amin Sarker','01769784196',NULL,1,NULL,1,NULL,'To share my culture, heritage, cast and values with the students/learners American School. \r\nTo gather knowledge about American society, culture, values, tradition, etc.\r\nTo improve my culture and attitude towards others language people, religion for creating a new world to us.','I would like to share my language movement, International Mother Language day and the sacrifice for preventing our language from Urdu language. I would also like to our most industrial Product i. e. Clothing Garments. The garments industry product exporting, design of our clothing, different type of wearing cloths in our country. The different ethnic group in our country like indigenous People in Hill track areas will be discussed to them. Our national in-heritage like Noboborsho, Puja, Eid also be shared and practice among them.',1,'A YES Alumni Member',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1555/school_seal/TEhwboxDgQPcbObke629cx843tDb5G3XdAiq39r2.jpeg'),
	(347,'sadman sakib',2,0,NULL,'Sylhet, Sylhet',NULL,19,'I have been taught since I was very young to donate and give back to the community. I come from a humble and generous family who loves to give back. I have visited orphanages with my parents and gave them blankets for the winter and also gave them money to buy food. My school always have community service programs like buying books for poor students or growing trees for better environment which I have volunteered many times.Also I Have Been a Member Of Red Crescent Organization Since I was Admitted In Class Six Dated on 01 January 2015 So I have Participated For Numerous Charitable Activities On Behalf Of The  Organization.',NULL,'House: 15, Road:22, Block:D, Shahjalal Upashahar, Sylhet, Bangladesh.',NULL,1556,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1556/certification/2XtskOikIivP7UR34VZPkx6JbCuesmRI7YxTZI22.jpeg','Bangladeshi','10',9,8,'01712524176','70','2003-10-24','sadsakib2003@gmail.com',NULL,'1','1','1','01712524176','grobbani91@gmail.com','Mohammod Golam Robbani',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'sakib',NULL,'01723699835','grobbani91@gmail.com','Doli Begum',NULL,NULL,'Housemaker',60,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1556/student_photo/5rwbEXpphvDqXdnSbtpSqhqYyzFmb8E9AY6HT2ie.jpeg',NULL,'3100','2','New York','Mirabazar','Shahjalal Jamia Islamia School and College','2019-11-27 06:43:20','0821-716841','male',NULL,'Sylhet','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1556/marksheet_previous/QqAPLRJ7OToGOKrIvtn0KKtXxFDTmrrAlxOSXN8o.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1556/marksheet_previous_two/0ntoF40KggRmwiv7ZnEsQDLADmGU7mxZbPFk9auu.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1556/marksheet_current/KeORLHtwbRg0u2Zu6twiAInl8bBc4dtGL5AXNaD8.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:06:43',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Sunamganj.',2,'3750486452',720000,2,'6000506136',200000,'Sylhet, Sylhet',3100,'Sylhet Sadar','Mohammod Golam Robbani','01309130462',NULL,1,NULL,1,NULL,'I want to apply to Yes Program because I want to experience different cultures in the United States and also gain different perspectives  of the way people live their life in a developed country. I want to learn and experience the rich culture in order to broaden my knowledge.','There are many aspects of Bangladeshi culture I would like to share with my American family and some of them are my language and cuisine. There are many dialects within Bangladesh that I know and would like to share with my American family. For example I speak sylheti which is spoken only in north eastern of Bangladesh. There are many delicious cuisines that I learned from my mother that I would like to share with my American family .',1,'Newspaper',NULL,2,'2019-11-22','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1556/school_seal/1PEZ0mqY25sZYXCmhTR7KQEwAXc0DbzMF5fhRWeW.jpeg'),
	(348,'Mansib',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I don\'t have an experience of attending in a community service event before. If I get a chance I am ready to participate in it. If I get a chance I would like to clean all the roads of Bangladesh and make it pollution free.',NULL,'House28,Road18,Sector14,Uttara,Dhaka',NULL,1561,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1561/certification/2GZxqIwuskrwR5mJ72vlHxMKWmMCZTtU8KrI3C3p.jpeg','Bangladesh','10',9,8,'01626078939','82','2003-08-05','mushfq7@gmail.com',NULL,'1','1','1','01671100019','moksud66@gmail.com','Moksudur Rahman',NULL,NULL,'Private Service Holder',NULL,'1',NULL,NULL,'Rahman',NULL,'01670100019','saila77amira@gmail.com','Saila Yesmin',NULL,NULL,'Unemployed',87,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1561/student_photo/vwYUy1nA9PNNAltkuQVStmqxM8Ts1nXstsjjS6f0.jpeg',NULL,'1230','2','New Jersey','Gausal Azam Avenue,Sector14,Uttara,Dhaka.','Mastermind English Medium School','2019-11-27 06:43:20','01793633097','male',NULL,'Uttara west','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1561/marksheet_previous/7W51J5cBO1MsU2cnCKrazaJIE3qi1D4Oeiy10oVA.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1561/marksheet_previous_two/IgGbHr03tGsyDJffs8YA0V4fJuQh4f4PmdYAFXoZ.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1561/marksheet_current/Tp39QRku2KoZXXjj1QbucWVXjmn3ZkDWAi1CSKYM.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:08:50',NULL,1,1,NULL,NULL,'BP0484029','2022-06-14','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1561/student_passport/3U6CtgitfrGlFaOz6Iw4thSVpFDa7AUgx8AELkmm.jpeg','Dhaka',2,'7304508414',1320000,2,'2693717215249',-1,'Dhaka, Dhaka',1230,'Uttara west','Fakhruddin Ahmed','028 933712',NULL,1,NULL,1,NULL,'I am always enthusiastic for programs like these. Two years earlier a YES program event was held at my school but back then I was not eligible for this. Now when I got to know from my brother that the program application is open now straight away I applied for the program. My family have full support they encourage me to go to a new country and have new experiences. Looking forward to this program !','I believe our culture is still not recognized by a lot of Americans most of them have wrong perception. Media is to be blamed as negative news are displayed more. My aim will be to share with my host family about my beautiful country of how rich in nature this country is, of course I will try to teach them my language, share my cuisine, clothing culture and religion.',1,'My Family Member',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1561/school_seal/0ob7m2eXCpuEp3olE6DHs8ZSJ7AcazdHWgPkRcDp.jpeg'),
