ultural program, History, Bengali language, Sports Cricket & Football. I would like to meet with the new people to know about their style life/new history/their tradition etc.',1,'U.S. Embassy Website/The American Center Dhaka/EMK Center',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1574/school_seal/zd7NyOHHZQv06JdONtl9QckJHRPzycxODZD3RetN.jpeg'),
	(351,'SHAMS BIN SHOHID',2,0,NULL,'Meherpur, Khulna',NULL,19,'Community service or social service is very important. But unfortunately, I did not get any opportunity in this sector. But if I get any opportunity in future , I will use it properly. I am very encouraged to setup a club or something like that in our society. The club will work  for bringing about a change in our society . I will try to literate  the illiterate people of our society . For this program ,I will take suggestion from the elders of our society. The club will also work for reducing gender discrimination. Women are yet neglected in our society. I will try to make people understood of the contribution of women in our society. Thus  I will continue my social service.',NULL,'MONDOL PARA,WARD NO.06,MEHERPUR SADAR,MEHERPUR',NULL,1579,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1579/certification/CxJRennbhnLhTJVCYyLVK0PDmOe9wZ4i8QRwaTlZ.jpeg','BANGLADESH','9',8,7,'+8801948548054','90','2003-08-31','shamsbin121@gmail.com',NULL,'1','1','1','+8801749355754','shahidullahbadol1966@gmail.com','SHAHIDULLAH BADOL',NULL,NULL,'Business',NULL,'1',NULL,NULL,'SHAMS',NULL,'+8801948548054','khaledaakther191@gmail.com','MST. KHALEDA AKTHER',NULL,NULL,'Unemployed',89,92,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1579/student_photo/gBD0yuvFcPPXq9BKyOFzkbE3701CzdwXFwqgL6Le.jpeg',NULL,'7100','2','New Jersey','GOVT MAHILA COLLEGE ROAD ,WARD NO. 7,MEHERPUR SADAR,MEHERPUR','MEHERPUR GOVT HIGH SCHOOL','2019-11-27 06:43:20','+88079162327','male',NULL,'MEHERPUR SADAR','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1579/marksheet_previous/xw6fUus4z8fDKF6woWrNivzEcOmQvvCPppAlDcwg.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1579/marksheet_previous_two/7Or8bLQcUnyS4FGSBMnu5V9OzSApExRmEpa6ZNaw.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1579/marksheet_current/QoCeR3xPYxsrHxImwSX57tudFLhPa52RAmdDkN2L.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:13:07',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'MEHERPUR',2,'7794942834',180000,2,'4644960652',-1,'Meherpur, Khulna',7100,'MEHERPUR SADAR','SELINA AKHTER','+8801746581165',NULL,1,NULL,1,NULL,'I think YES program is a platform for a youth to pursue his career. I want to pursue my career in YES program. For this reason , I want to apply for the YES program.','Language is a very important aspect of Bangladeshi  culture. I wish to share this aspect with my American family our Shohid Dibash 21st February is observed as international mother language day  all over the world. To share our language with my American family, at first I will describe how our brave sons sacrificed their lives for the cause of our mother tongue. I think it will help me encourage them to know more about our language. Besides speaking in English, I will try my best to speak in Bangla with them. I will try to enable them to speak in Bangla in order to share this aspect . Thus  I will share this aspect with my American family.',1,'Newspaper',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1579/school_seal/IHDJtmnA605AahpZWkN5betgDVvxvMtzKCCGUTUG.jpeg'),
	(352,'Md. Irfan',1,0,NULL,'Bagerhat, Khulna',NULL,19,'I am a student. Every student should serve his nation. If I will get a chance to serve my society I will teach the illiterate at first. I will teach them about health, sanitation, nutrition etc.\r\nDuring natural calamities I will help the poor and the privileged people. I will also serve the sick with proper food, medicine, cloth and other necessary things.',NULL,'House No. 82; Street: VIP Road, Kharder; Post Office: 9300; Bagerhat Sadar',NULL,1583,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1583/certification/o4TYCCaV3zcPcV6om0Ra1QG2JubXCXCLzLXXfYOM.jpeg','Bangladesh','8',7,6,'+8801673629433','58','2005-08-09','irfanassadik0987@gmail.com','https://www.facebook.com/irfan.as.sadik.09','1','1','1','+8801673629433','idrisali34@gmail.com','Md Idris Ali',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'As Sadik',NULL,'+8801710124619',NULL,'Farzana Akter',NULL,NULL,'Employer',74,68,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1583/student_photo/fDIxUqyxAlctc0rzuE0xsDXxcDkQrcVE7NsLiIb7.jpeg',NULL,'9300','1',NULL,'Old Rupsa Bagerhat Road, Bagerhat, Bangladesh','Bagerhat Govt. Secondary School','2019-11-27 06:43:20','+88046862503','male',NULL,'BAGERHAT SADAR','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1583/marksheet_previous/uYjm6pDaGjY3jhM1DoiNS8Lmyi3kAJsZuAOLcYh0.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1583/marksheet_previous_two/WGuz1T5MduFtUEsjLjn3gAse4U6K8lpGIGaYw5Ly.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1583/marksheet_current/hblLf3jUChpDfXEiYGtFDEq1tQofPm2Pvrpvq5uw.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:14:06',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Bangladesh',2,'1484666241',250000,2,'8684706271',250000,'Bagerhat, Khulna',9300,'BAGERHAT SADAR','Tapan Kumar Biswas','+88046862503',NULL,1,NULL,1,NULL,'I want to know more about a developed country and America is definitely a developed country. My main attraction is the education system of the country. And it is my dream country. That is why I want to apply for the YES program.','Our Bangladeshi culture is very rich. The main attraction of our culture is its language.\r\nThe fourth language of the world is Bangla. And we are the only nation who sacrificed their life for their mother tongue. In 1952, the boys of this country gave their life to protect our mother tongue. I\'ll speak in Bangla and share my language to the American people and also I\'ll tell many of our historical stories to the American people so they can know about our language.',1,'Other','From an online newspaper.',2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1583/school_seal/mc9jAdcSmkrAs0cr9VjO6TsJyxKxxhZr7zQIsAKf.jpeg'),
	(353,'ATANDRILA',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I am a graduate of Building Bridges Through Leadership Training Junior (BBLTJ) of Bangladesh Youth Leadership Center (BYLC). As a part of it, I have participated in community service programs. I went to slums in group as a BYLC participant and actively participated and worked for the betterment of the lifestyle of the people of slums. We worked regarding their hygiene problems and also solved it. Considering my passion for it, I have been selected as the Campus Ambassador of BYLC for Viqarunnisa school for consecutively two years (2018 and 2019) and working to promote it. I have motivated 54 students in 2018 and 78 students in 2019 to participate BYLC programs to enhance their leadership skills.\r\nI am also the volunteer of UNYSAB. Each year we do different programs from UNYSAB regarding some of the problems of Bangladesh. We organised a program this year in which we collected fund and bought food, toys and clothes for the slum children in the month of Ramadan.',NULL,'FLAT-7/K, SHANTA DIGONTO, 3, 3/A, PARIBAG, SHAHBAG, DHAKA- 1000',NULL,1584,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1584/certification/6139fxqlNpZNaaexC2Zthob7ZJ0oJx6ry4qCZXM4.jpeg','BANGLADESH','8',7,6,'+8801819210870','74','2005-12-12','anamika.bhakta@gmail.com',NULL,'1','1','1','+8801714090951','dhiman_ns@yahoo.com','DHIMAN CHOWDHURY',NULL,NULL,'PHYSICIAN (PROFESSOR OF NEUROSURGERY, BSMMU)',NULL,'1',NULL,NULL,'CHOWDHURY',NULL,'+8801819210870','anamika.bhakta@robi.com.bd','ANAMIKA BHAKTA',NULL,NULL,'ENGINEER (VICE PRESIDENT OF ROBI AXIATA LTD.)',84,82,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1584/student_photo/6tLQfhUKy0rYYf207kyxAxgGjFL6Ob8xlJyaEqmX.jpeg',NULL,'1000','1',NULL,'1/A, New Baily Road, Dhaka- 1000, Ramna, Dhaka, Dhaka - 1000','Viqarunnisa noon school and college','2019-11-27 06:43:20','+8802-58310500','female',NULL,'SHAHBAG','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1584/marksheet_previous/FBpBiX8yYSSStXkqMsChnDSkLSlc3nc7pptf6HPw.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1584/marksheet_previous_two/cuxIUXzvjGS0QqLmVbNzK5Rpblwrjmh1urFpzDHk.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1584/marksheet_current/6ccmV5lMbfn8o12NVoQmE9BVEu48MqcjV64S7Sgp.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:14:33',NULL,1,1,NULL,NULL,'BM0692820','2021-12-02','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1584/student_passport/OLmEp4aInIEfYI3KcdywxVMyxJyJCHKCJRS0y0ga.jpeg','DHAKA',2,'1527403044226',2500000,2,'2699501939593',7800000,'Dhaka, Dhaka',1000,'Ramna','Professor Fougia','+8802-58310500',NULL,2,'India for travelling, Vietnam for travelling , Singapore for meeting relatives, Bangkok for travelling',1,NULL,'Through YES program, I believe that it will be a great opportunity for me to interact with people from diverse background and culture. Interacting and socializing is something I am very passionate about and I think I am also quite good at it. So, this is one of the main reason for which I would like to do the YES program. Also, through YES program I can get to make my own decisions and know my true potentials. I can also exercise my leadership qualities which will further improve my leadership skills. i will be able to get to know about different countrys culture. And, I also wish to experience living in a different country with different culture, environment, mindset and language.','I wish to let the American family know about our country\'s culture and clothing. Each country has it\'s own culture and clothing. So, I think the American community can know about us and also get an idea about our culture and clothing. People of diverse environment have their own mindset. And surely there is a whole lot of difference in the way of thinking in between the people of Bangladesh and America. I would definitely love to share my opinions and point of view regarding any discussion, letting them to know about the thinking of the people of our country. And also I would love to share the background of our language to the Americans.',1,'Facebook',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1584/school_seal/BzixxOtIrXtGB5lC4neNYIhvNtU0H2QMLqXc0XPA.jpeg'),
	(354,'Layba',1,0,2,'Dinajpur, Rangpur',NULL,19,'One year back, once I had organized a community service project with my friends, juniors, and my high school teachers. I had planned a meet and greet with the people of old age home. \r\nNowadays alot of people think that they need privacy and they think their parents are envading their privacy. So, they tend to abandon their parents at the old age home but they never think about their parents how they feel. So to give them some affection and reduce their lonliness I decided this meet and greet with them. There my school gave some donations some of my friends including me, gifted them some snacks and spend some time with them, we came to know about their woes and how they were sent at the old age home.',NULL,'Paharpu, Bahadurbaza, Dinajpur Main Post Office, Dinajpur Sadar,Dinajpur',NULL,1596,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1596/certification/IXjF9kv8j0C1yhJvmtUMo2gI9XeaQwcxGROrEBFq.jpeg','Bangladesh','10',9,8,'+8801314124343','86','2002-12-13','layba.azad008@gmail.com',NULL,'1','1','1','01711421593','raju.azad002@gmail.com','Md.Abul Kalam Azad',NULL,NULL,'Businessman',NULL,'1',NULL,'@layba.008','Azad',NULL,'01785262062','jasmeenazadjamee@gmail.com','Jasmeen Azad Jamee',NULL,NULL,'Unemployed',82,79,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1596/student_photo/jetS8r9K8oajgrJT99LIPMGCX6W48MKSLaXYCWGS.jpeg',NULL,'5200','1',NULL,'Mission Road','Scholars International School & College','2019-11-27 06:43:20','01788191778','female',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1596/marksheet_previous/h6LOArqxxdWmYxFoeVLWKlOpyfMIO0gZhjdXPPFX.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1596/marksheet_previous_two/GoH6hG19SadUW4clLM2mMRMFOzWfHcfcll3N4Cb2.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1596/marksheet_current/HTfEUncfIz0YCL8ndjGM4d2GLmDN8AolBFHm73HC.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:14:58',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dinajpur',2,'7752887989',1800000,2,'2352845412',-1,'Dinajpur, Rangpur',5200,'Kotwali','Md.Sadekul Kabir','01920900800',NULL,2,'Thailand For holiday',1,NULL,'I certainly belive that YES is the correct learning for me I think YES is the best way to relresent my country, Bangladesh and most importantly I am going to represent myself as the ambassador of Bangladesh which is a great hounor for me. \r\nI have never lived independently before. So, I YES will make an opportunity to gain an experience independently. Moreover I belive this independence will also help me to gain confidence and become more sensible.','Bangladesh is a country of cultral diversity because people of different religions live here so there is a diversity in language, cuisine, clothing, religions etc. Bangaldesh is known to be the only country in the world where people sacrifice their lives for their mother tongue, Bangladesh. Every year on 21st February we celebrate the language martyre\'s day. In 1999 United Nation recognize this day as international mother language day.\r\nIn the cuisine of Bangladesh we find a royal taste because of the contribution of different ancient civilaization. And we were ruled my many mughal emperores so our food habits was greatly affected by the Mughals.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-22',1,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/239/file/HNi2rupaRUj0lwEaGZN5UnZDSABM7kldQbMThgSa.pdf','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1596/school_seal/Rugra4RWfqLQQ6FfuduKGNXJ99IrVAWhpMQT9dmB.jpeg'),
	(355,'SK Rimon Hossain',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I possess a friendly character & am always eager to work for others. So, it\'s a pleasure for me to dedicate myself in community services. I think that community services. I think that community service is very crucial for a responsible student because he/she has some promises for the society & country. whenever I have an opportunity, I dedicate myself to community services. \r\nHere, it can be informed that I am an active member of the Green club of my college. Every week we launch the cleaning program throughout the campus. In addition, every month we take part in the cleaning program of our neighborhoods. I am also an active member of Social Welfare club of my College. During the winter seasons we distribute warm clothes among the poor people. Every week we get involved in controlling traffics of our neighborhoods. Thus I serve my community and society.',NULL,'House # 25, Road # 7, PC Culture Housing',NULL,1599,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1599/certification/DQXXWYZ5riOwH2hIAiscPD9r4ee83qR1uWpJ5Y4f.jpeg','Bangladesh','11',10,9,'+8801745571173','80','2003-12-13','rimonshehab@gmail.com','https://https://www.facebook.com/rimon.hossenshihab','1','1','1','+8801751015269','hmozaffar756@gmail.com','SK MOZAFFAR HOSSAIN',NULL,NULL,'Private Service',NULL,'1',NULL,'@rimon.hossenshihab','Shehab',NULL,'+8801726724679','mstshahanara723@gmail.com','Shahanara',NULL,NULL,'Unemployed',80,81,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1599/student_photo/f7bubvzRYhmBCGud2Q8PaVQ4l8VN3iph6LtyK8mf.jpeg',NULL,'1207','1',NULL,'Gaznbi Road, College Gate','Mohammadpur Model School & College','2019-11-27 06:43:20','+8802-9138649','male',NULL,'Adabor','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1599/marksheet_previous/mq1raOZiyVPTj9llaV5pCr1nZ6supE3xUjW3E4QL.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1599/marksheet_previous_two/32LNLkaPKVvoF2t37Ohi5YoaZWDWs5inPuSKvQYr.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1599/marksheet_current/xAl08SiCmrH62zY0r1NElpQHAgzCrFilQnUlPVol.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:16:09',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Satkhira',2,'8711779443743',150000,2,'8714779443744',-1,'Dhaka, Dhaka',1207,'Mohammadpur','Kazi Sharif Uddin','+8802-9138649',NULL,1,NULL,1,NULL,'I am a member of ethnic society of Bangladesh & obviously I represent a minority group. Though I belong to an ethnic society, I dream to do something that makes my ethnic clan proud & at the same time, I would like to glorify my country. \r\nI love to get involved in cultural and social activities of my ethnic group & of my society. I\'ve always desires to cherish the spirit of Chakma & Bengali culture and spread among tall the people around me. Here, I would like to mention that I am a sportsman & have already earned a number of successes. So, I think that YES program can give me a great horizon for sharing my cultural & sporting spirit with the American people. \r\nI am friendly and jolly like other boys of the ethnic groups of my country. Besides, can easily adjust with new people and situations. I also love to enjoy things with others and I believe that if I apply for the YES Program and get selected I can be a true a ambassador of my community and of Bangladesh.','My motherland Bangladesh is replete with various unique cultural aspects. My Own ethnic community has added a glorious addition to the Bangladeshi culture. We are blessed with very rich languages, delicious foods, special clothing and co-existence of various religious communities. As I love all the aspects of Bangladeshi culture, I can share all those aspects with the American family. Specially I would like to emphasize our languages, cuisine, fashion and religious & ethnic values.\r\nI am a boy from the mountainous areas of Bangladesh. Love to taste traditional Bengali & ethical foods, wear traditional Bengali & ethical dresses.I can share our lifestyles and fashions my American family. Again I can share our values which emphasis peace and harmony. In additional I would love to share the great history of our language movement & of my own ethnic language with the American family and of our great liberation war. I want to give them a message that Bangladeshi people are peace loving of all.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1599/school_seal/qPbhHlWQ2Q8WyhqxkfFJ902UDsuCLsYsV6M8sy6B.jpeg'),
	(356,'Nabid',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I have mentioned before that I love volunteering works. I am working with many organizations as a volunteer for community service/social welfare. Currently I am working with Bangladesh Scouts and WOSM for 8 years and have done many social works like cleaning our living area and school area, feeding poor children and helping them in their study, creating social awarness, helping traffic polices in their work, planted many trees etc. I also work with Volunteer of Bangladesh as a volunteer and BD Clean as volunteer and attended many community service programs and worked with them. I am also a volunteer of UNICEF. I have worked for Gender Equality and a program of UN named HEforSHE. I have created a group with my friends and we save money from our transportatio fare and tiffin money and bought foods and stationaries for the poor childrens in our area. I will continue these type of work wherever I will be in the future.',NULL,'Block:G,Road no:04,House no:14 (4th Floor),Banasree,Rampura,Dhaka-1219.',NULL,1602,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1602/certification/6k90ROofajXjihNDzPQcvfqIQ6Iu2bWt5CnYd0Wa.jpeg','Bangladesh','11',10,9,'+8801830450578','100','2002-12-31','shaan.nabid@gmail.com','https://www.facebook.com/shaan.nabid','1','1','1','+8801799231936','doctorbaten@gmail.com','Doc. Md. Abdul Baten',NULL,NULL,'Retired Government Officer(Doctor)',NULL,'1',NULL,NULL,'Ahmed Shaan',NULL,'+8801819107082','shaan.nabid3@gmail.com','Najnin Sultana',NULL,NULL,'Housewife',90,100,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1602/student_photo/7CW7czrhDJqzGtIlvx9FETU7inzQGCl0o3njqL7n.jpeg',NULL,'1219','2','New York','Shaheed Sharani, Dhaka 1206','Adamjee Cantonment College','2019-11-27 06:43:20','+8802-8872446','male',NULL,'Rampura','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1602/marksheet_previous/SMChDZPv8FyEp9n