	(360,'S.M MOHITUL ISLAM',2,0,NULL,'Dhaka, Dhaka',NULL,19,'Recently, a cyclone called Bulbul was hit in Bangladesh. it has been stroked Coastal areas of Bangladesh such as Satkhira, Patuakhali, Chandpur etc .There have been huge losses. My parents live in Chandpur.I rush to protect them and the people of the village. I give food  to the village people there and bring them to a safe distance.',NULL,'1895,East Badda (Rupnagar),Haji Nawab Ali Road, Badda, Dhaka',NULL,1610,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1610/certification/ohKYxD5pXc9FmbyJ15Vyr4vBDvibQUDLLrcT0MsG.jpeg','Bangladesh','11',10,9,'01534942922','75','2003-02-10','mohitul155@gmail.com','https://www.facebook.com/mohitulislam.arabi.3','1','1','1','+8801534942922','mwr966@gmail.com','Mohammad Abdul Malek Miah',NULL,NULL,'Gov\'t. Service',NULL,'1',NULL,NULL,'ISLAM',NULL,'01670884906','snaher848@gmail.com','Shamsun Naher',NULL,NULL,'Teacher',80,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1610/student_photo/VgYistwwylOhn7mLjE31FT9GHYCSyfBIP6UIE1AZ.jpeg',NULL,'1212','2','New York','Gulshan, Badda, Dhaka','Badda Alatunnessa Higher Secondary School','2019-11-27 06:43:20','01911-579356','male',NULL,'Badda','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1610/marksheet_previous/s2brrxhrwlhEbuRzCGSu6SeILagqKGvpdxsd9dJJ.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1610/marksheet_previous_two/bfWiVfzVOSrG1PZcTkX1pzIUXdXPf968jDfXIkqp.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1610/marksheet_current/noo79tz2jF02oLDj0EvMYFkqmgMpUqdVRqfrQ3ar.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-12-01 05:45:51',NULL,1,1,NULL,NULL,'EB0403651','2024-09-07','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1610/student_passport/VR3mlPkWu4dJaOxt9bpIIjznfSY0AbbrPIdQ7j37.jpeg','Dhaka',2,'2924703126551',600000,2,'2924703126552',240000,'Dhaka, Dhaka',1212,'Badda','Shamsul Alam','+880 1914-247228',NULL,1,NULL,1,NULL,'I want apply for K-L YES  program. Because I know USA is a developed country in the world . For study, I can say that some specialization courses in management,science and technology are taught better in USA. Moreover, Foreign education also gives international exposure to the students which helps them when they start their professional life.','Yes, I wish to share our culture with my american relatives.I shall discussion to them about my traditions, festivals and celebrations. I show them our cultural videos contents through internet, facebook and other social media.\r\nThe Culture of Bangladesh is intertwined with the culture of the Bengal region. It has evolved over the centuries encompasses the cultural diversity of several social groups of Bangladesh.Cultures of Bangladesh are composite over the centuries have assimilated influences of Islam, Hinduism, Buddhism, Christianity.There are many festivals and celebrations contains in our culture and traditions.For example:Eid ul-Fitr,Eid ul-Adhha, Pohela Boishakh,Language day, Durga Puja, Christmas Day etc.',1,'Newspaper',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1610/school_seal/cRf1JzFU3dY0lXldmY63RlJJyXU75hYtP3d628iM.jpeg'),
