	(362,'Md.Sakif',2,0,NULL,'Dinajpur, Rangpur',NULL,19,'In the past I have participated in couple of projects like a year ago with the help of my friends and Schools fund we had purchased couple of clothes and blankets and donated them to the people who live spend their whole night in railway station and pavements.Road accident is now a regular happening in Bangladesh.In the recent times a protest was made by the school students to execute New traffic rule I was also a part of that protest.The most Satisfying thing is that the government of our country have taken initiative to execute New traffic rule after our protest.\r\nIn the future I want to do something for the third gender.The third gender people of our country is totally ignored by the public.They are also human being like us so why this discrimination?First of all I want to change this poor mind set of our society.Secondly I want to do something for them which will help them to establish themselves by their own and live in the society with full right and respect.',NULL,'Munshipara,Dinajpur',NULL,1618,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1618/certification/tP7SyVHTLAc5jIdDHWAzdHcxUPZub4etDHDcDUUu.jpeg','Bangladesh','10',9,8,'+8801835166742','94','2004-07-17','sakifalhasan18@gmail.com',NULL,'1','1','1','+8801835166742',NULL,'Md Matiur Rahman',NULL,NULL,'Engineer',NULL,'1',NULL,NULL,'Rahman',NULL,'+8801879986453',NULL,'Nasima Begum',NULL,NULL,'House wife',91,89,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1618/student_photo/auFVWDSr9MXCJZ0aWI5Mlkf3iT7D4It4PeUItWce.jpeg',NULL,'5200','1',NULL,'Mission Road,Dinajpur','Scholars International School and College','2019-11-27 06:43:20','+8801788191778','male',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1618/marksheet_previous/bptuZHBCTp1alQCOv9Y8fU1R4IFjFqacdLe9M5E1.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1618/marksheet_previous_two/LEpMAz8MRyMeQBKefyZtu9KOCR4M6GUphKSUmhnn.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1618/marksheet_current/3OxnIRqhc0zqrAQppoZ8t3FAsVYgp6WEfLrLyiiF.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:26:16',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dinajpur',1,'1452242587',600000,2,'7752243977',-1,'Dinajpur, Rangpur',5200,'Kotwali','Md Sadekul Kabir','+8801920900800',NULL,1,NULL,1,NULL,'Bangladesh is a developing country.It\'s age is now Almost 48 years old yet most of the people around the globe doesn\'t even know that there is a country named Bangladesh.So I want to uphold my country and it\'s culture infront of the people of all ages and of different nations.To accomplish this desire of mine I feel I can\'t get any other best opportunity rather then participating in yes program.','Our country have varieties of culture and tradition.First of all I would like to share our countries different types of festivals espicially about Pohela Baishakh which is celebrated across Bangladesh with great enthusiasm.The mother tongue of our country is Bengali but this language is almost unknown to most of the people outside Bangladesh,so I want to share and spread our mother language among all and provide them the detailed information about how hard the language martyrs of our country fought and sacrificed their lives to make Bengali as our mother language.\r\nMy wish is to uphold almost all our countries culture and rituals infront of the foreign people and invite them to visit our country and and experience it\'s varieties of culture and tradition and make themselves a part of our different festivals and make it more illuminating.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1618/school_seal/UjaZyKUBemFSyOU2MOmc1lMsJjeP0CDUnNPgXvlH.jpeg'),
	(363,'Abdur Rahman',2,0,2,'Khulna, Khulna',NULL,19,'If I get a chance to participate or host a community service in future, it would be an honor to do my best and help my community by any means. Humans are social being. They cannot live alone by themselves. In our society we help each other and live a good life. So community service is a must for everyone weather you do it secretly or openly. So it would be a great pleasure for me to help my community by any type of services.',NULL,'16/1, 30 Mujgunni Uttar Para, Khulna',NULL,1619,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1619/certification/2uBgYcbk60Pu94lfn585Vg5vJsazL6SAFrWtOOq8.jpeg','Bangladesh','11',10,9,'01705808866','85','2003-11-23','abdurrahmanjawad23@gmail.com',NULL,'1','1','1','0097430130731',NULL,'Abu Bakar Siddik',NULL,NULL,'Foreign Employee',NULL,'1',NULL,NULL,'Jawad',NULL,'01705808866','abdurrahmanjawad23@gmail.com','Minu Siddika',NULL,NULL,'Unemployed',85,85,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1619/student_photo/PAO2vFow1DEuCVGkxiLVZ0Vp1jDOOMK1yNCAHIHx.jpeg',NULL,'9000','1',NULL,'Sailor\'s Colony Goalkhali, Khulna','Navy Anchorage School and College Khulna','2019-11-27 06:43:20','01730305067','male',NULL,'Khalishpur Thana','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1619/marksheet_previous/slmGIaXwkiI28oqUPtmjpVZyjFXdjZH8stcAASBW.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1619/marksheet_previous_two/ZYb1B6hF3ohLsBHhs2KRnVGHqcGxqof8UBh0iqyD.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1619/marksheet_current/nEktSIaxjyg1vARkD3eEp1OXvjA3MrTlb1UfnwIe.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:36:25',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Khulna',2,'not available',150000,2,'0116059818882',-1,'Khulna, Khulna',9000,'Khalishpur Thana','M Ruhul Amin Sarkar','01730305067',NULL,1,NULL,1,NULL,'It would be a great pleasure to share about our culture to those who does not have any proper idea about it. And also I am eager to learn about the US culture which in which I think we are having a misunderstanding about their thoughts and stuff. Participating in social services and helping a new community is also one of the reasons.','Language, clothing, religion,  food habits etc mainly varies us from the American people. So I would like to tell them all about it. It would not be much harder for me as I was raised here, I can describe and show a model of our country and place it in front of the world. I would like to share how we dress, how we speak, which religion we follow and what occasions do we celebrate and so on. There is going to be a lot of time and I am going to utilize it properly.',1,'Other','The American Corner Khulna',2,'2019-11-23','2019-11-22',1,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/239/file/MMkyvRWHfZWcOt2x0fGZ7jDRbA7kMpWQZz0XJrud.pdf',NULL),
	(364,'Sheikh',2,0,NULL,'Munshiganj, Dhaka',NULL,19,'I have done quite a number of community services in the past years. I helped with the recycling program twice, participated in some tree plantation programs, joined an operation to give warm clothes to the poor twice and besides that I participate in the cleanup of our school area every month. I want to organize a community service project in the future for raising the awareness to combat climate change. Many people are unaware of it\'s impact. As a result, we are going towards an uninhabitable earth. I want to grow awareness in people about this matter which might take a form of a devastating disaster in the future. So, I want everyone to be aware of their responsibilities of securing an inhabitable earth for the future generation.',NULL,'Champukdi, Ichhapura',NULL,1620,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1620/certification/mYqDzgt9ak8YCUIxgGmy4QlALIaV3Nu6hLfM5QeD.jpeg','Bangladesh','9',8,7,'01727619684','80','2004-07-25','sheikhsamin05@gmail.com','https://www.facebook.com/saad.samin.7','1','1','1','01711276245','sheikhamin991@gmail.com','Sheikh Amin',NULL,NULL,'Teacher',NULL,'1',NULL,NULL,'Samin',NULL,NULL,NULL,'Sanjida Akter',NULL,NULL,NULL,85,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1620/student_photo/aiSzesF4XIivFYTfDjmRNWobf503ofXPP88oIZyH.jpeg',NULL,'1542','1',NULL,'Ichhapura','Ichhapura Goverment Model High School','2019-11-27 06:43:20','01309111171','male',NULL,'Sirajdikhan','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1620/marksheet_previous/pOVydJX1PUe3xojryUn54GueqUcAeF05zQ0B3yzx.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1620/marksheet_previous_two/8MswYNw9HudePfu8RT8Fj4JVsIFZydTkczEI1kkM.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1620/marksheet_current/PSTietoJLdkllBaIFDlXqwJlhe4Ewrjnmscalasv.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:27:44',NULL,1,1,NULL,NULL,'BE 0837543','2020-03-09','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1620/student_passport/kzbcPhRqQekpz7EtBABrapL5HRElc0uYmlcIvt8X.jpeg','Munshiganj',2,'59174400534444',600000,1,NULL,-1,'Munshiganj, Dhaka',1542,'Sirajdikhan','Mohammad Nasir Uddin','01913218448',NULL,2,'India for vacation.',1,NULL,'I want to learn about the culture of United States and share my culture with them. Today\'s world is a global village, and I think that in order to get connected with the global community we have to share ideas about each one of our cultures. That\'s why I want to share about my culture in order to become an active global citizen. Science is my favorite academic subject, so I want to build a network with people from all over the world to gather information about this subject in order to satisfy my thirst of knowledge. I want to enrich myself through communicating with various kinds of people across the globe and become a youth ambassador of Bangladesh.','I wish to share every aspect of Bangladeshi culture possible. Starting off with our history of independence and liberation war. Then about our rural culture. Following up with our clothes and hobbies and what we mostly do in our free time. After that I\'ll tell them about our language, Bangla. Then I would like to share about our local food. There are still a lot more aspects that describe Bangladeshi culture, I\'ll try to share as many as possible. I wish to share all those things in person. I think making a presentation with the right footage and sound is the best way to share something. It helps a person understand things easily. I would make presentations about each one of those aspects which I mentioned above. I also want to talk with them about my culture in a form of story. That way learning about our culture will be more entertaining and interesting. At last, I want to give some gifts to the people I\'ll meet, gifts that represent my culture, I hope it will make them happy.',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1620/school_seal/IKD6tBYtgsi4Ie12W885xvmL5YqjzzusbgP1kbAQ.jpeg'),
	(365,'Abdullah Islam',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I will communicate with people for change our environment by planting trees.Because now it is very essential to save our planet.',NULL,'House-70,road-4,block-e,kalshi,mirpur-11,Dhaka-1216',NULL,1625,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1625/certification/w9grsL1CpuzvAN4pmf3MnzrKNI7KKN6aR8D0Ehz3.jpeg','Bangladeshi','11',10,9,'01911859030','70','2004-03-19','anikislam4070@gmail.com',NULL,'1','1','1','01713049172',NULL,'MD Faridul Islam',NULL,NULL,'Service holder',NULL,'1',NULL,NULL,'Anik',NULL,'01846888166',NULL,'Jesmin Islam',NULL,NULL,'Service holder',75,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1625/student_photo/FbtNeRD6jmmnDrJmjF5OF0EFFWpOqdtNgJztPuz2.jpeg',NULL,'1216','1',NULL,'111-6,road 13 ,block-c,section-6,pallabi,Dhaka-1216','Mirpur Bangla High School and College','2019-11-27 06:43:20','02-9000264','male',NULL,'Pallabi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1625/marksheet_previous/5DWDveN5m2jGd3nU9O2ctI5HysFihOwxM874bycb.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1625/marksheet_previous_two/W92E5PPdwvNCexYrWNI1tuNsjWm6VC7d7Lzk1rd6.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1625/marksheet_current/jDpd3bd8H6uWEgje9q01NVVzAcmlQlwrF7QvbNmX.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:29:10',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'239 091 0707',120000,2,'149 088 1099',120000,'Dhaka, Dhaka',1216,'Pallabi','MD Kamal Khoshnobish','02-9000264',NULL,1,NULL,1,NULL,'To study for fulfilling my dream','I wish to share our cuisine with my american family.Because our cuisine is exceptional from other nations.Also I love Bangladeshi foods.I will talk to them and try to cook Bangladeshi foods for them....',1,'iEARN-BD Website',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1625/school_seal/Hzx2Z4K60RKaZJI7J8pDCdDJemXHqKjRIb3xM0pP.jpeg'),
	(366,'Nusrat Jahan',2,0,NULL,'Dhaka, Dhaka',NULL,19,'I don\'t have any experience of participating in a community service project in past.But i would like to have such an opportunity.If I get any opportunity like this,I will render my  service as a voluteer and will bring a specific positive change through my service.\r\n      I will make a team of voluteers like me and with their help,I\'ll educate the underprivilaged childrens of my society.\r\n      If any crisis arises in my area,I\'ll come forward to provide help and will encourage others to do so.\r\n      I\'ll make my friends and neighbours aware to not to pollute our surroundings and  motivate them to plant saplings around our houses and schools.\r\n     I\'ll help my school to organize any kind of festival as a volunteer and I believe, my actions will get a specific positive change in my community.',NULL,'1/13 Kha,Tali Office,Sikder Real Estate,Hazaribagh ,Dhaka',NULL,1628,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1628/certification/yItuuXlZRlbnpYcnDxFQQpwFi4WYXDfEccVwqaJ3.jpeg','Bangladesh','9',8,7,'+8801682716592','74','2004-10-26','nj177830@gmail.com',NULL,'1','1','1','+8801628683305','n.n.n.hira@gmail.com','Md. Hira Madbar',NULL,NULL,'Service Holder',NULL,'1',NULL,NULL,'Amrin',NULL,'+8801682716592','ataslima063@gmail.com','Taslima Akter',NULL,NULL,'Unemployed',79,84,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1628/student_photo/m53RGy4ZKmkt3X1eTIt7nvgyltZ0QxiJpqE3yHXl.jpeg',NULL,'1209','1',NULL,'School House No.4/1,Road No.11/A','Dhanmondi Govt Girls High School','2019-11-27 06:43:20','+880255000339','female',NULL,'Hazaribagh','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1628/marksheet_previous/l5zoaapBj9z5Gg9ewKRv1UZIGNG5fWknVq5D28XS.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1628/marksheet_previous_two/W7mvOcWHAkLcbWzuswo0G6x8NaPikjUkgyL2b4MC.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1628/marksheet_current/AeQlBf5Sfiz4XI3o9uIWDkyRk3bJQ6GIIcjyq16T.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:30:27',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dhaka',2,'3293692442',300000,2,'5546065920',-1,'Dhaka, Dhaka',1205,'Dhanmondi','Del Mahfooza Hossaine','+8801741117076',NULL,1,NULL,1,NULL,'I want to apply for YES program because I want to uphold my country,It\'s culture,tradition, values,heritages and other aspects in front of the mirror of world view;as a representative it will be an honour to me.YES program will help me to get an exchange in me.I will be able to exchange my cultural conventions,customs, food habit etc with Americans and on the contrary,I will get a chance to adopt their lifestyle and culture.I will be able to improve myself by receiving their skills,learning and leading styles,manual suchness etc and I think after coming back to my country,I\'ll be capable of developing my country by circulating their skills and styles in my country and its people.Thr activities of YES program will make me courageous,sturdy minded,friendly,skillful,efficient,soft from heart and the storehouse of my knowledge will also develop into a new level.As well as I\'ll get a new world,family,friends,cultures besides my country will be known and its admirations will increase to all.','I would like to share my cultural aspects,firstly my language to my American family.My mother tongue is Bengali which is the only International Mother Language in the whole world which was gained by the Language Movement in 1952. I would like to interpret my family about its history.\r\n     Cuisine is another aspect of my culture.Bangladeshi cuisine is ecstatic and delicious for spices and masala.I will make a few homemade Bengali dishes like Pitha\'s,sweetmeats for my American family.\r\n      Clothing and religion are another.I will present a few traditional dress to my family like Saree,Panjabi,Lungi etc and tell them about the primary religions of bangladesh.\r\n       I will tell them about the festivals of Bangalees and how we celebrate them.\r\n        Like this i will represent my cultural aspects to my American family so that they get a clear and vivid knowledge about my country and its culture.',1,'A YES Alumni Member',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1628/school_seal/SNKBLGaJM7RRTIffi9YIDJS1h9n7wkIXau1hItCw.jpeg'),
	(367,'Nusrat Jahan',2,0,NULL,'Dinajpur, Rangpur',NULL,19,'Nowadays most of the youth are getting more serious about the social service.And I personally think that it feels good when we help others,it gives us relief.\r\n\r\nI have participate couple of times in a social service.In my area there is a old-age and orphanage.They are so good.I went in oldage for once with my school teacher and friends.They became emotional when we got there.As a honour we gave them some money and cloths.\r\n\r\nIsheka Agarwal was a candidate in this program.With her in 2016 July 5 we distribute some old and new cloths in a nearby station.We gathered old cloths and some money to buy new cloths.',NULL,'Rajbati',NULL,1629,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1629/certification/XfqTzoEarf24VkNsZWVeNFIskruHOhDCJCAmfRsJ.jpeg','Bangladesh','10',9,8,'01319879149','89','2004-07-09','angelasiscdjan2020@gmail.com',NULL,'1','1','1','01726538344',NULL,'Md Abdus Salam Chowdhury',NULL,NULL,'Border Guard Bangladesh',NULL,'1',NULL,NULL,'Angela',NULL,'01319879141','nupajannat11@gmail.com','Nur-A-Jannat Nupa',NULL,NULL,'Unemployed',79,90,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1629/student_photo/M9sEYOfiPZ2XfPUY6rdSXMsNUFVJzO4dffMTe1Al.jpeg',NULL,'5200','1',NULL,'Mission Road','Scholars International School and college','2019-11-27 06:43:20','01788191778','female',NULL,'Kotwali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1629/marksheet_previous/NGOYvfgMjxshZizGREsY0tKRdv9PrkyY5qFyB9mO.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1629/marksheet_previous_two/EG030V4WuXUjUpFQmkitkJhvsi6zPmuvd1dVhqvN.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1629/marksheet_current/PN4gTYVOByjB2DFjI5ZzLgRvNMRA6VwNhkLdhdbm.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:31:43',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Dinajpur',2,'3716559467',216000,2,'5952087202',-1,'Dinajpur, Rangpur',5200,'Kotwali','Md Sadekul kabir','01920900800',NULL,1,NULL,1,NULL,'YES program is not only just for improving English.I think it\'s a platform to establish ourselves into better person.One of my reason is to overcome my fear while delivering speech in stage.While giving speech my hand gets cold and I literally start to shake.I just can\'t handle the situation.\r\n\r\nAnother reason is when I talk with others(whom I know for short time or new people)I become nervous. it\'s not like I totally can\'t talk but I hardly express my feelings.I am like shy type person.I want to be more confident.I really want to express my feelings towards people without being nervous.I want to discover new things about me in a fruitful way.','Bangladeshi culture is quite interesting.So there is a lot to share with my American family. The people in Bangladesh generally speaks in Bangla,means official language is Bangla.So if I get chance I can help to teach them Bangla. I hope they will also enjoy it.\r\nBangladesh is a Muslim Country.In Bangladesh the major religion is islam.Other than that there are Hindus, Christians,Buddhist. People of every religion in this country live in relative harmony. Everyone is free to celebrate their own religion.\r\nThe people in Bangladesh are so emotional,understanding,protest about wrong things and example of this is the poets in Bangladesh.The poets in Bangladesh  like Rabindranath Tagore and Kazi Nazrul Islam are the most famous writer.Not only these two there are many more.So I can read it out their poems.There are also some English books written by this writers.\r\nA typical Bangladeshi meal is beef,mutton,fish, egg,vegetables cooked in a hot spicy sauce with mustard oil,yellow lentils(dal).',1,'My High School/Teacher',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1629/school_seal/eG7fIVmHDhZkdXrn4sFzIadLiydmLlm2SfVeiVlJ.jpeg'),
	(368,'Md. Shahnawaj Islam',1,0,NULL,'Narayanganj, Dhaka',NULL,19,'Man is a social animal. He cannot live alone. Society provides all comforts and necessities of life to man. Man has an obligation towards the society. Especially, it is the duty of the students to do social service to others. Students have no worries about earning their livelihood. They have strength and capacity. Eighty per cent of our population lives in villages. Students should go to the villages and serve the villagers during vacation. Villagers are illiterate, innocent and ignorant about their rights and responsibilities. Students can provide help to these people. They can also help people when there are earthquakes, famines or epidemics. Students should not waste their free time in watching movies or leading a dull life. They should do some kind of social service.',NULL,'597/1, Bandar Bazar, Bandar, Narayanganj',NULL,1632,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1632/certification/sQhEpkzysnBmKNtz6sVovMc6y7qTCagv5DZhIlwb.jpeg','Bangladesh','9',8,7,'+8801934493040','75','2005-02-23','marufahammad30@gmail.com',NULL,'1','1','2','+8801715223318','marufahammad30@gmail.com','Md. Anowerul Islam',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Anas',NULL,'+8801934493040','marufahammad30@gmail.com','Shahinor Begum',NULL,NULL,'Housewife',78,75,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1632/student_photo/trY0RRbYPTlpg6MngQf552kjLHvYu6QI5zeWw2cE.jpeg',NULL,'1410','1',NULL,'98, S S Shah road, Bandar, Narayanganj','B M Union School & College','2019-11-27 06:43:20','+88027661003','male',NULL,'Bandar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1632/marksheet_previous/s7wU3JXNl6fA5qA3UglBC3wFhgBPDILsKKdG5lfG.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1632/marksheet_previous_two/qXIfi7TOQOnB7SZKN2vEi2nuntOXedWOIi3H4fDQ.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1632/marksheet_current/7dpTMlo8vIwjshT6VxD93RZhtIJHoXkUPoysNy5a.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 21:33:27',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Narayanganj',2,'5099668955',180000,2,'6710427876462',-1,'Narayanganj, Dhaka',1410,'Bandar','Md. Azizur Rahman','+88027661003',NULL,1,NULL,1,NULL,'The program is funded by the U.S. Department of State, Bureau of Educational & Cultural Affairs (ECA) to provide scholarships for high school students from countries with significant Muslim populations to study for one academic year in the United States. YES students serve as youth ambassadors of their home country, promoting mutual understanding by forming lasting relationships with their host families and communities. Participants live with a host family, attend an American high school, acquire leadership skills, and engage in activities to learn about U.S. society and values; they also help educate Americans about their home country and culture.','The people of Bangladeshs way of life make up the culture of Bangladesh. The country has a diverse culture that has evolved over time with influences from diverse social groups. Bangladeshs primary religions, Islam, Buddhism, and Hinduism, have played a critical role in influencing the countrys culture. Development of the Bengali culture proliferated in the 19th century and part of the 20th century during the Bengal Renaissance, with renowned Bengali writers, scientists, filmmakers, musicians, artists, and researchers playing a critical role. This culture manifests in the nations dance, music, literature, architecture, and even clothing.',1,'Newspaper',NULL,2,'2019-11-23','2019-11-22',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1632/school_seal/nJzE5J4VgxgEFo9UOlN3WB8xzBTOEqMn74kDd7jJ.jpeg'),
	(369,'Md. Jubaear',2,0,NULL,'Rangpur, Rangpur',NULL,19,'To be frank, I didn\'t get any opportunity yet to be a part of any community service but I want to. I want to start with setting up a library in my village. I know that many dreams remain unfulfilled due to lack of opportunities. I want my village students to take part in those competitions, from which I have seen the changes in me. It is not possible for all to buy books and other instruments for the competitions. This is why I want to set up the library. From my library, every year motivational seminars, workshops on science and arts will be arranged. These will inspire the village students to dream different from others. Gradually, I will try to extend my library work in different places. I want to do another thing. I want to find the transgender children from different parts of my country and will connect them with the libraries. I will do my best to give them all the opportunities that every normal child gets and will try my best to make a secured environment for them.',NULL,'Pirganj house, RK Road, Ideal Mor, Rangpur',NULL,1641,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1641/certification/sXQg3lu0LqqQ8GRsMiQ0bBqkUmaxMbVDadY1n28F.jpeg','Bangladeshi','10',9,8,'+8801920593781','80','2004-02-01','arajasmin47@gmail.com',NULL,'1','1','1','+8801815270183','arajasmin47@gmail.com','Md. Habibur Rahman',NULL,NULL,'Lecturer',NULL,'1',NULL,NULL,'Rahman',NULL,'+8801920593781','arajasmin9@gmail.com','Jasmin Ara',NULL,NULL,'Senior Cataloguer (BRUR)',78,74,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1641/student_photo/EOqnEb3NrOwLNnQuJc2Jvjz1MkSIyWHrfAjIrUne.jpeg',NULL,'5400','1',NULL,'Medical Mor, Rangpur','Cantonment Public School and College, Rangpur','2019-11-27 06:43:20','+88052163051','male',NULL,'Kotwali Thana, Rangpur-5400','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1641/marksheet_previous/BgqBZNcs6O5ab2p0TRFWzZxxn5bXdXLxz9ngCkDX.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1641/marksheet_previous_two/0nB9aEZM76UPIgxTFna6CXbldZyZGol2JFSvzT8S.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1641/marksheet_current/g97WSeA8uQ5tImOMZKEvMIWqTrI1vP6EEEdVFqpF.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,'BY0467557','2024-01-05','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1641/student_passport/bEbgAD5Nvj2GrjMEdM88HRx2NjM2VC49TGXP17li.jpeg','Rangpur',2,'8517682600433',348000,2,'8517682600434',431000,'Rangpur, Rangpur',5400,'Kotwali Thana, Rangpur-5400','Col Kazi Shamim Hasan','+88052163051',NULL,2,'India, for travelling and treatment',1,NULL,'I would like to share some story of my life. My habit is to think about people and science. I used to live in a village. Math was my favorite. Later on, my parents shifted to town only for my study purpose. When I was in class six, I took part in Math Olympiad and stand 1st runner up in the regional round. As I was one of the youngests of my category, after the national round, I got an offer to participate in National Math Camp, which was the turning point of my life. I came back with a dream which was totally different from my fellow brothers. From that incident, I want to study in one of the worlds top 100 universities. I started to give more emphasis on science and science based competitions. These competitions have made a big change in me. I also want to work with UN so that I can involve myself in removing world\'s big crises related to people\'s suffering. For these causes, I am interested in applying KL-YES Program as I know that this program will help me to touch my dreams.','A lot of Americans think that we, the Muslims, show extremist attitude by religious controversy. So, I would like to uphold the religious side of my culture to them first. I will make them understand how secular and cordial we are, through our cultural examples. I will tell them about our religious festivals and also apprise them that whatever our religions are, we participate and arrange all types of religious festivals together and share our happiness with our other religions friend and relatives. I will join in my American host familys religious festivals and tell them to do so. Next, I will introduce them with our food habit, our festivals and our seasonal pithas, clothing and embroidery. I want to give them special gifts like Nakshi Kantha, Jamdani Shari. I will introduce them with my language. I will tell them how it is related with our life and cultural history. Thus, I will try my best to represent my culture to them and to be a part of them and their culture.',1,'A YES Alumni Member',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1641/school_seal/lGajsNEro7vKPyROFe9zqBTp8bXDWGcUKdA24o6N.jpeg'),
	(370,'AYSHA SIDDIKA',2,0,NULL,'Bogura, Rajshahi',NULL,19,'At present,I had not work in social service. If I get any opportunity.Then I will bring a specific positive change in my community through by expanding women\'s education',NULL,'Vill- Pathan Mirzapur,P.O-Deogrm 5881,P.S.- Nandigram. Dist-Bogura.',NULL,1655,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1655/certification/OfMFQdXleTtd9xAsZmHkGAt31XYUY4WHIn1scKpk.jpeg','Bangladeshi','10',9,8,'01742217529','96','2004-12-30','mayshas2004@gmail.com',NULL,'1','1','1','01730720224',NULL,'MD. ANOWAR HOSSAIN',NULL,NULL,'Day labour',NULL,'1',NULL,NULL,'AYSHA',NULL,'01725630753',NULL,'MST. AKLIMA AKTER',NULL,NULL,'House wife',87,100,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1655/student_photo/uKBbywZMw3VBRnibrgLA0d5BCmyzDxmCO3vqqCn3.jpeg',NULL,'5881','1',NULL,'Vill- Pathan ,P.O-Deogrm 5881,P.S.- Nandigram. Dist-Bogura.','PATHAN A. S. A. HIGH SCHOOL','2019-11-27 06:43:20','01714843933','female',NULL,'Nandigram','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1655/marksheet_previous/XMHX06F3NehAXePaUEyfTtF3hKZPjwebvENM1N1r.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1655/marksheet_previous_two/G5y8YdK8oHvsEMosRY4vcAM30H2bVsMf88L0Ns5n.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1655/marksheet_current/5NRLsqRpoGcoTewc4MpqhcC54DRrRMxHm9EAGrxR.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Bogura.',2,'1016784934692',24000,2,'1016784934693',12000,'Bogura, Rajshahi',5881,'Nandigram','Md.Harun-or-Rashid','01714843933',NULL,1,NULL,1,NULL,'I read in class ten and a examine of s.s.c.Everyman have a dream.I have so.I want to be a engineer.I want a good study opportunity.That is why I want to apply for the YES program.','As a Bangladeshi, I lead very simple life.I would like to share my culture and tradition.Thus I share my culture with American family.',1,'My Family Member',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1655/school_seal/I7IKpinWQeVPxTXLmF84UEuq42CoX4c1KjniMmQv.jpeg'),
	(371,'Maithili Benerjee',1,0,NULL,'Dhaka, Dhaka',NULL,19,'Community service is a thing of which i have been really fond of from my childhood . I have attended many social service programme like young bangladesh, Better bangladesb. I have been associated with many social services like unicef and uniliver . But i hope to do more as I thing good has given me a privileged life so I shpuld work for the people who dont have one.',NULL,'Dhaka cantonment post office , road 2/A , building-lucid shamim, floor5th,Dhaka',NULL,1661,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1661/certification/QYMLQ9nPTMqEld3v116uR5gZe8jDqAxsy0VdXroM.jpeg','Bangladeshi','11',10,9,'01531874119','87','2001-11-16','maithili@yahoo.com','https://m.facebook.com/profile.php?id=100009891391725&ref=content_filter','1','1','1','01711721140','protanu@hotmail.com','Rabindranath Benerjee',NULL,NULL,'Businessman',NULL,'1',NULL,'@maaithiliii','Maithili',NULL,'01718004366','protanu@hotmail.com','Swati Banerjee',NULL,NULL,'Housewife',87,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1661/student_photo/q75bRFFW1rjrMD7SJbQOeADfENVWd7HoZf1WaXdi.jpeg',NULL,'1206','1','new yourk','shaheed sharoni, dhaka cantonment','Adamjee Cantonment College','2019-11-27 06:43:20','012788466','female',NULL,'Dhaka Cantonment','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1661/marksheet_previous/ttrdmqyorlZCVWVDUAzJP1gEmMF5kTjwcUFxxYnR.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1661/marksheet_previous_two/qW9h5OrDjLB9Ma8U3xqWIoGtMmuB7qrKrv7kz4l0.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1661/marksheet_current/DCcSFoFqAiCsLMB8VR9ipLNXL7TiTNfQ1HfDyIJ9.jpeg',NULL,1,'1500','study',NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,'EB0610668','2024-07-31','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1661/student_passport/XQIRpqdZhNfo20TKIOMl3qugDNqzIE4d2wcmy0GE.jpeg','Chittagong',2,'1595715438548',4000000,2,'1595715438547',10000,'Dhaka, Dhaka',1206,'Dhaka Cantonment','Mohammad Hafizur Rahman','012788466','no',2,'Singapore : travel purpose , Malaysia : travel purpose, Mauritius :travelling, Bangkok : travelling , Nepal : travelling, India: travelling',1,NULL,'I want to join YES programme as I intend to be a more developed human being. I want to know How does it feel like to be in a YES programme. I want to to live my dream which is to be in a programme like that. I want to experience the life of an regular amarican kid with an amarican family which will avail me to know the new exciting culture','I would love to make my foreign host family listen to my countries folk songs, which i have grown listening too. I will definitely introduce them to the lalon sangeet . I would love to make them imitate the lalon sangeet songs with me , I will arrange a karo ke night too \r\n\r\nI would love to cook bengali food for them  especially the sweet items like : mishti doi , roshogolla, shadhu mishty, payesh and pithas\r\n\r\nI would love to teach my host family how to wear a saari and lungi,I am sure that they will be amazed by looking at the saris and the fabrics\r\n\r\nI will show them by the documentaries how peacfully different  different religion people live together in peace in bangladesh \r\n\r\nThese are the plans for now , Hope\r\nto make more!',1,'YES Program Website',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1661/school_seal/JGtxspWDuZXAAcrr32QUmhwkvzHXgPCKNzfkorTZ.jpeg'),
	(372,'Asad Ullah Al',1,0,NULL,'Feni, Chattogram',NULL,19,'In the words of the ten sticks, the burden of one cannot be what one of the ten can do. That is why the community service program is very important. It is possible to reach a higher level of development for a family, a society and a country through community.\r\nFor example, once our society was almost a sanctuary of drugs. In the meantime, we formed a group and first of all, we unitedly unaware of the ineffectiveness of the drug, the health consequences of the drug use, the economic loss, etc.\r\nBy now they understand that the rate of drug abuse in our society has dropped to zero.',NULL,'Charsaha Bhikari, Kachari Pukur, Karamatia bazar, Sonagazi, Feni',NULL,1667,NULL,'Bangladesh','11',10,8,'+8801857630798','65','2001-06-17','bdfahad063@gmail.com',NULL,'1','1','1','+8801852152219','ibrahim.bd1974@gmail.com','Md. Ibrahim',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Fahad',NULL,'+8801681659470',NULL,'Nazma Akter',NULL,NULL,'Housewife',60,50,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1667/student_photo/UZhDx93UMqVRzxyXHhi7WZq4iX8nLp4xsL2WT5CA.jpeg',NULL,'3933','1',NULL,'Sonagazi, Feni, Chittagong, Bangladesh','Sonagazi Govt. College','2019-11-27 06:43:20','+8801741110254','male',NULL,'Sonagazi','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1667/marksheet_previous/R6B2C1aIVhE3BulrwGQu7NMjpSMfDm0QGsCeC9SQ.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1667/marksheet_previous_two/EE0phD84iHVEFaMbvpJUpixCWF6ZxyLHCE0GJ8D4.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1667/marksheet_current/RbSIBCvRhMCwhXVYKiOxSuhGrJsUGnIpIpXBajuy.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Feni',2,'2386905851',120000,2,'1933144048',-1,'Feni, Chattogram',3930,'Sonagazi','Md. Mohi Uddin','+8801741110254',NULL,1,NULL,1,NULL,'I am less familiar with the language, cuisine, clothing, religion, etc. of our country. The language of each country is in accordance with the customs of that country. The importance of language to adapt to a country\'s agricultural culture is unacceptable. As such, I will build relationships with American speakers through language culture.','Bangladesh is a poverty-stricken country. As such, there is a lot of heart in Bangladesh for higher education. With this age-old education not being modernized with the world, most of our students have failed to get higher education. I recently learned through the \"iEARN-BD Website\" that I am interested in applying to the YES program.',1,'My Family Member','Through Uncle',2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1667/school_seal/1PYiQqhtEhjnNOGXeQRHvE3dqZBAEILjsjdTAmr0.jpeg'),
