 Dhaka',1207,'Tejgaon','BrIgadier General Kazi Shameem Farhad','+8801713131670','21.03-22.04, 2014, New York',2,'UK, France, Malaysia, India',1,NULL,'My main purpose of applying for the YES program is adopting the unique culture of USA. Also I want to share my culture and cultural activities with the Americans.','I mainly want to share the cultural activities like the festival of Bengali new year, \'Nobanno(Peddy festival)\', mother language day, victory day, Independence Day etc. I want to share some religious festivals too.  Like the Eid Ul Fitre, Eid Ul Adha etc. Also I can cook some Bengali foods by which I could share the Bengali cuisine. Sharing the hospitality of the Bengali people is also on of my wishes.',1,'A YES Alumni Member',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1695/school_seal/GXGmbvSUtCWuU6f1ltVojydULG8twijtEMaytK68.jpeg'),
	(381,'Md. Shariur Islam',1,0,NULL,'Narayanganj, Dhaka',NULL,19,'Man is a social animal. He cannot live alone. Society provides all comforts and necessities of life to man. Man has an obligation towards the society. Especially, it is the duty of the students to do social service to others. Students have no worries about earning their livelihood. They have strength and capacity. Eighty per cent of our population lives in villages. Students should go to the villages and serve the villagers during vacation. Villagers are illiterate, innocent and ignorant about their rights and responsibilities. Students can provide help to these people. They can also help people when there are earthquakes, famines or epidemics. Students should not waste their free time in watching movies or leading a dull life. They should do some kind of social service.',NULL,'597/1, Bandar Bazar, Bandar, Narayanganj',NULL,1696,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1696/certification/6up5dV023pjVzjadkCTne8FSoWlJBEkTE2McvM9N.jpeg','Bangladesh','10',9,8,'+8801715223318','70','2004-01-13','anowerul18@gmail.com',NULL,'1','1','2','+8801715223318','anowerul18@gmail.com','Md. Anowerul Islam',NULL,NULL,'Business',NULL,'1',NULL,NULL,'Alif',NULL,'+8801934493040','anowerul18@gmail.com','Shahinor Begum',NULL,NULL,'Housewife',70,80,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1696/student_photo/GFYYxgfUVWBpKQ7NDw56AUz2XGOVTxAsNjSehf6F.jpeg',NULL,'1410','1',NULL,'98, S S Shah road, Bandar, Narayanganj','B M Union School & College','2019-11-27 06:43:20','+88027661003','male',NULL,'Bandar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1696/marksheet_previous/r2wcE0x5k5F8YUQJGo3K8BOjvtTiVJdbQMJ9Au6T.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1696/marksheet_previous_two/tHgRAb1zCBHtdMWnIpXOTUV2Xwnlh8JXsy1fJE51.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1696/marksheet_current/cDbrUlGldvsXYOzkS3uOYuxmIgEnnPGYDyFpyARg.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:22',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Narayanganj',2,'5099668955',180000,2,'6710427876462',-1,'Narayanganj, Dhaka',1410,'Bandar','Md. Azizur Rahman','+88027661003',NULL,1,NULL,1,NULL,'The program is funded by the U.S. Department of State, Bureau of Educational & Cultural Affairs (ECA) to provide scholarships for high school students from countries with significant Muslim populations to study for one academic year in the United States. YES students serve as youth ambassadors of their home country, promoting mutual understanding by forming lasting relationships with their host families and communities. Participants live with a host family, attend an American high school, acquire leadership skills, and engage in activities to learn about U.S. society and values; they also help educate Americans about their home country and culture.','The people of Bangladeshs way of life make up the culture of Bangladesh. The country has a diverse culture that has evolved over time with influences from diverse social groups. Bangladeshs primary religions, Islam, Buddhism, and Hinduism, have played a critical role in influencing the countrys culture. Development of the Bengali culture proliferated in the 19th century and part of the 20th century during the Bengal Renaissance, with renowned Bengali writers, scientists, filmmakers, musicians, artists, and researchers playing a critical role. This culture manifests in the nations dance, music, literature, architecture, and even clothing.',1,'Newspaper',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1696/school_seal/PG39UOdA1FZQ6npWZ7cGGcuXrYKgUrQuUYHUA1vY.jpeg'),
