4',1500000,2,'1595707316623',-1,'Manikganj, Dhaka',1800,'Manikgonj','Abdul Halim','+8801715025469','N/A',1,NULL,1,NULL,'I would like to share and exchange my culture, history,  custom, cuisine.','There are many aspects of Bangladeshi culture such as Pohela Bishakh ( Banglai New Year), Monghol Shova Jatra, Religious festival like Eid, Puja, Biju etc.\r\n\r\nI would to live share Pahela Baishakh. Pahela Baishakh or Bangla Nabobarsho is the first day of Bengali Calendar. It is celebrated on 14 April as a national holiday in Bangladesh. The festival is celebrated with processions, fairs and family time. The traditional greeting for Bengali New Year is   \"Shubho Nabobarsho\" which is literally \"Happy New Year\". The festive Mangal Shobhajatra is organized in Bangladesh. In 2016, the UNESCO declared this festivity organized by the Faculty of Fine Arts, University of Dhaka as a cultural heritage of humanity.',1,'A Friend',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1728/school_seal/NUy6o7T0as8KFcJWt28c92zzY3xT1UAX5vCloPGD.jpeg'),
