	(412,'Nabid',1,0,NULL,'Dhaka, Dhaka',NULL,19,'I have mentioned before that I love volunteering works. I am working with many organizations as a volunteer for community service/social welfare. Currently I am working with Bangladesh Scouts and WOSM for 8 years and have done many social works like cleaning our living area and school area, feeding poor children and helping them in their study, creating social awarness, helping traffic polices in their work, planted many trees etc. I also work with Volunteer of Bangladesh as a volunteer and BD Clean as volunteer and attended many community service programs and worked with them. I am also a volunteer of UNICEF. I have worked for Gender Equality and a program of UN named HEforSHE. I have created a group with my friends and we save money from our transportatio fare and tiffin money and bought foods and stationaries for the poor childrens in our area. I will continue these type of work wherever I will be in the future.',NULL,'Block:G,Road no:04,House no:14 (4th Floor),Banasree,Rampura,Dhaka-1219.',NULL,1768,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1768/certification/YyDSEgKaflyuWfEWZVyXT0jDGHucKC4FfGkHpqzi.jpeg','Bangladesh','11',10,9,'01830450578','64','2002-12-31','cocshaan.nabid@gmail.com','https://www.facebook.com/shaan.nabid','1','1','1','+8801799231936','doctorbaten@gmail.com','Doc. Md. Abdul Baten',NULL,NULL,'Retired Government Officer(Doctor)',NULL,'1',NULL,NULL,'Ahmed Shaan',NULL,'+8801819107082','shaan.nabid3@gmail.com','Najnin Sultana',NULL,NULL,'Housewife',90,100,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1768/student_photo/H5MECX5nSw8WIEoADxPPn2WmnQFc7xkJps5BK20s.jpeg',NULL,'1219','2','New York','Shaheed Sharani,Dhaka-1206','Adamjee Cantonment College','2019-11-27 06:43:20','+8802-8872446','male',NULL,'Rampura','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1768/marksheet_previous/OCGNWpwrIs7v0RfeO