	(417,'Md Muhibur Rahman Suhel',1,0,NULL,'Moulvibazar, Sylhet',NULL,19,'I have already joined some social programs.Some I have done alone and some with my friends.\r\nI have donated blood more than 6 time to my relative or non relative.I have joined in many road repairing program in our village and Neighboring village and also some \'Clean The Nature\' program.\r\nI was a Scouter in my ex school and I have joined so many social services on behalf of scouting.But after joining my new school I can\'t continue it because my new school doesn\'t have scout organization.\r\nSometime me and my friends became together help poor such like who can\'t study just for buying book,we help him by money or buying book.\r\nIf I get a opportunity of social service, I will make sure all the kids on the footpaths can studies in school.',NULL,'Tarapasha,Shamsher Nagar road,Rajnagar,Moulvibazar',NULL,1781,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1781/certification/lQ6aIFBVgT1rWJWtdKT2CY76priKzOUFomjdbQCs.jpeg','Bangladeshi','10',9,8,'+8801765712088','70','2004-01-22','msuhel56699@gmail.com',NULL,'1','1','1','01710709643',NULL,'Md. Mahbubur Rahman',NULL,NULL,'Retired Army officer',NULL,'1',NULL,NULL,'Suhel',NULL,NULL,NULL,'Died Mst. Alebun Nessa',NULL,NULL,NULL,70,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1781/student_photo/9bDfphyt2sX8pLZqSInGrQVWzfqdxWvi773D1TJq.jpeg',NULL,'3240','1',NULL,'Vocational road,Moulvibazar Sadar','Moulvibazar Govt. Technical School and College','2019-11-27 06:43:21','086163062','male',NULL,'Rajnagar','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1781/marksheet_previous/p5vFKLvIreoI9xDQlIE1TW8UgtmzXHuKOQjv8wTm.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1781/marksheet_previous_two/SQm3I9UqIGdWPWAdEnMjYCDo3yIQZkUsCSbayOVU.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1781/marksheet_current/Gr81tpbOWvAjOAlUJBDgbgaqHf9vmCUPQF5at2pZ.jpeg',NULL,1,NULL,NULL,NULL,NULL,'2019-11-29 18:55:23',NULL,1,1,NULL,NULL,NULL,NULL,NULL,'Chittagong',2,'1590698458803',100000,1,'5818021424288',-1,'Moulvibazar, Sylhet',3200,'Moulvibazar Sadar','Nurul Hakim','086163062',NULL,1,NULL,1,NULL,'First of all everyone has a dream to live in a developed country and I have also.But it is too exciting that I am getting this chance with explaining my own culture in USA.Here are the other reasons.\r\n1.I can describe my culture to them.They will know about bangladesh,our culture,our heritage.I can represent my Own country.\r\n2.I can know about American society.Then I can explore their social system in my country.\r\n3.And the most important is,I will know about American education system.When I will return to my country then I will try to change education system of our country as far as I can.Because our system of education is too wake.I don\'t know how far I can go but I will try my best.','Bangladesh has large culture.There are so many aspects in our culture.I will try to share all aspects of our culture to my American family.Here are some important aspects of our culture I wish to share:language,Bengali Lifestyle,religion-communal harmony,clothing,cuisine,heritage, architecture,Sightseeing,Music,Festival and celebrations, sports,ethnic peoples Lifestyle and culture,history of our freedom fighting and so many other aspects of culture.\r\n\r\nIn America, whenever I will see any of their rituals,program or any part of their culture, I will remember my own culture and I will express it to them.',1,'Facebook',NULL,2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1781/school_seal/XBTaVnVTfh2z2XG7v5Z64qIKoXyoP2NVx0CMyUYY.jpeg'),
