	(427,'MD. SAMI IBNE',2,0,NULL,'Mymensingh, Mymensingh',NULL,19,'From families to friendships, we share experiences and interactions with groups. Our attachments to those groups strong or weak weave the fabric of association and community. Social service is important for the benefit of the people. I did not get much chance to do social service but in some cases i try to get involved in it. I did some social services against the bad traffic rules which is wrong. Our goals was ensuresment of safe roads formulation and implementation of road safety laws and punishment of driver violating traffic rules for the beneficial for the people which is kind of social service. If I get a chance for social service. I would like to do create a hospital for the poor people for free of east. So that they can take treatment for free of cost. I also have a dream to create a school in the village, people who are illiterate; I would like to teach them for free of cost and to Help them how to overcome their problems I always love to work for the beneficial of the people.',NULL,'64/1, Aqua Madrasah Quarter',NULL,1799,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1799/certification/5fL4JMHE6krWdru3lSnZPbbqAaAo6PuTZFFHw7OP.jpeg','Bangladesh','11',10,9,'+8801707918057','80','2003-11-04','samialam504@gmail.com','facebook.com/sami.alam.75033149','1','1','1','+8801786672698','samialam949@gmail.com','MAHABUB ALAM',NULL,NULL,'Business',NULL,'1',NULL,'sami_Ibne','ALAM',NULL,'+8801914224309','sultanafs2@gmail.com','FAHAMIDA SULTANA',NULL,NULL,'Housewife',70,70,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1799/student_photo/8EUOrGmFCAEPDdQh9yNm1pYU2V3hwbj6kd8ACOZU.jpeg',NULL,'2200','1','N/A','Momenshahi Cantonment, Momenshahi.','CANTONMENT PUBLIC SCHOOL','2019-11-27 06:43:21','+8866701-8','male',NULL,'Kotawali','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1799/marksheet_previous/83N80J0EWMeQvEp5xYLHsQ3smfBsirKKNcrEjFct.jpeg',NULL,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1799/marksheet_previous_two/3s2P630H99hRre6BQy7IJJxg2MIoSEHZc0gXxqvg.jpeg','http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1799/marksheet_current/wN7l7QPItMpTvjnSmlBEY2ODmqBqK86NQK7rOzwk.jpeg','N/A',1,'0','N/A',NULL,NULL,'2019-11-29 18:55:23',NULL,1,1,'N/A','N/A',NULL,NULL,NULL,'Mymensingh',2,'2355879921',100000,2,'7781011833',-1,'Mymensingh, Mymensingh',2200,'Kotuwali','Lt Col Md Jalal Uddin','+88091-61645','N/A',1,'N/A',1,'N/A','I would like to apply for the Yes programme because I am looking forward to getting to know the American culture. Going to the USA means fulling one of my biggest childhood dreams. Plus, I want to expand my cultural horizons, make international friends and want to learn about the true American culture. Through this programme I would able to know about the tradition and can gather more experience about the new places and about the new people.\r\nI can also able to know about the society and how people behaves with others. Through\r\nthis programme. I can also share my language my clothing, cuisine etc with American people. I can also get a chance to learn something new from this programme. This programme will help me to gather knowledge and experience.','As a citizen of Bangladesh, I would like to share my mother tongue with my American family. A Mother tongue is the language that a human being learns from infancy. It is normally the native language of that person and he learns it from his parents and Other members of the family and this language that he first learns to Relate socially with other people. I will going to make them realize that this bangla language is very easy to learn and very beautiful to speak. Along with language i would also like to share my clothing style and how bengali people used to wear clothes. I would like to make them curious about the bengali tradition. I will also going to show that this style of bengali clothing we used to wear is very comfort and easy to wear. Bengali people also wear clothes in according to many occasions how we wear and what we wear, I would also love to share with them about this, I will make curious about clothing style that Bangladeshi People are used to wear.',1,'Facebook','N/A',2,'2019-11-23','2019-11-23',1,NULL,'http://connect-techynaf.s3-ap-southeast-1.amazonaws.com/yes.connect.techynaf.com/1799/school_seal/OHvxVKwnj8RaAO5KUKYQ7eBvDErJgxwuJfsVBLDe.jpeg'),
